n and save wages for permanent housing. Participants no longer struggle with life-altering addictions or behavior and are motivated to achieve independent employment.  For more information download the Mens Ministry Brochure.\n\nhttps://www.missiondc.org/wp-content/uploads/2019/07/men_programs_brochure_2019-7.pdf','726173106231202','759682631849783,754621632893339,902951823980164,945841786673442,1154397851156755,886267440482873',NULL,NULL),(36,761929300455945,'Heyman Interages Center','Program','The JCA Heyman Interages Center intergenerational programs have brought children and older adults together for 30 years. Since 1986, approximately 45,000 children and older adults in more than 100 schools and senior facilities have benefited from participation in our programs. Over the years hundreds of dedicated and caring older adult volunteers, who are the heart of Interages, have made a significant difference in the lives of children.',NULL,'1282487813090005,1147690047097756,616047069998063,993493444765030,1141624870158332',NULL,NULL),(37,777455803391753,'Housing Resource Center','Program','Our walk-in Domestic Violence Resource Clinic takes place every Wednesday from 1:00pm-3:30pm at the Westminster Presbyterian Church on 400 I St SW, DC (near Waterfront metro). With the DC Volunteer Lawyers Project and My Sisters Place, we provide victims access to housing assistance, legal assistance, and counseling.\n\nThe Housing Resource Center (HRC) is the hub of DASHs efforts to prevent homelessness among domestic violence survivors. We assist survivors in completing housing applications, obtaining safety transfers, navigating the public housing system, and making connections to community services. Survivors can conduct housing searches in our computer lab and work one-on-one with Housing Specialists.\n\nOur Housing Resource Center Online is a web-based information clearinghouse with comprehensive information on housing programs for women, including details on admission processes, eligibility requirements, and accessibility for people with disabilities.','983721114373124','1140920920771303,1195066035930824,765385785732538,577584068562238','828792720206018',NULL),(38,787691393603128,'Living with Opioid Dependency','Eligibility',NULL,NULL,'1077603109327544',NULL,NULL),(39,804517213435343,'Amerihealth','Insurance',NULL,NULL,'915711679952561,1296730701251441,599402007780126,907595418658961,822492274972082,845758882609427,1216556310653957,1180091016211141,984528775573917,586827752329383,789715981823462',NULL,NULL),(40,776053016432100,'Ages 16-30','Ages Served',NULL,NULL,'1162907800070547',NULL,NULL),(41,805633029474383,'Ages 3-5','Ages Served',NULL,NULL,'814817282883148,1219686317955585',NULL,NULL),(42,837964410196977,'Ages 6-17','Ages Served',NULL,NULL,'1296730701251441',NULL,NULL),(43,818279027974260,'Ages 16-24','Ages Served',NULL,NULL,NULL,NULL,NULL),(44,835895554702710,'Couples','Eligibility',NULL,NULL,'1120743935334776,658231090559812',NULL,NULL),(45,817072719805531,'Proof of Spouse/Dependants','Required Document','Varies from organization to organization and is only needed if applicable. Often, documentation includes:\n- Documents bearing the child\'s name and parent\'s current address\n- Apartment lease with child/spouse\'s name\n- Benefit letters',NULL,'834460550368169',NULL,NULL),(46,822271561821597,'Age 55+','Ages Served',NULL,NULL,'1280474482709655,597026276891169',NULL,NULL),(47,836091364973509,'Women','Eligibility',NULL,'909401719398962,1146223650874517','981580900656027,910692115764601,1183383601010590,1240040646031640,1139270346999526,761018228722418,679830596478752,645384002034771,1135056817241313,644648091160119,1224317983369922,1134361757901839,1248931277100420,734280780069484,1088249391392945,651504031814159,963890389048330,1076980913864779,810517634677025,1297058844905012,1188218787305496,1146566781515189,783798317190015,765387458092097,750465787434275,862423770633741,1234340144717096,590895767819582,967263158004203,97456256