906,'Mothers Ages 18-23 with Children Aged Under 3','Eligibility',NULL,NULL,'917742641898170',NULL,NULL),(70,891092215548488,'Stepping Stones (Basic Needs)','Program','United Community\'s Stepping Stones program provides critical basic needs supportive services to vulnerable families who are in financial crisis and need emergency assistance. After a client assessment and a counseling session, families in their time of need may obtain emergency food, assistance to prevent eviction and utility cut-off, as well as prescription drug assistance.','919690199169575','1311595168931297,950454120432775,1048291243097604,1298911741733382,824288922961198,1180623233814950',NULL,NULL),(71,907363295753671,'Grades 8-12','Eligibility',NULL,NULL,'908986332318967',NULL,NULL),(72,908163423675008,'Boys','Eligibility',NULL,NULL,'1070895654294162,789456565791843',NULL,NULL),(73,941503097115546,'Resident of 20010 Zip Code','Eligibility',NULL,NULL,'1185051455558186',NULL,NULL),(74,955662425502270,'Enrolled in Vocational School','Eligibility',NULL,NULL,'1171417382872545',NULL,NULL),(75,912906147241865,'Ages 21+','Ages Served',NULL,NULL,'928788698938707,1020934285482366,1077603109327544',NULL,NULL),(76,910994843667047,'Ages 5-17','Ages Served',NULL,NULL,'800132260226272',NULL,NULL),(77,930805038119118,'Ages 13-26','Ages Served',NULL,NULL,'1082503758750664',NULL,NULL),(78,976637222906895,'Maryland Resident','Eligibility',NULL,NULL,'1173963793862866',NULL,NULL),(79,983080950399519,'Ages 17-24','Ages Served',NULL,NULL,'948283799474714',NULL,NULL),(80,966756126649195,'At Risk of Homelessness','Eligibility',NULL,NULL,'573528188325499,1238532588650595,757654002604408,860779231100127,1128285304774272,1163310698125750,705771849785076,753253159497862,593910008000184',NULL,NULL),(81,937643355135162,'Trustsed','Insurance',NULL,NULL,'915711679952561,1296730701251441,599402007780126,907595418658961,822492274972082,845758882609427,1216556310653957,1180091016211141,984528775573917,586827752329383,78971598182