INSERT INTO `layout` VALUES (1,'1564172279.png','LARABLE',NULL,'<h5 helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" line-height:=\"\" 1.38;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" margin-top:=\"\" 0pt;=\"\" margin-bottom:=\"\" 16pt;\"=\"\" style=\"margin-top: 11px; margin-bottom: 11px; font-family: Roboto, sans-serif; line-height: 1.2; color: rgb(66, 66, 66); font-size: 1rem; text-shadow: rgba(0, 0, 0, 0.15) 0px 0px 1px; text-align: center;\"><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The purpose of this system is to provide a searchable and filterable directory of organizations, contacts and facilities to signed in users. </span><span style=\"font-family: Arial; font-size: 14pt; white-space: pre-wrap;\">Users can export any data about those three elements from the directory. </span></h5><h5 helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" line-height:=\"\" 1.38;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" margin-top:=\"\" 0pt;=\"\" margin-bottom:=\"\" 16pt;\"=\"\" style=\"margin-top: 11px; margin-bottom: 11px; font-family: Roboto, sans-serif; line-height: 1.2; color: rgb(66, 66, 66); font-size: 1rem; text-shadow: rgba(0, 0, 0, 0.15) 0px 0px 1px; text-align: center;\"><span style=\"font-family: Arial; font-size: 14pt; white-space: pre-wrap;\">A special class of users can also send three types of messages to contacts in the directory: email messages, SMS and recorded voice messages.</span></h5><h5 helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" line-height:=\"\" 1.38;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" margin-top:=\"\" 0pt;=\"\" margin-bottom:=\"\" 16pt;\"=\"\" style=\"margin-top: 11px; margin-bottom: 11px; font-family: Roboto, sans-serif; line-height: 1.2; color: rgb(66, 66, 66); font-size: 1rem; text-shadow: rgba(0, 0, 0, 0.15) 0px 0px 1px; text-align: center;\"><span style=\"font-family: Arial; font-size: 14pt; white-space: pre-wrap;\">Contacts can be organized into groups, and these messages can be sent to multiple groups of contacts at a single time. </span><span style=\"font-family: Arial; font-size: 14pt; white-space: pre-wrap;\">Replies to email, SMS and voice messages are recorded and attached to the message report for analysis. </span></h5><h5 helvetica=\"\" neue\",=\"\" roboto,=\"\" arial,=\"\" \"droid=\"\" sans\",=\"\" sans-serif;=\"\" line-height:=\"\" 1.38;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" margin-top:=\"\" 0pt;=\"\" margin-bottom:=\"\" 16pt;\"=\"\" style=\"margin-top: 11px; margin-bottom: 11px; font-family: Roboto, sans-serif; line-height: 1.2; color: rgb(66, 66, 66); font-size: 1rem; text-shadow: rgba(0, 0, 0, 0.15) 0px 0px 1px; text-align: center;\"><span style=\"font-family: Arial; font-size: 14pt; white-space: pre-wrap; color: inherit;\">Thank you.</span></h5>','We can help you create a directory like this for your organizations.','Contact Us','mailto:info@openreferral.org','<p style=\"text-align: center; \"><font color=\"#1f497d\" face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px;\">LARABLE</span></font><span style=\"color: rgb(31, 73, 125); font-family: Calibri, sans-serif; font-size: 14.6667px;\">&nbsp;Resource Guide - dorotusa.org</span></p>','LARABLE Resource Guide','dorotusa.org','LARABLE Resource Guide - dorotusa.org','0','1','0','#3e50b4','#14b2cf','#11ceda','#17a5b8',1,'South Dade Only','All Services','1577102338.png','1577102281.jpg','0','<p>Welcome! This is the login page.</p>','<p>Welcome! This is the register page.</p>',1,'Services (ex. larable-dev.sarapisorg)',0,0,0,0,0);
