INSERT INTO `organizations` VALUES (1,572890347249315,'St Anthony of Padua Church (VA)',NULL,NULL,NULL,'A local church offering services to community members.',NULL,NULL,NULL,'https://stanthonyofpaduacommunity.com/parish/',NULL,4,NULL,NULL,NULL,NULL,'873611419029370','1346383381421883,1138656191558408','1199654488652628','0',NULL,NULL,NULL,NULL),(2,597291118069880,'We Are Family',NULL,NULL,NULL,'Grounded in grassroots senior leadership, We Are Family mobilizes a committed corps of volunteers to reach out to isolated inner-city seniors with free services, advocacy, and companionship, building a network of caring eyes and ears that enables at-risk seniors to age in place. More than simply a social service provider, We Are Family is a bold experiment in building caring, just and inclusive community.','info@wearefamilydc.org',NULL,NULL,'https://www.wearefamilydc.org/',NULL,4,NULL,NULL,NULL,NULL,'1229834582759480','585670788788642','903036719647021','0',NULL,NULL,NULL,NULL),(3,548126332764833,'Whitman-Walker Health',NULL,NULL,NULL,'Multiple locations and services available targeted at total health and wellness.',NULL,NULL,NULL,'http://whitman-walker.org',NULL,4,NULL,NULL,NULL,'','684439431487008,1194108716776364','1226809070395519','1272844736960116','612213908439005,659954535630939',NULL,NULL,NULL,NULL),(4,562836772362344,'Association for Clinical and Translational Science (ACTS)',NULL,NULL,NULL,'The purpose of the Association for Clinical and Translational Science (ACTS) can be broken up into four realms. These four areas of focus are research, education, advocacy, and mentoring.\n\nResearch\nACTS supports investigations that continually improve team science, integrating multiple disciplines across the full translational science spectrum: from population based and policy research, through patient oriented and human subject clinical research, to basic discovery. Our goal is to improve the efficiency with which health needs inform research and new therapies reach the public.\n\nEducation\nACTS is the academic home for the disciplines of research education, training, and career development for the full spectrum of translational scientists. Through meetings, publications, and collaborative efforts, ACTS will provide a forum for members to develop, implement, and evaluate the impact of research education programs.\n\nAdvocacy\nACTS provides a strong voice to advocate for translational science, clinical research, patient oriented research, and research education support. We will engage at the local, state, and federal levels and coordinate efforts with other professional organizations.\n\nMentoring\nACTS will promote investigations and dissemination of effective models for mentoring future generations of translational scientists. Through collaborative efforts, ACTS will provide a forum for members to share studies, promote best practices, and optimize professional relationships among trainees and mentors.',NULL,NULL,NULL,'http://www.actscience.org/',NULL,4,NULL,NULL,NULL,NULL,'1123747363862749','877776396812857,1107027116589953','796479538430138','0',NULL,NULL,NULL,NULL),(5,574964812525513,'Housing Counseling Services',NULL,NULL,NULL,'Provides housing counseling services, training, and advocacy for low and moderate income homebuyers, homeowners, and tenants in the Washington Metropolitan area. Emergency Rental Assistance, Rental Housing Search, Foreclosure Prevention, Eviction Prevention, Home Purchase, Home Renovations, Tenant Counseling, Homeless Veterans Rehousing, Lead Safe Repairs, Coop/condo training, Credit Counseling, Reverse Mortgage Counseling, Housing Preservation Counseling','info@housingetc.org',NULL,NULL,'http://housingetc.org',NULL,4,NULL,NULL,NULL,NULL,'1140570813901169,627629263527494,1243832082519507,705771849785076,841132371028942,581022793280171','916077019265036,676485134262687,1178055279307047','947853021041099,1189388637168303','0',NULL,NULL,NULL,NULL),(6,592260988502497,'DC Department of Aging and Community Living',NULL,NULL,NULL,'Provides Intergenerational Programs services, including Opportunities for older adults to teach and learn from DC\'s youth.','dcoa@dc.gov',NULL,NULL,'https://dcoa.dc.gov/',NULL,4,NULL,NULL,NULL,NULL,'920928473432747','1273926928135629,1266100703604119','790873813272838','0',NULL,NULL,NULL,NULL),(7,605134586578120,'Elaine Ellis Center of Health',NULL,NULL,NULL,'Health center in DC and Maryland providing comprehensive medical services.\r\n\r\nOur History\r\nThe Elaine Ellis Center of Health was founded in 2010 by the relatives of the late Elaine Ellis, who lost her battle with cancer in 1993.\r\nShe was the matriarch of her family and a vibrant presence in her community. Her kindness and passion to serve others who were less fortunate extended beyond her family and friends to anyone who was in need of food, shelter, advice, and good conversation. Though she is unable to see the fruit which her character produced, her legacy continues, and is the driving force behind the Centers mission to serve others.\r\n\r\nMission Stament\r\nElaine Ellis Center of Health (EECH) is a Not-For-Profit Organization dedicated to providing affordable comprehensive, preventive, and primary healthcare services to individuals residing in public housing and the surrounding areas, regardless of their ability to pay. In so doing, we are committed to offering said services in a clean, safe environment, appropriate in meeting the healthcare needs of our target population. EECH also demonstrates social responsibility through the just use of resources. The commitment of our staff, physicians, volunteers, community partners and friends to our mission permits us to maintain a quality of presence and tradition of caring, which is a hallmark of EECH.',NULL,NULL,NULL,'http://eechealth.com/',NULL,4,NULL,NULL,NULL,'','565809012321458,1060160690284572','1198488947117166,695928846468418,877271835912480,899126386042540','770635363010046,1002753920993717','577518788649182,645838145603264,6