fairs Medical Center (D.C.VAMC) is among the most visible and dynamic facilities in the VA system. As a tertiary care facility, D.C.VAMC provides acute general and specialized services in medicine, surgery, neurology, psychiatry, dentistry and numerous other subspecialties. The Medical Center, part of the VA Capitol Health Care Network (VISN 5), offers long-term care treatment in the 120-bed Comprehensive Nursing and Rehabilitation Center (CNRC). It operates four Community Based Outpatient Clinics (CBOCs) and is a Veterans Health Administration test site for enhancements in the electronic medical record. The Medical Center is affiliated with three outstanding medical schools and is a medical readiness partner with three Department of Defense medical facilities. The D.C.VAMC supports hundreds of active research projects and is home to one of two VA War Related Illness and Injury Study Centers (WRIISC).',NULL,NULL,NULL,'http://va.gov/directory/guide/facility.asp?id=143',NULL,4,NULL,NULL,NULL,NULL,'989716764680602','725097943892600','1300302103708266','0',NULL,NULL,NULL,NULL),(26,659021595524966,'CONGRESS HEIGHTS SERVICE CENTER',NULL,NULL,NULL,'Provides Commodity Supplemental Food Program (CSFP) services.',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'635156280108722',NULL,'674131229606594','0',NULL,NULL,NULL,NULL),(27,617116824616756,'Nativity Shelter',NULL,NULL,NULL,'Social services provided: bilingual case managers and social workers and also therapeutic groups. All are welcome.',NULL,NULL,NULL,'http://www.catholiccharitiesdc.org/page.aspx?pid=375',NULL,4,NULL,NULL,NULL,NULL,'981580900656027','1130743087965133','890234129642572','0',NULL,NULL,NULL,NULL),(28,647276391431213,'CNCS: AMERICORPS: NCCC',NULL,NULL,NULL,'More than 1,000 young people, ages 18-24,serve on teams and address environmental projects,diaster preparedness and response,education, public safety, and other unmet human needs.',NULL,NULL,NULL,'http://nationalservice.gov',NULL,4,NULL,NULL,NULL,NULL,'62