ictions, operates a food and clothing distribution center, which provides food for over 4000 people each month, runs a camp for underprivileged children, and offers a ministry to families and senior citizens.\n\nThe Mission is continually developing its programs to meet the changing needs of the community. Its programs serve homeless men, underprivileged women, children, seniors, families and veterans.\n\nOne life at a time, the Mission works to help transform the area&rsquo;s toughest rehabilitation cases&mdash;including drug addicts, gang members, criminal offenders and the chronically homeless&mdash;into productive members of society. The Mission&rsquo;s programs have an extremely high success rate at helping individuals overcome addiction and homelessness and achieving independent living.',NULL,NULL,NULL,'https://www.missiondc.org',NULL,4,NULL,NULL,NULL,NULL,'1291599466171764,978182683421582,759682631849783,754621632893339,902951823980164,945841786673442,740916631620812,1154397851156755,886267440482873,1252264089140599,1187463498588025,1228495289369706,1265325284377461,1248912869636667,961458582690801,660868979951197,1321094180433140,908926837435227,580719808472057','842965887033119,569071299085270,1190357120409678','1287723230809141,1154195373907801,838780960881380,867745425991207,1135122975308953,835677959674778','1043054479944359','1319255723578292,800545996069324',NULL,NULL,NULL),(45,745762970824360,'SAMARITAN INNS: INTENSIVE RECOVERY PROGRAM',NULL,NULL,NULL,'Offers 3 phases of treatment for homelessness and addiction.',NULL,NULL,NULL,'http://samaritaninns.org/',NULL,4,NULL,NULL,NULL,NULL,'802536341225895','866416565083229','984550353973330','0',NULL,NULL,NULL,NULL),(46,727757843857751,'Far Southeast Family Strengthening Collaborative',NULL,NULL,NULL,'The Far Southeast Family Strengthening Collaborative works to tackle some of our community\'s toughest issues, while building the capacity of residents and organizations to do the same. The mission of the Far Southeast Family Strengthening Collaborative is to act as a catalyst to develop, nurture and sustain partnerships of residents, agencies, and institutions in the Southeast community and to create a healthy socioeconomic environment through which every child and family has an opportunity to achieve their maximum potential and to lead a productive life.',NULL,NULL,NULL,'http://www.fsfsc.org/',NULL,4,NULL,NULL,NULL,NULL,'789456565791843,910059099567277,859629175967195,1178096298000358,979536491529478,813064675400914,1299121197634961,818563649469922','932602737976044,1191551618847760','1286648129611472','0','900766491176234',NULL,NULL,NULL),(47,743525753773182,'Mayors Office of LGBTQ Affairs',NULL,NULL,NULL,'The Mayor&rsquo;s Office of Lesbian, Gay, Bisexual, Transgender and Questioning Affairs (LGBTQ) is a permanent, cabinet-level office within the Office of Community Affairs in the Executive Office of the Mayor, established by statute in 2006 to address the important concerns of the District\'s gay, lesbian, bisexual and transgender residents. The District of Columbia has one of the highest concentrations of LGBTQ residents in the country with an estimated 7 to 10% of the population being LGBTQ.',NULL,NULL,NULL,'http://www.glbt.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'605774245554167','918350012207483,688693608343237,804590542957247','1161706256775181','0',NULL,NULL,NULL,NULL),(48,744812603775568,'Quality Trust',NULL,NULL,NULL,'Quality Trust is an independent, non-profit advocacy organization focused on improving the lives of children and adults with disabilities and their families in the District of Columbia and beyond.  We work with individuals and family members to solve problems, identify opportunities for learning and contribution and find creative ways to minimize &ldquo;differences&rdquo; and make the most of each person&rsquo;s abilities.','info@dcqualitytrust.org',NULL,NULL,'http://www.dcqualitytrust.org/',NULL,4,NULL,NULL,NULL,NULL,'865253695035282,1210697117152571,1194701188927394,998912206496705,775356580769657,872625169605396,573931060003252','549594406351830','1185969381076176','6.599545356309448e50',NULL,NULL,NULL,NULL),(49,775874603891849,'So Others Might Eat (SOME) - Medical Clinic',NULL,NULL,NULL,'SOME (So Others Might Eat) is an interfaith, community-based organization that exists to help the poor and homeless of our nation\'s capital. SOME will meet the immediate daily needs of the people we serve with food, clothing, and health care. SOME also helps break the cycle of homelessness by offering services, such as affordable housing, job training, addiction treatment, and counseling, to the poor, the elderly and individuals with mental illness. Each day, SOME is restoring hope and dignity one person at a time.\nSOME offers a comprehensive network of healthcare. The clinic is located at 60 \'O\' Street, NW, and is open Monday - Friday, 8:00 am - 4:00 pm. Patients are accepted on a walk-in and appointment basis. SOME\'s Health Services includes a comprehensive Medical Clinic, an Eye Clinic and a Dental Clinic.\n\nMEDICAL CLINIC The Medical Clinic offers a full range of services including primary care, podiatry services, lab work and treatment for diabetics. The Medical Clinic treats an average of 26 patients each day.\nThe Eye Clinic is one of the only free eye clinics in the city and treats approximately 30 patients each month. SOME\'s part-time ophthalmologist treats those suffering from diabetes, glaucoma, AIDS, and eye injuries, and conducts general eye exams.\n\nDENTAL CLINIC The Dental Clinic provides both emergency and comprehensive oral care to patients, including prevention, basic care, restorations, root canals, extractions and removable prostheses (dentures). We are open five days per week.\nTo be eligible for dental care in the SOME Dental Clinic, a patient must be homeless in the District and/or low-income and living in the immediate neighborhood of our clinic. In addition to scheduled appointments, the Dental Clinic provides emergency care to the first four walk-in clients Monday - Friday.',NULL,NULL,NULL,'http://www.some.org',NULL,4,NULL,NULL,NULL,NULL,'998823719958227,1252793336729933,610721171447543,577558646630251','1328301158468902','903707682119815','0',NULL,NULL,NULL,NULL),(50,778852197302716,'Mom\'s Meals',NULL,NULL,NULL,'Offers meal delivery to a variety of qualifying clients including self-paying clients. ',NULL,NULL,NULL,'https://www.momsmeals.com/',NULL,4,NULL,NULL,NULL,NULL,'938870799038889','1217938662012922','1204227139966741','0',NULL,NULL,NULL,NULL),(51,782406976349276,'Dupont Park SDA',NULL,NULL,NULL,'Offers a food pantry and clothing closet.','dpc@dupontpark.org',NULL,NULL,'http://dupontpark.org/',NULL,4,NULL,NULL,NULL,NULL,'1145399925529779,1075486612088837','777587688446935','1197279412047011','0',NULL,NULL,NULL,NULL),(52,791950857737387,'Friendship Place',NULL,NULL,NULL,'Provides street outreach, addiction counseling, referrals, a medical clinic, psychiatric care and case management services all aimed at giving the homeless men and women in Northwest Washington assistance in rebuilding their lives by addressing their basic needs.','info@friendshipplace.org',NULL,NULL,'http://cchfp.org/',NULL,4,NULL,NULL,NULL,NULL,'621104147916374,978590256683513,647772152541651,647183151936796,1305546200651894,838774263465115,1298309949522497,615519347288251,1128282500996664,948283799474714,883344454564664,980808579975931,797815960840049,875517215179569','1235107925689722,956844133947886,1167551989292288','931886810745529,876397346396032','0',NULL,NULL,NULL,NULL),(53,727847273433183,'SOME: DINING ROOM',NULL,NULL,NULL,'Provides meals, clothes, and showering facilities for the needy. Meals are served in a main dining room, as well as a separate one for women and children.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'925880419304547','626402478477773','816964939097565','0',NULL,NULL,NULL,NULL),(54,756344334747450,'CONNECT.DC - DIGITAL INCLUSION INITIATIVE: ALL HANDS ON TECH',NULL,NULL,NULL,'Connect.DC created The All Hands on Tech initiative, in partnership with OCTOHelps, to provide FREE technical support to District of Columbia residents. One of the most important things a person needs to fully access technology is a functioning computer. Unfortunately, the cost of computer repair is often too high for many people. Whether you have a laptop with a virus or you don\'t understand how to use your smartphone, we are here to help!Visit website for current schedule of events.',NULL,NULL,NULL,'http://connect.dc.gov/free-tech-support',NULL,4,NULL,NULL,NULL,'','994280834710332','817066446192440','847472462897373','789879098577824,756653322156829',NULL,NULL,NULL,NULL),(55,782302579547834,'The Arc District of Columbia',NULL,NULL,NULL,'ARC DC helps improve the quality of life for individuals with intellectual and developmental disabilities and their families through support and advocacy. They offer counseling, family support, supportive employment opportunities, and day programs.',NULL,NULL,NULL,'http://arcdc.net',NULL,4,NULL,NULL,NULL,NULL,'977586749835410,879847524852951,1090262984895790','1228363334230136','814793229124367','0',NULL,NULL,NULL,NULL),(56,789345230945555,'Ambassador Baptist Church',NULL,NULL,NULL,'A local church offering services to the community.',NULL,NULL,NULL,'http://theambassadorbaptistchurch.org/home.html',NULL,4,NULL,NULL,NULL,NULL,NULL,'1267100819054999','995652098008403','0',NULL,NULL,NULL,NULL),(57,756001362836549,'Salvation Army NW - National Capital Area Command',NULL,NULL,NULL,'Harbor Light Transitional Housing Program:\nExtended transitional housing (6-18 months) for 33 men & women experiencing homelessness and in recovery from substance abuse. To enroll, call the Harbor Light center at (202) 269-6333 and ask for the Intake department.',NULL,NULL,NULL,'www.salvationarmy.org',NULL,4,NULL,NULL,NULL,NULL,'1098208700839960,940345726334678','1096946727548641','831454623275466','0',NULL,NULL,NULL,NULL),(58,777796010868947,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CHILDREN, YOUTH AND FAMILY SERVICES',NULL,NULL,NULL,'The Department of Behavioral Health is building a system of care for children, youth and their families that supports prevention and early identification of behavioral health needs, and provides community based treatment and supports that are able to meet multiple and changing needs. We are guided by the principles that services must be easy to access, culturally and linguistically competent, and family-driven and youth-guided. A range of treatment and support services for children, youth and their families are available, including specialized evidence-based practices for youth and families recovering from trauma, emergency care and ongoing treatment primarily through certified, community based mental health providers. Ongoing treatment includes individual, group, and family counseling, diagnostic assessment, medication management, and family support. In addition, community based providers are certified to provide substance use disorder treatment. The Department also operates a children\'s clinic, provides services in public and public charter schools, and manages an alcohol, tobacco and drug prevention and awareness campaign called DrugFreeYouthDC. To select a community based mental health provider that best meets your needs, please review the available community based providers or call the ACCESS Helpline at 1-888-793-4357 and talk with a mental health professional who will guide you through the process.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'999007044535768','1130087923383067','1220839720071176','0',NULL,NULL,NULL,NULL),(59,801265724461963,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS THREE AND FOUR PREVENTION CENTER',NULL,NULL,NULL,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'1048055694684936','1003126161348750','1089405934692969','0',NULL,NULL,NULL,NULL),(60,769893937425938,'Wendt Center for Loss',NULL,NULL,NULL,'',NULL,NULL,NULL,'https://www.wendtcenter.org/',NULL,4,NULL,NULL,NULL,NULL,'1013626780767014,830099986846686,1191542329896840,942712017441428,910741093310618,1225791609508431,579430499829276,623630268141505,873979070344056,1332764177181120,1272292641029297,672539129008408,1080520592440176,827029786281023','1137743103213639,900284612419562,1169215057325985,679656889022644,714080995184693,1114888612682654','1108850981657232,1166799153375505','0',NULL,NULL,NULL,NULL),(61,783236314114871,'Georgetown Ministry Center',NULL,NULL,NULL,'Provides basic services to people who are homeless and with mental illness including; Showers, Laundry, computer access, medical care and psychiatric care.','info@gmcgt.org',NULL,NULL,'http://gmcgt.org',NULL,4,NULL,NULL,NULL,NULL,'1305017069566679,1081316277006822,1311316578271310,772454821683547','658265377894745','865999041296626','0','877243931325915',NULL,NULL,NULL),(62,786390431879533,'COMMUNITY FAMILY LIFE SERVICES',NULL,NULL,NULL,'Trinity Arms program offers housing up to two-years, with 13 individual units, offering a stable and supportive housing program. These spacious one, two and three-bedroom, private apartments are available to help families escape homelessness and enable each family group to work towards independence and self-sufficiency.',NULL,NULL,NULL,'http://www.cflsdc.org/housing-programs',NULL,4,NULL,NULL,NULL,NULL,'799762672906525',NULL,'1266854743896634','0',NULL,NULL,NULL,NULL),(63,802521051916688,'Community Connections',NULL,NULL,NULL,'Community Connections provides comprehensive mental health services to children, youth, families and adult s in the District of Columbia and Montgomery County, Maryland including individualized treatment planning, network resource development, community support services, in home and/or office based counseling, psycho-educational training and support and crisis services. They are also able to assist with applying for Section 8 Vouchers and accessing affordable housing. They accept DC Medicaid, AmeriHealth, Trusted Health and Medstar Family Choice.',NULL,NULL,NULL,'http://communityconnectionsdc.org',NULL,4,NULL,NULL,NULL,NULL,'599402007780126,907595418658961,822492274972082,845758882609427,1216556310653957,1180091016211141,984528775573917,586827752329383,789715981823462,793847249153498,915711679952561,1296730701251441,956342437760431','1125537818767812,1186529718830668','1044869288351593,1130006642102532,692231605294536','0',NULL,NULL,NULL,NULL),(64,809193297555798,'DC Rape Crisis Center',NULL,NULL,NULL,'DCRCC is the designated State Sexual Assault Coalition for the District of Columbia providing survivor-centered advocacy through therapeutic services, training and technical assistance, community education, public policy initiatives as well as volunteer opportunities. More specifically:\n\nIndividual & group counseling (English and Spanish)\nA 24-hour crisis hotline (202-333-RAPE)\nCommunity education & outreach\nTraining & technical assistance\nPublic policy & legislative Initiatives\nVolunteer opportunities\nUndergraduate and graduate internship opportunities\n\n\nDCRCC is the oldest and the first rape crisis center in the country, and the federally designated State Sexual Assault Coalition for the District of Columbia providing survivor-centered, and community led advocacy through therapeutic services, training and technical assistance, community education, public policy initiatives as well as volunteer opportunities.','dcrcc@dcrcc.org',NULL,NULL,'www.dcrcc.org',NULL,4,NULL,NULL,NULL,NULL,'671724061345975,681767171553959,695948265970000,600624054710125,613307132570587,1160149147134890,1298139501002270','1058012807425886,782968788385719,819440187923797,1248802193472840','728145736382163','0',NULL,NULL,NULL,NULL),(65,761153930697275,'United Planning Organization','UPO',NULL,NULL,'Since 1962, the United Planning Organization (UPO) has focused on changing lives &mdash; supporting and inspiring Washington, DC&rsquo;s low-income residents on their journey to self-sufficiency and success.\nWe currently offer more than 30 programs and services in such areas as early childhood education, youth development, job training and placement, health and wellness, housing, and volunteering.\nUPO is a family, and we understand the importance of supporting both individuals and the loved ones who surround them. Working in and with the community, we will continue helping people get where they want and need to be.','info@upo.org',NULL,NULL,'https://www.upo.org',NULL,4,NULL,NULL,NULL,NULL,'1213230585541920,1219686317955585,1133165843084453,1052254032756894,1253744104425599,916436632015801,777260696695053,1300660045853572,807525744099302,874199505765345,825451959778479,1187200756463947,1282686227944763,1296433586474206,924655410570415,928788698938707,943779508068444,794796274007587,602650991439185','665905423802380,615824389715095,849573890085736,851233609504150,757819596231988,1152713868211992,1259667859611659,1066322983572364,620350277070213,725558204724863,853687095165430,645117414301336','1186823261288379,594960886051316,999755198000719,897673459565497','1.2588028364582193e87','1177145976454922,740331137219886,684980356183378,905876656375498',NULL,NULL,NULL),(66,795756022910298,'Ayuda',NULL,NULL,NULL,'Ayuda provides legal, social, and language services to help vulnerable immigrants in our neighborhoods access justice and transform their lives. Since 1973, we have served more than 100,000 low-income immigrants throughout Washington DC, Maryland and Virginia. Ayuda&rsquo;s expert and dedicated professionals help immigrants from anywhere in the world navigate the immigration and justice systems and access the social safety net. This comprehensive and welcoming approach breaks down barriers, helps those in need, and makes our communities stronger.',NULL,NULL,NULL,'http://ayuda.com',NULL,4,NULL,NULL,NULL,NULL,'1120365239019390,1098998360726289,940105141272489','910170559958808,1097812419353578,602586439838395','817854864378068,1161498401444320,833655491101686,1183432963433388,767274390634346','0','1186681173947755,1340162113833071,1212718840001878,670413521970743,1173706987543564',NULL,NULL,NULL),(67,804221482345419,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): APRA: ASSESSMENT AND REFERRAL CENTER (ARC)',NULL,NULL,NULL,'Once an individual is medically and psychiatric cleared they can report to ARC for a comprehensive assessment. Based upon the assessment it will determine the level of care the individual is eligible for in Substance Use Disorder (SUD) treatment. The individual must be stable to participate in SUD treatment/rehab that is that the client should not be exhibiting psychiatric crisis such as violent behavior, hearing voices, inability to respond to voice commands. Also, the individual should be medically stable such as not exhibiting any respiratory , cardiovascular or injuries etc. that would prevent them from participating in SUD treatment. In addition, the individual should report to ARC with a 30 day medication supply, if applicable, in the event they are assessed for residential services the individual could be sent directly from ARC to residential treatment. If the individual is eligible for Detoxification (an average of 3 day stay), or if eligible for Outpatient (length of stay depends on progression in program) or Residential (an average of 28 day stay) treatment services. If residing in a shelter or supportive living, bring a letterhead supporting the residence at that facility.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'942882797339036','1118135668686826','638793416229400','0',NULL,NULL,NULL,NULL),(68,769347676481702,'CHINATOWN SERVICE CENTER: SUMMER ENRICHMENT PROGRAM',NULL,NULL,NULL,'Aids elementary students for 6 weeks during the summer months by enhancing English and mathematics skills, teaching students songs and allowing students to participate in arts and crafts.',NULL,NULL,NULL,'http://cccdc.com/chinatown-service-center/',NULL,4,NULL,NULL,NULL,NULL,'1133092295870518','778368103757668','1195857100779606','0',NULL,NULL,NULL,NULL),(69,787727417537507,'Open Arms Housing',NULL,NULL,NULL,'Open Arms Housing operates three programs through which we serve chronically homeless women. We run our two project-based single-site apartment buildings, the Dunbar, in the Truxton Circle neighborhood of Northwest, and Owen House, in the Trinidad neighborhood of Northeast, as well the newer initiative, a scattered-site PSHP. Open Arms Housing offers individual and group on-site services tailored to the unique needs of our clients.','info@openarmshousing.org',NULL,NULL,'https://openarmshousing.org/',NULL,4,NULL,NULL,NULL,NULL,'634028809032783,1024397676156151,1279217562065520','1130020356495609','920572231138004','0',NULL,NULL,NULL,NULL),(70,820488001755900,'Neighborhood Legal Services Program (NLSP)','NLSP',NULL,NULL,'',NULL,NULL,NULL,'http://nlsp.org/',NULL,4,NULL,NULL,NULL,NULL,'940202748401268,813553671875388,806428640646955,1109436994306012,718050681265809,1224083578603659,1214476217655096',NULL,'931728525653879,1053529725692782,647497712481280','0',NULL,NULL,NULL,NULL),(71,833556938177872,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): APRA: ADOLESCENT SUBSTANCE ABUSE TREATMENT: ASTEP',NULL,NULL,NULL,'The District of Columbia offers four locations where young people can go to seek help for a drug or alcohol issue. If a young person, under the age of 21, lives in DC and needs help or just wants to talk to someone about his/her drug or alcohol use, he/she can contact one of the treatment providers which are available through a network of providers.',NULL,NULL,NULL,'http: