retirees in securing employment. Home visits: Downtown',NULL,NULL,NULL,'http://cnic.navy.mil/ffr/family_readiness/fleet_and_family_support_program.html',NULL,4,NULL,NULL,NULL,NULL,'1148230459385861','951901541718626','988704048030141','0',NULL,NULL,NULL,NULL),(77,801110030219864,'Thrive DC',NULL,NULL,NULL,'Thrive DC works to prevent and end homelessness in Washington, DC by providing vulnerable people with a wide range of services to help stabilize their lives.\n\nFounded in 1979 to serve dinner to homeless women, Thrive DC has grown to be a comprehensive, professionally staffed, bilingual organization serving more than 2,000 men, women, and children each year.\n\nWe are a safety net for people experiencing homelessness, unemployment, housing instability, and food insecurity. With our help, our clients take the first steps toward independence and self-sufficiency.\n\nThrive DC serves 200 &ndash; 250 homeless and vulnerable individuals every day who turn to us for critical support. Services range from twice daily meals and weekly emergency groceries, to assistance finding housing and support finding employment, to connections to legal aid and opportunities for health screenings, to intensive job training and access to computers, laundry and showers.','info@thrivedc.org',NULL,NULL,'http://www.thrivedc.org/',NULL,4,NULL,NULL,NULL,NULL,'916268094765428,651504031814159,1166512271577678,963890389048330,1183218830562978,965489694318451,1229484402696374,1267195102722768,988930242117816,1207414557990697,1179313324156762','665113076769939,885184809366687,1128108657108836,833465858171168,1299532893666576,616629263137129,1096494296237143','1220597047470925','8.725926416563875e122',NULL,NULL,NULL,NULL),(78,803996484769013,'Rita Bright Family and Youth Center',NULL,NULL,NULL,'',NULL,NULL,NULL,'https://dpr.dc.gov/page/rita-bright-community-center-01',NULL,4,NULL,NULL,NULL,NULL,NULL,'927493620278205','1291451614834077','0',NULL,NULL,NULL,NULL),(79,805167768269068,'Family Matters of Greater Washington',NULL,NULL,NULL,'FMGW provides assistance that impacts more than 20,000 children, youth, families and seniors each year in the Greater Washington area. Our spectrum of programs include youth development programs and mental health/counseling services. The Youth Development program is comprised of a &ldquo;Send A Kid To Camp&rdquo; program, designed to send children to sleep-away camps in the region that endeavors to build future leaders.',NULL,NULL,NULL,'http://familymattersdc.org',NULL,4,NULL,NULL,NULL,NULL,'1113022418855878,990367220887588,699058261887909','1148220140221272','741750394643085,1289997318242966','0',NULL,NULL,NULL,NULL),(80,804045327953048,'D.C. Central Kitchen',NULL,NULL,NULL,'Community kitchen cafe offering a variety of social ventures to the community including:\n- Culinary job training\n- Cafe and catering\n- Healthy school food\n- Healthy corner stores\n- Community meals',NULL,NULL,NULL,'http://www.dccentralkitchen.org/',NULL,4,NULL,NULL,NULL,NULL,'614149741156528,612309985819526','819191608404189','771634087422781','7.903400316014466e32',NULL,NULL,NULL,NULL),(81,826683601578208,'SIBLEY MEMORIAL HOSPITAL',NULL,NULL,NULL,'Provides Psychiatric services.',NULL,NULL,NULL,'http://www.sibley.org',NULL,4,NULL,NULL,NULL,NULL,'1196102680422177','880543716544953','1279712967379272','0',NULL,NULL,NULL,NULL),(82,844234717265246,'Marshall Heights Community Development Organization',NULL,NULL,NULL,'Offers housing assistance through a Homebuyers Club, HPAP and Housing Counseling programs. Also provides business, economic and workforce development programs. Specializes in assessment, job development and placement, education and vocational skills training','info@mhcdo.org',NULL,NULL,'http://MHCDO.org',NULL,4,NULL,NULL,NULL,NULL,'595263959299318,770135966287034,831138417529715,1211572108731192','1161638800071039','1116781625364190','0',NULL,NULL,NULL,NULL),(83,862349068568843,'SOME: MICKEY LELAND PLACE: TRANSITIONAL HOUSING',NULL,NULL,NULL,'Operates a 90 day transitional housing program that provides job-readiness and support services to homeless men recovering from addictions.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'1020841973640307','971023796358171','1005730911773458','0',NULL,NULL,NULL,NULL),(84,862675425917588,'Early Stages',NULL,NULL,NULL,'Early Stages helps assess and identify any developmental delays in children from age 2 years, 8 months to age 5 years, 10 months. This is a program through DC Public Schools and serves any child attending DC Public Schools, being homeschooled, or not yet in school.','info@earlystagesdc.org',NULL,NULL,'http://www.eslearningcenters.com/',NULL,4,NULL,NULL,NULL,NULL,'585908349000516','861067587432539','1279218262197811','0',NULL,NULL,NULL,NULL),(85,865229863994763,'ST. STEPHEN AND THE INCARNATION CHURCH: LOAVES AND FISHES',NULL,NULL,NULL,'Provides a free, hot, mid-day meal to anyone who is hungry on Saturday, Sunday and federal holidays. Additionally, guests can receive assistance in signing up for Food Stamps, and referrals for job counseling and medical care.',NULL,NULL,NULL,'http://saintstephensdc.org',NULL,4,NULL,NULL,NULL,NULL,'964209508718168','913062642189740','1045140628063947','0',NULL,NULL,NULL,NULL),(86,877366768823409,'Community Outreach and Development ','Community Development Corporation Community O',NULL,NULL,'Community Outreach and Development (Community Development Corporation Community Outreach) is a nonprofit organization established in the year 2000 whose mission is developing and implementing programs to better the quality of life for families and individuals. Our vision is to provide quality\n\nservices that enable  persons to become self-sufficient and\n\nproductive members of the community. Our main service\n\nareas are outlined in this brochure: Community Services\n\nand Economic Development.\n\n\n\nThe programs implemented are focused on nurturing\n\nself-empowerment, which we believe creates a better\n\nquality of life for those persons who contact us.  Each year,\n\nwe serve more than 6,500 individuals, with  everything\n\nfrom food and clothing to financial assistance and\n\nworkforce development resources.\n\n\n\nWe recognize that alone we are unable to address the many needs of our community; because of this, we have initiated many partnerships with law enforcement, educators, the   business community, the faith  community, and the agencies and organizations that share our  mission.. It is through these partnerships that we have been able to accomplish many of our  successes.',NULL,NULL,NULL,'https://www.communityoutreachcdc.org/',NULL,4,NULL,NULL,NULL,NULL,'1107243553438801,987007032021851,570068555050262,768832404265850,1266877916484133,951270390830894,831554257615200','1011118711605616','848686188808388','0',NULL,NULL,NULL,NULL),(87,840733417398800,'Mary\'s Center',NULL,NULL,NULL,'Mary\'s Center is a comprehensive health and wellness network with several locations across the greater DC area. Services include\n- Medical\n- Behavioral Health\n- Dental\n- Social Services\n- Education',NULL,NULL,NULL,'http://www.maryscenter.org/',NULL,4,NULL,NULL,NULL,NULL,'1259349665237657,1189947540122655,969095511875672,1147407982912051,754669198968415,1208776169183354,739078424499970,580520440912412,1249176990484846,637113061667348,615988503257217,918238055415108,1280256361717353,1300052909750200,842045983132421,1028365853402776,1035362732313948,586062612640149,727116699390008,924435449967844,966657126572943,767682966554088,948956237360164,872823918122712,1203671009935370,606631780927132,784062651801689,591961230618386','1123621293381489,1263593198567823,634775044632505,603473645503739,609237693650331,976451647500271,646579701967814,655687905213046,1253449137217297,1110628963363122,940163636453224,1286112501247852,1129515195690409,1049675423059160,1307595059042459','1282458965799792,964869638930274,629348329513757,992745211312122,1293474810072073','0',NULL,NULL,NULL,NULL),(88,874266502610128,'DC Office on Aging',NULL,NULL,NULL,'Older Adult Service and Information System (OASIS) offers challenging programs in the arts, humanities, health, wellness, travel, and volunteer service. This national growth program creates opportunities for adults 55 years of age and older to continue their personal growth and meaningful service to the community. (202) 362-9600 Ext. 560.\n\nSeniorWorks II is a structured internship program for District seniors seeking short-term volunteer opportunities and assignments working in public and private agencies, sponsored by the DC Office on Aging. Part-time volunteer internship assignments are generally limited to three months or less, with a small stipend provided to defray the intern/volunteer\'s travel and other workplace expenses. \n\nThe Older Workers Employment and Training Program is funded with a grant from Department of Employment Services. The program provides employment and training opportunities for District residents 55 years of age and older. Services are provided under Title I of the Act, and emphasize the development of employment and training opportunities through job search assistance workshops, on-the-job training, job development, and placement and classroom skills training. The Office is an active one-stop partner in the District of Columbia Workforce initiative. \n\nThe McMasters program sponsored in partnership with McDonalds\' Corporation helps older workers adjust to the work-a-day world. Its goals are to build an individual\'s confidence, self-esteem, and provide a job opportunity that fits into his/her life style and personal schedule.',NULL,NULL,NULL,'www.dcoa.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'615914620488320','1266100703604119','1223680649678241','0',NULL,NULL,NULL,NULL),(89,887095601228098,'SOME: THEA BOWMAN HOUSE',NULL,NULL,NULL,'Provides two-years of savings and financial literacy training, as well as a life-skills program that helps to secure long-term housing. Families are also connected to SOME\'s other services, such as job training programs, group, and individual counseling.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'977628518433061','1319579849820109','1268338961312460','0',NULL,NULL,NULL,NULL),(90,886723337790722,'D.C. DEPARTMENT ON DISABILITY SERVICES (DDS): TRANSPORTATION SERVICES',NULL,NULL,NULL,'Provides transportation services for any customer registered with MRDDA.',NULL,NULL,NULL,'http://dds.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'1287637880598333','1251133036677676','665576595246792','0',NULL,NULL,NULL,NULL),(91,887305127088830,'Metro Teen Aids',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0',NULL,NULL,NULL,NULL),(92,887352348953420,'La Clnica del Pueblo',NULL,NULL,NULL,'Provides primary medical care for adults and children, mental health services, social services, HIV testing, and counseling, HIV case-management and medical care, alternative medical care. Provides services regardless of ability to pay.','info@lcdp.org',NULL,NULL,'http://lcdp.org',NULL,4,NULL,NULL,NULL,NULL,'942312969809968,921815945825806,1181081521839444,1096755308957020,1119079742925957,890398981649041,543629082697964,1241974546153013,787452341993968,1235636405349063,910692115764601,1280840473848403,774338968156105,674557198522049,1122242214354849','1143026726991574,853098088747359,887062299451299,660265936787847','1170113060894673,868710877316469','0',NULL,NULL,NULL,NULL),(93,855802893163707,'Habitat for Humanity (DC)',NULL,NULL,NULL,'Here at DC Habitat, our goal is to eliminate substandard housing in Washington because we believe that everyone deserves a safe, decent, affordable place to live. We&rsquo;re working toward that mission by providing affordable homeownership opportunities, affordable home repairs, and post-purchase homeowner education to local families. Scroll down to learn more about our programs, how you can qualify and apply, and view other local housing resources.',NULL,NULL,NULL,'https://dchabitat.org',NU