enting women. The Northwest Center believes that it is essential for every pregnant woman to have access to safe housing, food, clothing, medical care, and educational and/or job opportunities so that she can adequately provide for herself and her children. Our programs are designed to be more than a &ldquo;band-aid solution,&rdquo; rather we strive to effectuate real change in the lives of the women and children we serve. The ultimate goal of both programs is to enable our clients to achieve self-sufficiency, which we define as having sustainable employment, adequate health care and viable housing for themselves and their child(ren).',NULL,NULL,NULL,'http://www.pregnancyhelpdc.org/',NULL,4,NULL,NULL,NULL,NULL,'1048327823635547,895703387545823','776656918535876','688746232722666','0',NULL,NULL,NULL,NULL),(209,1276788103667282,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS FIVE AND SIX PREVENTION CENTER',NULL,NULL,NULL,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'780601488413554','742520224803831','1185866432124387','0',NULL,NULL,NULL,NULL),(210,1280475814917857,'WHITMAN-WALKER CLINIC: LEGAL SERVICES PROGRAM',NULL,NULL,NULL,'Offers a variety of pro bono legal services to persons living with HIV/AIDS. Provides legal counseling and representation in the areas of confidentiality, insurance, discrimination, immigration, future planning documents, and access to public benefits.',NULL,NULL,NULL,'http://wwc.org',NULL,4,NULL,NULL,NULL,NULL,'684439431487008','912916861756268','948165240614648','0',NULL,NULL,NULL,NULL),(211,1286410465547920,'Department of Human Services',NULL,NULL,NULL,'IMA Change Center Phone: 727-6600\nFax: 535-1665\nFort Davis Service Center, 3851 Alabama Ave, SE. 645-4500\nAnacostia Service Center, 2100 MLK Jr Ave, SE. 645-4614\nCongress Heights Service Center, 4001 S. Capitol St, SW. 645-4525\nTaylor St Service Center, 1207 Taylor St, NW. 576-8000',NULL,NULL,NULL,'DHS 4 In 1 App',NULL,4,NULL,NULL,NULL,NULL,'1159527228339119','1102555479175659,612480373273711,958866684536217','536496426622681,688457108968845','0',NULL,NULL,NULL,NULL),(212,1260225511804442,'Center for Child Protection and Family Support',NULL,NULL,NULL,'The Center\'s Village Family Support Center, located at 2021 Alabama Avenue, in Southeast, offers home visits, crisis intervention counseling, individual/group counseling, life skills training and parent support groups. The focus is on prevention and early intervention.\nThe center also runs programs in parenting skills and childhood education.',NULL,NULL,NULL,'www.centerchildprotection.org',NULL,4,NULL,NULL,NULL,NULL,'1223670715224591','911026869446678','1266604236381612','0',NULL,NULL,NULL,NULL),(213,1276678931351667,'Nazarene Outpost Ministries',NULL,NULL,NULL,'A local church providing various religious based services ranging from counseling, to bible classes, to food and clothing.','Info@NazareneOutpostMinistries.org',NULL,NULL,'http://www.nazareneoutpostministries.org/',NULL,4,NULL,NULL,NULL,NULL,'1120743935334776,1104683959276927,653156323573606,671489333574807','842254025136504','1001921907887485','0','651281137045548',NULL,NULL,NULL),(214,1279370086426568,'SOME: JEREMIAH HOUSE',NULL,NULL,NULL,'Provides a single room occupancy facility to formerly homeless women and men. Shared common social areas, kitchen, and dining rooms.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'921414115906478','1136094580538324','901614727736762','0',NULL,NULL,NULL,NULL),(215,1284728776860892,'TERRIFIC, INC. (WARD 1): CASE/CARE MANAGEMENT',NULL,NULL,NULL,'Provides Case Management services.',NULL,NULL,NULL,'http://terrificinc.org/',NULL,4,NULL,NULL,NULL,NULL,'668000665510895','827443796670715','882333039588739','0',NULL,NULL,NULL,NULL),(216,1274689026716619,'D.C. SUPERIOR COURT: DOMESTIC VIOLENCE INTAKE CENTER',NULL,NULL,NULL,'Provides assistance with cases that involve domestic violence. Advocates provide step by step instructions through the civil and criminal justice system and draft the petitions and affidavits for civil prosecution orders.',NULL,NULL,NULL,'http://www.dccourts.gov/services/domestic-violence-matters/intake-centers',NULL,4,NULL,NULL,NULL,NULL,'826245178186822','1200396831468955','1287087731647843','0',NULL,NULL,NULL,NULL),(217,1257373124080631,'Transgender Health Empowerment',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0',NULL,NULL,NULL,NULL),(218,1253319258586656,'Covenant Baptist Church',NULL,NULL,NULL,'A local church providing a variety of services to the community.','info@covenantdc.org',NULL,NULL,'http://www.covenantdc.org/',NULL,4,NULL,NULL,NULL,NULL,'880988285788628,937354212048327,1054723852607588,895095793944105,1219974334671075','1067100404223709','861096970014349','0',NULL,NULL,NULL,NULL),(219,1278050819659890,'D.C. OFFICE OF THE CHIEF OF POLICE',NULL,NULL,NULL,'Provides Crisis Intervention services, including Immediate need mental health, protection, victim, or legal assistance',NULL,NULL,NULL,'http://www.mpdc.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'1104601682011881','791269361544315','771071731283748','0',NULL,NULL,NULL,NULL),(220,1295401458610005,'D.C. PUBLIC LIBRARY SYSTEM',NULL,NULL,NULL,'The DC Public Libraries have varying hours of operation and all offer a wide range of services. Beyond checking out books, the Library offers adult education/literacy courses, computer courses, tax preparation assistance, college planning services, and services for job seekers. For more information on each specific library branch refer to the DCPL website. Residents of the DC Metropolitan Area can apply for a library card online or in person by providing identification that includes name and address.',NULL,NULL,NULL,'http://dclibrary.org/',NULL,4,NULL,NULL,NULL,NULL,'1153264572449660','758285624313707','928679802213891','0',NULL,NULL,NULL,NULL),(221,1323195974089796,'Latin American Youth Center','LAYC',NULL,NULL,'Engages at least 50 students at Woodrow Wilson High School (Wilson HS) whose parents face language, literacy, or culture-related challenges to support their children\'s academic success.','info@layc-dc.org',NULL,NULL,'http://www.layc-dc.org/',NULL,4,NULL,NULL,NULL,NULL,'1088833752301562,871635119190314,839260018674017,850061472824026,872556751746749,812376267113321,637918031832415,1197691835069647,1158010282443707,685821962980238,1249659581366985,1234003496832541,1140318024724985,636733000958441','1087645166547434,1198575506619755,977837017262074,845010409228900,1165471269627538,745110519319130,1248093235818331,665879809068779,1072627992557883,1226355078973829,1281387074856034,801845574930546,1256499247956610,1080778313579001','1159564548417950,585101162574385','9.427870760350994e194','1295679372454826,883345659611536',NULL,NULL,NULL),(222,1256643221396691,'Courtney\'s House',NULL,NULL,NULL,'Courtney&rsquo;s House is committed to providing trauma informed services for domestic sex trafficked youth between the ages of 12 and 21.\n\nCourtney\'s House: \nFearlessly searches for children who are being forced into prostitution on the streets, in brothels, strip clubs, private homes, and hotels.\nEmbraces the survivors and brings them into a safe environment where they and their families can heal, recover and develop hopeful, dignified and influential lives. \nTrains community officials and creates awareness of the reality of sex trafficking in neighborhoods across America to help stop the crimes from happening. ',NULL,NULL,NULL,'http://www.courtneyshouse.org/',NULL,4,NULL,NULL,NULL,NULL,'920716842267245','864858110639039,1265266505156213','879768448149613','0',NULL,NULL,NULL,NULL),(223,1323664977480953,'Covenant House Washington',NULL,NULL,NULL,'For over 24 years, Covenant House Greater Washington (CHGW) has served as the region&rsquo;s leading non-profit throughout the area in protecting, supporting, and transforming the lives of youth ages 18-24 experiencing homelessness, disconnection, and exploitation. CHGW has provided a safe harbor and wrap-around supportive services to one of the area&rsquo;s most vulnerable populations. The programs and services offered to young people help them to get back on track in achieving housing, career, and economic stability. \n\nWe create tailored solutions for each young person that goes beyond short-term housing and support. Our approach equips youth with the resources they need to overcome common obstacles and barriers. Aside from housing, youth receive workforce readiness, job/career placement, post-secondary support, case management, mental health support, drop-in services, child development center (for youth with children), and more.',NULL,NULL,NULL,'http://covenanthousedc.org',NULL,4,NULL,NULL,NULL,NULL,'953668428109766,1147909066828937,978169761735866,885835927138322,875542904723327,963779263900815,1105456695695453,1212544141593855,682308202362189','613066881487958','1106602330344467','0',NULL,NULL,NULL,NULL),(224,1287130751059247,'Calvary Women\'s Services',NULL,NULL,NULL,'Our programs are designed for women who are survivors of violence and trauma, are living with mental illness, or are in recovery from substance abuse. Through personalized services and with peer support, each woman identifies and builds on her own strengths in order to meet her goals for safe housing, good health, and financial independence.','info@calvaryservices.org',NULL,NULL,'https://www.calvaryservices.org/',NULL,4,NULL,NULL,NULL,NULL,'750465787434275,862423770633741,1234340144717096,765387458092097','1285405208459287,660946577762729','1315826372203677','0',NULL,NULL,NULL,NULL),(225,1300690778936362,'VETERANS AFFAIRS (VA) OUTPATIENT CLINIC: SOUTHEAST WASHINGTON D.C.',NULL,NULL,NULL,'The Community Based Outpatient Clinic (CBOC) Southeast provides basic medical and preventative care, health education, mental health services, addiction counseling, comprehensive women\'s health care and nutritional counseling to eligible veterans. Referral services are provided for those who require specialized care.',NULL,NULL,NULL,'http://www.washingtondc.va.gov/locations/',NULL,4,NULL,NULL,NULL,NULL,'1288975729182572','960149581422207','953406517143083','0',NULL,NULL,NULL,NULL),(226,1319047892616905,'SOME: SHALOM HOUSE',NULL,NULL,NULL,'Offers affordable, housing for adults transitioning from homelessness to independent living. Residents pay 30% of their income as rent, participate in regular house meetings and maintain their health and sobriety.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'777108871381104','606210161081529','1261924735850333','0',NULL,NULL,NULL,NULL),(227,1318451956583107,'Clean and Sober Streets',NULL,NULL,NULL,'Clean and Sober Streets offers long term residential and outpatient drug and alcohol treatment and rehabilitation services for men and women who are willing to recover in Washington, DC.',NULL,NULL,NULL,'http://cleanandsoberstreets.org/Welcome.html',NULL,4,NULL,NULL,NULL,NULL,'936863331676390,968057316664450,1178562151177693,636134392103308','1146453286231773,1094848634511675,883461165895110','1147455525775238','0',NULL,NULL,NULL,NULL),(228,1326157862705937,'MBI Health Services',NULL,NULL,NULL,'A comprehensive health agency offering the following services:\nFree Standing Mental Health Clinic & CORE\nHome Health Care Services\nDay Treatment Program\nRSA & Supported Employment Services\nDepartment on Disability Services Division\nTransitional Age Youth Division (TAY)\nPartnerships\nNurse Staffing Services\nReturning Citizens Program\nHealth Home Services\nAssertive Community Treatment (ACT)\nAdult Day Health Program (ADHP)\nSubstance Use Disorder (SUD)\nHousing Programs\nChildren\'s Program','info@mbihs.com',NULL,NULL,'http://www.mbihs.com/',NULL,4,NULL,NULL,NULL,NULL,'1105568722092716,894009414185445,721115353360225,1135621422748851,1215651158311524,784662874544792,699918289813778,1055385917949527,1109924174096172,597026276891169,1020934285482366,585407675930864,800132260226272,794816074234794,1206891395647206,985012947614539','1211781059829341,1309068726775336,929037191615824,902963958186519,613925188728049,1169367921365761,827283242603751,878448197736553,1131051329814284,879651358762725,1179726198865150,960509036831710,1215372861989264','959978038980815,1284966614626832,1161640092680179,609550690795774,602791638266539','1.2965717104192586e33',NULL,NULL,NULL,NULL),(229,1331447374298751,'Catholic Charities of the Archdiocese of Washington',NULL,NULL,NULL,'We operate 59 programs in 35 locations all in Washington, DC and the surrounding five Maryland counties.\nSome of the ways we help include:\n- Legal and financial\n- Food assistance\n- Employment and adult education\n- Housing and shelter programs\n- Developmental disabilities help\n- Infants and expecting parents\n- Health care programs\n- Help for children and teens\n- Kennedy school (non-public day school for folks with disabilities ages 6-22)\n- Emergency help\n- Immigrant and refugee services\n- Prison outreach\n- Mental health services',NULL,NULL,NULL,'https://www.catholiccharitiesdc.org/',NULL,4,NULL,NULL,NULL,NULL,'662641889613680,777479494055010,843621219939860','1188739171637564,765310724233865,1200120875116452','1012923803825523,1182935368999640','0',NULL,NULL,NULL,NULL),(230,1279230501938511,'Martha\'s Table',NULL,NULL,NULL,'We believe that every child deserves the opportunity for their brightest future and a deeply engaged family and community committed to their success. For nearly 40 years, Martha&rsquo;s Table has worked to support strong children, strong families, and strong communities by increasing access to quality education programs, healthy food, and family support.','info@marthastable.org',NULL,NULL,'http://marthastable.org',NULL,4,NULL,NULL,NULL,NULL,'1242360569614402,1224237784751973,923438177610839,881381167741606,943841633351922,1298968199365502,1134694149755541,1072375211967855,632654541686281,1164006971785156','633789582292485,1235881686916009,781647570742420','776699670514011,1262159504249540,947434898715713,1235846186580133,812882827630009,643145676043430,905037841940941','0',NULL,NULL,NULL,NULL),(231,1292630118544041,'Phyllis Wheatley YWCA',NULL,NULL,NULL,'',NULL,NULL,NULL,'http://www.pwywca.org/',NULL,4,NULL,NULL,NULL,NULL,NULL,'1238122900635736','856110821321208','0',NULL,NULL,NULL,NULL),(232,1306699628219808,'Sasha Bruce',NULL,NULL,NULL,'Provides GED preparation, vocational classroom training in carpentry, and on-site carpentry experience for young people not currently enrolled in school.','info@sashabruce.org',NULL,NULL,'http://sashabruce.org',NULL,4,NULL,NULL,NULL,NULL,'838392358604924,1249532731729968,1066884473551582,1307622731573519,865371846794230,1157781613265181,873921955624383,1084298429662110,605446506944549,1087433575244513,1322260694270949,1238586489770478,1104456609971378,908536708739321,958643940332296,908986332318967,758846747979067,1119090357480675,1055696283461218,753964791303094','1173443518827100','646605477191198,1083708956779513,574114996921997,870889793389860,773029335736391,873020349083887,577194179164801,818297935399976,1324870517546321,951106217202607,1271606099314004,1218813676681454,798494517814959','0',NULL,NULL,NULL,NULL),(233,1341330878033407,'Samaritan Ministry of Greater Washington',NULL,NULL,NULL,'Every year, Samaritan Ministry of Greater Washington helps improve the lives of more than 1,000 people who are homeless or otherwise in need through our innovative Next Step Program. For over 30 years now, participants have been welcomed by our staff and volunteers into a safe, supportive environment that allows them the freedom to choose their own goals and pursue them! They are given the resources and support they need &mdash; housing and employment search guidance, coaching, referrals to partner service providers and more &mdash; to fulfill those goals. Participants are listened to, and treated like family.',NULL,NULL,NULL,'http://samaritanministry.org',NULL,4,NULL,NULL,NULL,NULL,'653858529595915','1313749480020796','1108000021700211,948736838709158,1229901678210145,880015218951352,955920420939787','0',NULL,NULL,NULL,NULL);
