INSERT INTO `services` VALUES (1,543629082697964,'Psychoeducational Group Intervention',NULL,887352348953420,'La Clnica operates a counseling program called Mi Familia, which works to reduce the negative impact of traumatic stress and to improve overall stability within the family unit. In this 14 week-long program, families receive individual and family counseling treatment while attending weekly psycho-educational group interventions. Program participants learn about effective communication and stress management strategies while emphasizing abuse and trauma prevention. In 2010, the program was awarded the National Council of La Razas Strengthening Families Award.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(2,556048703962949,'Primary Medical Care ',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,565809012321458,'Food Bank',NULL,641527619630164,'Offers a food bank to community members in need.','616652943932532',NULL,NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'966776474605843','585933393087354','798494739947118,804736877719123','','1157720407283054',NULL,NULL,NULL),(4,571969699128717,'Center for the Blind & Visually Impaired',NULL,1180598613249590,'Losing your vision can be not only challenging but also isolating and depressing. The Center for the Blind supports older adults in Washington, D.C. with making the physical and emotional adjustments to living with blindness.\n\nServices at the Center are free to all D.C. residents and include independent living skills training, music therapy, nutritional meals, braille, and other communication skills. ','765115819494380','https://www.seaburyresources.org/centerforblind',NULL,'info@seaburyresources.org','Verified','637158405241810','Call to apply for services.',NULL,NULL,NULL,NULL,'990653723421604','1176087327224268',NULL,'854808174954754,923078251322861','638665770674913',NULL,NULL,NULL),(5,577138792955216,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CONSUMER FOCUSED ACTIVITY CENTER: OUR DOOR',NULL,1120305351510755,'The purpose of the community peer operated activity center is to: 1) assist people with psychiatric illness who may also have co-occurring substance use disorder and medical conditions, regain control over their lives and their own recovery process; 2) achieve this goal in an environment that is conducive to support for self-directed recovery, advocacy, education, and information and referral services based on consumer experience, knowledge and input; and 3) provide activities that include: recreational and social, educational, Peer Support and Peer Advocacy groups, health education and linkages to medical care including participating in health fairs, community resource identification, assistance with benefits and entitlement applications; improvement of social interpersonal skills and life skills validation (e.g., Wellness Recovery Action Plan (WRAP) classes); and education on consumer rights.','1140332291662029','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'578228161038746',NULL,NULL,NULL),(6,574349076267569,'Unity at Christ House (Ward 1)',NULL,1043772486617212,'Healthcare for homeless ','925102157397517',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1223289968887299',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,580209857140665,'Adult Trauma Services',NULL,1265431689708141,'Inpatient - Day Program Partial Hospitalization - Intensive Outpatient\nSpecialty care for post-traumatic stress disorder includes rapid stabilization and skilled intervention. Our innovative treatment model focuses on training individuals in self-management skills using stage-oriented, cognitive and behavioral strategies. Our treatments for PTSD also includes problem-solving techniques with special focus on identifying skills patients can use during treatment and after discharge.\n\nThe Day Center offers two levels of intensity:\nPartial Hospitalization  four or five days of treatment each week dedicated to helping prevent inpatient admission or to shorten an acute inpatient stay\nIntensive Outpatient  a two to three-day a week program designed to help patients struggling with chronic or intermittent work and social dysfunction\nIndividualized treatment plans are developed to:\n\nEncourage maximum levels of functioning\nExpedite the transition to less intensive levels of treatment\nOffer flexible scheduling to accommodate a transition to work\nAvailable Treatment Groups\nGoal setting focuses on identifying issues patients face and establishes a framework for clinical care\nGroup Psychotherapy addresses personal safety and effective expression and management of feelings and to learn and practice interpersonal skills\nPsych-Education/Life Skills dedicated to trauma recovery, coping skills, emotional regulation and problem-solving\nExpressive Therapy identifies safe, contained expression and management of emotions using art therapy and writing','1289140698414142','https://psychinstitute.com/treatment-services/adults/adult-trauma-services/',NULL,NULL,'Verified','941516382466411','Its easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'1263089203668614','1045297656470568',NULL,NULL,NULL),(8,585908349000516,'Developmental Assessments',NULL,862675425917588,'Early Stages helps assess and identify any developmental delays in children from age 2 years, 8 months to age 5 years, 10 months. This is a program through DC Public Schools and serves any child attending DC Public Schools, being homeschooled, or not yet in school.',NULL,'http://www.eslearningcenters.com/',NULL,NULL,NULL,'941516382466411',NULL,NULL,NULL,NULL,NULL,'861067587432539','757306317490407',NULL,NULL,NULL,NULL,NULL,NULL),(9,585407675930864,'Supportive Independent Housing Program',NULL,1326157862705937,'What is MBI\'s Supportive Housing Program?\n\nMBI Supportive Independent Housing Program (SIL) is designed to support MBI consumers who already have housing and are having issues with their current housing.\n\nWhat Should I expect?\n\nMeet with MBI/SIL consumers for home visit\nEnsure that the home is in compliance with MBI housing standards\nAct as another resource between the consumer with MBI Services\nShare information with  the CSWs and Program Administration to ensure that the consumer is receiving the best level of care and services\nAssist with training and skill building (ADL) skills with consumer\nAdvocate on behalf of the consumer (when appropriate) to ensure that their needs are being met.\nRe-evaluate and revise the housing plan with the Treatment team on a regular basis to meet the consumers new goals and/ changing needs\n','959978038980815','http://www.mbihs.com/what-we-offer/housing-programs',NULL,'wpinson@mbihs.com','Verified','929094559121639','Am I Eligible?\n\nAll of MBI consumers that are currently living in a residential property in Washington, DC\n\n How Do I Enroll?\n\nTo receive an initial evaluation, contact your CSW\n\nThe advantage of this program is our consumer will have an additional individual who will work with the treatment team on a permanent housing solution.\n\nFor additional information and Inquiries please contact:\n\n\n\n\nBillie Pinson /SIL Program Liaison\n\n202-639-9762 or\n\nwpinson@mbihs.com',NULL,NULL,NULL,NULL,'929037191615824,1179726198865150',NULL,'1296571710419253','868012483124236','817410769508748',NULL,NULL,NULL),(10,585676804126726,'Unity at New York Avenue Homeless Shelter (Ward 5) ',NULL,1043772486617212,'Healthcare for homeless','595076968604503',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1196136931702216',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,590149106022184,'Holly House',NULL,906742630902911,'Located in a quiet, residential neighborhood near Silver Spring, MD, Holly House is a long-term group home for eight men and women with mental illness who are at great risk of homelessness. Holly House is within easy walking distance to public transportation and stores. Holly House residents receive continuing clinical support services from Woodley House as they integrate into the community, participating in individual day programs, full or part-time jobs and volunteer programs.',NULL,'https://woodleyhouse.org/residential-care/holly-house/',NULL,NULL,'Verified','929094559121639','Referrals are accepted from the Department of Behavioral Health, Core Service Agencies, private providers, hospitals and families.\n\nResidents must be formerly homeless, be enrolled with the DC Department of Behavioral Health, and have a recommendation from their Core Service Agency to apply to Holly House. The Core Service Agency will inform them of any needed documentation that they require.\n\nBecoming a resident includes receiving meals, 24-hour residential staff supervision and support services to enable clients to achieve greater independence.\n\nPlease contact Alkita Alhanssary, Holly House Supervisor, for information about how to enter Holly House.\n',NULL,NULL,NULL,NULL,'906348724543792',NULL,'1170089516639143',NULL,NULL,NULL,NULL,NULL),(12,592511260613384,'Downtown Cluster Geriatric Day Care',NULL,900455754248217,'Day services for seniors.','984058750613797','https://www.asburyumcdc.org/',NULL,NULL,'Verified','637158405241810','Call to confirm how to access services.',NULL,NULL,NULL,NULL,'1224416978291385,931894948994087','776532681871781',NULL,NULL,'944084611081362',NULL,NULL,NULL),(13,602724412494897,'Transportation Services','Misler Center',855094084464049,'Misler Adult Day Center is able to provide critically needed transportation to many of our participants using the JCA ElderBus fleet. Each day, trained drivers who are sensitive to the needs of older adults are out in neighborhoods surrounding the Center, providing roundtrip door-to-door service to those who live within our pick up area. Our fleet of accessible buses can accommodate wheelchairs and walkers.','924628911683577','https://accessjca.org/misler-center/',NULL,'Misler@AccessJCA.org','Verified','632609508449013','For more information, to arrange a visit, or to speak with one of our social workers, please call us at 301-468-1740, or use the contact form on our website to send an email inquiry.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1058170814905410',NULL,'1157835357284365,854808174954754,1032274526726429','1050035692418764',NULL,NULL,NULL),(14,605860875832060,'Diabetes Program',NULL,1220981589179778,'Our Diabetes Program provides educational, interactive workshops for those who are hospitalized and those who are caring for their diabetes at home. These workshops are designed to stabilize and restore diabetics health by learning how to control their disease and eliminate barriers to their care.','620132940242525','https://www.unitedmedicaldc.com/services/diabetes-program/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'1136418356307446','1100182510854387',NULL,NULL,'818226241830087',NULL,NULL,NULL),(15,549681153080082,'Know Your Rights',NULL,983721114373124,'An online resource to help educate you on your rights as a survivor of intimate partner violence.','828792720206018','https://www.dashdc.org/housing-resource-center/know-rights/',NULL,NULL,'Verified','917725171609009,929094559121639','Visit our website. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(16,563588572334023,'Ride Smart Workshops','Connect-A-Ride',855094084464049,'Ride Smart Workshops\nOffered periodically, these workshops help small groups of older adults learn to use public transportation options and otherwise navigate the National Capital Region.','924628911683577','https://accessjca.org/connect-a-ride/',NULL,'ConnectARide@AccessJCA.org','Verified','632609508449013','Registration is required for Ride Smart workshops. Call 301.738.3252 to register or for more information or email ConnectARide@AccessJCA.org',NULL,NULL,NULL,NULL,'1256462778437672','1276016050822057',NULL,'1262399029280424,854808174954754','1050035692418764',NULL,NULL,NULL),(17,565227181581504,'C.A.P. (Community Anti-violence) After School Program ',NULL,1013543362848937,'We equip, encourage and empower the emerging generation via reading tutoring, homework assistance, mentoring and discipleship development.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','789038541797078','Call or show up to the next meeting. October through May.',NULL,NULL,NULL,NULL,'905425032669080','1007276077218464',NULL,'1274396898894043,883345659611536','1190125799561725',NULL,NULL,NULL),(18,566502197729713,'Care Management',NULL,1180598613249590,'Families face new challenges as family members age. Life doesnt come with an event planner, so Seabury care managers are there for when you and your family need help.\n\nSeabury care managers guide older adults and their families through the process of planning for long-term needs. Seaburys Care Management team is dedicated to improving the quality of life as well as maintaining independence for their clients.\n\nCare Management provides counsel to families on key issues that could include elder law attorneys, home care providers, senior living communities, physicians, rehabilitation centers, mental health providers, financial planners, and others to promote a positive aging experience.','1183011241112934','https://www.seaburyresources.org/caremanagement',NULL,'info@seaburyresources.org','Verified','637158405241810','Call to apply for services.',NULL,NULL,NULL,NULL,'583858667444622','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(19,567631577251008,'Food Pantry',NULL,1107997028998056,'Offers a food pantry for people in need of food.','1112335428289741',NULL,NULL,NULL,'Verified','832990803111047','You must have a referral from social services or a case manager that is faxed to us. Then you will set up an appointment by phone.',NULL,NULL,NULL,NULL,'750948313560406,872643474789883,1118383435935760','675697250328431',NULL,'1244888069012632','826486612406662',NULL,NULL,NULL),(20,569770427910971,'Information and Referral',NULL,964889233755760,'DCCIL provides disability-specific information and referral to ensure people with disabilities have access to information needed to achieve or maintain independence in their communities.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(21,573528188325499,'Homelessness Prevention',NULL,1195870505334629,'We work with families at risk of losing their housing to prevent homelessness. We help stabilize families through services, financial assistance, and connection to mainstream resources so that they do not need to enter the shelter system.\n\nCommunity of Hope\'s Homelessness Prevention Program works to stabilize families at risk of becoming homeless through specialized services and connection to other community resources.\n\nAll families must be referred from the Virginia Williams Family Resource Center. Clients are usually living temporarily with a friend or relative, and have often moved frequently. Clients find themselves on the brink of homelessness and come seeking any assistance available to stay stably housed.\n\nCommunity of Hope helps prevent clients from losing their homes and entering the shelter system through effective targeting of resources. We recognize that different families require different solutions.\n\nOur case managers serve as supporters and advocates for clients  helping them think through their goals and create detailed plans with a realistic timeline. These wide-ranging supportive services include:\n\nComprehensive case management\nMediation services\nFinancial assistance\nBudgeting and financial management\nRental and utility assistance\nReferral for legal services\nThe Homelessness Prevention Program, through expert case management and mediation services, helps families stay stably housed and allows them to remain connected to their natural systems of family and community.','688457108968845','https://www.communityofhopedc.org/housing/homelessness-prevention',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195','1255819816076094',NULL,NULL,NULL),(22,577390293811162,'Walk-In Pregnancy Tests',NULL,662579547117824,'Walk-in pregnancy tests. Under 21: $2, Over 21: $5.','901362892558172','http://www.healthybabiesproject.org/contact/',NULL,NULL,'Verified','941516382466411','Walk in.',NULL,NULL,NULL,NULL,'645677274573700','968633845824283',NULL,NULL,'1244665120116979',NULL,NULL,NULL),(23,577584068562238,'Change Your Locks','Keep Safe Housing',983721114373124,'If you have a protection order you are legally entitled to change your locks even if your abuser is on the lease. Use our sample letter (on our website) to request a lock change from your landlord.\nIf your abuser is not on the lease you have the legal right to request a lock change from your landlord at any time. Your landlord or property manager is responsible for changing the locks within 5 business days of the request. Use this sample letter (on our website) to request lock changes, and this letter if your landlord has taken more than 5 business days to change the locks.','828792720206018','https://www.dashdc.org/housing-resource-center/maintain-housing/',NULL,NULL,'Verified','917725171609009','Visit our website for sample letters. You can also visit our walk-in clinic for help. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'777455803391753,1256136937607288,1212718840001878','1043474797867812',NULL,NULL,NULL),(24,579430499829276,'Counseling Services',NULL,769893937425938,'Grief counseling is often about finding new solutions to problems of living, or about changing relationships in the context of loss. Our trained, experienced therapists accompany adults and families as they readjust to a world that has drastically changed.','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(25,576262745925884,'Youth Development',NULL,931366816861797,'The Perry Center, Inc. Youth Development Program provides a continuum of services to develop and educate youth from ages 3 to 18.','1098817401970888','https://www.perryschool.org/services',NULL,NULL,'Verified','789038541797078','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372','802405581688320',NULL,'743601753506222','896277574789110',NULL,NULL,NULL),(26,596474071852609,'Adult Education',NULL,889845893875767,'Academy of Hope provides a variety of programs and services free of charge to meet the needs of our adult learners. Our programs focus on the following:\n\n- Adult Basic Education (ABE)\n- General Educational Development (GED)\n- National External Diploma Program (NEDP)\n- Gateway to College and Careers\n- Career Academies in the high-demand sectors of hospitality, healthcare and office administration\n\nWe offer additional services to assist our adult learners in attaining their educational goals, including:\n\n- Computer Training\n- Career Assessment and Planning\n\nAcademy of Hope also provides a range of student support services to help break down barriers that may stand in the way of a student meeting his or her goals.','873273529728080,909942619088980','https://aohdc.org/what-we-do/',NULL,NULL,'Verified','789038541797078','Apply in person on campus, call to register, or apply online.',NULL,NULL,NULL,NULL,'1022412281964551,972949389893061,790733365231464','855840227548974,777701460078348,1281999112214963',NULL,'866965462945330,868012483124236','1152392105754818,915998507127869',NULL,NULL,NULL),(27,603778865328891,'Medstar Georgetown University Hospital',NULL,1198455162499731,NULL,NULL,'www.medstargeorgetown.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,607885233270947,'Disaster Relief',NULL,1004391421304549,'ACSGW stands ready to help our community through any disaster. Unfortunately, it is hard to predict just what misfortune may impact our lives. Will it be a violent storm, a devastating home fire or some other horrid event that strikes our community? Although such incidents are hard to predict, ACSGW is prepared to offer assistance in the form of case management, food, clothing, household goods and other support. Please think of ACSGW when disaster strikes','950009053464384','https://www.acsgw.org/disasters.html',NULL,NULL,'Verified','878986697513222','If there has been some form of natural disaster, contact ACSGW for help. If you are in an emergency, call 911.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(29,610489256524292,'Home-delivered Meals',NULL,1180598613249590,'Through Seaburys home delivered meal program, older adults in Washington, D.C. who are unable to travel to shop for food or prepare food themselves have meals delivered to their homes.  ','1183011241112934','https://www.seaburyresources.org/homdeliveredmeals',NULL,'info@seaburyresources.org','Verified','832990803111047','Call to apply for services.',NULL,NULL,NULL,NULL,'1215962717214630','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(30,561778285748604,'Nutrition Counseling',NULL,1219589148672769,'At Food & Friends, we consider nutrition to be a vital part of the treatment for our clients. Our community dietitians are available to provide personalized nutrition counseling and meal plans to address each clients nutritional needs.\n\nIn addition, within the community, we provide the following services, all of which are free of charge:\n\nOn-site cooking classes\nEducational handouts on increasing protein and calorie intake, food safety and more\nOff-site group presentations on nutrition related to HIV/AIDS, cancer and other life-challenging illnesses','857875532631251','https://foodandfriends.org/about-us/#services-we-provide',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'1239494728678928,1133561368089400','857395816743172,884617333624034',NULL,NULL,'1251720034767684',NULL,NULL,NULL),(31,573931060003252,'Project ACTION',NULL,744812603775568,'Project ACTION! is a regional coalition of self-advocates and self-advocacy groups from the District of Columbia, Maryland and Virginia.  ACTION! stands for Advocacy, Change, Training, Information, Organizing and Networking.  \n\nPeople with disabilities have many issues and concerns in common, including transportation, health care, jobs, safety, adult education, and others issues.  After a popular adult education program was threatened with closing without notice, students gathered together to protest the budget cuts and quickly learned that there is strength in numbers!   They learned they can accomplish more together than alone.  \n\nThis strong community of self-advocates shares personal experiences of living with developmental disabilities  training and encouraging their peers to speak out on issues important to them.  The groups motto, Nothing About Us without Us, is one Quality Trust fully endorses.  Many members have joined boards, committees, work groups, and commissions that make decisions that affect their lives.  Self-advocates meet to learn about their rights, update each other on important issues and events, practice speaking up and sharing their opinions, learn how to lead meetings, set priorities, provide and receive training and celebrate their achievements. ','1185969381076176','https://www.dcqualitytrust.org/families/join-project-action/',NULL,'pholton@dcqualitytrust.org','Verified','637158405241810','Project ACTION! meetings are held on Saturdays at Kennedy Institute of Catholic Charities, located at 801 Buchanan Street, NE, Washington, DC  20017.  Refreshments are provided. \n\nFor more information about Project ACTION! email Phyllis Holton or call her at 202-448-1458 (direct).',NULL,NULL,NULL,NULL,'1294732165044482',NULL,'659954535630939','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(32,577558646630251,'SOME: BEHAVIORAL HEALTH SERVICES',NULL,908756987447173,'Encourages individuals with substance abuse issues to seek help. Assesses the need of the client during the initial intake stage, where clients work with an addiction counselor to determine the program best suited to their needs.','923653351035648','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'962036505121926',NULL,NULL,NULL),(33,574661829122399,'Crossing Place',NULL,906742630902911,'Located in Woodley Park, Crossing Place is an eight-bed emergency shelter and crisis stabilization for people experiencing acute mental illness. One of only two private crisis homes in Washington, DC, its therapeutic atmosphere supports clients stabilization and recovery. Crossing Place offers short-term (2-14 days) intensive support services at approximately one-third the cost of hospitalization. Crossing Place is staffed 24 hours a day, seven days a week with professional residential crisis specialists who work with the Department of Behavioral Health, medical and psychiatric providers and case managers to support residents. ',NULL,'https://woodleyhouse.org/residential-care/crossing-place/',NULL,NULL,'Verified','929094559121639,878986697513222','Call screening line (202) 830-3517 to begin application. To be eligible, you must be\n- Age 18 or older\n- Experiencing a psychiatric crisis\n- Must be able to maintain safety of self or others\n- Must not be in need of medical detoxification or other inpatient care',NULL,NULL,NULL,NULL,'607359446784933',NULL,NULL,'866965462945330',NULL,NULL,NULL,NULL),(34,576988108950338,'Emergency Assistance Program',NULL,1187372282686349,'Offers emergency rent, mortgage and utility assistance to residents of Ward 6. This is only offered on a case by case basis for participants.','1209121324412172','http://fathermckennacenter.org',NULL,'info@fathermckennacenter.org','Verified','878986697513222,1077790582995406','This is only offered on a case by case basis for participants. Contact your case manager for more information.',NULL,NULL,NULL,NULL,'1123859846194392','1107831955306053',NULL,NULL,'645829762063748',NULL,NULL,NULL),(35,580719808472057,'Camp Bennet',NULL,726173106231202,'Located on 220 scenic acres in beautiful Brookeville, Maryland, Camp Bennett serves as a residential summer camp for financially underprivileged children from all over the Washington, DC, area. Every summer for seven fun-filled weeks, Christian counselors and volunteers lead hundreds of children ages 8-12 through life-changing Bible programs. Children who have never been away from the city streets can experience a week in the country and make new life-long friends.','1135122975308953','http://www.campbennett.org/',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'569071299085270',NULL,NULL,'986272445118075','1175347461652522',NULL,NULL,NULL),(36,580120354830667,'Free After School Program',NULL,931366816861797,'Perry School Community Services Center provides a free After-School and Summer Camp program for children in the Washington, D.C. metropolitan area, and particularly Wards 5 & 6.More information on the most recent registration period and the program is contacting the Perry Center at (202) 312-7140 or by emailing Activities and programming for children include:\n\nDeveloping nutrition skills through cooking classes;\nArt projects with mixed media and crafts;\nAnti-bullying and conflict resolution programs;\nHomework assistance and cultural enrichment opportunities;','1098817401970888','https://www.perryschool.org/youth-development',NULL,NULL,'Verified','789038541797078','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372',NULL,NULL,'1274396898894043,883345659611536','896277574789110',NULL,NULL,NULL),(37,586827752329383,'Genoa',NULL,802521051916688,'Genoa, a QoL Healthcare Company, is a leading pharmacy serving the behavioral health and addiction treatment community for more than 15 years. Genoa is an on-site, full-service pharmacy located in the Community Connections main office waiting room. Genoa takes care of many of the medication needs of our clients, including prescriptions written by psychiatrists, primary care providers, or other specialty prescribers, as well as working with treatment teams to coordinate care.','1044869288351593','http://www.communityconnectionsdc.org/our-services/integrated-care',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(38,586062612640149,'Maternal Mental Health',NULL,840733417398800,'If you are pregnant or preparing for the addition of a new baby, adjusting to life with a new child, had a baby in the past year, or experienced a loss in pregnancy, Marys Center is here for you.  \n\nSignificant life changes like these can cause tremendous amounts of stress and we want you to know youre not alone. Reach out to Marys Center if you are experiencing:  \n\nDifficulty adjusting to a significant life change \nDifficulty with your emotions following a difficult or traumatic birth \nDifficulty bonding with your baby \nFeelings of irritability, sadness, or depression \nPerinatal grief/loss \nScary, intrusive thoughts \nIf youre struggling with something you dont see listed above, we strongly encourage you to reach out to us for additional support.\n\nOur Maternal Mental Health program is dedicated to support pregnant and postpartum women, adoptive parents, and their families through a variety of resources and services including:  \n\nCare coordination \nPhone outreach including a brief assessment, educational information, and ways to connect to additional care \nSupport and education, including free online support groups held in English and Spanish \nTherapy and psychiatry ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/other-specialties-and-services/maternal-mental-health/',NULL,NULL,NULL,'941516382466411','Marys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below:  \n\nTo an appointment and indicate your interest in the Maternal Mental Health program, call (202) 846-8053 x 2797\nTo reach the Maternal Mental Health Program Manager, call (202) 545-2061',NULL,NULL,NULL,NULL,'1301804131597006,655687905213046,1253449137217297','1134877289644712,827996522503929,601427652072887',NULL,NULL,'903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(39,591961230618386,'Child Development Associate Job Training',NULL,840733417398800,'Train for a career working with young children! Briya Public Charter School offers a Child Development Associate (CDA) training program. The 10-month program prepares you for a career as an early childhood teacher or assistant teacher. During training, students learn educational theory and best practices while also getting hands-on teaching experience with children in a childcare or school setting.  \n\nUpon completion of the Child Development Associate training program, you will be prepared to take the national CDA exam and submit a work portfolio for certification review. You will also be certified in CPR/First Aid and ready to begin your new career! \n\nTo qualify for the CDA training, you must:  \nLive in Washington, DC \nBe at least 18 years old \nPass the entrance exam ','629348329513757','https://www.maryscenter.org/education/job-training/child-development-associate/',NULL,NULL,NULL,'789038541797078','Program Details: \nClasses are held Monday-Thursday; 6:00-9:00 pm (English or Spanish) or 12:30-3:00 pm (Spanish only) at Marys Centers Ontario Road site \n480 hours of practicum experience is required and arranged through Briya  \nRegister for the course or call (202) 232-7777 for more information.  \n\nMarys Center and Briya Public Charter School work together to provide health care, social services, and education for residents of D.C. ',NULL,NULL,NULL,NULL,'1307595059042459',NULL,NULL,'868012483124236,1263089203668614','732086812000340',NULL,NULL,NULL),(40,597642797256208,'Family Rapid Re-Housing',NULL,1245236106154921,'Everyone Home DCs Family Rapid Re-Housing Program provides short-term rental and utility assistance to families experiencing homelessness in Washington, DC. Families work with Rapid Re-Housing case managers to set goals for greater housing and economic self-sufficiency.\n\nEveryone Home DCs Family Rapid Re-Housing team and partners provide support through housing stability focused case management, employment preparation services, affordable housing search support, transportation assistance, mental health services, educational or vocational training, and related services to help make the transition to self-sufficient living possible.\n\nEveryone Home DCs Family Rapid Re-Housing serves 55 families in scattered site apartments throughout the District.','936934819762396','https://everyonehomedc.org/programs/family-rapid-re-housing/',NULL,NULL,'Verified','929094559121639','Referrals for the Family Rapid Re-Housing Program come from The Community Partnership for the Prevention of Homelessness.\n\nIf you know a family encountering a housing crisis that they cannot resolve on their own, they can access homelessness prevention advice and program assistance referrals exclusively through the Virginia Williams Family Resource Center (920 Rhode Island Ave NE, Washington, DC 20018 | (202)-526-0017), the central intake for DCs coordinated homelessness assistance system for families.',NULL,NULL,NULL,NULL,'735608882009072','832596400468443,1170433044969408',NULL,'877243931325915,1292849277583603','811198505758894',NULL,NULL,NULL),(41,598601043584489,'PrEP Program for HIV Prevention',NULL,1093127605400642,'The PrEP Clinic at Andromeda offers comprehensive sexual health services, including pre-exposure prophylaxis or PrEP, to persons at risk for HIV/AIDS. The PrEP Clinic was created to provide the DC metropolitan population with easy access to healthcare providers who support the utilization of PrEP for HIV prevention.\n\nThe PrEP Clinic is housed at Andromeda, a non-profit health services organization that has been in operation for more than 48 years. Andromeda provides HIV/AIDS treatment services, substance use treatment, primary care and mental health services, nutrition counseling, and health promotion and education. Andromeda is a multicultural organization that understands and supports the needs of all persons, including: LGBT persons, substance users, sex workers, and immigrant populations. Our staff will work with you to address your needs and develop strategies to support your health.','841307455613093','Andromeda Transcultural Health',NULL,NULL,'Verified','941516382466411','Call for appointment',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,NULL,'1224638786118966',NULL,NULL,NULL),(42,600624054710125,'Tools for Survivors',NULL,809193297555798,'This webpage offers guided information about various concerns related to sexual assault and rape. Please visit this website to learn more.','728145736382163','http://dcrcc.org/counseling/no-straight-path/tools-for-survivors/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Visit website.\n',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(43,605724148465394,'Model Cities Senior Wellness Center',NULL,1180598613249590,'Model Cities Senior Wellness Center offers a variety of comprehensive programs, classes and activities designed to educate and promote active and healthy aging for older adults in DC. Free for DC residents 60 years of age and older. Come join us to learn, socialize, and engage in some fun healthy activities!\n','1261619093567791','https://www.seaburyresources.org/model-cities-senior-wellness-center',NULL,'info@seaburyresources.org','Verified','637158405241810,789038541797078','Call to apply for services.',NULL,NULL,NULL,NULL,'1117976446223168','1176087327224268',NULL,'854808174954754','708859571613221',NULL,NULL,NULL),(44,607894816484467,'Civics-focused English Classes',NULL,1116810105858975,'The ESL classes complement the civics classes by providing practice in oral, written and reading English in order to enable candidates to pass the English portion of the citizenship exam. Class activities include conversation practice with outside groups of volunteers who come every other week to talk to our students and help them improve oral comprehension and speaking skills. Classes are offered Wednesdays, 6-8 PM and Saturdays, 12:30-2:15 PM.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009,789038541797078','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','1184118914852207,568535831537843',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(45,611590713528319,'Sustainability',NULL,930909694635560,'A financial assistance program for families including:\n- Direct financial assistance\n- Budgeting classes\n- Tax filing','906651913636867','https://lortonaction.org/youth-programs/',NULL,NULL,'Verified','1077790582995406','Call to register. Walk in during registration hours.',NULL,NULL,NULL,NULL,'906987068756792','1229690477859335,892622133517119,876311376686616,600743088526043,1256920432035968',NULL,'1292849277583603','1276944443091304',NULL,NULL,NULL),(46,612611049847328,'Hypothermia Program',NULL,1187372282686349,'For more than 20 years The Father McKenna Center has responded to the needs of men without a home for a safe and predictable environment during the cold nights of winter. While DC has a Hypothermia Hotline, many of our guests do not feel safe in emergency shelter environments, and there is not support for their transition through homelessness, only maintenance of their status quo.\n\nOur Hypothermia/Transition Program is application based, and each applicant meets with his Case Manager to ensure commitment to the goals and structure of the Program. Men are approved for participation in the Program based on an assessment of their readiness to move toward the next step on their journey out of homelessness, whether that step is a job, a temporary or permanent housing situation, or stability on the road to sobriety or mental health.\n\nWe open on November 1st and operate every night until March 31. The Hypothermia/Transition Program offers the men shelter for the night, a shower, a home-cooked evening meal, and time to work on their personal plan or to socialize.\n\nThe Program has two exceptional characteristics: it builds a cohort and it reintroduces family interactions.\n\nEach year we provide shelter for a consistent group of 18-20 men. This is not a drop-in program, rather the same men join us each night until they find stable housing or reunite with their community. This opportunity to build a bond of trust in a predictable environment cannot be underestimated. The state of homelessness is characterized by chaos and, too often, by fear. We believe the Hypothermia/Transition Program offers a place of not just physical shelter. It also provides a mental and emotional place of safety that allows each man to focus on moving his life forward.\n\nThe success of the Hypothermia/Transition Program is made possible by the consistent and loving support of the Gonzaga Mothers Club (GMC). Each season, the GMC and their families commit to cooking and serving the evening meal for 20 men for over 150 nights! Even more remarkable, this is not simply a drop-off service. The meals are brought to the Center by families, who then stay to serve and eat with the men. The act of breaking bread together, sharing conversation, and engaging as brothers and sisters in Christ breaks down barriers and allows everyone at the tables to see each other as individuals. This removal of the us/them divide is a tremendous gift for both our guests and our volunteers.','1209121324412172','https://fathermckennacenter.org/what-we-do/hypothermia-program/',NULL,'info@fathermckennacenter.org','Verified','929094559121639','Have to be approved in an application process. Call or walk in for more information.',NULL,NULL,NULL,NULL,'1123859846194392','1063950960307708',NULL,'625195015492370,1263089203668614','645829762063748',NULL,NULL,NULL),(47,606631780927132,'English Classes',NULL,840733417398800,'Free English Classes for DC Parents\nDC parents can take advantage of free English classes through our trusted partner, Briya Public Charter School! Course details are below: \n\nAll levels are welcome  beginner to advanced  \nAdult students must live in DC and have a child/children ages 0-12. \nParents and young children learn together; while parents learn English and other skills, young children attend the Briya early childhood program \nProgram has open enrollment and weekly registrations throughout the year. \nClasses are Monday-Friday; morning session 9:00-11:30 am; afternoon session 12:30-3:00 pm \nTo register, please complete our online form or call (202) 232-7777\nYou may bring your young children (up to age 5) to school with you ','629348329513757','https://www.maryscenter.org/education/english-classes/',NULL,NULL,NULL,'789038541797078','All levels are welcome  beginner to advanced  \nAdult students must live in DC and have a child/children ages 0-12. \nParents and young children learn together; while parents learn English and other skills, young children attend the Briya early childhood program \nProgram has open enrollment and weekly registrations throughout the year. \nClasses are Monday-Friday; morning session 9:00-11:30 am; afternoon session 12:30-3:00 pm \nTo register, please complete our online form or call (202) 232-7777\nYou may bring your young children (up to age 5) to school with you ',NULL,NULL,NULL,NULL,'1307595059042459',NULL,NULL,'915486946336080','732086812000340',NULL,NULL,NULL),(48,627629263527494,'Homebuyer Support',NULL,574964812525513,'Offers support to people looking to buy a home. Training sessions are available that go over the various aspects of buying a home. Info is given on Affordable Dwelling Units as well. ','947853021041099','http://housingetc.org/homebuyers/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call our main number (202-667-7006) and ask about scheduling a counseling appointment or attending a workshop. If you decide to meet with a housing counselor then you might be asked to ',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,NULL,'1138176448388213',NULL,NULL,NULL),(49,629844217460402,'CNCS: AMERICORPS: NCCC',NULL,647276391431213,'More than 1,000 young people, ages 18-24,serve on teams and address environmental projects,diaster preparedness and response,education, public safety, and other unmet human needs.','1201917781354008','http://nationalservice.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'651786461883664',NULL,NULL,NULL),(50,570068555050262,'Clothing Closet ','Labor of Love Human Service Center',877366768823409,'Our closet provides casual and professional wear for men and women. Donations are accepted year-round.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','911225335803318','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(51,593910008000184,'Anacostia Road Apartments',NULL,1085960322097234,'Anacostia Road Apartments consists of eight affordable one-bedroom apartments for formerly homeless or at risk individuals and families.\n\nAnacostia Road Apartments represents part of the Coalitions expanded mission to help at-risk D.C. residents become self-sufficient. The tenants are fully independent and the Coalition maintains only a resident manager on site for those who may need additional support.','545659771156125','http://www.dccfh.org/programs/permanent-housing/permanent-housing-for-families-and-individuals/',NULL,NULL,'Verified','929094559121639','Call to inquire about openings and eligibility.',NULL,NULL,NULL,NULL,'1202903945491491','1202819882057306',NULL,'966756126649195','1056162087894961',NULL,NULL,NULL),(52,595263959299318,'MARSHALL HEIGHTS COMMUNITY DEVELOPMENT ORGANIZATION',NULL,844234717265246,'Offers housing assistance through a Homebuyers Club, HPAP and Housing Counseling programs. Also provides business, economic and workforce development programs. Specializes in assessment, job development and placement, education and vocational skills training','1116781625364190','http://MHCDO.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'802890951138045',NULL,NULL,NULL),(53,599402007780126,'Assertive Community Treatment (ACT)',NULL,802521051916688,'The Assertive Community Treatment (ACT) teams provide comprehensive, community-based, psychiatric treatment, rehabilitation, and support to persons with serious and persistent mental illness. ACT clients often have co-occurring problems with addiction, homelessness, criminal justice involvement, physical illness, and violent victimization. ACT teams embrace the nationally established Evidence Based Practice Model for ACT and achieve a high level of fidelity to the model. Teams are composed of a psychiatrist, nurse, licensed team supervisor, a peer support specialist, and rehabilitation support staff. Staff may develop sub-specialties in group services, substance abuse treatment, forensic services, parenting interventions, and vocational rehabilitation. ACT teams have small caseloads and work as a tight knit interdisciplinary unit to create opportunities for growth and recovery.','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'637158405241810,941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(54,623011864568715,'Third Street',NULL,904943826975100,NULL,'1307285743296604','http://www.thirdstreet.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'770770456719894',NULL,NULL,NULL),(55,627323919512057,'Housing & Community Development',NULL,1140996665222837,'The Housing & Community Development Department (HCD) spearheads the integration of place-based and people-based strategies focusing on systemic change within housing, transportation, and community development on the local, state, and national level. The HCD houses the Fair Development Coalition, a grassroots partnership; housing advocacy & development; the Langley Park Crime Prevention Collaborative; and the Housing Matters Campaign.  Our goal is to achieve transformational change through strategic planning, coalition building, effective advocacy, and implementation.','1091435530922324','https://wearecasa.org/programs/410/',NULL,NULL,'Verified','929094559121639','For more information please contact Government & Strategic Relations Specialist: Julio Murillo  jmurillo@wearecasa.org',NULL,NULL,NULL,NULL,'1184988992731200',NULL,'1095190489836587',NULL,'836261919910340',NULL,NULL,NULL),(56,633712201049185,'Wellness Recovery Action Program',NULL,883186000200856,'A peer led self-advocacy program designed to promote peer support and develop a tool-box for building resilience. These groups offer adult and adolescent peers.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810,941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(57,633702102837581,'Shelter & Housing',NULL,682552065545256,'With 92 beds, SERVE Family Shelter is Northern Virginias largest family homeless shelter. On average, more than 40 percent of shelter guests are children. Shelter guests stay an average of 36 days, and during that time, work with a case manager who helps connect them with the right tools, knowledge and resources for lasting well-being and self-sufficiency.','764854375292129','https://www.nvfs.org/our-services/homelessness-housing/serve-campus/',NULL,NULL,'Verified','929094559121639','Please call to confirm capacity.',NULL,NULL,NULL,NULL,'837377238916897,964860483808020',NULL,'645633521716641','877243931325915,1292849277583603','1341470966230086',NULL,NULL,NULL),(58,636733000958441,'DC Prevention Center Wards 1-2',NULL,1323195974089796,'LAYCs hosts the DC Prevention Center Wards 1 & 2 (DCPC), an initiative of the DC Department of Behavioral Health (DBH), serving as a dynamic hub that engages, supports, and helps connect the many community elements that are needed for promoting healthy children, youth, and families as well as a drug-free District of Columbia. The theme of the DCPC: Strong CommunitiesIts About Youth, Families, and Caring Adults.\n\nThe DCPC is designed to strengthen and mobilize communities to prevent substance abuse amongst youth in Wards 1 and 2 by disseminating education and increasing awareness about alcohol, tobacco, and other drugs; identifying community leaders and building community prevention networks to prevent substance abuse in their communities; facilitating Community Conversations and coordinating community forums to strengthen community capacity and address priority risk and protective factors by implementing evidence-based strategies; and providing training and technical assistance for community prevention networks. All of the strategies implemented by the DCPC are based on Substance Abuse and Mental Health Services Administrations (SAMHSA) Strategic Prevention Framework (SPF).\n','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/dc-prevention-center-wards/',NULL,NULL,'Verified','637158405241810,789038541797078','Call or email for more information.',NULL,NULL,NULL,NULL,'1256499247956610','920999838182205,1016645181977967','1278696466858509','1295679372454826','1288365969354186',NULL,NULL,NULL),(59,580520440912412,'Infectious Disease',NULL,840733417398800,'Marys Center providers are highly-trained and equipped to treat patients with infectious diseases such as HIV, Hepatitis, Tuberculosis, sexually transmitted infections, and many others. Our Infectious Disease team will work with you to identify, manage, and treat your diagnosis with the utmost care. Marys Center provides quality care for a variety of infectious diseases including:  \n\nBloodstream, bone, and joint infections \nComplicated urinary tract infections \nFungal and skin infections \nHIV/AIDS  \nLyme disease \nMalaria and other tropical diseases \nMeningitis \nSexually transmitted infections \nStaphylococcus aureus infections, including MRSA \nWhile many infectious diseases can be prevented by vaccines, frequent and thorough hand-washing also is one of the most effective ways to protect your health, and always talk to your healthcare provider before any international travel. \n','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/infectious-disease/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,NULL,'903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(60,581022793280171,'Support for People Living with HIV/AIDS',NULL,574964812525513,'HCS administers the Metropolitan Housing Access Program (MHAP), the centralized source for housing services and housing information for persons living with HIV/AIDS (PLWHA) in the District of Columbia, Prince Georges County, MD and Charles County, MD. ','947853021041099','http://housingetc.org/metropolitan-housing-access-program-mahp/',NULL,NULL,'Verified','929094559121639,1077790582995406','MHAP services differ depending on where you live. Visit website to find out which MHAP services are available in your jurisdiction:',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,'780785826421817','1138176448388213',NULL,NULL,NULL),(61,588693422814528,'The Career Gateway!',NULL,855094084464049,'The Career Gateway! offers intensive training, take-home materials, a long-term mentor and individual attention for mid-level managers and other professionals who are seeking employment at age 50+.','924628911683577','https://accessjca.org/career-gateway/',NULL,NULL,'Verified','970915508638448','Registration for this five-day workshop is just $75 thanks to generous funding from Montgomery County Aging and Disability Services and the Morris and Gwendolyn Cafritz Foundation. Call to apply.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'854808174954754,1114978823107611,1178794928615970','1050035692418764',NULL,NULL,NULL),(62,596938254485583,'Inpatient Detoxification Program',NULL,1265431689708141,'Our inpatient detoxification program is medically supervised for individuals with alcohol and drug addiction. This short-term substance abuse rehabilitation program addresses medical and psychiatric factors associated with dependency. After completing our inpatient substance abuse treatment program, our staff will help the patient find additional mental health services in DC, or the surrounding area, to continue their recovery.','1289140698414142','https://psychinstitute.com/treatment-services/adults/adult-detoxification-program/',NULL,NULL,'Verified','941516382466411','Its easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'1263089203668614','1045297656470568',NULL,NULL,NULL),(63,595461104582359,'Workforce Development',NULL,692112692154000,'Throughout our many years of service, A Wider Circle has seen far too few people rise out of poverty. Those who have reached independence did so, in large part, because they got jobs and had the support of others. Our Workforce Development Program is a holistic, intensive, and highly personalized approach to preparing adults to enter the workforce and advance in their careers. As with all our efforts to end poverty, our workforce readiness programming is rooted in the power of connections. Partnerships with community employers are key to connecting job seekers with jobs and area businesses with excellent staff members.\n\nBoot Camps and Workshops\n\nDSC_0242 cropOur intensive, 40-hour Boot Camp combines career planning with the soft skills that employers seek. Topics include goal setting, conflict resolution, and phone etiquette, as well as hands-on support and practice with resume writing, cover letters, and interviewing. Following the Boot Camp, each job seeker is paired with a job coach from the community.\n\nBoot Camp workshops are held six times a year at A Wider Circles Professional Development Center\n\nFor job seekers who cannot attend our Boot Camp (and for Boot Camp graduates who would like a refresher), we offer workshops and one-to-one job search assistance appointments during which participants get personalized attention from volunteers.\n\n \n\nProfessional Clothing\n\njohnA Wider Circles Professional Development Center  through which we serve more than 2,000 individuals each year  has a showroom of professional attire and accessories that is better than Bloomingdales and nicer than Nordstrom.\n\nAnyone in need of professional attire and accessories is welcome, regardless of whether or not they are enrolled in our classes. Each client is scheduled with a personal shopper who assists him or her in selecting outfits, accessorizing, and feeling confident.','610894518918920','http://awidercircle.org/workforcedevelopmentprogram/',NULL,'alicia@awidercircle.org','Verified','911225335803318,970915508638448','To set up an appointment to receive professional attire and accessories, please contact Alicia Donahoe at alicia@awidercircle.org.',NULL,NULL,NULL,NULL,'877523491860439','646160018921336,1236548249618145',NULL,NULL,'1154169690232586',NULL,NULL,NULL),(64,602650991439185,'Foster Grandparents',NULL,761153930697275,'UPOs Foster Grandparent Program trains low-income seniors with caring spirits to provide attention, guidance, and support to DC children in a variety of local settings, including early education centers, elementary schools, hospitals, and youth programs.\n\nVolunteering as a foster grandparent is the perfect opportunity for individuals aged 55 and older to share their experience and wisdom with children who will cherish the lessons to be learned.','594960886051316,999755198000719','https://www.upo.org/foster-grandparents/',NULL,NULL,'Verified','637158405241810','Call to apply or apply online. For more information, contact Foster Grandparent Program Director Cheryl Christmas at 202-610-5826 or cchristmas@upo.org.',NULL,NULL,NULL,NULL,NULL,'587544010010943,940897095189363,682372519823224','1242020855566510',NULL,'1304904589817191,1166860713798541',NULL,NULL,NULL),(65,607074649518713,'Health & Nutrition',NULL,612828763371641,'Mazique provides high-quality health services including oral health, mental health and nutritional services while continuously developing culturally and linguistically appropriate growth and support for our children and families.','836904778271068','https://www.mazique.org/services/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'1200602057472122','888042423183025',NULL,NULL,'626820886744559',NULL,NULL,NULL),(66,612309985819526,'Community Meals',NULL,804045327953048,'Delivers meals to various agencies and non-profits around the DC area. You must receive meals at those agencies, you cannot get meals individually directly from DC Central Kitchen.\n\nEvery day with the help of dedicated volunteers, we transform 3,000 pounds of otherwise wasted food into 5,000 healthy meals for our community. These arent simply bags of donated groceries or crates of canned goods  theyre real meals, made by hand by graduates of our Culinary Job Training program who now work for us full-time at living wages. We then put these meals onto our fleet of trucks and deliver them to more than 80 partner agencies in the Washington metropolitan area, including homeless shelters, rehabilitation clinics, and after-school programs.','771634087422781','https://dccentralkitchen.org/community-meals/',NULL,NULL,'Verified','832990803111047','No application process. Services are provided to various agencies and non-profits.',NULL,NULL,NULL,NULL,'819191608404189',NULL,'932493235875618',NULL,'730657096706420',NULL,NULL,NULL),(67,609582364629457,'Adult Medicine',NULL,605134586578120,'\n		Wellness Visits\n		Sick Visits\n		Flu Shots\n		Physicals\n		Comprehensive Screenings for disease detection (blood pressure, blood sugar, cholesterol etc.)\n		Diagnosing, treating, and helping patients manage acute and chronic illnesses','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,'1263089203668614','651804021834110,1128987918758522',NULL,NULL,NULL),(68,615519347288251,'AimHire Job Placement',NULL,791950857737387,'Being both jobless and homeless is a vicious cycle. You cant get a job when you dont have a place to live, and you cant get a place to live without a job. AimHire offers people a way out. This program utilizes the Employment First Model to empower participants who are experiencing unemployment to find jobs.\n\nWe take a personalized approach with each and every participant, helping them assess their skills and interests. Participants in our program are often able to draw from past work experience. Many have been displaced from the workforce by a major life event and simply need tools and services to reconnect and make their job-search process less difficult. We look at the barriers to stable employment, such as incarceration, felonies and substance abuse, and address special accommodations participants need.\n\nOur staff consists of employment specialists supported by a dedicated team of skilled volunteers. Volunteers provide one-to-one mentoring on a wide variety of job readiness topics, provide resume writing assistance, and help participants submit job applications online in the AimHire computer lab. They also help create job opportunities by reaching out to potential employers in the community.','876397346396032','https://friendshipplace.org/programs-outreach/aimhire-job-placement/',NULL,'aimhire@friendshipplace.org','Verified','970915508638448','AimHire holds an orientation session every Wednesday at 10 am at the AimHire office, located at 5100 Wisconsin Ave NW, Suite 520 Washington, DC 20016. To attend and become a participant in the program, call us at 202.248.0496 or email us at aimhire@friendshipplace.org.',NULL,NULL,NULL,NULL,'1167551989292288','813982796684360',NULL,'1070225300187916','668005555469731',NULL,NULL,NULL),(69,617097787641398,'New Parent Support',NULL,1195870505334629,'Moms and dads of children under three can benefit from our Healthy Start Program. These free services provide pregnant women, new moms and their families with the support and encouragement they need. We help you strengthen the bond between you and your child right in your home. We come to you!\n\nWith Healthy Start, you will receive:\n\nEducational and fun home visit sessions (for those who qualify)\nSupport for when you feel tired or worried\nTips on how to care for and bond with your baby\nHelp with getting daycare, WIC, medical care and other resources\nInformation about birth control and breastfeeding\nFood and fun at parent support group sessions for mom and dad\nDiapers and baby supplies when needed','1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411,637158405241810','For more information on how to join Healthy Start, please contact Marsha Greaves, Program Director, at 202.407.7747.',NULL,NULL,NULL,NULL,'763524779006557','922694115907703,1197713243335218',NULL,'915486946336080','920259856619905',NULL,NULL,NULL),(70,615186024715740,'Intensive Outpatient Services',NULL,883186000200856,'Treatment for Substance Use for Adolescents and Adults','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(71,615914620488320,'DC Office on Aging',NULL,874266502610128,'Older Adult Service and Information System (OASIS) offers challenging programs in the arts, humanities, health, wellness, travel, and volunteer service. This national growth program creates opportunities for adults 55 years of age and older to continue their personal growth and meaningful service to the community. (202) 362-9600 Ext. 560.\n\nSeniorWorks II is a structured internship program for District seniors seeking short-term volunteer opportunities and assignments working in public and private agencies, sponsored by the DC Office on Aging. Part-time volunteer internship assignments are generally limited to three months or less, with a small stipend provided to defray the intern/volunteer\'s travel and other workplace expenses. \n\nThe Older Workers Employment and Training Program is funded with a grant from Department of Employment Services. The program provides employment and training opportunities for District residents 55 years of age and older. Services are provided under Title I of the Act, and emphasize the development of employment and training opportunities through job search assistance workshops, on-the-job training, job development, and placement and classroom skills training. The Office is an active one-stop partner in the District of Columbia Workforce initiative. \n\nThe McMasters program sponsored in partnership with McDonalds\' Corporation helps older workers adjust to the work-a-day world. Its goals are to build an individual\'s confidence, self-esteem, and provide a job opportunity that fits into his/her life style and personal schedule.','1223680649678241','www.dcoa.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(72,620920746047249,'SPANISH CATHOLIC CENTER: DENTAL CLINIC',NULL,624726610902590,'Provides dental care for children and adults including restorative and preventative treatments. Referrals for surgery and emergency treatments are given if needed.','1297060122320888','http://www.catholiccharitiesdc.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1091712845549464',NULL,NULL,NULL),(73,621104147916374,'COMMUNITY COUNCIL FOR THE HOMELESS AT FRIENDSHIP PLACE',NULL,791950857737387,'Provides street outreach, addiction counseling, referrals, a medical clinic, psychiatric care and case management services all aimed at giving the homeless men and women in Northwest Washington assistance in rebuilding their lives by addressing their basic needs.','931886810745529','http://cchfp.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1152494666421051',NULL,NULL,NULL),(74,632654541686281,'Family Engagement Programs',NULL,1279230501938511,'We are committed to ensuring parents and caregivers are both supported and supportive. Our Family Engagement program helps strengthen the home-school relationship for our students and connects caregivers to critical resources.\n\nOur family engagement efforts include:\nA Home Visiting Program, which provides caregivers essential support during their childs critical early years.\nThe Parenting Journey, a course that allows caregivers to reflect on how they were parented as children, and supports them to make intentional parenting decisions to ensure strong outcomes for their children.\nA partnership with Healthy Futures, which offers resources and trainings on social-emotional development.\nOur program also offers education to caregivers, connecting them to a range of vital resources related to parenting, financial literacy, and adult education.','947434898715713','https://marthastable.org/family-engagement-program/',NULL,NULL,'Verified','637158405241810,1077790582995406,789038541797078','Call to apply.',NULL,NULL,NULL,NULL,'1235881686916009','1128449542578572,799792178245127',NULL,'1292849277583603,915486946336080','1273798320035626',NULL,NULL,NULL),(75,642373200193088,'Unity Health',NULL,1043772486617212,NULL,NULL,'http://unityhealthcare.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(76,645815813705213,'Raising SAFE Kids',NULL,948113581207578,'We offer a comprehensive, in-depth curriculum for parents of children of all ages.\nOUR  TOPICS INCLUDE:\nBullying\nHuman Development\nPositive Reinforcement\nDiscipline\nThe Impact of Technology/Social Media\nManaging Anger\nSetting Limits\nRaising Resilient Children\n\n','911858349594317','https://www.wearecsc.org/parenting',NULL,'info@wearecsc.org','Verified','637158405241810,789038541797078','Please call to apply.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'915486946336080','921919612082211',NULL,NULL,NULL),(77,645384002034771,'Miriam\'s House',NULL,1186080684764999,'Miriams House,  a Housing First model, provides permanent supportive housing for formerly homeless women who are living with HIV and AIDS. Up to 25 women live and work together on managing and improving their physical health while addressing other self-sufficiency goals, which can include addiction recovery, mental wellness, education, employment, income, and long-term housing.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(78,590895767819582,'Healing Circle',NULL,948113581207578,' Collaborative Solutions for Communities (CSC) in partnership with the DC Department of Corrections is committed to helping women successfully transition home to their families. CSC has 20 years of experience helping families discover and uncover their own strengths and abilities to heal and build futures together. Through Healing Circles, and one-on-one family supportive services, participants will find the strength and confidence to rebuild their lives and reconnect with their families.','911858349594317','https://www.wearecsc.org/training-institute',NULL,'info@wearecsc.org','Verified','637158405241810','Clients will be referred by the department of corrections. You can call or email for more information.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'836091364973509,664148755918958','921919612082211',NULL,NULL,NULL),(79,597026276891169,'Adult Day Health Program (ADHP)',NULL,1326157862705937,'Purpose: \n\nThis program was designed to provide medically supervised adult day services to DC residents who are home-bound with chronic health problems and can benefit from various supervised therapeutic activities in an integrated community \n\n \n\nServices:\n\nParticipants will receive services based on the individuals assessed needs (plan of care) and the participant-centered service plan. Services will include but are not limited to:\n\nNursing Services\nIndividual and Group Therapeutic Activities Including Social, Recreational and Educational Activities\nMeals (breakfast, lunch and snack based on individual dietary requirements)\nIndividual and Group Counseling for Participants and Families\nPersonal Care Assistance\nMedication Administration, Assistance and Counseling\nTransportation\nNutritional Services & Education\nCommunity Outings\nSafe and Secure Environment & Respite for Caregivers While Enrolled in the Program.','959978038980815','http://www.mbihs.com/what-we-offer/adult-day-health-program-%28adhp%29',NULL,' cbrown@mbihs.com        ','Verified','941516382466411,637158405241810','Eligibility\n\nApproved by Medicaid in DC, medicare, other accepted insurance, & private pay\nAge: 55 or older\nHave chronic medical condition\nIncome up to 150% of federal poverty level\nHave an assessment determination form authorizing/specifying level of need for ADHP Services\n ',NULL,NULL,NULL,NULL,'929037191615824,1211781059829341',NULL,NULL,'822271561821597,1279872477210132','817410769508748',NULL,NULL,NULL),(80,605446506944549,'Transitional Housing Program',NULL,1306699628219808,'SBYs Transitional Housing Program offers service-enriched apartment-style living for families exiting emergency shelters in the District of Columbia.\n\nInitiated in collaboration with the Community Partnership for the Prevention of Homelessness, SBY grants ten families exiting city shelters seamless access to transitional housing units at Belmont Crossing Apartments. Residents receive a wide range of housing, case management, employment assistance, life skills education and other positive youth development services. Continuously updated, individualized service plans for each resident are geared towards the overall goal of assisting families in transitioning to independent or subsidized permanent housing.','818297935399976','https://www.sashabruce.org/programs/safehomes/transitional-housing-program/',NULL,'nharris@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program.',NULL,NULL,NULL,NULL,'1248521145824482','882054301651193',NULL,'877243931325915,883345659611536,1292849277583603','876404395390211',NULL,NULL,NULL),(81,610721171447543,'Medical ',NULL,775874603891849,NULL,'903707682119815','https://www.some.org/services/healthcare#medical',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'962036505121926',NULL,NULL,NULL),(82,615988503257217,'Adult Psychotherapy',NULL,840733417398800,'Life can throw unexpected challenges your way and its important to know youve got someone to rely on when things get tough. Our compassionate and affirming behavioral health care team offers help and hope when you need it most. You can rely on the qualified team at Marys Center for your needs including:  \n\nIndividual Therapy: Sometimes lifes challenges are hard to face alone. When you come to individual therapy, a Marys Center therapist will work alongside you to address a lingering challenge, inspire change, and help you improve your overall quality of life.\nFamily and Couples Therapy: Coming to therapy as a family can be a beneficial tool towards healing. We offer understanding, confidential talk therapy for couples and families who want to improve their communication and resolve conflict in a healthy way. \nGroup Therapy: Expressing your challenges to others who are in a similar circumstance can be very healing. Group therapy at Marys Center is led by one or more of our trained therapists in a safe, confidential and supportive setting.  \nPsychiatry: For many people, medication is an integral part of mental health recovery. If you and your individual therapist decide medication is needed, our psychiatrists are available for ongoing medication management services. \nWhatever your challenge, our highly-trained therapists can meet your needs. Our team of providers specialize in a variety of behavioral health needs including:\n\nAnxiety \nDepression \nEmotional or physical trauma, including post-traumatic stress disorder (PTSD)  \nLGBTQIA needs \nMaternal mental health \nSubstance Abuse','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/adults-and-seniors/therapy/',NULL,NULL,NULL,'941516382466411','Marys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below:  \n\nTo make an appointment, call (844) 796-2797 anytime \nIf you are a current behavioral health participant and need to contact Marys Centers Behavioral Health department directly, please call: \nDCBehavioral Health Direct Line (202) 851-3671  \nMaryland Behavioral Health Direct Line (240) 839-3401 \n\nBehavioral Health Services are by appointment only Monday-Friday from 8:00am to 6:00pm (other hours by arrangement).\n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1345728742501995','1134877289644712,827996522503929,601427652072887',NULL,'1263089203668614,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(83,626403044236059,'Interview Interpretation',NULL,1116810105858975,'Qualified staff members may accompany a citizenship applicant who is eligible for the language exemption (under the 55/15 or 50/20 rule) and provide interpretation services. Those who need assistance should contact our office as soon as they receive their notice to appear for the interview before USCIS.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009','Call for services as soon you receive a notice to appear for your interview before USCIS.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(84,638393936667053,'Recovery Support Services',NULL,883186000200856,'Recovery Support Management assists clients with the implementation of the recovery support plan.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(85,642012149083751,'Outreach Program',NULL,644694600510926,'Our outreach team is responsible for engaging the DC community in regards to prevention of substance abuse, mental illness, and homelessness.  The outreach team is comprised of community support workers, and clinical team from Neighbors Consejo.  Our goals are to involve the community in reforming disadvantageous behavior and cognition, develop relationships with residents, and continued education for a better future.','818839794992906,788509441386056','http://neighborsc.org/en/our-programs/outreach-program/',NULL,NULL,'Verified','637158405241810','Call (888) 793-4357.',NULL,NULL,NULL,NULL,'1114638904926849,963948373745242,1104511203133237','779790908267690',NULL,NULL,'1231516890380928,926785180984945',NULL,NULL,NULL),(86,647183151936796,'Neighbors First Individuals',NULL,791950857737387,'Neighbors First Individuals empowers highly-vulnerable individuals who are experiencing chronic homelessness together with a serious disability (such as mental health challenges, addictions, or physical illnesses) to transition into housing and begin rebuilding their lives. Neighbors First Individuals, unlike Neighbors First Families, serves single adults. Both Neighbors First Families and Neighbors First Individuals are Permanent Supportive Housing (PSH) programs, meaning participants receive long-term case management support to ensure housing stabilization, a maximum level of self-sufficiency, and an overall better quality of life.\n\nNeighbors First Individuals follows the Housing First model, which removes all barriers to housing, including sobriety requirements, and places participants directly into their own apartments from the street or shelters using a scattered site approach. Once housed, wraparound case management support addresses the medical, psychiatric, substance use, and/or employment needs of the participant.\n\nThe Housing First model welcomes participants as they are and favors flexibility over rules. It is person-centered, nonjudgmental, and non-coercive. The participants themselves drive the process, while case managers are there to help them achieve individual goals such as recovery, health, financial stability, education, reconnection with family, or employment.\n\nThe Housing First approach is extraordinarily effective, as evidenced by our housing stability rates of greater than 98 percent.`','931886810745529','https://friendshipplace.org/programs-outreach/neighbors-first-individuals/',NULL,NULL,'Verified','929094559121639','Neighbors First Individuals receives referrals directly from the Department of Human Services (DHS), through DCs Coordinated Entry System. If you are currently experiencing homelessness and would like to be assessed for the Neighbors First Individuals program, you must complete an assessment at our Welcome Center or at numerous other outreach and drop-in centers within the District.\n\nTuesday is by appointment only.',NULL,NULL,NULL,NULL,'1235107925689722','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'1244888069012632,877243931325915','1152494666421051',NULL,NULL,NULL),(87,657511678545226,'Immigration Legal Services',NULL,1116810105858975,'CARECENs legal department helps community members navigate the confusing and intimidating immigration process. The program seeks to facilitate Latino immigrants transition to the United States, reunite families, secure work authorization and economic security, and seek legal relief and justice for victims of crimes and abuse. Specifically, the low- or no-cost services provided include assistance with naturalization, family visa petitions, consular processing, obtaining and maintaining Temporary Protected Status, and filing for U Visas. In addition to direct services, CARECENs legal department educates community members through Know Your Rights forums on topics including immigration, civil rights, and notario fraud.\n\nAnnually, our legal staff provides direct service to more than 3,000 community members in the following areas:\n\nAssisting eligible youth to apply for deferred action (click here for more info)\nAssisting eligible Lawful Permanent Residents in applying for U.S. citizenship.\nAssisting with renewal of Employment Authorization Documents.\nAssisting residents in obtaining and maintaining Temporary Protected Status (TPS).\nHelping families reunite through assistance with family visa petitions, adjustment of status and consular processing.\nAssisting eligible clients obtain Lawful Permanent Residence under the provisions of the Nicaraguan and Central American Relief Act (NACARA).\nObtaining legal relief for victims of criminal acts under the U Visa program.\nProviding court representation for individuals in removal proceedings.\nHolding individual consultations, educational workshops and immigration clinics to provide information on legalization under existing laws and proposed measures for reform.\nProviding referrals of complex immigration cases to pro bono and low cost attorneys.','547920365968268','http://carecendc.org/direct-services/immigration-legal-services/',NULL,'info@carecendc.org','Verified','917725171609009','By-appointment Immigration Consultations are available on the following Saturdays in 2018.  Pre-payment is required to reserve your appointment.',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(88,660868979951197,'Operation Backpack',NULL,726173106231202,'Remember going back to school as a child with all your new supplies & backpack, maybe even your Trapper Keeper! That excitement is what children all over Washington D.C. will be experiencing in just a few weeks, but some are not ready and need our help. Parents often cannot afford to purchase the supplies when forced to choose between new shoes for school or a new backpack.\n\nOperation Backpack is Central Union Missions program designed to help low-income families have the needed supplies.','838780960881380','https://www.missiondc.org/what-we-do/family-programs/school-readiness-program/',NULL,NULL,'Verified','911225335803318','Call to inquire about receiving a backpack. Go online for donation guidelines.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(89,662641889613680,'Anchor Counseling Services',NULL,1331447374298751,'Are you living with depression, addiction, or just too much stress? Anchor Counseling Services, part of Catholic Charities free-standing mental health clinic, is here to help. Tap into our 50-plus years of experience providing professional counseling and supportive guidance for reflection, exploration, and self-improvement.  You can schedule your one-on-one appointment with our licensed professionals when it works best for you.\n\nOUR SERVICES\nOur licensed mental health professionals at Anchor Counseling Services can provide one-on-one counseling to assist you with:\n\nDepression\nAnxiety\nBipolar Disorder\nSelf Esteem\nGrief and Loss\nAnger Management\nSubstance Abuse\nTrauma/PTSD\nRelationship/Intimacy\nFamily Dynamics\nStress management','1012923803825523','http://catholiccharitiesdc.org/page.aspx?pid=366',NULL,NULL,'Verified','941516382466411','Call to set up an intake.\n\nWe accept Amerihealth,Trusted, Medstar, DC Medicaid, Medicare, Optimum (previously United Healthcare), and most CareFirst BlueCross/BlueShield insurance plans. We will verify your insurance coverage once you schedule an initial consultation appointment and provide you with information regarding any co-pays or deductible you might have.  If we do not accept your insurance or if you dont have insurance, you can still see one of our therapists and pay the appointment fee ($125/hour). Fees and co-pays are due at the time of service.  We accept Visa and MasterCard.',NULL,NULL,NULL,NULL,'1188739171637564','1309930863286628',NULL,NULL,'638813775258256',NULL,NULL,NULL),(90,616047069998063,'Reading and Educating to Advance Lives','REAL',855094084464049,'REAL connects volunteers with children and their parents through literacy and health activities in Department of Health and Human Services waiting rooms. Volunteers read, talk about shapes/letters/numbers/colors, talk about healthy foods, draw and color, do activity sheets, etc. with children who are present. Volunteers also offer free books for children to take home with them. Sites in Germantown, Rockville, and Silver Spring.','924628911683577','https://accessjca.org/interages/',NULL,NULL,'Verified','789038541797078','Call to find out more.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'761929300455945,854808174954754','1050035692418764',NULL,NULL,NULL),(91,616081055315775,'Survivor Resilience Fund',NULL,983721114373124,'Through our Survivor Resilience Fund, DASH provides emergency financial assistance to help survivors address needs which might threaten their permanent housing, help them achieve safety, and gain the support they need to move forward with their lives. This innovative fund can cover a number of expenses including home security measures, utilities, moving costs, legal or medical fees and first months rent. In addition to determining what financial support is needed, DASH staff will go over a safety and wellness plan with survivors to help equip them to remain safe while in the community. Providing survivors with financial support such as this can mean the difference between housing stability and life on the streets.','828792720206018','https://www.dashdc.org/programs-services/safe-housing/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(92,617081192222015,'English and Adult Education',NULL,1140996665222837,'CASAs classes utilize a combination of communicative task-based learning and Popular Education techniques. Lessons are focused upon concrete and practical everyday experiences. Students, as adults, come to class with experiences they are encouraged to share and peer teach while performing tasks. Class materials are geared towards students life experiences and promote both civic engagement and community empowerment.','818820237164190,1091435530922324,979563581148756,1240567562394258','https://wearecasa.org/programs/education/',NULL,'rcusic@wearecasa.org','Verified','789038541797078','Call to apply or apply online. Visit our website to see when each class is offered at the various locations.',NULL,NULL,NULL,NULL,'958973665695309','615195958300567,940374540509771,878447457899091','789879098577824','656944907385650','612619690370287,836261919910340,1210638555366240,987608607195027',NULL,NULL,NULL),(93,623630268141505,'Training and Education',NULL,769893937425938,'Wendt Center experts provide on-site training on numerous subjects relating to adult and child grief and trauma. From skill building techniques in play therapy to in-depth presentations on traumatic bereavement, our trainers share knowledge gained from current direct practice and extensive training and research opportunities. As active members of the National Child Traumatic Stress Network and the International Society for Traumatic Stress Studies, we strive to provide stimulating, interactive presentations that fuse clinical experience with state of the art theory and research.','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(94,626861523724993,'Supported Independent Living',NULL,906742630902911,'Woodley House owns and leases apartments and condominiums throughout Washington, DC for our residents who can thrive without 24-hour care as they reintegrate into the community. The Supported Independent Living Program is the last step before total independence. Residents live on their own or with roommates in a shared apartment environment with continuing monitoring and support from Woodley House Life Skills Trainers. Staff provide weekly coaching, counseling support and skills training, focusing on mastering basic skills that will ease their transition toward self-sufficiency and successful independent living.',NULL,'https://woodleyhouse.org/residential-care/supported-independent-living/',NULL,NULL,'Verified','929094559121639,637158405241810','Referrals are accepted from the Department of Behavioral Health, Core Service Agencies, private providers, hospitals and families.\n\nPrivately-paying residents need a psychiatrist who can include Woodley House in the residents treatment plan and thereby provide a referral to Woodley House. Privately paying residents can come from outside Washington, DC and must demonstrate proof of their ability to pay.\n\nResidents who require financial assistance must show proof of Washington, DC residency, be enrolled with the DC Department of Behavioral Health (with an eCura Number) and have a recommendation from their Core Service Agency to apply to Woodley House and have access to public funding assistance. The Core Service Agency will provide the resident all necessary documentation.\n\nThe cost for residents are determined on a sliding scale, including fees, skills training and clinical support services. For more information about how to enter our Supported Independent Living Apartment Program, please contact:',NULL,NULL,NULL,NULL,'966435484864334',NULL,'1215015803426176',NULL,NULL,NULL,NULL,NULL),(95,640103169037193,'Food Pantry',NULL,915322254234555,'A food pantry for those in need.','671468679071199','https://www.reformationdc.org/in-the-community',NULL,NULL,'Verified','832990803111047','Walk in during hours. You do not need an ID but it\'s helpful if you do. You will need to provide your name, address, and the number of people in your household. You can only visit the food pantry once every 60 days because we have limited amounts of food. \n\nWe prefer that only DC residents visit because we are limited but we wont turn anyone away if they are in great need.',NULL,NULL,NULL,NULL,'852143936371728','647305599401067',NULL,NULL,'948985953505133',NULL,NULL,NULL),(96,642284944498747,'Mobile Outreach',NULL,810479025131545,'A mobile service providing outreach to the DC area providing support and referral to sex workers. Services may be provided on the mobile site, referred back to headquarters, or referred to another agency.',NULL,NULL,NULL,NULL,'Verified','637158405241810,941516382466411,929094559121639','If you are curious about the mobile clinic\'s locations, call. Otherwise, head to the main location for services.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','905292149512870,1180568407412895,1078769706102153',NULL,NULL,NULL,NULL,NULL,NULL),(97,647772152541651,'Neighbors First Families',NULL,791950857737387,'Neighbors First Families provides Permanent Supportive Housing (PSH) and support for highly-vulnerable, chronically homeless families. All participants in the program are provided with permanent housingalong with comprehensive long-term case managementto ensure a better quality of life and stability. Our case managers serve the needs of each member of the family. This can include help with individual goals, health, financial stability, education, reconnection with family, employment and more.','931886810745529','https://friendshipplace.org/programs-outreach/neighbors-first-families/',NULL,NULL,'Verified','929094559121639','Neighbors First Families and Neighbors First Individuals receive their referrals directly from the Department of Housing Services, through DCs Coordinated Entry System. If you are currently experiencing homelessness and would like to be assessed for Neighbors First Program eligibility, you must complete an assessment at our Welcome Center or at numerous other outreach and drop-in centers within the District. If you are a family experiencing homelessness, you are required to complete program eligibility screening at the Virginia Williams Family Resource Center located at 920-A Rhode Island Ave NE, Washington, DC 20018.\n\nTuesday is by appointment only.',NULL,NULL,NULL,NULL,'1235107925689722','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'1244888069012632,877243931325915,1292849277583603','1152494666421051',NULL,NULL,NULL),(98,651504031814159,'Evening Program',NULL,801110030219864,'Thrive DCs Evening Program offers a safe, peer supported environment for women and children.\n\nSince 1979 we have always reserved dinner for women and their dependents, as they often face the greatest challenges in the face of homelessness and poverty.\n\nDuring the Evening Program, we offer dinner, showers, laundry, emergency groceries, enrichment and therapeutic activities, and a safe place.\n\nEvening Schedule\nEach evening we serve 20  40 women and their dependents. The schedule is as follows:\n\n2:00 PM  Program opens, clients & volunteers arrive.\n3:00 PM  Meal is served and groups meet for arts, fitness, other group activities.\n4:00 PM  Program is over and the floor is closed. The office remains open until 5:00 PM.','1220597047470925','https://www.thrivedc.org/programs/dinner/',NULL,NULL,'Verified','832990803111047,637158405241810','If you need assistance, please call one of our case managers at (202) 737-9311.Case Management at Thrive DC\n\nYou can also come directly to our offices:\n\nMonday  Friday\n8:30 AM  2:00 PM (Men & Women)\n2:00 PM  4:00 PM (Women Only)\n1525 Newton St. NW\nWashington, DC 20010\n\nWe are located on the bottom level of St. Stephen and the Incarnation Episcopal Church. No appointment necessary, just come in and ask for one of our case managers.',NULL,NULL,NULL,NULL,'665113076769939','1183059385696004',NULL,'836091364973509,1274396898894043,877243931325915','962322435473993',NULL,NULL,NULL),(99,657179015884472,'Activities','Kensington Clubs',855094084464049,'The Kensington Club programs are planned and implemented by our professional staff of Certified Therapeutic Recreation Specialists and activities leaders. Activities are tailored to meet members needs, strengths and interests.\n\nActivities and services include:\n\nStimulating discussions on a broad range of topics from current events to history, art and literature\nPhysical and cognitive exercise\nReminiscing activities\nGuest entertainers and speakers\nMusical programs\nTherapeutic art programs\nField trips to local areas of interest\nCaregiver education and support\nMorning coffee and catered lunch\nInformation and referral to community resources','924628911683577,805806723754090,1179174778771993','https://accessjca.org/kensington-clubs/',NULL,NULL,'Verified','637158405241810','For information or to schedule a visit, please call.',NULL,NULL,NULL,NULL,'958720616157709,898009380902296','600730005000820,878694033728814,1149591818853041',NULL,'618828421943202,854808174954754,1157835357284365','1050035692418764,1203002351100645,594266389872303',NULL,NULL,NULL),(100,668000665510895,'\"TERRIFIC, INC. (WARD 1): CASE/CARE MANAGEMENT\"',NULL,1284728776860892,'Provides Case Management services.','882333039588739','http://terrificinc.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'891450530336608',NULL,NULL,NULL),(101,668729683192909,'Food Program',NULL,1004391421304549,'Adventist Community Services of Greater Washington (ACSGW) collects food donations from throughout the community and keeps it available at our center at 501 Sligo Avenue for people who need some assistance. Community members needing assistance can come to the center and discuss their needs with a case worker during our regular hours (Monday - Thursday from 10:00am -2:30pm). Qualified clients can visit the center once a month for food.\n\nThe food that is available varies throughout the month. It just depends on what ACSGW has received. Typically, we have nonperishable food, such as canned goods and pastas, as well as perishable food, such as fruits and vegetables. Sometimes we meat or poultry for our clients. Usually, we also have breads.\n\nPeople needing food must first visit our center to talk with a case manager to explain their need and provide the information necessary to ensure they meet current qualifications. You can request an appointment with a case manager by calling us at 301-585-6556 or sending an e-mail using the form, below. People who qualify can receive food the same day. Since we often provide more food than a person can carry, you should consider bringing a shopping cart or someone else with you to help you carry the food home.','950009053464384','https://www.acsgw.org/food.html',NULL,NULL,'Verified','832990803111047','An appointment is required, please call to make an appointment.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(102,666406976354887,'Supportive Employment',NULL,883186000200856,'Supported employment program is to provide evidence based support and assist with employment services for our clients. Through a multi-tiered method of wellness, we will help clients with obtaining education and skills for employment opportunities.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','970915508638448,637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(103,667209917494721,'The Behavioral Health Feeding and Eating Disorders Program',NULL,1061724977026001,'The Behavioral Health Feeding and Eating Disorders Program offers comprehensive evaluation and treatment planning for children and adolescents with eating disorders. Depending on the need of the individual, this includes an evaluation by a psychiatrist for diagnostic clarification, therapeutic treatment and medication management (if indicated) of the eating disorder and any accompanying conditions (such as depression, anxiety disorders and behavioral issues). Other aspects of the evaluation and treatment include parent consultation with a nutritionist, family-based or individual therapy and medical monitoring with referral to pediatrics/adolescent medicine as needed. \nWe also offer comprehensive evaluation and treatment planning for infants and young children with feeding disorders. Depending on the needs of the individual patient, this may involve some or all of the following: a psychiatric evaluation, including the observation of a family meal and play time, as well as evaluation for need of medication management. This is done as part of a multidisciplinary assessment in collaboration with a nurse practitioner, a nutritionist and gastroenterologist, and consultation with speech and occupational therapy. \n\nParent training for management of eating and other behavioral concerns. \n\nOur Focus\nAnorexia Nervosa\nBulimia Nervosa\nBinge Eating Disorder\nAvoidant Restrictive Food Intake Disorder, (ARFID) including Infantile Anorexia, Sensory Food Aversion, Post-Traumatic Feeding Disorder and other food intake disorders.\nEvidenced-Based Therapies Offered for Eating Disorders\nFamily Based Therapy (FBT) in the Maudsley Treatment Model for Anorexia Nervosa\nCognitive Behavior Therapy for Bulimia Nervosa, Anorexia Nervosa and Binge Eating Disorders','1282604214927911,856126341619748,979447652621070','https://childrensnational.org/departments/the-behavioral-health-feeding-and-eating-disorders-program',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'978304346911390','892012398827551,1095419747725144,587218394770946',NULL,'1274396898894043','928813128095347,787442654546775,1067302604787333',NULL,NULL,NULL),(104,605774245554167,'Community Resources',NULL,743525753773182,'A guide to community resources by type and as downloadable PDF resources are available for LGBTQ community, a cross-reference is also available through the alphabetical directory of LGBTQ organizations.','1161706256775181','https://lgbtq.dc.gov/service/community-resources',NULL,NULL,'Verified','637158405241810','Walk in or download from the website.',NULL,NULL,NULL,NULL,'918350012207483,804590542957247,688693608343237','1118971527369692',NULL,NULL,'882267988490168',NULL,NULL,NULL),(105,613307132570587,'Tools for Loved Ones',NULL,809193297555798,'This webpage offers guidance for people the loved ones of victims of sexual assault and rape. Caring for a loved one who is a survivor of sexual assault is difficult and this website offers guidance.','728145736382163','http://dcrcc.org/counseling/no-straight-path/tools-for-loved-ones/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Visit website.\n',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(106,615976785591225,'Tutoring',NULL,1116810105858975,'As the exam date nears, CARECEN offers individual tutoring to those who need intensive practice before their interview. Candidates are paired up with volunteer tutors and they meet at CARECEN, typically twice a week, to practice their English and answering the exams history and government questions.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009,789038541797078','Call or walk in to get more information on getting tutoring services.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(107,614149741156528,'Culinary Job Training',NULL,804045327953048,'For almost 30 years, DC Central Kitchens Culinary Job Training program has helped more than 1,700 men and women launch culinary careers. We care about our students potential much more than their pasts, and work to prepare adults facing high barriers to employment for careers in the food service industry. Thanks to our generous donors, all admitted students receive full scholarships to attend our program, so there is no cost to our students at any point in their training or in the two years of post-graduation support we provide.\n\nWe offer two training options:\n\nCulinary Job Training at DC Central Kitchen:\n\nOur renowned training program provides culinary arts education, career readiness training, and real-world internships for adults who have experienced barriers to employment. Through this fourteen week course offered at our headquarters (425 Second Street NW), trainees will prepare to earn two valuable credentials, including the ServSafe Food Protection Manager Certification. Learn more about Culinary Job Training at DC Central Kitchen>>\n\nCulinary Job Training at DC Central Kitchen Cafe:\n\nDC Central Kitchen Cafe provides hands-on culinary training and career readiness training to young adults ages 18-24 who are not in school and not working. With enrollment offered the first Monday of each month, trainees will progress through the course at their own pace as they work alongside staff at our fast-casual cafe located on the campus of THEARC (1901 Mississippi Avenue, SE).\n\nCareers and Opportunities:\n\nOur graduates work across Washington, DCs thriving culinary industry, including top restaurants, large hotels, corporate cafeterias, local artisans, hospitals, schools, and universities.\n\nEmployers interested in hiring DC Central Kitchen graduates can contact our Chief Programs Officer, Kim Brown, at kbrown@dccentralkitchen.org.\nUpcoming CJT at DC Central Kitchen Class Flyer\nVIEW\nCJT at DC Central Kitchen Cafe Flyer','1277910214924473','https://dccentralkitchen.org/enroll/',NULL,NULL,'Verified','970915508638448','Apply online.\n\nThanks to the generous support of individual, foundation, corporate, and government partners, DC Central Kitchen pledges to meet 100% of demonstrated financial need for all admitted students. The per-student cost for the Culinary Job Training program at DC Central Kitchen Cafe is $14,084 (includes Tuition: $5,192; Books: $65; Licensing and Certification Fees: $127; Required Equipment $670; and other kitchen, occupancy, and stipend expenses totaling $8,030).',NULL,NULL,NULL,NULL,'819191608404189',NULL,'790340031601441','1070225300187916,1222973168897685','730657096706420',NULL,NULL,NULL),(108,630366887360887,'Teen Clinics ',NULL,1043772486617212,NULL,'768745938934251,933134498085222,806168781795597',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(109,636134392103308,'Phase IV',NULL,1318451956583107,'Each resident goes through four phases of treatment. In Phase 4, residents are now employed and preparing for re-entry while supported by counseling.','1147455525775238','http://cleanandsoberstreets.org/How_It_Works.html',NULL,NULL,'Verified','637158405241810','You must have been admitted and gone through the previous phase of this four phase program. We accept referrals from the DC Department of Behavioral Health.',NULL,NULL,NULL,NULL,'883461165895110',NULL,NULL,'1244888069012632','711002699024806',NULL,NULL,NULL),(110,637113061667348,'Nutrition Counseling',NULL,840733417398800,'You probably know eating whole, nutritious food leads to improved health, but many of us need a little guidance. There is so much conflicting diet information, it can be hard to know whats best for youespecially if you or a loved one have a complex health condition.  \n\nAt Marys Center, you can trust our knowledgeable and friendly nutritionists to guide you and your family to better health through better food. Our nutritionists are co-located within the medical area and the Women, Infant, and Children (WIC) program to provide all the nutrition counseling necessary to ensure your family stays well fed. When you visit Marys Center for nutrition counseling, you will:   \n\nFind nutrition resources, education, and individual and group nutrition counseling  \nGet help navigating your WIC and SNAP benefits \nReceive nutrition guidance while you are breastfeeding your baby  \nLearn about managing chronic conditions through your diet \nRegardless of your needs, our nutrition counselors will be by your side to build a better diet, increase your vitality, and improve your overall health.','964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/nutrition-counseling/',NULL,NULL,NULL,'832990803111047,941516382466411','Marys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below:  \n\nTo learn more about WIC or make a WIC application appointment, call (202) 232-6679 \n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','621996763448625,747443860105703,598752576659212,1283475567989779',NULL,NULL,'962742212670581,732086812000340',NULL,NULL,NULL),(111,637918031832415,'Behavioral Services for Homeless Youth',NULL,1323195974089796,'LAYC is excited to bring the Behavioral Services for Homeless Youth Program (BHHY) to D.C. as a way to end youth homelessness and improve overall health and wellbeing.\n\nBHHY is a federally-funded program that provides services to youth ages 17-24 who are experiencing homelessness and are using substances.\n\nTREATMENT APPROACHES\nEvidence Based Practices (EBPs):  Motivational Interviewing, Trauma Focused  Cognitive Behavioral Therapy, Adolescent Community Reinforcement Approach\nCase Management: linkage to community resources, psycho-education, advocacy\nLife-Skills Groups: money management, time management, communication and healthy relationships\nReferrals to drug testing for youth receiving SUD treatment\nWHO IS ELIGIBLE?\nYouth between the ages of 17 and 24 experiencing homelessness and using substances\nResidents of the District of Columbia\nSERVICES\nLinking youth to housing, employment and other resources\nProviding Individual Mental Health and Substance Use Disorder counseling\nTeaching Life Skills (Professional Development, Goal Setting, etc.)','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/behavioral-services-for-homeless-youth/',NULL,NULL,'Verified','941516382466411','Call or email for more information. Referral form is available on website.',NULL,NULL,NULL,NULL,'1080778313579001,665879809068779','920999838182205,1016645181977967','1328428091308050,697976339958489','1295679372454826,883345659611536,877243931325915','1288365969354186',NULL,NULL,NULL),(112,639340474137848,'East of the River Health Center (Ward 7) ',NULL,1043772486617212,NULL,'806168781795597',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1090011879898457',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(113,644091225156703,'50+ Employment Expos',NULL,855094084464049,'Over 50 & Looking for Employment?\n\nAt our annual 50+ Employment Expos, you can:\n\nnetwork with area employers and community resource organizations,\nget a free rsum review, and\nlearn new job-search skills.\nThere are dozens of employers with available jobs and community resources to help with your employment search.','924628911683577','https://accessjca.org/employment-expos/',NULL,NULL,'Verified','970915508638448','This is offered a few times a year so check the website or call for information on the most current upcoming exposition.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403',NULL,NULL,'854808174954754,1114978823107611,1178794928615970','1050035692418764',NULL,NULL,NULL),(114,644620777168393,'Immigration and Naturalization',NULL,1141864402494387,'Immigration and Naturalization\nAs a large percentage of the Asian Pacific Islander community consists of immigrants, the APALRC provides legal assistance on immigration and naturalization cases. Because of complex U.S. immigration laws, language barriers, cultural preferences and traditions, the APALRC helps immigrants access and navigate the U.S. justice system.\n\nThe APALRC provides assistance in adjustment of status, consular processing, Deferred Action for Childhood Arrivals (DACA), Employment authorization, family-based petitions, Naturalization, Removal hearings, T visas, temporary Protected Status (TPS), U visas, Violence Against Women Act (VAWA) petitions.\n\nThe APALRC has created individual projects to help specific groups of people.\n\nReaching for the Dream Project: helps undocumented youth immigrants secure temporary deportation reprieve and employment authorization under President Obamas Deferred Action for Childhood Arrivals program (DACA).\n\nJustice for Filipino Teachers Project: provides legal representation to Filipino teachers trafficked to the U.S. under fraudulent labor contracts\n\nNew Americans Campaign: an area network of immigration legal providers assisting eligible legal permanent residents become naturalized citizens.  ','1264011549910449','https://www.apalrc.org/immigration/',NULL,'helpline@apalrc.org','Verified','917725171609009','Call for services',NULL,NULL,NULL,NULL,'1010201225467528',NULL,NULL,'884944905632896','1018319997039351',NULL,NULL,NULL),(115,671489333574807,'Child Sponsorship',NULL,1276678931351667,'Working with Families and groups to provide opportunities for children in need. Through partnerships sponsoring children and families at hoome and internationally.',NULL,'http://www.nazareneoutpostministries.org/programs-and-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(116,674557198522049,'Medical Interpretation',NULL,887352348953420,'In order to ensure equal access to healthcare for Limited English Proficient individuals, La Clnica provides medical interpretation in over eight languages and American Sign Language (ASL) on-site and at community health organizations and local hospitals. We are D.C.s only non-profit provider of health-related interpreter services to government agencies and healthcare organizations, among them the DC Department of Health Care Finance (DHCF), Department of Health (DOH), and other Federally Qualified Health Centers (FQHCs). Medical interpretation is paired with navigation to help clients prepare for office visits, complete intake forms, attend appointments, receive treatment instructions, and arrange follow-up visits. Our model combines personalized attention, community knowledge, and linkages with a professional language services operation, including a streamlined and efficient claims-based billing system.','1170113060894673,868710877316469','https://lcdp.org/_en/programs-language-access.html',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359,887062299451299','1202170493625306,686273477676422,1136144186376874',NULL,'670413521970743,1295679372454826','1080723808883365,1214063268443455',NULL,NULL,NULL),(117,682802249776984,'Hepatitis, HIV, and STD Treatment ',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(118,619922899003410,'Senior Helpline',NULL,855094084464049,'JCA can help you find the senior services you need within the Greater Washington, D.C. area  housing, home care, recreation and more  through the Rose Bent Lee Senior HelpLine and the Steven M. Reich HomeCare Resource Center.','924628911683577','https://accessjca.org/information-and-referral/',NULL,NULL,'Verified','637158405241810','To talk with an Information & Referral Specialist, call us at 240.290.3311 or 703.652.1515, or send an email.',NULL,NULL,NULL,NULL,'904979906912360,879017523095473','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(119,627760898509669,'Escorted Transportation','Connect-A-Ride',855094084464049,'This program serves eligible low-income residents of Montgomery County who are unable to travel alone. Customers must require assistance due to physical, cognitive or emotional impairment. The program assists with transportation to medical appointments, grocery stores and other destinations.','924628911683577','https://accessjca.org/connect-a-ride/',NULL,'Escorted.Transport@AccessJCA.org','Verified','632609508449013','For information or to enroll, call 240.395.0915 or email Escorted.Transport@AccessJCA.org.',NULL,NULL,NULL,NULL,'1256462778437672,826005584996919','1276016050822057',NULL,'1262399029280424,854808174954754','1050035692418764',NULL,NULL,NULL),(120,639467846851619,'Online Housing Resources',NULL,810479025131545,'An online group of resources providing information on various housing services around DC.',NULL,'https://www.hips.org/housing-resources.html',NULL,NULL,'Verified','929094559121639','Visit website to check out the resources.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(121,642601279257974,'Clothing Closet',NULL,1150695227682882,'A clothing closet providing clothing to those in need.','994308933727557','https://assumptiondc.org/outreach/',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'576203813370859,1068293081202730','924548406180044',NULL,NULL,'1245750861687096',NULL,NULL,NULL),(122,646395612481753,'Transitional Rehab Program',NULL,1114103792920259,'Provides residential housing and supportive services to 40 homeless men. Services include food, substance abuse counseling, case management, employment and housing placement assistance. Washers and dryers are available on the site. Dormitory style sleeping for 40 men. Projected length of stay is 6 months.  La Casa has bilingual staff in English and Spanish.\n\nTransitional housing is affordable supportive housing designed to provide housing and appropriate support services to persons who are homeless or who are close to homelessness. The transition is to help them be more self sufficient to move towards independent living on their own. Transitional housing locations are oftentimes called Halfway Houses. The naming of the two (Halfway House OR Transitional House) is oftentimes interchangeable.\n\nMany Transitional Housing programs are subsidized and are income based. Income based transitional housing generally charges 30% of your income for rent when you do have income. Contact the transitional housing facility to see if this applies.\n\nServices provided at transitional housing facilities varies from substance abuse treatment, to psychological assistance, job training, domestic violence assistance, etc. The assistance provided varies, but it is generally affordable and low cost housing. Read the descriptions of each of the transitional living locations for more detailed information. Transitional housing facilities also may or may not assist with alcohol and/or drug substance abuse treatment.Drug And Alcohol Rehab programs are intended to treat alcohol and/or drug dependency.  The cost of participating in one of these programs and the method of treatment range significantly. The database operated on this website only includes residential rehab programs (not outpatient programs). We also provide Access to Recovery (ATR) Grant programs for substance abuse treatment. ','595592759444028','https://www.shelterlistings.org/details/31468/',NULL,NULL,'Verified','929094559121639','Fees may apply for this Transitional Housing resource. Contact La Casa Transitional Rehab Program with the contact information we provided to get full details. Oftentimes you can apply for sliding scale fee payment or other options if you are low income. You will need to speak with them to see if you qualify.',NULL,NULL,NULL,NULL,'1213542765723083','1179201057626161',NULL,'877243931325915,625195015492370','855901575106743',NULL,NULL,NULL),(123,644648091160119,'Eden House',NULL,1186080684764999,'Located in N Street Villages flagship building, Eden House is a 51-unit apartment complex that provides affordable housing for low- and moderate-income families and individuals.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(124,651208869509343,'Health Home Program',NULL,883186000200856,'A multidisciplinary team which advocates and coordinates primary health and behavioral health services for clients.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(125,653156323573606,'Seminars',NULL,1276678931351667,'Parenting and Relationship Workshops. Wedding Services available.(Pre marital Counseling required.)','1001921907887485','http://www.nazareneoutpostministries.org/programs-and-services/',NULL,NULL,'Verified','637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'842254025136504',NULL,NULL,'915486946336080,1292849277583603,651281137045548','753150645151105',NULL,NULL,NULL),(126,653858529595915,'Next Steps Program',NULL,1341330878033407,'The Next Step Program provides job assistance, a pre-GED course, and services to individuals living with HIV/AIDS.\n\nCaseworkers and staff help to:\n\n- Develop a plan to find a place to live\n- Identify and apply to shelters and transitional housing programs\n- Get ready for successful employment through STRIVE\n- Develop a professional resume and prepare for job interviews\n- Learn how to use computers to search for employment and submit online job applications\n- Set-up and use e-mail to apply for jobs\n- Obtain a valid photo ID\n- Select appropriate clothing for a job interview\n- Receive mail and phone messages from potential employers\n- Complete applications for benefits such as Social Security and food stamps\n- Apply for medical benefits and find medical care\n- Enter detox and recovery programs\n- Find legal advice\n- Develop a personal spending plan','1108000021700211,948736838709158,1229901678210145,880015218951352,955920420939787','http://samaritanministry.org/program',NULL,NULL,'Verified',NULL,'Visit the office nearest you between 9am-11am, Monday through Friday to complete the intake with a caseworker.',NULL,NULL,NULL,NULL,'1313749480020796,1278070780621235,1116577714869583,929291849442144,907595396415056,809087167806044,779145162518714,1240962571903687,798196836607721','1315075616326203,901698481561498,899511741518736',NULL,NULL,'915426938281998,1291310824415800,931556635311387,757642919857969,1125465450764814',NULL,NULL,NULL),(127,671724061345975,'Rape Crisis Hotline',NULL,809193297555798,'For people in crisis, our hotline offers 24 hour services.','728145736382163','http://dcrcc.org/counseling/no-straight-path/crisis-intervention/',NULL,NULL,'Verified','878986697513222,637158405241810','Call our hotline 202-333-RAPE (7273)',NULL,NULL,NULL,NULL,'1248802193472840','745214673411437',NULL,NULL,'782477248679291',NULL,NULL,NULL),(128,672042329600890,'Park Road Transitional Program',NULL,1085960322097234,'Park Road Transitional Program can accommodate up to 12 men who are homeless and are in transition from a substance abuse treatment program emergency shelter or other crisis situation.\nAlong with other trained staff, a Program Director is onsite to manage shelter operations. A Social Worker helps to formulate and facilitate an Individual Service Plan (ISP) to include helping the participant obtain and remain in permanent housing, helping develop independent living skills, stabilizing his recovery from substance abuse and finding employment.','593420875501329','http://www.dccfh.org/programs/transitional-housing/park-road-transitional-program/',NULL,NULL,'Verified','929094559121639','Referral by area shelters, District government agencies, drug rehabilitation facilities, or other social services organizations required.',NULL,NULL,NULL,NULL,'731145721900218,1210092478249256','1202819882057306',NULL,'877243931325915,625195015492370,866965462945330,1244888069012632,868012483124236','1196769672934076',NULL,NULL,NULL),(129,670644496333952,'Toddlers',NULL,580772169029651,'For children 19 months+, the Toddler Program builds upon the Infant Program by introducing new activities and learning opportunities that foster the social, emotional, physical and intellectual development of your child. We use the Creative Curriculum, a play-based learning curriculum, in our toddler classrooms. The physical learning environments are designed to promote creativity through self-discovery and trial and error.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'628619044391936','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(130,672539129008408,'Domestic Violence',NULL,769893937425938,'The Wendt Center provides specialized crisis intervention and counseling services to survivors of domestic violence, including children.','1108850981657232,1166799153375505','https://www.wendtcenter.org/domestic-violence/',NULL,NULL,'Verified',NULL,'Call the National Domestic Violence Hotline 24 days, 7 days a week, anywhere in the country: 800-799-SAFE.\nFor the DC Domestic Violence Hotline call 202-749-8000.\nFor an appointment call the Wendt Center 202-624-0010.',NULL,NULL,NULL,NULL,'1071202278113160,801719759212724,1137743103213639','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(131,678882337307747,'Holocaust Survivor Program',NULL,970560028876577,'JSSA provides multiple services for Holocaust survivors living independently in the community.\n\nServices include:\n\n- Limited urgent needs assistance\n- Claims assistance\n- Ongoing care management\n- Homemaker assistance\n- Personal care assistance\n- Emergency call system in your home\n- Pro bono dental program\n- Pro Bono eye care program\n- Meals on Wheels (Kosher meals delivered to your home)\n- Escorted transportation to medical appointments\n\nJSSA can also offer counseling/mental health services that are insurance reimbursable.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/holocaust-survivor-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'752956657718236','1328302797893590,1218692669680880',NULL,NULL,NULL),(132,685821962980238,'Mental Health Treatment',NULL,1323195974089796,'LAYCs Behavioral Health Treatment Team uses various approaches. This includes the Trauma Focused Cognitive Behavioral Therapy (TF-CBT), including medication management, and other rehabilitation services. The TF-CBT approach is a systematic treatment approach grounded in cognitive-behavioral therapy. It is developed for children/youth that have experienced trauma and are exhibiting symptoms that may have a profound and long-lasting negative impact on their daily functioning, health, and safety. CBI Services are time-limited, intensive mental health services delivered to youth who have a history of involvement with Child Protective Services or Juvenile Court, a history of negative involvement with schools due to behavioral issues, or are at risk of out-of-home placement due to negative behavior or emotional challenges.\n\nWHO IS ELIGIBLE?\nYouth between the ages 12 to 21\nResidents of the District of Columbia\nYouth experiencing emotional, psychological, or behavioral problems\nSERVICES\nAssessment\nIndividual, group, and family counseling\nCommunity Based Intervention\nCrisis intervention\nPsychiatric evaluations and medication management\nCommunity support\nReferrals\nLOCATION','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/mental-health-treatment/',NULL,NULL,'Verified','941516382466411','Call or email for more information.',NULL,NULL,NULL,NULL,'665879809068779','920999838182205,1016645181977967','1328428091308050','1295679372454826','1288365969354186',NULL,NULL,NULL),(133,688139575815288,'Bilingual Dispute Resolution Clinic',NULL,1116810105858975,'As part of an initiative launched in 2011, in partnership with the D.C. Superior Court, CARECEN offers bilingual dispute resolution services on-site twice a month to individuals with employment, consumer, tenant, and other issues.\n\nThis is a free, by-appointment clinic in CARECENs offices, held on the second and fourth Wednesday of every month. Community members with disputes involving unpaid wages, neighbor conflicts, tenant problems (security deposits and repairs), consumer problems (with vendors, contractors, auto shops, etc.), or other monies owed between individuals are pre-screened by CARECEN staff and scheduled for interviews with the Bilingual Dispute Resolution Specialist the day of the clinic. To be assisted during the clinic, at least one of the parties involved in the dispute must live or do business in D.C.','547920365968268','http://carecendc.org/direct-services/immigration-legal-services/',NULL,'info@carecendc.org','Verified','917725171609009','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(134,634028809032783,'Scattered-site Permanent Supportive Housing Program',NULL,787727417537507,'For clients under the scattered site PSHP, OAH case managers provide intensive mobile case management. All supportive services include supportive counseling, crisis intervention, financial management and assistance in receiving public benefits and referrals to resources and/or programs. OAH also connects residents with off-site services that include mental health and assertive community treatment, alcohol and drug abuse counseling, employment counseling, day programs, volunteer opportunities, self-help groups, medical treatment, and food pantries.\n\nOAH On-site Supportive Services:\n- Outreach and engagement\n- Orientation to building and apartment, assistance in obtaining subsidy\n- Financial management, help with activities of daily living\n- Supportive counseling, crisis intervention','920572231138004','https://openarmshousing.org/programs',NULL,'info@openarmshousing.org','Verified','929094559121639','You must be referred to our program through Coordinated Entry and the DHS.',NULL,NULL,NULL,NULL,'1130020356495609','819527791411716',NULL,NULL,'663934110398598',NULL,NULL,NULL),(135,635136975520891,'Skilled Nursing Facility',NULL,1220981589179778,'The United Medical Nursing Center (UMNC) is a licensed, full-service, 120-bed nursing facility that provides care for residents on the 6th and 7th floors of UMC. Credentialed physicians and nurses provide comprehensive nursing care and medical services  cardiovascular, pulmonary, general medical and rehabilitative services, as well as wound care management, and other needed care. In addition, social and therapeutic recreational activities are provided on a regular basis, as are other specialized services.','620132940242525','https://www.unitedmedicaldc.com/nursing-facility/',NULL,NULL,'Verified','941516382466411','Information and assistance in securing placement are available through the Admissions Department at 202-574-6979.',NULL,NULL,NULL,NULL,'1136418356307446','1100182510854387',NULL,NULL,'818226241830087',NULL,NULL,NULL),(136,635156280108722,'CONGRESS HEIGHTS SERVICE CENTER',NULL,659021595524966,'Provides Commodity Supplemental Food Program (CSFP) services.','674131229606594',NULL,NULL,NULL,'Inactive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1094251756466267',NULL,NULL,NULL),(137,636128659634571,'MIRIAM\'S KITCHEN',NULL,1043249662316489,'Every Wednesday, 12noon-2pm nearly 100 guests join Miriam\'s Cafe for a healthy lunch, the opportunity to access case management services, and the chance to participate in life skills classes.','1220017101351760','http://miriamskitchen.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'850193305992354',NULL,NULL,NULL),(138,641610186670486,'Suicide Grief Support',NULL,970560028876577,'A comprehensive program for specialized bereavement support for survivors of suicide loss, encompassing expert clinical training, counseling services, a support group, information and referral services, and community educational programs.','1104646684650585','https://www.jssa.org/get-help/adults-couples-and-parents/counseling/suicide-grief-support/',NULL,NULL,'Verified','637158405241810','Pre-registration required for the Support Group for Survivors of Suicide Loss. Email Ellen Lebedow at elebedow@jssa.org.\n\nFor more information about the Support Group for Teen Survivors of Suicide Loss, please contact Heidi Cohen, LCSW-C, at 301-610-8379.',NULL,NULL,NULL,NULL,'815545569707089','573957674876281,773649767743777',NULL,'586981821517675,1211730899647476','1328302797893590',NULL,NULL,NULL),(139,647232963972591,'Clothes Closet',NULL,1013543362848937,'We give away free clothes the second Saturday of every month (except July and August) from 11:00 am until 1:00 pm. No sign-up required.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'905425032669080','1146330288608786',NULL,NULL,'1190125799561725',NULL,NULL,NULL),(140,647808349539409,'Foggy Bottom Food Pantry',NULL,606016520179422,'The Foggy Bottom Food Pantry provides assistance to Washington, DC families in need. The Food Pantry provides fresh produce, meats, bread, cereal, and snacks.','791197553917784','http://www.theunitedchurch.org/new-events/2019/2/9/foggy-bottom-food-pantry-le83x',NULL,NULL,'Verified','832990803111047','Walk in. Clients should bring a photo ID showing their current Washington, DC address.\n\nPlease note the schedule is subject to change around Thanksgiving and Christmas. Check our calendar for openings.',NULL,NULL,NULL,NULL,'1303072516221458','884338031728165',NULL,'868012483124236,1274524177531453,565669778208779','1116967911199305',NULL,NULL,NULL),(141,648224105090520,'Child and Adolescent Health',NULL,1138775501034023,'Children and youth deserve quality, affordable, coordinated and culturally sensitive health services, mental health services and nutrition to learn, grow and thrive. DC Action for Children is the leading organization evaluating and working toward improvements in the District\'s comprehensive health services for children and youth.','1147823510376197','https://dcactionforchildren.org/our-priorities/health',NULL,NULL,NULL,'917725171609009','Call for information on our current projects.\n',NULL,NULL,NULL,NULL,'1139434629285592','1098590993104545',NULL,NULL,'792709813022086',NULL,NULL,NULL),(142,647361700663696,'Transitional Living Program',NULL,577764298046742,'This free service is for LGBT youth between the ages of 18 and 24 years old, and guarantees stable housing and support services for up to 18 months. This program requires members to complete 35 hours devoted to personal improvement, which can be combined with a school or employment program that helps them create a financial base and stability to thrive.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','599621071767378','1200832408072169,605403471620978,1222973168897685','603292299584681',NULL,NULL,NULL),(143,652574554780668,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS SEVEN AND EIGHT PREVENTION CENTER',NULL,932228398355792,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.','799908624348129','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'688999009453287',NULL,NULL,NULL),(144,656905764489449,'Latino & Immigration Services',NULL,577764298046742,'This is a unique program that meets the needs of LGBTQ immigrants from around the world. We understand the needs and constraints that have forced people to leave their countries of origin, escaping discrimination, fear, and rejection. Through this program, Casa Ruby seeks to improve living conditions and make it easier to transition to a new country.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','917725171609009','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','1189733668647287','1200832408072169,605403471620978,1340162113833071','603292299584681',NULL,NULL,NULL),(145,662348348100050,'Self-Help Office (SHO)',NULL,1093127605400642,'LCEs Self Help Office (SHO) empowers seniors through advocacy and community partnerships. A legal associate and volunteers provide direct assistance, helping more than 300 seniors each year. Services include, but are not limited to:\n\n- Providing information for requesting DC government services\n- Providing educational information on various legal topics;\n- Providing self-help guides;\n- Conducting public benefits checkups;\n- Helping  with the preparation of applications for public benefits;\n- Helping  write consumer complaint letters;\n- Providing referrals to social service agencies;\n- Providing information on filing small claims cases;\n- Providing information on small estate probate and recording deeds;\n- Providing information on requests for vital records;\nRequesting and disputing credit report information\n\nLCE believes there is no substitute for having staff \"on the ground\" in the community. We serve at six partnering locations:\n\n- Downtown Cluster/NW\n- Israel Baptist/NE\n- Capitol View Baptist/NE\n- IONA/NW\n- Bread for the City/SE\n- AARP DC State Office/SE','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/self-help-office.html?intcmp=AE-LCE-WWD-R1C2LL2',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','You must first call and make an appointment. ',NULL,NULL,NULL,NULL,'1262951146146675',NULL,NULL,NULL,'763163886168100',NULL,NULL,NULL),(146,658231090559812,'Thriving Together',NULL,970560028876577,'Led by a trained mental health professional from JSSA, Thriving Together provides premarital and married couples with the tools they need to:\n\n- Identify strength and growth areas\n- Increase communication and intimacy\n- Understand personality traits and dynamics\n- Improve conflict resolution skills\n- Reduce interpersonal stress\n- Create healthy expectations','977589590864235,1321118518935089','https://www.jssa.org/relationship-coaching/',NULL,NULL,'Verified','637158405241810','To learn more, please contact Kirsten Sidell at 301-610-8328 or ksidell@jssa.org.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'1211730899647476,835895554702710','863218507660277,1218692669680880',NULL,NULL,NULL),(147,668963134824856,'JOINT BASE MYER-HENDERSON HALL: ARMY COMMUNITY SERVICE (ACS)',NULL,888574254962004,'Provides assistance in accessing social services for service members, DoD Employees and their families.','1154204314985719','http://jbmhh.armymwr.com/programs/army-community-service-acs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1214906324166131',NULL,NULL,NULL),(148,665682144219766,'Blair Transitional Rehabilitation Program',NULL,1085960322097234,'Blair House is a large Transitional Rehabilitation housing facility that can serve up to 85 men who are 18 and older. The purpose of this program is to provide individuals with comprehensive supportive services which will enable them to return to independent living and to obtain employment. Men who are accepted into the program will be assigned to a case manager who will develop an individual service plan (ISP). The ISP targets goals that should be reached prior to and after leaving the program.','1254506542357377','http://www.dccfh.org/programs/transitional-housing/blair-transitional-rehabilitation-program/',NULL,NULL,'Verified','929094559121639','Monday, Tuesday, Thursday and Friday between 9:00 a.m. and 1:00 p.m. During the intake process, clients will be provide basic information such as name, date of birth and social security number. Complete an application for transitional services, and informed of the documentation needed to enter the program.',NULL,NULL,NULL,NULL,'963370820777327,1130023184198081,1083795033337940','1202819882057306',NULL,'877243931325915,625195015492370,866965462945330','1250736471490258',NULL,NULL,NULL),(149,673534610271949,'Psychiatric Evaluation',NULL,883186000200856,'An assessment to determine the source of the emotional and behavioral concerns and determine appropriate course of treatment','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536,1292849277583603,915486946336080','646846673243288,1261416234116596',NULL,NULL,NULL),(150,679830596478752,'Recovery Housing',NULL,1186080684764999,'Recovery Housing is a therapeutic community program for up to 21 women with co-occurring mental illness and addiction. Women work to stabilize their mental health and recovery with the support of each other, their recovery networks and our staff. Part of the process is to document and present your autobiography. Some residents explore their personal journey as participants in our Theatre Lab Life Stories partnership. By dramatizing their personal stories women are able to find and share their remarkable stories of courage and resilience.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,941516382466411,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(151,680052874958118,'Clothing Closet',NULL,866237660806724,'A clothing closet for those in need.','640375823525191','http://acamec.org/ministries/allen-food-pantry',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'654485576131912','1080981189328944',NULL,NULL,'632170755225855',NULL,NULL,NULL),(152,681767171553959,'There is No Straight Path',NULL,809193297555798,'Website offers interactive artwork to describe the complex nature of healing from sexual assault. \n\nImagining healing is one of the most challenging tasks asked of a survivor. The word itself conjures the visual of a spinning turntable as one navigates feelings of hopelessness, shame, anger, fear, doubt and anxiety. The wreckage caused by trauma can easily overwhelm and paralyze us, making us feel stuck and keeping us in crisis.\n\nDCRCC is committed to the belief that everyone can heal from trauma. We work to preserve individual agency in ones healing. We seek to build a hub of resources to enable individuals to have more models and greater access to tools and support. The premise of There is No Straight Path is to reframe healing as gathering tools and developing skills that begin to restore a sense of power and control. We offer the insight that healing is not a linear path but rather a spiral of resiliency. Like a winding labyrinth, the trials of regaining connection, battling loneliness, managing frustration, building trust, practicing self love and finding hope line a spiral circling outward as we emerge with new insights and more resources','728145736382163','http://dcrcc.org/counseling/no-straight-path/',NULL,'alindamood@dcrcc.org','Verified','878986697513222,637158405241810','Email or call for more information.',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(153,682308202362189,'Hospitality Institute',NULL,1323664977480953,'The Hospitality Institute is an addition of CHGWs existing workforce readiness curriculum created in partnership with Accenture, which provides an opportunity for youth to gain critical career skills through skills training, career coaching, and experiential learning. The six-week curriculum includes 29 hours of classroom and web-based professional skills training followed by on-the-job shadowing. After completing the six-week course, participants will have obtained industry recognized Guest Service Gold and ServSafe Food Handler Manager Certifications. Our unique partnership with Grads of Life connects youth with employers helping them to get the interview and land employment.','1106602330344467','http://covenanthousedc.org/our-services/hospitality-institute/',NULL,'kwhitehead@chdc.org','Verified','789038541797078,970915508638448','If you are interested in starting your career in hospitality, please call 202-610-9600 or email.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(154,684439431487008,'WHITMAN-WALKER CLINIC: LEGAL SERVICES PROGRAM',NULL,1280475814917857,'Offers a variety of pro bono legal services to persons living with HIV/AIDS. Provides legal counseling and representation in the areas of confidentiality, insurance, discrimination, immigration, future planning documents, and access to public benefits.','948165240614648','http://wwc.org',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'',NULL,'756653322156829,773180771408189','',NULL,NULL,NULL,NULL),(155,685530407413205,'Rehabilitation',NULL,1195280864464976,'Our goal is to make each of our residents and patients feel complete and whole. This can be challenging if youve just been released from surgery, have suffered a stroke, or have a chronic condition that inhibits your ability to live fully. Thats where our rehabilitation services come in. Our team of compassionate and motivated professionals provide the therapy, encouragement and support our residents need to achieve their maximum potential.\n\nPhysical Therapy\nOur Physical Therapists work with individuals to start the journey to recovery. The ultimate goal is to return people to optimum physical functioning, so they can return to their home or senior living community and continue leading their lives.\n\nOccupational Therapy\nOccupational Therapists help those individuals who have reduced functioning in the activities of daily living, such as dressing, bathing, grooming, etc. The goal is to enable the patient to regain the skills necessary to live safely in their own home.\n\nSpeech Therapy\nFor people with speech, communication and swallowing issues, our Speech Therapists can diagnose and treat numerous disorders.','814720878521693','https://www.stoddardbaptistglobal.org/our-services/rehabilitation/',NULL,NULL,'Verified','941516382466411','Call for services.',NULL,NULL,NULL,NULL,'1257614234179117',NULL,NULL,'854808174954754','1230684095904498',NULL,NULL,NULL),(156,688871630742360,'Transition Services',NULL,964889233755760,'DCCIL assists individuals with significant disabilities who live in nursing homes and other institutions to transition to community-based residences as well as assist in establishing community-based supports and services, provides assistance to individuals with significant disabilities who are at risk of entering institutions so that the individuals may remain in the community and facilitates the transition of youth who are individuals with significant disabilities.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(157,695948265970000,'Counseling Services',NULL,809193297555798,'DCRCC CONTINUUM OF CARE & COUNSELING PHILOSOPHY\n\nIndividuals who have experienced any form of sexual violence have survived a profound violation which can lead to deep, difficult feelingsincluding shock, shame, anger, and grief. These feelings can impact a persons relationship with family, friends, partners, and work. Whether you experienced sexual violence recently or decades ago, it is possible to heal, and you are not alone. DCRCC has trained therapists to support you in FREE individual or group therapy.\n\nThe DCRCC Clinical Program exists to support and empower survivors of sexual violence. Our therapy is based on empowering the survivors to regain control over their lives, helping the client to have choices, understanding that education is power, respecting their right to self-determination with the understanding that all forms of oppression are connected.\n\nValues\n\nWe believe in the capacity for every survivor to heal and thrive.\nCommitted to the belief that all forms of oppression are linked, we value accessibility, cultural respect and understanding, as well as the empowerment of all people.\nWe respect the unique experiences of each survivor and believe that survivors are experts in their own experiences.\nWe support people to find their own power to improve the quality of their lives.\nWe believe that healing from sexual trauma is a series of journeys. We serve as guides assisting the survivor on the next part of their journey, providing them with tools and support, along with an invitation to hope, trust, and embrace their power.\nWe act and advocate with authenticity and integrity by staying true to these core values in all we do.DCRCC CONTINUUM OF CARE & COUNSELING PHILOSOPHY\n\nIndividuals who have experienced any form of sexual violence have survived a profound violation which can lead to deep, difficult feelingsincluding shock, shame, anger, and grief. These feelings can impact a persons relationship with family, friends, partners, and work. Whether you experienced sexual violence recently or decades ago, it is possible to heal, and you are not alone. DCRCC has trained therapists to support you in FREE individual or group therapy.\n\nThe DCRCC Clinical Program exists to support and empower survivors of sexual violence. Our therapy is based on empowering the survivors to regain control over their lives, helping the client to have choices, understanding that education is power, respecting their right to self-determination with the understanding that all forms of oppression are connected.\n\nValues\n\nWe believe in the capacity for every survivor to heal and thrive.\nCommitted to the belief that all forms of oppression are linked, we value accessibility, cultural respect and understanding, as well as the empowerment of all people.\nWe respect the unique experiences of each survivor and believe that survivors are experts in their own experiences.\nWe support people to find their own power to improve the quality of their lives.\nWe believe that healing from sexual trauma is a series of journeys. We serve as guides assisting the survivor on the next part of their journey, providing them with tools and support, along with an invitation to hope, trust, and embrace their power.\nWe act and advocate with authenticity and integrity by staying true to these core values in all we do.','728145736382163','http://dcrcc.org/counseling/counseling-philosophy/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Call to begin an application.',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(158,699058261887909,'Mental/Behavioral Health',NULL,805167768269068,'The Mental Health Program is certified as a Core Service Agency for Mental Health Rehabilitation through the DC Department of Mental Health and has been operating since 1943. Trained licensed therapists and counselors provide guidance to mentally ill, abused and neglected children; adults suffering from anxiety, depression and mental illness; and lonely and despairing seniors. They also provide domestic violence and anger management counseling.  The goal of the Mental/Behavioral Health unit is to provide high-quality, low-cost mental health services to all at little or no cost Greater Washington residents.','1289997318242966','https://familymattersdc.org/services/mentalbehavioral-health/',NULL,NULL,'Verified','941516382466411','Call for services.',NULL,NULL,NULL,NULL,'800542552294891','621588457199048',NULL,NULL,'1276846480409026',NULL,NULL,NULL),(159,699918289813778,'Returning Citizens Program',NULL,1326157862705937,'The Returning Citizens Program is designed to be a one-Stop Solution for those released from incarceration wanting to be fully and successfully reintegrated into society. The RC Program provides services such as: Pre and Post release services.\n\nService Divisions\nPre-Release\nWe help you start transitioning prior to your release date from incarceration with a comprehensive plan that tackles employment, housing, your mental and physical health, family support, as well as help you gather community resources beneficial to your new style of living.\n\nServices We Provide During This Process Include:\n\nNeeds Assessment\nTransition Planning\nCase Management\nFamily Engagement\nPost Release\nAs the largest Core Mental Health Agency in the District of Columbia, MBIHS is in a unique position to provide a myriad of supportive services under one roof. Under this program and during the Post Release phase, you will have access to the following:\n\nMental & Behavioral Health Services\n\nSubstance Abuse Counseling\n\nPhysical Health Care:\n\nPhysical Health education and engagement\nPhysical Health coordination and referrals\nBenefits Counseling:\n\nWe will help you obtain medical insurance, Identification Cards, Supplemental Security Income/Social Security Disability Insurance (SSI/SSDI), International Development Association (IDA), food stamps, and other types of benefits.\n\nEducation Counseling\n\nEducation Support Placement\nDigital Training\nHousing Opportunities\n\nHousing Counseling- Trained Staff will help you achieve your housing goals\nHousing Placement Support- Collaborative agencies and MBIHS housing wil. laid you in obtaining transitional and permanent housing.\nHousing Advocacy- Supportive staff will advocate for individuals for affordable housing placement and suitable living conditions.\nEmployment Services:\n\nJoin our 30,60, or 90 day track towards getting employed\nJob Readiness, Job coaching, and Job Placement\nSupportive Employment Services\nRehabilitation Services Administration\nIntensive Work Readiness Training:\n\nThe participant will be in customized group settings to familiarize him or her with skills necessary to successfully seek and hold a job that works for him or her. Topics that will be covered include:\n\nThe purpose & function of a Resume\nHow to Prepare a Resume\nHow to Retrieve and Complete an Employment Application\nLearning How to Pass Different Types of Interviews\nPracticing Different Interview Techniques & Skills\nStandard interview & Workplace Attire\nWorkplace Ethics & Rules of Workplace Interaction\nIndividual Employment Plan (IEP)\n\nOur Case managers will assist in developing written pre and post employment plans for the participant to gain a long-term point of view of their job and/or career goal.\n\nBy developing an IEP,  the individual has just enabled the case manager and the job developer to review, discuss, analyze, andHELP him or her gain a more stable and fulfilling career-filled and financially stable lifestyle.\n\nJob Search, Job Placement and Post Placement Assistance\nThe program will provide job placement assistance. Working with an assigned job developer, each participant is guided through the job-search process, learning how to effectively market him or herself, until he or she has secured gainful employment.\n\nFamily Engagement\nCommunity Support Workers will work with the families to assist in making the transition. MBI staff use Family Group Conferencing (FGC) when working with families. Young people need the sense of community, identity and stability that only the family, in its various forms, can provide. Families are more likely than professionals to find solutions, which actively involve other family members, thus keeping the child within the care of the family, rather than transferring care of the child to the state. The key features of the FGC model are preparation, information giving, and private family time, agreeing on the plan, and monitoring and review.','959978038980815','http://www.mbihs.com/what-we-offer/returning-citizens-program',NULL,NULL,'Verified','637158405241810,1232587316936391,929094559121639,789038541797078','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'664148755918958','817410769508748',NULL,NULL,NULL),(160,705771849785076,'Homeless Services',NULL,574964812525513,'Services are offered to help people without a home locate affordable housing and avoid homelessness.','947853021041099','http://housingetc.org/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call to schedule an appointment or find out when workshops are taking place.',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,'877243931325915,966756126649195','1138176448388213',NULL,NULL,NULL),(161,713046095331473,'Parent Training and Information Center',NULL,1169351687674186,'The Parent Training and Information Center is a comprehensive resource library and training center. The Center offers parents information on the laws of special education, specific disabilities, the latest research on treatment and interventions, and adaptive technology. This resource center is especially critical to our work, as it is accessible to families that traditionally would not have had access to this information. Our training and advocacy sessions are specifically designed to: clarify legal obligations and rights; assist parents and advocates in the preparing for educational meetings and conferences; and to orient the individual on the various services available for children with special needs. An important component of our mission at AJE is to empower parents to be effective advocates for their children. In addition to offering a comprehensive resource library and operating a training center, the PTI also provides one-on-one assistance to families of children and youth with special needs, offers advance leadership training for parents and provides a supportive network through peer-to-peer support for families','763729877559385,641740493818315','http://www.aje-dc.org/training-2/',NULL,NULL,NULL,'637158405241810,789038541797078','Call for more information.',NULL,NULL,NULL,NULL,'1278097116269820,1123181686957068,602432444817544','859999387383412,1170631815352558',NULL,'1292849277583603,915486946336080','578010665151939,767767048082720',NULL,NULL,NULL),(162,724876636641588,'American Job Center',NULL,1211152552512890,'Provides comprehensive employment, unemployment, resume preparation and training services to residents of the District of Columbia. Provides labor exchange services to employers who are seeking qualified workers and to job seekers.\n\nThe American Job Center, formerly the DC Works! One-Stop Center, offers job-seekers, students, businesses and career professionals access to a comprehensive array of employment-related services and tools in one convenient location. Through the Districts American Job Center, residents can utilize resources such as career counseling, career planning, resume assistance, direct job placement, classroom and on-the-job-training, information about local and national labor markets, unemployment compensation and much more.  The Department of Employment Services, supported with resources from the District government and the US Department of Labor, operates the centers that are strategically located and accessible throughout the District.\n\nWhether looking for a job, facing a career transition, seeking new skills, or you just want a new start, visit the District of Columbia American Job Center, your workforce connection for the following services:\n\nCareer counseling\nJob search assistance\nConnections to employers with current job openings\nWorkshops on topics such as:\nResume Building\nJob search strategies\nInterviewing skills\nComputer Basics\nNavigating DCNetworks\nReferrals to education and training programs (see attachments below)\nApprenticeship information\nLabor Market Information and various career ladders\nAccess to computers, fax machines, telephones and copiers\nGeneral information about Unemployment Insurance\nUnemployment Insurance - Overview\nUnemployment Insurance - Frequently Asked Questions*\n*Please note: The public can file for unemployment compensation benefits at the centers from 8:30 am - 4:00 pm.\n\nThe District of Columbias American Job Center network is geared to assist all job-seekers to develop solid career plans that lead to satisfying careers. Planning your job search and developing short and long-term employment goals are central to any good career plan.','614054990318357','https://does.dc.gov/service/american-job-center',NULL,'does@dc.gov','Verified','970915508638448,1077790582995406','You can walk in and file for unemployment at during business hours. Call or walk in for information on all services.\n\nTo be eligible for programs you must be at least 18 years of age, a District resident and meet Workforce Investment Act income requirements.  All residents will be required to submit proof of the following:\n\nProof of Birth    \nProof of Social Security Number\nProof of DC Residency              \nProof of Family Income',NULL,NULL,NULL,NULL,'1186759129130174,875468115344861','1199959158515631',NULL,NULL,'1146287597878979',NULL,NULL,NULL),(163,738209311024775,'Tenant Advocacy',NULL,1116810105858975,'CARECEN acts as a liaison between city agencies and tenants. CARECEN assists tenants in solving housing and health code violations while preventing displacement and abuse. Tenants become familiar with housing laws and regulations and learn how to take advantage of existing laws or advocate for changes in current policies. In many instances, CARECEN facilitates testimonies by tenants before the City Council, DC Courts, and other officials.','547920365968268','http://carecendc.org/direct-services/housing-services/',NULL,'info@carecendc.org','Verified','917725171609009,929094559121639','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1295679372454826','842193303927915',NULL,NULL,NULL),(164,735696343430795,'Birth Control/Sexual Health ',NULL,1195870505334629,'We provide a range of services to meet all your sexual health and family planning needs!\n\nOur counselors are here to help answer any questions you may have about your reproductive health. You can receive services in a supportive and confidential setting:\n\nPregnancy planning and testing\nBirth control (free IUDs and implants for interested teens and some available same day)\nEmergency contraception\nSexual health education\nConfidential teen visits\nConfidential HIV/AIDS and STI testing and counseling\nHPV vaccine','1090162375763715,1146632771763115,1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'1279880844015186','1201313382171851,961771055926549',NULL,NULL,'1016957397804274,771726091253980,920259856619905',NULL,NULL,NULL),(165,741770132344686,'Supportive Housing',NULL,883186000200856,'Designed to find and support our clients in housing based on their choice and level of care.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','929094559121639,637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(166,748177592722248,'Pre-Employment Program',NULL,970560028876577,'JSSA offers transition services for students with disabilities (ages 15-22) to help them prepare for success after high school or college. These services include post-secondary program counseling, career assessments, workplace readiness training, and work-based learning opportunities such as internships.\n\nJSSA\'s Specialized Employment services helps teens with autism secure summer jobs at RSVP Pools in Maryland. Internships are available year-round for students with disabilities attending secondary school or college.','977589590864235,946508354826345,1321118518935089','https://www.jssa.org/get-help/specialized-employment/',NULL,NULL,'Verified','970915508638448','Call for more information.',NULL,NULL,NULL,NULL,'1289392147201269,1215754131378315','806655987955880',NULL,'1322383076619129,1152885158441684','863218507660277,1257520076925731,1218692669680880',NULL,NULL,NULL),(167,767585807206000,'Parkside Health Center (Ward 7) ',NULL,1043772486617212,NULL,'933134498085222',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1054597146068156',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(168,768961725734908,'East River Family Strengthening Collaborative',NULL,1204249190863211,'Offers case management services including assessments, family visits, school visits, senior meals, youth violence and drug prevention programs, parenting education, and support for grandparents who are caregivers of grandchildren.\n\nCase management\nSenior services\nYouth services\nCrisis intervention\nHousing assistance\nFatherhood support\nLifeskill training\nCommunity engagement\nCapacity building\nTechnical assistance\nParent Education and Support Services\nTruancy\nFinancial Literacy and Tax preparation classes','866160986976618','http://www.erfsc.org/case-management/',NULL,'info@erfsc.org','Verified','637158405241810,929094559121639,878986697513222,1077790582995406,917725171609009','Call for services',NULL,NULL,NULL,NULL,'1228368122652082','1048017825983621,798704743007649',NULL,NULL,'1205097520595212',NULL,NULL,NULL),(169,767255821745825,'Early Childhood Services',NULL,970560028876577,'JSSAs early childhood services include:\n\n- Psychosocial evaluation and functional assessments\n- Counseling for children and their sibling(s)\n- Neuropsychological , psychological and psychoeducational testing\n- Age-appropriate social skills therapy groups\n- Support groups and parenting workshops\n- Skill development for managing challenging behaviors\n- Counseling for children with special needs (including autism, Aspergers and other pervasive developmental disorders)\n- Consultation services for early childhood professionals','977589590864235,1321118518935089','https://www.jssa.org/get-help/children-and-adolescents/early-childhood-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'586981821517675,1274396898894043','863218507660277,1218692669680880',NULL,NULL,NULL),(170,774338968156105,'LGBTQ Health Program',NULL,887352348953420,'La Clnica operates two sites and safe spaces called Empodrate Centers. Our program is the only comprehensive, bilingual HIV prevention program that targets Latino men who have sex with men and transgender Latinas in the Washington, D.C. Metropolitan Area. Historically, LGBTQ individuals have been among the most impacted by HIV within the local Latino community. La Clnica addresses this issue by tackling the underlying causes of the epidemic, including stigma, isolation, depression, and the lack of safe and substance/alcohol-free spaces for immigrants that frequently face rejection from families and communities due to homophobia, transphobia, and socioeconomic and immigration status.','868710877316469','https://lcdp.org/_en/programs-community-health-action.html',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'887062299451299','1136144186376874',NULL,'625195015492370,1186681173947755','1214063268443455',NULL,NULL,NULL),(171,772580143837637,'Integrated Health',NULL,976379482380679,'As Pathways to Housing DC has evolved over the past fifteen years, so too has the national landscape of healthcare services. Individuals served by the public mental health system are dying, on average, 25 years earlier than the general population. This is largely due to chronic health conditions such as diabetes, hypertension, cancers, and other obesity- and smoking-related diseases. These illnesses are worsened by years of malnutrition, living out in the harsh elements, and limited access to preventive health care. Pathways to Housing DC originated as a mental health and substance abuse provider. We have grown our partnerships with primary care providers and other local nonprofits over the past few years, recognizing that physical health and mental health are inextricably linked. We are committed to growing life expectancy and improving the health of the individuals we serve.\n\nTimely access to healthcare and health education greatly impact an individuals ability to recover, live longer, and maintain a healthy lifestyle. We currently provide integrated mental health and primary care services to all Pathways clients through an on-site, walk-in clinic via our partnership with Unity Health Care (the Districts largest Federally Qualified Health Center). The program has impacted the lives of the people we serve by increasing their awareness of, and adherence to, healthy behaviors and independence in managing their healthcare needs. We have seen an increase in the number of preventive care visits, a decrease in emergency department visits, an increase in the percentage of clients linked to primary care providers, an increase in adherence to diabetes management and regular lab work for clients with diabetes and pre-diabetes, an increase in adherence to follow-up medical appointments and medication, an increase in healthy eating, an increase in social support and a decrease in substance use.\n\nUltimately, our goal is to ensure that the people we serve are empowered and able to live longer, healthier and more hopeful lives.','743353111808252','https://pathwaystohousingdc.org/what-we-do/integrated-health/',NULL,NULL,'Verified','941516382466411','Call to make an appointment. This is provided through a partnership with Unity Health.',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268',NULL,'877243931325915','1137409735223363',NULL,NULL,NULL),(172,777481511640778,'DC Healthy Start',NULL,922709314921881,'DC Healthy Start is a program for the residents of the District of Columbia that provides support and referrals for services and resources for all women, parents and infants up to 2 years of age. DC Healthy Start is a federally funded program under the Health Resources and Service Administration (HRSA) that aims to improve birth outcomes for infants and women of child bearing age. Healthy Starts overall goals are to reduce differences in access to health services, improve the quality of the local health care system, empower women and their families and increase community participation in health care decisions. \n\nWhat kind of services can I receive through DC Healthy Start? \n\n Care Coordination/Case Management Services\n Reproductive Life Planning\n Health Education\n Health and Wellness Screenings\n Centering Pregnancy Sessions\n Breastfeeding Support\n Parenting Classes Male Support Services for Parenting Fathers','659628565110513','https://dchealth.dc.gov/service/dc-healthy-start',NULL,'dchealthystart@dc.gov','Verified','941516382466411','Call or email to apply.',NULL,NULL,NULL,NULL,'1256399030177407','910273761873267',NULL,'1244783161808236','1225625601966457',NULL,NULL,NULL),(173,777479494055010,'Legal Network',NULL,1331447374298751,'For 30 years, the Catholic Charities Legal Network has provided pro bono legal services, giving persons accessing this program general information, access to volunteer attorneys and law firms, as well as referrals to other appropriate legal service organizations.\n\n*The Legal Network does not handle Criminal, Fee-Generating or Immigration Cases. Find more information on Immigration Legal Services.\n\nSERVICES\nThe Catholic Charities Legal Network focuses on serving low-income families and individuals whose earnings are equal to or less than 200% of the U.S. Federal Poverty Guidelines. The Catholic Charities Legal Network offers its services to residents of the District of Columbia and surrounding Maryland counties of Montgomery, Prince Georges, Calvert, Charles, and St. Marys. Civil law subject areas this program addresses are:\n\nConsumer Debt/Bankruptcy\nEmployment\nFamily Law (including Child Custody and Domestic Violence)\nLandlord-Tenant/Housing Issues\nPublic Benefits (Social Security, Disability)\nWills and Probate, Guardianship and Conservatorship\n','546085340417620','https://www.catholiccharitiesdc.org/gethelp/legal-and-financial-services/',NULL,NULL,'Verified','917725171609009','Call for intake.',NULL,NULL,NULL,NULL,'637096323626057','1150084771473447,1080167812313489',NULL,NULL,'1072933446361784',NULL,NULL,NULL),(174,714211448512130,'Online Employment Resources',NULL,810479025131545,'An online group of resources offering information on various employment services around DC.',NULL,'https://www.hips.org/employment-resources.html',NULL,NULL,'Verified','970915508638448','Visit website to check out the resources.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(175,718050681265809,'Domestic Violence',NULL,820488001755900,'For victims of domestic violence:\n\nNLSP can help obtain a Civil Protection Order (CPO). This will prohibit your abuser from harassing you.\nNOTE: NLSP assists victims of domestic violence or trafficking without regard to immigration status. We will not consider the income of the abuser when determining eligibility for services.\n\nDo you need help now?\n\nWhen you are ready to get legal help, call 202-832-NLSP during our intake hours. If you need assistance outside of NLSPs business hours, you can use the following resources:\n\nYour first priority is your immediate safety. If you are in immediate danger, call 911.\n\nHouse of Ruth provides a 24-hour shelter/safe place for battered women and their children with support groups and other resources for recovery. However, their intake hours are limited, so please contact them by phone at 202-667-7001 ext. 320. The administrative office of House of Ruth is located at 5 Thomas Circle, NW, Washington, DC 20005.\n\nIf you want to talk to someone about what you\'re going through, My Sisters Place offers a confidential 24-Hour hotline: (202) 529-5991.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/domestic-violence',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586,1212718840001878','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(176,721115353360225,'Day Treatment Program',NULL,1326157862705937,' Do You Have an Issue With:\n\nAnger Management\nIrritability\nDepression\nSocializing\nIsolation\nRacing Thoughts\nNutrition and Health\nSelf-Esteem\nParenting\nDomestic Conflicts\nTrauma\nMBI Health Services Day Treatment Program offers a structured clinical program that focuses on developing positive mental, behavioral, and physical skills through a range of social, psycho-educational, behavioral, and cognitive mental health interventions. This program is designed to have a curriculum that assists our patients in the restoration of independent and community living skills, strengthening appropriate socialization skills, as well as teaching our patients on learning how to adapt to his or her ever-changing surroundings. \n\nA few of our services offered at the Day Treatment Program Include:\n\nTherapeutic Group Counseling\nIndividual Group Counseling\nCommunity Support\nMedication Management\nReferral to wrap around services\nTransportation Stipend\nHot Breakfast and Lunch\nHousing Assistance\nEmployment Services','959978038980815','http://www.mbihs.com/what-we-offer/day-treatment-program',NULL,NULL,'Verified','637158405241810','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'817410769508748',NULL,NULL,NULL),(177,723134469644452,'VillageRides',NULL,855094084464049,'VillageRides supports neighborhood volunteer transportation for seniors and adults with disabilities who do not drive and live within areas served by participating villages and community organizations in Montgomery County and Prince Georges County.','924628911683577','https://accessjca.org/villagerides/',NULL,'https://accessjca.org/villagerides/VillageRides@AccessJCA.org','Verified','632609508449013','If you need a volunteer ride for yourself or are a caregiver, family member or a neighbor of a senior citizen who needs transportation services and lives in one of our partnering community organizations, you can connect directly to them by clicking on their logos on our website or by calling VillageRides at 301.255.4212 for more information.\n\nIf you are looking for transportation options for a senior who does not live in the areas served by VillageRides, please call Connect-A-Ride at 301.738.3252.\n\nWe are always seeking new volunteer drivers. Call VillageRides at 301.255.4212 for more information.',NULL,NULL,NULL,NULL,'1268373072226461','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(178,727116699390008,'Dental',NULL,840733417398800,'We keep smiles picture perfect! The friendly dentists and support staffat our state-of-the-art dental offices provide care for the whole family. Equipped with brand new, top-of-the-line tools, our skilled team takes great care with each patient and helps make sure your oral health is in excellent shape. Our highly trained staff care for all ages through a variety of services including:  \n\nAdults and Seniors \nPreventive care:X-rays, cleanings, fluoride varnish, and oral hygiene instructions \nRestorative care: Fillings, extractions, crowns, bridges, anterior root canals, and more \nRemovable care: We make complete and partial dentures \nTeeth whitening: A bleaching tray will be made, and bleaching material provided \nChildren and Teens \nPreventive care:X-rays (over 6 years old), cleanings, fluoride varnish, oral hygiene instructions, and sealants \nRestorative care: Fillings, extractions, and stainless-steel crowns \nReferrals to orthodontist ','964869638930274,629348329513757','https://www.maryscenter.org/dental/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'609237693650331,1301804131597006','644550844370242,1059813935264051',NULL,'670413521970743','962742212670581,732086812000340',NULL,NULL,NULL),(179,725916932978557,'D.C. DEPARTMENT OF CONSUMER AND REGULATORY AFFAIRS (D.C.RA): BUILDING AND LAND REGULATION ADMINISTRATION',NULL,1213058378158421,'Regulates all building and land use within the District of Columbia to ensure safety and conformity to local and federal laws and regulations. Manages permit processing, building inspection, and zoning program; covering new construction, alterations and repairs.','1298013609220199','http://dcra.dc.gov/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'912991375068271',NULL,NULL,NULL),(180,733244062080278,'Substance Abuse Treatment',NULL,964008795352849,'Regional Addiction Prevention (RAP), Inc. uses the therapeutic community (TC) approach to substance abuse treatment. We offer drug and alcohol-free residential settings that use the influence of the community consisting of treatment staff and those in recovery, as key agents of change.\n\nIn addition to using the concept of community as treatment method, the TC employs the principle of self-help. Self-help implies that the individuals in treatment are the main contributors to the change process. Mutual self-help means that individuals also assume partial responsibility for the recovery of their peers  an important aspect of an individuals own treatment. The stages of treatment reflect increased levels of personal and social responsibility. We use a variety of group processes to help individuals learn and assimilate social values and develop more effective social skills.\n\nOur TC is centered on cultural values. Recognizing that a clients culture is an inseparable part of his or her self-image, we provide clients information to combat what Dr. Carter G. Woodson* described as the mis-education that has shaped their lives. This information is vital in helping clients to clarify who they are and to place themselves as worthy citizens. Our cultural teaching is based on respect and support of all individuals and their communities.\n\n*Dr. Carter G. Woodson created what we now know as African American History Month. He believed that African Americans should know their past in order to participate intelligently in their future.','803526594539754','http://www.rapinc.org/substance.html',NULL,NULL,'Verified','941516382466411,637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'664148755918958,780785826421817,915486946336080','601647045974328',NULL,NULL,NULL),(181,734280780069484,'Health & Wellness',NULL,1186080684764999,'The Wellness Center at N Street Village offers integrated mental health, physical health, and addiction recovery services to homeless and low-income women. Our program offerings take a holistic approach to wellness-  addressing the mind, body, and spirit. Thanks to program partnerships, and dedicated volunteers including client alumna, we offer a full spectrum of daily wellness programs that promote health education, physical fitness, and holistic well-being.\n\nPhysical Health\nIn partnership with Unity Health Care, we have onsite primary health care and dental clinics. In addition, we have Village staff, volunteers and other partnerships which provide services and support groups for women coping with HIV/AIDS, addiction, trauma and other challenges.  We offer daily classes  from Yoga and Aerobics to Smoking Cessation and Diabetes prevention.\n\nMental Health\nWe provide women with mental health education, support groups, crisis intervention assistance, and referral services. In partnership with Marys Center, we offer weekly individual therapy and psychiatric services. We also offer a variety of mental health promotion and holistic wellness classes like anger management, meditation, massage, and trauma recovery support programs.\n\nIn addition, we have a full offering of arts classes from open studio to an acting program in partnership with Theatre Lab. Women can also express themselves through written word in our autobiography, journaling, and poetry classes.\n','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/health-wellness/',NULL,NULL,'Verified','941516382466411','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nPlease call to make an appointment. Appointments are on a first-come first-served basis. Clinic hours are only offered Tuesdays and Thursdays from 9:00am to 12:00pm.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','733422375074097',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(182,739078424499970,'Health for Heroes (Active Duty & Veterans)',NULL,840733417398800,'Marys Center is grateful for your service and we want to help you protect your health. We have been providing healthcare, education, and social services for over 30 years and are honored to offer high-quality care to the many active duty military members, veterans, and reservists in our community. When you visit Marys Center, you and your family can expect access to comprehensive care including:  \n\nMedical services such as:\nAnnual physicals, check-ups, and immunizations \nHealth screenings for chronic conditions (cancer screenings available based on your personal risk) \nTreatment and management of acute and chronic conditions \nSick visits \nHIV prevention and care \nInfectious disease care\nCleanings and screenings \nCrowns and bridges \nExtractions, fillings, and sealants\nBehavioral Health services such as:\nTherapy for trauma, depression, anxiety, and other illnesses \nPsychiatric evaluations and care coordination \nSubstance abuse treatment \nEarly childhood behavioral health treatment \nWe also offer a wide variety of family support services including: \nHome Visiting and Care Coordination \nInsurance enrollment assistance ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/health-for-heroes/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,'1260550501779199,1135008555245828','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(183,743182672086208,'Laboratory Services',NULL,605134586578120,'Our certified technician works with our providers to collect blood, fluids, and tissue samples which are used in a variety of comprehensive testing to detect diseases, and monitor treatment in the management of patient care.','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,NULL,'651804021834110,1128987918758522',NULL,NULL,NULL),(184,754621632893339,'Ready2Cook',NULL,726173106231202,'Ready2Cook offers two options for culinary-minded students: \n\nMission Muffins\nMission Muffins is a bakery run by homeless employees, who bake, market, sell and deliver delicious baked goods. Employees are paid and live at the Mission; they receive training for bakery work and business management.  Read More>\n\nVisit our Mission Muffins website to view our menu and order products or download the Mission Muffins Brochure.\n\nCulinary Job Training Program\nStudents can also participate in the Culinary Job Training Program, sponsored in partnership with DC Central Kitchen. Graduates gain valuable kitchen skills required for cooking jobs as well as soft skills necessary to be successful in the workplace.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(185,757050460311671,'Housing Services Program',NULL,577764298046742,'Our Housing Services Program provides stable living arrangements for young people experiencing homelessness or at risk of losing their homes. Our array of services accommodate people with various needs, from shelter for a night, to more stable housing, including subsidized rent for up to 6 months. In addition to our shelters, we provide case management for our clients, including advice on other available resources and assistance in meeting other needs.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','599621071767378','1200832408072169,605403471620978','603292299584681',NULL,NULL,NULL),(186,757455042685009,'Appellate Advocacy',NULL,1091757696945828,'Established in 2004 with seed money from the DC Bar Foundation, which continues to provide generous support, Legal Aids Appellate Project has become a model of excellence that the National Legal Aid and Defender Association has urged other legal services programs to emulate. The Project was named for its founding Director, Barbara McDowell, after her untimely death.\n\nThe Project not only litigates appeals on behalf of Legal Aid clients but also files friend of the court briefs on cases involving matters of importance to people living in poverty. Beyond litigation, the Project provides appellate instruction, consultation, and advice to the larger D.C. legal services community. Although most of the Projects work involves cases before the Districts highest court  the District of Columbia Court of Appeals  the Project also gets involved in administrative appeals and cases before the District of Columbia Superior Court and the federal courts.\n\nLearn more about Barbara McDowell, the renowned appellate litigator and U.S. Supreme Court advocate who served as the projects first director and after whom our appellate advocacy project is named.\n\nAfter Barbaras untimely death, Legal Aid created the Barbara McDowell Endowment Fund for Appellate Litigation with funds donated both from Barbaras estate and from the generous donations of her husband, Jerry Hartman. The Fund was created to honor the immeasurable contributions that Barbara made to Legal Aid and the legal needs of persons living in poverty in the District of Columbia. Jerry has continued to donate generously in Barbaras honor to the Fund to sustain the ongoing, important work of The Barbara McDowell Appellate Advocacy Project. Jerry also founded The Barbara McDowell and Gerald S. Hartman Foundation, which supports organizations that undertake systemic litigation on behalf of disadvantaged persons and groups throughout the United States.','768639914164498,1052799655566995','https://www.legalaiddc.org/appellate-advocacy/',NULL,NULL,'Verified','917725171609009','You can apply online or utilize walk-in intake hours. Call for more information.',NULL,NULL,NULL,NULL,'1289374770713295,1234325977097951','871092289270509,1035182743655741,1155614982637715',NULL,NULL,'635267247673749,1157364802959844',NULL,NULL,NULL),(187,771378282180941,'Short-term Living Program',NULL,577764298046742,'This free service is for LGBT youth between the ages of 18 and 24 years old, and guarantees stable housing and support services for 3 to 6 months, with the purpose of helping clients transition into more permanent housing.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','599621071767378','1200832408072169,605403471620978,1222973168897685','603292299584681',NULL,NULL,NULL),(188,777108871381104,'SOME: SHALOM HOUSE',NULL,1319047892616905,'Offers affordable, housing for adults transitioning from homelessness to independent living. Residents pay 30% of their income as rent, participate in regular house meetings and maintain their health and sobriety.','1261924735850333','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1320872330999559',NULL,NULL,NULL),(189,780601488413554,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS FIVE AND SIX PREVENTION CENTER',NULL,1276788103667282,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.','1185866432124387','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'626337120120757',NULL,NULL,NULL),(190,787765929715080,'Home$mart Post-purchase Education',NULL,855802893163707,'First-time homeowners can face many challenges during the first few years in their new home, but with the right resources and education, they can surmount these obstacles successfully. Were arming DC homeowners with the tools and knowledge they need to navigate all the ups and downs of homeownership. Our Home$mart post-purchase classes help new homeowners tackle the challenges that can arise in the first few years of homeownership and beyond. These classes are for current homeowners looking for knowledge and resources to help them be successful homeowners. Additionally, these classes can be counted toward sweat equity hours for families that are already owners of DC Habitat homes.  \n\nOur first class series, Life After Settlement, focuses on what to do after youve closed on your home to prepare for the future. Over the course of this series, youll learn whats in those mortgage documents, home maintenance and repairs, how to create a S.M.A.R.T. budget and save, how to prevent mortgage delinquency and foreclosure, how to go green and do-it-yourself, and what good credit looks like and how you can get it.','884179044911706','https://dchabitat.org/housing-services/homesmart-post-purchase-education/',NULL,NULL,'Verified','789038541797078,929094559121639','Sign up for the course online.',NULL,NULL,NULL,NULL,'1093912479911840','1140008964398815',NULL,'1294818681778567,868012483124236','1098238485894342',NULL,NULL,NULL),(191,786302163414865,'Neighborhood Community Centers',NULL,919690199169575,'Community centers providing:\n- Referrals to community resources\n- Meal distribution\n- Group counseling\n- Case management\n- Tutoring\n- Mentoring\n- Out of school programs\n- School readiness\n- School supplies\n- Early childhood education\n- Literacy\n- ESL\n- Workforce readiness\n\nOur community centers are places where residents of all ages connect with their neighbors, learn to lead, and make changes that strengthen the community where their families live.\n\nWe engage adults and youth in community programming, leadership development activities, and social and educational opportunities. With our community partners, we provide resources for learning, mentorship, and health screenings to community residents.\n','928012146500435,1246140596600748','http://www.ucmagency.org/neighborhood-community-centers.html',NULL,NULL,'Verified','789038541797078,911225335803318,637158405241810,941516382466411','Call for more information or walk in. Time and application process will vary by service.',NULL,NULL,NULL,NULL,'676690284227155,746366368083217','554058492941520,1120594852165211,826011901306447,1232282827720859',NULL,'883345659611536,1292849277583603,915486946336080,1274396898894043','1126520692919525,890837741306671',NULL,NULL,NULL),(192,794527613963060,'Clothing Closet',NULL,706476638607137,'Offers a clothing closet to DC residents in need of clothing. Must bring own bags.','692842183271323','https://www.brighterdaydc.org/',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'919075870505440','900620545310091',NULL,'868012483124236,1274524177531453','915998507127869',NULL,NULL,NULL),(193,732442069691146,'Brentwood Health Center',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,730763164086236,'Home Delivered Meals',NULL,1219589148672769,'Monday through Saturday, Food & Friends delivers nutritionally-tailored, delicious meals directly to our clients homes. Each delivery includes food for breakfast, lunch and dinner, along with liquid nutritional supplements, as needed. Our community dietitians and professional chefs work closely to provide individualized services to our clients. Food & Friends offers 11 specialized meal plans to meet our clients nutritional needs.','857875532631251','https://foodandfriends.org/about-us/#services-we-provide',NULL,NULL,'Verified','832990803111047',NULL,NULL,NULL,NULL,NULL,'1239494728678928,1133561368089400','857395816743172,884617333624034',NULL,NULL,'1251720034767684',NULL,NULL,NULL),(195,748118421956392,'\"DEAF AND HEARING OUTREACH CENTER, FAMILY MATTER OF GREATER WASHINGTON\"',NULL,NULL,'Provides Deaf & Hard of Hearing services','1295023062659721','http://familymattersdc.org/services/deaf-and-hard-of-hearing/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'621335851884833',NULL,NULL,NULL),(196,747822750998769,'Chronic Disease Management ',NULL,1195870505334629,'We help you manage your health, so that you can lead a healthy lifestyle.\n\nPersonalized health goals and care plans\nAccess to a care coordinator to assist with education and specialty care appointments\nAssistance with overcoming transportation, language, medication/supplies and other barriers to getting the care you need\nGroup care and referrals for support to manage stress and change\nWe teach you about disease prevention, healthy lifestyles and other self-care activities.','1090162375763715,1146632771763115,1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'1279880844015186,763524779006557,665495770462606','1201313382171851,961771055926549,1133644382136224,849922591487683,774772066237737,1257079363804425,1223815259564202,1305096827911095',NULL,NULL,'1016957397804274,771726091253980,920259856619905',NULL,NULL,NULL),(197,750164217924618,'Comfort Care',NULL,1195280864464976,'For those who are nearing the end of life and are no longer interested in curative or life-prolonging care, we offer Comfort Care. The goal of Comfort Care is to make the persons last days (which may be several days or many months) as comfortable as possible. This includes addressing their physical, emotional, social, and spiritual needs as they make their transition. We also offer grief support for family members.','814720878521693','https://www.stoddardbaptistglobal.org/our-services/comfort-care/',NULL,NULL,'Verified','941516382466411','Call for information.',NULL,NULL,NULL,NULL,'1257614234179117',NULL,NULL,'854808174954754','1230684095904498',NULL,NULL,NULL),(198,754669198968415,'Health at Home',NULL,840733417398800,'Get the care you need when you need it most. When coming to the clinic is a challenge, Marys Center Health at Home telemedicine program quickly connects you to a caring medical provider in a matter of moments, saving you precious time and energy at a time when youre not feeling your best.  \n\nThe Health at Home program currently serves patients with plans through the following Medicaid Managed Care Organizations: \n\nAmeriHealth Caritas DC \nTrusted Health Plan \nAmerigroup DC   \nBy harnessing the power of technology, a Marys Center home visitor will come to your home and connect you to your Marys Center provider through a live video on a laptop computer. The home visitor will bring everything they need to connect, including a computer, Wi-Fi internet access, and medications.  \n\nRegular management and follow-up of chronic conditions results in improved health. Our Health at Home team and our providers actively reach out to patients who may qualify for the program.  If you believe you may be a good fit for the Health at Home program but havent heard from our team or talked with your provider, please dont hesitate to reach out to us.  \n',NULL,'https://www.maryscenter.org/medical/other-specialties-and-services/health-at-home/',NULL,'healthathome@maryscenter.org',NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'976451647500271,1301804131597006',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(199,758846747979067,'DC Prevention Center',NULL,1306699628219808,'The DC Prevention Center for Wards 5 & 6 is a collaborative venture in conjunction with the Department of Health (DOH), Addiction Prevention and Recovery Administration (APRA), and Sasha Bruce Youthwork. Our vision is to support a healthy and drug free District of Columbia where all children are safe, drug free and connected and supported by a network of caring families, community organizations, and faith based organizations. As we identify prevalent risk factors within Wards 5 & 6, it will be important to engage in community conversations and trainings that will help to develop and sustain an infrastructure of community leadership.\n\nWe also offer and host:\n Structured trainings and workshops that will increase community knowledge, skills, and awareness of substance abuse trends and indicators\n Community Conversations on underage drinking, so-called gateway drugs and risk & protective factors','1083708956779513','https://www.sashabruce.org/programs/lifeskills/preventioncenter/',NULL,'cdark@sashabruce.org','Verified','637158405241810','Call, walk in, or email to access this program. ',NULL,NULL,NULL,NULL,'742520224803831','882054301651193',NULL,NULL,'626337120120757',NULL,NULL,NULL),(200,761018228722418,'Permanent Supportive Housing',NULL,1186080684764999,'Permanent Supportive Housing at our flagship location provides affordable housing with embedded services to 44 individuals who are coping with mental health issues, addiction, trauma, physical health problems or other issues which require support to help them remain stably housed. Residents live in studio or shared apartments, and enjoy social and therapeutic activities provided by the Village. ','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(201,765387458092097,'Housing',NULL,1287130751059247,'Calvary provides transitional and permanent supportive housing services that enable women to make lasting changes in their lives.\n\nWe provide women with basic services and nutritious meals at our facility, allowing them to focus on healing, building their skills, and building their futures.\n\nOur Sister Circle program offers permanent supportive housing services to women who live independently, but still receive long-term assistance. Sister Circle fosters a close-knit community of peer support and sisterhood.','1315826372203677','https://www.calvaryservices.org/program/housing/',NULL,NULL,'Verified','929094559121639','To access our services, you must first receive a referral from a core service agency. If they match you with our organization, you will be sent over for an intake. If you have additional questions, please call.',NULL,NULL,NULL,NULL,'1285405208459287','890039510897571',NULL,'836091364973509,877243931325915,1212718840001878','926608893625888',NULL,NULL,NULL),(202,767682966554088,'Food and Nutrition Support',NULL,840733417398800,'A balanced diet plays a big part in building a healthy body, but we know it can be hard to get the right kind of foods for you and your family. In addition to nutrition counseling, Marys Center is an official site for the federally-funded Women, Infants, and Children (WIC) program and Supplemental Nutrition Assistance Program Education (SNAP-Ed), Marys Center connects you to the nutrition resources and services available in our community and puts healthy food at your familys fingertips.  \n','964869638930274,629348329513757','https://www.maryscenter.org/social-services/referrals-and-resources/food-and-nutrition-assistance/',NULL,NULL,NULL,'637158405241810','Marys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below: \n\nTo learn more about WIC or make a WIC application appointment, call (202) 232-6679  \n\n*A fourth DC WIC site can be found at Adventure Dental located at 1060 Brentwood Road NE',NULL,NULL,NULL,NULL,'1286112501247852','1134877289644712,827996522503929,601427652072887',NULL,NULL,'962742212670581,732086812000340',NULL,NULL,NULL),(203,770135966287034,'IZ Household Certification for Developers',NULL,844234717265246,'MHCDO is an authorized, Certifying Entity, approved by District of Columbia Department of Housing and Community Development (DHCD) to conduct:\n\nCertification of Income\nAffordability and Housing Size\nDeclaration of Eligibility\nfor the District of Columbias Inclusionary Zoning Program.  MHCDO provides consulting services to conduct the mandated process certifying of prospective IZ tenants for property owners, property managers, and developers.','1116781625364190','https://mhcdo.org/iz-developer-services',NULL,'housing@mhcdo.org',NULL,'917725171609009,929094559121639','For further information about how MHCDOs IZ Certification services, please contact us by emailing housing@mhcdo.org or calling 202-396-1200.',NULL,NULL,NULL,NULL,'1161638800071039','887181369602868',NULL,NULL,'802890951138045',NULL,NULL,NULL),(204,775356580769657,'Monitoring',NULL,744812603775568,'Quality Trust was created to serve as an independent monitoring organization to ensure services to and for people with developmental disabilities are responsive to the needs of each person receiving services in DC. Quality Trust monitors visit people where they live and spend their days. Our activities includes individual program monitoring, follow up on abuse, neglect and personal thefts incidents, environmental site visits, regular reporting of data collected, trending and tracking of different types of critical events (e.g., hospitalizations, nursing home placements, deaths, etc.) and technical support to providers. Quality Trusts Monitoring Team includes a monitoring coordinator, four monitoring specialists, and a registered nurse with over 50 years of combined experience supporting and working with people with developmental disabilities. All people monitored are personally interviewed to ensure the assessment reflects what is most important to and for each person. The goal of our assessment is to collect data and ensure that required supports are in place.','1185969381076176','https://www.dcqualitytrust.org/advocates/monitoring/',NULL,'jlethbridge@dcqualitytrust.org.org','Verified','637158405241810','Call for more info on monitoring services.',NULL,NULL,NULL,NULL,'759133304767858','655204523101840','866390871990408','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(205,780286718217610,'Social Services',NULL,1168436736852155,'The participants of Vida Senior Centers are mostly first-generation Hispanics, who throughout their lives accumulated little pension and few social benefits, either because they were late to the United States or because their salaries were always low In any case, the majority of VIDA participants are below the poverty line. And being a poor older adult in Washington DC is a huge challenge, largely because of the price of rentals in the city. In addition, Hispanic older adults never knew about the social benefits offered by the federal or city government, and even when they know there is some benefit, it is difficult for them to apply for the benefit because they cannot read the documents that They explain the benefits, cannot fill out the forms, or do not know how to follow those procedures. To face this tangle of procedures, Vida has a Social Services Counselor. All participants of Vida Senior Centers receive help from our counselors to apply for affordable housing, transportation and social benefits for programs that benefit older adults. With regard to immigration procedures, VIDA not only helps participants to start and follow-up on their migration processes, but also offers a weekly Citizenship Class in which participants are prepared to take the Citizenship exam. We also connect them with the agencies that help them file their taxes and file legal procedures, if necessary. Likewise, VIDA is an official distributor of boxes of the Food Bank, and with this it helps to identify older adults at greater risk. So, in summary, when it comes to social services:\n\n Home Application Procedures\n Migratory processes\n Preparation for the Citizenship Exam\n Application for transportation benefits\n Legal and employment services\n Procedures for cell phone subsidy\n Tax return\n Contact them with adult service agencies','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/social-services/',NULL,NULL,'Verified','637158405241810,917725171609009','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(206,784062651801689,'Medical Assistant Job Training',NULL,840733417398800,'Train to be a Medical Assistant! Briya Public Charter School offers a Medical Assistant training program. The 12-15 month program prepares you for a career as a Registered Medical Assistant, working alongside doctors and nurses in clinics and hospitals.  \n\nThroughout the course, you will gain hands-on practice with clinical lab skills such as drawing blood, giving injections, and taking blood pressure. You will also gain proficiency in administrative skills, including updating patient records and coding insurance forms. Briya offers the Medical Assistant Program in collaboration with Marys Center, providing students embedded learning opportunities with Marys Center nursing and medical assistant staff. \n\nUpon completion of the Medical Assistant training program, you will be prepared to take the national Registered Medical Assistant Exam and begin your new career! ','629348329513757','https://www.maryscenter.org/education/job-training/medical-assistant/',NULL,NULL,NULL,'789038541797078','To qualify for the Medical Assistant training program, you must: \nLive in Washington, D.C. \nHave a high school diploma or GED \nPass entrance exams in reading and math  \nProgram Details: \nClasses are held Monday-Thursday, 6:00-9:00 p.m., at Marys Centers Georgia Avenue site \nThe course lasts 12-15 months, including coursework (August through June) and externships and summer test prep sessions (July through August) \nOne month of full-time clinic training at medical centers across the DC area is required \nRegister for the course or call (202) 232-7777 for more information. \n\nMarys Center and Briya Public Charter School work together to provide health care, social services, and education for residents of D.C. ',NULL,NULL,NULL,NULL,'1307595059042459',NULL,NULL,'868012483124236,1224478530518610,1227957138475220','732086812000340',NULL,NULL,NULL),(207,797834103829212,'Cornerstone Building/Emergency and Transitional Safe Housing','Cornerstone Residence',983721114373124,'When it opened in November 2010, the Cornerstone Residence became the Districts largest dedicated safe housing program. Here, DASH provides 42 apartment units for survivors of domestic violence and their families in crisis. Residents may live at Cornerstone for up to 24 months while working with DASH advocates (case workers) to address their needs and ultimately live safely and independently. All services are offered on a voluntary basis, affording residents the opportunity to determine their own goals toward re-establishing their lives on their own terms. All residents are connected to a range of community resources to help them move toward long-term or permanent housing, as well as emotional and financial independence. ','828792720206018','https://www.dashdc.org/programs-services/safe-housing/',NULL,NULL,'Verified','929094559121639','Call for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(208,802735747611778,'Retention/Recapture Services ',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(209,804986111814033,'Minnesota Avenue Health Center (Ward 7) ',NULL,1043772486617212,NULL,'1279341581208919',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'670695859922202',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(210,740916631620812,'Food Assistance',NULL,726173106231202,'Families and individuals rely on the Missions food assistance program in emergencies and as a steady source of food.\n\nIn partnership with individuals, corporations and churches, the Mission distributes almost $8 million worth of in-kind food, toiletries, clothing and household items each year.','838780960881380','https://www.missiondc.org/what-we-do/family-programs/food-assistance/',NULL,NULL,'Verified','832990803111047','Call or walk in for help.\n\nIf you are currently in need of assistance outside of FMC operating hours, please contact the Hunger Lifeline at (202) 644-9807 (Monday-Friday 9am5pm) or visit the Food Bank Network Website or DC Food Finder Website to search for services such as food, healthcare, housing, and job training. If you are in need of furniture, contact A Wider Circle at (301) 608-3504.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(211,753253159497862,'Family Homelessness Prevention',NULL,1245236106154921,'Everyone Home DCs Homelessness Prevention Program offers services for families at risk of becoming homeless through mediation, flexible financial assistance, and connecting them to supportive resources. Families who come to Everyone Home DC for support are often living temporarily with relatives and friends, moving frequently. They find themselves on the verge of homelessness and are seeking assistance to stabilize their housing.\n\nEveryone Home DCs prevention specialists serve as supporters and champions for clients, assisting families with developing a plan, identifying resources, and setting goals that will allow them to remain stably housed and connected to their natural systems of support, rather than having to enter the shelter system.','936934819762396','https://everyonehomedc.org/programs/family-homelessness-prevention/',NULL,NULL,'Verified','929094559121639','Access to Everyone Home DCs Homelessness Prevention services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families. If you know a family encountering a housing crisis that they cannot resolve on their own, they can access homelessness prevention advice and program assistance referrals exclusively through the Virginia Williams Family Resource Center (920 Rhode Island Ave NE, Washington, DC 20018 | (202)-526-0017).',NULL,NULL,NULL,NULL,'735608882009072','832596400468443,1170433044969408',NULL,'966756126649195,1292849277583603','811198505758894',NULL,NULL,NULL),(212,759287871630149,'Early Childhood Education',NULL,682552065545256,'Healthy Families and Early Head Start foster learning and development in children and provide parents with the tools to continue this growth. In addition to SERVEs Early Head Start classroom, home-based programs help families build strong parenting skills and ensure children are healthy and meet developmental milestones.','764854375292129',NULL,NULL,NULL,'Verified','789038541797078','Call to enroll.',NULL,NULL,NULL,NULL,'736909404940832,964860483808020',NULL,'998959625812107','1274396898894043,826113037014422','1341470966230086',NULL,NULL,NULL),(213,757654002604408,'Temporary Housing at Girard Street Apartments',NULL,1195870505334629,'Located in the Columbia Heights neighborhood of Northwest, DC, Girard Street Apartments provides apartment-style emergency shelter for 20 homeless families with children.\n\nAt their most vulnerable moment, families find safety and security. From the first day they enter our program, families begin to search for long-term housing and develop a family stability plan, which includes a wide range of supportive services and resources:\n\nGoal-oriented case management Assistance on finding an affordable apartment\nConnection to employment and training\nConnection to behavioral health services\nLife skills classes on parenting\nChildrens activities\nBudget and financial management\nConnection to community resources.','984945374868800','https://www.communityofhopedc.org/girard-street-apartments-0',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195,877243931325915','1180267371580937',NULL,NULL,NULL),(214,762888373958688,'Senior Medicare Patrol (SMP)','SMP',1093127605400642,'The SMP DC office empowers and assists Medicare beneficiaries, their families, and caregivers to prevent, detect, and report health care fraud, errors, and abuse through outreach, counseling, and education. DC SMP is a grant-funded project of the federal U.S. Department of Health and Human Services (HHS), U.S. Administration for Community Living (ACL). Our work is in three main areas:\n\nConduct Outreach and Education:  SMP DC gives presentations to groups, exhibits at events, and works one-on-one with Medicare beneficiaries. In 2013 more than 1 million people were served by the national SMP program outreach and education efforts across the country;\nEngage Volunteers: Protecting older persons health, finances, and medical identity while saving precious Medicare dollars is a cause that attracts civic-minded Americans;\nReceive Beneficiary Complaints: When Medicare beneficiaries, caregivers, and family members bring their complaints to - our office, we make- a determination about whether or not fraud, errors, or abuse is suspected. When fraud or abuse is suspected, we make referrals to the appropriate state and federal agencies for further investigation.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/senior-medicare-patrol.html?intcmp=AE-LCE-WWD-R1C2LL3',NULL,'LCESMP@aarp.org','Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'793218371104365','885227948751306',NULL,'854808174954754','763163886168100',NULL,NULL,NULL),(215,771396624281852,'Community Support Services',NULL,883186000200856,'Education, school and community consultation, and services provided in the home, school, and other settings to improve parenting, academic, daily living, and behavioral management skills.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536,1292849277583603,915486946336080','646846673243288,1261416234116596',NULL,NULL,NULL),(216,770458474126572,'Affordable Housing Development ',NULL,1178149503221687,NULL,NULL,'https://housingup.org/ending-homelessness/developing-affordable-housing/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(217,775820607481251,'Inpatient Psychiatry',NULL,1061724977026001,'Inpatient psychiatry services for children and adolescents at Children\'s National are provided through the Psychiatry and Behavioral Sciences program, one of the earliest pediatric programs in the nation. Throughout our history, we have emphasized a family-centered approach to care for the benefit of patients and their families.\n\nSupport and Inpatient Services\nWe recognize how challenging a childs illness can be for the entire family, especially when parents cannot see whats wrong. Mental illness and psychiatric conditions are particularly complex because there are many factors that may influence your childs emotions and behaviors. As well, the signs and symptoms of a psychiatric condition are often different between younger children and teens.\n\nOur multidisciplinary team is composed of pediatric psychiatrists, nurses, social workers, academic counselors, psychologists, and expressive (art) therapists, who see to all aspects of care. They have extensive experience in the specialized care and treatment of children and teens with complicated emotional and behavioral disturbances.\n\nThe inpatient unit was specifically designed to meet the developmental and psychiatric needs of children and adolescents. We offer two separate programs to meet the distinct medical needs of children and teens  a 12-bed unit for patients aged 2-12 and a 14-bed unit for those aged 13-17. Working closely with pediatric specialists at Childrens National, we can also treat patients with other medical conditions on the psychiatric unit, including children with diabetes, HIV, and eating disorders.','1282604214927911,856126341619748,979447652621070','https://childrensnational.org/departments/psychiatry-and-behavioral-sciences/inpatient-psychiatry',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'1220504141221415','892012398827551,1095419747725144,587218394770946',NULL,'1274396898894043,798275500344709','928813128095347,787442654546775,1067302604787333',NULL,NULL,NULL),(218,777260696695053,'C.R.E.A.T.E.','Children Reaching Educational Achievements Through Enrichment',761153930697275,'When children are supported, motivated, and celebrated, theres no end to what they can accomplish! Thats why its so important to keep them occupied and educated after school, over the summer, and whenever else they need attention and encouragement.\nUPOs Children Reaching Educational Achievements Through Enrichment (C.R.E.A.T.E.) program provides a safe, secure place for children to interact with their friends as they learn new things, eat healthy snacks, and think differently.','594960886051316,999755198000719','https://www.upo.org/youth-services/',NULL,NULL,'Verified','789038541797078','Please call to enroll.',NULL,NULL,NULL,NULL,'757819596231988,665905423802380','587544010010943,940897095189363,682372519823224','773180771408189','740331137219886','1304904589817191,1166860713798541',NULL,NULL,NULL),(219,789456565791843,'Men and Boys Program',NULL,727757843857751,'The goal of the Men and Boys program is to provide men and boys with support services and opportunities to increase fathers ability to contribute positively to the well  being of their children, improve the quality of relationships between fathers and the mothers of their children.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234,625195015492370,908163423675008','1231516890380928',NULL,NULL,NULL),(220,797891805827498,'The Pathways for Young Adults Program (PYAP)',NULL,1262229839027778,'The Pathways for Young Adults Program is designed to assist out-of-school and out-of-work District residents ages 18-24 by combining occupational training, life skills development and work readiness instructions to connect them back to the world of work successfully.  The three areas of occupational training include allied health, administrative Services and basic IT/Admin. Tech. \n\nThrough PYAP, we strive to provide youth with the opportunity to:\n\nGain meaningful work experience through a paid internship; \nLearn and develop skills, attitudes and commitment necessary to succeed in todays world of work; while interacting with dynamic working professionals in a positive work environment.;\nReceive occupational training necessary to gain a nationally recognized credential within the specialized field of interest.\n Recruitment and Enrollment\n The Pathways for Young Adults Program operates in a cohort format. Specific dates are provided to each participant /vendor as the participant matriculates through all phases. For more information contact: YouthJobs@dc.gov .\n\n\nProgram Structure\nThe PYAP is designed for youth to combine occupational training and work-readiness instruction to connect youth to meaningful industry-oriented work experience. Youth will be assigned to an internship with an approved employer. Youth must commit to work between 25-40 hours per week throughout all phases of the program. \n\nPhase I: Occupational Training \nPhase II: Work Readiness \nPhase III: Internship Experience ','1191156779628062,871972134291589,968786376614445,945061241324147','https://contemporaryservices.net/programs-and-services/',NULL,NULL,'Not vetted',NULL,'Walk in for services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1070225300187916,1222973168897685','1240535751990184,1104690815663262,594681114588627,1156542764196212',NULL,NULL,NULL),(221,800132260226272,'Children\'s Program',NULL,1326157862705937,'MBI\'s Youth Division services children ages 5-17 and their families. Services include individual therapy, group therapy, family therapy, community support, psychiatry and school based.\n\nServices Provided:\n\nDiagnostic Assessments; referral for Psychiatric Assessment/Medication Management\nTreatment Planning\nCrisis Interventions\nIndividual Therapy\nGroup Therapy\nPlay therapy\nClassroom Observations Parent & Teacher Trainings\nWellness, Education, & Prevention Programs\nEarly Recognition & Screening Program\nReferral for Hospitalization & Specialty Care','609550690795774','http://www.mbihs.com/what-we-offer/children%27s-program',NULL,NULL,'Verified',NULL,NULL,NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'910994843667047,1274396898894043','1231516890380928',NULL,NULL,NULL),(222,803655377623585,'Legal Hotline',NULL,1093127605400642,'Legal Counsel for the Elderlys Legal Hotline provides free legal advice, assistance, and referrals to:\n\nAll D.C. residents 60 years of age or older\nD.C. residents 55 years of age or older with Social Security and Supplemental Security Income disability issues\nD.C. residents 18+ regarding D.Cs home adaptation program, Safe at Home\n\nCallers first speak to our intake specialists, who gather information including name, address, date of birth, marital status, household members, income and asset information, and a general description of the legal problem or question.\n\nOur intake team includes staff who are bilingual in Spanish and English. Intake specialists provide this information to the hotline attorneys who are authorized to practice law in the District of Columbia. Hotline attorneys return calls as promptly as workload permits.\n\nThe Legal Hotline attorney gathers further information about the question or problem, and provides advice or assistance. If the problem requires further legal representation, the hotline attorney can refer the client to an LCE staff attorney or other programs depending upon the nature of the issue and program limitations on client income and assets.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/getting-help/?intcmp=AE-LCE-WWD-R1C1LL5',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,'868012483124236,1183802898164393,897000577913584,1131844892985746','763163886168100',NULL,NULL,NULL),(223,801873048546872,'Community Meal',NULL,1013543362848937,'We provide a free nutritious meal every Tuesday from 5:30 pm - 6:30 pm. Everyone is invited so please join us.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'905425032669080','862251806175777',NULL,NULL,'1190125799561725',NULL,NULL,NULL),(224,806428640646955,'Consumer Law',NULL,820488001755900,'Currently, we are only able to provide advice and brief services for most consumer issues.\n\nWe will consider handling the following consumer problems for clients who meet our income guidelines:\n\nCollections\n-Improper collections practices\n-Garnishments of exempt funds\n-Illegal harassment by debt collectors\n-Illegal fees or excessive interest rates\nWrongful repossession of vehicles\nPredatory or Deceptive Practices\n-Predatory or deceptive lending or installment purchase practices\n-Unlicensed contractors\nWrongful termination of public utilities\nContracts and warranties\n\nWe may offer advice and brief services for other consumer issues. If we cannot assist you, we will help find an organization that can.\n\nNLSP also helps staff the Small Claims Resource Center in DC.\nThe Small Claims Resource Center provides legal and procedural information to Plaintiffs and Defendants involved in Small Claims Court proceedings in the District of Columbia, as well as to individuals considering filing actions in Small Claims Court.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/consumer-law',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(225,807525744099302,'UPO Inspire',NULL,761153930697275,'We seek to improve the career trajectory for the smart, the motivated, and unfortunately, the often overlooked talent in Washington DC\n\nThrough technology training, UPO Inspire aims to improve the career prospects of locals residents who are committed to pursuing a path towards sustainability.  Because when people work their way out of poverty, good things happen.  Positive contributions to society.  Local businesses have access to top rated technical skills.  It\'s a win-win. \n\nThe UPO Inspire Technology Training Initiative is designed to increase middle-skill job opportunities for those on the edge of poverty.  This program attempts to close this opportunity gap by funding job training and support for underemployed individuals. Our students undergo comprehensive well-rounded IT training covering help desk support, technical professional development, and career and social coaching.  32 weeks in duration (at a minimum) combining in-class sessions and internships, students receive their CompTIA A+ certification upon successful completion.','594960886051316,999755198000719','https://www.upoinspire.org/',NULL,NULL,'Verified','789038541797078,970915508638448','Call to find out more information about enrollment.',NULL,NULL,NULL,NULL,'665905423802380','587544010010943,940897095189363,682372519823224',NULL,NULL,'1304904589817191,1166860713798541',NULL,NULL,NULL),(226,810517634677025,'Business & Information Technology',NULL,1230770757213322,'Our Administrative Support certification is a great first step towards any entry-level office support position. Learn to navigate computer software, as well as e-mail, the internet, and social media platforms.\n\nCourse Tracks Under Administrative Support:\nBasics for Computer: Learn to demonstrate basic computer skills for home and work. You will learn to navigate programs including Microsoft Office Word, Excel, and PowerPoint. Also gain skills to confidently navigate the Internet, E-mail, and social media platforms. This track provides the tools you need to take online exams and assessments with ease.\n\nMicrosoft Office Specialist: Get the most out of Microsoft Office to advance in any office environment. A Microsoft Office Specialist (MOS) certification in programs such as Word, Excel, or PowerPoint is a good fit for unemployed or under employed entry-level professionals.','771897230838212','https://www.ywcanca.org/what-we-do/career-education-training-center/business-it-fundamentals/',NULL,NULL,'Verified','970915508638448,789038541797078','The application is available online on the program website. You can also call for more information.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'836091364973509','1330181492619505',NULL,NULL,NULL),(227,809544210408082,'DC Fiscal Policy Institute',NULL,633605990771272,'The DC Fiscal Policy Institute conducts research and public education on budget and tax issues in the District of Columbia, with a particular emphasis on issues that affect low- and moderate-income residents.',NULL,'http://www.dcfpi.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(228,750095723394999,'DC Public Library',NULL,1210512793158453,'The library provides environments that invite reading, learning and community discussion and equips people to learn all their lives, to embrace diversity and to build a thriving city. We are proud to be a recognized force in the community for engaging the mind, expanding opportunities and elevating the quality of life.',NULL,'http://dclibrary.org',NULL,NULL,NULL,'789038541797078',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(229,750465787434275,'Health',NULL,1287130751059247,'Calvary provides therapy and mental health services with a licensed professional, addiction recovery support, and nursing care  all on-site.\n\nWomen at Calvary with a history of domestic abuse have the space and support to begin healing.\n\nCalvary offers daily addiction recovery meetings for women who are working to maintain their sobriety. Meetings are facilitated by an addiction recovery counselor.\n\nWomen receive physical care at Calvarys facility from a staff nurse. Case managers offer support by coordinating medical appointments and follow-up treatment.','1315826372203677','https://www.calvaryservices.org/program/health/',NULL,NULL,'Verified','941516382466411','To access our services, you must first receive a referral from a core service agency. If they match you with our organization, you will be sent over for an intake. If you have additional questions, please call.',NULL,NULL,NULL,NULL,'1285405208459287','890039510897571',NULL,'836091364973509,877243931325915,1212718840001878','926608893625888',NULL,NULL,NULL),(230,753964791303094,'Lukey Kaempfer Transformation Project',NULL,1306699628219808,'The Lukey Kaempfer Transformation Project will prepare formerly homeless Sasha Bruce clients to enter college by offering a dedicated education coordinator to provide them with an intensive high school navigational experience relevant to college admissions and to coordinate college access planning with each participant to include:\n\n G.E.D. Preparation (if necessary);\n After school tutoring;\n Mentoring (particularly during summer months)\n Study skills development;\n SAT/ACT preparation;\n Career exploration and training opportunities; \n College tour arrangements and visits;\n Practical supports on college campuses where participants have enrolled; and\n College scholarship and financial assistance support. \n\nThe initial cohort will be comprised of 5 prospective undergraduate students during the projects first year of operation with a plan to add an additional 5 SBY clients annually (until the program reaches a maximum of 25 students).','1083708956779513','https://www.sashabruce.org/workforce-development/',NULL,NULL,'Verified','789038541797078','Candidates interested in joining the cohort group will be required to complete a career interest inventory in addition to submission of school records and a reference for college/career readiness from a SBY program manager.  Client credentials will be reviewed by project supporters to include a representative from the Kaempfer Family; a member of the SBY Board of Directors; a representative of the SBYs Community Impact Council; SBYs Chief of Programs; and a member of the SBY Senior Team.',NULL,NULL,NULL,NULL,'1173443518827100',NULL,NULL,'883345659611536','626337120120757',NULL,NULL,NULL),(231,765864786771732,'Job Placement',NULL,872299181857178,'After the completion of an OIC/DC training program, OIC/DC provides job placement services and an extensive follow-up service for 12 months to ensure successful job retention.','644198517647426','https://www.oicdc.org/job-placement.html',NULL,NULL,'Verified','970915508638448','Services are offered to those enrolled in an OIC/DC job training program.',NULL,NULL,NULL,NULL,'1159943619120642,1329231011154165,940633061926387',NULL,NULL,'868012483124236','592528015341160',NULL,NULL,NULL),(232,772454821683547,'Health and Wellness',NULL,783236314114871,'Our two psychiatrists and general practitioner seek out clients who do not have access to basic medical care and psychiatric treatment and help them address the underlying issues that may cause their homelessness. Weekly, the psychiatrists engage and treat our guests in the Drop-in Center, residents in our winter shelter, and those with whom contact is made by going to them on the street.\n\nOur psychiatrists make referrals to AA, detox, and addiction treatment programs and perform comprehensive medical assessments needed to qualify for S.S.I. benefits. They are available for emergencies and, if necessary, for preparing emergency psychiatric evaluation petitions in the case of dangerous behaviors. Most of the time, the psychiatrists provide crisis intervention and offer the opportunity for treatment and S.S.I assessments because it is the insidious nature of mental illness that individuals are in denial of their illness.\n\nOur general practitioner sees patients in our Drop-In Center and accompanies staff on street outreach one morning a week. She checks blood pressure, listens to peoples heart and lungs, tests blood sugar, manages chronic diabetes or hypertension, dispenses medication or writes prescriptions, makes referrals, and calls an ambulance when needed. She also engages in health counseling aimed at reducing or stopping drinking, smoking, and the use of drugs, as well as addressing nutrition and other self-care priorities.','865999041296626','https://georgetownministrycenter.org/programs/health/',NULL,'info@gmcgt.org','Verified','941516382466411','Call or walk in to apply for services.\n',NULL,NULL,NULL,NULL,'658265377894745','1251235179498072',NULL,'877243931325915','807078925662836',NULL,NULL,NULL),(233,782799413098806,'LGBTQ Programs',NULL,1180598613249590,'Through transportation, housing, volunteer services, and more, Seabury Resources for Aging supports older adults and people with disabilities of all sexual and gender identities and expressions. \n\nOut and About connects DC LGBTQ older adults through wellness programs, cultural events and conversations designed to address the concerns within the community. It is our mission to better understand the growing needs of LGBTQ older adults through listening, creating, and delivering programming with sensitivity, knowledge, and pride.','1183011241112934','https://www.seaburyresources.org/lgbtq-programs',NULL,'kfuller@seaburyresources.org','Verified','637158405241810','Call or email for more information.',NULL,NULL,NULL,NULL,'762056949976027','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(234,784134299150571,'Computer Training',NULL,1004391421304549,'ACSGW offers various classes with the goal of helping you to become self-sufficeint. Classes are very reasonably priced to help us pay for the instructors and to ensure that clients are invested in their education. \n\nBeginning Computer Training, familiarizes students with computer and their applications emphasizing their use in the work place, college and for future careers. Students learn about the Internet, email, web browsing for jobs and school application and social media.\n\nIntermediate Computer Training, students learn Microsoft applications for the work place, Microsoft word, Excel for data entry and PowerPoint for creating presentations and the use of scanners and printers','950009053464384','https://www.acsgw.org/education.html',NULL,NULL,'Verified','789038541797078','For more information or to learn how to register for a class please call us.\n',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(235,784403343985076,'School-based Behavioral Health Services',NULL,883186000200856,'Mental health services offered through a 3 tiered approach at area schools in the District.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(236,784662874544792,'Transitional Age Youth Division (TAY)','TAY',1326157862705937,'TIP (now known as our TAY Program) has been one of MBI Health Services shining programs found within its walls. Kids ranging from 14 years to 29 years of age are able to experience a different, and much more positive way of life with the help, and guidance, of the TAY Team found at our headquarters location in Washington D.C. \n\nThe Transition to Independence Process Program is an evidence-based practice for youth that range between 14 to 29 years of age.  By using the Seven TIP Core Practice Modules (SCORA, Whats UP, Rationales, SODAS, In-Vivo, Strength Discovery/Needs Assessment, Futures Planning), youth are able to move towards independence in life.  ','959978038980815','http://www.mbihs.com/what-we-offer/transitional-age-youth-division-%28tay%29',NULL,NULL,'Verified','637158405241810,1232587316936391','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'627208723437175','817410769508748',NULL,NULL,NULL),(237,789715981823462,'Psychiatry Clinic',NULL,802521051916688,'The Community Connections Psychiatric Clinic provides access to Board Certified psychiatrists and nurses. The clinic provides integrated psychiatric care to all interested Community Connections clients (adults, children, and youth) and works closely with their treatment teams. Services provided in the clinic include assessment, medication management, lab work, and nursing services. Psychiatrists and nurses working with the Assertive Community Treatment teams often meet clients in the community. ','1044869288351593','http://www.communityconnectionsdc.org/our-services/integrated-care',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(238,785647685413221,'Coming of Age',NULL,970560028876577,'Coming of Age in Maryland (CoA) is an interagency collaboration between JSSA and Premier Homecare, Bender JCC of Greater Washington, and Jewish Council for the Aging that offers social and educational events for seniors. Participation in CoA is an easy way for older adults to stay engaged, active, and independent. Registration for activities is open to individuals age 60+ of all faiths and ethnicities living in Montgomery County. There is no membership fee to join.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/social-programs/coming-of-age/',NULL,NULL,'Verified','637158405241810','Brochures and registration forms are available on the website.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'1053289039718908,1183802898164393,1227383950401000','1328302797893590,1218692669680880',NULL,NULL,NULL),(239,797815960840049,'Mental Health Care',NULL,791950857737387,'We offer same-day psychiatric appointments, no questions asked. Individuals in need can immediately get help without having to share personal information. Removing barriers to psychiatric help enables us to assist more individuals and build trust. This gives us the opportunity to further enhance our participants lives.\n\nOur team understands the impacts that mental health issues can have and always have the individuals long term mental health in mind.',NULL,'https://friendshipplace.org/programs-outreach/drop-in-clinic/',NULL,NULL,'Verified','941516382466411','The Welcome Center is located at 4713 Wisconsin Ave NW, Washington, DC 20016, between the TenleyTown and Friendship Heights Metro Stations. To visit, take the following busses: 30N, 30S, 31, 33 and N2.\n\nAnyone in need of assistance is welcome to come to the Drop-In Clinic and Center.\n\n',NULL,NULL,NULL,NULL,NULL,'1075131025312672,822138509409088,795731873911297',NULL,'877243931325915',NULL,NULL,NULL,NULL),(240,802536341225895,'SAMARITAN INNS: INTENSIVE RECOVERY PROGRAM',NULL,745762970824360,'Offers 3 phases of treatment for homelessness and addiction.','984550353973330','http://samaritaninns.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'780151548177804',NULL,NULL,NULL),(241,805523882999344,'Youth and Family Support ',NULL,548126332764833,NULL,'946031179775955','https://www.whitman-walker.org/youth-services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1147736112287505',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(242,814817282883148,'Pre-K (3-5 years)',NULL,580772169029651,'The pre-K classrooms are designed to provide a safe, open environment in which children can explore, discover and participate in daily activities. Students must learn how to use large and fine motor to communicate, solve problems, and socialize with their peers. Theyre encouraged to show mutual respect among peers and adults. The preschool classrooms are composed of many challenges in different developmental areas to meet childrens needs and developmental skills. Examples of such include block areas, dramatic areas, house areas, reading corner, manipulative area, art, and music corner. The stage of trust and autonomy is reinforced.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'805633029474383','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(243,812376267113321,'Young Families',NULL,1323195974089796,'LAYC offers a housing program, Hopes House that caters to single parents with one child. Hopes House is a nine-month transitional living program for youth who are homeless or unstably housed and should be able to demonstrate that they have begun to the build skills needed to live independently before beginning the program.\n\nYouth live in studio apartments with their child, meet weekly with a case manager, and are offered wrap-around services and parenting classes while in the program. Bilingual services in English/Spanish offered.\n\nHopes House is located in an apartment building in northwest Washington, DC. The location is unlisted.',NULL,'http://www.layc-dc.org/what-we-do/safe-housing/young-families/',NULL,NULL,'Verified','929094559121639','Call for more information. Location is unlisted.',NULL,NULL,NULL,NULL,'1165471269627538','1353902664253088','942787076035093','1292849277583603,1295679372454826',NULL,NULL,NULL,NULL),(244,814382562390416,'Case Management',NULL,964008795352849,'Comprehensive outpatient services are offered to those consumers who are HIV+:\n\nSupport groups, counseling, and auxiliary services\n\nHIV One-on-One Education\n\nEntitlements (social, medical and mental health)\n\nADAP applications and follow up\n\nHealth Insurance (Medicare, Medicaid, DC Health Alliance)\n\nHousing referrals, SSI Benefits\n\nFood, water and childcare vouchers','803526594539754','http://www.rapinc.org/case.html',NULL,NULL,'Verified','941516382466411,637158405241810,832990803111047','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'664148755918958,780785826421817,915486946336080','601647045974328',NULL,NULL,NULL),(245,816660270769024,'Explorer Camp',NULL,1085490883099798,'A summer christian camp with various activities six weeks long during the day.','1146981306227913','http://www.nbmchurchdc.org/ministries.html',NULL,NULL,'Verified','637158405241810','Call to apply.',NULL,NULL,NULL,NULL,'731593628942678',NULL,NULL,'1274396898894043,1292849277583603','1217909742971397',NULL,NULL,NULL),(246,818563649469922,'Ward 8 Drug Free Coalition',NULL,727757843857751,'The mission of the Ward 8 Drug Free Coalition is to develop and implement comprehensive community-based activities designed to provide youth with positive alternative life choices.\n\nThe coalition engages Ward 8 youth, ages 11-17, in year-round programming designed to reduce alcohol, marijuana, tobacco, and synthetic drug use among youth through community engagement and peer intervention.','1286648129611472','http://www.fsfsc.org/copy-of-family-services',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'1274396898894043','1231516890380928',NULL,NULL,NULL),(247,760997112833771,'Online LGBTQ Resources',NULL,636426656659289,'An online resource page of various LGBTQ services in the DC area and nationwide.',NULL,'http://www.wandaalstonfoundation.org/resources/',NULL,'info@wandaalstonfoundation.org','Verified','637158405241810','Visit our website and click on the resources link.',NULL,NULL,NULL,NULL,'625109799377934',NULL,NULL,'1186681173947755',NULL,NULL,NULL,NULL),(248,762171918332918,'Care Management for Seniors',NULL,970560028876577,'Geriatric care managers meet with clients either at a JSSA office location or in their home to help address a wide range of concerns and to conduct a comprehensive needs assessment. Family members are encouraged to be a part of this process. After the initial needs assessment, the care manager will work with the older adult and their family to develop a detailed plan of care, including recommendations and referrals.\n\nServices could include:\n\n- Assistance with medical appointments, including transportation\n- Communication and family issues\n- Home-delivered meals\n- Home repair and maintenance coordination\n- Medical and legal needs coordination\n- Monitoring home care services (housekeeping, personal care)\n- Paperwork organization and bill paying\n- Relocation and moving assistance\n- Safety concerns\n- Socialization issues\n- Shopping and errands (through JSSAs volunteer programs)\n\nClients are provided access to:\n\n- Mental health counseling to address a variety of difficult life challenges and situations (such as anxiety, caregiving, depression, dementia, family concerns, grief, health concerns, making difficult decision, moving and retirement issues)\n- JSSA and community workshops and groups\n- JSSA and community resources\n\nJSSAs care managers act as advocates, consultants, and educators prioritizing the unique needs of each of their clients.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/care-coordination-for-seniors/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'1053289039718908,854808174954754','1328302797893590,1218692669680880',NULL,NULL,NULL),(249,759682631849783,'Ready2Work',NULL,726173106231202,'Ready2Work is a street-cleaning and beautification service provided by formerly homeless and unemployed men and women for six Business Improvement Districts in the city.  The 12 to 18 month program provides participants employment and the opportunity to develop and enhance on the job skills.  Participants also receive social service support, adult education and employment counseling to prepare them for successful long term employment.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(250,760885031702204,'Insurance Navigation Services ',NULL,548126332764833,NULL,'619784806206149,864227644478566,1214132387827753','https://www.whitman-walker.org/insurance-navigation',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'936920006699618',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(251,765385785732538,'Change Your Lease','Keep Safe Housing',983721114373124,'The 2005 Violence Against Women Act gives survivors of domestic violence the right to bifurcate their lease, removing their abuser. By calling us or visiting our walk in clinic, we can help you make this happen.','828792720206018','https://www.dashdc.org/housing-resource-center/maintain-housing/',NULL,NULL,'Verified','917725171609009','Call us or visit our walk in clinic access a letter to send to your landlord requesting bifurcation. You may be asked to provide documentation such as a letter from an advocate or court or policy documents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'777455803391753,1256136937607288,1212718840001878','1043474797867812',NULL,NULL,NULL),(252,775111969675006,'Basic Needs Services',NULL,810479025131545,'Shower Facilities with toiletries\nOn Site Laundry (Last Wash at 2:30PM)\nGender Neutral Bathrooms\nCommunity Lunch (Everyday at 2PM)\nClothing Closet\nHousing services with behavioral health support\nLegal Clinic (2nd and 4th Monday from 1-3PM)','994012462825446','https://www.hips.org/our-services.html',NULL,NULL,'Verified','911225335803318,929094559121639,637158405241810','Call or walk in. Mobile outreach services may be available in your area.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','1116823258971812,755877120889008,1239359074339438',NULL,NULL,'1115958014521430',NULL,NULL,NULL),(253,775927218674309,'Social Services',NULL,618997848324116,'Bread for the City cares about the well-being of our community. In addition to offering several community programs, our social workers assist with problem-solving and link friends and neighbors with appropriate resources. \n\nPrograms:\n\nPre-emplyoment Program (PEP)\n- Job readiness\n- Case management\n- Life skills coaching\n- Job placement\n\nRepresentative Payee Program\nA Representative Payee is an individual or an organization designated to receive disability benefits on a clients behalf. The Representative Payee then helps the client to budget the money and disburses the funds to pay for current needs, including housing and utilities, food, medical expenses, personal care and clothing. The Representative Payee must keep records of how the clients money is spent. This information is reported regularly to the Social Security Administration or to the Office of Personnel Management.\n\nWomen Empowered\nWomen Empowered is a wellness program for BFC clients that seeks to help them to achieve overall wellness of the mind, body, and spirit.  Participants are assigned a wellness coordinator and included in a supportive environment offering a wealth of workshops and activities. For additional information, please contact Donnie Hampton, SE Social Services Supervisor, at 202-587-0530.','858837023472383,1058560288612968','https://breadforthecity.org/social-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'592888047524221,606695908675970','1093418067022998,1317865313753055,620597234198028',NULL,NULL,'941976438893110,786471426290380',NULL,NULL,NULL),(254,785698484366760,'Nutrition & Food',NULL,1168436736852155,'At Vida Senior Centers we take care of the nutrition and diet of our participants. To do this, VIDA has a licensed nutritionist / dietitian who supervises the food services of our participants. Our nutritionist also offers nutritional and diet counseling individually and in groups. The nutritionist works in coordination with the Health Promotion Counselor to put emphasis on people with high risk of diabetes and high blood pressure. Individual and group counseling are done with the objective of helping participants establish a healthy diet, by promoting informed decisions regarding their food. It is always emphasized that a healthy diet helps prevent and manage chronic diseases such as diabetes, hypertension and obesity. In addition to the classes, the nutritionist also offers demonstrates of healthy cooking. Depending on the season and seasonal vegetables or fruits, healthy meals are prepared. The nutritionist regularly uses food from the Food Bank box so that we teach participants how to use those ingredients in the healthiest way possible. Participants are also educated on important issues related to nutrition such as: learning to keep food in good condition; modify recipes to make them healthier; improve decisions when buying food; use healthy portions of meals; and pay attention to their weight. They are often reminded of the importance of having breakfast and not skipping meals to avoid spikes and drops in sugar levels. In addition to that, VIDA gives breakfast to 50 participants in our two centers. We do not have a subsidy to provide breakfast, but for the past year VIDA has obtained private donations of bread and cereals that allow us to deliver breakfast in the morning to 50 people. In addition, we offer free lunch to about 120 people daily. Thanks to the support of the Washington DC Department of Aging, we deliver around 120 hot lunches daily between our two centers, Monday through Friday. Additionally, Vida Senior Center is an official distributor of the city\'s Food Bank, with which we distribute to each participant one meal box per month. In summary, nutrition and food activities are as follows:\n\n Free light breakfast: coffee / tea and bread or oatmeal\n Free lunches\n Individual nutrition assessments\n Individual diet tracking\n Group classes on nutrition\n Healthy food demonstrations\n Monthly distribution of a Food Bank box\n Individual counseling to handle stress situations\n Group counseling on frustration management techniques\n Tai-Chi exercises to learn to breathe and relax the body\n Classes on Positive Thinking\n Classes on Mental and Emotional Health\n Referral to doctors if the need is identified','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/nutrition-food/',NULL,NULL,'Verified','941516382466411,832990803111047','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(255,784304581015971,'Enroll in Insurance',NULL,1195870505334629,'Community of Hope can help you explore affordable health insurance options for you and your family through DC Health Link.\n\nDont have insurance? Need to change plans? Not sure what kind of coverage you need?  Problems enrolling with Medicaid? Get free one-on-one expert help from a Community of Hope Enrollment Assister at any of our locations!\n\nOur Enrollment Assisters are \nDC Health Link Certified trained experts who help you:\n\nNavigate the DC Health Link website\nReview your available health insurance options and help you enroll in quality coverage that meets your unique needs\nSubmit Medicaid applications (including DC Healthcare Alliance)\nAnswer your questions about healthcare coverage, including deductibles, co-pays, network coverage, and any other questions\nFind the right medical, dental or vision insurance plan for you and your family. See if you qualify for a tax credit or Medicaid.','1090162375763715,1146632771763115','https://www.communityofhopedc.org/healthcare/enroll-insurance',NULL,NULL,NULL,'637158405241810','No appointment necessary to meet with an Enrollment Assister.',NULL,NULL,NULL,NULL,'665495770462606,763524779006557,1279880844015186','1257079363804425,1223815259564202,1305096827911095,1201313382171851,961771055926549',NULL,'858010753970278','1016957397804274,771726091253980',NULL,NULL,NULL),(256,789912082269332,'Handicap-accessible Bus Rentals',NULL,855094084464049,'Handicap-accessible Bus Rentals\nCatch a JCA bus  or rent one for your group! Groups throughout the metropolitan D.C. area can rent our handicap-accessible buses, most seating 18-20 passengers. In addition, many buses run regular routes, taking seniors to the JCA Misler Adult Day Center, Montgomery County Senior Centers, the grocery store and other essential destinations.\n\nAll JCA drivers have commercial licenses and are specially trained to meet seniors needs.','924628911683577','https://accessjca.org/handicap-accessible-bus-rentals/',NULL,'mgalil@AccessJCA.org','Verified','632609508449013','Contact the JCA Rose & Harold Kramer Center on Transportation\nPhone: 301.468.6280 or 703.652.1510',NULL,NULL,NULL,NULL,'957166179094598,1046945308097127','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(257,810344496794884,'Assistance to Crime Victims',NULL,1116810105858975,'Through this program, CARECEN informs Latinos who have been victims of crime or suffered as a result of a crime (such as domestic violence, violent crimes or sexual assault) about their rights and provides direct services to crime victims including applying for compensation and screening for immigration services.','547920365968268','http://carecendc.org/direct-services/immigration-legal-services/',NULL,'info@carecendc.org','Verified','917725171609009','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(258,811709644888130,'HOWARD UNIVERSITY HOSPITAL: COMPREHENSIVE AREA RESOURCES: ENTITLEMENTS AND SERVICES',NULL,636208133431880,'The HUH CARES program provides comprehensive health services, including mental health counseling, to men, women, children and adolescents who are HIV positive. They serve clients who are uninsured or underinsured; clients must be DC residents.','1163808823186351','http://howard.edu/huhcares/default.htm',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1200743429012601',NULL,NULL,NULL),(259,820685180498221,'Urgent Care Clinic',NULL,976379482380679,'Our Urgent Care Clinic (UCC) at the DC Superior Court serves individuals in the criminal justice system who are in need of immediate mental health and/or substance abuse services. Individuals served by UCC can be referred by a judge, pretrial officer, probation officer or an attorney. This partnership between Pathways to Housing DC, the DC Department of Behavioral Health, DC Addiction Prevention and Recovery Administration and DC Superior Court  allows for immediate access to support services and establishes linkages to long-term providers to ensure effective treatment alternatives, prevent repeat offenders, and ultimately, help our clients recover. UCC is one of the first of its kind in the country to provide immediate substance abuse and short-term mental health treatment services to arrestees (many of whom are homeless).','743353111808252','https://pathwaystohousingdc.org/what-we-do/urgent-care-clinic/',NULL,NULL,'Verified','941516382466411','Individuals served by UCC can be referred by a judge, pretrial officer, probation officer or an attorney. This partnership between Pathways to Housing DC, the DC Department of Behavioral Health, DC Addiction Prevention and Recovery Administration and DC Superior Court  allows for immediate access to support services and establishes linkages to long-term providers to ensure effective treatment alternatives, prevent repeat offenders, and ultimately, help our clients recover. ',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268',NULL,'877243931325915','1137409735223363',NULL,NULL,NULL),(260,831138417529715,'Workspace Rentals',NULL,844234717265246,'MHCDO offers several types of workspace: private offices, co-working, and dedicated desks. Our workspaces provide the perfect environment to increase your productivity and grow your business. MHCDO provides several workspace packages to meet the needs of nonprofits, start-ups, existing businesses, and solopreneurs. MHCDO also offers conference rooms available to rent for meetings and special events. The conference rooms provide several amenities to ensure that your presentation or event are extremely successful.','1116781625364190','https://mhcdo.org/workspace-rentals',NULL,NULL,NULL,'970915508638448','Fill out the form on our site.',NULL,NULL,NULL,NULL,'1161638800071039','887181369602868',NULL,NULL,'802890951138045',NULL,NULL,NULL),(261,768832404265850,'Financial Assistance ','Labor of Love Human Service Center',877366768823409,'Based upon a client intake process, persons may be eligible to receive assistance with rent/mortgage, utilities, and  other emergency care needs.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','1077790582995406','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(262,793392702326293,'Case Management (Medical Case Management) ',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(263,793847249153498,'Homelessness and Housing',NULL,802521051916688,'For more than 25 years, Community Connections has supported individuals and families with establishing and maintaining safe and affordable homes as a part of their whole health recovery. We were an early leader in the Districts effort to develop and implement effective Coordinated Assessment and Housing Placement processes.  We are active with government partners and local coalitions of community providers to expand the availability of housing resources, especially for the citys most vulnerable individuals and families. In all of these activities, we demonstrate a comprehensive understanding and commitment to the District\'s strategic plan to end homelessness.\n\nCommunity Connections offers a comprehensive range of outreach and residential supportive services to promote housing stability and prevent homelessness  especially with people experiencing mental illness, addiction, and trauma.\n\nOur Homeless Services Program provides outreach to women and men living outside and in reach to those staying in emergency and transitional shelters. We offer extensive navigation assistance (e.g., obtaining identification, completing applications, mitigating housing barriers, etc.). We also utilize SAMHSAs SOAR model to increase access to Social Security disability benefits for people with medical and/or behavioral health issues currently experiencing or at risk of homelessness. Our teams build relationships with people experiencing homelessness to reduce barriers to housing and promote connection with other services.','1044869288351593','http://www.communityconnectionsdc.org/our-services/homelessness-housing',NULL,NULL,NULL,'929094559121639','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812',NULL,NULL,NULL,'872487510282336',NULL,NULL,NULL),(264,796710603642968,'HIV Services',NULL,1093127605400642,'After more than four decades of serving indigent, underinsured, and uninsured D.C. residents, Andromeda continues to live by its mission of providing culturally accessible and quality health services to District residents living with or affected by HIV. As a multidisciplinary health service provider, Andromeda is fully aware of the economic and psychosocial barriers and obstacles encountered by our participants and in an attempt to address these barriers we aim to expand and improve the range of services available by providing a multilingual and multicultural staff, accessible service hours, and leveraging all payer systems.\n\nOur integrated system of care consists of core medical services: Outpatient Ambulatory Medical Care, Medical Case Management, Treatment Adherence Counseling, Mental Health as well as Substance Abuse Services. Andromedas system of care includes the provision of Early Intervention Services, Psychosocial Support Services, and Medical Transportation. Andromeda continues to make its services well known and accessible, promoting HIV prevention and early diagnosis through HIV testing, health education, and providing informative resources. Our aim is to educate our community, reduce the stigma of HIV, increase early detection of HIV and encourage immediate enrollment into care. Our network of supportive services also provides necessities such as food, housing, oral health and legal services, address the individual needs of our participants and provide them with care that is effective to the improvement of their health. Andromeda hopes to continue its provision of all services needed, while adhering to the established protocols and the professional guidance of HAHSTA.','841307455613093','http://andromedahealth.org/our-services/hiv-services/',NULL,NULL,'Verified','941516382466411','Call for an appointment',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,NULL,'1224638786118966',NULL,NULL,NULL),(265,792954474348824,'Family & Community',NULL,NULL,NULL,'836904778271068,621638073150979,1120989994777643,1261460579474983','https://www.mazique.org/services/',NULL,NULL,'Verification in Progress','637158405241810',NULL,NULL,NULL,NULL,NULL,'1200602057472122',NULL,NULL,NULL,'626820886744559,882267988490168,920259856619905,913507292300030',NULL,NULL,NULL),(266,794796274007587,'Foreclosure Prevention',NULL,761153930697275,'Are you late in paying your mortgage or concerned about your ability to pay in the future? We provide free assistance to borrowers in distress.\n\nHomeowners who are facing default or have already defaulted too high level on a mortgage may speak with one of our foreclosure prevention counselors or set up a session to discuss their options moving forward.','594960886051316,999755198000719','https://www.upo.org/housing-counseling/',NULL,NULL,'Verified','1077790582995406,929094559121639','Please call to join the next class.',NULL,NULL,NULL,NULL,'853687095165430','587544010010943,940897095189363,682372519823224',NULL,'905876656375498','1304904589817191,1166860713798541',NULL,NULL,NULL),(267,804988563046565,'Assistance',NULL,1004391421304549,'ACSGW offers various types of assistance to qualifying local community members. The specific qualifications vary for different types of assistance. That\'s why the first step is for interested people to call and make an appointment with a case manager, who will conduct an interview to determine your needs, the programs we have available to assist you and to determine your qualifications.','950009053464384','https://www.acsgw.org/assistance.html',NULL,NULL,'Verified','637158405241810','For more information or to schedule an appointment, please call. You can also request an appointment online.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(268,807848846460860,'Healthy Families',NULL,930909694635560,'A program offering assistance to families including:\n- Food assistance\n- Clothing and hygiene\n- Nutrition classes','906651913636867','https://lortonaction.org/self-sufficiency-resources/',NULL,NULL,'Verified','941516382466411,911225335803318,832990803111047','Call to register. Walk in during registration hours.',NULL,NULL,NULL,NULL,'906987068756792','1229690477859335,892622133517119,876311376686616,600743088526043,1256920432035968',NULL,'1292849277583603','1276944443091304',NULL,NULL,NULL),(269,807542367996268,'La Casa Transitional Rehabilitation Program (TRP)',NULL,1085960322097234,'La Casa Transitional Rehabilitation Program (TRP) provides transitional housing for English and Spanish speaking homeless men to help them achieve self-sufficiency.\n\nThe program can serve up to 40 men who are 18 and older. All participants in the program receive an Individualized Service Plan (ISP). The ISP identifies goals that should be met by individuals in the program. The primary objective will be to assist the residents in finding employment and moving into permanent housing.','612166168856784','http://www.dccfh.org/programs/transitional-housing/la-casa-transitional-rehabilitation-program-trp/',NULL,NULL,'Verified','929094559121639','Applicants for transitional housing will be accepted Monday through Friday between 9:00 a.m. and 1:00 p.m. During the intake process, individuals will need to provide basic information such as name, date of birth, and social security number if available.',NULL,NULL,NULL,NULL,'1213542765723083','1202819882057306',NULL,'625195015492370,866965462945330,877243931325915','855901575106743',NULL,NULL,NULL),(270,822297863188980,'Clothing Program',NULL,1004391421304549,'Generous and caring community members bring clothing donations to the Adventist Community Services of Greater Washington (ACSGW) center at 501 Sligo Avenue throughout the year. Volunteers then sort the clothing and display the items in the center\'s small store, just like you would see in a retail clothing store, except there are no price tags. The clothing is free for qualifying people.\n\nPeople in need of clothing can schedule a time to discuss their needs with a case manager. The case manager will ensure the person qualifies for our assistance. Upon leaving the case manager\'s office, qualifying clients proceed to the \"store\" to shop. Since our shop is so small and demand is so high, we set limits on the number of items a client can take during any visit. We also ask clients to only shop one day a month and limit their selection to what is needed for members of the client\'s immediate household.','950009053464384','https://www.acsgw.org/clothing.html',NULL,NULL,'Verified','911225335803318','An appointment is required, please call to make an appointment.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(271,825451959778479,'Shelter Hotline',NULL,761153930697275,'No one should be forced to live out on the street, especially during extreme weather conditions.\nAs DCs one and only provider of transportation services for the homeless, UPOs Shelter Hotline helps bring people without a place to live to local sheltersno matter the time of year. We also provide those in need with clothing, blankets, sleeping bags, and other items that can help them feel a bit more comfortable.\nThe Shelter Hotline is staffed by a dedicated team of more than 40 employees, with services offered around the clock from November 1 through March 31 and 8 a.m. to midnight from April 1 through October 31. Concerned community members are encouraged to look out for homeless individuals and families in their neighborhood and call to have them transported to the comfort and care of a nearby facility.','1186823261288379','https://www.upo.org/communitywellness/',NULL,NULL,'Verified','929094559121639,878986697513222','Call our hotline.',NULL,NULL,NULL,NULL,'775081687772349,1066322983572364','623621986722153',NULL,'684980356183378','1010090868515533',NULL,NULL,NULL),(272,836738857450646,'Harm Reduction',NULL,810479025131545,'Syringe Access and Disposal\nOverdose education and prevention materials such as Naloxone and Fentanyl test kits\nSafer Sex Materials\nHarm Reduction Counseling','994012462825446','https://www.hips.org/harm-reduction.html',NULL,NULL,'Verified','637158405241810,941516382466411','Call or walk in. Mobile outreach services may be available in your area.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','1116823258971812,755877120889008,1239359074339438',NULL,NULL,'1115958014521430',NULL,NULL,NULL),(273,838994053401205,'Race Equity In Child Policy',NULL,1138775501034023,'As the District undergoes a profound demographic shift and booming economy, persistent racial inequities exist among the Districts children. DC Action for Children is developing resources and tools to effectively advocate for public investments that improve equity in opportunities and outcomes for children and families of color.','1147823510376197','https://dcactionforchildren.org/race-equity-child-policy',NULL,NULL,NULL,'917725171609009','Call for information on our current projects.\n',NULL,NULL,NULL,NULL,'1139434629285592','1098590993104545',NULL,NULL,'792709813022086',NULL,NULL,NULL),(274,783798317190015,'Preventative Health',NULL,577764298046742,'The objective of this program is to help LGBTQ individuals that are at risk of acquiring or who are diagnosed with a sexually transmitted infection, especially HIV and AIDS, and to ensure clients receive the most scientifically sound information on prevention and treatment to promote a healthy lifestyle. These services focus on educating local communities as a preventive measure.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','941516382466411','Call or walk in to set up an appointment.',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158',NULL,'836091364973509','603292299584681',NULL,NULL,NULL),(275,800290835408679,'Housing Services',NULL,1043249662316489,'Miriams Kitchen provides supportive services to 107 individuals in the Department of Human Services Permanent Supportive Housing Program (DHS PSHP), who live in units located throughout the city.   \n\nOnce clients are matched with housing, Miriams Kitchen serves as a coordinator and advocate between clients, their landlords and service providers, an essential strategy for long-term success.\n\nCase managers support clients goals for returning to an active life in the wider community with a broad spectrum of services, ranging from:\n\nmonitoring their health and safety;\nhelping them set and keep appointments with medical professionals and counselors;\ndeveloping budgeting and daily living skills;\nassisting them in efforts to find employment and benefits; and\nproviding other more intensive physical and psychological interventions.\nPermanent Supportive Housing isnt just about having a home. Its about having expert case management services to help a client stay in that home.\n\nIts about helping clients thrive in their new lives.','1220017101351760','https://miriamskitchen.org/programs/housing-services/',NULL,NULL,'Verified','929094559121639','You must be referred to by a core service agency.',NULL,NULL,NULL,NULL,'582664674810922,1076876608568522','1229918560173750,777551828972187',NULL,'1244888069012632','850193305992354',NULL,NULL,NULL),(276,801481287749333,'Christmas for Our Children',NULL,584105465886479,'We give out toys and clothing to children in our community.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318','Call to find out what the distribution process is this year.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(277,799762672906525,'COMMUNITY FAMILY LIFE SERVICES',NULL,786390431879533,'Trinity Arms program offers housing up to two-years, with 13 individual units, offering a stable and supportive housing program. These spacious one, two and three-bedroom, private apartments are available to help families escape homelessness and enable each family group to work towards independence and self-sufficiency.','1266854743896634','http://www.cflsdc.org/housing-programs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'967673170995278',NULL,NULL,NULL),(278,804741531339742,'Unity at Patricia Handy Place (Ward 2) ',NULL,1043772486617212,'Healthcare for homeless ','593446361217353',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1255731860722472',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(279,813051911788426,'Before and After School',NULL,580772169029651,'Our Before and After School Program offers a rigorous academic, cultural, and developmental program. Credentialed bilingual teachers oversee homework completion and provide tutoring in reading, writing, math, science, and computer based learning. Our long term goal lies in demonstrating that Latino students can be academically successful regardless of language proficiency, income level, origin, background, or immigration status. Further, the primary objective of our Before and After program is to improve academic and social-emotional skills, and multi-cultural awareness of the students between 5 and 12 years old.\n\nThe Before and After School Program at BCCC is staffed by individuals from a host of different cultures, with whom children can identify. Participants are encouraged to communicate in whichever language they feel most comfortable speaking, and staff is able to accommodate all levels of language learners. Latino enrollment in DCPS has more than doubled in the last decade. More importantly, it is the need for auxiliary services to reflect this population to ensure their success.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'648529534305998','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(280,822106893088278,'Pediatrics',NULL,605134586578120,'\n		Wellness Visits\n		Sick Visits\n		Immunizations\n		Flu Shots\n		Physicals','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,'1274396898894043','651804021834110,1128987918758522',NULL,NULL,NULL),(281,830099986846686,'Resilient Scholars Project (RSP)','RSP',769893937425938,'The RSP clinicians provide therapy and case management services to DC children/adolescents and their families affected by trauma and/or loss.  RSP collaborates with youth, their families, and community partner staff to improve their understanding of trauma/loss and allow them to develop coping skills that are healthy and practical.  Weekly sessions provide youth and their families the space to process their experiences and discover their innate resilience.\n\nResilient Scholars Project  School Based (RSP-SB) Services\n\nRSP-SB Services are grounded in evidence-based treatment models such as trauma-focused cognitive behavioral therapy (TF-CBT), play therapy, and mindfulness. The program empowers children and adolescents by highlighting their existing strength.  Throughout the school year, RSP clinicians facilitate group and individual therapy services using games, art, experiential activities, writing, and other modalities that explain concepts to participants in developmentally appropriate ways.  As part of RSP-SB Services, RSP clinicians also provide trainings to partner staff on incorporating trauma and bereavement informed practices into their environments. \n\nResilient Scholars Project  Home Based (RSP-HB) Services\n\nRSP-HB Services are designed to supplement RSP-SB Services by engaging entire families in the treatment process.  Using the trauma adapted family connections (TA-FC) model, RSP clinicians also aim to help families improve access to needed resources, increase safety skills, reduce youth absenteeism from school, and/or improve youth grades over a period of six months.  RSP clinicians build on the treatment models used in RSP-SB Services by incorporating principles from narrative therapy, motivational interviewing, and family systems therapy to work toward goals established with each family.  By participating in activities, games, and conversations that help families learn about trauma/loss, families also work toward improving communication and family cohesion.','1108850981657232,1166799153375505','https://www.wendtcenter.org/c-h-i-l-d-resilient-scholars/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(282,832915449530060,'LUTHERAN SOCIAL SERVICES: ADOPTION/FOSTER CARE',NULL,1182637329109100,'Provides adoption services for couples and individuals in their 20\'s - 50\'s who are able to provide a stable, secure and loving home environment for a child. Post-adoption services are also available.','1203649171352486','http://lssnca.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'840736952825536',NULL,NULL,NULL),(283,834347484127358,'Community Organizing',NULL,1140996665222837,'CASA conducts widespread regional outreach and organizes its members into local committees that develop individual and collective leadership to fight for social justice and human rights. Current organizing campaigns are aimed at:\n\nAchieving comprehensive immigration reform to create paths to citizenship for the nations 11 million undocumented.\nProtecting local families by challenging unjust immigration enforcement policies.\nPreserving low-income housing and improving job opportunities related to the construction of a new metro line.\nTenants rights and workers rights\nCASA members are encouraged to join activist committees in their area to continue to fight for justice and opportunity for our members. Committees meet biweekly in all CASA centers and some remote locations to participate in leadership trainings and to get more deeply involved in campaigns.','1091435530922324','https://wearecasa.org/programs/community-organizing/',NULL,NULL,'Verified','637158405241810,917725171609009','Call for more information on advocacy in your area.',NULL,NULL,NULL,NULL,'1184988992731200',NULL,NULL,NULL,'836261919910340',NULL,NULL,NULL),(284,830080281630476,'Walk-in Clinics and Workshops',NULL,1093127605400642,'Walk-in Clinics and Workshops\nThe APALRC holds walk-in clinics in different communities with the help of our legal partners. The APALRCs goal is to bring its services to communities in need. Clinics have been held in DCs Chinatown, the Muslim Community Center in Silver Spring, Maryland; a Korean church in Annandale, Virginia; and senior centers in Maryland and DC. At the clinics, law students and volunteer attorneys conduct intake interviews with clients, while legal partner agencies assist with advising clients and accepting cases where clients need ongoing representation.\n\nAPALRC staff members regularly conduct Know Your Rights presentation on issues of special importance to the Asian American community. APALRC attorneys have presented on workplace rights, domestic violence, employment discrimination, language access, and matters related to housing. APALRC staff members also regularly participate in health fairs and community festivals to ensure that those in need are aware of the assistance available through the organization.\n','1264011549910449','https://www.apalrc.org/walk-in-clinics-and-workshops/',NULL,' helpline@apalrc.org','Verified','917725171609009',NULL,NULL,NULL,NULL,NULL,'1148564700806737','743786809520784,835936447569443',NULL,NULL,'1018319997039351',NULL,NULL,NULL),(285,837954913596387,'Wellness Will Work',NULL,584105465886479,'This is a program to help those who may have chronic illnesses such as high blood pressure, heart diseases, etc. to manage their illness better by cooking and eating  organic and fresh produce , A LPN monitors their health for 6 month to make sure they are doing better with their health challenges.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','832990803111047,941516382466411','Call to join the program or walk in to learn more.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(286,850523592271025,'Behavioral Health Services','Emotional Wellness',1195870505334629,'Through our effective and compassionate services, we provide crisis intervention, counseling and many other supportive services, so that you can live a full life and achieve your and your familys goals.\n\nWe believe that your overall health is not just about how your body feels, but also about your whole life experience. Your emotional well-being is critical.\n\nStress, grief and other life challenges impact your physical and emotional well-being. Understanding our moods, thoughts, and behaviors are essential to personal growth. \n\nWe provide easy access to supportive care integrated into your regular health care visit, as well as crisis intervention, psychotherapy and medication options at all three of our healthcare centers. We work to make sure that you have access to effective and compassionate treatment so that you can live a full life and achieve your goals.\n\nEmotional Wellness Services\nScreening for all patients 12 years and older for common symptoms of stress, anxiety, and depression\nShort term counseling accessible during your health care visit for crisis and follow up options\nPre and postnatal emotional support\nPsychotherapy services supportive of your needs, goals, and preferences\nAccess to medication \nSmoking cessation counseling\nNew services added regularly, please call for the most up to date information','1146632771763115,1090162375763715,803276717045236,1000709017081839','https://www.communityofhopedc.org/healthcare/emotional-wellness',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'665495770462606,763524779006557,1279880844015186,785030046200943','568614343543607,948180855277876,1222464336020541,851787190372436,665724877149799,922694115907703,1197713243335218,849762282889895,856292695140924',NULL,NULL,'771726091253980,1016957397804274,1172277611731022,920259856619905',NULL,NULL,NULL),(287,853468345123345,'Health Promotion and Wellness',NULL,1168436736852155,'VIDA daily monitors the health condition of our participants. Vida has a Cuban geriatrician who fulfills the role of Health Advisor and Coordinator of the Health Promotion and Wellness Program. In addition, we have an Argentine Internist doctor, who supports this same task in our VIDA-Brightwood Meal-Site. As part of the Health Promotion program, our counselors routinely check the participants who register daily: their pressure is measured; their blood sugar levels are monitored; and their vital signs are supervised. Due to the high preparation of our counselors, when it is detected that the participant requires a medical appointment, the participants are referred to an appointment with their primary doctor or the needed specialist, if the case requires so. VIDA works with 7 hospitals in the city to which our counselors refer the participants when necessary. If the participant needs it, our social service counselor helps the participant to make the medical appointment. Sometimes the language barriers require this type of support. We also have a medication monitoring program to teach participants to know the benefits and side effects of the medications they take, so that they can understand the impact of their medications and identify if there is a problem. As part of the Medication Monitoring Program, a personalized follow-up of each person who enrolls in the program is carried out and a medication organizer pill is provided free of charge, so that they learn to take their medications on time and also learn to realize when they forget to take their pills. Likewise, VIDA also offers two weekly classes on common chronic diseases in older adults. Finally, Vida Senior Centers complements health education with the promotion of physical activity. VIDA offers arthritis exercise classes, chair exercise classes, dance and zumba classes, and yoga classes for seniors at its two locations. In summary, the activities offered by VIDA as part of the Health Promotion Program are the following:\n\n Daily monitoring of vital signs\n Diabetes Monitoring\n Weekly Chronic Disease classes in the Elderly\n Drug Adhesion Monitoring\n Training on how to be regular with medications\n Reference to medical consultations if necessary\n Support to make appointments with your doctors.','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/health-promotion-and-wellness/',NULL,NULL,'Verified','941516382466411','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(288,787452341993968,'School-based Mental Health Program',NULL,887352348953420,'In 2014, the Washington, D.C Metropolitan Area had a surge of young, unaccompanied immigrants fleeing endemic violence in Central America. In response to the needs of these young immigrants, La Clnica partnered with the Prince George County Transforming Neighborhoods Initiative (TNI@Schools) to launch a mental health and support program for youth. The program is housed in Northwestern High School in Prince Georges County, Maryland since 2015. Through individual counseling group sessions and case management, at-risk youth have a safe space to engage with their peers and express themselves while developing resilient and pro-social behavior.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','The program is housed in Northwestern High School in Prince Georges County, Maryland since 2015. For more information on how to get your student at Northwestern High School services, please call.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(289,794816074234794,'Permanent Supportive Housing Program (PSH)',NULL,1326157862705937,'Who is MBI Health Services LLC.?\n\nMBI Health Services, LLC is a certified behavioral health agency servicing the D.C. Metropolitan Area. We provide a wide range of services and programs for both adults and children for the sake of helping each individuals gain back their confidence and security into their lives.  Permanent supportive Housing (PSH) assist with Housing search, acquisition, and setup, landlord negotiations, credit, referrals, deposits, arrange utilities, phone, insurance, furnishings, recreation, housekeeping, food shopping and preparation, financial management, medication management, dental, nutrition, accessing natural supports, transportation, medical care, dental, disabilities benefits applications and appeals and SOARS.\n\nWhat should I expect?\n\nICM teams such as the PSHP at MBI that provide (Intensive Case Management) are designed to support individuals with less acute mental health and addiction issues through an individualized case management approach. The goal of case management is to help Clients maintain their housing and achieve an optimum quality of life through developing plans, enhancing life skills, addressing health and mental health needs, engaging in meaningful activities and building social and community relations.\n\n Our trained Case Managers will be respectful of the Clients choice in housing and living arrangements, there will be a moderate access to housing and privacy, functional separation of housing and services, community integration and rights of tenancy through housing classes in the community and documentation provided during home visits and interventions as well as flexible, voluntary, and recovery-focused services.','959978038980815','http://www.mbihs.com/what-we-offer/housing-programs',NULL,NULL,'Verified','929094559121639','How do I enroll?\n\nAssessment  The Vulnerability Index-Service Prioritization Decision Assistance Tool (VI-SPDAT). Is used for people who are homeless, and conducted at partner agencies, including shelters, services centers, transitional housing programs, permanent housing programs and outreach programs.\n\nTo ensure the most vulnerable are housed first, the master list is prioritized based on VI-SPDAT scores, length of time homeless, severity of need, and local population priorities for continuity of care. \n\nThe person is then matched through coordinated entry to a provided for case management services.  ',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'817410769508748',NULL,NULL,NULL),(290,813497895890135,'Food Distribution',NULL,891609880372190,'Food for Others provides free food to people in need in Northern Virginia.','1162558264395905','https://www.foodforothers.org/get-help/',NULL,NULL,'Verified','832990803111047','Northern Virginia Residents may receive food from us at the warehouse in two different ways:\n\n1. Families who meet U.S. Government income guidelines may be eligible to receive USDA food supplements. Northern Virginia residents may walk into the warehouse office and apply for this monthly program. The Emergency Food Assistance Program (TEFAP) is a supplemental assistance program for low-income households and is provided by the United State Department of Agriculture. Clients may shop in the choice area, choosing enough food to meet their families needs for three to five days.\n\nIf you are a Northern Virginia resident, you may walk in and apply. Bring a photo ID. If the ID does not have your current address on it, please also bring in a lease or a piece of mail addressed to you.\n\n2. Free emergency food distributions are made from our warehouse and are given to people who are referred to us by social service providers throughout the area including social workers, clergy, hospitals, and schools. The amount can provide nutrition for a family for three-to-five days until other forms of assistance become available.',NULL,NULL,NULL,NULL,'1111158785593728','993941911612725',NULL,'1244888069012632,767422099025816,565669778208779','902600774038071',NULL,NULL,NULL),(291,813553671875388,'Housing Law',NULL,820488001755900,'NLSP provides services for tenants all across DC. NLSP will consider handling the following types of housing problems for persons who meet our income guidelines:\n\nSERVICES FOR TENANTS\n\nTermination of a housing subsidy or voucher\nEviction defense\n- Assistance for tenants facing wrongful eviction\n\n- Including if the house is in foreclosure, being sold by the owner, or sold at a tax sale\n\nPoor housing conditions, including but not limited to:\n- lack of heat, air conditioning, water or electricity\n\n- bad plumbing\n\n- rodents, roaches, bugs or other infestations\n\nRequests for transfer vouchers, including for reasonable accommodations for disabilities\nFailure to return a security deposit\nIncorrect rent or utility allowance calculations\nWrongful utility disconnects\nTenant groups that seek to correct problems affecting many residents including:\n- Violations of the Tenant Opportunity to Purchase Act\n\n- Poor conditions\n\n- Threatened destruction or sale of a multi-family property\n\n- Relocation of residents because of changes to apartments\n\n\nPlease call us if you have a problem with conditions in your housing or if you are afraid you may lose your housing for any reason. If we cannot assist you, we will help find an organization that can.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/housing-law',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(292,817086926506130,'Youth Enrichment Program YEP!','YEP!',909401719398962,'YEP! utilizes the Early Risers Skills for Success model to engage children and parents in the childrens scholastic achievement, especially reading and math, as well as their social growth. YEP! operates during the school year and summer months, giving children a full year of support and enrichment activities.\n\nNEW staff and volunteers provide homework assistance during the week after school, as well as educational and cultural activities on the weekends. This year we are serving 25 children in YEP! and nearly all of them are performing at grade level or above in reading and math. We believe that supporting our youth so they can experience success in school is a tangible way to work to end homelessness.\n\nNEW has two family programs  New Horizons and New Generations  which provide both transitional and permanent supportive housing.  By offering comprehensive model support services, we help strengthen womens capacity to be heads of household, and offer women and children a chance to build life skills and forge stronger bonds as a family unit.','1215517692128370','http://nebw.org/programs/yep/',NULL,'info@nebw.org','Verified','789038541797078',NULL,NULL,NULL,NULL,NULL,'815707427459010',NULL,NULL,'883345659611536','1071232777595227',NULL,NULL,NULL),(293,822492274972082,'Crisis Services',NULL,802521051916688,'The Community Connections Crisis Service Team is responsible for providing comprehensive crisis services after 5 pm, on weekends, and holidays to all clients receiving services at Community Connections. This allows us to respond to crises as they happen, ensuring the safety of all our clients. Our main goals are to prevent crises, stabilize emergent situations, and reduce use of city emergency services such as 911 or hospital emergency rooms. The Crisis Service Team currently consists of trained mental health clinicians, supervised by a Licensed Clinical Supervisor.','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'637158405241810,878986697513222','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812',NULL,NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(294,821536701651146,'JCA & WorkSource Montgomery',NULL,855094084464049,'\nJCA & WorkSource Montgomery\nAmerican Job Center of Wheaton, MD\n\nJCA is the older worker expert of the American Job Center at the Westfield South Office Building near the Wheaton shopping mall. There, seniors can:\n\n- learn about SCSEP program eligibility requirements,\n- use phones and computers for free, and\n- discover resources to help them with their job search.',NULL,'https://accessjca.org/jca-and-worksource-montgomery/',NULL,'JCASCSEP@AccessJCA.org','Verified','970915508638448','Go to the WorkSource Montgomery website to learn more about its American Job Center and other programs. And be sure to see its comprehensive directory of 50+ employment resources and service providers in and around Montgomery County, Md.',NULL,NULL,NULL,NULL,'1277945722277968','1276016050822057',NULL,'1178794928615970,1114978823107611',NULL,NULL,NULL,NULL),(295,825628435745785,'Family to Family',NULL,931366816861797,'The Perry School Community Service Center (PSCSC) Inc. Family to Family  (FTF) Mentor Program combines the positivity of self sufficient family with TANF recipients or at-risk family within the PSCSC service area. The purpose of the PSCSC Inc., FTF Mentor Program is to assist families struggling to obtain self-sufficiency due to peer pressure, and high-risk factors with their family structure. The PSCSC Inc., FTF Mentor Program provides case management, workforce development, and family activities to support the at-risk family in reaching their goal of self  sufficiency in life. The Program is fully committed in its efforts to combat the chronic poverty within our community.  Today, we would like to ask that you join us by becoming a volunteer in the Family to Family Mentor Program.','1098817401970888','https://www.perryschool.org/family-to-family',NULL,NULL,'Verified','637158405241810','If you interested in this endeavor, please contact Mr. Christopher Tobias: email ctobias@perryschool.org',NULL,NULL,NULL,NULL,'821652578679829','802405581688320','804736877719123','1263089203668614,1292849277583603','896277574789110',NULL,NULL,NULL),(296,821678418698117,'Unity at Central Union Mission - Gales School (Ward 2) ',NULL,1043772486617212,'Healthcare for homeless ','574924274540606',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'630653316111869',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(297,824247975076202,'EmpowerSTEAM Summer Academy',NULL,1230770757213322,'Breaking Barriers for Girls in Traditionally Male-Dominated Fields\nEmpowerSTEAM Summer Academy is a five-week experience for girls ages 11-17. We know that women are underrepresented in STEM education & careers, especially women of color. More importantly, we also know its time to break those barriers.\n\nThrough EmpowerSTEAM, we further girls interest in pursuing STEM education and careers. Girls explore Science, Technology, Engineering, and Math in an engaging environment  and have a lot of fun while doing it!\n\nPast Camp Modules Have Covered:\nCoding and programming- program robots and create mobile applications\nScience in medicine\nMath as a basis for engineering\nEnvironmental science, urban farming, and sustainability\n..much more!','771897230838212','https://www.ywcanca.org/what-we-do/youth-mentoring-development/empowersteam-summer-academy/',NULL,'youthprograms@ywcanca.org','Verified','970915508638448,789038541797078','The application is available online on the program website. Download the application, fill it out, and then send it to youthprograms@ywcanca.org. You can also call for more information.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'998189789977161,1247050101845323','1330181492619505',NULL,NULL,NULL),(298,822696272964380,'Domestic Violence Project',NULL,1141864402494387,'Domestic Violence Project\nThe APALRC provides legal assistance to domestic violence survivors in Northern Virginia and Maryland. APALRC attorneys provide their clients with a full range of legal assistance  assisting with protective orders; immigration matters, particularly self -petitions under the Violence Against Women Act; and family law, which includes divorce, support and custody issues, etc.\n\nIn addition to providing legal assistance, APALRC attorneys work with community-based organizations and social service organizations to ensure that their clients receive holistic support. Outreach is also conducted to educate the community about the rights of battered immigrants and the resources available to them.\n\nFinally, to support their work, the APALRC has been working to expand the availability of bilingual pro bono attorneys through training sessions; the APALRC initiated a training program for pro bono attorneys interested in assisting clients with immigration self-petitions under the Violence Against Women Act.','1264011549910449','https://www.apalrc.org/domestic-violence-project/',NULL,'helpline@apalrc.org','Verified','917725171609009','Call for services',NULL,NULL,NULL,NULL,'1010201225467528','743786809520784',NULL,NULL,'1018319997039351',NULL,NULL,NULL),(299,824288922961198,'Limited Transportation Assistance',NULL,919690199169575,'Limited transportation vouchers available for employment interviews and medical appointments.','987030255962297','http://www.ucmagency.org/stepping-stones-basic-needs.html',NULL,NULL,'Verified','632609508449013','Call to set up an appointment.',NULL,NULL,NULL,NULL,'927006793998791','717231166133554',NULL,'891092215548488','611571036444170',NULL,NULL,NULL),(300,832898052878964,'Truancy Prevention',NULL,948113581207578,' Students with five to nine unexcused absences receive wraparound services that assist them and their families in addressing the family, school, and student factors that prevent them for attending school regularly. Activities include awareness/outreach; identification/referral/intake; and enrollment; and intervention. Additionally, families are offered multi-tiered, individualized services that are designed to accommodate their availability and level of commitment to address issues that impede school attendance.  This includes home visitation, case management, and other services, to include: parenting workshops/training/family strengthening events; music education and physical fitness for the middle schoolers. CSC works with elementary and middle schools throughout the district.\n\nFamily events, designed to promote parent-child bonding and emphasize the importance of education and school attendance\n\nGraduation ceremony for completing the Parent Support Workshop\n\nHome Visitation, Case Management, and Referrals as needed','911858349594317','https://www.wearecsc.org/tr',NULL,'info@wearecsc.org','Verified','789038541797078,637158405241810','This services is offered in partnership with \"Show Up, Stand Out\" initiative within the District of Columbias Public and Charter Schools. We serve Wards 1, 5, 7, & 8.\n\nEach participating schools Attendance Committee will collaborate closely with CSC staff to identify and refer students/families to the program. Once families are enrolled, CSC staff will conduct an intake with the families and work on goals families have identified.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'883345659611536','921919612082211',NULL,NULL,NULL),(301,838392358604924,'Sasha Bruce House',NULL,1306699628219808,'Sasha Bruce House is a compassionate alternative to the dangers of the streets for homeless, abandoned, abused, neglected, and runaway children. DCs only short-term shelter for young people, Sasha Bruce House is open 24 hours a day, serving youth ages 11 to 17. By providing a safe place to stay and intensive counseling services, Sasha Bruce House helps most youth reunite with their families and works to return all young people to stable and safe environments. On-site services include crisis intervention; individual, group, and family counseling; case management, support for shelter graduates, and temporary respite care.','1083708956779513','https://www.sashabruce.org/programs/safehomes/sasha-bruce-house/',NULL,'dpotts@sashabruce.org','Verified','929094559121639','Call 24 hours a day.',NULL,NULL,NULL,NULL,'1309000420353930','1040004903404957',NULL,'877243931325915,883345659611536,1247050101845323','626337120120757',NULL,NULL,NULL),(302,849919523533582,'Food Pantry',NULL,900455754248217,'A food pantry for those in need of food.','984058750613797','https://www.asburyumcdc.org/',NULL,NULL,'Verified','832990803111047','Call to confirm how frequently you can visit the food pantry.',NULL,NULL,NULL,NULL,'1224416978291385,931894948994087',NULL,NULL,NULL,'944084611081362',NULL,NULL,NULL),(303,856023638190230,'Lunch',NULL,1274524554725599,'A weekly lunch on Wednesdays for those who need a meal.','756139435965093',NULL,NULL,NULL,'Verified','832990803111047','Walk in and bring an ID.',NULL,NULL,NULL,NULL,'1179786506429029,821254553857567','592106590927990',NULL,'565669778208779','1088461256923134',NULL,NULL,NULL),(304,856932561557862,'Farms and Gardening ',NULL,1191959686811989,NULL,NULL,'https://www.capitalareafoodbank.org/what-we-do/farms-and-gardening/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(305,859897161557047,'Medical Services',NULL,1195870505334629,'Community of Hope is committed to providing our patients with accessible, compassionate and affordable healthcare services. Through the highest quality of care, we ensure an outstanding patient experience every visit.\n\nCommunity of Hope offers high quality medical care for patients of all ages. Receive the care that you want, when you need it, at any of our three federally qualified health centers!\n\nFind a medical home for you and your family, with a Community of Hope doctor, nurse practitioner or midwife that you trust. Visit us today.\n\nMedical services for you and your family\nAvailable in all three of our health centers to men, women and children, unless otherwise noted\nPhysicals, immunizations, and urgent visits\nChronic disease management\nPediatric care, including well and sick visits\nPrenatal care and pregnancy support groups\nBirthing services either at a local hospital or in our birth center\nBreastfeeding support and education\nFamily planning counseling and services, including birth control and confidential youth services\nConfidential HIV/AIDS and STI testing and treatment\nNutrition and wellness counseling\nWIC and other social service referrals\nWell-vision exams and other opthamology services* - Available only at Conway Health and Resource Center\nPodiatry* - Available only at Conway Health and Resource Center','1146632771763115,1090162375763715,803276717045236,1000709017081839','https://www.communityofhopedc.org/healthcare/medical-services',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'548821734063224,665495770462606,1279880844015186,785030046200943','1201313382171851,961771055926549,1133644382136224,849922591487683,774772066237737,1257079363804425,1223815259564202,1305096827911095',NULL,NULL,'771726091253980,1016957397804274,1172277611731022,920259856619905',NULL,NULL,NULL),(306,857913961326886,'ADA Accessible Shelter Units',NULL,1245236106154921,'In conjunction with the Department of Human Services, we operate four ADA accessible, apartment style, shelter units for families in Washington, DC. Everyone Home DC provides case management services to families during their shelter stay, and assists them transition into permanent housing.','936934819762396','https://everyonehomedc.org/programs/ada-accessible-shelter-units/',NULL,NULL,'Verified','929094559121639','Referrals for our ADA Accessible Shelter Units come from the Department of Human Services.\n\nIf you know a family encountering a housing crisis that they cannot resolve on their own, they can access homelessness prevention advice and program assistance referrals exclusively through the Virginia Williams Family Resource Center (920 Rhode Island Ave NE, Washington, DC 20018 | (202)-526-0017), the central intake for DCs coordinated homelessness assistance system for families.',NULL,NULL,NULL,NULL,'735608882009072','832596400468443,1170433044969408',NULL,'877243931325915,1292849277583603,1322383076619129','811198505758894',NULL,NULL,NULL),(307,796887413251668,'Career Center',NULL,1006551858895588,'Provides education, training, and employment services for people with disadvantages and disabilities. Also offers life skills training, computer classes, and a job placement services program. Specific training for hospitality and unarmed security & protective services is available.','556992607571593','https://www.dcgoodwill.org/education/training-programs/',NULL,NULL,NULL,'970915508638448','Application information is available online. There are deadlines for certain training programs as they run on a course schedule a few times annually.',NULL,NULL,NULL,NULL,'853501578147425','1234489072118727',NULL,NULL,'1109157629072836',NULL,NULL,NULL),(308,800106312438349,'Obstetrics and Gynecology (OB/GYN)',NULL,605134586578120,'\n		Wellness Visits\n		Prevention Treatment and Education\n		Comprehensive Screenings for disease detection\n		Breast Exams\n		Pelvic Exams\n		Contraception Counseling\n		Pregnancy Testing\n		Prenatal Care up until the 2ndtrimester (will refer to other facility after the 2ndtrimester)','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,'1263089203668614','651804021834110,1128987918758522',NULL,NULL,NULL),(309,802246956701009,'Behavioral Health',NULL,548126332764833,NULL,'619784806206149,946031179775955,1214132387827753','https://www.whitman-walker.org/behavioral-health',NULL,NULL,NULL,'535512457471607',NULL,NULL,NULL,NULL,NULL,'1346383381421893',NULL,'599621071767378,645838145603264','',NULL,NULL,NULL,NULL),(310,805800258888513,'Weekend Snack Pack Program',NULL,584105465886479,'We supply food for Saturday and Sunday for homeless children at five different schools that will not have food to eat if we did not send these snack packs to the schools.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','832990803111047','This program is available through the five schools we serve. Please call to learn more.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(311,818489779377722,'Resident Services Program ',NULL,1178149503221687,'Provides programming in health and wellness, employment, community building, tenant education, and youth enrichment. ',NULL,'https://housingup.org/ending-homelessness/resident-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(312,821980999983631,'Tenant Organizing',NULL,1116810105858975,'CARECEN provides technical assistance to buildings where tenants face complex housing and health code violations or are presented with the opportunity to purchase their building. CARECEN assists tenants in organizing and incorporating as tenant associations in order to effectively address housing issues. Tenants thus build a collective voice and are able to better access financial and legal resources, negotiate repairs, and stop evictions or abusive practices by landlords. They also develop leadership skills by facilitating meetings, contacting inspectors and other city officials, and advocating for themselves before different stakeholders.','547920365968268','http://carecendc.org/direct-services/housing-services/',NULL,'info@carecendc.org','Verified','917725171609009,929094559121639','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1295679372454826','842193303927915',NULL,NULL,NULL),(313,822081621672598,'Career Support',NULL,605622028340987,'Once you have graduated from Byte Back\'s courses, we can help you prepare your resum, apply for jobs, and prepare for interviews.','865063089655254','https://byteback.org/career/',NULL,NULL,'Verified','970915508638448','You can seek out these services once you have completed your courses.',NULL,NULL,NULL,NULL,'591752588532619','950208089897090',NULL,NULL,'1000698980135639',NULL,NULL,NULL),(314,833788770520302,'Himmelfarb Mobile University',NULL,970560028876577,'JSSAs Himmelfarb Mobile University (HMU) program provides stimulating classes to residents of retirement and assisted living facilities and nursing homes, and participants in senior activity programs.\n\nHMU course topics cover a wide range of subjects and interests including:\n\n- Art and architecture\n- Cultural anthropology\n- Geography\n- Literature and poetry\n- History\n- Economics\n- Music appreciation and musical presentations\n- Popular culture and current events  and more!!','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/social-programs/himmelfarb-mobile-university/',NULL,NULL,'Verified','789038541797078','Call to learn more.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'1053289039718908,854808174954754','1328302797893590,1218692669680880',NULL,NULL,NULL),(315,833155783547619,'Pharmacy ',NULL,1043772486617212,NULL,'933134498085222,1232398464032126,806168781795597','https://www.unityhealthcare.org/services/pharmacy',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'571755907108727',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(316,834471316045858,'NV Rides',NULL,855094084464049,'NV Rides is a network of service providers aiming to enhance and improve volunteer driving programs throughout Northern Virginia. This community-wide initiative aims to serve more non-driving older adults so that they can get where they need to go at no cost.\n\nThe Jewish Community Center of Northern Virginia (the J) administers the NV Rides program in partnership with Fairfax County and the Jewish Council for the Aging, and with additional support from the Community Foundation for Northern Virginia.','924628911683577','http://nvrides.org/',NULL,'info@NVRides.org','Verified','632609508449013','Call or visit the website to schedule a ride.',NULL,NULL,NULL,NULL,'1085521567553332','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(317,839260018674017,'Safe Housing Drop-in Center',NULL,1323195974089796,'Youth looking for shelter can drop in to be connected to the appropriate housing program or emergency for their specific needs.  Our friendly, bilingual staff provide ongoing assessment and case management to connect youth to other needed services including educational and employment support, mental health, and accessing public benefits.\n\nThe Drop-In Center is equipped with shower, laundry, and kitchen facilities, computers for youth use, private meeting rooms, day lockers, and resting rooms. More information and pictures of the center are available in the Youth Corner.','585101162574385','http://www.layc-dc.org/what-we-do/safe-housing/outreach-intake/',NULL,NULL,'Verified','929094559121639','Walk in for services.',NULL,NULL,NULL,NULL,'845010409228900','1353902664253088',NULL,'1295679372454826,883345659611536','846581217255552',NULL,NULL,NULL),(318,853798812414411,'Family Preservation',NULL,925199151398185,'Family preservation and support represents a broad range of services aimed at families who are in need of community supports or are at risk of child maltreatment.  The Collaborative has developed programs to preserve the family unit by providing access to services that reduce the incidence of child maltreatment and/or its recurrence.','778459456343468','http://ebfsc.org/our-programs/family-preservation/',NULL,NULL,'Verified','637158405241810','Please call or visit our main office.',NULL,NULL,NULL,NULL,'1194161595371590','986926461476700',NULL,'1292849277583603','1174417076661204',NULL,NULL,NULL),(319,854338133373761,'Scholars',NULL,1007623446966696,'We serve an excellent God who gives us the ability to accomplish in His will our hearts desire.  We financially support our student members higher learning aspirations through the Cora Biggs and Steven R. Brown Scholarship Foundations and our College Incentive Awards program.  Our Barnabas Ministry sends care packages and corresponds with students during the school semester.','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','789038541797078','Call or visit us during our church services.',NULL,NULL,NULL,NULL,'755149488867036',NULL,NULL,NULL,'1088461256923134',NULL,NULL,NULL),(320,852882436125716,'Alcoholics Anonymous',NULL,915322254234555,'This is an open discussion-format meeting. Alcoholics Anonymous is a fellowship of men and women who share their experience, strength and hope with each other that they may solve their common problem and help others to recover from alcoholism. For more information see www.aa-dc.org','671468679071199',NULL,NULL,NULL,'Verified','637158405241810','Walk in. Schedule varies. Visit our website and check out our calendar or call for upcoming AA meetings.',NULL,NULL,NULL,NULL,'852143936371728',NULL,NULL,NULL,'948985953505133',NULL,NULL,NULL),(321,856596013009881,'Multi-lingual Legal Helpline',NULL,1141864402494387,'Since 1998, the flagship project of the Asian Pacific American Legal Resource Center has been its multilingual legal helpline. The Helpline serves low-income and limited English proficient Asian Pacific Americans in the D.C. metropolitan area. About 25 bilingual law students volunteer with the APALRC to assist Helpline callers each semester. When an individual calls the Helpline, an APALRC volunteer conducts an intake interview in the callers native language. Helpline assistance is free of charge to its callers, but the level of service the APALRC provides depends on factors such as the callers legal issue and household income. The APALRC often refers callers to other legal service providers, and staff and volunteers work to ensure that a caller is able to access legal assistance after the referral is made.\n','1264011549910449','https://www.apalrc.org/multi-lingual-legal-helpline/',NULL,NULL,'Verified','917725171609009','Call to access the helpline',NULL,NULL,NULL,NULL,'1010201225467528','743786809520784',NULL,'884944905632896','1018319997039351',NULL,NULL,NULL),(322,854051618591377,'Empowerment Project/Transitional to Permanent Housing',NULL,983721114373124,'Our scattered site transitional-to-permanent housing project, called the Empowerment Project, is an innovative approach to providing housing for survivors whose credit and rental histories were damaged during abusive relationships, which often prevents them from establishing housing stability long after the physical abuse has ended. EP is based on the principles of the Housing First evidence-based model, to stabilize housing immediately, so other needs can be met. Participants are offered the opportunity to sign a lease on an apartment of their choosing that best meets their familial, financial and safety needs, made possible by the relationships DASH has established with landlords across the city. DASH provides a rental subsidy, along with intensive supportive services and resources, so the individuals and families can become financially independent over the course of two years. DASHs Empowerment Advocate works with each participant to focus on financial goals such as paying down debt, restoring damaged credit and saving money for future goals, all while building a solid rental history in a safe apartment unit. After two years (or sooner), participants are poised to take over full financial responsibility of their apartment. Since 2009, DASH has increased its transitional to permanent housing through the Empowerment Project and expanded permanent housing from 10 to 15 survivors and their families during this two-year program.','828792720206018','https://www.dashdc.org/programs-services/safe-housing/',NULL,NULL,'Verified','929094559121639','Call for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(323,855252238426842,'School Discipline Project',NULL,1169351687674186,'AJE provides legal services to families in the area of special education, school discipline and school push-out issues.  We also provide training to parents, youth, professionals about the laws governing school discipline and expulsions.','763729877559385,641740493818315','http://www.aje-dc.org/legal-services-school-discipline-project/',NULL,NULL,NULL,'917725171609009','Call to apply.',NULL,NULL,NULL,NULL,'1278097116269820,1123181686957068,602432444817544','859999387383412,1170631815352558',NULL,'883345659611536,915486946336080','578010665151939,767767048082720',NULL,NULL,NULL),(324,862423770633741,'Employment',NULL,1287130751059247,'Step Up DC, Calvary Women\'s Services\' job placement program, assists women in gaining employment and financial security.\n\nProgram activities include rsum and cover letter building, mock interviewing, assistance with completing online job applications, professional workshops, transportation assistance, trips to local career fairs, and referrals for professional attire.\n\nCalvary works to build relationships with area employers that allow women enrolled in Step Up DC to be directly connected with companies from a variety of industries. Step Up DC participants have secured jobs in different fields, including IT support, retail, security, hospitality, administration, and healthcare.','1315826372203677','https://www.calvaryservices.org/program/employment/',NULL,NULL,'Verified','970915508638448','To access our services, you must first receive a referral from a core service agency. If they match you with our organization, you will be sent over for an intake. If you have additional questions, please call.',NULL,NULL,NULL,NULL,'1285405208459287','890039510897571',NULL,'836091364973509,877243931325915,1212718840001878','926608893625888',NULL,NULL,NULL),(325,870219187741961,'Mood Disorders Program',NULL,1061724977026001,'Its normal for children to feel sad, irritable or upset at times. Unfortunately, that can lead to depression and other mood disorders being misdiagnosed or dismissed as a typical part of childhood, especially in teens.\n\nMood disorders can have wide-ranging effects on children, teens and their families. The toll on their physical health, performance in school, family and social relationships and overall well-being can be devastating.\n\nHelping Children and Teens with Mood Disorders\nThe Mood Disorders Program at Childrens National Health System is dedicated to helping children and teens with mood disorders live as happily and healthfully as possible. We personalize care for each patient and family to ensure children receive the most appropriate treatment with the best outcomes.\n\nFeatures of our program include:\n\nExpert pediatric specialists. When a child or teens negative feelings dont go away, our highly trained pediatric specialists have the expertise and experience to recognize mood disorders and provide the care they need. That includes pediatricians, counselors, social workers, psychiatrists and others.\nFamily-centered care. Our multi-specialty team knows that you know your child best. We value your input and work closely with your family to include you as a part of your childs care team. This ensures he or she receives the most comprehensive and individualized care.\nOngoing support and education. We strive to empower preteens and their families diagnosed with mild to moderate depression to learn about the disorder that is impacting their lives. Group sessions that include art therapy and other tools help you work together toward recovery and wellness.\nFinding new ways to help. Learning more about the factors that can lead to depression and other mood disorders in school-age children can improve their treatments and outcomes. Our researchers are committed to discovering new ways to identify, prevent and treat these disorders. Some of our patients participate in clinical trials. You can find out more by speaking with your childs doctor, nurse, or other care team member.\nConditions We Treat\nAt Childrens National, we treat a wide range of mood disorders, including:\n\nMajor depression. A serious condition that involves persistent sadness, hopelessness and other symptoms\nBipolar disorder. A type of depression that also includes severe mood changes to extreme elation and happiness\nDysthymic disorder. Depression that is less severe but more long-lasting than major depression\nAnxiety disorder. Excessive worry that doesnt get better and can interfere with daily activities\nChildren and teens with mood disorders may have:\n\nDifficult relationships with family and friends\nTrouble sleeping\nChanges in eating patterns or weight\nExtreme temper outbursts\nLow energy\nPoor concentration\nAggressive behaviors\nMood disorders can cause other symptoms as well. Parents are in a unique position to see behavior changes and problems in their children. We take your concerns seriously and listen carefully to your observations.\n\nServices We Offer\nWe start with a thorough evaluation, which can last two sessions or more, depending on your needs. Your pediatric specialist will talk with you about your childs symptoms, your family health history and any other psychological concerns you may have. To give us more details about your childs condition, we may ask your family to fill out forms known as objective scales. In some cases, teachers are also asked to complete these scales.\n\nWith an accurate diagnosis, we design a specific plan to provide the best care for each child. Follow-up care may involve:\n\nIndividual therapy\nFamily therapy\nMedication, when necessary\nWe want you to be confident in your childs care. To that end, we also provide second opinion evaluations and consultations.','1282604214927911','https://childrensnational.org/departments/mood-disorders-program',NULL,NULL,NULL,'941516382466411','We see children and teenagers from the Washington, D.C., metropolitan region and across the nation. To make an appointment for a child, call 202-476-5166. To make an appointment for an adolescent, call 202-476-3867.',NULL,NULL,NULL,NULL,'911365586682388,1234245230275644','892012398827551',NULL,'1274396898894043','928813128095347',NULL,NULL,NULL),(326,872625169605396,'Personal Support',NULL,744812603775568,'Quality Trust also provides consultation for families to help identify support needs for children or adults with developmental disabilities. These consultations can assist in developing and implementing strategies to effect change and/or address specific issues or problems such as the following:\n\nImproving Educational Outcomes\nMaking practical Environmental Accommodations (home or work)\nAddressing Challenging behavioral needs;\nFacilitating a better use of abilities, gifts and talents;\nHelping identify opportunities for expanded social roles;\nMaking plans for the transition from school to work;\nThese services are independent of other support provided by Quality Trust and are consultative in nature. Depending on the specific engagement, Quality Trust will provide reports, recommendations for families, attorneys, trustees or other caregivers. We can also be engaged to provide one on one coaching to the child, adult or family members. \n\nOur approach is highly individualized and success is measured person by person.  ','1185969381076176','https://www.dcqualitytrust.org/families/personalsupport/',NULL,'tcampanella@dcqualitytrust.org','Verified','637158405241810','Individuals can also seek out their own support services. Just call to set up an intake appointment.',NULL,NULL,NULL,NULL,'650675878696913','655204523101840','1280208916486415','891868766081123','1262646425320757',NULL,NULL,NULL),(327,872556751746749,'Transitional Living',NULL,1323195974089796,'LAYCs Transitional Living programs provide housing to homeless or unstably housed youth between the ages of 18 and 21 for up to 18 months. Youth live in furnished apartments with or without a roommate. Program staff are on-call 24/7 and are stationed in the apartment buildings during the day. Residents receive life skills workshops, case management, and group recreational activities, as well as access to all LAYC services and programs.\n\nBy providing stable housing, the program aims to promote safety, well-being, self-sufficiency, and a sense of connectedness to other resources. Through weekly case management and life skills workshops, the program ensures youth acquire the skills necessary for independent living without developing a long-term dependency on social services.\n\nWith 32 beds at three residential sites, LAYC is able to serve the special needs of youth exiting foster care (CFSA referral required), LGBT-identifying youth, and immigrant and unaccompanied minors.','585101162574385','http://www.layc-dc.org/what-we-do/safe-housing/transitional-living/',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1165471269627538','1353902664253088','942787076035093','951536606221426,1295679372454826,1186681173947755,1340162113833071,868851101422969','846581217255552',NULL,NULL,NULL),(328,873979070344056,'Comprehensive Homicide Elimination Strategies Task Force',NULL,769893937425938,'Our Executive Director has been appointed by the D.C. Mayor to co-chair the citys Comprehensive Homicide Elimination Strategies Task Force.  The Task Force will make recommendations to the City Council and the Mayor on strategies to reduce/eliminate homicide in the District of Columbia.','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(329,810358604812792,'Behavioral & Mental Health',NULL,1168436736852155,'When aging, it is sometimes inevitable that older adults have a life without much company. Sometimes this happens because of their children have other responsibilities as parents and have to take care of their own families. Also, in the case of older adults who are immigrants, when getting older they are disconnected from their networks and family members in their country of origin. In many cases, this isolation ends up generating chronic episodes of depression. Likewise, the life of the elderly is usually accompanied by many economic concerns, especially when it comes to immigrants with limited resources, who did not accumulate a sufficient pension to meet their basic needs. Not being able to pay the house bills or the costs of their health bills generates a lot of anxiety. In the case of most of our participants, who are first-generation immigrants, linguistic isolation is added to all of the above. Feeling that they cannot communicate well with the society that surrounds them or that they cannot function as they normally do is a very common stress generator in immigrants. To handle these situations, VIDA offers daily individual counseling and group counseling aimed at training older adults to manage stress and anxiety. We try to break the taboo barrier and understand that we all are exposed to situations of anxiety and that in the midst of problems, we must have tactics that help us relieve tensions. And to complement group and individual counseling, Vida also offers daily Tai-chi exercise classes, in which older adults learn to breathe and relax the tensions that manifest in their body. Vida Senior Centers puts special emphasis on mental health, because this can trigger other effects on the well-being of the person. When the situation requires the intervention of a doctor, Vida Senior Centers refers the participant to a specialized center. For this, VIDA has been coordinating with several local organizations specialized in mental health medical treatments. In summary, the activities offered as part of our Mental Health program are as follows:\n\n Individual counseling to handle stress situations\n Group counseling on frustration management techniques\n Tai-Chi exercises to learn to breathe and relax the body\n Classes on Positive Thinking\n Classes on Mental and Emotional Health\n Referral to doctors if the need is identified','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/behavioral-mental-health/',NULL,NULL,'Verified','941516382466411','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(330,811998666629450,'\"DC Department of Behavioral Health (DBH), Office of Prevention Services\"',NULL,1183105756467350,'Maintains the','1092213609334000','http://dbh.dc.gov/service/prevention-services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1186879796731815',NULL,NULL,NULL),(331,819327215791900,'Veterans Advocacy Project',NULL,1093127605400642,'To ensure we are best serving older veterans living in our Nations capital, LCE launched its Veterans Advocacy Project in 2014. LCEs Veterans Advocacy Project ensures DC low-income older or disabled veterans with specific claims before the Department of Veteran Affairs (VA)\n\nLCE assists eligible honorably discharged war-time D.C. veterans aged 60 and older and certain eligible surviving spouses with: Claims for (Non-Service Connected) VA Pension benefits, Claims for increased ratings for Aid and Attendance for Pension eligible veterans with specific disabling conditions\n\nLCE assists eligible D.C. veterans aged 60 and older with: Claims for Service Connected Disability Compensation if they are diagnosed with conditions the VA has found to be Presumed, Conditions related to military service\n\nLCE also assists veterans and surviving spouses aged 60 and older with: Creating  electronic VA benefit portals to access information regarding their VA benefits, Disputing allegations of VA debts and overpayments by requesting: Waivers of alleged VA debt or, More favorable repayment options\n\nLCE does not have the resources to help older veterans and surviving spouses apply for every resource and benefit the VA offers. We encourage veterans seeking help with benefits other than those LCEs Veterans Advocacy Project accepts to find a local Veteran Service Organization (VSO) for help with benefit questions and claims. VA approved and accredited VSOs can be found at the Department of Veterans Affairs website and they do not charge for help accessing VA benefits and resources. ','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/veterans-advocacy.html?intcmp=AE-LCE-WWD-R1C2LL6',NULL,NULL,NULL,'637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'1154003895918016',NULL,NULL,'1260550501779199,854808174954754','763163886168100',NULL,NULL,NULL),(332,813064675400914,'Rapid Housing Assistance',NULL,727757843857751,'The Rapid Housing Program is funded by the Child and Family Services (CFSA) in collaboration with FSFSC will provide limited assistance in the form of short-term subsides to families for whom the lack of affordable housing will likely result in children being brought into care, or the lack of affordable housing is the major barrier to family stabilization. Young adults, with and/or without children that are transitioning out of care are also eligible to participate in the Rapid Housing Program.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','929094559121639','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234,1292849277583603,1228977611234530','1231516890380928',NULL,NULL,NULL),(333,827029786281023,'Support Groups',NULL,769893937425938,'Our group therapy provides a place for people to express the many emotions associated with grief and trauma in a safe, supportive and confidential environment. We offer support groups for adults, children, teens and families.\n\nGroup Therapy for Adults, Children, Teens and Families\nOur Group Coordinator will assess if a group is the most appropriate therapeutic service or make other recommendations.\n\nTherapy Groups are held at both Wendt Center offices.\nTherapy groups are led by licensed, experienced Clinicians.\nWe accept some insurances for group services, or you can choose to pay a fee of $35 per session.\nPrior to joining a group, a clinical assessment is required (unless you have completed one with the Wendt Center in the previous year). This may or may not be conducted by the group facilitator. The fee for this assessment follows our normal pricing for individual client sessions. We accept some insurances for this assessment. If insurance is not an option, the full cost for an assessment is $145 with a licensed clinician, $40 with an intern (limited slots available), and there is also a sliding-fee scale.\nAdvance registration is required for all groups.\nAll inquiries are confidential.\nWe offer the following support groups year-round:\n\nChildrens Grief Group  ages 7-10\nSpouse /Partner Loss Support Group\nAdult Suicide Bereavement Support Group\nAdult Grief Support Group\nTeen Grief Group  ages 14-18\nMindfulness and Grief Group\nTween Grief Group  ages 11-13\nOur group therapy provides a place for people to express the many emotions associated with grief and trauma in a safe, supportive and confidential environment. Each individuals reaction to their experience is unique and everyone is encouraged both to share his or her views and to honor the views of others. Licensed professionals facilitate our groups for individuals and families dealing with these issues. Facilitators use talk and art as well as other modes of intervention based on the ages and dynamics of the group.','1108850981657232,1166799153375505','https://www.wendtcenter.org/support-groups/',NULL,NULL,'Verified',NULL,'Please call if you are interested in joining a group.',NULL,NULL,NULL,NULL,'798956401851670','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(334,831554257615200,'Health Services ','Labor of Love Human Service Center',877366768823409,'As part of the Health Enterprise Zone (HEZ) we offer information and resources through our partnerships that target the overall health and well-being of individuals in our community.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','941516382466411','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(335,845758882609427,'Day Rehabilitation Services Program',NULL,802521051916688,'The Day Rehabilitation Services Program (DSVC) is a skills training and motivation enhancement program that supports participants in their efforts to change lifestyle, overcome obstacles, recover their lives, and experience empowerment. We believe people with a serious mental illness can recover and are capable of living independent, satisfying lives. Central to that process is the development of skills that will empower the individual to make positive life choices. Program participants work together in a variety of activities to gain or rebuild confidence and the skills necessary for living independently. Participants can expect integrated care with their treatment teams within and outside of Community Connections.','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(336,845999906983085,'Homebound Elderly Project (Project HELP)',NULL,1093127605400642,'Project HELP provides critically important legal assistance and advocacy to some of the most vulnerable seniors living in our community. These older neighbors are unable to play an active role in society because of their homebound status, which results in them becoming \"invisible\" and, consequently, this all too often leads to situations in which they are taken advantage of because of their decreased mobility and limited support network.\n\nProject HELP utilizes a full-time staff attorney, para-professional support, volunteers, and a cadre of volunteer (pro bono) attorneys from private law firms and government organizations.\n\n- Interview clients at home regarding legal problems;\n- Draft or review legal documents that seniors may need, such as powers of attorney or wills;\n- Administer a public-benefits checkup;\n- Assist clients with securing and maintaining public benefits such as Social Security, Supplemental Security Income (SSI), Medicaid, Elderly and Persons with Physical Disabilities (EPD) Waiver, Medicare, Qualified Medicare Beneficiary (QMB) and Supplemental Nutrition Assistance Program (SNAP) benefits.\n- Assist clients whose benefits or services have been threatened with termination, terminated, decreased or overpaid, through representation at all stages of the appeal process including personal conferences, requests for reconsideration, and fair hearings before the Office of Administrative Hearings (OAH). \n- Analyze their housing situation concerning any landlord problems or consumer problems or, in the case of homeowners, any problems with home repair, predatory lending or deed fraud;\n- Ensure proper follow-up on the identified legal problems either directly or via LCEs other program initiatives.\n\nVolunteers\nWe are always looking for volunteers! We have a special need for attorneys and notaries, but anyone can volunteer to serve as a witness when we finalize important documents in seniors\' homes.\n\nIf you are an attorney licensed in the District of Columbia, please consider taking a case from us pro bono. We have many homebound seniors who need legal assistance. Our staff often gives training presentations on basic estate planning at area law firms. Please let us know if you are interested in hosting a training session.\nIf you are a notary licensed in the District of Columbia, please consider volunteering to help our clients execute important documents. Periodically, we send emails to our volunteer notaries asking if they can meet us at certain times and places to notarize documents for our homebound clients. Please send us your email address, and we will add you to our list.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/homebound-elderly-project.html?intcmp=AE-LCE-WWD-R1C1LL4',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,'591526800514165','763163886168100',NULL,NULL,NULL),(337,850061472824026,'Family-based Housing',NULL,1323195974089796,'SHORT-TERM (UP TO 3 WEEKS)\nLAYC offers its family-based or host home model for youth with short-term housing needs and youth who could benefit from long-term placement with a family.\n\nOur short-term program (up to 21 days) provides emergency shelter to homeless and runaway youth, ages 12-17. LAYC recruits and trains English and Spanish-speaking individuals and families as host families to provide youth with safe, loving, and stable homes. As part of this program, biological families receive family preservation services.\n\nFAMILY PRESERVATION (SHORT-TERM ONLY)\nThe goal of family preservation is to reunite youth with their families. Our staff makes every effort to mediate temporary conflicts that do not pose a long-term threat to the youths safety. Our staff provides in-home family counseling, parent skills development, and mental health treatment to youth. We work with families who may be experiencing difficulties with adolescent behavior problems and mental health concerns as well as the effects of abuse or neglect, trauma, and poverty. We typically work with the families of youth at risk of running away or who have run away and are housed with one of our host families for five weeks.\n\nLONG-TERM (UP TO 18 MONTHS)\nOur long-term program helps older homeless youth, 18-21, transition to adulthood in a loving home. Once a youth is placed in the home of a certified family, the program provides supportive services to the youth, the host family, and the youths biological family. These services include crisis intervention; individual, group, and family counseling; mental health assessments; advocacy; referrals; intensive case management; and transportation.','585101162574385','http://www.layc-dc.org/what-we-do/safe-housing/family-based-housing/',NULL,NULL,'Verified','929094559121639','REQUIREMENTS FOR YOUTH IN OUR FAMILY-BASED HOUSING PROGRAM\nMust be 12-17 years old for short-term placement; 18-21 for long-term placement\nMust be homeless or runaway\nCannot be actively using drugs. If so, youth must be actively participating or willing to participate in a treatment program.\nMust not be considered a danger to self or others\nMust be willing to comply with the objectives agreed upon in his/her treatment plan.\nCONTACT INFORMATION FOR DC RESIDENTS\nJaneth Chorlango, Program Manager, janeth@layc-dc.org, (202) 400-5194.\n\nCONTACT INFORMATION FOR MD RESIDENTS\nMelissa Barney Montoya, Case Manager, melissa@layc-dc.org, (301) 431-3121.',NULL,NULL,NULL,NULL,'845010409228900,1193950530495506','1353902664253088','946647963504599','1295679372454826,1292849277583603','846581217255552',NULL,NULL,NULL),(338,862025517520940,'\"GRACE AND MERCY HEALTH SERVICES, INC\"',NULL,610643317850454,'Provides the following services: RW Behavior Support BSP Development & Follow-Up , RW Behavior Support Diagnostic Assessment, RW In-Home Supports, RW Respite Daily (out of the home), RW Respite Hourly (in the home)','876205598154141','http://dds.dc.gov/service/how-apply-services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1079432174401742',NULL,NULL,NULL),(339,862747362682708,'D.C. HOUSING AUTHORITY: CLIENT SERVICES CENTER',NULL,874969319589202,'Responsible for application intake, waiting list management, and eligibility determination for Public Housing, the Housing Choice Voucher Tenant Based Program - HCVP (formerly known as the Section 8 program)','932196643976542','http://dchousing.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'812536589441629',NULL,NULL,NULL),(340,865349654371674,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(341,873921955624383,'Independent Living Program',NULL,1306699628219808,'The Independent Living Program provides residential services for homeless young people ages 18  24 years old who are unable to return home. Residents may be self-referred or referred by case workers or family. The ILP program offers apartment-style living for teenagers unable to return home due to absent or severely dysfunctional families or to young people transitioning out of foster care homes. Residents may stay in ILP housing for up to 18 months. Residents must be enrolled in school, work part-time, and save portions of their income. Some also contribute to their rent. When individuals are able to move out on their own, ILP counselors help them find apartments and roommates and provide follow-up support to help them achieve stability.','873020349083887','https://www.sashabruce.org/programs/safehomes/independent-living-program-ilp/',NULL,'mdaley@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program.',NULL,NULL,NULL,NULL,'675950610691596','882054301651193',NULL,'877243931325915,883345659611536,1222973168897685','757812310225300',NULL,NULL,NULL),(342,873611419029370,'Emergency Assistance/Food Pantry',NULL,572890347249315,'St. Anthonys provides food assistance to those in need in our community. Our assistance is provided to all on a nondenominational basis.\n\nWhen finances permit, some financial support for rent and other emergency expenses is also provided to deserving individuals.','1199654488652628','https://stanthonyofpaduacommunity.com/parish/parish-life/social-ministry/emergency-assistance/',NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'1138656191558408,1346383381421883','656982606700787',NULL,NULL,'628567320148149',NULL,NULL,NULL),(343,826245178186822,'D.C. SUPERIOR COURT: DOMESTIC VIOLENCE INTAKE CENTER',NULL,1274689026716619,'Provides assistance with cases that involve domestic violence. Advocates provide step by step instructions through the civil and criminal justice system and draft the petitions and affidavits for civil prosecution orders.','1287087731647843','http://www.dccourts.gov/services/domestic-violence-matters/intake-centers',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1100623769973973',NULL,NULL,NULL),(344,834460550368169,'Food Program',NULL,618997848324116,'Two monthly Farmers Markets offer fresh produce to the community at large, and as a Grocery Plus distribution site, Bread for the City offers an additional 30 lb box of food to a small number of seniors. Our Sustainable Agriculture division both grows food and educates the community at our two rooftop gardens and three-acre orchard.','858837023472383,1058560288612968','https://breadforthecity.org/food/',NULL,NULL,'Verified','832990803111047','To receive a monthly food supplement from Bread for the Citys pantry, clients must be low income and live in Washington, DC. Eligible clients are residents of the District of Columbia who have incomes at 200% or less of the federal poverty line.\n\nBread for the City requires a one-time registration and an annual re-certification. Please let us know if you are unable to get the items on this list, and we will try to work with you. If you need help, we will do our best to assist you.\n\nWhat to bring on your first visit:\nYou may visit either our NW or SE Center during normal operating hours:\n\nNorthwest Food Pantry\nMonday  Thursday: 8:30 am  5 pm\nFriday: 8:30 am  Noon\nClosed: Noon  1 pm\n\nSoutheast Food Pantry\nMonday  Thursday: 9 am  5 pm\nFriday: 9 am  Noon\nClosed: Noon  1 pm\n\nProof of positive identity:\n\nPhoto ID\nBirth certificate\nMail postmarked within 2 months\nOther documentation may occasionally be required in special cases.\n**No one will be turned away from receiving services at Bread for the City because they do not have a photo ID.  If you dont have an ID during your first visit to the pantry, you may be asked to answer a security question that can then be used as identification on future visits, if other identification continues to not be available.\n\nProof of address or access to cooking facilities in DC:\n\nRental receipt with recent date\nStatement from DHS\nLease (less than 2 years old)\nPersons living in a shelter must bring proof of access to kitchen\nMail with clients name and address\nOther documentation may occasionally be required in special cases. (If you live with someone who owns or rents a property, that individual may be asked to provide verification documents.)\nProof of Income:\n\nPay stub/ receipt\nLetter from DHS (public benefits)/ SSI/ Social Security\nPhotocopied checks\nBank statements\nOther documentation may occasionally be required in special cases.\nProof of spouse and/or dependents, if applicable:\n\nAnything bearing childs name and parents current address such as school records, medical bills, rental lease, or TANF documentation. (You will not be able to use the childs birth certificate, medical card or social security card.)\nApartment lease or letter from landlord\nLetter from DHS/ TANF documents\nOther documentation may occasionally be required in special cases.',NULL,NULL,NULL,NULL,'592888047524221,606695908675970','1165940675626241,1126042040218943',NULL,'868012483124236,1328137842642608,1274524177531453,1173761108824771,753216819976855,817072719805531','941976438893110,786471426290380',NULL,NULL,NULL),(345,837982775211551,'Nutrition and Wellness ',NULL,1191959686811989,NULL,NULL,'https://www.capitalareafoodbank.org/what-we-do/nutrition-and-wellness/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(346,847425752356331,'Case Management',NULL,1043249662316489,'Our case managers work one-on-one with guests each day in our dining room.  We also partner with many organizations who bring their services to Miriams Kitchen.\n\nIn a warm and welcoming environment, we help our guests by:\n\nAssessing their immediate and long term needs\nIdentifying strategies for accomplishing their goals\nProviding clothing and toiletries\nProviding access to a consistent phone and mailing address\nConnecting guests to mental health services\nHelping guests obtain housing\nProviding resume and job search assistance\nHelping guests apply for benefits and obtaining ID','1220017101351760','https://miriamskitchen.org/programs/case-management/',NULL,NULL,'Verified','911225335803318,637158405241810,917725171609009,929094559121639,832990803111047,941516382466411','Walk in or call during office hours which are the same as case management hours.',NULL,NULL,NULL,NULL,'582664674810922,1076876608568522','777551828972187,1229918560173750',NULL,NULL,'850193305992354',NULL,NULL,NULL),(347,847598884926148,'Seabury Connector',NULL,1180598613249590,'Seabury Connector provides free transportation for Washington, D.C. residents age 60 years and older to wellness centers, adult day care, and for group shopping trips. ','1183011241112934','https://www.seaburyresources.org/transportation',NULL,'info@seaburyresources.org','Verified','632609508449013','To see about scheduling transportation, please call.',NULL,NULL,NULL,NULL,'1215962717214630',NULL,NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(348,852851666991889,'Food Pantry',NULL,866237660806724,'A food supplement is provided to any person expressing a need for food.\n\nAdditionally, the food pantry operates a mobile food pantry (fresh produce), holds nutrition classes, performs blood pressure checks, participates in a weekend bag program for children, and a brown bag program for seniors.','640375823525191','http://acamec.org/ministries/allen-food-pantry',NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'654485576131912','1080981189328944',NULL,NULL,'632170755225855',NULL,NULL,NULL),(349,862476176486863,'Downtown Day Services Center ',NULL,976379482380679,'The Downtown Day Services Center (The Center) offers downtown day services to individuals experiencing homelessness. The Center utilizes Pathways to Housing DCs Housing First method to move individuals into housing by connecting them with supportive services. The Center is operated by the DowntownDC Business Improvement District (BID) with support from the District of Columbia Department of Human Services and services from Pathways to Housing DC and HIPS.\n\nThe Center offers on-site support for individuals experiencing homelessness by providing a multitude of services within a single point of access, including: food and beverages, restroom facilities, showers, laundry, housing services, non-driver, identification, employment assistance, case management, legal services, vital records, healthcare ,disability application\nharm reduction service, computer access, and social activities/entertainment.\n\nThe Center is also supported by partnerships with agencies and organizations such as the District Department of Employment Services, the District Department of Health, the District Department of Motor Vehicles, the Economic Security Administration, Unity Health Care and the Washington Legal Clinic for the Homeless.','1314518681278904','https://pathwaystohousingdc.org/what-we-do/downtown-services/',NULL,NULL,'Verified','970915508638448,637158405241810,941516382466411,917725171609009,832990803111047','The Center, which opened in February 2019, is located in the completely renovated bottom floor of the historic New York Avenue Presbyterian Church (1313 New York Ave, NW, Washington, DC 20005). The Center is currently open Monday through Friday from 8:30am  4:30pm (the hours that homeless shelters are closed).\n\nDaily\nCASE MANAGEMENT\nLAUNDRY\nLUNCH\nSHOWERS\nSNACKS & BEVERAGES\nRESTROOM FACILITIES\nRISK REDUCTION SERVICES\nMonday\nDISABILITY BENEFITS  11AM-2PM\nHEALTHCARE  9AM-12PM\nLEGAL BENEFITS  1PM-2PM\nTuesday\nLOW-INCOME BENEFITS  9AM-5PM\nWednesday\nHEALTHCARE  9AM-12PM\nNON-DRIVERS IDENTIFICATION  9AM-5PM\nThursday\nDISABILITY BENEFITS  11AM-2PM\nHEALTHCARE  9AM-12PM\nFriday\nHEALTHCARE  9AM-12PM',NULL,NULL,NULL,NULL,'972386234094039','677370702202489',NULL,'877243931325915','659764004272890',NULL,NULL,NULL),(350,872823918122712,'Insurance',NULL,840733417398800,'At Marys Center, your health is our priority. Understanding your health insurance options can be tough and we are here to help. We accept most insurance plans, but are deeply committed to providing you with health care regardless of your ability to pay.  \n\nAre you covered?\nIts important to look into your insurance coverage before making an appointment with Marys Center to avoid paying unnecessary fees.  Check the insurance plans we accept. If you have any questions, please call us at (202) 420-7028. \n\nIf you DO NOT have insurance, heres what to do: \nMeet with us before you make your first doctors appointment at Marys Center. During the meeting, we will help you find out if you are eligible to sign up for a health plan or public benefit. \nOnce we determine you are eligible for a health plan or public benefit, we will help you with the sign-up process so you can see one of our medical providers as soon as possible. \nApplying for Health Insurance Under the Affordable Care Act (ACA)   \nMarys Centers certified staff will help you determine if you are eligible for insurance coverage under the ACA. If so, we are happy to help you sign up for the most appropriate health plan during the open enrollment period from November to January.\n\nApply for ACA plans: \n\nWashington, DC \nPrince Georges County, Maryland \nMontgomery County, Maryland \nSliding Fee Scale\nMarys Center also offers a Sliding Fee Scale. Visit costs will be based on your income and the number of people in your household. If you cannot pay for your visit at the time of your appointment, we will work out a payment plan with you.','964869638930274,629348329513757','https://www.maryscenter.org/patients/insurance-and-fees/',NULL,NULL,NULL,'637158405241810','If you need further assistance, you can always visit us in person or give us a call at (202) 483-8196. ',NULL,NULL,NULL,NULL,'1263593198567823,575323208420901',NULL,NULL,NULL,'962742212670581,732086812000340',NULL,NULL,NULL),(351,871635119190314,'Arts and Recreation',NULL,1323195974089796,'LAYC is proud to offer a rich program of arts and recreation for youth in a safe and drug and alcohol-free environment.\n\nLAYCs DC Teen Center is home to our DC arts and recreation programs. It is the center of multiple opportunities for youth 12-21 as it offers digital media (radio, photography, music/poetry and design); art (drawing, painting, mixed media, and mural), guitar, jewelry making, and more.\n\nLAYC also operates the Rita Bright Family & Youth Center in collaboration with the Parents Association of the Boys & Girls Club of Greater Washington on behalf of the Department of Parks and Recreation.','1159564548417950','http://www.layc-dc.org/what-we-do/arts-recreation/',NULL,NULL,'Verified',NULL,'Call or walk in for more information.',NULL,NULL,NULL,NULL,'1198575506619755,1087645166547434','920999838182205,1016645181977967',NULL,'1295679372454826,883345659611536','1288365969354186',NULL,NULL,NULL),(352,879847524852951,'Advocacy',NULL,782302579547834,'Offers support in advocating to your local legislator around developmental disability rights. ',NULL,'https://arcdc.net/programs/advocacy/',NULL,NULL,'Verified','917725171609009','Visit the website for information on how to begin advocating.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(353,882877789489952,'Computer Lab',NULL,1116810105858975,'Our newly created computer lab enables enrolled students to make use of online citizenship resources such as: USCIS Citizenship Resource Center, Preparing for the Oath: U.S. History and Civics for Citizenship and our very own computer-based curriculum. Computers are used for class activities and additional practice and self testing during times agreed on with the citizenship staff.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','789038541797078','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(354,881475888864647,'Health Services',NULL,1140996665222837,'CASA provides case management assistance to connect members with social services in the community aimed at improving their physical and mental health and increasing social stability. Through a multilingual health hotline and medical interpreter program, CASA helps increase access to essential health services in the community. CASA also operates a health promoter promotora program that utilizes a culturally appropriate popular education methodology in risk reduction strategies to combat HIV, cancer, and other health risks.\n\nIn addition CASA operates a comprehensive public benefits outreach and enrollment program that assists community members understand and enroll into a variety of government assistance and health insurance programs including those made available through the Affordable Care Act (ACA) in addition to other public benefits such as SNAP.','1091435530922324','https://wearecasa.org/programs/health/',NULL,NULL,'Verified','941516382466411,637158405241810','Call to set up an appointment.',NULL,NULL,NULL,NULL,'1184988992731200,1279959054833190,689569738972286','736089112142715',NULL,NULL,'836261919910340',NULL,NULL,NULL),(355,885835927138322,'Outreach',NULL,1323664977480953,'Outreach Programs Are More Than Driving the Streets\nCovenant House outreach extends beyond vans. Our outreach staff members attend committee meetings and sit on mayoral councils, and we visit local schools, hospitals, and community group events  all to educate anyone who might encounter a teen in need so he or she can recognize the signs of homelessness and youth trafficking.\n\nYouth Outreach Extends to Other Organizations\nOutreach staff work collaboratively with local child welfare organizations not only to tackle the problem of youth homelessness within their community but also to introduce these organizations to our exceptional crisis care and transitional living programs. Working collaboratively allows us to foster change on the local, state, and even federal levels  and at the same time, partnering organizations are more likely to refer at-risk youth to Covenant House.','1106602330344467','http://covenanthousedc.org/our-services/outreach/',NULL,NULL,'Verified','637158405241810','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(356,831904738773639,'Children & Teens',NULL,1007623446966696,'Our Youth Ministry Program is holy bible-based. We hold fast to Gods Word in Proverbs 22:6 Train up a child in the way he should go, and when he is old he will not depart from it. We believe that God has gifted our children to excel spiritually through greater knowledge of him. We expect our children to uphold a standard of excellence in education, behavior, and giving back to the community. We encourage our children to have fun, be curious, be responsible and socially conscious.','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','637158405241810','Call or visit us during our church services.',NULL,NULL,NULL,NULL,'755149488867036',NULL,NULL,'1274396898894043,883345659611536','1088461256923134',NULL,NULL,NULL),(357,858697878378487,'Home Ownership',NULL,855802893163707,'Habitat for Humanity provides a unique opportunity for families to build and buy their own homes. Our houses are sold below market value to families who qualify for a monthly housing payment that is no more than 30% of their monthly income. We work closely with our partner families to provide them with the knowledge and tools they need to become successful homeowners and were with them every step of the way to offer support and guidance. To become a homeowner, applicants must meet income and credit requirements, have a manageable level of debt, and be willing to complete up to 300 hours of sweat equity helping to build their home alongside our construction team and volunteers.','884179044911706','https://dchabitat.org/housing-services/homeownership/',NULL,NULL,'Verified','929094559121639','To apply visit our website for a comprehensive breakdown. Read the requirements and if you fit those requirements, you then attend an information session, submit an application, complete volunteer hours, and then secure funding.',NULL,NULL,NULL,NULL,'1093912479911840','1140008964398815',NULL,NULL,'1098238485894342',NULL,NULL,NULL),(358,865253695035282,'Family-based Advocacy',NULL,744812603775568,'Advocacy is the foundation of Quality Trusts mission and the work we do for residents of the District of Columbia with developmental disabilities and for families who have a family member with disabilities. Quality Trust advocates work one-on-one with individuals and take the lead from them on what to focus on to meet their desired needs. Our advocacy is unique.  We make initial contact with each person and the person can choose to stop advocacy support at any point. Quality Trust advocates support the person to tell his or her story and empower the person to speak up and share their concerns.\n\nQuality Trust advocates meet with the members they support as often as necessary to get to know them, their preferences and desired outcomes. They work with the family, government, and other stakeholders to keep the focus on the individual and what they desire.\nAdvocacy allows us to learn more about people with disabilities and the systemic issues in the city. We identify issues including healthcare education and life choice planning and offer disability support professionals best-practices training on how to better support people live positive, person-centered lives.\n\nHighlights\nSupported over 4,800 people with disabilities since the inception of the  program in 2003\nAdvocates are trained and knowledgeable of best-practice standards in supporting people with developmental disabilities\nProvided assistance with finding employment, accessing services employment, residential moves, rights violations, and other important life issues','1185969381076176','https://www.dcqualitytrust.org/families/advocacy/',NULL,'jlethbridge@dcqualitytrust.org.org','Verified','917725171609009','Call to make a referral or set up an intake.',NULL,NULL,NULL,NULL,'759133304767858','655204523101840','866390871990408','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(359,877620900930693,'Other Housing Resources',NULL,855802893163707,'This website offers a list of additional housing resources offered by organizations outside of Habitat for Humanity.','884179044911706','https://dchabitat.org/housing-services/other-housing-resources/',NULL,NULL,'Verified','929094559121639,1077790582995406,789038541797078','Visit our website.',NULL,NULL,NULL,NULL,'1093912479911840',NULL,NULL,NULL,'1098238485894342',NULL,NULL,NULL),(360,887937499803617,'Adult Literacy Resource Center',NULL,1154572477664352,'The DC Public Library offers adult literacy services through the Adult Literacy Resource Center (ALRC). The ALRC provides literacy services to young adults (16 years +) and adults and is staffed with adult literacy education specialists.\n\nWe have instructional, informational and leisure reading materials for adult developing readers and speakers of other languages.We also provide resource materials for teachers and tutors of literacy, ABE, GED and English as a Second Language (ESL).\n\nIf you need to improve your reading, writing and math skills for the GED test, you can call our Literacy Helpline at 202-727-2431 for information about organizations that offer classes. You can also use our directory to find classes as well. Click here for our directory which lists GED and literacy classes. \nFind GED Classes, Basic Reading Classes, Tutors for Reading or English Classes\nTake a GED Skills Assessment\nGED and High School Skills Tutoring\nStudy Online\nSpeak English\nSchedule a Library Orientation\nDiscuss Books\nView/Download \"A Feel for Books, Book Discussions for Adult Developing Readers: A Resource Manual\"\nAttend Teacher Training Workshops\nDCPL\'s Online Resources for Teachers','935220481179962','https://www.dclibrary.org/services/adult',NULL,NULL,'Verified',NULL,'Call for information',NULL,NULL,NULL,NULL,'632652143042998','1316965531777415,1210205332989072',NULL,'1193549839853778','618422560177652',NULL,NULL,NULL),(361,888900193677833,'Legal Clinic',NULL,618997848324116,'Bread for the Citys Legal Clinic provides advice and representation in three main areas to DC residents living with low-incomes:\n\nHOUSING LAW: helping tenants in landlord-tenant and subsidized housing cases.\n\nFAMILY/IMMIGRATION LAW: helping survivors of domestic violence in Civil Protection Orders, family law cases (like custody and divorce), and immigration cases (like VAWA self-petitions, U visas, and SIJS), plus helping custodial and non-custodial parents in child support cases.\n\nPUBLIC BENEFITS LAW: helping individuals facing problems with getting or keeping public benefits, like TANF, Food Stamps, and Medicaid.',NULL,'https://breadforthecity.org/legal/',NULL,NULL,'Verified','917725171609009','Call for intake.',NULL,NULL,NULL,NULL,'1312338385799572','1297995567053982',NULL,NULL,NULL,NULL,NULL,NULL),(362,895703387545823,'Maternity Home',NULL,1275972111076677,'Our Maternity Home is a comprehensive transitional housing program which offers transitional housing for pregnant women ages 18  30. Program includes:\n\nLife skills training\nA safe, stable home for up to 18 months for homeless pregnant women and their children\nCase management services on a weekly basis\nAccess to adequate health care and health education\nCounseling on household budgeting, saving and financial management\nAssistance with and referrals for quality day care\nAdherence to a set of rules that instill the discipline necessary to take care of a family\nDevelopment of interpersonal communication skills\nReferrals and linkages with a variety of community-based agencies','688746232722666','http://www.pregnancyhelpdc.org/services/',NULL,'help@northwestenter.net','Verified','1077790582995406,941516382466411,637158405241810,929094559121639','Call or use our website to make an appointment.',NULL,NULL,NULL,NULL,'776656918535876','1165555818915699,1177629354463342',NULL,NULL,'854824186087142',NULL,NULL,NULL),(363,841132371028942,'Veteran Services',NULL,574964812525513,'The Supportive Services for Veteran Families (SSVF) program provides services to very low-income veterans who are homeless or face potential homelessness. Brochure is available online.\n\nWith the support of the U.S. Department of Veteran Affairs we provide short, intensive Case Management and Temporary Financial Assistance (TFA) to address a host of factors that affect the housing stability of veteran families (joblessness, limited income, disability, mental illness, credit/budget issues, etc.) and link veterans to the following services:\n\n housing counseling\n assistance with paying rental arrears\n security deposit/1st months rent\n moving expenses\n health care\n daily living\n personal financial planning\n transportation assistance\n fiduciary and payee services\n legal services\n child care','947853021041099','http://housingetc.org/supportive-services-for-veteran-families-ssvf/',NULL,NULL,'Verified','929094559121639,1077790582995406',' Must be a veteran who was not dishonorably discharged from the military\n Must reside in the HCS SSVF service area (DC, Prince Georges County, Montgomery County, Fairfax County, the City of Alexandria, and Arlington County)\n Must be at imminent risk of homelessness or currently homeless as defined by the VA\n Must meet income requirements for very low income households (see below):\n Must be a veteran who was not dishonorably discharged from the military\n Must reside in the HCS SSVF service area (DC, Prince Georges County, Montgomery County, Fairfax County, the City of Alexandria and Arlington County)\n Must be at imminent risk of homelessness or homeless as defined by the VA\n Must meet income requirements for very low income households (see below):',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,'1260550501779199','1138176448388213',NULL,NULL,NULL),(364,843621219939860,'SHARE Food Network','SHARE',1331447374298751,'SHARE is a non-profit, community-based organization dedicated to offering healthy, nutritious groceries at a roughly 50 percent discount.  This is accomplished through high-volume purchasing and thousands of volunteer hours, which strengthens the community for all.  SHARE food packages are available to anyone who is interested.\n\nMonthly value packages cost just $22 and include $40-$45 worth of basic and healthy groceries; always four to six pounds of frozen proteins and 8 to 12 pounds of fresh fruits and vegetables, sometimes with seasonal grocery or dessert items.\n\nSHARE is a sustainable, social enterprise of Catholic Charities that helps anyone save money on nutritious, healthy food.  We are committed to supporting local community groups where all may participate, serve, and lead with dignity.\n\nProviding wholesome and nutritious food to families and individuals at a reduced cost\nPromoting volunteer service in our communities\nBuilding partnerships with community organizations','1182935368999640','https://www.catholiccharitiesdc.org/share/',NULL,NULL,'Verified','832990803111047','If you eat, you qualify!  SHARE is a great equalizer in a world of great inequality.  Everyone is welcome to purchase without application, qualification, identification, or documentation. Everyone receives the same, fresh, high-quality food.\n\nBecause we purchase all the food we offer, the more who join us the STRONGER we become.\n\nSHARE accepts organizational or business checks, credit and debit cards, EBT/SNAP benefits, money orders, gift certificates, and cash.',NULL,NULL,NULL,NULL,'765310724233865,1200120875116452','841384557417096',NULL,NULL,'783706569251103',NULL,NULL,NULL),(365,838774263465115,'Rapid Rehousing',NULL,791950857737387,'Many of the individuals and families who turn to Friendship Place for help dont need the long-term support that PSH provides. They may have found themselves suddenly unable to pay rent because of unforeseen life challengesa layoff, a health crisis, a family crisis, domestic violenceor they may be newly released from incarceration. With just temporary assistance, they can get back on their feet. For people in this situation, Friendship Place offers homelessness prevention and rapid rehousing services through a variety of avenues.','931886810745529','https://friendshipplace.org/programs-outreach/housing/',NULL,NULL,'Verified','929094559121639','You must be referred directly from the Department of Human Services (DHS), through DCs Coordinated Entry System.\n\nTuesday is by appointment only.',NULL,NULL,NULL,NULL,'1235107925689722','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'1244888069012632,877243931325915','1152494666421051',NULL,NULL,NULL),(366,842045983132421,'Got Transition',NULL,840733417398800,'An online resource page. The transition from adolescence to adulthood can be both exciting and overwhelming, so its important to know youre not alone. Using the Got Transition program as a guide, weve put together helpful resources to help you navigate this transition and continue caring for your emotional health.\n\nAre You Ready? Q',NULL,'https://www.maryscenter.org/behavioral-health/children-and-teens/got-transition/',NULL,NULL,NULL,'941516382466411','Visit website and check out our resources.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'883345659611536,1274396898894043',NULL,NULL,NULL,NULL),(367,842684188416003,'UNIT MEDICAL CENTER',NULL,1220981589179778,'Provides Psychiatric services.','620132940242525','http://www.united-medicalcenter.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'818226241830087',NULL,NULL,NULL),(368,857532124289295,'Case Management ',NULL,1178149503221687,'Case managers take a holistic, family-centered approach to providing services. Guidance on physical and mental health, employment, and education.',NULL,'https://housingup.org/ending-homelessness/case-managment/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(369,860988302609734,'Coat Drive',NULL,584105465886479,'A yearly program giving coats out to our community and schools children who are in need.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318','Call or walk in during fall and winter months to get a coat.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(370,867793861079810,'Helping Hands to Seniors',NULL,584105465886479,'We supply to our Seniors personal care items for themselves and also a bag  to give to another seniors a bag of personal care items','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318','Call or walk in to get any items we have that you need.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(371,874569788026655,'NEWCOMER COMMUNITY SERVICE CENTER: ENGLISH SECOND LANGUAGE',NULL,1034824444966763,'Provide free evening English classes in both the D.C. and Virginia offices.','848140138973075','http://newcomerservice.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'953759760601920',NULL,NULL,NULL),(372,902980090080880,'Community Based Services ',NULL,876151548923517,NULL,NULL,'https://www.nccf-cares.org/community-based-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(373,902951823980164,'Work Program',NULL,726173106231202,'An additional work program the Mission offers, provides assistance to men who are currently employed full-time but have no place to live. They receive a reserved bed for 90 days initially and are required to save 50 percent of their net earnings on a cumulative basis each payday. This savings is used to secure their permanent housing after leaving the Work Program.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(374,900680386991276,'Interview Preparation',NULL,1116810105858975,'Before their appointment, candidates receive an orientation with instructions on what to take to their interview, what to expect, and how to be prepared for their interview. A CARECEN staff member or volunteer may accompany eligible students to their interview to provide interpretation services.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009,789038541797078','Please call and make an appointment.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(375,903471867323822,'The Day Center',NULL,1265431689708141,'At the Day Center, we promote mental, physical, spiritual and emotional healing through a holistic, integrated and evidence-based treatment approach. We provide trauma interventions, mindfulness and art therapy to help improve outcomes in the clients we serve. Patients can achieve a lasting recovery with support from peers and a highly trained staff.\n\nIntensive Outpatient & Partial Hospitalization Program\nBoth the IOP & PHP programs offer a structured daily schedule consisting of evidence-based group therapy and a variety of hands-on art therapy, recreation and expressive activities. We help adults experiencing mental health conditions such as PTSD, depression, bipolar diagnoses, or anxiety return to a healthy daily routine that incorporates self-care, social interaction, and mindfulness.\n\nThe Partial Hospitalization Program provides an intense, structured treatment setting for individuals who would benefit from daily therapeutic interventions or who would otherwise require inpatient psychiatric care.\n\nIntensive Outpatient Treatment (IOP)\nIntensive Outpatient clients come to the PIW Day Center from 9:00 am to 12:30 pm three days a week for psychiatric services and group therapy sessions. While multiple groups are offered licensed clinicians work with each IOP client to develop an individualized treatment plan based on the clients strengths, diagnosis and identified opportunities for growth and skill building.\n\nDuring treatment, patients generally attend 3 groups a day and receive other individualized care provided by licensed clinicians and a psychiatrist in accordance with the clients treatment plan.\n\nPartial Hospitalization Treatment (PHP)\nThe Partial Hospitalization Program runs five days per week, five hours each day 9:00am to 2:00pm, plus a 30 minute lunch break.  Each day:\n\nBegins with a community meeting group to review the daily schedule\nWelcomes any new individuals\nReviews progress on treatment goals\nAddresses any concerns or challenges\nDuring treatment, patients generally attend 4 groups a day and receive other individualized care provided by licensed clinicians and a psychiatrist in accordance with the patients treatment plan.\n\nTrauma Recovery & Empowerment Model\nThe Day Center at PIW utilizes an evidence based approach called The Trauma Recovery and Empowerment Model (TREM). TREM is a fully manualized, group-based intervention designed to facilitate trauma recovery among women with histories of exposure to sexual, emotional and physical abuse. Drawing on cognitive restructuring, psychoeducational, and skills-training techniques, the intervention emphasizes the development of coping skills and social support. It addresses both short-term and long-term consequences of violent victimization and neglect, including mental health symptoms, such as posttraumatic stress disorder (PTSD), depression, and substance abuse.\n\nMindfulness\nThe Day Center at PIW utilizes the practice of Mindfulness to support clients in their healing. Mindfulness is an integrative, mind-body based approach that helps people to manage their thoughts, feelings and mental health. It has become widely used in a range of contexts to support emotional health and awareness.\n\nMindfulness exercises are ways of paying attention to the present moment, using techniques like meditation, breathing, and yoga. Training helps people to become more aware of their thoughts, feelings and body sensations so that instead of being overwhelmed by them, they are better able to manage them. Practicing mindfulness can give more insight into emotions, boost attention and concentration as well as improve relationships.','1289140698414142','https://psychinstitute.com/treatment-services/adults/the-day-center/',NULL,NULL,'Verified','637158405241810,941516382466411','PIWs Day Center Program has evidence-based treatment and skill enhancement to improve a persons ability to function in daily life. Our clinicians perform a thorough assessment to determine if intensive outpatient or partial hospitalization is an appropriate level of care. A good candidate for the program has:\n\nAn acute psychiatric disorder but is not at imminent risk for suicide or harm to others\nCapacity to fully participate\nReasonable expectation of improvement\nA history of trauma (TREM Program for women)\nA history of significant life challenges\nTransportation to and from the program each day\nThe willingness and ability to commit to the program and the therapeutic work involved.\n\n\"Its easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.\"',NULL,NULL,NULL,NULL,'938568918684495,823866019660328',NULL,NULL,'1263089203668614','1045297656470568',NULL,NULL,NULL),(376,910692115764601,'Gender & Health Program',NULL,887352348953420,'La Clnicas Gender & Health Program is a comprehensive and holistic health program for Latina immigrant women. The program, also known as Entre Amigas, focuses on physical, emotional, and social wellbeing, creating a supportive network and solidarity among women. The program offers diverse services including a support groups, advocacy and navigation for survivors of gender-based violence, community education about prevention of violence and sexual and reproductive rights, and guidance in legal and immigration issues. The goal of Entre Amigas is to strengthen participants health, respecting their beliefs, in their own language and at their own pace.','868710877316469','https://lcdp.org/_en/programs-community-health-action.html',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'887062299451299','1136144186376874',NULL,'1295679372454826,836091364973509','1214063268443455',NULL,NULL,NULL),(377,908536708739321,'REACH Residential Empowerment Adolescent Community Home',NULL,1306699628219808,'Residential Empowerment Adolescent Community Home (REACH) is a community-based residential facility for committed and detained youth ages 13 to18 who are in the custody of and referred by the DC Department of Youth Rehabilitation Services. REACH provides youth involved in the juvenile justice system with a highly structured, service-enriched, homelike environment as an alternative to institutionalization. The expected length of stay for young people is thirty days. The program emphasizes individual, group, and family counseling; educational remediation; life skills development; substance abuse counseling; and self-esteem building.','1218813676681454','https://www.sashabruce.org/programs/safehomes/reach/',NULL,'gjohnson@sashabruce.org','Verified','929094559121639,637158405241810','A referral from the DC Department of Youth Rehabilitation Services is required.',NULL,NULL,NULL,NULL,'766550059427065','882054301651193',NULL,'1111909443324870','816167940258946',NULL,NULL,NULL),(378,846445553337660,'Spiritual Support Services',NULL,883186000200856,'The purpose of Spiritual Support Services is to provide strategies on how a client can incorporate spirituality into their recovery process.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(379,849003153117298,'Food Pantry',NULL,1097044507649764,'Offers a food pantry every third Saturday of the month from 10:00AM to 12:00PM.','952434908769061',NULL,NULL,'info@nepc-dc.org','Verified','832990803111047','Before arriving at the food pantry, you need to do the following prior to the day of the food pantry:\n\n- Obtain a referral from Bread for the City\n- Come into the church to fill out an application\n- Bring a photo ID\n\nYou must reside within Ward 5 or Hyattsville, MD',NULL,NULL,NULL,NULL,'930974123497646','602018276076140',NULL,'565669778208779,1244888069012632,1009160981885425','1275033807968921',NULL,NULL,NULL),(380,855116520932040,'Congregational Resources',NULL,1180598613249590,'Seabury provides leadership and coordination of aging services to congregations in the Episcopal Diocese of Washington and the United Church of Christ Potomac Association.\n\nOur Congregational Resources program provides:\n- Information on services and resources for older adults\n- Resources and support for older adult ministry design and development\n- Educational presentations on aging issues\n- Opportunities for service with our Age-In-Place project and in our senior living communities\n- Opportunities to honor the service of older adults to congregations\n\nCommon Threads: An Intergenerational Worship Series\n\nEverybody has a story. Whats yours? Seabury Resources for Aging invites you to a creative worship series based on life stories. Well gather for conversation, reflection, and worship, focusing on themes of joy, sorrow, hope, and change. Participatory and station-based, these one-hour services are often a great fit for children, youth, and families. Common Threads is offered in partnership with area clergy and congregations. People of all ages and abilities are welcome.','1183011241112934','https://www.seaburyresources.org/congregationalresources',NULL,'info@seaburyresources.org','Verified','637158405241810,789038541797078','Call to apply for services.',NULL,NULL,NULL,NULL,'754495695785925','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(381,869725690004657,'Specialized Employment',NULL,970560028876577,'JSSA empowers individuals with disabilities to achieve self-sufficiency through long-term career success. Working as a team, our experienced employment specialists take a customized approach to career development that focuses on each candidates individual strengths, interests, and skills. Fees can be paid privately or by appropriate state agencies.','977589590864235,946508354826345,1321118518935089','https://www.jssa.org/get-help/specialized-employment/',NULL,NULL,'Verified','970915508638448','Call for more information.',NULL,NULL,NULL,NULL,'1289392147201269,1215754131378315','806655987955880',NULL,'1322383076619129','863218507660277,1257520076925731,1218692669680880',NULL,NULL,NULL),(382,871817666202986,'Miriam\'s Studio Art Therapy',NULL,1043249662316489,'Miriams Studio is a distinctly different therapeutic space than what many of our guests are used to, and thats really importantespecially for those of our guests who dont trust the traditional homeless services model.\n\nGuests are free to create art in a variety of media  drawing, sculpture, collage, painting, jewelry  that can be completed in a single session or over several sessions. During the creative process, the art therapist observes and engages guests while participants speak openly and gain support from each other in a safe and trusting environment.\n\nThis approach creates a place of belonging, where each guest is free to share, express and grow. In doing so, relationships with case managers are built, trust is earned and dignity is fostered.\n\nEach week during Studio hours, we offer:\nOpen Studio Art Therapy\nCreative Writing groups\nYoga classes\n\nIn addition, we have special activities such as:\nTheater\nArt Exhibitions\nField Trips\n\nStudio activities are facilitated by our Art Therapist, case managers and volunteers.','1220017101351760','https://miriamskitchen.org/miriams-studio/',NULL,NULL,'Verified','637158405241810','You can walk in for open studio hours. Please call about special events.',NULL,NULL,NULL,NULL,'582664674810922,1076876608568522','1182760890335527,1292960782415135',NULL,NULL,'850193305992354',NULL,NULL,NULL),(383,880988285788628,'AIDS Ministry',NULL,1253319258586656,'The Covenant Baptist UCC HIV/AIDS Ministry exists to promote HIV/AIDS education, advocate on behalf of those infected/affected by HIV/AIDS, and effect change in the behavior of the African American community in the Metropolitan DC area. We seek to inform the church and community about HIV/AIDS through the following:\n\nOur Conversation Center provides a safe space to discuss HIV/AIDS and obtain information about local services and events concerning HIV/AIDS\nRecognize the national HIV/AIDS awareness days: Black Church Week of Prayer for the Healing of AIDS, National Black AIDS Awareness Day, National Women and Girls Awareness Day, National HIV Testing Day, and World AIDS Day\nPartner with local organizations to conduct HIV 101 workshops and other community events.','861096970014349','http://www.covenantdc.org/aids-ministry',NULL,NULL,'Verified','637158405241810,941516382466411',NULL,NULL,NULL,NULL,NULL,'1067100404223709',NULL,NULL,'780785826421817','1159415480551281',NULL,NULL,NULL),(384,881381167741606,'Urban Alliance Partnership',NULL,1279230501938511,'To support older youth, we have deeply co-invested in and partnered with Urban Alliances workforce readiness training program which supports over 300 high school students in Wards 7 and 8. Students participate in weekly job training workshops starting their freshman year. By senior year, they will be placed in 9-month, paid professional internships.','947434898715713,1262159504249540','https://marthastable.org/education-programs/',NULL,'educationprograms@marthastable.org','Verified','789038541797078','Our education program has an open, non-discriminatory enrollment policy. For information about enrollment, please contact educationprograms@marthastable.org.\n\nApplications for our early childhood education program are accepted on a rolling basis at both of our locations. Ready to begin the online enrollment application?\n\nApplications can also be submitted in person at either location or done online. A comprehensive list of documents and steps are available online.\n\nYou can learn more about Urban Alliance by visiting our website or their\'s.',NULL,NULL,NULL,NULL,'1235881686916009','1128449542578572,799792178245127',NULL,'617429251519067','1273798320035626,873144110718631',NULL,NULL,NULL),(385,881403344964972,'Job Seeker Services','Job Placement Program',908300362827413,'Jubilee Jobs provides job preparation, placement and community of support for eager, ready to work applicants.\n\nFree services include:\n\n- Resume Preparation\n- Online Application Support\n- Interviews with Hiring Employers\n- Community Connections & Service Opportunities\n- Long-Term Goal Setting\n- Career & Educational Guidance\n- Mentoring, Entrepreneurship, & Internships\n\nIn addition to providing job preparation and placement, we offer up to two years of continuing support to applicants. We are very proud to have a current 78% retention rate of employees hired. We are open to all individuals over 18 years of age.','1150129069386124,1286395778585315','http://jubileejobs.org/our-programs/for-job-seekers/',NULL,NULL,'Verified','970915508638448','If you are seeking help in finding employment through our job placement program, you must attend orientation. Upcoming orientations are listed on the website.',NULL,NULL,NULL,NULL,'1313473502046025,639225425188186','1250551652902957,903053826297447',NULL,'866965462945330','638447966180396,1157041158470005',NULL,NULL,NULL),(386,906107564923489,'Medical Case Management',NULL,935708179993271,'DamienMinistries also offers case management to PLWHA. Once under our case management, our three case managers work closely with an individual to develop a case plan, including steps that need to be taken in order to meet the needs of the client. Through our services a client has access to emergency services, help obtaining relevant benefits, referrals to other organizations that offer services we may not, and help securing permanent housing. We help many clients who are homeless or are at risk of becoming homeless with obtaining permanent, secure housing.','1295311939008541','http://www.damienministries.org/',NULL,NULL,'Verified','941516382466411','Call to set up an appointment',NULL,NULL,NULL,NULL,'1174596952831378','1170974328064768,620540776659347',NULL,NULL,'1010200482336643',NULL,NULL,NULL),(387,920302771339848,'Safe at Home',NULL,623502983860633,'The Safe at Home program helps older adults and people with disabilities living in DC reduce the risk of falls in partnership with the DC Department of Aging and Community Living (DACL). Currently the DC Department of Aging and Community Living offers grab bars, chair lifts and other safety modifications for DC resident below 80% Area Median Income (AMI). Rebuilding Together DC  Alexandria will provide the same services for qualifying households who make 80-100% AMI, working with occupational therapists.','834887345290440','http://www.rebuildingtogetheralex.org/index.php/about-us/programs2019',NULL,'info@rebuildingtogetherdca.org','Verified','929094559121639','Call or apply online. Concerning eligibility, folks who are eligible are low income homeowners who cannot maintain their homes (typically elderly, persons with disabilities, veterans, and families with children), as are nonprofit facilities, schools, and public spaces that serve low-income residents. To be considered for home assistance, candidates must complete and submit an application form and provide documentation of total household income, such as tax forms or pay stubs. Some of our clients are referred through congregations, schools, community agencies and service groups, or by self-referral.',NULL,NULL,NULL,NULL,'1184206268036011','1272598751590026',NULL,'1009160981885425,753216819976855','1171518036331901',NULL,NULL,NULL),(388,860779231100127,'Temporary Housing at Hope Apartments',NULL,1195870505334629,'We provide short-term, transitional housing for families who are also in need of substance abuse services. In a safe, service-rich environment, parents get help with treatment and support for their employment and permanent housing search.\n\nNestled in the Congress Heights neighborhood of Southeast, DC, Hope Apartments provides apartment-style transitional housing for 10 homeless families with children, where the head of household is in recovery from substance abuse.\n\nHope Apartments is one of few programs in DC where children can live with their parents while the parent works on recovery. Adults attend outpatient substance abuse treatment programs while simultaneously working on finding a job and stable housing.\n\nFamilies work closely with our staff to achieve their goals and receive a number of supportive services:\n\nGoal-oriented case management\nConnection to substance abuse services\nAssistance on finding an affordable apartment\nConnection to employment and training\nConnection to behavioral health services\nLife skills classes on parenting\nConnection to community resources','1323076878369772','https://www.communityofhopedc.org/housing/hope-apartments',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195,877243931325915','540676479546509',NULL,NULL,NULL),(389,859629175967195,'Community Impact Centers',NULL,727757843857751,'Our community-based resource centers are designed to provide a large array of services and support for Ward 8 individuals and families. Our full-time staff focuses on providing resources necessary to put children and families is the best possible position to be stable and successful.','1313701156750318,939076222269480,1218278923208260','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234','880651940863411,760369360005535,1245852672133548',NULL,NULL,NULL),(390,865371846794230,'Family Strengthening Program',NULL,1306699628219808,'At the SBY Our Family Strengthening Program, is a new collaboration with the Department of Human Services. The goal is to increase family strength and stability and decrease family conflict behaviors by improving youth runaway behaviors. The program does this through improving communication, conflict resolution and coping skills of family members. It is meant to last 90 days with up to 90 days of follow-up support.','1083708956779513','https://www.sashabruce.org/programs/safehomes/family-strengthening-program/',NULL,'slovett@sashabruce.org','Verified','637158405241810,789038541797078','Call or email for information on joining the program.',NULL,NULL,NULL,NULL,'1173443518827100','882054301651193',NULL,'877243931325915,883345659611536,1292849277583603','626337120120757',NULL,NULL,NULL),(391,874272763703793,'Youth Substance Abuse Treatment',NULL,883186000200856,' Intensive Out-Patient group, individual and family services','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(392,875517215179569,'Drop-in Center',NULL,791950857737387,'Meals\nLaundry & Shower facilities\nPersonal hygiene supplies\nClothing (Socks/Underwear/T-shirts)\nHealth and Mental Health services\nSupportive Services & Street Outreach\nCoordinated Entry/Housing assessment (DC)\nResources and Referrals\nVital Document & Benefits Assistance\nMail Coordination & Phone Usage',NULL,'https://friendshipplace.org/drop-in-and-clinic/',NULL,NULL,'Verified','941516382466411,929094559121639,637158405241810,832990803111047,911225335803318','The Welcome Center is located at 4713 Wisconsin Ave NW, Washington, DC 20016, between the TenleyTown and Friendship Heights Metro Stations. To visit, take the following busses: 30N, 30S, 31, 33 and N2.\n\nAnyone in need of assistance is welcome to come to the Drop-In Clinic and Center.\n\n',NULL,NULL,NULL,NULL,NULL,'952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'877243931325915',NULL,NULL,NULL,NULL),(393,875542904723327,'Meals',NULL,1323664977480953,'We served 62,000 meals last year alone, we believe that once youth are fed they are better equipped to start their success plan. Homeless and disconnected youth eat along side our staff and volunteers daily to promote fellowship and trust.','1106602330344467','http://covenanthousedc.org/our-services/supportive-services/',NULL,NULL,'Verified','832990803111047','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(394,881012847859169,'Homeless Street Outreach',NULL,976379482380679,'Pathways to Housing DC oversees the largest homeless street outreach effort in the District, funded through partnerships with the DowntownDC and Golden Triangle Business Improvement Districts, the DC Department of Behavioral Health, and the DC Department of Human Services. The goal of our street outreach program is to connect people living on the street with housing and the life saving services they need.\n\nIn 2018, our outreach teams served 1,872 unduplicated people over with 12,428 individual face-to-face contacts. Our teams completed thousands of housing assessments, helped hundreds of people obtain vital documents required as prerequisites for housing, and connected hundreds more to mental and physical healthcare services.\n\nOur Outreach staff works to build trust with those experiencing homelessness first by helping to meet some of their basic needs (including food, clothing, showers, laundry, transportation, identification, etc.). Then, they partner with each individual to access housing, employment, medical care, mental health care, substance abuse treatment, and other services. Additionally, our nurse practitioner and psychiatrist conduct street visits to engage people with complex health needs who are not connected to other health services. The approach is not about maintaining homelessness; it is about ending homelessness for those living on the street in downtown DC.\n\nThe Outreach team also responds to concerns about people experiencing homelessness in the area from police, other social service providers, business owners, workers, residents, and downtown visitors.','743353111808252','https://pathwaystohousingdc.org/what-we-do/homeless-street-outreach/',NULL,'dispatch@downtowndc.org','Verified','929094559121639','To refer someone who is homeless and in need of assistance in the DowntownDC Business Improvement District, you may contact the DowntownDC BID Dispatch at dispatch@downtowndc.org or 202-624-1550.\n\nTo refer someone who is homeless in the Golden Triangle Business Improvement District, you may contact the Golden Triangle BID Dispatch at BBB1650Dispatch@blockbyblock.com or 202-293-9580.',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268','1053546370861365,1245676378058200','877243931325915','1137409735223363',NULL,NULL,NULL),(395,893345439899253,'Sherman Avenue Single Room Occupancy (SRO)',NULL,1085960322097234,'Sherman Avenue Single Room Occupancy (SRO) provides 10 Single Room Occupancy (SRO) units for men who were once homeless.\n\nThis program represents the most tangible step towards independence within the Coalitions continuum of care. Men, who were once homeless, now pay rent, buy and prepare their own food. Men who are in this program have demonstrated that they are ready for independent living and are prepared to assume appropriate responsibility for their lives.\n\nThe men residing at Sherman Avenue have demonstrated that they are ready for independent living and are prepared to assume appropriate responsibility for their lives. Most of the tenants eventually move on and find traditional one or two bedroom apartments.\n\nEach building has a common kitchen, bathroom, living room and dining area. Sherman Avenue has ten single rooms for rent, which are available to any formerly homeless men. Most of the tenants are graduates of the Coalitions shelter and transitional programs. The SRO tenants form a partnership with the Coalition to remain alcohol and drug free during their tenancy.','916613468118556','http://www.dccfh.org/programs/permanent-housing/permanent-housing-for-men/',NULL,NULL,'Verified','929094559121639','Call to inquire about openings and eligibility.',NULL,NULL,NULL,NULL,'1202903945491491','1202819882057306',NULL,'625195015492370','628765225467948',NULL,NULL,NULL),(396,899838401230788,'D.C. OFFICE OF VETERANS\' AFFAIRS',NULL,559154929442125,'Provides Veterans Resources services','1274640117388299','http://www.ova.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'616767096527901',NULL,NULL,NULL),(397,899139018547334,'Premier Homecare',NULL,970560028876577,'Premier Homecare, a wholly owned subsidiary of JSSA, is a licensed, nonprofit private duty home care agency providing medical care management, home support, and home care services.\n\nMedical Care Management services include:\n\n- Comprehensive Nursing Assessments\n- Home Safety Assessments\n- In-home Medical Supplies & Equipment\n- Medication Administration  Supervised by a Registered Nurse\n- Care Coordination  with Physicians and Other Healthcare Providers\n\nHome Support Services include:\n\n- Meal Preparation\n- Light Housekeeping\n- Laundry\n- Grocery Shopping / Errands\n- Transportation to Appointments\n- Concierge Services\n\nHome Care Services include:\n\n- Dressing\n- Bathing\n- Grooming\n- Lifting and transferring\n- Toileting\n- Walking\n- Feeding\n- Medication reminders','1104646684650585','https://www.jssa.org/get-help/premier-homecare/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'1181473804104391','799390782148011,823008542949204,790762956605328',NULL,'854808174954754','1328302797893590',NULL,NULL,NULL),(398,902085800158226,'\"KUEHNER PLACE, SHELTER FOR ABUSE ELDERLY AND NEGLECTED\"',NULL,1118282953085799,'Provides coalition for the Homeless, Headquarters services','616405328742379','http://some.org/services/senior-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1289939133492405',NULL,NULL,NULL),(399,895973468150097,'Shirley\'s Place Day Center',NULL,1245236106154921,'Shirleys Place, Everyone Home DCs drop-in day center, offers people experiencing homelessness a safe and dignified place to spend their day off of the street. Shirleys Place provides access to showers, laundry, restrooms, mail service, phones, computers, lunch, and social service referrals.','843095304494507','https://everyonehomedc.org/programs/shirleys-place-day-center/',NULL,NULL,'Verified','929094559121639','Walk in for services.',NULL,NULL,NULL,NULL,'591848459801218,976521643212097','1127790854320730,1172146638038771',NULL,'877243931325915','803436271206188',NULL,NULL,NULL),(400,910059099567277,'Congress Heights Senior Wellness Center',NULL,727757843857751,'In partnership with the DC Department on Aging and the East River Family Strengthening Collaborative, we provide comprehensive programs that promote the health and wellness of DC senior residents 60 years of age and older.  All services focus on wellness, health promotion and disease prevention. Health care services are provided to help seniors in the community maintain their independence and avoid premature institutionalization.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234,1183802898164393','1231516890380928',NULL,NULL,NULL),(401,914835976451142,'HIV & STD Prevention',NULL,925360037107607,'A preventative health care program offering primary and secondary prevention skills building groups; peer-based support groups.','946396771118356',NULL,NULL,NULL,'Verified',NULL,NULL,NULL,NULL,NULL,NULL,'640736255097589',NULL,NULL,'836091364973509,998189789977161','1134563231552544',NULL,NULL,NULL),(402,915917142791989,'Unity at N Street Villiage (Ward 1) ',NULL,1043772486617212,'Healthcare for homeless ','1027459128839995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1077212094599633',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(403,916268094765428,'Morning Program',NULL,801110030219864,'During the morning program, our clients can take showers, do laundry, access their mail and use the phone, receive emergency groceries, and enjoy community in a safe, welcoming atmosphere.\n\nBreakfast Services\nThrive DC serves more than 2,000 clients annually through our Morning Program.\n\nMorning Schedule\nEach day, Monday through Friday, we see 150  200 clients for breakfast.\n\nMonday, Wednesday, & Friday we provide a hot breakfast. On Tuesday & Thursdays, we provide clients with fresh sandwiches and salads from our partners at Pret A Manger.\n\nFarmers Market for Homeless and Low-Income Individuals\nSpecial mention goes to our Fresh Food Fridays. Every Friday from 12:30 PM  1:30 PM clients are invited to participate in our farmers market at no cost to them! Many of the community members in Columbia Heights come to participate in our farmers market, you do not have to be experiencing homelessness to take part in our programs or fresh food Friday.','1220597047470925','https://www.thrivedc.org/programs/morning/',NULL,NULL,'Verified','832990803111047,637158405241810','If you need assistance, please call one of our case managers at (202) 737-9311.Case Management at Thrive DC\n\nYou can also come directly to our offices:\n\nMonday  Friday\n8:30 AM  2:00 PM (Men & Women)\n2:00 PM  4:00 PM (Women Only)\n1525 Newton St. NW\nWashington, DC 20010\n\nWe are located on the bottom level of St. Stephen and the Incarnation Episcopal Church. No appointment necessary, just come in and ask for one of our case managers.',NULL,NULL,NULL,NULL,'665113076769939','818646560557978',NULL,NULL,'962322435473993',NULL,NULL,NULL),(404,918238055415108,'Health Home Behavioral Health',NULL,840733417398800,'The Marys Center DC Health Homes team is here to help you manage your physical and mental health chronic conditions and create a personalized plan of care to improve health outcomes.  \n\nMarys Center became a certified DC Health Homes provider in January 2016, when the Department of Health Care Finance (DHCF) launched the My DC Health Homes program to benefit Medicaid recipients.  \n\nAll DC Health Homes services are optional and will not affect your eligibility for other Medicaid services. All services are covered under Medicaid with no additional fees. \n\nTo enroll, please contact Tara Pavao, our Health Homes Director at (202) 389-2486. Once you are enrolled, our HH team coordinates your medical and behavioral healthcare needs by pairing you with a Nurse Care Manager and a Community Support Worker. Your Nurse Care Manager and Community Support Worker will:  \n\nSchedule medical and mental health appointments, send reminders, and help secure transportation. \nMonitor your chronic physical and mental health conditions to determine adherence to or variance from evidence-based treatment guidelines. \nMake sure you have the right medications and you are taking them correctly. \nFollow up after you are discharged from the hospital. \nConnect you to other community resources such as housing, food, transportation insurance re-certification, and legal assistance as needed. \nProvide support for you and your family on your pathway to better health. ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/adults-and-seniors/dc-health-home/',NULL,'tpavao@maryscenter.org',NULL,'941516382466411','To enroll, please contact Tara Pavao, our Health Homes Director at (202) 389-2486.\nTo enroll, call the Behavioral Health front desk at (202) 851-3671 \nTo reach Tara Pavao, DC Health Homes Director, call (202) 389-2486 or email tpavao@maryscenter.org \n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'646579701967814,1301804131597006','1134877289644712,827996522503929,601427652072887',NULL,'1263089203668614,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(405,921815945825806,'Care Management and Care Coordination',NULL,887352348953420,'La Clnicas care management program is focused on high-risk/medically complex patients. Our Care Management and Care Coordination team will conduct a comprehensive assessment of medical, cultural, and social needs and develop a patient-centered care plan with mutually agreed upon goals. Our team is made up of registered nurses and care coordinators who together with our patients work to improve health outcomes.','1170113060894673','https://lcdp.org/_en/programs-medical-services.html',NULL,NULL,'Verified','941516382466411,637158405241810','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(406,928788698938707,'Methadone Treatment Center',NULL,761153930697275,'We provide an array of services aimed at helping patients improve their quality of life. The services include but are not limited to:\nIndividual Substance Abuse Counseling\nGroup Counseling\nFamily Counseling\nMedical/Medication Appointments with a  Medical Director\nAnnual Physical Examination\nNursing Consultations\nTen Week Educational Series\nMonitored Drug Screening\nHEP C Testing and Referral Services by Grubbs','897673459565497','https://www.upo.org/ctc/',NULL,NULL,'Verified','941516382466411','Under DBH, one must be 21 or older and a DC resident who does not have insurance or whose insurance does not cover substance abuse treatment services in order to qualify for services.\nTo access this program, you must visit the ARC at 75 P Street NE (intersection of P Street and Florida Avenue, look for the blue awning).\nYou can walk into the ARC without an appointment or call ` to schedule an appointment. You must be at least 21 years old, a District resident, and bring a photo ID.\nCTC serves all DC customers regardless of inability to pay per the Department of Behavioral Health Chapter 63 Title 22-A 62 27 DCMR 008905. Discounts for essential services may be offered based on eligibility and CTCs Sliding Fee Discount Program Policy. For more information, ask to speak with Administrative Manager Althea Burgess.',NULL,NULL,NULL,NULL,'725558204724863,1118135668686826','926816513853435,808903707383571',NULL,'684980356183378,912906147241865,868012483124236,858010753970278','1247278757376259',NULL,NULL,NULL),(407,871063337645437,'Public Benefits Law',NULL,1091757696945828,'Our public benefits attorneys help our clients obtain the safety net benefits they need to make ends meet  and to which they are legally entitled. We help hundreds of clients address legal issues with their food stamps, unemployment insurance, healthcare, TANF, and other matters, through direct representation in administrative appeals, litigation, and agency advocacy.','768639914164498,1052799655566995','https://www.legalaiddc.org/public-benefits-law/',NULL,NULL,'Verified','917725171609009','You can apply online or utilize walk-in intake hours. Call for more information.',NULL,NULL,NULL,NULL,'1289374770713295,1234325977097951','871092289270509,1035182743655741,1155614982637715',NULL,NULL,'635267247673749,1157364802959844',NULL,NULL,NULL),(408,883344454564664,'Before Thirty',NULL,791950857737387,'Before Thirty is a person-centered program that provides employment and housing services to youth and young adults aged 17-29 (including single mothers) experiencing or at risk of homelessness. Friendship Place staff regularly meet with youths in the program to design customized plans that help them to achieve their goals. Job Developers at our AimHire Job Placement program arm participants with tools that will speed their professional growth, such as training in job readiness, resume preparation, interviewing skills, job identification, and outreach to potential employers. Participants are also given mentoring opportunities, and are encouraged to attend our life skill workshops, creative expression workshops, social events, community events, and more. Once they are placed in employment, participants are assisted in finding affordable housing. They also receive financial assistance for move-in costs, security deposits, and up to two months rent.','931886810745529','https://friendshipplace.org/programs-outreach/youth-young-adults/',NULL,NULL,'Verified','929094559121639,970915508638448','Call us at 202.364.1419 or email us at info@friendshipplace.org. You can also visit us at our Welcome Center (4713 Wisconsin Ave NW, Washington, DC 20016).',NULL,NULL,NULL,NULL,'956844133947886','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'877243931325915,883345659611536,921560515442064','1152494666421051',NULL,NULL,NULL),(409,886788508609002,'Mi Espacio',NULL,1140996665222837,'Mi Espacio is an after school leadership and enrichment at CASA for Latino high school students in Baltimore City and soon in Langley Park. The program strives to build the next generation of Latino youth leaders by combining academic support with life skills including workforce development, financial literacy and health education, with civic leadership development and social justice training, including public speaking, advocacy, conflict resolution, antiracism training, and community service.\n\n \n\nThe program integrates practical, hands-on activities, field trips, arts, and sports into every aspect of the program to ensure that the material is relevant and students are engaged. The program is offered each day after school from 3pm to 6pm and community service or field trip activities are held on Saturdays.  Parents are also encourage to participate in monthly meetings, which include an informational workshop on topics identified as priorities by staff during home visits, and to access additional services at CASA or partner agencies.  The Mi Espacio Program provides a positive environment for youth that meets their social service needs, advances their academic achievement, and facilitates positive development for their entire families and the broader community.','1091435530922324','https://wearecasa.org/programs/mi-espacio/',NULL,NULL,'Verified','789038541797078','Call to join the program.',NULL,NULL,NULL,NULL,'1184988992731200',NULL,NULL,NULL,'836261919910340',NULL,NULL,NULL),(410,890398981649041,'Telemental Health',NULL,887352348953420,'La Clnicas uses secure and confidential videoconferencing technology to deliver live, interactive mental health consultation between our mental health providers and patients. La Clnicas Telemental Health initiative consists of two components: client on-Site/psychiatrist off-site or client off-site/mental health provider on-site. Through Telemental Health, La Clnicas providers are reducing socioeconomic barriers and expanding access to critical psychiatric, mental health therapy to underserved, underinsured and or uninsured Limited English Proficient, Spanish-speaking Latino community in the Washington, D.C. Metropolitan Area.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(411,895095793944105,'Bereavement',NULL,1253319258586656,'The Bereavement Ministry offers emotional, spiritual, and physical support to church members and regular attendees who are grieving the loss of a loved one. This ministry may also organize groups to assist with special needs during funeral and bereavement periods.','861096970014349','http://www.covenantdc.org/bereavement',NULL,NULL,'Verified','637158405241810',NULL,NULL,NULL,NULL,NULL,'1067100404223709',NULL,NULL,NULL,'1159415480551281',NULL,NULL,NULL),(412,895467915545937,'Housing and Homeless Services',NULL,925199151398185,'E/BFSC partners with CFSA and The Community Partnership for the Prevention of Homelessness to expand the citys capacity to provide permanent housing and supportive services to families. E/BFSCs housing program is modeled after Housing First, which emphasizes the importance of housing families in permanent housing first and then providing supportive services to prevent the recurrence of homelessness. Housing services provided to families include: Case Management and Family Stabilization, Budget Planning and Management, Emergency Services and Rental Subsidy, Household Maintenance, and Housing Advocacy and Placement.','680609348421278','http://ebfsc.org/our-programs/housing-and-homeless-services/',NULL,'kcoates@ebfsc.org','Verified','929094559121639','For more information, please contact: \nKatrina Coates, MSW, LICSW, Clinical Director \n202-832-9400 ext 130\nkcoates@ebfsc.org',NULL,NULL,NULL,NULL,'1194161595371590','675698187786947','1268182811010585','877243931325915','861472460969984',NULL,NULL,NULL),(413,894009414185445,'Home Health Care Services',NULL,1326157862705937,'Skilled Home Healthcare Services - Our Skilled Nursing staff (RN\'s, LPN\'s) delivers a broad range of clinical services directly to your home. These services are based on a thorough assessment of the patients health care needs and the development of an individualized plan of care from a physician. Patients must be homebound. Our team always stands ready to assist the patient with a wide variety of skilled care services, such as;\n\nStroke & Cardiac Rehabilitation\nWound Care & Wound Vac\nDressing Changes\nDisease Management & Teaching\nMedication Management\nRegistered Nursing\nPhysical & Occupation Services\nHome Health Aides/Personal Care Services - MBI Home Health Agencys Home Health Aides provide personal care to clients who need assistance in the home.  We are more than willing to help your loved one go through their daily activities.  Our Home Health Aides support our patients by providing the following services:\n\n \n\nBathing\nGrooming\nLaundry Services\nGrocery Shopping\nHousekeeping\nMeal Preparation\nRunning Errands\nMedication Reminders\nProviding Escort Services for Medical Appointments (NOT TRANSPORTATION)\nRespite Care\nMedical Supplies, durable medical equipment\n\nPhysical Therapy - Licensed Physical Therapists who can manage and provide skilled physical rehabilitation to patients with a wide variety of diagnoses and disabilities all within the comfort of your own home. \n\n \n\nPain Management\nBalance Training\nStrength and Mobility Enhancement \nManual Exercises Administration\nMassage\n \n\nOccupational Therapy - Occupational Therapists will create a specialized plan of care for those patients who are recuperating from physical or mental illness that encourages rehabilitation through the performance of activities required in daily life. Occupational Therapists perform therapeutic exercises and instruct in activities such as:\n\n \n\nMeal preparation\nToileting\nGrooming   \nOccupational Therapists also assist with energy and endurance difficulties, and address equipment needs such as grab bars.\n \n\nSpeech Therapy - Speech/Language Therapists will provide treatments to improve speech, swallowing, communication, and abilities to understand and express language, including non-verbal language.  Your Speech Therapist can assist you with most issues ranging from swallowing disorders to include aspects of feeding. \n\n \n\nArticulation Skills/Speech Intelligibility\nSpeech Fluency/Stuttering  \nCognitive-Communication Skills    \nSwallowing/Feeding Issues\n \n\nBehavioral Health Specialty Services - By integrating our already positively well-known behavioral health services with our Home Health Care Division, we are addressing the patient in a holistic manner that will best propel them further into a better lifestyle behaviorally and physically. Our staff is professionally trained to help those with Depression, Bipolar Disorder, Alzheimer\'s Disease, Dementia, Schizophrenia  and Aggression through our Core Services, which provide:\n\n \n\nDiagnostic Assessments\nMedication/Somatic Treatment\nCounseling/Psychotherapy\nLife Skills & Coping Strategies    \nCrisis Intervention \nCommunity Support\n ','602791638266539','http://www.mbihs.com/what-we-offer/home-health-care-services',NULL,NULL,'Verified','941516382466411,637158405241810','Am I Eligible for Home Health Care Services?\n\nMust be a DC resident  \nEnrolled in or eligible for Medicaid and Medicare   \nYou must be under the care of a doctor, who must certify you are in need in one or more of the services (outlined above)\n \n\nHow to I enroll?\n\nContact your doctors office to receive referral (Prescription Order Form)\nYour doctor will submit referral to DC Department of Health Care Finance\nDepartment of Health Care Finance will initiate process for services to begin',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'1220655046642450',NULL,NULL,NULL),(414,902098981922569,'Meal Fund',NULL,1164024351359039,'Safe Shores Family Advocacy program is a familys first point of contact at Safe Shores and works with children and their non-offending caregivers throughout the continuum of services to help families see and achieve a safe, new start.\n\nThe Meal Fund Program provides food to child victims who come to Safe Shores for forensic interviews or therapy sessions. The Meal Fund covers the cost of providing food onsite for children and their families.','1101386810121427','https://www.safeshores.org/get-support/our-services/family-advocacy-services/',NULL,NULL,'Verified','832990803111047','Safe Shores will conduct a forensic interview after a report of child sexual or physical abuse is made to DC CFSA or the MPD. Family Advocacy Services are available to children and families during this time.',NULL,NULL,NULL,NULL,'1171658960657370','597458689446427',NULL,'1079714166824390,1274396898894043,915486946336080','960248296759213',NULL,NULL,NULL),(415,920716842267245,'Services for Survivors of Human Trafficking',NULL,1256643221396691,'Courtney\'s House provides recovery services for male, female, and transgender survivors of sex trafficking ages 12 to 21. We work with law enforcement to find and recover survivors from their trafficking situations. We work to educate the public and we have trained law enforcement personnel, nurses, hotel employees, teachers, high school classes, church groups, and many others on recognizing the signs of sex trafficking.',NULL,'http://www.courtneyshouse.org/how-we-help.html',NULL,NULL,'Verified','878986697513222,637158405241810','Call for help.',NULL,NULL,NULL,NULL,'864858110639039,1265266505156213','1210971762312640',NULL,'1173706987543564,785913135910989',NULL,NULL,NULL,NULL),(416,925880419304547,'SOME: DINING ROOM',NULL,727847273433183,'Provides meals, clothes, and showering facilities for the needy. Meals are served in a main dining room, as well as a separate one for women and children.','816964939097565','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'755424702995265',NULL,NULL,NULL),(417,923438177610839,'Martha\'s Table Scholar\'s Enrichment Program',NULL,1279230501938511,'Marthas Table offers a nationally accredited out-of-school enrichment program for students at our partner schools in Southeast D.C. Children participate in fun and engaging clubs that help them develop in several key areas including: literacy, social-emotional development, communication, team work, problem-solving, and creative thinking. During the school year, the program offers:\n\nPick-up from Moten Elementary\nAfter-school snack and dinner\nProgramming focused on STEM, arts, and nutrition education\nFull-day program during most DCPS school closings\nDuring the summer, we run a full-time program that prepares students for the next step in their academic journey. The summer program offers:\n\nFull-day programming Monday  Friday (8am-6pm)\nBreakfast, lunch, and afternoon snack provided\nWeekly field trips\nAcademic supports to help prevent summer learning loss and to prepare students for the next grade','947434898715713,1262159504249540','https://marthastable.org/education-programs/',NULL,'educationprograms@marthastable.org','Verified','789038541797078','Our education program has an open, non-discriminatory enrollment policy. For information about enrollment, please contact educationprograms@marthastable.org.\n\nApplications for our early childhood education program are accepted on a rolling basis at both of our locations. Ready to begin the online enrollment application?\n\nApplications can also be submitted in person at either location or done online. A comprehensive list of documents and steps are available online.',NULL,NULL,NULL,NULL,'1235881686916009','1128449542578572,799792178245127',NULL,'1243666525534340','1273798320035626,873144110718631',NULL,NULL,NULL),(418,927643315007217,'Clothing Closet',NULL,1164024351359039,'Safe Shores Family Advocacy program is a familys first point of contact at Safe Shores and works with children and their non-offending caregivers throughout the continuum of services to help families see and achieve a safe, new start.\n\nThe Clothing Closet is stocked with brand new clothing, underwear, and toiletries for children who come to Safe Shores. Children who arrive at Safe Shores might need new clothing for any number of reasons: The clothing that theyre wearing needs to be taken for evidence, or it may have been damaged, ripped or torn during the abuse. In some cases, children are not returning home, instead moving into foster care or staying with relatives. Every child who comes to Safe Shores is offered seasonally-appropriate clothing in their correct size, as well as underwear, pajamas, and toiletries, all delivered in a duffel bag or backpack to create take-care bags for children.','1101386810121427','https://www.safeshores.org/get-support/our-services/family-advocacy-services/',NULL,NULL,'Verified','911225335803318','Safe Shores will conduct a forensic interview after a report of child sexual or physical abuse is made to DC CFSA or the MPD. Family Advocacy Services are available to children and families during this time.',NULL,NULL,NULL,NULL,'1171658960657370','597458689446427',NULL,'1079714166824390,1274396898894043,915486946336080','960248296759213',NULL,NULL,NULL),(419,929396265497963,'Pro Bono Project',NULL,1093127605400642,'The Pro Bono Project enables Legal Counsel for the Elderly to provide comprehensive legal services to low-income, older people by recruiting attorneys who willingly contribute their valuable time to pro bono work. The Pro Bono Project handles approximately 600 cases annually. These cases come to the Pro Bono Project through LCE\'s Legal Hotline, LCE in-house staff attorneys and the Active Intake Project.\n\nScores of underserved seniors would be denied access to free legal services without the help of our dedicated pro bono attorneys. We count on our volunteer attorneys in the community to help us reach those in need.\n\nThe Pro Bono Project handles a multitude of civil legal issues affecting older D.C. residents with limited means, such as ensuring that seniors receive public benefits (Social Security, Medicaid, food stamps, etc.) or by preventing eviction or foreclosure of their homes through negotiation or court litigation.\n\nLCE attorneys and staff first screen all cases to help ensure that they have legal merit and are well developed. Then, the Pro Bono Project refers these cases to private sector and government attorneys who have agreed to handle them on a pro bono basis. Our volunteers and staff periodically monitor these cases until closure.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/pro-bono-project.html?intcmp=AE-LCE-WWD-R1C1LL6',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,NULL,'763163886168100',NULL,NULL,NULL),(420,934420315468432,'Upper Cardozo Health Center (Ward 1) ',NULL,1043772486617212,NULL,'1232398464032126',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'581209194821532',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(421,937486843530248,'HIPS Clinical Services Department',NULL,810479025131545,'Linkage to Care\nMedication Assisted Treatment for Opioid Use Disorder Clinic (MAT Clinic)\nInfectious Disease Clinic (HCV Treatment)\nPrimary Care Clinic\nFirst Aid and Emergency Response\nEvening Clinic Services\nBehavioral Health Services\nSubstance Use Treatment','994012462825446','https://www.hips.org/our-services.html',NULL,NULL,'Verified','941516382466411','Call or walk in. Mobile outreach services may be available in your area.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','1116823258971812,755877120889008,1239359074339438',NULL,NULL,'1115958014521430',NULL,NULL,NULL),(422,940105141272489,'Language Services',NULL,795756022910298,'At Ayuda, we work to make sure that everyone can get help when they need it, regardless of the languages that they use to communicate.\n\nWe partner with and work for a wide array of clients, non-profit organizations, legal and social professionals, and more. Use one of the links below to learn about our language access services, our partnerships, and our opportunities. ','817854864378068,1161498401444320,833655491101686,1183432963433388','https://ayuda.com/what-we-do/language-services/',NULL,'interpreterbank@ayuda.com','Vetted','917725171609009,637158405241810','Email for information on interpretation services. You can also raise this need during intake.',NULL,NULL,NULL,NULL,'910170559958808',NULL,NULL,NULL,'986915619860557,738259216161094,1255038891038036,1136426278579096',NULL,NULL,NULL),(423,940202748401268,'Family Law',NULL,820488001755900,'We will consider handling the following types of family matters for persons who meet our income guidelines:\n\nCustody\n-For individuals experiencing domestic violence\n-For the person who has primarily cared for the child and can provide a stable home environment\n-When the person on the other side has committed abuse or neglect\nDivorce\n-For survivors of domestic violence\n-Where custody is also an issue\n-Where age, disability, language or cultural background may prevent a just result if the person is not represented\n-For a parent who does not have custody but who needs assistance to help preserve a strong relationship with a child\n\nChild support\n-As part of a custody case\n-Where the person who owes support has a legal basis for modification of a child support order. Examples of when a person might have a legal basis for modification of a child support are:\n The person who is paying support has a change in earnings or income\n There is a change in circumstances which affect the income or expenses of one of the parents, such as extraordinary medical or child care expenses\n There is a change in custody\n\n-Where the parent seeking support does not agree with the position taken in his/her case by the Office of the Attorney General\n\nDomestic violence \n\nPaternity\n-Assistance in establishing paternity in child support, divorce, custody or visitation cases NLSP is handling\n-Where a parent who does not have custody seeks to establish or strengthen a relationship with his or her child(ren) and also seeks visitation or custody\nNLSP does NOT help with the following types of family law cases:\n\nAdoptions\nTerminations of Parental Rights\nAdult Guardianships','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/family-law',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(424,943922015489393,'Home Repair',NULL,855802893163707,'Across the District there are families who cannot afford to make repairs to issues in their homes that threaten their health and safety. There are seniors and older adults who dont have the money to install ramps, handrails, and make modifications that would allow them to safely remain in their homes and maintain their independence. There are homeowners with unaffordable electric and heating bills, because their older homes are poorly insulated and energy-inefficient. Our Home Repair Program is addressing DCs affordable housing crisis by partnering with low-income homeowners to help them make critical repairs to their homes. By helping families who cannot afford these repairs, were making their houses safe, healthy, and reducing their energy costs, so they can continue to liveand thrivein their own homes. When we help people to stay in the homes theyve lived and grown up in, were also freeing up the already limited supply of affordable housing in DC for other families in need of quality housing.','884179044911706','https://dchabitat.org/housing-services/home-repair/',NULL,'marshall.vernon@dchabitat.org','Verified','929094559121639','You can apply online. Eligibility info:\nDistrict residents, age 60 and over, or adults with disabilities, age 18 and over, who are homeowners or renters of a property used as a primary residence, with an annual household income at or below 80% of Area Median Income (AMI)*.',NULL,NULL,NULL,NULL,'1093912479911840','1140008964398815',NULL,'868012483124236,1183802898164393,774578996510944,1164062476491981,1294818681778567','1098238485894342',NULL,NULL,NULL),(425,874199505765345,'UPO Workforce Institute',NULL,761153930697275,'Whether you seek a new job or new skills, our training and placement services prepare you for the journey to opportunity, success and the future you deserve! \n\nWe offer courses in the following roles:\n- Building maintenance technician\n- Electrical technician\n- Commercial driver\n- Emergency medical technician (EMT)\n- Culinary arts professional\n- Hospitality and tourism industry service worker\n- Electrical installation professional\n- IT help desk and application support specialist\n- Child development associate\n\nSteady, reliable work is the key to having money in your pocket, food on the table, and a roof over your head.\nIf youre ready to get to work and arent afraid of learning something new, UPOs Workforce Institute offers training for some of DCs most in-demand vocational careers. We also help you search for jobs, nail your interview, and find and keep the job thats right for you. And we provide each and every student with one-on-one case management services to keep you focused, moving forward, and ready for better days ahead.','594960886051316,999755198000719','https://www.upo.org/workforce-institute/',NULL,NULL,'Verified','789038541797078,970915508638448','Call to find out about enrolling in one of our courses.',NULL,NULL,NULL,NULL,'665905423802380','587544010010943,940897095189363,682372519823224',NULL,NULL,'1304904589817191,1166860713798541',NULL,NULL,NULL),(426,884244585280076,'Counseling Services for Children & Adolescents',NULL,970560028876577,'JSSAs staff provide a comprehensive evaluation to identify a child or teens particular areas of need and then create a plan of service, which could include:\n\n- Individual, group or family therapy\n- A psychiatric evaluation and/or a medication management plan\n- Neuropsychological, psychological and psychoeducational testing\n- Social Skills therapy groups\n- Referrals to a specific JSSA workshop or support group\n- Care coordination','977589590864235,1321118518935089','https://www.jssa.org/get-help/children-and-adolescents/counseling-services/',NULL,NULL,'Verified','637158405241810','Call for services.\n\nPlease note that to receive psychiatric services, you or your child must already be receiving counseling services from a JSSA clinician. Please speak to your clinician if you would like to receive psychiatric services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'586981821517675,1063441922826031,1274396898894043','863218507660277,1218692669680880',NULL,NULL,NULL),(427,886267440482873,'Extended Support Program',NULL,726173106231202,'Extended Support Program participants struggle with mental illness, cognitive impairment and/or physical impairment and are without family or other caretakers. Individuals are deemed eligible based on the Missions ability to support their level of care. When appropriate, the Mission assists them with obtaining health and income benefits and suitable employment.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(428,893656046937448,'Emery Work Bed Program',NULL,1085960322097234,'The Emery Work Bed Program (EWBP) is specifically tailored to the needs of homeless men who are employed or in job training. The EWBP can serve up to 100 men. The primary objective is to assist men in sustaining employment and moving into permanent housing. Program participants must be willing to accept case management services, meet with case management staff weekly and develop and follow an Individualized Service Plan (ISP).','1338999388183746','http://www.dccfh.org/programs/transitional-housing/emery-work-bed-program-ewbp/',NULL,NULL,'Verified','929094559121639','Applications for transitional housing are accepted Monday through Friday from 9:00 a.m. to 5:00 p.m. During the intake process, clients will provide basic information such as name, date of birth, social security number, and proof of employment or job training, complete and provide required supporting documentation.',NULL,NULL,NULL,NULL,'585747742483327','1202819882057306',NULL,'877243931325915,625195015492370','1064111830015897',NULL,NULL,NULL),(429,896288673327409,'Loaves & Fishes',NULL,1010694996525430,'You are welcome at Loaves and Fishes for lunch at noon every Saturday and Sunday at 1525 Newton St NW (lower level of St. Stephen & the Incarnation Episcopal Church). We also provide lunch on Federal Holidays.','1045140628063947','http://loavesandfishesdc.org/',NULL,NULL,'Verified',NULL,'Walk in for a meal.',NULL,NULL,NULL,NULL,NULL,'1009737201726225',NULL,NULL,'962322435473993',NULL,NULL,NULL),(430,903665589155441,'DASH Housing Toolkit',NULL,983721114373124,'If you are a survivor of domestic violence facing homelessness as a result of the violence, this toolkit [PDF] is designed to heighten your awareness of housing protections afforded to you. This toolkit tells you:\n\nWhat to do if you want to stay where you are\nWhat to do if you want to leave your home\nWhat to do if you need to find safe housing\nWho can help you','828792720206018','https://www.dashdc.org/housing-resource-center/dash-housing-toolkit/',NULL,NULL,'Verified','917725171609009,929094559121639','Visit our website to download the toolkit. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(431,911181735974447,'Support Groups',NULL,810479025131545,'Peer Support Groups\nBehavioral Health Support Groups','994012462825446','https://www.hips.org/our-services.html',NULL,NULL,'Verified','637158405241810','Call for information on the next group and how to join.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','1116823258971812,755877120889008,1239359074339438',NULL,NULL,'1115958014521430',NULL,NULL,NULL),(432,910741093310618,'Camp Forget-Me-Not/ Camp Erin DC',NULL,769893937425938,'Camp Forget-Me-Not/ Camp Erin DC is a free, weekend, sleep-away bereavement camp for metropolitan Washington DC area youth ages 6-16 who have experienced the death of a loved one. Heart attack, cancer, homicide, suicide, HIV, motor vehicle collision  whatever the cause of death  Camp Forget-Me-Not provides a safe, supportive environment for children to gently explore their feelings and to understand they are not alone in their grief. Camp Forget-Me-Not combines traditional camp activities with programs designed to help children remember, mourn and celebrate loved ones who have died. ','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,'shandel@wendtcenter.org','Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'1114888612682654','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(433,914537946909052,'Financial Education Program',NULL,1140996665222837,'CASA operates an integrated program of financial literacy, naturalization, and legal services.\n\nStudies show that integrated services work. While providing naturalization application assistance, civics courses, legal support, and English instruction, CASA provides clients with financial education on topics such as:\n\nDeveloping a household budget and establishing savings\nBuying a home\nNaturalization fees affordability\nCredit counseling\nCASA provides individual and group-based financial education and assistance that includes:\n\nIndividual financial counseling\nTax preparation assistance\nWorkshops on issues such as obtaining identification documents, opening a bank account, writing a check, using a debit card, debt analysis, financial planning, and obtaining and improving ones credit score..\nAccess to micro-loans and fee waiver applications for immigration processes.\nWe are proud to count on a number of partners who help community members cope with their financial needs. Some of those partners are:','1091435530922324','https://wearecasa.org/programs/financial-literacy/',NULL,NULL,'Verified','1077790582995406','Call to join the program.',NULL,NULL,NULL,NULL,'1184988992731200','736089112142715',NULL,NULL,'836261919910340',NULL,NULL,NULL),(434,916436632015801,'Emergency Rental Assistance Program','ERAP',761153930697275,'If you are facing eviction and homelessness, UPO can help obtain payment for overdue rent, a security deposit for a new residence, or your first months rent at a new home.need to add for severe cases, first come first serve, etc. They receive tons of requests for this service that doesnt move them to self-sufficiency.\nWe work with the federal Emergency Rental Assistance Program (ERAP) to support the needs of low-income DC residents and their families who are experiencing immediate housing crises. All ERAP payments are made directly to the landlord, court, or court marshals.','594960886051316,999755198000719','https://www.upo.org/housing-counseling/',NULL,NULL,'Verified','1077790582995406','To learn more about ERAP, determine your eligibility, and apply for emergency assistance, please call 202-562-3800',NULL,NULL,NULL,NULL,'1152713868211992','587544010010943,940897095189363,682372519823224',NULL,'905876656375498','1304904589817191,1166860713798541',NULL,NULL,NULL),(435,940345726334678,'Angel Tree Program',NULL,756001362836549,'Getting Angel Tree Help in Washington, DC\nIf you need help getting Christmas gifts for your family this year, then you have come to the right place.  Each year, The Salvation Army National Capital Area Command assists thousands of parents in Washington, DC Metro Area with providing their families a wonderful Christmas through our Angel Tree program.\n\nIn order to qualify for assistance, applicants must be in need due to an emergency financial hardship, underemployment, or unemployment.  At this time only children 12 years old and under are able to receive gifts.','957585009039168,1204175927893390','http://salvationarmynca.org/angeltree/help-dc/',NULL,NULL,NULL,'911225335803318','HOW TO REGISTER FOR DC ANGEL TREE\n\nRegistration will take place on the following days and location:\n\nTuesday, September 3  Friday, September 27, 2019\n\nDoors open at 9:00 AM, Monday  Friday\n\nThe Salvation Army Solomon G. Brown (use the Morris Road Entrance)\n2300 MLK Jr. Ave., SE\nWashington, DC 20020\n\nOnly the first 100 families will be processed each day, on a first come first served basis.\n\n************************************************************************************************\n\nRegistration will also take place on the following days and location:\n\nTuesday, October 15  Friday, November 8, 2019\n\nDoors open at 9:00 AM; Monday  Friday\n\nSherman Avenue Corps\n768 Morton Street, NW\nWashington, DC 20010\n\nOnly the first 100 families will be processed each day, on a first come first served basis.\n\nNOTE: Only families currently residing in Washington, DC can register for the Angel Tree Program at the Washington, DC locations.\n\nWHAT TO BRING\n\nPlease bring the following items with you to registration:\n\nPicture ID (District Residents only)\nBirth Certificates for all children 12 years and younger\nProof of Household Income (income should be current within the last 30 days)\nProof of Residency (Current Lease or rent receipts)\nProof of Household expenses/bills (most current bills including rent, utilities, child support, etc.)\nIf you are not the lease holder, you must have a notarized letter stating that you and your children live there and pay $X amount for rent. You also must have other mailed documents (proof of income, pay stub, W2, etc.) at that address.\nIf you are residing at a shelter you must have a letter from the shelter stating the percentage you pay into escrow or any other fees you are responsible for.',NULL,NULL,NULL,NULL,'1096946727548641',NULL,NULL,'1294258872289046,868012483124236,565669778208779,1080143486455420,753216819976855,1274524177531453,1081177323974279,1235391485627514','1205767697739732,1124201869905369',NULL,NULL,NULL),(436,937354212048327,'Men\'s Ministry','Brotherhood',1253319258586656,'The Men\'s Ministry is committed to strengthening the relationships between our members and the community we serve. The key areas that the brotherhood ministry lifts up are fellowship, family, and leadership. Our vision is to be filled with knowledge of the will of God, with a goal of being \"one in spirit active in the body of Christ\" (Philippians 2:3-4). We have an identified mission which is to prepare the men of Covenant Baptist UCC for service so that their gifts and talents would be awakened for the purpose of uplifting the body of Christ.','861096970014349','http://www.covenantdc.org/brotherhood',NULL,NULL,'Verified','637158405241810',NULL,NULL,NULL,NULL,NULL,'1067100404223709',NULL,NULL,'625195015492370','1159415480551281',NULL,NULL,NULL),(437,942312969809968,'Primary Medical Care',NULL,887352348953420,'La Clnicas primary care services employ a family practice model of care and encompass the entire spectrum of family medicine, including: prenatal care, pediatrics and adolescent medicine, adult medicine, and geriatrics. Services focus on preventive care as well as chronic disease management. Diabetes, cardiovascular disease, obesity, and HIV are areas of expertise as the most prevalent chronic diseases affecting our target population. Care teams at La Clinica include bilingual medical providers, nurses, and staff; mental health therapists embedded within the clinic; and health educator, care coordinators, and insurance specialists available to support patients with holistic needs.','1170113060894673','https://lcdp.org/_en/programs-medical-services.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'670413521970743,1295679372454826','1080723808883365',NULL,NULL,NULL),(438,943779508068444,'Homebuyer Workshops',NULL,761153930697275,'Does the mere thought of purchasing a home make you feel confused, overwhelmed, or scared? Our staff of trained professionals is here to help along your housing journey  from research to purchase to home sweet home !\n\nWhen you attend a UPO homebuyer workshop, our counselors work one on one to help you develop a budget, manage or repair your credit, shop for a home and a lender, make a purchase, and learn how to take care of a new house after you settle in.\n\nOur home buying and counseling services also include education designed to show you how to spend credit wisely, manage money on a day-to-day basis, and develop plans for reducing debt and saving for the future.\n\nIndividuals who are not affiliated with a bank or have limited access to banking services can access our financial literacy programs and products through UPOs partnership with Bank on DC.','594960886051316,999755198000719','https://www.upo.org/housing-counseling/',NULL,NULL,'Verified','1077790582995406,929094559121639','Please call to join the next class.',NULL,NULL,NULL,NULL,'853687095165430','587544010010943,940897095189363,682372519823224',NULL,'905876656375498','1304904589817191,1166860713798541',NULL,NULL,NULL),(439,942923225062781,'College Student Recognition Event',NULL,584105465886479,'Provides to our college students items they may need while they are at college or attending college at home.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318','Call to get help with what goods you need.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(440,943480498983752,'NATIONAL MULTIPLE SCLEROSIS SOCIETY: TRANSPORTATION',NULL,1130976795185960,'Provides cab vouchers, a maximum of two times a month, for multiple sclerosis related visits to doctors, support groups and counselors.','1206937936321537','http://nationalmssociety.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'575667082633363',NULL,NULL,NULL),(441,946272738558477,'Bread for the City Legal Clinic - NW',NULL,NULL,'Bread for the City is a non-profit organization that provides free comprehensive services including supplemental food, clothing, medical care, legal and social services. The Legal Clinic at Bread for the City provides advice and representation in the following main areas of law:\n\nHOUSING: helping tenants in landlord-tenant and subsidized housing cases','1228487137683267','http://www.breadforthecity.org',NULL,NULL,NULL,'917725171609009',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(442,888015364104840,'Transitional Housing',NULL,1131980011333623,'EFEC has affordable housing for an ex-offender who is ready to take the next step to permanent housing. Participants are provided up to 12-months residence in a secure, safe six-unit complex in Southeast Washington, DC. Eligibility requirements for the program are that prospective participants have stable employment, do not have charges pending before the Court, are Substance Abuse Free, who have completed their stay in a Halfway House or living in a shelter and who agree to follow EFECs Rules and Regulations. Client will live in a Single Room with bed and have access to a Kitchen to cook, a refrigerator and a freezer to store food. Program participants agree to maintain employment, increase savings, pay a monthly program fee of $330.00, regularly volunteer for a minimum of 4-hours of community or other social outreach efforts of their choice per month and register to vote. Client will have the responsibility to keep the kitchen clean and clean the bathroom facility on his floor.','1297547838260579','http://www.efecachieves.org/housing/',NULL,NULL,'Verified','929094559121639','Call to apply.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'664148755918958','949959980193647',NULL,NULL,NULL),(443,907595418658961,'Community Support Treatment',NULL,802521051916688,'We provide comprehensive and integrated mental health services for clients who have mental health problems and may have co-occurring problems of addiction, homelessness, medical illness, and violent victimization. Integrated clinical services include: diagnostic assessment, community support, care coordination, therapy, and liaison with psychiatric services. Community Support specialists provide direct care and coordinate services to help clients achieve their recovery goals.','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'637158405241810,941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(444,908986332318967,'Teen Outreach Program (TOP)',NULL,1306699628219808,'Since 2011 SBY has been implementing the Teen Outreach Program in Wards 7 & 8 at Ballou High School, Maya Angelou Public Charter School and Johnson Middle School, and serves 500 8th-12th graders throughout the school year.  The TOP team creates a safe space and utilizes the Changing Scenes curriculum to encourage youth to openly share and discuss their thoughts, feelings, experiences, and beliefs on themes we introduce such as Values, Development, Relationships, Sexuality, Communications/Assertiveness, Goal Setting, and Preparing for Service.  The Teen Outreach Program (TOP) is a uniquely effective youth development program because of the community service component. Community service project(s) are a meaningful application of the discussions held within the TOP sessions. Through positive adult guidance, community service, and weekly group meetings based on the TOP curriculum, TOP assists youth in achieving life skills, healthy behaviors, and aides in their understanding of their sense of purpose through our discussions on how to improve their quality of life. The TOP model services have demonstrated efficacy in reducing teen pregnancy risks while increasing civic engagement and improving students academic outcomes.',NULL,'https://www.sashabruce.org/programs/lifeskills/top/',NULL,'cgibbs@sashabruce.org','Verified','637158405241810,789038541797078','Outreach is conducted directly to Wards 7 & 8 at Ballou High School, Maya Angelou Public Charter School and Johnson Middle School, and serves 500 8th-12th graders throughout the school year',NULL,NULL,NULL,NULL,NULL,'882054301651193',NULL,'907363295753671',NULL,NULL,NULL,NULL),(445,908926837435227,'Medical Services',NULL,726173106231202,'Staying healthy is hard when you are living on the streets, and keeping your teeth clean is nearly impossible.\n\nAfter coming through our doors, homeless people learn that the Mission offers free medical and dental services to restore health and dignity to their lives.\n\nThe medical, eye and dental exams are private consultations with doctors that happen in a sterile, modern medical room inside the mission.\n\nHospital visits and consultations happen regularly for homeless people who are hospitalized after coming into local emergency rooms.','1154195373907801','https://www.missiondc.org/what-we-do/community-services/medical-services/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,NULL,'585594366267961',NULL,NULL,NULL),(446,911320628244521,'Family In Transition',NULL,584105465886479,'This program help families with housewares, clothing and groceries who are in transition from halfway houses, homeless shelters, and  alternative housing to their own housing from Maryland/DC government and other housing provided by other donors.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318,832990803111047','Call or walk in to get services.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(447,915711679952561,'Outpatient Addiction Services','OAS',802521051916688,'Community Connections Outpatient Addiction Services (OAS) is an ARC/DBH approved substance use treatment provider. Recognizing the complexity of addiction, OAS utilizes Community Connections\' expertise in mental health and trauma recovery to provide sophisticated clinical services geared toward empowering clients. Clients are able to discover the roots of their substance addiction and how they can attain sustained recovery to meet their goals. Addiction and recovery are not just about a substance, but about a complex person with multiple concerns including the impact of mental health symptoms, developmental traumas, family relationships, environmental factors, and other obstacles to recovery. OAS incorporates a holistic approach to recovery. We teach relapse prevention skills, emphasize lifestyle modifications, and encourage network and family involvement. OAS provides person-centered and curriculum-based treatment and a diverse staff that brings a wide range of life experience, work experience, and education to the recovery process.\n\nGROUP TOPICS:\nRecovery from Trauma\nCravings, Highs, and Chemical Dependency\nMental Health and Substance Abuse\nAddiction Runs in the Family\nLearning to Love Yourself\nStress Reduction and Soothing\nValues, Goals, and Meaning\nBuilding Healthy Relationships and Supportive Networks\nCoping Skills\nFinding Motivation\nLearning Your Triggers\n\nOUR SERVICES:\nComprehensive Diagnostic Assessments\nIndividualized Treatment Planning\nIndividual Addictions Counseling\nGroup Addictions Counseling\nGroup Psychoeducation\nCase Management\nCrisis Intervention\nClinical Care Coordination','1044869288351593','http://www.communityconnectionsdc.org/our-services/addiction',NULL,NULL,NULL,'941516382466411','To get authorized for treatment, obtain a referral by visiting the DBH Assessment and Referral Center (ARC), located at 75 P Street NE, Washington, DC 20002 (at the intersection of Florida Ave & P Street  look for the blue awning). No appointment is necessary. Hours of operation are Monday through Friday, 7:00 a.m. to 6:00 p.m. The ARCs phone number is 202.727.8473.\n\nAfter getting your referral, contact OAS for an intake appointment at 202.528.6900.\n',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(448,920928473432747,'Ambassador Program',NULL,592260988502497,'Provides Intergenerational Programs services, including Opportunities for older adults to teach and learn from DC\'s youth.','790873813272838','https://dcoa.dc.gov/service/dacl-ambassador-program',NULL,'dcoa@dc.gov','Verified','637158405241810','Call to apply to be an ambassador. Also call to inquire about receiving ambassador services.',NULL,NULL,NULL,NULL,'1266100703604119','1307968476831403',NULL,NULL,'853101226577898',NULL,NULL,NULL),(449,924435449967844,'Domestic Violence Support',NULL,840733417398800,'Marys Center recognizes the deep and lasting effects of domestic violence and we want you to know you are not alone. We are committed to empowering you and your family to live a life free from violence by providing compassionate care and comprehensive support.  \n\nOur caring staff is trained to subtly look for signs of domestic violence (DV) and will refer you to the Domestic Violence Advocate, Family Support Workers, or a Marys Center therapist for mental health services if we believe you are experiencing DV. We also accept direct referrals from individuals and other service providers. Our in-house resources and services include: \n\nCase Management\nSafety Planning\nShelter Placement\nHelp with Legal Needs','964869638930274,629348329513757','https://www.maryscenter.org/social-services/domestic-violence-support/',NULL,NULL,NULL,'637158405241810','If you have experienced or are currently experiencing domestic violence, you dont have to face it alone. Marys Center can help. Call us at (202) 748-2611 today. ',NULL,NULL,NULL,NULL,'1110628963363122,1301804131597006','1134877289644712,827996522503929,601427652072887',NULL,'1212718840001878','962742212670581,732086812000340',NULL,NULL,NULL),(450,921414115906478,'SOME: JEREMIAH HOUSE',NULL,1279370086426568,'Provides a single room occupancy facility to formerly homeless women and men. Shared common social areas, kitchen, and dining rooms.','901614727736762','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1000199453998485',NULL,NULL,NULL),(451,924655410570415,'EBT',NULL,761153930697275,'For many low-income communities throughout DC, this lack of access to healthy food options makes it even more difficult to properly take care of ourselves and our families.\nUPOs Electronic Benefits Transfer (EBT) program is dedicated to increasing access to healthy food, fighting DCs childhood hunger epidemic, and educating customers about health, nutrition, and eating right.\nLike a debit card for grocery shopping, an EBT card can be used in place of cash, checks, or food stamps to purchase household food items such as bread, fruit, vegetables, meat, fish, and dairy products.\nAs DCs official issuer of EBT cards, we process more than 57,000 cards each year and offer training to eligible DC Department of Human Services clients on how to use them.','594960886051316,999755198000719','https://www.upo.org/communitywellness/',NULL,NULL,'Verified','832990803111047,1077790582995406','For more information, contact Luline Almonacy at 202-238-4691.',NULL,NULL,NULL,NULL,'620350277070213','587544010010943,940897095189363,682372519823224','874540655387308','684980356183378','1304904589817191,1166860713798541',NULL,NULL,NULL),(452,933469008966389,'Inpatient Adult Psychiatric Services',NULL,1265431689708141,'Short-term, intensive, inpatient care is available in the Adult Treatment Program for people who are 18 years of age and older. Specialty, mental health counseling programs are available to treat a range of psychiatric disorders, including:\n\nDepression\nSchizophrenia\nBipolar disorder\nSerious personality disorders\nDual diagnosis\nAnxiety disorders\nTreatment components in our psychiatric care facilities include:\n\nCrisis stabilization\nIndividualized treatment plan\nIntensive therapy for victims of emotional or sexual trauma\nPsychotherapy\nPsychopharmacology\nArt and expressive therapies\nSelf-esteem groups\nLiving skills\nTherapeutic recreation activities\nGroup therapy\nFamily support','1289140698414142','https://psychinstitute.com/treatment-services/adults/adult-psychiatric-services/',NULL,NULL,'Verified','941516382466411','Its easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'1263089203668614','1045297656470568',NULL,NULL,NULL),(453,938870799038889,'Meal Delivery',NULL,778852197302716,'You can call or use our website to order meals. You will need to qualify first or become a self-paying client. Visit our website for eligibility information.\n\nOur culinary team is very passionate about food, we spend countless hours in the kitchen designing each meal to a flavor profile our clients will love. We utilize high-quality ingredients to create well-rounded, seasonal menus featuring classic comfort foods along with contemporary favorites. Our clients consistently tell us they appreciate the quality of our meals.',NULL,'https://www.momsmeals.com/how-it-works/who-we-serve/',NULL,NULL,'Verified',NULL,'Place your order  Simply call the telephone number on the menu you receive with each order to make your selections. Or, if you would like to self-pay, you may order online.\nReceive your delivery  Your delivery date will be scheduled and the meals you have chosen will be delivered directly to your home by a Moms Meals driver or a third party partner.\nHeat and enjoy  Heat directly from the refrigerator for 2 minutes or less.\n\nIf you\'re uncertain about qualifying for Moms Meals, you can visit our eligibility page https://www.momsmeals.com/how-it-works/our-process/ to get in touch with your local area agency on aging. If they determine that you qualify for our LTSS program, they will send an authorization to us on your behalf.\n\nMany health plans offer a post-discharge or chronic care benefit. If youre uncertain, check with your health plan.\n\nFor those who do not qualify for our LTSS program and do not have a benefit available through a health plan, you are still eligible for self-pay and can receive our meals at an affordable cost  directly to your home.',NULL,NULL,NULL,NULL,'1217938662012922','1072738284399785',NULL,NULL,NULL,NULL,NULL,NULL),(454,939026297030865,'UNITY HEALTH CARE: UPPER CARDOZO HEALTH CENTER',NULL,1119446546918981,'This site provides medical, dental, and specialty services. Primary Medical Care at this site includes adult medicine, family medicine, internal medicine and pediatrics. Dental care services include restorative dentistry, extractions, dentures and hygiene. Specialty care includes behavioral medicine, cardiology, HIV care, OB/GYN, podiatry, pulmonary medicine and rheumatology. Health education is also provided. Clinic hours: Mon-Fri 8am-10pm; Saturday and Sunday, 8am-2pm. WIC hours: Mon-Fri 8:30am-5pm, and Saturday 8am-12pm. UHC provides people in Washington, D.C. with quality health care regardless of ability to pay. For those who can pay, a sliding scale based on family size and income is used to determine the appropriate amount. Unity Health Care accepts Medicaid, Medicare, Managed Care Organizations, DC Healthcare Alliance (AmeriHealth, MedStar Family Choice, Trusted Health Plan), and other private insurance plans. LOCATED IN WARD 1.','1128869310018968','http://unityhealthcare.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'890675606845092',NULL,NULL,NULL),(455,945841786673442,'Work Therapy',NULL,726173106231202,'The Work Therapy Program provides ten guests the opportunity to work part-time supporting Mission-related work activities. They save\nhalf of their earnings toward permanent housing and are required to seek full-time employment (or transition into another program)\nby the end of their one-year term.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(456,953668428109766,'Career Pathways',NULL,1323664977480953,'GED and Adult Basic Education Classes\nWe work with youth independently to create a success plan tailored for their success\n\nA good education is fundamental to achieving financial independence as well as a successful career. Covenant House Washington offers a flexible GED preparation program that allows young people ages 18-24 to follow their dreams by successfully completing their high school education.  Our curriculum focuses on the mastery of subject matter tested during the GED exam- Science, Social Studies, Mathematics, and Language Arts.  Our experienced and compassionate teachers and volunteers work closely with youth, offering one-on-one tutoring and mentoring to ensure confidence and educational success.\n\nCovenant House provides youth with transportation assistance to and from our Community Service Center as well as well as meals and childcare (for youth who are eligible) to help alleviate barriers to attending classes.\n\nCovenant House Washingtons Job Readiness Career Center (JCRC) helps young people gain skills in a specific vocation and also learn what they need to know about job hunting and the professional world.  Skills taught to young people include:\n\nInterviewing\nResume Building\nWorkplace Ethics & Behavior\nProper Workplace Attire\nComputer Skills\nNetworking\nEffective Communication\nHelping our youth find jobs is the most important step to ensuring their financial independence and future success.  Our staff are sensitive to the fears that young people experience when it comes to looking for employment and handling the responsibility that keeping a job requires. They know that not all the answers can be found in a classroom or a textbook, so they make themselves available to youth by listening to their concerns and offering reassurance.  That often includes pre-interview pep talks, or even just help with choosing the right outfit for that important first meeting.','1106602330344467','http://covenanthousedc.org/our-services/career-pathways/',NULL,NULL,'Verified','970915508638448','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'1222973168897685','899989255714132',NULL,NULL,NULL),(457,958643940332296,'POWER Program',NULL,1306699628219808,'The POWER Program provides prevention and education services to youth between the ages of 13-24, including runaway and homeless youth, commercial sex workers, street youth, teenage mothers, and court-adjudicated youth. Youth are self-referred or may be referred through other SBY programs. In order to better educate and prevent unplanned pregnancies and the spread of HIV/AIDS in young people, the P.O.W.E.R. Program offers the following services:\n\nStreet and Community Outreach\nEvidence-based interventions for HIV positive youth (CLEAR)\nStreet Smart group level intervention\nSexual Health presentations and workshops\nHIV testing and Care Advocacy\nPregnancy testing\nSafer Sex materials\nSTD Screenings','773029335736391','https://www.sashabruce.org/programs/lifeskills/power-program/',NULL,'dpruitt@sashabruce.org','Verified','789038541797078','Call or email to access this program. ',NULL,NULL,NULL,NULL,'939499390851181','882054301651193',NULL,'909533774543019','1331024333739197',NULL,NULL,NULL),(458,964012421803449,'Brenner Escorted Transportation',NULL,970560028876577,'Brenner Escorted Transportation provides safe and reliable rides to medical appointments for seniors and other individuals who need assistance when leaving and returning to their homes.\n\nRides are scheduled in advance by the passenger or their family members. Passengers pay an hourly fee of $42.00/hour billed monthly. One hour minimum required. Rides are scheduled on a first-come, first-served basis. 24-hour cancellation required.\nThe hourly fee includes gas, parking.  There is no tipping of the drivers. Passengers may request specific drivers.\n\nAll drivers are prepared to manage walkers, wheelchairs, or other assistance equipment, and to offer door-through-door service to passengers:\n\n- Escorting passengers out of their homes and into car\n- Driving passengers to medical appointments and accompanying them into office\n- Assisting with various waiting room needs, such as checking in at the reception desk, filling out forms, or hanging up outerwear\n- Waiting during appointments and then helping passengers back into car\n- Stopping at a pharmacy, if needed, to fill prescriptions\n- Driving passengers home and assist them into their home','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/transportation/brenner-transportation-program/',NULL,NULL,'Verified','637158405241810','Register for JSSAs door-through-door transportation services by completing the Brenner Escorted Transportation Application and the Brenner Escorted Transportation Passenger Code of Conduct and Ride Cancellation Policy, available on the website.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1139987753978502',NULL,'1053289039718908,854808174954754','1328302797893590,1218692669680880',NULL,NULL,NULL),(459,893746684671899,'Caregiver Support','Misler Center',855094084464049,'Support to family caregivers is at the heart of all we do.\n\nWhen participants come to Misler for a day of enriched activities, families know that their family member is in a supportive and stimulating environment. They also know that they can take a much needed break while their older family member is at the Center. Our families regularly tell us how grateful and relieved they feel once their loved one is attending Misler. The respite from their own caregiving responsibilities means that they will be better able to provide needed care at home.\n\nSocial work staff also supports caregivers through their knowledge of community resources to help families with their caregiving responsibilities. Whether it is a referral to a community based professional such as a neurologist, or a roster of credible home care agencies, we are there to help you meet the needs of your loved ones, today and in the future. We draw on the resources of JCA programs such as the Senior HelpLine or Connect-A-Ride Information and Referral to link families to the services they need.\n\nOur social workers lead a caregiver support group that meets twice a month. Under the gentle facilitation of our licensed social worker, families find a haven  a place to talk with others who are experiencing very similar challenges. Caregivers share ways to cope and manage the stresses in their lives. There is much talk, laughter and tears as caregivers connect to those who really understand.\n\nFor information about caregiver support, call us at 301.468.1740 or use this contact form to send an email inquiry.\n\nThe best way to appreciate the Misler Center is to see it for yourself.\n\nWe encourage you to call to schedule a visit so you can see us in action  our dedicated and caring staff, our stimulating activities and the difference we are making in the lives of our participants each and every day.','924628911683577','https://accessjca.org/misler-center/',NULL,'Misler@AccessJCA.org','Verified','637158405241810','For more information, to arrange a visit, or to speak with one of our social workers, please call us at 301-468-1740, or use the contact form on our website to send an email inquiry.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1058170814905410',NULL,'1157835357284365,1032274526726429,641003986848929','1050035692418764',NULL,NULL,NULL),(460,899463533628469,'Anger and Stress Management',NULL,883186000200856,'Individual and group counseling is offered to youths whose anger is out of control and is contributing to problems at school, work, and in their personal relationships.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536,1292849277583603,915486946336080','646846673243288,1261416234116596',NULL,NULL,NULL),(461,904797303274454,'Community Advocates Program ',NULL,559497771463092,'A training program that provides resources and support to residents with lived experience of food insecurity. ',NULL,'https://www.dcgreens.org/community-advocates',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(462,917742641898170,'Perennial House',NULL,662579547117824,'Perennial House provides short-term housing for young parents and their newborns plus siblings as they work towards the goals of healthy birth outcomes and independent living.','901362892558172','http://www.healthybabiesproject.org/perennial-house/',NULL,NULL,'Verified','929094559121639','Most referrals come from the Virginia Williams Family Resource Center. Individuals can call directly. There is an intake and assessment process with an interview.',NULL,NULL,NULL,NULL,'645677274573700','841350792744889',NULL,'937745775126906','1244665120116979',NULL,NULL,NULL),(463,919666377341125,'Substance Abuse Counseling ',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(464,920973469831730,'DC Green Corps Training Program',NULL,640186123610411,'The DC Green Corps training program is an umbrella for citywide service & entry level workforce development in urban forestry, storm water mitigation, green infrastructure, urban agriculture & related fields. DC Green Corps provides a gateway to 50 different green career tracks in urban and community forestry and forest-based ecosystem and watershed restoration. The vast majority of DC Green Corps trainees come to the program with a record of previous incarceration.\n\nIn partnership with the DC Department of Energy and the Environment, the US Forest Service, and the DC Urban Forestry Administration, Green Corps recruits seasonal cohorts of up to 8 trainees to take part in an 8-week training program aimed at addressing core urban and community forestry needs by: expanding and sustaining the urban tree canopy; remediating storm water runoff; and restoring natural habitats within DC.  This training program provides trainees with valuable job skills, self confidence, contacts/resources for job placement, and mentoring.  Each selected trainee commits to at least 20 hours/week over the course of the program.','1133664511724903','https://washingtonparks.net/programs/green-corps/',NULL,'greencorps@washingtonparks.net','Verified','970915508638448','Application is available on the website. Call or email for questions.',NULL,NULL,NULL,NULL,'1198829430756347','1186410017519358,976209607538308',NULL,NULL,'906270690131919',NULL,NULL,NULL),(465,935467815186616,'Spiritual Retreats',NULL,935708179993271,'Damien Ministries sponsors spiritual retreats each year, which are designed to bring together PLWHA in a safe, stress-free environment for four days in order to share their experiences, discuss issues relevant to their disease, as well as offer each other emotional and spiritual support. The workshops are an important way for PLWHA to network and meet others who are struggling with similar issues, giving them a support network that often continues beyond the workshop and into everyday life.','1295311939008541','http://www.damienministries.org/',NULL,NULL,'Verified','637158405241810','Call to find out when the next retreat is.',NULL,NULL,NULL,NULL,'1174596952831378',NULL,NULL,NULL,'1010200482336643',NULL,NULL,NULL),(466,948442047347066,'Ralph Petey Greene EFEC Scholarship Fund',NULL,1131980011333623,'The Ralph Petey Greene EFEC Scholarship Fund, gives $1,000.00 scholarship grants to the children of ex-offenders.  Many of the children of ex-offenders would not have the opportunity to pursue a college education without this financial assistance.  Envisioning this fund as a way to to give something back EFEC has awarded thirty-two (32) grants since 1986.','1297547838260579','http://www.efecachieves.org/programs/efec-scholarship-programs/',NULL,NULL,'Verified','1077790582995406,789038541797078','Call for information.',NULL,NULL,NULL,NULL,'562269954846755',NULL,NULL,'664148755918958','949959980193647',NULL,NULL,NULL),(467,947357493854904,'Divorce and Separation Services',NULL,970560028876577,'Offers Two Homes One Family, Collaborative Divorce Process at an affordable cost to families of moderate means in Montgomery County, Maryland. We want to help families experience divorce as a transition rather than a trauma.\n\nOffers assistance with developing parenting plans. Research suggests that developing a comprehensive, individualized parenting plan with a mental health divorce coach helps prioritize your childrens needs during this transitional period and in the future. A typical parenting plan often outlines scheduled time with each parent, holidays and vacations, major decision-making, exchange of information, how to handle an impasse on a parenting issue and how the plan might be updated in the future.\n\nA child specialist provides a safe place for children to share their feelings and concerns and ask questions about the divorce process. A child specialist plays an important, time-limited role in helping parents understand what their children are experiencing and what their needs are during the divorce process and in the future. The child specialist serves as a resource to parents and provides feedback to the collaborative team as they develop a parenting plan that strives to ensure the best interest of the children. For special needs families, JSSA offers guidance and expertise with their unique challenges.\n\nAdditional Services:\n\n- Counseling\n- Divorce services for couples with special needs children\n- Parenting trainings and workshops\n- Referrals to child, adult and family therapy\n- Consultations for attorneys dealing with challenging clients\n ','977589590864235,1321118518935089','https://www.jssa.org/get-help/adults-couples-and-parents/divorce-and-separation-services/',NULL,NULL,'Verified','637158405241810','Call for services',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'1211730899647476','863218507660277,1218692669680880',NULL,NULL,NULL),(468,950151604773646,'DV/Family Law',NULL,1091757696945828,'Our domestic violence/family law attorneys represent clients in a wide range of intrafamily matters in the D.C. Superior Court. We represent domestic violence survivors seeking to obtain civil protective orders against their abusers. As of 2012, we maintain a presence at both Domestic Violence Intake Centers in D.C. (in N.W. at the courthouse, and in S.E. at United Medical Center) to increase access to our services and to provide critical same-day assistance to clients.\n\nWe also represent clients in custody and divorce matters, seeking to achieve just outcomes that improve the lives of families and children in poverty. And we represent clients in child support cases, where we strive to ensure fair and accurate child support orders  support that is often vital to a childs well-being. In 2011, we established an office at the D.C. Superior Courts Paternity and Child Support Branch to help custodial and non-custodial parents navigate the daunting child support system. We are able to help hundreds of individuals every year as a result.\n\nIn addition to providing direct client representation, we have continued to focus on our systemic efforts around these issue areas. Our domestic violence/family law attorneys actively participate in efforts to increase collaboration and improve services to domestic violence survivors, serving on many committees with other advocates in the District. We also strive to transform the operations of the child support court, as well as participate in meetings with other service agencies and stakeholders in the community to address emerging issues and trends.','956369396938800,956135951962872','https://www.legalaiddc.org/dvfamily-law/',NULL,NULL,'Verified','917725171609009','You can apply online or utilize walk-in intake hours. Call for more information.',NULL,NULL,NULL,NULL,'1289374770713295,1234325977097951','937440662643840',NULL,'1212718840001878,1292849277583603','965737501077000,1002479240399098',NULL,NULL,NULL),(469,951270390830894,'Senior Center','Labor of Love Human Service Center',877366768823409,'We provide a fun and interactive time for seniors to enjoy food and fellowship every Tuesday and Thursday from 10am  2pm.  Special guests and presenters provide resource information to participants.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','637158405241810','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','668533478103148',NULL,'1194535092428324,854808174954754','764105236981511',NULL,NULL,NULL),(470,955710918748274,'Health Services','Misler Center',855094084464049,'Staffed with RNs and geriatric aides, our health staff can take care of participants medical needs. Our nurses administer medications, monitor blood pressure, and provide overall nursing management of chronic medical conditions. Our geriatric aides assist with activities of daily living, helping with personal care related to ambulation and toileting.\n\nWith so much hands-on care, it is no wonder that the health staff are often the first to notice physical or cognitive changes in a participant. Regular communication with families and physicians assure that care needs are followed up on swiftly. In addition, nurses lead monthly interactive discussion groups with participants on a variety of health and nutrition topics.','694216969315685','https://accessjca.org/misler-center/',NULL,'Misler@AccessJCA.org','Verified','941516382466411','For more information, to arrange a visit, or to speak with one of our social workers, please call us at 301-468-1740, or use the contact form on our website to send an email inquiry.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1058170814905410',NULL,'1157835357284365,854808174954754,1032274526726429','999940717683001',NULL,NULL,NULL),(471,950454120432775,'Rental Assistance',NULL,919690199169575,'- Financial assistance (paid to landlord) is available with proof of eviction (once per 12-months).','987030255962297','http://www.ucmagency.org/stepping-stones-basic-needs.html',NULL,NULL,'Verified','878986697513222,1077790582995406,929094559121639','- Eviction notice is required\n- Proof of a crisis that prevented rent from being paid and eviction notice are required.\n\nCall for help or walk-in during office hours.',NULL,NULL,NULL,NULL,'927006793998791','717231166133554',NULL,'891092215548488,1245887354473260,1336431426596805','611571036444170',NULL,NULL,NULL),(472,958476585509237,'Food Pantry',NULL,1257820660406303,'A food pantry to those in need.','890450452640466',NULL,NULL,NULL,'Verified',NULL,'Offered the second and fourth Wednesday of the month at 12:00pm. Service is provided until food runs out as this is on a first come first served basis. Please bring bags and/or a cart to cary your food.',NULL,NULL,NULL,NULL,'588843626629723','1257681816817040',NULL,NULL,'760496420622178',NULL,NULL,NULL),(473,963890389048330,'Laundry Services - Women',NULL,801110030219864,'Offers a space to do laundry.','1220597047470925',NULL,NULL,NULL,'Verified','911225335803318','Sign ups for laundry are done on Fridays for the following week, on a first come-first served basis, with one alternate for each day.',NULL,NULL,NULL,NULL,'665113076769939','800336135953730',NULL,'836091364973509,877243931325915','962322435473993',NULL,NULL,NULL),(474,961034015650386,'Catholic Community Services Southeast Family Center',NULL,1185296657231877,'We are a multi-service center offering family support, foster care, independent living, substance abuse services, parent education, and financial assistance. We serve ward 8 residents and children who are wards of the District of Columbia.','1109469871110801','http://www.catholiccharitiesdc.org/sefc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'820809720654118',NULL,NULL,NULL),(475,963237379779513,'Batterer Intervention Program',NULL,1146223650874517,'A unique program that empowers men to hold each other accountable and overcome dangerous, destructive behavior\nThe Batterer Intervention Program (BIP)  Through a 24 week intensive program facilitated by licensed clinicians, MSP staff work with batterers,  providing a safe community place to learn about healthy relationships, how to become accountable for their own violent and abusive behavior, and how to replace violence and abuse with positive and healthy behaviors.  The program uses the Men Stopping Violence curriculum developed in Atlanta that integrates an ecological perspective by acknowledging systems of oppression and then empowering men to build communities that support men in achieving healthy relationships.  The goal of the BIP group is to provide participants with greater self-awareness to help them identify themselves as abusers, and to develop appropriate strategies to properly address aggressive behaviors.','828471643877342','https://mysistersplacedc.org/programs-services/',NULL,'info@mysistersplacedc.org','Verified','637158405241810,789038541797078','For more information, contact Toshira Monroe, Director of Programs, at 202-540-1056.',NULL,NULL,NULL,NULL,'614553051482053','584619367978739','1267681237969372','625195015492370,1129075972072847','795538631439658',NULL,NULL,NULL),(476,963779263900815,'Food Pantry',NULL,1323664977480953,'Our food pantry is available for our independent living housing facility youth and our community youth. Our pantry offers canned goods and non perishables that youth can take home over nights, weekends, and holidays.','1106602330344467','http://covenanthousedc.org/our-services/supportive-services/',NULL,NULL,'Verified','832990803111047','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(477,912991415461624,'Cardoza High School (DC Health Oversight) ',NULL,1043772486617212,'School-based Health Center ','802183159679728',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(478,931637209705712,'Infant Program',NULL,584105465886479,'This program meets the needs for diapers, formula, baby wipes, clothing and food for infants and toddlers.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318','Call or walk in to get supplies.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(479,931334254553785,'Food Pantry',NULL,653128415848094,'A food pantry for those in need. ','1112049443949860',NULL,NULL,NULL,'Verified',NULL,'Must get a referral through Thrive DC.',NULL,NULL,NULL,NULL,'932680541439060','998448826610226',NULL,NULL,'980961391787895',NULL,NULL,NULL),(480,928612911758060,'Alternatives to Landlord/Tenant Court Project',NULL,1093127605400642,' LCEs Alternatives to Landlord/Tenant Court Project (Alternatives Project) combines social work, legal and volunteer coordination to help prevent eviction of D.C. elders.\n\nLegal Assistance We Provide to Tenants and/or Tenant Associations\n- Eviction defense: if you received a Notice to Vacate and or a court summons from your landlord for issues like breach of lease or non-payment of rent, we can help you defend against eviction;\n- Rent control disputes: we help you get the correct rent level under rent control, by helping you file forms and filing, defending against, rent control related petitions;\n- Government subsidies: we help you prevent loss of your housing subsidy, including filing required paperwork for Section 8 vouchers, public housing and site-based subsidized housing;\n- Repairs: we advocate for your right to live in a safe, well-maintained apartment, and to a rent credit for enduring those conditions;\n- Reasonable accommodations: if you have a disability and need an accommodation to live in your apartment more comfortably, we can advocate for your apartment to better meet your needs;\n- Tenant Opportunity to Purchase Act: we work with tenants and tenants associations to help them exercise their right of first refusal of the purchase of their home, and to negotiate benefits in exchange for their right to purchase;\n- Outreach and Education: we are glad to speak with community members about tenants rights and the rights of elderly tenants;\nPolicy advocacy to improve community responsiveness to elderly tenants, enhance affordable housing creation and preservation resources, and ensure accommodations for elderly tenants.\n\nSocial Work and Volunteer Assistance\n- Assessment: of your full needs to ensure you are getting all of the services you need;\n- Referrals: for services like meals, housekeeping and money management;\n- Health care advocacy: we link tenants with medical service providers, home health care, and community social work referrals, for long-term health and case management;\n- Volunteer coordination for tenants at risk of eviction for issues related to housekeeping or having too many possessions in the unit, we engage volunteers where appropriate;\n- Counseling of clients who experience grief, loss and other mental health challenges to remaining housed.\n\nWe welcome referrals from community agencies, property managers and other community members, upon signs of eviction risks, like:\n- A lapse in payment of rent\n- Unpaid utilities\n- Housekeeping or hoarding concerns; and/or\n- Memory loss of the tenant that causes neglect of obligations that the tenant followed previously.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/alternatives-to-court.html?intcmp=AE-LCE-WWD-R1C1LL2',NULL,NULL,'Verified','917725171609009,929094559121639','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,NULL,'763163886168100',NULL,NULL,NULL),(481,936863331676390,'Phase I',NULL,1318451956583107,'Each resident goes through four phases of treatment. In Phase I, there is intensive detoxification treatment including:\n- Nutritional rebounding\n- Counseling\n- 12 Step recovery\n- Educational seminars and lectures\n- Art therapy\n- Yoga\n- Qi Gong and acupuncture','1147455525775238','http://cleanandsoberstreets.org/How_It_Works.html',NULL,NULL,'Verified','941516382466411,637158405241810','We accept referrals from the DC Department of Behavioral Health.',NULL,NULL,NULL,NULL,'883461165895110',NULL,NULL,'1244888069012632','711002699024806',NULL,NULL,NULL),(482,942882797339036,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): APRA: ASSESSMENT AND REFERRAL CENTER (ARC)',NULL,804221482345419,'Once an individual is medically and psychiatric cleared they can report to ARC for a comprehensive assessment. Based upon the assessment it will determine the level of care the individual is eligible for in Substance Use Disorder (SUD) treatment. The individual must be stable to participate in SUD treatment/rehab that is that the client should not be exhibiting psychiatric crisis such as violent behavior, hearing voices, inability to respond to voice commands. Also, the individual should be medically stable such as not exhibiting any respiratory , cardiovascular or injuries etc. that would prevent them from participating in SUD treatment. In addition, the individual should report to ARC with a 30 day medication supply, if applicable, in the event they are assessed for residential services the individual could be sent directly from ARC to residential treatment. If the individual is eligible for Detoxification (an average of 3 day stay), or if eligible for Outpatient (length of stay depends on progression in program) or Residential (an average of 28 day stay) treatment services. If residing in a shelter or supportive living, bring a letterhead supporting the residence at that facility.','638793416229400','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1299357181914721',NULL,NULL,NULL),(483,942712017441428,'RECOVER',NULL,769893937425938,'Our RECOVER Program at the Office of the Chief Medical Examiner enables Wendt Center clinicians to provide crisis response, emotional support, education and referral services to adults who must identify their deceased loved one. Our clinical staff continues to check in with families several weeks following the homicide to see how they are doing. This support is especially valuable to people suffering a homicide-related death. ','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,'shandel@wendtcenter.org','Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'1114888612682654','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(484,943841633351922,'Martha\'s Table Markets',NULL,1279230501938511,'Offers fresh produce and pantry items for purchase. All guests are welcome to shop once per month for fresh produce and pantry items at our no-cost weekday markets located in the lobby at both of our SE & NW locations.','947434898715713,1262159504249540','https://marthastable.org/health-wellness-programs/',NULL,NULL,'Verified','832990803111047','Guests can just show up to shop at no cost once a month only.',NULL,NULL,NULL,NULL,'1235881686916009','1149548494065862,1261160479251726,1322088797774961',NULL,NULL,'1273798320035626,873144110718631',NULL,NULL,NULL),(485,946643663102938,'Adult Substance Abuse Treatment',NULL,883186000200856,'Group and Individual Addiction Counseling','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(486,944036937200998,'Consumer Fraud and Financial Abuse Unit',NULL,1093127605400642,'With the twin goals of protecting clients homes and their sources of income, the Consumer Fraud and Financial Abuse Unit provides direct representation to LCE clients on a range of issues, including:\n- Foreclosure Defense;\n- Real Property Fraud;\n- Debt Collection Defense;\n- General Consumer Issues.\n- The unit also houses the Real Property Tax Project, which represents clients who are facing real property tax foreclosures.\n\nIn addition to providing direct services, the unit attorneys make an impact through systemic and policy advocacy. Our attorneys have been involved at the ground level in:\n- The creation of an early mediation program in mortgage foreclosure suits filed in court and a similar mediation program for non-judicial foreclosures;\n- The creation of a court-based legal services program to protect seniors from abusive debt collection suits;\n- Legislative and administrative advocacy on mortgage and condominium foreclosures, real property tax issues, and financial exploitation.\n\nLCE is a member of the DC TROV core multidisciplinary team, created to help D.C. first responders and advocates better respond to elder abuse victims. In 2015, DC TROV delivered an 8-hour training to more than 350 MPD Detectives as cross-training sessions with victim advocates, the aging network, Adult Protective Services staff, and others who may interact with at-risk seniors . The trainings included information about identifying forms of elder abuse and investigation techniques to promote the prosecution of elder abuse crimes and to enhance victim safety.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/consumer-fraud-financial-abuse.html?intcmp=AE-LCE-WWD-R1C1LL3',NULL,NULL,'Verified','917725171609009,1077790582995406','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,NULL,'763163886168100',NULL,NULL,NULL),(487,965489694318451,'Computer Lab Employment Assistance',NULL,801110030219864,'Every Tuesday and Thursday we reserve the computer lab to work with clients on employment. In the computer lab we offer help with writing resumes and cover letters, looking for job openings, and applying for jobs online.','1220597047470925','https://www.thrivedc.org/programs/computerlab/',NULL,NULL,'Verified','970915508638448','Sign ups are available for the Employment Assistance Workshops starting at 8:30 AM Tuesdays and Thursdays.',NULL,NULL,NULL,NULL,'665113076769939','1238589018393619',NULL,'877243931325915','962322435473993',NULL,NULL,NULL),(488,974562561948426,'Women Veterans Resource Center ',NULL,1013543362848937,'We assist women with identifying veteran benefits, access to computers and internet. ','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','637158405241810,789038541797078','Every Thursday from 8am - 4pm. Appointment is necessary. Call 240-997-0176 to sign-up.',NULL,NULL,NULL,NULL,'1273725796552539','625872062383437',NULL,'1260550501779199,836091364973509','1190125799561725',NULL,NULL,NULL),(489,977628518433061,'SOME: THEA BOWMAN HOUSE',NULL,887095601228098,'Provides two-years of savings and financial literacy training, as well as a life-skills program that helps to secure long-term housing. Families are also connected to SOME\'s other services, such as job training programs, group, and individual counseling.','1268338961312460','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1092516027457456',NULL,NULL,NULL),(490,977586749835410,'Employment',NULL,782302579547834,'This program is a wonderful and very successful initiative where an individual with intellectual and developmental disabilities is welcomed into a neighborhood business, trained by us in how to carry out the specific tasks required in the workplace, and monitored by us to ensure satisfaction for the individual as well as the employer.','814793229124367','https://arcdc.net/programs/employment/',NULL,NULL,'Verified','970915508638448','Call for services',NULL,NULL,NULL,NULL,'803054506073706','828558772845010',NULL,'891868766081123','844747715352778',NULL,NULL,NULL),(491,926396312659010,'Food Bank',NULL,935708179993271,'The Food Bank program is often the client\'s first introduction to our organization, whether it\'s through a referral from another agency or word of mouth spread from peers who have accessed our services in the past. Clients come in once a month to receive enough groceries to last up to 10 days (2 meals a day). This helps alleviate some of the financial burden clients struggle under trying to afford basic necessities like rent and food for their families on top of their medical bills and other expenses.','1295311939008541','http://www.damienministries.org/',NULL,NULL,'Verified','832990803111047','Call to apply.',NULL,NULL,NULL,NULL,'1174596952831378',NULL,NULL,NULL,'1010200482336643',NULL,NULL,NULL),(492,936572307607654,'FAMILY PLACE: EMERGENCY ASSISTANCE PROGRAM',NULL,1099027550013558,'Provides hospitality, resources, and support services to expectant parents and families with young children (through the age of five). Helps meet emergency needs, provides information and education and enhances long-term family stability','826027653390612','http://thefamilyplacedc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1204830512074068',NULL,NULL,NULL),(493,937906584225930,'Hunger Ministry',NULL,1085490883099798,'A food pantry. Every second and fourth Saturday of the month, National Baptist Memorial Church opens its doors at 9:00 am. to a steady flow of people coming to receive food from our food pantry.  ','1146981306227913','http://www.nbmchurchdc.org/ministries.html',NULL,NULL,'Verified','832990803111047','Visit the food pantry the 2nd and 4th Saturday of the month at 9:00AM to 11:00AM. Please bring an ID that proves you are a DC resident. Please also bring a bag to carry your food home. You can visit the food pantry twice a month.',NULL,NULL,NULL,NULL,'731593628942678','1027215361422768',NULL,'868012483124236,1173761108824771','1217909742971397',NULL,NULL,NULL),(494,939239658768708,'A Home of Your Own',NULL,623502983860633,'A Home of Your Own provides first-time buyers with an opportunity to become homeowners. We acquire foreclosed properties, renovate them using volunteer and skilled tradespeople, and sell the units to low- and moderate-income City of Alexandria residents and workers with greatly discounted and subsidized funding. Based on four recent acquisitions, buyers were able to decrease their housing costs by $350/month. In partnership with the City of Alexandrias Office of Housing, we have provided affordable homes for more than 25 families.','834887345290440','http://www.rebuildingtogetheralex.org/index.php/about-us/programs2019',NULL,'info@rebuildingtogetherdca.org','Verified','929094559121639','Call or apply online. Concerning eligibility, folks who are eligible are low income homeowners who cannot maintain their homes (typically elderly, persons with disabilities, veterans, and families with children), as are nonprofit facilities, schools, and public spaces that serve low-income residents. To be considered for home assistance, candidates must complete and submit an application form and provide documentation of total household income, such as tax forms or pay stubs. Some of our clients are referred through congregations, schools, community agencies and service groups, or by self-referral.',NULL,NULL,NULL,NULL,'1184206268036011','1272598751590026',NULL,'1009160981885425,753216819976855','1171518036331901',NULL,NULL,NULL),(495,936510517377927,'Child and Adolescent Anxiety Program (CAAP)',NULL,1061724977026001,NULL,'1282604214927911,856126341619748,979447652621070','https://childrensnational.org/departments/child-and-adolescent-anxiety-program-caap',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'978304346911390','892012398827551,1095419747725144,587218394770946',NULL,'1274396898894043','928813128095347,787442654546775,1067302604787333',NULL,NULL,NULL),(496,943023691666873,'Computer Tech Courses',NULL,605622028340987,'Byte Backs FREE training pathway can take you from any skill level to a living-wage career working with tech. Whether you need to start with using a mouse and typing or are ready to dive in to advanced IT topics, we have a class that can help you accomplish your goals!\n\nCourses start with foundational courses and then branch out into career specialties in IT or Administrative. ','865063089655254','https://byteback.org/classes-the-byte-back-pathway/',NULL,NULL,'Verified','789038541797078,970915508638448','Once youve found the class level that you think is right for you, simply fill out the interest form at the bottom of that page. When we have openings for that class, well send you an email with information about how to apply.\n\nThe application process differs based on class  find out more about application requirements under the Prerequisites section of the class youre interested in.\n\nStudents must meet all course requirements, including passing assessments and in-person interviews to enroll in Computer Foundations 2 and Professional Tracks.\n\nWe serve clients in the greater Washington, DC metro area and Baltimore.',NULL,NULL,NULL,NULL,'591752588532619','950208089897090',NULL,'866965462945330,1227957138475220,1224478530518610','1000698980135639',NULL,NULL,NULL),(497,936643241913847,'Attention Deficit and Hyperactivity Disorders Clinic',NULL,1061724977026001,'If you are concerned that your child may have Attention Deficit and Hyperactivity Disorder (ADHD), our experienced clinicians can confirm a diagnosis and counsel you on the latest and best treatments for your child.\n\nParents should recognize that although ADHD is a common childhood condition, symptoms vary greatly and accurately diagnosing the condition is complex. We factor your concerns and observations into a thorough medical and psychiatric evaluation, the first step in diagnosing ADHD.\n\nMany conditions share symptoms of ADHD and affect your childs behavior, such as sleep disorders, obsessive-compulsive disorders, and learning disabilities. When your child needs additional screenings to rule out another cause of behavioral issues, we coordinate referrals to the necessary specialists for further evaluation, including speech, hearing, and psychological testing.\n\nOur team is skilled in managing the diverse types of ADHD and associated learning disorders. We work with you to develop a care plan most appropriate for your childs particular needs.','1282604214927911','https://childrensnational.org/departments/attention-deficit-and-hyperactivity-disorders-clinic',NULL,NULL,NULL,'941516382466411','Please call us at 202-476-2118 to schedule an appointment or for more information. For urgent assistance outside of business hours, please call 202-476-5000. If you\'re the parent of a new patient, please fill out the Vanderbilt ADHD Questionnaire for Parents before your visit. There is also a Vanderbilt ADHD Questionnaire for Teachers that should be completed prior to your visit.\n\nThese questionnaires are available on our website.',NULL,NULL,NULL,NULL,'613224797190233','892012398827551',NULL,'1274396898894043','928813128095347',NULL,NULL,NULL),(498,946406110593174,'Progreso Center for Literacy & Citizenship',NULL,919690199169575,'The Progreso Center for Literacy and Citizenship empowers immigrants through education, citizenship services, and immigration assistance services. \n\nThe program seeks to increase the English-speaking skills of area residents. We provide English as a Second Language (ESL) classes for adult learners, as well as a path to U.S. citizenship.\n\nSemester-long classes for ESL Levels 1-5, as well as United States history, are taught by trained volunteer teachers in both daytime and evening sessions. English Conversation is held on a \"drop in\" basis at Good Shepherd Catholic Church and at the Sherwood Hall Public Library.','806538913069520','http://www.ucmagency.org/progreso-center-for-literacy--citizenship.html',NULL,'cristina.schoendorf@ucmagency.org','Verified','789038541797078,917725171609009','For more information -- including the schedule of classes -- call 703.799.8830 or email Center Director Cristina Schoendorf at cristina.schoendorf@ucmagency.org.',NULL,NULL,NULL,NULL,'1107310655120205','1142549507368182,865906886892733','659108624341793','1340162113833071,656944907385650','1147744635877386',NULL,NULL,NULL),(499,951768857764331,'Program for Health Problems Related to Bullying',NULL,1061724977026001,'Bullying happens when a child is purposely mistreated by another person or by a group. This abuse can be physical, verbal or emotional. It can have devastating effects on the child. In some cases children who are bullied try to commit suicide.\n\nWhile bullying can happen at any age, its more likely to occur among school children. Both those who are bullied and those who bully others can have serious health problems as a result.\n\nThe Program for Health Problems Related to Bullying at Childrens National Health System offers professional evaluation and treatment for children and teens affected physically or mentally by bullying.\n\nWe are passionately committed to improving the lives of these children. In addition, were dedicated to prevention and we work hard in the community to inform the public about bullying and the health risks it causes.\n\nWhy Choose Us\nFeatures of the Program for Health Problems Related to Bullying at Childrens National include:\n\nExperienced Specialists. Childrens National Health System is the largest provider of pediatric care in the Washington, D.C., area. As part of that system, our team treats the effects of bullying every day. We consider your childs individual situation and provide expertise from our teams years of experience of specialists in the needed areas of care.\nSafe space. Our pediatric specialists are experts at talking with children, teens and their families. Our team creates a safe space for you and your child to speak freely about bullying to help get to the root of the problem and work together to find a solution.\nCommitment to Advocacy. We advocate for research-based programs to prevent bullying. To be effective, these programs should involve students, teachers, parents and the community. Program Medical Director Jorge C. Srabstein, M.D., has testified on Capitol Hill about the connection between bullying and public health problems in our society.\nServices We Offer\nIf you think your child may be troubled by bullying, our program can help. Your first visit will include a thorough evaluation to find out how bullying has affected your child.\n\nBased on this evaluation, treatment will be designed specifically for your child and family. It may include:\n\nIndividual therapy\nFamily therapy\nGroup therapy\nMedication, if appropriate\nHealth Effects of Bullying\nYoung people who are bullied, and also those who bully, are at risk for a wide range of health and safety hazards. Our program is designed to address the physical concerns as well as the psychological effects caused by bullying. Children or teens who are bullied may:\n\nFeel depressed or sad\nBe angry or irritable\nWorry or feel anxious or fearful\nHave trouble falling asleep or staying asleep\nHave frequent headaches, stomachaches, dizziness, or other physical symptoms\nBe injured by physical forms of bullying such as being slapped, kicked, pushed, or another action\nBullying can lead to unhealthy behaviors such as:\n\nSmoking\nAbusing alcohol and/or drugs\nMissing school and neglecting schoolwork\nGetting into fights\nRunning away from home\nCarrying a weapon to school\nSelf-injuries, such as cutting\nAttempting to commit suicide','856126341619748','https://childrensnational.org/departments/bullying-related-health-risks',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'662385092304093','587218394770946',NULL,'1274396898894043','787442654546775',NULL,NULL,NULL),(500,956342437760431,'Healing, Recovering, and Empowering Together','HEART',802521051916688,'The Healing, Recovering, and Empowering Together (HEART) program is an innovative 5-year project funded by SAMHSA, to grow their National Child Traumatic Stress Initiative. HEARTs ambitious mission is to improve early access to integrated high-quality behavioral health and trauma specific treatment for children, youth, and their families. The goal of the program is to disrupt the transmission of intergenerational trauma. Family peers and clinicians will develop and implement creative strategies to provide coordinated services that will allow for integrated child and adult services. HEART will utilize Community-Based Intervention and Family Team Meetings, with trauma-specific evidence based practices offerings: Trauma Focused Cognitive Behavioral Therapy for 1:1 child-specific recovery work, Strengthening Families Coping Resources for multi-family group recovery work, and Trauma Recovery and Empowerment for adult womens recovery work.','1130006642102532','http://www.communityconnectionsdc.org/our-services/families-children',NULL,NULL,NULL,'637158405241810,941516382466411','If you are interested in receiving services at The Center for Families and Children or have questions about our services, please come to an Information Session.\n\n\n\nYou can sign up for our next session by visiting our calendar. Your child does not need to attend the Information Session.\n\nCalendar: http://www.communityconnectionsdc.org/events/?view=calendar',NULL,NULL,NULL,NULL,'1186529718830668',NULL,NULL,NULL,'603553623654573',NULL,NULL,NULL),(501,967263158004203,'Women\'s Ministry',NULL,1007623446966696,'Our women are breast cancer survivors, business owners, attorneys, college professors, veterans, mothers, daughters, and prayer warriors.  They understand the challenges women face as wives, single mothers, caretakers, and Christians.  Our goal is to develop spiritually fit women who can share Gods Word and their personal life experiences (the good, the bad, and the ugly) with others who are seeking knowledge and relief','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','637158405241810','Call or visit us during our church services.',NULL,NULL,NULL,NULL,'755149488867036',NULL,NULL,'836091364973509','1088461256923134',NULL,NULL,NULL),(502,970377297500925,'Workshops and Groups',NULL,970560028876577,'JSSA offers a variety of workshops and groups for individuals struggling with social, emotional, and physical challenges. These program include life skills workshops, social skills groups, social clubs, and bereavement support groups.  Workshops & Groups are available in Maryland and Northern Virginia.','1104646684650585,1321118518935089,977589590864235','https://www.jssa.org/get-help/workshops-and-groups/',NULL,NULL,'Verified','637158405241810','Group details and schedules can be found on the website.\n\nTo receive information about updates or additions to our workshop and group offerings, subscribe to the newsletter.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777,799390782148011,823008542949204,790762956605328',NULL,NULL,'1328302797893590,1218692669680880,863218507660277',NULL,NULL,NULL),(503,971394967118666,'Foster Care and Adoption Services ',NULL,876151548923517,NULL,NULL,'https://www.nccf-cares.org/foster-care-and-adoption-services/',NULL,'fostercareinfo@nccf-cares.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(504,972989260139901,'Immersion Service Learning Program',NULL,1187372282686349,'As a service provider in the Ignatian tradition, one of the most important things we do is facilitate encounters between brothers and sisters in Christ. Each year we welcome young people from colleges, schools, parishes, and other programs who not only serve as volunteers, but also live at The Father McKenna Center for a week at a time. This program is often an Alternative Spring Break or an Outreach Program for students who come to the Center on Saturday or Sunday, and stay through the following weekend.\n\nOur volunteers are not bystanders, rather they eat their meals in common with the men we serve, work in the Center, and support all aspects of our program. They sleep in the program area in the former church basement (often on pews or air mattresses they bring), take time to reflect on their experiences of service, and often have supplementary learning experiences at other organizations that support people experiencing homelessness (e.g. The Washington Legal Clinic for the Homeless). The week of service frequently culminates in a day of advocacy as our visitors meet with their representatives or staff in the US Congress  just steps away from The Father McKenna Center.\n\nWe believe the experience of immersive service plays a vital role in breaking down societal barriers, teaches about individuals as well as issues, and equips our young visitors with tools for compassionate engagement as they return to their own communities.\n\nAs one of our visitors from The University of Notre Dame observed, When I arrived, the homeless were a demographic. Now, they are people. A brother or a sister to me.','1209121324412172','https://fathermckennacenter.org/what-we-do/immersion-service-learning-program/',NULL,'info@fathermckennacenter.org','Verified','789038541797078','Call for more information.',NULL,NULL,NULL,NULL,'1123859846194392',NULL,NULL,'883345659611536','645829762063748',NULL,NULL,NULL),(505,978590256683513,'Permanent Supportive Housing',NULL,791950857737387,'Friendship Places PSH programs are designed to empower people with serious mental health challenges, addictions, physical illnesses and/or disabilities to transition into housing and rebuild their lives. Year after year, our Permanent Supportive Housing programs achieve housing stability rates of better than 99 percent','931886810745529','https://friendshipplace.org/programs-outreach/housing/',NULL,NULL,'Verified','929094559121639','You must be referred directly from the Department of Human Services (DHS), through DCs Coordinated Entry System.\n\nTuesday is by appointment only.',NULL,NULL,NULL,NULL,'1235107925689722','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'1244888069012632,877243931325915','1152494666421051',NULL,NULL,NULL),(506,988930242117816,'Re-entry Program','New Direction',801110030219864,'Men and women are released every day from jails and prisons without food, clothing, or support.\n\nThrive DC provides all of this without restrictions on sobriety, without time limits, and without judgment over their conviction.\n\nThe New Directions Re-entry Program is designed to assist people who have been recently incarcerated and/or released from jail or prison, back on the road to becoming successful returning citizens.\n\nIt consists of five components:\n\nCase Management\nBasic Needs Assistance (meals, toiletries, clothing, etc)\nLife Skills Education\nAccess to Sobriety Maintenance Assistance and Support\nEmployment Assistance\nProgram Benefits\nParticipating in New Directions receive the following benefits:\n\nTransportation Assistance\nSmall Stipend\nAccess to One of Two Training Programs:\nCustomer Service Training And Certification, or\nReal Opportunity Job Training\nLife Skills Education\nOur re-entry curriculum focuses on maintaining and developing life skills, getting back to work, and re-integrating with your family and community. Groups are interactive and include goal setting, listening and communication skills, healthy relationships, and sustaining the change.\n\nMy father notices a different in me when I come back from meeting with you at Thrive DC.\n\nEmployment Support and Job Search Workshops for Returning Citizens\nWorkshops focus on job readiness as well as job search techniques. Participants will also be required to complete a resume and perform mock interviews.','1220597047470925','https://www.thrivedc.org/programs/newdirections/',NULL,'kimberly@thrivedc.org','Verified','637158405241810,911225335803318,789038541797078,970915508638448,929094559121639','For more information or to join New Directions, please contact Kimberly Gray at (202) 503-1531 or kimberly@thrivedc.org.',NULL,NULL,NULL,NULL,'616629263137129,665113076769939','818646560557978','998802888046811','877243931325915,664148755918958','962322435473993',NULL,NULL,NULL),(507,986036993747047,'PEPCO - SOUTHEAST SERVICE CENTER',NULL,973679790071307,'Provides Pepco services.','692231605294536','http://www.ddoe.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1205767697739732',NULL,NULL,NULL),(508,990274038416855,'Unity at Pathways to Housing Health Center ',NULL,1043772486617212,'Healthcare for homeless ','975869217753458',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(509,932258895912915,'DC Care Consortium',NULL,806677477926389,'The mission of DC Care is to provide support to PLWHA (People Living with HIV/AIDS) and their families and collaborate with service providers to enhance the delivery and quality of HIV/AIDS services in Washington, DC. DC Care supports PLWHA and their families through emergency financial assistance, training programs, and by supporting the HIV/AIDS service delivery workforce. Our goal is to improve health outcomes by supporting the dedicated individuals and systems that serve the estimated 16,513 people known to be living with HIV/AIDS in Washington, DC.','867684167756788','www.dccare.org',NULL,NULL,'Inactive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'780785826421817','981030603936813',NULL,NULL,NULL),(510,948956237360164,'Energy Assistance Program',NULL,840733417398800,'Life can sometimes throw unexpected challenges your way making it hard to keep up with the bills. Thanks to a grant from Pepco Holdings Inc. Community Foundation, our Energy Assistance Program allows us to help you pay a portion of your households heating and electric bill. To participate in the one-time emergency program, you must: \n\nBe a resident of Prince Georges County, Maryland \nBe unable to pay your utility bill because of documented financial hardship \nBe at risk of disconnection from your gas or electric service \nHave an annual household income (before taxes) belowthe federal poverty level. \nPlease remember this program is meant to help you pay a portion of your households heating/electric bill, not the entire annual cost of heating your home. \n','964869638930274,629348329513757','https://www.maryscenter.org/social-services/referrals-and-resources/energy-assistance-program/',NULL,NULL,NULL,'637158405241810','To be considered for the Energy Assistance Program, you must call (202) 545-2024 to schedule an appointment. Appointments are held on Wednesdays at 2355 Ontario Road, NW Washington, DC 20009 and Fridays at 8908 Riggs Road, Adelphi, Maryland 20783 and last approximately 30 minutes. \n\nApplications are only accepted in person and by appointment. Mailed, faxed, or e-mailed paperwork WILL NOT be accepted. Applications will NOT be processed unless ALL information is provided. Incomplete applications will result in delay or denial. Please bring the documents listed below to your scheduled appointment. \n\nRequired Documents \nPhoto ID of applicant\nProof of Identification for ALL members of your household (e.g.  social security card, birth certificate, drivers license,orpassport)\nProof of Residency (e.g.  copy of mortgage, lease, or rental agreement) \nGas/Electric Bill; Disconnection Notice (if applicable)\nProof of Income for the ENTIRE Household (e.g.  employmentpaystubs, social security income, food stamps, unemployment, child support, disability, retirement, veterans benefits, survivors benefits, etc.) \nProof of Hardship or Inability to Pay (e.g. employment termination letter, unemployment claim, medical bills, proof of loss of other income, OR budget showing insufficient funds)\nLetter explaining your emergency situation ',NULL,NULL,NULL,NULL,'1129515195690409','1134877289644712,827996522503929,601427652072887',NULL,'565669778208779,1173761108824771,1274524177531453,1235391485627514,753216819976855,1081177323974279','962742212670581,732086812000340',NULL,NULL,NULL),(511,953130575650955,'Nutritional Counseling',NULL,964008795352849,'Nutrition services at RAP promote a holistic approach to diet, nutrition, and health. Our program\nTeaches the fundamentals of nutrition aimed at promoting good health\n\nEncourages a diet rich in whole grains, fruits and vegetables with poultry, fish, and eggs\n\nProvides individual and group nutrition counseling\n\nProvides training in areas of Food Safety, Sanitation and Personal Hygiene to ensure the safe handling of foods\n\nDemonstrates of the role of food consumption in the healing process','803526594539754','http://www.rapinc.org/nutritional.html',NULL,NULL,'Verified','941516382466411,637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'664148755918958,780785826421817,915486946336080','601647045974328',NULL,NULL,NULL),(512,955750891211425,'Senior Outreach Program',NULL,584105465886479,'This program meets the needs of our senior population by addressing the challenges of making sure they have food and personal care items in their homes.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','637158405241810,911225335803318','Call for more information.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(513,961164325265072,'The Well Clothing Closet',NULL,1085490883099798,'A clothing closet where you can come and take clothes that you need.','1146981306227913','http://www.nbmchurchdc.org/ministries.html',NULL,NULL,'Verified','911225335803318','Visit the clothing closet the 2nd and 4th Saturday of the month at 9:00AM to 11:00AM. Please bring an ID that proves you are a DC resident. Please also bring a bag to carry your clothing home. You can visit the clothing closet twice a month.',NULL,NULL,NULL,NULL,'731593628942678','1027215361422768',NULL,'868012483124236,1173761108824771','1217909742971397',NULL,NULL,NULL),(514,983621321487069,'HOUSE OF RUTH: KIDSPACE CHILD AND FAMILY DEVELOPMENT CENTER',NULL,1196862576129712,'Provides child-care and developmental services for children. Case management is also provided for parents.','1118428224846105','http://houseofruth.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1123054317753711',NULL,NULL,NULL),(515,985012947614539,'Supportive Residence Program',NULL,1326157862705937,'What is MBI Supportive Residence Program?\n\nMBI Supportive Residence Program (SR) is designed to support DBH consumers who have already been approve  housing by DBH and needs 24/7 monitoring and supervising care.\n\nWhat Should I Expect?\n\nWe Support our residents in future planning services, we provide not only a place to live but also the best quality of life through behavioral support.\nEnsure that the home is in compliance with DBH housing standards\nAct as another resource between the consumer and core agency. \nShare information with  the CSWs and Program Administration to ensure that the consumer is receiving the best level of care and services\nAssist with training and skill building (ADL) skills with consumer. MBI provide three meals and two snack a day, laundry, internet and services, \nAdvocate on behalf of the consumer (when appropriate) to ensure that their needs are being met.\nEnsure participation in Treatment team meeting on regular basis to meet the consumers new goals and/ changing needs\n','959978038980815','http://www.mbihs.com/what-we-offer/housing-programs',NULL,NULL,'Verified','929094559121639','Am I Eligible?\n\nAll of consumers approve by DBH that are currently in need of  housing.\n\n \n\nHow Do I Enroll?\n\nUpon approval from DBH, contact your CSW/CORE AGENCY\n\nThe advantage of this program is our consumer will have the opportunity to move forward to an independent living housing were as to become independent in the future.',NULL,NULL,NULL,NULL,'1215372861989264,960509036831710',NULL,'1071434095608880',NULL,'817410769508748',NULL,NULL,NULL),(516,985593774651159,'Contemporary Family Services',NULL,1262229839027778,'Offers tutoring, mentoring, and family support services.','1191156779628062,871972134291589,968786376614445','https://contemporaryservices.net/programs-and-services/',NULL,NULL,'Verified',NULL,'Walk in for services.',NULL,NULL,NULL,NULL,'686902171451083',NULL,NULL,NULL,'1240535751990184,1104690815663262,594681114588627',NULL,NULL,NULL),(517,989188268576682,'TANF',NULL,1262229839027778,'The TANF program, which is time limited, assists families with children when the parents or other responsible relatives cannot provide for the family\'s basic needs. The Federal government provides grants to States to run the TANF program. These State TANF programs are designed to accomplish four goals:\n\nto provide assistance to needy families so that children may be cared for in their own homes or in the homes of relatives;\nto end the dependency of needy parents on government benefits by promoting job preparation, work, and marriage;\nto prevent and reduce the incidence of out-of-wedlock pregnancies and establish annual numerical goals for preventing and reducing the incidence of these pregnancies; and\nto encourage the formation and maintenance of two-parent families.\n\nContemporary Family Services, also offers job placement assistance and educational occupational training.','1191156779628062,871972134291589,968786376614445,945061241324147','http://contemporaryservices.net/',NULL,NULL,'Verified',NULL,'Call for more information. To be eligible for TANF in DC, you must be:\n- A resident of the District of Columbia\n- Either pregnant or responsible for a child under 19 years of age\n- A US national, citizen, legal alien, or permanent resident\n- Have low or very low income, and\n- Be either under-employed (working for very low wages),\n  unemployed or about to become unemployed.',NULL,NULL,NULL,NULL,'686902171451083',NULL,NULL,NULL,'1240535751990184,1104690815663262,594681114588627,1156542764196212',NULL,NULL,NULL),(518,994497447759686,'Violence Prevention & Intervention',NULL,948113581207578,'CSC Provides violence intervention services in Wards 1 to 5. Program activities/services include: community outreach, community engagement, violence interception and interruption, case management, Critical Incident Protocols, partner engagement, peacemaking retreats, and school-based educational and enrichment services. Critical Incident Meetings are held within 24 hours of a homicide or serious incident in Wards 1 to 5. Community-based Cool Down activities are held to help communities heal from violence and build collective efficacy.','911858349594317','https://www.wearecsc.org/violence-prevention',NULL,'info@wearecsc.org','Verified','637158405241810','Call for more information. These sessions occur when an incident occurs.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,NULL,'921919612082211',NULL,NULL,NULL),(519,990367220887588,'Youth Development',NULL,805167768269068,'For more than 50 years, Family Matters owned and operated Camp Moss Hollow, affectionately called The Hollow, located on 401 acres of incredibly beautiful woods, nestled in the foothills of the Shenandoah Valley in Markham, Virginia. This year, weve revamped our popular camp program to one that sends youths, enrolled in our mental and behavioral health program who match certain inclusion criteria, to other recognized camps located throughout Maryland and Virginia. Our goal is to provide therapeutic experiences that promote positive behavioral, emotional and social changes in the youths lives. This youth development program is specially designed to enhance educational achievement, expand horizons and increase self-worth and self-esteem for at-risk youth.','741750394643085','https://familymattersdc.org/services/',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'1148220140221272','621588457199048',NULL,'883345659611536','862131546718091',NULL,NULL,NULL),(520,998823719958227,'So Others Might Eat (SOME) - Medical Clinic',NULL,775874603891849,'SOME (So Others Might Eat) is an interfaith, community-based organization that exists to help the poor and homeless of our nation\'s capital. SOME will meet the immediate daily needs of the people we serve with food, clothing, and health care. SOME also helps break the cycle of homelessness by offering services, such as affordable housing, job training, addiction treatment, and counseling, to the poor, the elderly and individuals with mental illness. Each day, SOME is restoring hope and dignity one person at a time.\nSOME offers a comprehensive network of healthcare. The clinic is located at 60 \'O\' Street, NW, and is open Monday - Friday, 8:00 am - 4:00 pm. Patients are accepted on a walk-in and appointment basis. SOME\'s Health Services includes a comprehensive Medical Clinic, an Eye Clinic and a Dental Clinic.\n\nMEDICAL CLINIC The Medical Clinic offers a full range of services including primary care, podiatry services, lab work and treatment for diabetics. The Medical Clinic treats an average of 26 patients each day.\nThe Eye Clinic is one of the only free eye clinics in the city and treats approximately 30 patients each month. SOME\'s part-time ophthalmologist treats those suffering from diabetes, glaucoma, AIDS, and eye injuries, and conducts general eye exams.\n\nDENTAL CLINIC The Dental Clinic provides both emergency and comprehensive oral care to patients, including prevention, basic care, restorations, root canals, extractions and removable prostheses (dentures). We are open five days per week.\nTo be eligible for dental care in the SOME Dental Clinic, a patient must be homeless in the District and/or low-income and living in the immediate neighborhood of our clinic. In addition to scheduled appointments, the Dental Clinic provides emergency care to the first four walk-in clients Monday - Friday.','903707682119815','http://www.some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'962036505121926',NULL,NULL,NULL),(521,998912206496705,'Legal Tools',NULL,744812603775568,'Quality Trusts Legal Advocacy team works with people to help them get the supports and services they need to live full and meaningful lives in the places and ways they choose.  Our works includes:\n\nHelping people in cases seeking eligibility and access to Vocational Rehabilitation Special Education, alternatives to guardianship, Developmental Disabilities Administration services, Social Security, Medicaid, and end-of-life planning.\nAdvocating for changes to laws, regulations, policies and practices to make sure they respect and protect the rights of people with disabilities. \nProviding education, training and support on topics including education, employment, public benefits, finances, guardianship and alternative decision-making support and end-of-life planning.\nWorking with Quality Trusts Jenny Hatch Justice Project, a legal, policy and research center dedicated to protect the right of people with disabilities to make their own decisions, as free as possible from any restriction or limitation of these individual rights as citizens. \nOur work has been covered by the Washington Post, CBS News, People Magazine, the Huffington Post, MSNBC and numerous other outlets.','1185969381076176','https://www.dcqualitytrust.org/families/legal-tools/',NULL,'mwhitlatch@dcqualitytrust.org','Verified','917725171609009','Call to access services.',NULL,NULL,NULL,NULL,'843667294628283','655204523101840','1297081719996609','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(522,1001097186191124,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(523,956658240049666,'Public Benefits & General Services Unit',NULL,1093127605400642,'The Public Benefits and General Services Unit (PBGS) ensures that seniors receive the income, benefits, and services to which they are entitled that enable them to live independently in the community.  The PBGS staff represents clients in cases involving public benefits and income maintenance issues.\n\nPBGS staff assist clients whose benefits or services have been threatened with termination, terminated, decreased or overpaid through representation at all stages of the appeal process including personal conferences, requests for reconsideration, and fair hearings before the Office of Administrative Hearings. \n\nOur Services\nThe PBGS staff represents clients in cases involving public benefits and income maintenance issues. Such cases include, but are not limited to:\n\n- Social Security Administration (SSA)\nInitial applications and appeals: Social Security Retirement, Supplemental Security Income (SSI), Social Security Disability, Overpayments\n- Department of Human Services (DHS), Economic Security Administration (ESA), Department of Health Care Finance (DHCF): Medicaid, Medicare, Qualified Medicare Beneficiary (QMB)\nHome Health Care Services such as Personal Care Aide (PCA) services, Elderly and Persons with Physical Disabilities  (EPD) Waiver, Supplemental Nutrition Assistance Program (SNAP) benefits (formerly food stamps), Other Retirement Benefits (Federal, Private, and other.\n- Department of Veteran Affairs (VA) Benefits (specific areas only): Non Service Connected VA Pension Claims, Aid & Attendance, Rating Claims for VA Pension Eligible Veterans, Service Connected, Disability Compensation Claims for Presumed Conditions, Enrollment in E-Benefits Portal, Overpayments\n\nPublic Benefits Checkup\nPBGS staff also assists clients in determining what public benefits and services they are entitled to receive by conducting Public Benefits Checkups and assisting clients in applying for those identified benefits and services.\n\nOther Services\nSmall consumer cases (such as public utilities, hearing aids, credit card debt, banking problems, student loans)\nCollection cases\nOther general cases that do not fall squarely within other specific LCE programs','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/public-benefits-general-services-unit.html?intcmp=AE-LCE-WWD-R1C1LL7',NULL,NULL,'Verified','917725171609009,637158405241810','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,'854808174954754','763163886168100',NULL,NULL,NULL),(524,961738059568521,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): COMPREHENSIVE PSYCHIATRIC EMERGENCY PROGRAM/HOMELESS OUTREACH PROGRAM',NULL,593530875968066,'The Homeless Outreach Program (HOP) provides a variety of services and supports adults and families who are homeless. Its primary purpose is to provide outreach to homeless individuals and families with needed mental health services. HOP also provides consultation and training to the provider network most closely involved with the homeless population.','1109839475209474','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'538706638880734',NULL,NULL,NULL),(525,960051770169079,'Emergency Food Pantry',NULL,643565902574203,'We offer an emergency food pantry to those in need every other Tuesday from 10:00AM to 12:00PM. ','579382634687033','http://www.firstrising.org/community-outreach/helping-hands.html',NULL,NULL,'Verified','832990803111047','Those who live in the neighborhood (7-12th St NW) do not need a referral. Others may need a referral and must meet eligibility requirements for receiving food. Proof of income and ID is required.',NULL,NULL,NULL,NULL,'1249359518761001','977558904020139',NULL,'1173761108824771,753216819976855','768490071786905',NULL,NULL,NULL),(526,968057316664450,'Phase II',NULL,1318451956583107,'Each resident goes through four phases of treatment. In Phase 2, there is continued focus on counseling and group therapy with an emphasis on identity, spirituality, and sociability. \n\nThis includes:\n- A running program\n- GED courses\n- Computer literacy and software (partnered with Byte Back)\n- Job training guidance\n- Art therapy\n- Physical fitness and gym\n- Arts workshops','1147455525775238','http://cleanandsoberstreets.org/How_It_Works.html',NULL,NULL,'Verified','941516382466411,637158405241810,789038541797078','You must have been admitted and gone through the previous phase of this four phase program. We accept referrals from the DC Department of Behavioral Health.',NULL,NULL,NULL,NULL,'883461165895110',NULL,NULL,'1244888069012632','711002699024806',NULL,NULL,NULL),(527,964209508718168,'ST. STEPHEN AND THE INCARNATION CHURCH: LOAVES AND FISHES',NULL,865229863994763,'Provides a free, hot, mid-day meal to anyone who is hungry on Saturday, Sunday and federal holidays. Additionally, guests can receive assistance in signing up for Food Stamps, and referrals for job counseling and medical care.','1045140628063947','http://saintstephensdc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'962322435473993',NULL,NULL,NULL),(528,971066029264975,'Celebrate Recovery',NULL,1228099889682852,'Celebrate Recovery is a Christ-centered, 12 step recovery program for anyone struggling with hurt, pain or addiction of any kind.\n\nCelebrate Recovery is a safe place to find community and freedom from the issues that are controlling our life. A biblical and balanced program that helps us overcome our hurts, hang-ups, and habits.','904892331647550','http://cityofpraisechurch.com/community/',NULL,NULL,'Verified','637158405241810','Walk in.',NULL,NULL,NULL,NULL,'600625677788643','747215045766739',NULL,NULL,'818242711886355',NULL,NULL,NULL),(529,968013894798831,'The Road Home',NULL,883186000200856,'Hillcrest Center operates a Short Term Family Housing site located at the W. J. Rolark Building in support of Mayor Muriel Bowsers initiative to end homelessness.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','929094559121639','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(530,969095511875672,'Pediatrics',NULL,840733417398800,'Marys Center knows strong and healthy kids make for strong and happy families! Our goal is to help prevent sickness and injury while fostering your childs optimal growth and development. Marys Centers kind, family-focused pediatric providers are here to address your childs medical, dental, and behavioral health needs (ages 0-21). Our pediatrics services include:   \n\nInfants and Children (Newborns to age 11): \nEarly childhood behavioral health services \nFirst dental care visits \nImmunizations \nNewborns first-days check-ups \nAdolescents and Teens (ages 12 through 21):  \nComprehensive behavioral health services \nCare for acute, chronic, and complex conditions like asthma and diabetes \nDental care and referrals to orthodontists if needed  \nPhysicals (school, sport, camp, and pre-operative) \nObstetrics and gynecological (OB/GYN) care  \nSexual health services including prevention, testing, and treatment \nWe also invite you to enjoy access to our:  \n24/7 medical on-call line  \nEvening and Saturday clinic hours  \nPediatric provider meet-and-greets \nPharmacy with free delivery  \nSame-day sick visits ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/children-and-teens/pediatrics/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,'1274396898894043,883345659611536','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(531,978169761735866,'Transitional Housing',NULL,1323664977480953,'Rights of Passage I, II, III  CHWs long-term transitional housing program, this program is geared for youth 19-24 who are actively engaging in activities to get their lives back on track such as post-secondary education, employment, or GED prep in CHW Career Pathways program. During their stay, youth will engage in household management courses such as financial literacy, food wellness, and organization.\n\nWhen our young people graduate from ROP, they leave with the complete understanding of household management, and what it means to be an active member of the community\n\nTheyve received the education and training they need to be productive and self-sustaining citizens and have their own plan for permanent housing. Theyve learned how to take care of themselves and are ready to move on  without ever returning to the streets.','1106602330344467','http://covenanthousedc.org/our-services/housing/',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'1222973168897685','899989255714132',NULL,NULL,NULL),(532,980808579975931,'Medical Care',NULL,791950857737387,'What could be more fundamental to someones peace of mind than knowing that they can see a doctor when theyre sick?\n\nOur Drop-In Clinic provides medical care to everyone in need through a partnership with Unity Health Care. Theres no red tape and no appointments are necessary. Individuals in need can simply walk in and see a doctor or nurse. Our goal is to provide the needed medical care quickly, and with the sole goal of helping the individual. If treatment can not be completed at the clinic, our doctors will try to find a specialist to provide pro bono (free) care.',NULL,'https://friendshipplace.org/programs-outreach/drop-in-clinic/',NULL,NULL,'Verified','941516382466411','The Welcome Center is located at 4713 Wisconsin Ave NW, Washington, DC 20016, between the TenleyTown and Friendship Heights Metro Stations. To visit, take the following busses: 30N, 30S, 31, 33 and N2.\n\nAnyone in need of assistance is welcome to come to the Drop-In Clinic and Center.\n\n',NULL,NULL,NULL,NULL,NULL,'1075131025312672,822138509409088,795731873911297',NULL,'877243931325915',NULL,NULL,NULL,NULL),(533,984528775573917,'Health Homes',NULL,802521051916688,'Health Homes is an integrated model of care addressing an individuals behavioral and physical health needs. The Health Home team includes nurse care managers, a primary care liaison, and care coordinators who work together to meet each clients\' physical and mental health needs, as well as psychosocial goals. The teams work with a individual and their network, including family members and medical providers, to help clients improve self management of chronic illness and promote total wellness. Comprehensive Care Management, Care Coordination, Transitional Care, Health Promotion, Individual/Family support, and Accessing Resources via referrals are the six services that comprise the Health Home service delivery model.','1044869288351593','http://www.communityconnectionsdc.org/our-services/integrated-care',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(534,995363917586083,'Behavioral & Mental Health',NULL,605134586578120,'		Stress Management\n		Health Communication\n		Conflict/Anger Management\n		Trauma\n		Substance Abuse Disorder\n		Depression\n		Anxiety\n		Bipolar Disorder\n		Discussion Groups','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,NULL,'651804021834110,1128987918758522',NULL,NULL,NULL),(535,1003092169948483,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(536,1007199538654431,'Heart & Soul',NULL,640186123610411,'Washington Parks & Peoples Heart & Soul program aims to educate people about the benefits of healthy living habits for ourselves and our environment. We promote city-wide park-based health and learning through:\n\n- Jazzercise, African dance, and other dance and movement programs\n- Community Health Walks\n- Healthy Living cooking and Eat Smart nutrition classes\n- Bike repair, bike rides, and trail patrol\n- Girls on the Run, Family Fun Fridays, Sports Saturdays, and other youth athletics\n- and a wide range of programs to enliven the park as a hub of healthy physical activity and wellness.','1052806219928789,1133664511724903','https://washingtonparks.net/programs/heart-soul/',NULL,NULL,'Verified','941516382466411,789038541797078,832990803111047','Visit website for calendar of events.',NULL,NULL,NULL,NULL,'1126250650450819,1198829430756347','1186410017519358,976209607538308',NULL,NULL,'1108569071838139,906270690131919',NULL,NULL,NULL),(537,948283799474714,'Youth Connect',NULL,791950857737387,'Our Youth Connect Case Managers provide street outreach engagement services to 18-to-24 year olds who are runaways, homeless, or at-risk. The program functions as a mobile drop-in center. Our specialists canvas areas in across the District of Columbia looking for young adults aged 17-24 in need of help. Specialists conduct on the spot housing assessments, and help youth get the vital documents (Social Security cards, ID cards, and other items) needed to access a host of services ranging from Food Stamps and Medicaid to substance abuse treatment programs to housing. They can also conduct on-the spot-housing assessments and accompany the young person to various aid agencies to help them navigate the regions public services system. If help is declined, Friendship Place Youth Specialists can help ensure an individuals comfort and safety by offering a survival kit with bottled water, blankets, safe-sex kits, hygiene products, SmarTrip cards, and information about hypothermia or hyperthermia shelters during periods of extreme temperatures.\n\nImpact','931886810745529','https://friendshipplace.org/programs-outreach/youth-young-adults/',NULL,NULL,'Verified','929094559121639','Call us at 202.364.1419 or email us at info@friendshipplace.org. You can also visit us at our Welcome Center (4713 Wisconsin Ave NW, Washington, DC 20016).',NULL,NULL,NULL,NULL,'956844133947886','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'983080950399519,883345659611536,877243931325915','1152494666421051',NULL,NULL,NULL),(538,956817646477291,'Dental Services',NULL,605134586578120,'	Family and Kids Dentistry\n	Cosmetic Dentistry\n	Preventive Dentistry Emphasized\n	Root Canals\n	Crowns and Bridge\n	Complete and Partial Dentures\n	Routine/ Complicated Extractions\n	Friendly Insurance\n	Prompt Emergency Care\n	Fast Braces','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,'1263089203668614,1274396898894043','651804021834110,1128987918758522',NULL,NULL,NULL),(539,953777853543160,'Parenting Education',NULL,883186000200856,'Individuals and groups learn and practice skills essential to successful child rearing and healthy family relationships.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','789038541797078,637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'915486946336080','646846673243288,1261416234116596',NULL,NULL,NULL),(540,954908524616299,'Substance Use Services',NULL,1093127605400642,'In response to the recent spike in the heroin epidemic in young people in the DC region, in addition to the rise in deaths due to overdoses of heroin and other opiates, for the past 10 years Andromeda has been successfully serving 90 patients with the Buprenorphine and naloxone (Suboxone) treatment program. As one of the few Medication Assisted Therapy (MAT) treatment providers in Washington, DC, Andromeda is uniquely positioned to provide MAT for opioid dependent persons with unmet treatment needs for substance use and co-occurring mental health disorders.\n\nAndromedas staff has decades of experience in working with persons with opioid dependence. Staff provides a safe space, inclusive of empathy for the consequences of addiction. Patients are seen once a month by a psychiatrist who provides them with substance abuse and mental health therapy, they participate in a group therapy session, get a urine test and then are provided a 30 day prescription of the medication. In addition, the case managers at Andromeda provide housing support, career orientation, job training opportunities, transportation subsidies, patient navigation services, language acquisition, adherence to HIV medications and/or mental health and substance use medication, nutritional classes and individual weight or diabetes management plans. They also refer patients to the array of educational health and social services that are available in the DC metro area.\n\nAndromeda patients that have been in the program have turned their lives around, working, living free of drugs and reestablishing healthy relationships. Their depression and/or other mental health illness sometimes goes in remission, but any crisis can trigger their need to go back to using opiates. They are in constant contact with Andromeda staff to assure their continued treatment, an essential element to their full recovery and their moving into successful and healthy lives.','841307455613093','http://andromedahealth.org/our-services/substance-use-services/',NULL,NULL,'Verified','941516382466411','For those suffering from addiction to opiates, Andromeda offers individual and group therapy options including prescribing Suboxone treatment as part of our Suboxone Group. For more information or to secure an appointment, please contact Raquel at (202) 292-4707 X 100.',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,'1200033126219686,1226186421680538,1185211556812450','1224638786118966',NULL,NULL,NULL),(541,957022682260174,'Metro Health',NULL,1200954196071495,'Formally known as the Carl Vogel Center (CVC), Metro Health is a nonprofit community-based organization that provides multidisciplinary and integrated medical healthcare that embodies all aspects of a person\'s physical, mental, and emotional well-being. CVC helps medically under-served individuals to become full partners and informed advocates in managing their health. The Carl Vogel Center also offers free HIV/AIDS testing.\n\nThe Center is accessible off of the Metrorail at McPherson Square or Farragut West and by Metrobus routes 70, X2, S4 and S2.','1179332074138565','http://www.carlvogelcenter.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1194993289280136',NULL,NULL,NULL),(542,960651180984847,'Radiology',NULL,1220981589179778,'Offers x-ray and intervention procedures including:\n\n- MRI\n- CT\n- Micro-Dose Mammography\n- Ultrasound\n- X-ray\n- Fluoroscopy\n- Interventional Radiology','620132940242525','https://www.unitedmedicaldc.com/services/radiology/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'1136418356307446','1100182510854387',NULL,NULL,'818226241830087',NULL,NULL,NULL),(543,966657126572943,'Family Support - Home Visiting',NULL,840733417398800,'Since 1988, Family Support has been visiting with growing families like yours right where they are  in the comfort of their home  to provide the information, resources, skills, and hands-on support to build a solid family foundation. \n\nThe first few years of a childs life can be one of the most challenging and important times for a family. Lets meet those challenges together. Reach out to us for free, experienced support for you and your family. This is what it means to be part of a community. \n\nWe build relationships with families who are about to have a new child or have recently had one in order to support a healthy home environment that is loving, nurturing, safe, and self-sustaining. \n\nOur Family Support team is dedicated to working alongside you in fun ways to encourage:  \n\nParenting skills \nChild growth \nFinancial stability \nSchool readiness \nStress relief \nPhysical health needs \nNutrition \nParent-child bonding \nGoal planning \nOur long-term, hands-on approach gives you valuable skills, supplies, and knowledge, when you need them, and periodically follows up with inspiration for keeping your goals on track. ','964869638930274,629348329513757','https://www.maryscenter.org/social-services/family-support-programs/home-visiting/',NULL,NULL,NULL,'637158405241810','Our support is provided based on your individual interests and personal schedule  there is no one size fits all here. Call or text us at (202) 302-6669 to begin the conversation. Together, we can find the program that best fits your unique life situation.\n\nMarys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below:\n\nTo reach our Healthy Families America Program Manager, Abayea Pelt, call (202) 847-4279 or (202) 302-6669 \n',NULL,NULL,NULL,NULL,'940163636453224,1301804131597006','1134877289644712,827996522503929,601427652072887',NULL,'1292849277583603','962742212670581,732086812000340',NULL,NULL,NULL),(544,978182683421582,'Restoration and Transformation Program',NULL,726173106231202,'Our Restoration & Transformation Program  is a residential rehabilitation program created to free men from the control of drugs, alcohol and other destructive behavior by establishing an active relationship with Jesus Christ.\n\nThe program can accommodate 50 students in systematic Bible study, biblical counseling, regular drug testing and work therapy. Classes and tutoring in reading, writing, math, job readiness and computer skills are also provided. After completing the program, men enter a Transition Period where they seek employment and are mentored through a gradual transition back into the community.\n\nWe enable restoration of family relationships and a strong relationship with a mentor church to help prevent relapse and ensure the graduates continued growth and accountability.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/stp-program/',NULL,NULL,'Verified','929094559121639,637158405241810','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'625195015492370,877243931325915,1319255723578292','585594366267961',NULL,NULL,NULL),(545,987007032021851,'Food Pantry','Labor of Love Human Service Center',877366768823409,'Emergency food is available to residents, by providing a 3-day supply of staples and meats.  To supplement pantry items, produce and other food distributions occur multiple times each month. ','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','832990803111047','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(546,988942778535389,'H.D. Woodson High School (DC Health Oversight) ',NULL,1043772486617212,'School-based Health Center ','732860283051181',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(547,993984406526461,'Warm Coat Outreach',NULL,930909694635560,'A coat drive that happens during the winter months.','906651913636867','https://lortonaction.org/warm-coat-outreach/',NULL,NULL,'Verified','911225335803318','Call to find out when this season\'s coat drive will occur.',NULL,NULL,NULL,NULL,'906987068756792',NULL,NULL,NULL,'1276944443091304',NULL,NULL,NULL),(548,999007044535768,'\"D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CHILDREN, YOUTH AND FAMILY SERVICES\"',NULL,777796010868947,'The Department of Behavioral Health is building a system of care for children, youth and their families that supports prevention and early identification of behavioral health needs, and provides community based treatment and supports that are able to meet multiple and changing needs. We are guided by the principles that services must be easy to access, culturally and linguistically competent, and family-driven and youth-guided. A range of treatment and support services for children, youth and their families are available, including specialized evidence-based practices for youth and families recovering from trauma, emergency care and ongoing treatment primarily through certified, community based mental health providers. Ongoing treatment includes individual, group, and family counseling, diagnostic assessment, medication management, and family support. In addition, community based providers are certified to provide substance use disorder treatment. The Department also operates a children\'s clinic, provides services in public and public charter schools, and manages an alcohol, tobacco and drug prevention and awareness campaign called DrugFreeYouthDC. To select a community based mental health provider that best meets your needs, please review the available community based providers or call the ACCESS Helpline at 1-888-793-4357 and talk with a mental health professional who will guide you through the process.','1220839720071176','http://dbh.dc.gov',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'',NULL,'','','677760270951950',NULL,NULL,NULL),(549,1013626780767014,'C.H.I.L.D.  Child Healing to Improve Learning and Development','CHILD',769893937425938,'Research reflects a strong link between exposure to trauma and depression, anxiety, and post-traumatic stress disorder in children and youth. In the District, children and youth are exposed to multiple traumas/difficult experiences including violent deaths, domestic violence, incarcerated caregivers, and community violence. C.H.I.L.D. is a holistic program of mental health services that represents a continuum of care for children and youth impacted by violence, trauma, grief and loss. Children are viewed in the context of family and community, and services are provided in office and community-based settings. Wendt Center clinicians employ verbal and non-verbal evidence-based, age-appropriate interventions, including art and play therapy, sand-tray, and other techniques.\n \n\nC.H.I.L.D. offers the following services\nIndividual and group counseling at our Northwest and Southeast offices. Groups are offered for children at our Northwest office for ages 7-18. \nResilient Scholars Project, providing group and individual counseling at school- and community-based locations throughout the District to children who have experienced at least one traumatic event.\nCrisis response at schools, community centers, and other locations to help children who have been traumatized by acts of community violence or disaster.\nCommemorative community healing events for families and communities impacted by loss, such as candlelight vigils.\nGrief camp (Camp Forget-Me-Not/Camp Erin DC), a therapeutic sleep-away weekend camp for children and youth grieving the loss of a loved one.\nVolunteer support, including mentoring for children and parents.\nInformation, education on topics related to child trauma, and referrals provided via intake coordinator and at both office locations, as well as the Office of the Chief Medical Examiner (OCME), where the Centers RECOVER program is located. Parents coming to the OCME meet with RECOVER clinicians and receive comprehensive information and resources to help their children cope with traumatic loss.\nTraining and education of providers and the public on issues relating to childhood trauma and loss. Wendt Center teams of therapists and graduate interns provide training or consultation to local schools, community centers, and other social service agencies throughout the metro areal, including consultation to facilitate on-site support for children.\nProfessional Training by senior staff clinicians to any mental health professional interested in providing individual or group grief counseling services to children and teens.','1108850981657232,1166799153375505','https://www.wendtcenter.org/c-h-i-l-d-resilient-scholars/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(550,1012930231616826,'Outreach Team',NULL,1043249662316489,'MKs Street Outreach Team seeks out and supports the most vulnerable and hard-to-reach people experiencing homelessness.\n\nOur focus is to work with clients in the following neighborhoods: Foggy Bottom, Georgetown, near the State Department and the National Mall. Our team will locate these clients and help them move into permanent housing, while connecting them to mental and physical health services, social security benefits and employment.','1220017101351760','https://miriamskitchen.org/outreach-team/',NULL,' lindsay.curtin@miriamskitchen.org','Verified','637158405241810','This is an outreach program. If you have any questions, please contact Outreach Director, Lindsay Curtin at lindsay.curtin@miriamskitchen.org',NULL,NULL,NULL,NULL,'582664674810922,1076876608568522',NULL,'645838145603264',NULL,'850193305992354',NULL,NULL,NULL),(551,1020892252007799,'Case Management ',NULL,1200954196071495,NULL,NULL,'https://metrohealthdc.org/services/case-management/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(552,1020841973640307,'SOME: MICKEY LELAND PLACE: TRANSITIONAL HOUSING',NULL,862349068568843,'Operates a 90 day transitional housing program that provides job-readiness and support services to homeless men recovering from addictions.','1005730911773458','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'796408821097223',NULL,NULL,NULL),(553,958581554726772,'Day Program',NULL,1220107638243156,'McClendon Center is certified as a Day Services program through the DC Department of Behavioral Health. The Day Program identified different learning levels for clients, who are grouped according to their cognitive ability and degree of motivation. These learning levels, or tracks, include substance abuse recovery groups as well as early recovery groups for those individuals who are beginning to consider the process of recovery. The Day Program offers a morning session and an afternoon session.\n\nThe Day Program is staffed by a Licensed Independent Clinical Social Worker, a Licensed Professional Counselor, a Registered Nurse, a Art Therapist, a Certified Addictions Counselor, Peer Specialists, and other professionals with advanced degrees.\n\nIndividuals enter the Day Program for a variety of reasons. Some seek stability and routine in their lives, often as a stepping stone towards going back to work. Others seek to be a part of a community where they can focus on their wellness and recovery within a supportive environment, enjoying the social interaction that can be found here. Clients entering the Day Program hope to maximize their potential and develop the skills and self-confidence to achieve the goals that he or she sets.\n\nThe morning program has four tracks:\n\nClinical Skills Building\nConsumer Empowerment\nExpressive Arts Therapy\nSubstance Abuse Recovery\n\nThrough active discussion, clients are led by seasoned therapists in covering a variety of psychosocial and educational topics. A key part of their learning focuses on clients own uniquely designed treatment plans.\n\nThe afternoon program, Serenity  Transform  Achieve  Recover  Thrive (START) is geared toward clients who are ready for more advanced programming, have a wide range of needs and interests, or who have other commitments in the morning. A nutritious lunch is served each day and is free of charge for clients who attend their scheduled sessions. And for clients who do not use Medicaid vans or Metro Access, McClendon Center provides public transportation assistance.\n\nSTART offers group sessions in three main areas:\n\nRebuilding and Recovery\nTrauma Recovery\nExpressive Arts','691606849422707','https://mcclendoncenter.org/programs/day-program/#toggle-id-2',NULL,'info@McClendonCenter.org','Verified','637158405241810,941516382466411','Call to set up an intake appointment.',NULL,NULL,NULL,NULL,'1291522275841396','762020382657935',NULL,NULL,'659764004272890',NULL,NULL,NULL),(554,961458582690801,'Operation Christmas Miracle',NULL,726173106231202,'The Christmas season is upon us and the children in the DC metropolitan area need to know they are not forgotten. Help children and families who are struggling financially experience love, laughter, and joy. With your help, Central Union Mission will supply Christmas gifts to thousands underprivileged children and youth.','838780960881380','https://www.missiondc.org/get-involved/events/operation-christmas-miracle-2-2/',NULL,NULL,'Verified','911225335803318','Call or go online to either sign up or to find information on donating/sponsoring.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(555,957722583611343,'Transition Housing Program',NULL,636426656659289,'The Wanda Alston Foundation is the only housing program in Washington, DC solely dedicated to offering pre-independent transitional living and support services to homeless or at-risk LGBTQ youth ages 18 to 24 in all eight wards.\n\nThese services include:\n\nLong-term transitional living (up to 18 months)\nCase management\nEducational guidance and support\nJob training and guidance\nSupport service referrals\nWanda Alston House residents have their own rooms and live with an advocate with extensive experience with housing and LGBTQ issues.\n\nIn addition, Wanda Alston House offers each youth a life skills counselor who works with the individual daily on issues relating to education/vocational training, housing, and other matters as necessary.','959373006921454','http://www.wandaalstonfoundation.org/services/',NULL,'info@wandaalstonfoundation.org','Verified','929094559121639','Clients must first be referred by a core housing agency. Once they have been matched with Walda Alston, they will be sent over for intake.',NULL,NULL,NULL,NULL,'625109799377934',NULL,NULL,'1186681173947755,1222973168897685','683177016827244',NULL,NULL,NULL),(556,977300457256642,'WASHINGTON ENGLISH CENTER',NULL,1165920736845072,'Provides excellent and affordable English classes and other workforce programs to adult immigrants using volunteer teachers.','1166838878012103','http://www.washingtonenglish.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'953744672072596',NULL,NULL,NULL),(557,979887684937950,'Family Success Program ',NULL,1178149503221687,'Education, employment, family support, and personal development opportunities. ',NULL,'https://housingup.org/ending-homelessness/family-success-program/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(558,979536491529478,'\"Milestones\" Supervised Visitation',NULL,727757843857751,'MSVP is rooted in the belief that the reunification of families is a lengthy, personal and emotional process. Therefore, the Milestones mission is to offer Ward 8 families, the appropriate time, tools, environment, and mental/emotional supports that can empower and realistically prepare them for the homecoming of their children.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234,1292849277583603','1231516890380928',NULL,NULL,NULL),(559,981580900656027,'Nativity Shelter',NULL,617116824616756,'The Nativity Shelter for Women provides overnight shelter for women over the age of 18. The shelter is low-barrier. It opens at 7 p.m. and closes at 7 a.m. This location also serves as a hypothermia shelter when temperatures drop to dangerous lows between November and March.\n\nNativity Shelter for Women is a low-barrier shelter for single adult women over the age of 18.  Nativity Shelter provides each client with a cot or a bed to sleep in each night in addition to blankets and sheets.  An evening meal is also available.  Case management and social services are available upon request and include referrals to obtain food stamps, medical assistance, photo identification and more.  Referrals are also available for clients dealing with substance abuse problems.','890234129642572','https://www.catholiccharitiesdc.org/nativity/',NULL,NULL,'Verified','929094559121639','The Nativity Shelter for Women is a low-barrier emergency shelter with a 20-bed capacity (25 during hypothermia season), and spaces are filled on a first-come, first-served basis.',NULL,NULL,NULL,NULL,'1130743087965133','1170304963711598',NULL,'877243931325915,836091364973509','1146226549543913',NULL,NULL,NULL),(560,985132906099195,'Stanton Road Health Center (Ward 8) ',NULL,1043772486617212,NULL,'608638223100862',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1212690067949838',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(561,989819878149890,'Individual, Couples, and Family Counseling',NULL,970560028876577,'Individual, couple and family counseling services. Help address, among other challenges:\n\n- Anxiety\n- Defiant behavior\n- Depression\n- Impulsivity\n- Social anxiety\n- Social  communication\n- ADHD/Executive functioning difficulties\n- Food issues\n- Identity issues\n- Adjusting to change\n- Aging issues\n- Bullying\n- Employment issues\n- Grief, loss and bereavement\n- Stress\n- Conflict resolution\n- Communication\n- Divorce\n- Family dynamics\n- Intimacy/trust\n- Marital conflict\n- Parenting\n- Premarital concerns','977589590864235,1321118518935089','https://www.jssa.org/get-help/adults-couples-and-parents/counseling/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'1211730899647476','863218507660277,1218692669680880',NULL,NULL,NULL),(562,989716764680602,'VETERANS AFFAIRS MEDICAL CENTER: WASHINGTON D. C.',NULL,660031487204054,'The Washington D.C. Veterans Affairs Medical Center (D.C.VAMC) is among the most visible and dynamic facilities in the VA system. As a tertiary care facility, D.C.VAMC provides acute general and specialized services in medicine, surgery, neurology, psychiatry, dentistry and numerous other subspecialties. The Medical Center, part of the VA Capitol Health Care Network (VISN 5), offers long-term care treatment in the 120-bed Comprehensive Nursing and Rehabilitation Center (CNRC). It operates four Community Based Outpatient Clinics (CBOCs) and is a Veterans Health Administration test site for enhancements in the electronic medical record. The Medical Center is affiliated with three outstanding medical schools and is a medical readiness partner with three Department of Defense medical facilities. The D.C.VAMC supports hundreds of active research projects and is home to one of two VA War Related Illness and Injury Study Centers (WRIISC).','1300302103708266','http://va.gov/directory/guide/facility.asp?id=143',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'909536473882576',NULL,NULL,NULL),(563,993349225663598,'Retail Store and Donation Center',NULL,1006551858895588,'Retail thrift store with home goods and clothing. Donations are also accepted.','556992607571593','https://www.dcgoodwill.org/shopping/retail-stores/',NULL,NULL,NULL,'911225335803318','Walk in to shop or donate.',NULL,NULL,NULL,NULL,'1097481648548755','1236014074213679,897023077002665,909213414445109,931233978224989',NULL,NULL,'1109157629072836',NULL,NULL,NULL),(564,990258942674234,'Making Tracks Academic Enrichment Summer Program',NULL,1004391421304549,'ACSGW recognizes that youth from low-income families may not always receive healthy, nutritious meals, and consistently score at the lower percentiles on academic tests. Youth deserve access to quality academic and vocational programs, and life-skill training to assist them in their journey towards adulthood.\n\nOur mission is to help the disadvantaged and disenfranchised in the community to attain self-sufficiency and independence, and deliver programs that serve youth and their families in the Silver Spring, Takoma Park, and other East Montgomery communities.\n\nMaking Tracks Academic Enrichment Program is a nationally recognized Montgomery County summer program conducted by Adventist Community Services of Greater Washington (ACSGW) and its community partners. It is our signature program that complements other ACSGW youth development and education programs that occur throughout the year.\n\nThe 6- to 7-week camp provides elementary-grade participants in East Montgomery County with a safe and positive environment to engage in vital academic instruction, hands-on visual and performing arts classes, a wide range of fitness and recreational activities, and essential life-skills training. Participants receive daily breakfast, lunch meals, and take-home weekend food packages (Smart Sacks). On any given Friday we hand out food to make 1000 meals.\n\nOver 450 elementary-age students have been served to date in East Montgomery County at elementary school sites. Our principal partner, Montgomery County Recreation Department, coordinates the registration and selection of eligible participants for the summer camp.','950009053464384','https://www.acsgw.org/youth.html',NULL,'Shirley@acsgw.org','Verified','637158405241810','Call for more information on this summer program.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782','1325427508018418','1204831166914095','877682236637760',NULL,NULL,NULL),(565,993493444765030,'Students Help and Reach Elders','SHARE',855094084464049,'Students Help and Reach Elders enriches the lives of adult residents in nursing homes and assisted-living facilities by linking them with school groups (from pre-school through high school) for friendship and interactive fun activities.','924628911683577','https://accessjca.org/interages/',NULL,NULL,'Verified','789038541797078','Call to find out more.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'761929300455945,854808174954754','1050035692418764',NULL,NULL,NULL),(566,994280834710332,'CONNECT.DC - DIGITAL INCLUSION INITIATIVE: ALL HANDS ON TECH',NULL,756344334747450,'Connect.DC created The All Hands on Tech initiative, in partnership with OCTOHelps, to provide FREE technical support to District of Columbia residents. One of the most important things a person needs to fully access technology is a functioning computer. Unfortunately, the cost of computer repair is often too high for many people. Whether you have a laptop with a virus or you don\'t understand how to use your smartphone, we are here to help!Visit website for current schedule of events.','847472462897373','http://connect.dc.gov/free-tech-support',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'',NULL,'612213908439005,645633521716641','','965448006761791',NULL,NULL,NULL),(567,1018775936818943,'DC Action for Children',NULL,1138775501034023,'DC Action provides data-based analysis and policy leadership on critical issues facing DC children and youth, to promote policies and actions that optimize child and family well-being.',NULL,'http://dcactionforchildren.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(568,1017815111476074,'Mother\'s Rising Home Visitation Program',NULL,1088589897673997,'The Mother\'s Rising Home Visitation Program provides expectant and new mothers with expansive ancillary and wraparound services during the perinatal period. Working with a care team, program participants receive perinatal health education, support with social service needs, care coordination, advocacy,  and parenting support during their pregnancy and throughout the infants first three months of life. \n\nMRHV will provide the following health and wellness interventions to expectant mothers:\n- Regular office and/or in home visits from a Perinatal Community Health Worker/Perinatal Family Support Worker.\n- Labor Support and in-home Postpartum Support (4 hours daytime and 8 hours overnight)\n- Support beyond a doctor or midwife such as nutrition, health and wellness coachingWomen will receive education and coaching on nutritional needs during pregnancy, and learn how to select quality pregnancy-safe foods, healthy weight gain, stress reduction.\n- Access to a variety of classes and support groupsWomen will have access to classes such as perinatal fitness, childbirth education, newborn care/SIDS prevention, breastfeeding, and parenting skills. These classes and groups will focus on helping expectant mothers to maintain a healthy pregnancy by reducing pregnancy related morbidities such as diabetes, hypertension and preeclampsia, increase infant bonding and increase the likelihood of positive birth outcomes. \n- Breastfeeding AssistanceMothers will receive education on the physiology and benefits of breastfeeding. Support groups and 1:1 lactation coaching is offered to provide social support systems designed to increase likelihood of initiation and duration. \n- Access to essential maternity and postpartum mother and baby supplies, including breastfeeding supplies, clothes and newborn essentials\n- Mental Health Support (for individuals, couples, and co-parents)--Utilizing a strength-based approach, counseling will guide individuals and families through an exploration of feelings, expectations, and experiences. Through this process, participants will be provided with the tools to facilitate a healthy transition to parenthood.\n- Referrals to WIC, health insurance, and other community resourcesExpecting mothers and their families will receive referrals to community-based organizations providing WIC, health insurance assistance, and other supportive services.\n- Complimentary therapies- Through program incentives, participants are able to earn credits towards massages, acupuncture, reiki, belly casting, and more.','1191890430739322','https://www.mamatotovillage.org/supportservices-259619-206860.html',NULL,NULL,'Verified','637158405241810','Any birthing person in the D.C. Metro Area can be referred to the MRHV. Those expected to gain the most benefit include:\n\n- A person with a racially or ethnically diverse background including, Black, Asian, Pacific Islander, Native American, Latinx or multiracial\n- A person with psychosocial factors and social determinants that may impact her perinatal health\n- A person who has limited to no family or partner support; or limited socioeconomic resources\n- A person at risk for giving birth to a low birth-weight or preterm baby\n- A person with morbidities that complicate pregnancy or postpartum\n\nHealthcare providers can use the \"Make A Referral\" link on the website.\n',NULL,NULL,NULL,NULL,'644056895061746,867238429645312','1259025264194553,840380756273952',NULL,'1182104828841650,915486946336080','948258077222906',NULL,NULL,NULL),(569,1022185739742814,'Refugee Health Services ',NULL,1195870505334629,'We are proud to offer a variety of services for refugees and asylees at our Conway Health and Resource Center.\n\nAccess to a care coordinator to support you through the healthcare process\nFree newcomer workshops that promote health among newly arriving refugees (including asylees, special immigrants, and survivors of trafficking)\nWorkshops cover various topics including: healthcare in the U.S., womens health, hygiene, and coping in a new environment\nRefreshments are provided and transportation and language assistance is available.','1090162375763715','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411','To register, or for more information, contact our Refugee Healthcare Coordination Specialist at 202.232.9022. ',NULL,NULL,NULL,NULL,'830522845866182','849762282889895,856292695140924',NULL,'1002130425245488','1016957397804274',NULL,NULL,NULL),(570,1020934285482366,'Substance Use Disorder (SUD)',NULL,1326157862705937,'Intensive Outpatient Substance (IOP) Abuse Services for Adults\n\nWho is MBI Health Services, LLC?\n\nMBI Health Services, LLC is a certified behavioral health agency servicing the D.C. Metropolitan Area. We provide a wide range of services an programs for both adults and children for the sake of helping each individuals gain back their confidence and security into their lives.           \n\nOur New Day Recovery Center offers Intensive Outpatient Program (IOP),\nand Outpatient (OP) programming that is tailored for clients who struggle\nwith alcohol and drug use and may need more support than regular\noutpatient services can offer. IOP also assists clients who completed\ninpatient care and are ready to transition into the community successfully\nand meet the challenges of daily life on their continued journey to\nrecovery. The New Day Recovery Center partners with clients to improve\ntheir functioning and their overall quality of life through sustained recovery.\n\n \n\nWhat Should I expect?\n\n 2 months of IOP programming with a minimum of 12 hours of services\nper week\n 6 months of OP programming with 1-7 hours of services per week\n Individual counseling\n Multiple group counseling sessions per week\n Clinical Care Coordination, and Case Management services\n Random drug screenings\n Additional services such as assessments, crisis intervention, and family\ncounseling\n Referrals such as Housing and Supportive employment','959978038980815',NULL,NULL,NULL,'Verified','941516382466411','Am I Eligible?\n\n Individuals ages 21 and over who are struggling with alcohol and drug\nuse and/or need additional supportive services.\n Individuals who have completed a residential treatment or inpatient\nprogram\n Enrolled in or eligible for Medicaid, and Medicare\n Returning Citizens\n Must be a DC resident\n Contact our office if you have private insurance\n\nHow do I Enroll?\n\nTo receive an initial evaluation, contact the Assessment and Referral Center\n(The ARC) and bring a photo ID, or contact New Day Recovery Center\ndirectly.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'912906147241865,1200033126219686,1226186421680538,664148755918958,868012483124236','817410769508748',NULL,NULL,NULL),(571,1024397676156151,'Single-site Permanent Supportive Housing Program',NULL,787727417537507,'Open Arms Housing hosts two single-site PSH buildings-the Dunbar and Owen Place. Both facilities are apartment-style buildings housing women experiencing homelessness with on-site support services. The availability of an on-site certified Peer Specialist and Case Managers with whom clients can consult, arrange benefits, and request access to mobile treatment teams, helps to ensure accessibility to supportive services at a level and pace determined by the residents. \n\nFrom its conception, Open Arms has stressed the provision of quality living spaces with full bath and kitchen for each resident; shared common space; customization of units to meet the special mobility and other needs of residents; a secure and safe building to call home; and effective property management that keeps each unit a healthy and responsive place to live. \n\nOAH On-site Supportive Services:\n- Outreach and engagement\n- Orientation to building and apartment, assistance in obtaining subsidy\n- Financial management, help with activities of daily living\n- Supportive counseling, crisis intervention','920572231138004','https://openarmshousing.org/single-sites',NULL,'info@openarmshousing.org','Verified','929094559121639','You must be referred to our program through Coordinated Entry and the DHS.',NULL,NULL,NULL,NULL,'1130020356495609','819527791411716',NULL,NULL,'663934110398598',NULL,NULL,NULL),(572,1028365853402776,'Addiction and Substance Abuse Treatment',NULL,840733417398800,'You can get your life back. There is help and hope if youre struggling with addiction and substance abuse. When you come to Marys Center, you can expect safe, confidential care from our trusted team of clinicians. We work hard to reduce the stigma and discrimination associated with addiction and substance abuse and are here to help you on your path to recovery by providing:  \n\nAccess to Suboxone* and other medications through our Medication Assisted Treatment (MAT) program \nCare coordination services \nRisk reduction interventions \nResources and education \nReferrals to mental health, medical, and social services at Marys Center and external partners \n*Suboxonehas been clinically proven to be a safe and effective treatment option for people who are struggling with heroin-opioid addiction. \n\nMedication Assisted Treatment (MAT) at Marys Center\nMarys Center offers Medication Assisted Treatment (MAT) if you are struggling with heroin-opioid abuse. We use buprenorphine (Suboxone)a safe and clinically proven treatmentas a key part of our MAT program to help you reduce and then stop substance abuse. Patients who have used buprenorphine have reported experiencing a decrease in cravings for continued opioiduse and diminished withdrawal symptoms. Heres what you can expect if you decide to try the MAT program: \n\nYou will meet with a Marys Center medical staff member for an assessment.  \nYour medical provider will gather your medical history and review clinic protocols and requirements. \nYou will be scheduled for 2 to 3 visits per week as your dose is adjusted. After that, you will have weekly to biweekly visits, eventually reducing to monthly visits. \nYou will not be prescribed buprenorphine during your first visit or if you are taking illicit benzodiazepines or stimulants. \nYou will need to have a plan in place to pay for medication. (We accept Medicaid, Medicare, cash, or private insurance is accepted). ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/other-specialties-and-services/addiction-and-substance-abuse-treatment/',NULL,NULL,NULL,'941516382466411','Marys Center is ready to partner with you on your health journey. To speak with an Addiction Specialist/MAT Care Coordinator, call (202) 545-8047. \n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'782271612014328,1301804131597006','1134877289644712,827996522503929,601427652072887',NULL,'1263089203668614,883345659611536,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(573,1035362732313948,'LGBT+ Mental Health',NULL,840733417398800,'Access to supportive mental health care is important. Marys Center has behavioral health providers who can assist children, adolescents, and adults who identify as part of the LGBT+ community. Several members of our behavioral health team are trained to provide culturally competent care for the LGBT+ community and are committed to creating a supportive, healing space.  \n\nSpecific behavioral health providers are also available to assist persons identifiying as transgender or gender non-conforming with gender affirming mental health care. If you identify as transgender or gender non-conforming and are seeking care, Marys Center can serve as your home base during the process. Our behavioral health team can: \n\nTalk with you about your gender treatment goals to come up with plan that is right for you  \nProvide mental health related referral letters when needed \nConnect you to our medical providers for help with hormone therapy and surgical letters \nOur greatest hope is you feel welcome, safe, and truly cared at Marys Center. Please reach out to us if youre in need of support. \n','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/other-specialties-and-services/lgbtqia-mental-health/',NULL,NULL,NULL,'941516382466411','Marys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below:  \n\nIf you are a new behavioral health participant, please call our regular appointment line at (844) 796-2797 and ask for help with a behavioral health appointment \nIf you are a current behavioral health participant and need to contact Marys Centers Behavioral Health department directly, please call: DC Behavioral Health Direct Line: (202) 851-3671 | Maryland Behavioral Health Direct Line: (240) 839-3401 \n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1345728742501995,1301804131597006','1134877289644712,827996522503929,601427652072887',NULL,'1263089203668614,883345659611536,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(574,1035914598171821,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CHILD PSYCHIATRIC PRACTICE GROUP',NULL,973693914944031,'Child Psychiatric Practice Group (PPG) includes 3 child psychiatrists that provide psychotropic medication assessment and management. Same day urgent care is available under certain circumstances for youth already prescribed psychotropic medication, but is not intended for psychiatric emergencies (e.g., suicidal).','616773646539267','http://dbh.dc.gov/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1175595689293964',NULL,NULL,NULL),(575,1048327823635547,'Pregnancy Center',NULL,1275972111076677,'The Pregnancy Center is a community outreach program that provides the following free services in a confidential, non-judgmental, supportive atmosphere:\n\nPregnancy testing\nOptions counseling\nHealth education\nMaterial assistance\nIn addition, counselors assist clients with the following referrals:\n\nPrenatal care\nMedical care\nAdoption\nDomestic violence\nLegal services\nHousing\nEducational opportunities\nJob training','688746232722666','http://www.pregnancyhelpdc.org/services/',NULL,'help@northwestenter.net','Verified','941516382466411,637158405241810','Call or use our website to make an appointment.',NULL,NULL,NULL,NULL,'776656918535876','1165555818915699,1177629354463342',NULL,NULL,'854824186087142',NULL,NULL,NULL),(576,1048291243097604,'Utility Assistance',NULL,919690199169575,'Qualifying clients are eligible for utilities assistance one time during winter months and once during summer\nseason.','987030255962297','http://www.ucmagency.org/stepping-stones-basic-needs.html',NULL,NULL,'Verified','878986697513222,1077790582995406','Proof of a crisis that prevented bill from being paid and a disconnection notice are required.\n\nCall or walk in during business hours.',NULL,NULL,NULL,NULL,'927006793998791','717231166133554',NULL,'1336431426596805,891092215548488','611571036444170',NULL,NULL,NULL),(577,1052496292978459,'DC KIDS COUNT',NULL,1138775501034023,'By providing high-quality data and trend analysis, DC KIDS COUNT seeks to enrich local discussions about ways to secure better futures for all children and youth  and to raise the visibility of kids\' issues through a nonpartisan, evidence-based lens.\n\nDC KIDS COUNT is part of the network of local-level organizations in all 50 states, Puerto Rico, the U.S. Virgin Islands, and the District of Columbia that provide a community-by-community picture of the condition of children. The network organizations also monitor budget and legislative decisions in the states and provide policy analysis based on evidence of what works for children and families.','1147823510376197','https://dcactionforchildren.org/data',NULL,NULL,NULL,'917725171609009','Call for information on our current projects.\n',NULL,NULL,NULL,NULL,'1139434629285592','1098590993104545',NULL,NULL,'792709813022086',NULL,NULL,NULL),(578,1054723852607588,'Health Ministry',NULL,1253319258586656,'The purpose of this ministry is to provide health services during church services, events, and activities. Raise the awareness of health issues affecting the African American community, promote wellness and physical activities, conduct health screening seminars, provide CPR training and partner with local health care organizations to educate our community and congregation regarding living a healthy life.','861096970014349','http://www.covenantdc.org/health-ministry',NULL,NULL,'Verified','637158405241810,941516382466411',NULL,NULL,NULL,NULL,NULL,'1067100404223709',NULL,NULL,NULL,'1159415480551281',NULL,NULL,NULL),(579,1056385088511360,'PrEp Services ',NULL,1200954196071495,'HIV Testing, STI Testing, Patient Education, Comprehensive Medical Visits ',NULL,'https://metrohealthdc.org/services/prep/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(580,1055385917949527,'Health Home Services',NULL,1326157862705937,'The Health Home service delivery model encompasses a person-centered, comprehensive approach to addressing consumers goals for recovery and improvement of behavioral health, physical health, acute care, and social needs. The Health Home team collaborates with the consumers physical and behavioral health providers, social services network, and other health data sources such as the consumer provided information, laboratory and radiology results, to develop a Comprehensive Health Assessment (CHA). This CHA informs the Health Home Comprehensive Care Plan (CCP) of services to be delivered to the consumer.\nThe goal is to reduce avoidable, high cost interventions and increasing the use of appropriate, timely interventions, along with improved self-care management. Health Home services are provided by an inter-disciplinary team of primary and behavioral health professionals in conjunction with the consumer and others as identified by the consumer. The Health Home uses a team-based, person-centered approach, where staff collectively uses their skills and knowledge, to ensure that culturally and linguistically competent evidence-based services and supports are employed to address the overall health and wellness of each consumer. Each consumer is actively involved with the Health Home team in setting goals and participating in his/her care planning. \n \nSome of the health services we provide are...\nScheduling appointments\nSending Reminders\nTransportation to the appointment\nHelping You and providers create an adequate healthcare plan\nWe will follow-up with you after yo have been discharged from the hospital\nWhat to expect once you have been enrolled in this service...\nWe will be working with you, your doctor and other healthcare professionals in getting you the medical, behavioral, and social services you need to further your positive growth. Individual and family support will be provided.','959978038980815','http://www.mbihs.com/what-we-offer/health-home-services',NULL,NULL,'Verified','941516382466411','Make sure you are eligible!\nThose who are eligible for the Health Home Service should have been already identified by D.C. Medicaid system. It should show that you have received treatment and frequent visits to the hospital for serious mental ad physical illnesses. Conditions include, but not limited to:\n\nDiabetes\nCongestive Heart Failure\nSeizures\nCirrhosis\nCoronary Artery Disease\nLung Disease\nLastly,\nYou must agree to participate in the District\'s Medicaid Health Home Initiative by signing a consent form approved by Department of Behavioral Health, (DBH). Make sure you are enrolled in a DBH Certified Core Service Agency, (CSA), without being enrolled in ACT, (Assertive Community Treatment).',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'817410769508748',NULL,NULL,NULL),(581,1071110285565782,' Essential Support Services','Previously: Neighbor-to-Neighbor ',692112692154000,'Our Essential Support Services, formerly known as Neighbor-to-Neighbor and Basic Needs Services, is A Wider Circles largest program. This program provides beds, dressers, tables, chairs, dishes, pots, pans, and other large and small home goods to families transitioning out of shelters, escaping domestic violence, or otherwise living without their basic need items.\n\nIndividuals and families call on their own or are referred to A Wider Circle by more than 300 government or nonprofit social service agencies, large and small. After speaking to our staff and scheduling an appointment to visit our Center for Community Service, people have the opportunity to select the items they need, free of charge. Each year, A Wider Circle furnishes the homes of more than 4,000 families, helping to create the stability and dignity that everyone deserves.','610894518918920','https://awidercircle.org/how-we-help/',NULL,NULL,'Verified','911225335803318,637158405241810','You must call for an intake before receiving services.',NULL,NULL,NULL,NULL,'877523491860439','646160018921336,1236548249618145',NULL,NULL,'1154169690232586',NULL,NULL,NULL),(582,1081316277006822,'Street Outreach',NULL,783236314114871,'GMC serves chronically homeless, service-resistant individuals in our community. Many of these individuals stay on the streets despite the weather or their needs. GMC staff does street outreach several times a week, usually with our medical team, to offer medical and psychiatric care, build trusting relationships, and prevent injury or death from exposure.\n\nHypothermia Outreach Team (HOT)\n\nIn January 2013, GMC partnered with Georgetown Universitys Center for Social Justice to create a volunteer hypothermia outreach team (HOT). These volunteers, made up of students, faculty, and staff, do street outreach on behalf of GMC on the coldest nights to check on those unwilling to go to shelters. They let people know about what warming sites are available, distribute cold-weather accessories, and check for signs and symptoms of hypothermia.\n\nThe Hypothermia Outreach Team was featured on NPR and Georgetown University put together this informational video. Take a few minutes to listen, watch and learn more about how the team works and how they interact with people on the street.\n\nSaving Lives Through Street Outreach\n\nOften, we encounter the same individuals week after week during our street outreach rounds. We always stop to say hello and ask if they need anything from us, and often the most service-resistant individuals will always dismiss us. No, Im fine. I dont need anything. Still, we persist week after week and become a familiar face and trusted source for help.\n\nMickey was a man we encountered every week sitting outside of the same store in Georgetown. Wed always say hello and ask if he needed anything, but hed always say no, and wed move on.\n\nOne day when we were walking with Dr. Crosland, our general practitioner, Mickey switched his answer from no to yes. He wanted us to check his blood pressure, which we found out was alarmingly high. Mickey let us call an ambulance for him, and we later found out that he was suffering from a heart attack. Mickey stayed in the hospital for several days before being discharged.\n\nThis is why we continue to do street outreach week after week and talk to people, even if they always tell us they dont need help. One day, they might, and we want to be there for them when they do.','865999041296626','https://georgetownministrycenter.org/programs/street-outreach/',NULL,'info@gmcgt.org','Verified','929094559121639,637158405241810','Call for more information. Services are provided in an outreach model.',NULL,NULL,NULL,NULL,'658265377894745',NULL,NULL,'877243931325915','807078925662836',NULL,NULL,NULL),(583,1095230986476849,'Gender Development Program',NULL,1061724977026001,'A Multidisciplinary Program for Gender-Diverse Youth and Their Families \nSome young people feel, sense or know they are a gender different than the one they were assumed at birth. They may live and dress in ways typical of another gender (gender non-conformity), and some may experience the need to live and be affirmed as this gender in some or all settings. This can be an urgent need, or for others, there may be experimentation and exploration. There are also some young people who show gender non-conformity in their everyday behaviors, but may not yet have the self-advocacy skills to discuss their gender identity and their gender-related needs. Each child\'s gender journey is unique.\n\nThe gender development of a child may be confusing to parents and families, providers, and sometimes young people themselves. Parents may wonder:\n\nHow can my child\'s gender-related needs best be supported?\nHow do we navigate our child\'s gender diversity in everyday life (e.g., with family, in school, when moving into adulthood, etc.)?\nIs my child transgender?\nWill my child\'s gender and gender-related needs change over time?\nThe needs of gender-diverse youth are often complex, requiring a multidisciplinary team approach and ongoing care supports over time.\n\nAbout Us\nThe Gender Development Program at Children\'s National has been supporting the gender needs of youth and their families for the past 20 years. As one of the earliest founded youth gender programs, we are a multidisciplinary team of specialists who work in the assessment and broad care needs of youth on the gender spectrum and their families. We also conduct cutting-edge research to move forward our understanding of youth gender development and ways to best support gender-diverse and transgender youth. Research findings inform all of our clinical care.\n\nWe work with gender exploring, gender non-conforming, gender dysphoric, gender non-binary, transgender and gender-questioning young people, and we see children and adolescents of all ages. We also work with youth who have genetic and other conditions in which gender variation is common.\n\nWe offer:\n\nPersonalized evaluations and tailored care: This includes evaluation of your child\'s gender development and needs in the real world. Throughout care with us, your child will receive supports tailored to their unique needs, in coordination with an existing community of professionals your child already sees to ensure continuity and consistency of care.\nComprehensive services and collaboration with multiple specialties: From initial and ongoing evaluation and support to specialists in medical treatments such as Veronica Gomez-Lobo, M.D., a pediatric gynecologist who provides medical interventions such as puberty suppression or hormone therapy, the program offers a full spectrum of care options based on the needs of each young person.\nUnique programs for diverse needs:\nChildren and teens who have both autism spectrum characteristics (or related conditions) and gender dysphoria have access to a support program designed specifically for them: the Gender and Autism Program led by John Strang, Psy.D. Many providers refer patients to our program to access these services, which may not be offered elsewhere.\nThe Gender Development Program works closely with the Youth Pride Clinic, which offers primary and specialty care services to LGBTQ (lesbian, gay, bisexual, transgender and questioning/queer) patients.\nEvaluation and Ongoing Supports\nYour childs care will start with an initial evaluation by our team. During this two to three-hour visit, you will meet the team together with your child and also separately. The goals of these visits vary from family to family and may include:\n\nUnderstanding the various aspects of your childs gender development\nScreening for any mental health concerns/risks\nSupport for parenting a gender diverse child\nSupport for families navigating issues related to siblings, friends, school, etc.\nWe may ask you and your child to return for periodic follow-up visits. These visits can help us make a more extended evaluation. Your team also may suggest treatments or supportive services through Childrens National or in the community such as:\n\nIndividual supports for youth and/or parents\nFamily-specific supports\nSchool supports/interventions\nSupport groups for you and/or your child','1282604214927911,1283315251842747','https://childrensnational.org/departments/gender-development-program',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'978304346911390','892012398827551,1349869848955998',NULL,'1274396898894043,1200832408072169,1292849277583603','928813128095347,559586682724890',NULL,NULL,NULL),(584,1098065208904471,'Professional Development ',NULL,559497771463092,'Workshops, networking, approved farm field trips, seeds and seedlings, farmer trading cards ',NULL,'https://www.dcgreens.org/workshops-and-resources-1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(585,1100964352786904,'Good Food Purchasing Program ',NULL,559497771463092,'Creating a transparent and equitable food system built on dc greens core values. ',NULL,'https://www.dcgreens.org/good-food-purchasing-program',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(586,1048055694684936,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS THREE AND FOUR PREVENTION CENTER',NULL,801265724461963,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.','1089405934692969','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'570426365726754',NULL,NULL,NULL),(587,1056286703581712,'Healthy Families',NULL,919690199169575,'United Community\'s Healthy Families (HF) program is an intensive, evidence-based home visiting program that successfully prevents child abuse and neglect in high-risk families. Parents receive home-based parenting education, health information, community support and school readiness from pregnancy until the child reaches age three.\n\nFamilies who graduate from the HF program have healthier children and better parent-child interactions. Less than 1% of these families are found to later abuse their child. The program has four goals:\n1. Promote positive parenting\n2. Improve child health and development\n3. Promote school readiness\n4. Prevent child abuse and neglect\n\nHealthy Families provides two main types of services: Family Assessment and Home Visits. A Family Resource Specialist conducts an initial Family Assessment based on the Kempe Family Stress Checklist to determine eligibility for the program as well as need for other services within the community. Depending on indicated need, the Resource Specialist provides parents with referrals to community resources. If admitted into the program, Family Support Workers provide regular Home Visits to at-risk families beginning during pregnancy and until child reaches the age of three years.\n\nHome Visiting Services:\nFamily Goal Planning: families develop family goal plans, which are updated regularly according to family needs.\nParenting Education: Parents learn about positive family interaction from the Parents as Teachers curriculum, which is activity-based and builds upon parents growing knowledge of child development.\nHealth Education: Parents get information on healthcare, family planning, immunizations, and other resources.\nDevelopmental Screenings: Children receive regular developmental screenings and are referred to early intervention if delays are discovered.\nSchool Readiness Activities: Children gain early literacy through literacy-based playgroups and activities. Depending on funding, children receive new books through partnerships with programs like The Reading Connection and Reading Is Fundamental.\nReferrals: Families are referred to other community resources as needed.','987030255962297','http://www.ucmagency.org/healthy-families-fairfax.html',NULL,NULL,'Verified','941516382466411,789038541797078,637158405241810','Call for more information about joining the program.',NULL,NULL,NULL,NULL,'927006793998791','717231166133554',NULL,'1292849277583603,915486946336080,826113037014422','611571036444170',NULL,NULL,NULL),(588,1055696283461218,'Richardson Youth Center',NULL,1306699628219808,'SBYs Richardson Youth Center offers a myriad of activities including tutoring, workforce development training, violence prevention groups, and sexual health classes.','798494517814959','https://www.sashabruce.org/programs/lifeskills/richardson/',NULL,'lrichmond@sashabruce.org','Verified','970915508638448,789038541797078,941516382466411','Call, walk in, or email to access this program. ',NULL,NULL,NULL,NULL,'708588487667319','882054301651193',NULL,'883345659611536','1275327544188973',NULL,NULL,NULL),(589,1060160690284572,'Substance Abuse',NULL,605134586578120,'Focused care and treatment of substance abuse addictions through our Suboxone Program','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215','612213908439005','','651804021834110',NULL,NULL,NULL),(590,1070582664052295,'Truancy Intervention Program (TIP)',NULL,883186000200856,'A truancy reduction program offered for high school aged youth.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(591,1076521704505640,'ETHIOPIAN COMMUNITY CENTER: COMPUTER TRAINING',NULL,929124125579243,'Offers computer training at minimal charge.','561801011049427','http://ethiopiancommunitydc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1292569171205217',NULL,NULL,NULL),(592,1076980913864779,'Hotel & Hospitality Certification Program',NULL,1230770757213322,'Our Hospitality Program is a great first step to a variety of positions in customer service. Learn to provide excellent guest service and create memorable guest experiences.\n\nCourse Tracks under Hospitality:\nCertified Guest Services Professional (CGSP): Learn the skills needed to provide excellent guest service and create memorable guest experiences.\n\nSkills, Tasks, and Results Training (START): Learn how to perform key tasks in a hospitality environment. Also gain the soft skills needed to succeed in a front-line position at a lodging property.\n\nWHAT IS A FRONT-LINE POSITION?\nFront Desk Representative  meet and anticipates the needs of all guests at hotels, resorts, and other lodging facilities. Provides necessary services to ensure guest satisfaction.\nGuest Room Attendant   responsible for keeping rooms at hotels, resorts, and other lodging facilities clean, safe, stocked and maintained.\nKitchen Cook  members of the food service team who prepare meals and ensure food service operates smoothly.\nMaintenance  Perform routine repairs or cleaning of property, ensuring all quality standards are met.\nElectives within the Hospitality Program:\nCertified Restaurant Server: Learn the skills and knowledge needed to succeed as a food service professional in a dining facility.\n\nCertified Breakfast Attendant: Learn the skills needed to succeed as a professional in a food service position at a lodging property','771897230838212','https://www.ywcanca.org/what-we-do/career-education-training-center/hotel-hospitality-certification-program/',NULL,NULL,'Verified','970915508638448,789038541797078','The application is available online on the program website. You can also call for more information.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'836091364973509','1330181492619505',NULL,NULL,NULL),(593,1087433575244513,'PASSAGES Extended Transitional Housing Program (ETHP)','Personal Achievement Sustained through Self-Advocacy, Guidance, and Engagement in ones own Success',1306699628219808,'Personal Achievement Sustained through Self-Advocacy, Guidance, and Engagement in ones own Success\n\nThe road to success is dependent upon a persons ability to advocate, regulate, navigate, and engage in ones own wellness and education. PASSAGES provides youth between the ages of 18-24 living with a disability, a shared apartment living experience along with the tools needed to independently and successfully engage and manage milestones.  These levels of achievement include legal, medical, employment, social, educational, and relationship building. Residents may stay in ETLP housing for up to 6 years. Residents must be enrolled in school, work part-time, and save portions of their income. Some also contribute to their rent.\n\nOur team meets the youth where they are in life to assist them with accessing the necessary tools to obtain educational opportunities and/or to secure competitive employment to promote income sustainability and access to resources.  These resources are instrumental to live with little to no support in Independent Living Programs, Rapid Rehousing, Reunification, and Self Placements.\n\nPASSAGES is located in the District of Columbias 8th ward. South East of the Anacostia River, PASSAGES is a 9 unit shared apartment building, newly renovated, offering 2-5 bedroom apartments.  Potential residents are invited in for a tour and introduction to the program before matching with potential roommates. PASSAGES is easily accessible to the DC metro bus and train system.','1324870517546321','https://www.sashabruce.org/programs/safehomes/passages/',NULL,'ndavis@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program.',NULL,NULL,NULL,NULL,'933177707559584','882054301651193',NULL,'877243931325915,883345659611536,1222973168897685,1322383076619129','644077299763331',NULL,NULL,NULL),(594,1088833752301562,'Academics',NULL,1323195974089796,'When youth enroll in LAYCs educational programs, they can look forward to an enriching experience with an emphasis on academics, leadership development, and social-skill building. Our programs focus on activities that enhance academic performance with the goal to support attainment of a high school diploma or GED, and prepare youth for post-secondary education and success. Youth have access to our academic programs at LAYCs sites and at partner schools during the school day and after school through our School-Based Academic Programs and After-school Enrichment.\n\nSchool-based academic programs: \n- Pre-high school services\n- After school program\n- Americorps academic mentors\n\nGED education\n\nCollege access and retention\n\nCommunity schools:\nA community school represents a set of partnerships between the school and community resources that support students and families in and beyond the classroom. The goal of a Community School is to integrate academics, health and social services, youth and community development, and community engagement, to improve to increase student academic achievement and ensure family well-being.\n\nAfter school enrichment for ages 14-19','1159564548417950','http://www.layc-dc.org/what-we-do/academics/',NULL,NULL,'Verified','789038541797078','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1198575506619755,1087645166547434','920999838182205,1016645181977967',NULL,'1295679372454826,883345659611536','1288365969354186',NULL,NULL,NULL),(595,1089778010404757,'Produce Rx ',NULL,559497771463092,'Allows medical professionals to prescribe fresh fruit and vegetables to patients experiencing diet-related chronic illnesses with additional support for patients living in poverty. ',NULL,'https://www.dcgreens.org/produce-rx',NULL,'andrea@dcgreens.org ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(596,1098208700839960,'Salvation Army NW - National Capital Area Command',NULL,756001362836549,'Harbor Light Transitional Housing Program:\nExtended transitional housing (6-18 months) for 33 men & women experiencing homelessness and in recovery from substance abuse. To enroll, call the Harbor Light center at (202) 269-6333 and ask for the Intake department.','831454623275466','www.salvationarmy.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(597,1105456695695453,'Dove Store',NULL,1323664977480953,'Our boutique donations shop is setup like a department store, where youth can select items free of charge for everyday clothes, undergarments, hygiene products, and outfits for interviews/special events.','1106602330344467','http://covenanthousedc.org/our-services/supportive-services/',NULL,NULL,'Verified','911225335803318','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(598,1106771248483191,'Activities','Misler Center',855094084464049,'Activity programming is at the heart of the Misler Center experience. Days at Misler are filled with enriching activities, with programs tailored to meet the needs of people with a range of cognitive and physical abilities.\n\nThroughout the day, there are two activity periods and participants select from at least two choices each time. Staff are always there to help those who need encouragement. For those with memory loss, it is all about staying in the moment. For those with physical challenges, we strive to maximize capabilities, no matter what the diagnosis. Our goal is to exercise all the muscles of the person  the body and the mind!\n\nThe monthly activities calendar is very popular among participants and families alike. It illustrates the planning of the staff for activities that include:\n\nDiscussion groups on topics ranging from current events to ancient philosophy\nPhysical exercise, including strength training, chair aerobics, stretching and games\nTherapeutic arts and crafts projects\nWriting workshops and literature based activities\nMusical performances and programs by local artists, including opera, and instrumental and vocal performances by community and school groups\nWord games\nReminiscing programs\nField trips/outings to museums, parks, and nearby attractions\nNutrition and health talks with our RNs','924628911683577','https://accessjca.org/misler-center/',NULL,'Misler@AccessJCA.org','Verified','637158405241810','For more information, to arrange a visit, or to speak with one of our social workers, please call us at 301-468-1740, or use the contact form on our website to send an email inquiry.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1058170814905410',NULL,'1157835357284365,854808174954754,1032274526726429','1050035692418764',NULL,NULL,NULL),(599,1107634998787398,'Counseling for Individuals with Special Needs',NULL,970560028876577,'JSSA offers a wide range of assessment and treatment options that include cognitive behavior therapy, play therapy for children; social skills therapy groups; psychodynamic psychotherapy; family and group therapy; and other evidence-based approaches. JSSA provides both brief and longer-term intervention as needed.\n\nOur assessment, counseling and therapy services include:\n\n- Behavioral, educational and psychological evaluations\n- Individual, group and family counseling\n- Social skills groups and summer camps\n- Psychiatric evaluations and medication management\n- Parenting and family workshops and support groups\n- Neuropsychological, psychological and psychoeducational testing','977589590864235,1321118518935089','https://www.jssa.org/get-help/individuals-with-special-needs/counseling/',NULL,NULL,'Verified','637158405241810','Call for services. Please be advised psychiatric services are only available to those already receiving consultation services from a JSSA clinician.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','573957674876281,773649767743777,1094678156609302,1113885469544387',NULL,'646178708377781','863218507660277,1218692669680880',NULL,NULL,NULL),(600,1052254032756894,'Pregnant Women',NULL,761153930697275,'Providing care from belly to cradle\nUPO partners with the Healthy Babies Project to serve 52 pregnant women and families as they go through pregnancy and transition into parenting. Prenatal health has an impact on the childs development so we can enroll moms-to-be in a center where they receive support for a healthy birth. We also train them on fetal alcohol syndrome, breastfeeding, and labor and delivery, and offer dental appointments for those who want them.\nThe goal is to provide proper planning for the unborn child. All pregnant women are screened for perinatal and post-partum depression and each family receives a post-partum visit 2 weeks after delivery to ensure a healthy transition from hospital to home.','594960886051316,999755198000719','https://www.upo.org/earlyeducation/',NULL,NULL,'Verified','637158405241810','Call to sign up.',NULL,NULL,NULL,NULL,'871521669861323,665905423802380','587544010010943,940897095189363,682372519823224','1250903097874303','1182104828841650,915486946336080,1177145976454922','1304904589817191,1166860713798541',NULL,NULL,NULL),(601,1052463055100883,'Hospice',NULL,970560028876577,'JSSA Hospice services include quality medical and support services, from symptom and pain management to emotional and spiritual guidance for patients and their families.\n\nServices include:\n\n- 24/7 access to a hospice staff\n- Collaboration with the patients primary physician\n- Care is coordinated by an interdisciplinary team consisting of registered nurses, hospice physician, social workers, chaplains, hospice aides and volunteers\n- Instruction in pain and symptom management\n- Flexible scheduling to accommodate patient and family needs\n- Hospice consultations and evaluations available at the location of your choice at no charge (physicians order not required);\nJSSA can provide a consultation to patients in the hospital, but our services cannot be delivered in a hospital setting\n- Provision of medications, medical supplies and durable medical equipment\n- Nutritional advice and guidance\n- Trained hospice volunteers provide a comforting presence, family support as well as a wide range of complimentary modalities including: pet, massage and music therapy\n- Access to a broad range of JSSA support services\n- Bereavement support for 13 months following the loss of a loved one','1104646684650585','https://www.jssa.org/get-help/hospice/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'838371887515959','1136707297418763',NULL,'1227383950401000','1328302797893590',NULL,NULL,NULL),(602,1052874613014434,'Age in Place',NULL,1180598613249590,'Having a healthy, safe, and comfortable place to call home is important for all of us. Seaburys Age-In-Place program supports older adults in Washington, D.C.s Wards 4, 5, and 6 through transformative volunteer service projects that help people stay in their own homes.\n\n\n\nAge-In-Place engages volunteers as a critical piece of the safety net in D.C. by providing yard work and housing cleaning services.','1154084082448020','https://www.seaburyresources.org/ageinplace',NULL,'ageinplace@seaburyresources.org','Verified','637158405241810','Call to receive services. Email to sign up to volunteer.',NULL,NULL,NULL,NULL,'1281076749443978','1176087327224268',NULL,'854808174954754','1137042288285597',NULL,NULL,NULL),(603,1066946772206101,'UNIVERSITY LEGAL SERVICES',NULL,1200699271788672,'University Legal Services (ULS) proposes to target the Washington, D.C. Latino community for specific outreach efforts to provide information about homebuying and rental opportunities in wards 7 and 8.','965499960712698','http://www.uls-dc.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'806093396765868',NULL,NULL,NULL),(604,1066884473551582,'Project Safe Place',NULL,1306699628219808,'Project Safe Place provides safety and shelter to young people in immediate danger or in need of services. Since 1989 SBY has been the Washington DC sponsor for Project Safe Place, a national program that works to provide a safe place for youth in need of crisis-related help. Project Safe Place is a network of businesses, community organizations, and fire stations that serve as entry points to SBY services and can be identified because they display the Safe Place logo. When young people access these sites, personnel at the location call SBY and provide a safe place for the young person to wait while SBY dispatches a trained counselor to pick up the youth. Young people are brought to the Sasha Bruce House shelter where they have access to all of SBYs services. Young people who need assistance can also call the Safe Place hotline directly at 202-547-7777 to speak with trained SBY staff.','773029335736391','https://www.sashabruce.org/programs/safehomes/project-safe-place/',NULL,NULL,'Verified','929094559121639','Call for services. If it\'s an emergency, call the emergency hotline at 202-547-7777.',NULL,NULL,NULL,NULL,'1173443518827100',NULL,NULL,'877243931325915,883345659611536','1331024333739197',NULL,NULL,NULL),(605,1068357766582058,'Clinical Pharmacy Services',NULL,1093127605400642,'Through a partnership with Howard University College of Pharmacy, a doctor of pharmacy works on-site. Both the College of Pharmacy and Andromeda are aware that a team approach in healthcare including medication therapy management has the potential to improve health outcomes in patients. For this reason Clinical Pharmacy Services works with Andromedas core medical services to deliver medication education, training, and provider consulting. The pharmacist works alongside providers to help manage conditions such as diabetes, high blood pressure, high cholesterol, HIV and hepatitis C in addition to addressing medication side effects. Patients can make appointments to see the pharmacist to review how their medications work, the importance of adherence to medications, and for training to use devices to check blood sugar and blood pressure correctly. The College of Pharmacy and Andromeda strive to provide equal, quality, and comprehensive healthcare to all individuals. In doing so, Andromedas mission is recognized and supported so that cultural and linguistic differences are appreciated in all services provided.','841307455613093','http://andromedahealth.org/our-services/clinical-pharmacy-services/',NULL,NULL,'Verified','941516382466411','Doctor will provide prescription. Call for help with orders.',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,NULL,'1224638786118966',NULL,NULL,NULL),(606,1072375211967855,'McKenna\'s Wagon',NULL,1279230501938511,'McKennas Wagon, Marthas Tables mobile food service, rolls out 7 days a week, 365 days a year to feed hundreds of DC neighbors who may be experiencing housing instability or hunger at two downtown locations. Volunteers stop at the two locations and serve hot, fresh meals, as well as sandwiches, homemade muffins, fruit, and refreshments.','812882827630009,643145676043430','https://marthastable.org/health-wellness-programs/',NULL,NULL,'Verified','832990803111047','Folks can just show up to these two locations seven days a week.  Times are approximate and subject to traffic conditions.',NULL,NULL,NULL,NULL,'1235881686916009','993619337592407,761457899568459',NULL,'877243931325915','618301459976775,1119020487265501',NULL,NULL,NULL),(607,1084298429662110,'Transitional Living Program',NULL,1306699628219808,'The Transitional Living Program (TLP) provides supervised apartment living for older youth ages 18 to 24 whose family problems prevent them from living at home. Residents may be self-referred or referred through the DC Department of Human Services. TLP residents may live in SBY-managed apartments for up to12 months, receiving counseling and support services and learning life skills they need to live independently. TLP requires residents to be enrolled in school, work part-time, and save portions of their income. Some program residents also contribute to their rent. The TLPstaff provides counseling, life skills training, career guidance, job referrals and aftercare counseling to assist TLP graduates in living successfully on their own.','577194179164801','https://www.sashabruce.org/programs/safehomes/transitional-living-program-tlp/',NULL,'mdaley@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program.',NULL,NULL,NULL,NULL,'957130180146437','882054301651193',NULL,'877243931325915,883345659611536,1222973168897685','1119492762868078',NULL,NULL,NULL),(608,1087270111823708,'Family Permanent Supportive Housing',NULL,1245236106154921,'Everyone Home DCs Permanent Supportive Housing is designed to provide permanent housing and supportive services for homeless families in Washington, DC. The families in our Permanent Supportive Housing Program live in scattered site apartments, throughout the city, and pay a portion of their income towards their monthly rent.\n\nWe provide ongoing resources so our families have the opportunity to experience stability, and lead healthy, fulfilling and productive lives. Families in our permanent supportive housing program receive subsidized housing along with intensive case management services, regular home visits, and workshops in order to maintain long-term stability.','936934819762396','https://everyonehomedc.org/programs/family-permanent-supportive-housing/',NULL,NULL,'Verified','929094559121639','Referrals for Everyone Home DCs Permanent Supportive Housing Program come from The Community Partnership for the Prevention of Homelessness.\n\nIf you know a family encountering a housing crisis that they cannot resolve on their own, they can access homelessness prevention advice and program assistance referrals exclusively through the Virginia Williams Family Resource Center (920 Rhode Island Ave NE, Washington, DC 20018 | (202)-526-0017), the central intake for DCs coordinated homelessness assistance system for families.',NULL,NULL,NULL,NULL,'735608882009072','832596400468443,1170433044969408',NULL,'1292849277583603,877243931325915','811198505758894',NULL,NULL,NULL),(609,1088296624271784,'Housing Law',NULL,1091757696945828,'Keeping families in safe, affordable housing is at the core of our housing law practice. Our housing law attorneys understand the importance of getting our clients effective and timely relief in matters such as eviction, housing code violations, the termination of housing subsidies, and the preservation of affordable housing.\n\nWe represent clients in eviction cases in the Landlord and Tenant Branch of D.C. Superior Court and in administrative hearings to preserve housing subsidies and challenge unlawful rent increases. Legal Aid housing law attorneys also assist clients living with deplorable housing conditions by representing them in affirmative suits to obtain repairs.\n\nRecognizing the acute need for tenant representation in D.C. Superior Court, we established the Landlord Tenant Court-Based Legal Services Project in 2007 to provide legal assistance to tenants at the courthouse. In 2010, we also advocated for the creation of the Housing Conditions Calendar, designed to help tenants living in poor housing conditions bring repair claims to court. In 2015, Legal Aid, in collaboration with Bread for the City, Legal Counsel for the Elderly, and the D.C. Bar Pro Bono Center, launched the Housing Right to Counsel Project, which aims over the long term to offer a guarantee of representation to tenants in subsidized housing who are facing eviction and the associated risk of losing an invaluable housing subsidy and entering into long-term homelessness.\n\nIn addition to individual representation, our housing law unit works to identify cases that could have a broad-based impact and to engage in advocacy on issues that affect a group of tenants or the operations of government agencies and the Court.','768639914164498,1052799655566995','https://www.legalaiddc.org/housing-law/',NULL,NULL,'Verified','917725171609009','You can apply online or utilize walk-in intake hours. Call for more information.',NULL,NULL,NULL,NULL,'1289374770713295,1234325977097951','871092289270509,1035182743655741,1155614982637715',NULL,NULL,'635267247673749,1157364802959844',NULL,NULL,NULL),(610,1083719705858867,'Citizenship Classes',NULL,1116810105858975,'CARECEN offers quarterly 12-week citizenship classes to prepare eligible individuals for the naturalization exam. The classes cover the knowledge of history and government necessary to answer the 100 civics questions on the exam. Class activities include a trip to the National Archives, the American History Museum, the Capitol or other DC landmarks. At the culmination of the 12 week period, the students are evaluated through a mock citizenship interview. Classes are offered Tuesdays, 6-8 PM and Saturdays, 10 AM-12 PM, or 2:30-4:30 PM.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009','Bring $50 and your green card to register.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(611,1098665459896297,'Consumer Law',NULL,1091757696945828,'Our consumer law attorneys strive to help protect their clients limited income and assets, specializing in two key areas of practice: foreclosure prevention and consumer debt collection litigation. Since 2008, our consumer law attorneys have worked to provide representation to individuals threatened with foreclosure, as well as to protect clients from mortgage servicers abusive and illegal practices. Our consumer attorneys are in the courtroom for initial hearings in judicial foreclosure cases to provide legal information, referrals, and representation to low-income homeowners at risk of losing their homes.\n\nMore recently, we have increased our services to include representation of D.C. residents in cases involving abusive debt collection practices. In 2012, we began a court-based initiative in the Collections Calendar of D.C. Superior Court and in D.C.s Small Claims Court  where debt collection cases make up an overwhelming percentage of the docket  to provide same-day legal services to clients. Our attorneys work to protect clients from judgments or unfavorable settlements that can have a devastating impact on people living in poverty.\n\nOur Consumer Law Unit also engages in systemic advocacy to reform debt collections practice in the District of Columbia, to defend and enforce homeowner protections provided by D.C. law, to monitor the efficacy of foreclosure mediations, and to advocate for legislative and regulatory improvements to consumer laws.','768639914164498,1052799655566995','https://www.legalaiddc.org/consumer-law/',NULL,NULL,'Verified','917725171609009','You can apply online or utilize walk-in intake hours. Call for more information.',NULL,NULL,NULL,NULL,'1289374770713295,1234325977097951','871092289270509,1035182743655741,1155614982637715',NULL,NULL,'635267247673749,1157364802959844',NULL,NULL,NULL),(612,1107243553438801,'Computer Lab ','Labor of Love Human Service Center',877366768823409,'Our lab is free and open to the public for persons to develop their cover letter and resume, conducting job searches, and maintaining communication with potential employers.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','789038541797078','The computer lab is open each weekday from 9am - 4:30pm.',NULL,NULL,NULL,NULL,'1011118711605616','1260109472339648',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(613,1105865058729494,'Wellness Recovery Action Program',NULL,883186000200856,'A peer led self-advocacy program designed to promote peer support and develop a tool-box for building resilience. These groups offer adult and adolescent peers.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(614,1106083468244471,'Recreation and Education',NULL,1168436736852155,'There are two fundamental ingredients when it comes to thinking about the best recipes to avoid diseases: one is to feel happy and accompanied and the second is to continue learning. All scientific studies refer to the need to continue using the mind to prevent diseases related to memory loss. And that\'s why at VIDA we offer all kinds of classes: embroidery, weaving, art, music, dance, zumba, English, Spanish, jewelry, computing, among other specific trainings. We believe that happiness is built with small daily illusions, and with personal satisfaction. And then we focus on reinforcing the self-esteem of participants. On the other hand, we believe that being with friends doing all these things helps a person to feel better. Being able to share with other older adults and have a place where they feel welcome is an essential element in the elderly. That is why VIDA offers, in addition to all its classes, a whole package of recreation and socialization activities, such as walks, birthday celebrations, parties, group dances, and other activities and festivities that vary weekly. In summary, among the Education activities that we carry out regularly are the following classes:\n\n English for Beginners\n Intermediate English\n Literacy is Spanish\n Computing\n Embroidery\n Tissue\n Jewelry\n Singing\n Art / Painting\n Dance / Zumba\n\nAmong the recreational activities are the following:\n Birthday celebrations every month\n Bingo several times a week\n Out of center walks\n Daily monitoring of vital signs\n Diabetes Monitoring\n Weekly Chronic Disease classes in the Elderly\n Drug Adhesion Monitoring\n Training on how to be regular with medications\n Reference to medical consultations if necessary\n Support to make appointments with your doctors','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/recreation-education/',NULL,NULL,'Verified','637158405241810,789038541797078','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(615,1105568722092716,'Free Standing Mental Health Clinic & CORE',NULL,1326157862705937,'Our Freestanding Mental Health Clinic & Core Services can be found at our Minnesota, Hunt Place, and MLK branches. These two services were our first services we ever offered to the D.C. community in 2009. They were put in place to help individuals proceed with their lives despite any physical or behavioral difficulties. Our Freestanding Mental Health Clinic focuses on the following:\n\nDiagnostic Assessment\nIndividual, Family, and Group Therapy\nInteractive Psychotherapy\nTrauma-Based Therapy\nPrevention / Intervention / Group Counseling\nBehavior Modification\nAnger Management\nDomestic Violence\nMedication Management\nTrauma Groups\nWhile our Freestanding services are easily accessible by the public, CORE is not. In order to be placed under our CORE services, one must be linked to the Department on Behavioral Health (DBH). Also, unlike our Freestanding services, individuals are placed with Community Support Workers to help you commit to evolving and reinventing yourself into someone you have always wanted to become.\n\nOur Core services agency focuses on:\n\nDiagnostic Assessments\nMedication/Somatic Treatment\nCounseling/Psychotherapy\nCommunity Support\nLife Skills and Coping Strategies\nSubstance Abuse\nCrisis Intervention','609550690795774,1284966614626832,959978038980815','http://www.mbihs.com/what-we-offer/free-standing-mental-health-clinic-0024-core',NULL,NULL,'Verified','941516382466411','Call to make an appointment.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'1231516890380928,1307003077051177,817410769508748',NULL,NULL,NULL),(616,1108768153867457,'ESOL',NULL,1004391421304549,'ACSGW offers various classes with the goal of helping you to become self-sufficeint. Classes are very reasonably priced to help us pay for the instructors and to ensure that clients are invested in their education. \n\nESOL (English for Speakers of Other Languages), is designed to teach English to non-English speaking individuals such as immigrants or international students. ESOL is a Life Skills and Academic program using the latest computer resources to prepare students for the workplace, college and for computer-based exams such as the GED and TOEFL. This prepares students for the GED exam (to prep students for the online exam).','950009053464384','https://www.acsgw.org/education.html',NULL,NULL,'Verified','789038541797078','For more information or to learn how to register for a class please call us.\n',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(617,1113022418855878,'FAMILY MATTERS OF GREATER WASHINGTON (WARD 8): FOSTER CARE AND ADOPTION SERVICES',NULL,805167768269068,'Our foster parents provide a safe, nurturing home for children who have been removed from their parents care because of abuse or neglect. The Child Welfare Unit strives to ensure all children have a permanent placement within 15 months.','1201013486946841','http://familymattersdc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'664797781907050',NULL,NULL,NULL),(618,1111524873166786,'Housing and Community Justice Project',NULL,1141864402494387,'The Housing and Community Justice Project was established in the Fall of 2008, and is directed by an APALRC staff attorney. The project combines community education, advocacy, community organizing and direct legal representation of low income and limited English proficient Asian tenants to protect their rights to safe, affordable homes in neighborhoods in which they want to live. In addition, the project engages communities with a long-term community lawyering strategy, trusting that no one knows its priorities better than the community itself. The project provides corporate and transactional legal services to groups of affected community members, helping tenants to organize and run tenant organizations and the groups that work together to address problems and build community together.','1264011549910449','https://www.apalrc.org/housing-and-community-justice-project/',NULL,'helpline@apalrc.org','Verified','917725171609009,929094559121639','Call for services',NULL,NULL,NULL,NULL,'1010201225467528','743786809520784',NULL,'884944905632896','1018319997039351',NULL,NULL,NULL),(619,1115196970236426,'Tenant Education and Assistance',NULL,1116810105858975,'Tenants are informed of their rights and responsibilities as renters through individual counseling and regular meetings with existing or newly formed tenant associations. Tenants learn how to communicate with landlords to ask for repairs and respond to notices associated with renting. In some cases tenants are referred to pro-bono attorneys in order to resolve tenant-landlord disputes through legal channels. Our housing program also offers a variety of workshops on topics such as building and repairing credit, budgeting, and financial planning.','547920365968268','http://carecendc.org/direct-services/housing-services/',NULL,'info@carecendc.org','Verified','917725171609009,929094559121639','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1295679372454826','842193303927915',NULL,NULL,NULL),(620,1120365239019390,'Legal Services',NULL,795756022910298,'Almost half of all immigrants seeking assistance have a valid legal claim or available legal avenue to obtain legal status in the US. However, immigration laws and related legal proceedings are complex.\n\nTo make a legal right a reality, low-income immigrants need help to successfully access and navigate our justice system. We provide expert legal services so that low-income immigrants can overcome barriers and access justice. Unaware of their rights and overwhelmed by a complex legal bureaucracy and language barriers, many immigrants require the aid of a professional to navigate the U.S. immigration system. Ayudas staff attorneys and pro bono program serve more than 3,000 women, men, and children every year by helping them obtain visas, work authorization, legal status, and more.\n\nImmigration services:\nFamily-based immigration applications\nRemoval defense\nAsylum\nSpecial Immigrant Juvenile Status (SIJS)\nHumanitarian applications (victims of crime, domestic violence, human trafficking)\nViolence Against Women Act petitions\nAdjustments of status to permanent residence, naturalization (citizenship), Temporary Protected Status, work authorization, and Deferred Action for Childhood Arrivals (DACA).\n\nDomestic Violence and Family Law:\nCivil Protection Orders\nCustody, Divorce and related matters\nCivil Contempt\nChild Support\n\nProject End:\nIf you have tried to get help from the wrong in people in the past, we can help.\n\nProject END (Eradicating Notario Deceit) is a direct legal services project aimed at remedying the harm caused by notario or immigration consultant fraud. Project END provides advice, counsel, and representation to victims in civil, criminal, and immigration proceedings.\n\nA notario, notario pblico, or immigration consultant in the U.S. is not an attorney nor an accredited representative of the Department of Justice in the U.S., and consequently, is not licensed to provide paid immigration legal advice or legal services. Unscrupulous notarios or consultants routinely prey on immigrants who, because of linguistic, cultural, and financial obstacles, believe a notario or consultant can assist them with their legal issues. The fraudulent work of notarios or immigration consultants can have life-devastating consequences on its victims, including financial ruin, damage to a legal case, deportation, and permanent family separation.\n','1161498401444320,833655491101686,1183432963433388','https://ayuda.com/what-we-do/legal-services/',NULL,NULL,'Verified','917725171609009','Call for services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1340162113833071','738259216161094,1255038891038036,1136426278579096',NULL,NULL,NULL),(621,1119079742925957,'Behavioral Health Integration',NULL,887352348953420,'La Clnicas behavioral health and primary care services are co-located, and the behavioral health and medical care teams collaborate to achieve a fully integrated system of care. Our Primary Care Mental Health Therapist is part of the primary care team, removing barriers to access to mental health services by screening patients right away, linking them to services, and providing triage and assessments.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(622,1070895654294162,'Youth Diversion - Cosmic Wolves',NULL,948113581207578,'In 2015 the CSC soccer program was launched with the intentions of keeping young males off the streets. Using the High School Health Curriculum (HSHC), CSC provides educational sessions about an array of life skills. The sessions are held once per week. Participants also engage in soccer  practice twice per week and compete in soccer tournaments. Program staff tracks school attendance and  grades to ensure support is offered where needed.\n\nThrough the use of HSHC Participants learn much more than the game:\nLeadership skills\nSportsmanship\nTeamwork\nPerseverance\nHandling winning and losing with grace\nHow to celebrate others\nSelf-Discipline','911858349594317','https://www.wearecsc.org/cosmic-wolves',NULL,'info@wearecsc.org','Verified','637158405241810','Call for information on joining the league',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'883345659611536,908163423675008','921919612082211',NULL,NULL,NULL),(623,1082503758750664,'Transition Advocacy Project (TAP)','TAP',1169351687674186,'The Transition Advocacy Project provides youth ages 13  26 and their parents with support, advocacy, information, and training in order to improve their involvement in their educational planning. TAP focuses its attention on serving and providing resources to at-risk youth and out-of-school youth through the provision of support training and guidance in an effort to effect school reform and secure appropriate transition services.\n\nThe TAP program partners with various schools and youth-serving organizations to prepare youth be effective self-advocates and to lead their educational planning. Some of our TAP partners have included Anacostia High School, Mamie D. Lee, Options Public Charter School, Sharpe Health School and Sasha Bruce Youthwork.\n\nTAP participants are encouraged to apply for a Life Enrichment Awards Program (LEAP).The purpose of the LEAP is to enrich the lives of youth and young adults with disabilities and chronic illnesses in the expanded Washington, DC metropolitan area. LEAP provides goods and services that are directly linked to youth transition planning and implementation that are usually not available from public service and government agencies. Examples of LEAP awards are technology devices, GED prep course, clothes for employment or job interviews, and books and supplies for vocational program or college.','763729877559385,641740493818315','http://www.aje-dc.org/tap/',NULL,NULL,NULL,'637158405241810','Detailed and comprehensive eligibility information is available on our website. Call for more information.',NULL,NULL,NULL,NULL,'1278097116269820,1123181686957068,602432444817544','859999387383412,1170631815352558',NULL,'930805038119118,883345659611536','578010665151939,767767048082720',NULL,NULL,NULL),(624,1087786183743790,'Southwest Health Center (Ward 6) ',NULL,1043772486617212,NULL,'590682349485236',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'900021185703447',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(625,1081790752848877,'UPO: FATHERHOOD INITIATIVE: ALWAYS ON SATURDAY',NULL,647476689662846,'Provides parenting classes, life skills, budget management, employment assistance, and education referrals to fathers and expecting fathers.','594960886051316','http://upo.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1304904589817191',NULL,NULL,NULL),(626,1094949344500644,'National Center for Children and Families',NULL,876151548923517,'Family Ties Program (FTP) is a community partnership aimed at developing and delivering comprehensive services for children in the District\'s Ward 7 and 8 who are affected by parental incarceration. It is the mission of FTP to help children between the ages of 6-12 and their siblings master appropriate developmental tasks and transitions so they can become stable and self assured, with a strong, positive sense of self. The goal of FTP is to reduce childhood trauma, stigmatization and the stress of separation caused by parental incarceration and to enhance opportunities for positive life experiences and outcomes for these children and youth. For more information, contact Temeka Parker (x43) or Katedra Sullivan (x19).','716790716916689',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'606496800787508',NULL,NULL,NULL),(627,1106419147216738,'Public Benefits',NULL,1061460575455807,'Public Benefits services include:\n\n- TANF\n- Food Stamps\n- Medicaid\n- Childcare Subsidy for families working on their TANF goals','1282660521731521','https://dhs.dc.gov/page/virginia-williams-family-resource-center',NULL,NULL,'Verified','637158405241810','Bring the following with you to access family emergency shelter:\n\n- Identification\n- Birth Certificates for each family member\n- Proof of Income\n- Proof of District residency if not established through identification',NULL,NULL,NULL,NULL,'1066322983572364','606181263945469,1047678134294030',NULL,'1227383950401000,1182980053228188,1274524177531453,565669778208779','592947414359807',NULL,NULL,NULL),(628,1107889620148311,'Skilled Nursing',NULL,1195280864464976,'Offers both 24-hour and long-term skilled nursing services including\n\nAlzheimers & Dementia Care (Secured Unit)\nRehabilitation  PT/OT/ST (Rehab to Home Program)\nWound Care Management\nMedication Management\nIV Therapy\nRespiratory Care\nComfort Care\nHospice Care\nNutritional Counseling\nPastoral Care\nRound-the-clock monitoring\nAssistance with activities of daily living (bathing, dressing, grooming)\n24/7 admissions','814720878521693','https://www.stoddardbaptistglobal.org/our-services/24-hour-skilled-nursing/',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'1257614234179117','774143429809246',NULL,'854808174954754','1230684095904498',NULL,NULL,NULL),(629,1119090357480675,'The PASS Program',NULL,1306699628219808,'The PASS Program uses an evidence-based curriculum developed in partnership with the Urban Institute to help teens make healthy and informed decisions about their bodies, relationships, personal development, self-expression and identities.','870889793389860','https://www.sashabruce.org/programs/lifeskills/pass-program/',NULL,'gbarjolo@sashabruce.org','Verified','789038541797078,941516382466411','For more information, call or email.',NULL,NULL,NULL,NULL,'1173443518827100','882054301651193',NULL,'883345659611536','1348528510348782',NULL,NULL,NULL),(630,1119572087741816,'Rapid Re-housing for Youth',NULL,948113581207578,'This program serves youth, ages 18 to 24 to facilitate stability by assisting with housing acquisition, and providing support  case management, housing retention skills, and referrals  to the participating young people to ensure established independent living.','911858349594317','https://www.wearecsc.org/family-services',NULL,'info@wearecsc.org','Verified','929094559121639',NULL,NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'883345659611536','921919612082211',NULL,NULL,NULL),(631,1067731380928038,'Find Safe Housing',NULL,983721114373124,'A web resource to help you navigate the numerous routes to safe housing here in DC. This site offers specific guidance to folks who are deaf or have a disability, seniors, LGBTQI, undocumented, living with an addiction, or have a criminal background.\n\nThe walk in clinic offers help to folks who are seeking emergency, transitional, or permanent housing. ','828792720206018','https://www.dashdc.org/housing-resource-center/find-safe-housing/',NULL,NULL,'Verified','917725171609009,929094559121639','Visit our website for guidance or visit our walk in clinic. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(632,1075486612088837,'Clothing Closet',NULL,782406976349276,'A clothing closet for those in need.','1197279412047011',NULL,NULL,NULL,'Verified','911225335803318','No application, you just need to be a DC resident.',NULL,NULL,NULL,NULL,'777587688446935','672436089248275,645766619371641',NULL,'868012483124236','826890204604396',NULL,NULL,NULL),(633,1086946181218942,'Brentwood Health Center (Ward 5) ',NULL,1043772486617212,NULL,'768745938934251',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1307775585573231',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(634,1088249391392945,'Employment & Income',NULL,1186080684764999,'3 in 5 women arrive at N Street Village with no income. Our goal is to meet her where she is and provide opportunities for income and employment growth through a variety of programs. We also recognize the importance of community in the healing and recovery process, and we promote peer mentorship and peer leadership programs that help women feel connected and empowered.\n\nOther services:\n- Referrals\n- Computer learning lab\n- Workforce Champions embedded in residential programs\n- Peer to peer counseling','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/employment-income/',NULL,NULL,'Verified','970915508638448,1077790582995406,789038541797078','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed. \n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193',NULL,NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(635,1088727091600389,'Youth Trauma Unit',NULL,1265431689708141,'PIW is pleased to announce that we have added a\ntrauma unit serving adolescents, ages 13 17.\nThe trauma informed treatment environment\nprovides inpatient therapies with medication\nmanagement. A customized treatment plan is\ndeveloped for long-term growth.\nThe Psychiatric Institute of Washington is a 130-\nbed facility with inpatient, outpatient and partial\nhospitalization programs providing treatment for\nsubstance use, trauma and mental illness.','1289140698414142','https://psychinstitute.com/wp-content/uploads/2018/08/Adolescent-Trauma-Unit-8-1-18.pdf',NULL,NULL,'Verified','637158405241810,941516382466411','Help is available and accessible 24/7. Call our Clinical Assessment Center for a free assessment to make mental health and substance use treatment referrals and\nfor up-to-date bed availability.\n(202)885-5610 or (800) 369-CARE',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'883345659611536,846861043691596','1045297656470568',NULL,NULL,NULL),(636,1096415400271835,'Direct Food Distribution Services ',NULL,1191959686811989,NULL,NULL,'https://www.capitalareafoodbank.org/what-we-do/direct-food-distribution-programs/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(637,1098750358504732,'Men\'s Ministry',NULL,1007623446966696,'The FBCD Mens Ministry provides a platform for men of all ages and backgrounds to learn from and listen to each other.  We teach men to be servant leaders at home and church and to set a righteous example for our young men.  We fellowship and break bread on the first Saturday of the month at 8:00am.','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','637158405241810','Call or visit us during our church services.',NULL,NULL,NULL,NULL,'755149488867036','930195989079825',NULL,'625195015492370','1088461256923134',NULL,NULL,NULL),(638,1108884623053766,'Workforce Development',NULL,925199151398185,'E/BFSC was awarded a Community Services Block Grant from the United Planning Organization (UPO) to implement the Readiness Individualized Support and Employment Program (RISE uP). RISE uP is E/BFSCs Workforce Development program that assists families and individuals to become more self-sufficient by securing employment, increasing educational attainment, and removing social barriers to economic success.\nEmployment readiness and placement must be comprehensive to be successful, therefore we focus on provision of educational and employment readiness opportunities, increasing job placements and post-employment retention, and providing supportive services to remove barriers to success. In 2017, E/BFSC provided workforce development services to 108 DC residents.','885824420758755,778459456343468,877263478223136,835499994326344','http://ebfsc.org/workforce-development2/',NULL,'sperry@ebfsc.org','Verified','970915508638448','For more information, please contact:\nScott Perry, Program Manager\n202-832-9400 x 127\nsperry@ebfsc.org\n\n',NULL,NULL,NULL,NULL,'1194161595371590','986926461476700,900372337520002,1142698126123180','931603038502827','1070225300187916','895959854542145,1174417076661204,1107174864513111,1141336056500287',NULL,NULL,NULL),(639,1108638663383567,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): APRA: ADOLESCENT SUBSTANCE ABUSE TREATMENT: ASTEP',NULL,833556938177872,'The District of Columbia offers four locations where young people can go to seek help for a drug or alcohol issue. If a young person, under the age of 21, lives in DC and needs help or just wants to talk to someone about his/her drug or alcohol use, he/she can contact one of the treatment providers which are available through a network of providers.','861447627614096','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1288365969354186',NULL,NULL,NULL),(640,1122242214354849,'Language Services',NULL,887352348953420,'Interpretation for meetings, support groups and other group gatherings is also available through experienced simultaneous interpreters. La Clnica provides document translation services to our community clinic partners as well as the general community.\n\nLanguage access','1170113060894673,868710877316469','https://lcdp.org/_en/programs-language-access.html',NULL,NULL,'Verified','637158405241810',NULL,NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359,887062299451299','1202170493625306,686273477676422,1136144186376874',NULL,'670413521970743,1295679372454826','1080723808883365,1214063268443455',NULL,NULL,NULL),(641,1125198539592081,'Youth Enrichment ',NULL,1178149503221687,'On-site educational and emotional development for children and young adults in program. ',NULL,'https://housingup.org/ending-homelessness/youth-enrichment/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(642,1125749101520857,'Narcotics Anonymous and Alcoholics Anonymous',NULL,1013543362848937,'We help families overcome substance abuse. Narcotics Anonymous and Alcoholics Anonymous meet every Friday from 7:00 pm - 8:00 pm.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','637158405241810','Walk in.',NULL,NULL,NULL,NULL,'905425032669080','1208529596434588',NULL,NULL,'1190125799561725',NULL,NULL,NULL),(643,1126237202836851,'Individual, Family, and Group Therapy',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(644,1135905810909481,'Connect-A-Ride',NULL,855094084464049,'Call Connect-A-Ride for answers and assistance. The Connect-A-Ride Transportation Resource Center is a free service that helps seniors and disabled adults of all ages find the transportation they need. Certified Information and Mobility Specialists help with schedules, benefits and eligibility requirements in:\n\nMontgomery County, Maryland;\nArlington and Fairfax Counties in Virginia; and\nthe Virginia cities of Alexandria, Fairfax and Falls Church.','924628911683577','https://accessjca.org/connect-a-ride/',NULL,NULL,'Verified','632609508449013','If you live in one of these jurisdictions and need transportation assistance, call Connect-A-Ride at 301.738.3252 or 703.323.6494',NULL,NULL,NULL,NULL,'1256462778437672,826005584996919','1276016050822057',NULL,'1262399029280424,854808174954754','1050035692418764',NULL,NULL,NULL),(645,1141624870158332,'Makeover Madness',NULL,855094084464049,'This program brings adults from senior facilities to the Thomas Edison High School of Technology and Gaithersburg High School for cosmetic services and friendly conversation with students.','924628911683577','https://accessjca.org/interages/',NULL,NULL,'Verified','637158405241810','Call to find out more.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'761929300455945,854808174954754','1050035692418764',NULL,NULL,NULL),(646,1142076553934088,'EmpowerGenerations',NULL,1230770757213322,'When we work with parents and children together, we can strengthen the family unit. Ultimately, this approach helps break cycles of generational poverty.\n\nIn addition to creating spaces for families to spend constructive time together, we offer both parents and youth workshops and experiences to strengthen protective factors, including:\n\nFamily communication and boundary setting\nManaging and avoiding peer pressure and risky behavior\nSetting goals and accountability practices\nHealthy conflict resolution strategies\nWe also host skill building sessions for youth and parents that cover everything from advocacy to study skills.\n\nFurthermore, all EmpowerGenerations parents are offered professional support through our Career Education & Training Center.','771897230838212','https://www.ywcanca.org/what-we-do/youth-mentoring-development/empowergenerations/',NULL,'youthprograms@ywcanca.org','Verified','970915508638448,789038541797078','Call to learn more about this program.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'915486946336080,998189789977161,1292849277583603','1330181492619505',NULL,NULL,NULL),(647,1140570813901169,'Programs for Renters',NULL,574964812525513,'The Inclusionary Zoning (IZ) program of the District of Columbia allows income eligible households to purchase or rent housing at below market prices. The DC government provides incentives to developers to set aside certain units for low- to moderate-income households for purchase or rent through the IZ program in order to preserve affordable housing in the city.\n\nFor the opportunity to purchase or rent an IZ unit, income eligible households must attend an Inclusionary Zoning Orientation AND register for the IZ lottery on the DC Department of Housing and Community Developments (DHCDs) website (http://www.dhcd.dc.gov).','947853021041099','http://housingetc.org/programs-for-renters/',NULL,'iz.adu@housingetc.org','Verified','929094559121639,1077790582995406','Orientations  We conduct Inclusionary Zoning Orientations once a week at different times, days and locations. Click Here to register. Orientations fill up quickly but we do have a generous walk-in policy. If the session you wish to attend is posted as FULL, you should still consider attending and arriving 10 to 15 minutes early. We will not hold seats for registrants who are late or fail to show. As a result, we have found that we are able to accommodate most walk-ins. Walk-ins will be seated on a first-come first-seated basis as long as seats are available. Fifteen minutes after the event start time you may not be seated.\n\nCertifications  We provide required certifications for households selected in the Inclusionary Zoning lottery. To schedule an appointment to obtain your required certifications, please email your request and a copy of your lottery selection notice to us at iz.adu@housingetc.org or call 202-667-7006.',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,NULL,'1138176448388213',NULL,NULL,NULL),(648,1080520592440176,'Sexual Assault & Trauma',NULL,769893937425938,'Sexual Assault and Trauma\nAt the Wendt Center, we view sexual assault as a broad term for unwanted sexual contact including rape, date rape, acquaintance rape, sexual abuse, incest, marital rape, childhood sexual abuse, molestation, or any other unwanted sexual contact. We offer individual and group counseling for survivors.','1108850981657232,1166799153375505','https://www.wendtcenter.org/sexual-assault-and-trauma/',NULL,NULL,'Verified',NULL,'If you or someone you know has been sexually assaulted, encourage them to reach out and get help. The Wendt Center offers individual and group counseling for survivors. Please call our intake coordinator at 202-624-0010.\n\nIf you are not ready for counseling, consider calling a hotline for survivors:\n\nDC Rape Crisis Center (202-333-RAPE) or the Rape\nAbuse and Incest National Network (RAINN; 1-800-656-HOPE or online\nChildren Experiencing Sexual Abuse http://www.safeshores.org/contact_us.htm\nOtherwise, the Wendt Center offers individual and group counseling for survivors. Please call our intake coordinator at 202-624-0010.\nTo become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'1071202278113160,801719759212724,1137743103213639','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(649,1077603109327544,'Opioid Dependence Treatment',NULL,807867907645287,'PIDARC provides pharmacological intervention through methadone maintenance along with a variety of other therapeutic modalities. PIDARCs patients are adults, 21 years of age or older, with opioid dependence, including heroin, oxycontin, and other prescription narcotic pain medications.','945081690439180','https://pidarcdc.org/treatment/',NULL,NULL,'Verified','637158405241810,941516382466411','Call to speak with an intake coordinator to briefly discuss your substance abuse history, prior treatment, and your current drug use to make an initial determination of your general eligibility for treatment at PIDARC. If you are eligible, you will then be given an appointment for a comprehensive assessment that will require you to be at the clinic for 3-4 hours. You must show photo identification upon arrival. A licensed counselor will meet with you to conduct a biopsychosocial history. In addition, you will receive a physical examination, including blood work and urinalysis the same day, if possible. If it has been determined that you are not qualified, a referral for appropriate services will be made.',NULL,NULL,NULL,NULL,'612423782652894','1209165521563443',NULL,'787691393603128,912906147241865','1253212858247868',NULL,NULL,NULL),(650,1080060911179544,'Health Care',NULL,618997848324116,'We provide primary care for all ages. Our dental, vision, and behavioral health clinics only see patients who come to Bread for the City for their primary health care. This allows our doctors to offer high-quality, coordinated, comprehensive services to every patient.\n\nThe clinic also provides examinations, medications, lab tests, and referrals to patients, regardless of their ability to pay.','858837023472383','https://breadforthecity.org/health/',NULL,NULL,NULL,'941516382466411','Call for an appointment.',NULL,NULL,NULL,NULL,'732018700373297','1303318889724324,731523024235409,1109708466726726',NULL,NULL,'941976438893110',NULL,NULL,NULL),(651,1080087105483732,'Pool',NULL,1004391421304549,'ACSGW operates the swimming pool located in the Piney Branch Elementary School under a contract with the Montgomery County government. This is a six-lane, 25-yard pool, ranging in depth from 3\' to 10\' with one operational sliding board. Dressing and locker rooms are adjacent to the pool.','1115728022119882','https://www.acsgw.org/pool.html',NULL,NULL,'Verified',NULL,'Hours vary by season so visit our website or call to confirm when we are open currently.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'1277125914875683',NULL,NULL,NULL),(652,1090262984895790,'Education',NULL,782302579547834,'The Arc of the District of Columbia is pleased to partner with the District of Columbia Public Schools Transition Program where we assist school administrators and teachers to support students to:\n\nincrease their knowledge and use of community resources\npractice lessons learned in the classroom within their community\nenhance their self-determination skills\nconsider career paths and future employment opportunities\norganize their experiences and discoveries in to student portfolios\nIn addition to coordinating community-based instructional opportunities, The Arc of the District of Columbia also assists students to obtain volunteer and paid employment positions and delivers professional development workshops to schools personnel. The Arc of the District of Columbia is currently working with students and teachers at:\n\nAnacostia High School\nBallou High School\nBenjamin Banneker High School\nCardozo Education Campus\nEastern High School\nMamie D. Lee School\nWoodrow Wilson High School',NULL,'https://arcdc.net/programs/education/',NULL,NULL,'Verified','789038541797078','Call for more information. For participating schools you can also speak to administration.',NULL,NULL,NULL,NULL,NULL,'828558772845010',NULL,NULL,NULL,NULL,NULL,NULL),(653,1090898575973829,'Citizenship',NULL,1140996665222837,'CASAs comprehensive citizenship initiative includes citizenship education, mentoring and interview preparation, application assistance, and post-naturalization support. Through an innovative partnership with the AmeriCorps program , trained AmeriCorps members provide these services at various locations throughout the state. As a part of the citizenship program, CASA operates a low-interest micro-loan program to assist Legal Permanent Residents (LPRs) afford the naturalization application fee. In addition, CASA provides financial education assistance including tax preparation, individual counseling, and workshops on issues such as: obtaining identification documents (Individual Tax Identification Number, passport, consular identification, and drivers license), opening a bank account, debt analysis, financial planning, and creating a budget.\n\nOur services are:\n\nEligibility Analysis: Free for CASA members ( Meeting with a specialist to analyze your case and a complete a prescreen form, your prescreen form will be reviewed by a BIA accredited or Immigration Attorney)\nPreparing Citizenship application ( completing N-400 form)\nIn addition to our Citizenship services we are offering assistance filling out:\nCompleting the application for the certificate of Citizenship ( form N-600):\nCompleting the application for renewing or replacing the green card ( Form I-90)\nFamily Petitions (just in our Woodbridge and Falls Church Offices) call for more information to 571-421-2211 to know requirements needed.\nIt includes: Petition for an Alien Relative ( Form I-130), Adjustment of Status ( Form I-485) Affidavit of Support ( Form I-864) and Employment Authorization\nForm I-751 Petition to Remove Conditions on Residence (Just in our Woodbridge and Falls Church offices) Call 571-421-2211 for more information and requirements needed.\n','1283411988337750,1318390042587758,1091888223201074','https://wearecasa.org/programs/citizenship/',NULL,'cmantilla@wearecasa.org','Verified','917725171609009','After making the great decision of becoming a U.S citizen, filling out your application for citizenship (Form N-400 Application for Naturalization) is the next step towards your goal. At CASA, we stand by ready to help you through the application process. All consultations are private and completely confidential. Our citizenship promoters can:\n\nGuide you through filling out the N-400 Application for Citizenship.\nHelp you understand USCIS correspondence.\nTell you where to go to obtain any necessary documents.\nRefer you to an immigration attorney, if you should you need one.\nEnroll you in a citizenship class.\nMentor/tutor you to get you ready for your interview.\n\nFor information about fees and requirements please call :\nCASA IN VIRGINIA: 571.421.2211 or Email to cmantilla@wearecasa.org\nCASA IN MARYLAND: 240.491.5765',NULL,NULL,NULL,NULL,'1218289339018813,914445625577149,1111869997679664','554499668370440,838436995923944,871634714393410',NULL,'1340162113833071','807881417777661,661561769394810,1140367088046682',NULL,NULL,NULL),(654,1092577874332799,'Postpartum Support Services',NULL,1088589897673997,'Covered within all postpartum care are the following services:\n\n- Breastfeeding, pumping, returning to work and bottle nursing education \n- Infant care education (including bathing, feeding, and safety education) \n- Safe sleep and co-sleeping education \n- Infant development education\n- Babywearing information \n- Parenting education\n- Light food preparation \n- Light housework\n- Nutrition guidance for breastfeeding\n- Providing referrals for local resources','1191890430739322','https://www.mamatotovillage.org/postpartum.html',NULL,NULL,'Verified','637158405241810','Call the intake line or fill out an initial inquiry form on the website.',NULL,NULL,NULL,NULL,'644056895061746,867238429645312','1259025264194553,840380756273952',NULL,'915486946336080','948258077222906',NULL,NULL,NULL),(655,1096928318806733,'Family Group Conferencing',NULL,948113581207578,'A time for families to come together to find solutions to problems that strengthen the family unit. \n\nA meeting that places you and your family members at the center of the decision making process.\n\nA time for you to set goals and outline the necessary steps to achieve those goals with the help of people who can put your plan into action.\n\nA sessions that takes place in a location of your choice. This session may take as long as necessary to complete your plan.','911858349594317','https://www.wearecsc.org/training-institute',NULL,'info@wearecsc.org','Verified','637158405241810','Call to set up an appointment.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'1292849277583603','921919612082211',NULL,NULL,NULL),(656,1098880366371154,'Food Distribution Sites',NULL,1091687465844379,'Provides food for those in need.','757770995905648,1340365653627144,1299927078956313,902044061825216,794544831800797,1019389671178070,636804178113511','https://www.mannafood.org/about/contact-manna/manna-food-distribution-sites/',NULL,NULL,'Verified',NULL,'Walk in.',NULL,NULL,NULL,NULL,'1181713169181704','1290585332942139,1120182591462010,864730590452624,782763514132873,688366505677747,691575783329891,1291723002835070,833118659201120,919516814699587,821589713313328,1086583396819017',NULL,NULL,'1201700034845635,926831253898451,875676966431621,797118402416406,1141293492392934,834422660772346,1323399831811616',NULL,NULL,NULL),(657,1096755308957020,'Mental Health Treatment Services',NULL,887352348953420,'La Clnica currently provides bilingual, culturally competent group, individual, and couples therapy, using a trauma-informed approach and specializing in family trauma, depression, PTSD, and dual diagnoses.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(658,1109924174096172,'Assertive Community Treatment (ACT)',NULL,1326157862705937,'MBI ACT program provides 24/7 team-based integrated, multidisciplinary, flexible treatment and support to people with severe mental illness who are more at-risk of psychiatric crisis and hospitalization and involvement in the criminal justice system. We believe people receive better care when their mental health care providers work together. We have psychiatrist and nurse on the team and we work closely with each other to best support our clients achieving psychiatric stability. On top of that, we help our clients address every aspect of their life, whether it be medication, therapy, social support, employment, legal issues or housing. Our goal is to support our clients working through their general recovery needs, developing desired skills for independent living and achieving the best quality of their life.','602791638266539','http://www.mbihs.com/what-we-offer/assertive-community-treatment-%28act%29',NULL,NULL,'Verified','941516382466411','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824,1131051329814284,879651358762725',NULL,NULL,NULL,'1220655046642450',NULL,NULL,NULL),(659,1109436994306012,'Public Benefits/Income Maintenance/Health Law',NULL,820488001755900,'We will consider handling the following types of cases for clients that meet our income guidelines:\n\nDenial of benefits\nTermination of benefits\nClaims that you were overpaid\nNLSP can help clients obtain and preserve the following public benefits:\n\nTANF\nFood Stamps (SNAP)\nUnemployment\nSupplemental Security Income (SSI)\nSocial Security Disability Insurance (SSDI)\nMedicaid\nMedicare\nOther health care benefits\nVeterans benefits\nIf you believe you have been wrongfully denied access to income supports or health benefits please contact us. If we cannot assist you, we will help find an organization that can.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/public-benefits-income-maintenance-health-law',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(660,1128282500996664,'Street Outreach',NULL,791950857737387,'Friendship Place canvases the street to connect with men and women experiencing homeless. We reach out to them where they are; be it the street, or places like parks, store fronts, and church parking lots.\n\nOur Specialists provide outreach services throughout the week and focus on the hardest-to-serve i.e. those who have been on the streets for an extended period of time, who have mental health and/or substance abuse issues, and who are disconnected from public health systems (or CoC).','931886810745529','https://friendshipplace.org/programs-outreach/street-outreach/',NULL,NULL,'Verified','929094559121639','To receive help from the Street Outreach program, please call 202.364.1419 or visit our Welcome Center located at 4713 Wisconsin Ave NW, Washington, DC 20016.',NULL,NULL,NULL,NULL,'956844133947886','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'877243931325915','1152494666421051',NULL,NULL,NULL),(661,1133092295870518,'CHINATOWN SERVICE CENTER: SUMMER ENRICHMENT PROGRAM',NULL,769347676481702,'Aids elementary students for 6 weeks during the summer months by enhancing English and mathematics skills, teaching students songs and allowing students to participate in arts and crafts.','1195857100779606','http://cccdc.com/chinatown-service-center/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'809466173644410',NULL,NULL,NULL),(662,1135621422748851,'RSA & Supported Employment Services',NULL,1326157862705937,'Our Rehabilitation Services Administration Division is hosted by the U.S. Department on Disability Services, (DDS), and focuses on nurturing, educating, and preparing those with behavioral and physical disabilities for the ever-changing scenes of a work environment. With professionals that have over 30 years of placing individuals with disabilities into jobs worth having, we are certain that we can work with you in gaining a comfortable work life and living. However, the journey always begins with the mindset and heart of the individual. \n\nHere are a few employment options that we can provide to you if you qualify:\n\nOffice Support\nTeacher Assistants\nSecurity Personnel\nFood Services & Utilities Personnel\nWHSE & Cashiers\nJanitorial Duties\nCDL / Truck Training\nDispatchers & Operators\nResidential & Commercial Cleaning\nCustomer Service Representatives\nAirport Worker Personnel\nState & Government Personnel\nThose admitted into our RSA program undergo a 90 day-program whereby the individual is given assistance with the transition and adaptation period of acquiring and maintaining a new job.  This is coupled with our Supported Employment Services. ','959978038980815','http://www.mbihs.com/what-we-offer/rsa-0024-supported-employment-services',NULL,NULL,'Verified','970915508638448','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'817410769508748',NULL,NULL,NULL),(663,1139270346999526,'Aftercare',NULL,1146223650874517,'Clients benefit from ongoing contact with case-management staff to support them in their independence, including counseling, referrals to community-based services, and advocacy.\nUpon exiting the residential and non-residential programs, clients benefit from ongoing contact with case-management staff to support them in their independence. Services include counseling, referrals to community-based services, and advocacy as needed for a minimum of 90 days.  Our goal is to provide active outreach and assist clients in building long-term supportive systems within their communities, to reduce the likelihood of future victimization.',NULL,'https://mysistersplacedc.org/programs-services/',NULL,'info@mysistersplacedc.org','Verified','637158405241810','For more information, contact My Sisters Place at 202-540-1064 to learn more about our services.',NULL,NULL,NULL,NULL,'796866824967986','584619367978739',NULL,'836091364973509,1212718840001878',NULL,NULL,NULL,NULL),(664,1135056817241313,'Erna\'s House',NULL,1186080684764999,'Ernas House is a Housing First model of permanent supportive housing for 30 women with personal histories of chronic homelessness and disabling conditions. This residence offers efficiencies and one-bedroom apartments. Residents enjoy social and therapeutic activities and have access to case managers who provide assistance as they seek to achieve and maintain highest quality of life.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(665,1138943294791040,'Forensic Services',NULL,1164024351359039,'Safe Shores Forensic Services team coordinates and conducts neutral, fact-finding, and developmentally sensitive interviews with children affected by abuse and witnesses to violence. In partnership with the Multidisciplinary Team agencies, our highly trained forensic team conducts one-on-one interviews with children, while team members watch on closed-circuit television, in order to not overwhelm the child while at the same time gathering as much information for various partners. Our goal is to ensure that the voices of children are heard and to prevent the need for a child to tell his or her story more than once.','1101386810121427','https://www.safeshores.org/get-support/our-services/',NULL,NULL,'Verified','637158405241810','Safe Shores will conduct a forensic interview after a report of child sexual or physical abuse is made to DC CFSA or the MPD.',NULL,NULL,NULL,NULL,'1171658960657370','597458689446427',NULL,'1274396898894043,915486946336080','960248296759213',NULL,NULL,NULL),(666,1146357672886284,'Emergency Housing',NULL,964008795352849,'Our emergency housing program provides beds for ten single adult men for a maximum stay of 4-6 weeks. On site case management, linkage to entitlement and medical providers are some of the services offered to clients.','803526594539754','http://www.rapinc.org/medical.html',NULL,NULL,'Verified','929094559121639','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'625195015492370,877243931325915','601647045974328',NULL,NULL,NULL),(667,1147690047097756,'Intergenerational Resource Center','IRC',855094084464049,'Intergenerational Resource Center (IRC) provides technical assistance to individuals and organizations interested in developing intergenerational programming in the community. IRC meetings are held throughout the year and an e-newsletter featuring ideas and trends in intergenerational programming is distributed on a regular basis.','924628911683577','https://accessjca.org/interages/',NULL,NULL,'Verified','637158405241810','Call to find out more.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'761929300455945,854808174954754','1050035692418764',NULL,NULL,NULL),(668,1153502278841700,'Non-Offending Caregiver Support Group',NULL,1164024351359039,'Support from a caregiver is the single most important factor in promoting a childs healing after abuse has occurred. Discovering that their child has been abused or harmed in some way can bring about a mix of emotions for caregivers, from guilt to anger to fear. Caregivers most often want to help their child but can feel overwhelmed; not knowing how to best support or talk with their child. Safe Shores Caregiver Support Group connects caregivers with others facing similar challenges, and provides education, crisis support, and self-care tools.','1101386810121427','https://www.safeshores.org/get-support/our-services/prevention-and-outreach-program/',NULL,'groups@safeshores.org','Verified','637158405241810','If you would like to join the group or if you would like to make a referral, email groups@safeshores.org, and a staff member will contact you with information and next steps.',NULL,NULL,NULL,NULL,'1171658960657370','597458689446427',NULL,'915486946336080','960248296759213',NULL,NULL,NULL),(669,1153264572449660,'D.C. PUBLIC LIBRARY SYSTEM',NULL,1295401458610005,'The DC Public Libraries have varying hours of operation and all offer a wide range of services. Beyond checking out books, the Library offers adult education/literacy courses, computer courses, tax preparation assistance, college planning services, and services for job seekers. For more information on each specific library branch refer to the DCPL website. Residents of the DC Metropolitan Area can apply for a library card online or in person by providing identification that includes name and address.','928679802213891','http://dclibrary.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1042280248130731',NULL,NULL,NULL),(670,1086482131081597,'Individual and Systems Advocacy',NULL,964889233755760,'DCCIL advocates for improved accessibility, and assists people transitioning from nursing homes to independent living in their communities. DCCIL staff advocate on an individual and system-wide basis to ensure the civil and human rights of people with disabilities.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','917725171609009','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(671,1094845253700469,'Citizenship Oath Ceremony and Voter Registration',NULL,1116810105858975,'CARECEN often celebrates its students\' naturalization by taking part in the oath ceremony or organizing community events where new citizens and CARECEN graduates can share their interview/exam experience with their peers. CARECEN also follows up to encourage voter registration and civic participation.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(672,1107300725870426,'Core Services',NULL,1220107638243156,'All clients initially meet with one of our psychiatrists to determine if they could benefit from medication management. Most clients make the decision that medications would help them, though all clients have the option of taking medication or not. Medications are prescribed to address the symptoms expressed by the client and observed by the doctor. Follow-up visits are scheduled, often every four weeks, so the doctor can determine how well the medication is working and whether or not there are any troubling side effects. The doctor works alongside one of our nurses, who also checks for physical conditions. The nurse often makes referrals to the clients primary care provider and follows up to make sure that the clients health is optimal. When needed, the Community Support Specialist assists the client in filling prescriptions.\n\nMcClendon Center is certified by the DC Department of Behavioral Health as a Core Services Agency (CSA). At the CSA, we provide four core services:\n\nIntake Assessment\nMedication Management\nCommunity Support\nCounseling\nOur CSA is staffed by Licensed Independent Clinical Social Workers, Team Leaders, a team of Bachelors-level Community Support Specialists, Registered Nurses, and a number of part-time Psychiatrists, five of whom are third and fourth-year psychiatry residents from George Washington University. All the staff work together in multi-disciplinary teams to provide Mental Health Rehabilitation Services. We also operate a 24/7 on-call service to meet clients needs after hours and on weekends.','968722175760593','https://mcclendoncenter.org/programs/core-services/#toggle-id-2',NULL,'info@McClendonCenter.org','Verified','941516382466411','To make an intake appointment, please call the Access Help Line at 1-888-793-4357. This is a service provided by the Department of Behavioral Health, and is answered 24 hours each day.\n\nClients can assist in the intake assessment by having the following information with them:\n\nMedicaid and/or Medicare numbers\nName and number of an emergency contact person\nName and number of their next of kin\nName and number of their primary care physician\nList of all medications being taken\nDates and locations of any hospitalizations',NULL,NULL,NULL,NULL,'883515995625764','641591436499223',NULL,NULL,'1141142036651515',NULL,NULL,NULL),(673,1102547057482287,'CATHOLIC CHARITIES: DOWNTOWN FAMILY CENTER',NULL,663729632205210,'Provides emergency assistance, adult education, family support, Parish Support, and crisis resolution. Also provides a computer lab and a number of classes including a Professional Counseling Education Program and Spanish classes.','546085340417620','http://catholiccharitiesdc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1072933446361784',NULL,NULL,NULL),(674,1106825602268001,'Emergency Psychiatric Evaluations',NULL,1061724977026001,'Be assured that at any time of day, our specialists are available by phone for consultation and for emergency psychiatric evaluations in the Emergency Department  24 hours a day, seven days a week.\n\nOur team of child and adolescent mental health clinicians care exclusively for children. Our specialists have the expertise to recognize psychiatric disorders in children and the experience to recommend the most appropriate next steps in care.\n\nWe assess patients in crisis and determine whether a patient would benefit from inpatient psychiatric services or can be safely discharged and seen at a follow-up visit with outpatient services.\n\nIf a child or adolescent needs to be admitted, the staff facilitates the most appropriate admission for each patient.\n\nPlease note that we do not provide medication evaluations in the Emergency Department.','1282604214927911,812651859569539,753725216657831','https://childrensnational.org/departments/psychiatry-and-behavioral-sciences',NULL,NULL,NULL,'941516382466411,878986697513222,968511154801619','Walk in for services. Call for more information.',NULL,NULL,NULL,NULL,'1148967777928261','1114212408169049',NULL,'1274396898894043','928813128095347,624416318221093,759955074598501',NULL,NULL,NULL),(675,1110554525256285,'Health & Fitness',NULL,1007623446966696,'Our Nurses Ministry along with our resident fitness gurus work year round to provide health services and fitness sessions to members, visitors and neighbors. Blood pressure screenings occur after morning service every 3rd Sunday. Our Community Health Fair and Health Walk are held annually on the second Saturday in April and includes cholesterol and HIV screenings, dental checkup, fitness classes, nutrition and health insurance information, and DOOR PRIZES.','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','941516382466411','Call or visit us during our church services. Blood pressure screenings occur after morning service every 3rd Sunday.',NULL,NULL,NULL,NULL,'755149488867036',NULL,NULL,NULL,'1088461256923134',NULL,NULL,NULL),(676,1114943570667214,'Food Pantry ',NULL,1013543362848937,'We give away free groceries every 2nd Saturday from 11:00 am - 1:00 pm. ','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','832990803111047','Sign-up is required. Call the church office (202-398-3411) to sign-up.',NULL,NULL,NULL,NULL,'905425032669080','1146330288608786',NULL,NULL,'1190125799561725',NULL,NULL,NULL),(677,1129649174532000,'WHITMAN-WALKER HEALTH',NULL,548126332764833,'A program of Whitman-Walker Health is offering free individual and group therapy to youth and young adults who have experienced or witnessed a crime. The program is completely voluntary and partners with clients to meet their own individual needs while providing culturally competent, trauma-informed care and treatment. This program aims at reducing barriers for youth/young adults in accessing mental health services. Clinicians will meet clients where they are, both physically within the community and emotionally during treatment. Criteria for enrollment in these services includes the following: Ages 13-24 years old; Witnessed or experiences a crime (no police report required). For more information about this program or to make a referral, please contact Timothy Elliott at (202) 207-2361 or telliott@whitman-walker.org.','1272844736960116','http://whitman-walker.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1200033126219686,762317978058760','958680649440929',NULL,NULL,NULL),(678,1145687738484263,'Primary Care',NULL,1220981589179778,'The UMC Primary Care Center helps you manage your overall health by providing preventive care, annual physicals and treatment when you are ill.\n\nOur primary care practice provides comprehensive care at 1310 Southern Avenue, SE, and within the community via our Mobile Health Clinic. The practice includes team of expert physicians who specialize in Internal Medicine and Family Medicine. By selecting a UMC primary care provider, you will have access to all the services and medical professionals at UMC  acute care, physician specialists, preoperative procedures, radiology, emergency department care, skilled nursing facility access, and more.','620132940242525','https://www.unitedmedicaldc.com/primary-care/',NULL,NULL,'Verified','941516382466411','Call to schedule an appointment.',NULL,NULL,NULL,NULL,'779773845250525,634348163252280','854915524932802,889948989559604,773644966794633',NULL,NULL,'818226241830087',NULL,NULL,NULL),(679,1157294466052185,'Spiritual Support Services',NULL,883186000200856,'The purpose of Spiritual Support Services is to provide strategies on how a client can incorporate spirituality into their recovery process.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(680,1154397851156755,'Special Circumstances Program',NULL,726173106231202,'Men who do not qualify for other programs but need short-term residential services and support can participate in the Special\nCircumstances Program. Participants must be involved in a productive activity that will lead to self-sufficiency, such as school, training or part-time employment.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(681,1162076105935592,'GREATER WASHINGTON URBAN LEAGUE: D.C. EMERGENCY ASSISTANCE FUND',NULL,649101984743047,'Provides rent/mortgage and utility assistance to individuals and families living in Ward 5 of the District of Columbia through the D.C. Emergency Assistance Fund.','875107767611380','http://gwul.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'825051851809001',NULL,NULL,NULL),(682,1098998360726289,'Social Services',NULL,795756022910298,'Ayuda supports and protects immigrant victims of domestic violence, sexual assault, stalking, and human trafficking, as well as neglected children and youth. Whether someone is in crisis and needs immediate protection or a family requires long-term assistance, Ayudas social workers are there.\n\nSocial workers work with our clients to identify their unique needs and goals. We then work with community resources to help them find emergency and transitional shelter, food, clothing, or medical and mental health care for themselves and their children. Ayudas services also include safety planning, crisis intervention, emotional support, and trauma-informed therapy so these survivors can heal and recover.\n','1161498401444320,833655491101686,1183432963433388','https://ayuda.com/what-we-do/social-services/',NULL,NULL,'Vetted','637158405241810','You are not required to receive social services to participate in other Ayuda services. You can access this service after intake.',NULL,NULL,NULL,NULL,'910170559958808,1097812419353578,602586439838395',NULL,NULL,NULL,'738259216161094,1255038891038036,1136426278579096',NULL,NULL,NULL),(683,1100791575997951,'Promoting Homeownership and Asset Creation',NULL,1116810105858975,'Traditionally, CARECEN housing staff has provided first-time homebuyer counseling and assisted clients with the home purchasing process, including credit and financial planning and homeownership guidelines. CARECEN has also assisted tenant associations through the building acquisition, rehabilitation and conversion process from rental property to affordable condos. Please visit the economic development page for more details. Our program also works to preserve existing homeownership through education and assistance to prevent foreclosure.','547920365968268','http://carecendc.org/direct-services/housing-services/',NULL,'info@carecendc.org','Verified','917725171609009,929094559121639','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1295679372454826','842193303927915',NULL,NULL,NULL),(684,1102556254964153,'Children\'s Law Services',NULL,1097944906840777,'Provides comprehensive legal services to advocate for and protect vulnerable children in DC. Topics range from housing, to education, to neglect, to the foster care system, and more.\n\nServices are not by specific program but rather focused on the child in question. Often cases are referred to by the courts.','916631371752727','https://www.childrenslawcenter.org/',NULL,NULL,'Verified','917725171609009','Call or walk in to get help. A court referral may be necessary in some cases.',NULL,NULL,NULL,NULL,'1337254835856329',NULL,NULL,'1274396898894043','853785764079416',NULL,NULL,NULL),(685,1104683959276927,'Pastoral Counseling',NULL,1276678931351667,'Dealing with the everyday problems of living and making choices. Learning how to depend on God in faith believing that success is possible, with help in confidence and trust.','1001921907887485','http://www.nazareneoutpostministries.org/programs-and-services/',NULL,NULL,'Verified','637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'842254025136504',NULL,NULL,'651281137045548','753150645151105',NULL,NULL,NULL),(686,1104601682011881,'D.C. OFFICE OF THE CHIEF OF POLICE',NULL,1278050819659890,'Provides Crisis Intervention services, including Immediate need mental health, protection, victim, or legal assistance','771071731283748','http://www.mpdc.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'953544198636965',NULL,NULL,NULL),(687,1101603153311416,'Unity at Downtown Bid (Ward 2) ',NULL,1043772486617212,'Healthcare for homeless','1220976687659768',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'857164237533130',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(688,1104456609971378,'Chloe\'s House',NULL,1306699628219808,'Chloe House is a group home for teenage girls referred by the DC Department of Youth Rehabilitation Services. It offers residential care, counseling, and life skills development activities including educational and employment opportunities. Chloe House was named for Tabara Chloe, a former participant of several Sasha Bruce Youthwork programs who established a life-long relationship with the organization.','773029335736391','https://www.sashabruce.org/programs/safehomes/chloe-house/',NULL,'jmurray@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program. ',NULL,NULL,NULL,NULL,'806785633721659','882054301651193',NULL,'998189789977161','1331024333739197',NULL,NULL,NULL),(689,1123263717880462,'Community Based Intervention',NULL,883186000200856,'An intensive program designed to avoid family disruption and out of home placement for the adolescent.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(690,1122897671715969,'Food Pantry',NULL,1228099889682852,'Provides food assistance, free of charge, to individuals and families that are in need. Other services include clothing, prayer, counseling, and a link to community resources.','904892331647550','http://cityofpraisechurch.com/community/',NULL,NULL,'Verified','832990803111047,911225335803318','Walk in.',NULL,NULL,NULL,NULL,'600625677788643','897487189856933',NULL,NULL,'818242711886355',NULL,NULL,NULL),(691,1120743935334776,'Pre Marital Counseling',NULL,1276678931351667,'A three session introduction to the complexity and dimensions of the marital relationship, required for those seriously contemplating marriage.','1001921907887485','http://www.nazareneoutpostministries.org/programs-and-services/',NULL,NULL,'Verified','637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'842254025136504',NULL,NULL,'651281137045548,835895554702710','753150645151105',NULL,NULL,NULL),(692,1121979483597520,'Birth Services',NULL,1195870505334629,'Our certified nurse midwives are on call 24 hours a day, seven days a week to accommodate your babys arrival schedule.\n\nOur eight midwives support births at Washington Hospital Center and at our free-standing birth center, Family Health and Birth Center. The birth center option is available to eligible low-risk women each month and provides a relaxed and caring setting for you to give birth on your terms, in the two beautiful, home-like birth rooms.\n\nIf you are a current patient with questions about whether you qualify for an out-of-hospital birth, please contact Ebony Marcelle, Director of Midwifery, at emarcelle@cohdc.org .\n\nWe offer a variety of services for our mothers during and after their pregnancy! Our midwives provide prenatal care, including groups, throughout your pregnancy. In addition, we connect our moms to our doula services and provide breastfeeding and other postpartum services. We\'ll also provide pediatric care for your newborn.\n\nMonthly individual visits with a midwife during the first half of your pregnancy\n\nAt each prenatal visit, learn more about your body, your baby and the choices you have for care.\n\nTransfers\n\nWe accept transfers up to 37 weeks for hospital birth only\n\nNo more than 32 wks with records for birth center birth option.\n\nCenteringPregnancy group care starts after your 6th month of pregnancy \n\nCentering is a fun and supportive way of providing prenatal care in a group setting. Talk to other pregnant moms about what matters to you, ask your doctor or midwife  and complete lots of fun activities: belly casting, eating snacks, and the chance to win prizes and gifts. Learn more on our website. \n\nBreastfeeding Support and Education \n\nOur breastfeeding experts educate you about the benefits of breastfeeding your baby and provide tips on how to breastfeed.\n\nAfter birth, we provide breastfeeding support: home or hospital visits, phone calls, drop in office visits, and a Mom and Baby Day session covering SIDS, baby care, birth control and infant development.\n\nBirth Center 101\n\nThe last Tues of every month\n**Please Note: There will not be a Birth Center 101 in December due to Christmas**','1000709017081839','https://www.communityofhopedc.org/healthcare/birth-services',NULL,'eroebuck@cohdc.org',NULL,'941516382466411,637158405241810','If you are a current patient with questions about whether you qualify for an out-of-hospital birth, please contact Ebony Marcelle, Director of Midwifery, at emarcelle@cohdc.org. If you are not a patient yet, call to set up an appointment.',NULL,NULL,NULL,NULL,'785030046200943','1133644382136224,849922591487683,774772066237737,922694115907703,1197713243335218',NULL,'1182104828841650','920259856619905',NULL,NULL,NULL),(693,1123977616675533,'WASHINGTON LEGAL CLINIC FOR THE HOMELESS',NULL,1189531744334079,'The core of the Legal Clinic\'s work, through the Legal Assistance Project, is the representation of individual low- and no-income clients through a network of over 200 volunteer attorneys and legal assistants. Volunteers obtain clients on a referral basis or at one of 7 intake sites run by the Legal Clinic at meal programs, health clinics, and day programs throughout DC. Volunteer attorneys participating in the project represent people on issues including: public benefits (e.g., SSD, SSI, medical assistance, food stamps and TANF); shelter and housing (e.g. shelter placement, conditions and expulsions, public housing, Housing Choice Voucher Program eligibility and terminations, and housing condition disputes); street rights; and consumer debt/credit. Please contact the Legal Clinic\'s main line at (202) 328-5500 for the most up-to-date scheduling information.','786926809235258','http://legalclinic.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1094557326565656',NULL,NULL,NULL),(694,1125350403679270,'Economic Empowerment',NULL,931366816861797,'Focuses on economic empowerment services including job training, counseling and placement, GED, tax assistance, financial management, adult computer learning, resume development, and individual development accounts.','1098817401970888','https://www.perryschool.org/services',NULL,NULL,'Verified','970915508638448,789038541797078,1077790582995406','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372','802405581688320',NULL,'1263089203668614,1292849277583603','896277574789110',NULL,NULL,NULL),(695,1133489323155206,'WIC Clinics ',NULL,1043772486617212,NULL,'764535834724222,806168781795597,933134498085222,1232398464032126','https://www.unityhealthcare.org/services/wic-program',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(696,1137250454182986,'Crime Victims Assistance Partnership (CVAP)',NULL,1141864402494387,'Crime Victims Assistance Partnership (CVAP)\nThe Crime Victims Assistance Partnership (CVAP) seeks to educate, support, and assist victims and their families with the financial burden brought about by the tragic occurrence and aftermath of violent crime in the District of Columbia. CVAP assists with reimbursement or direct payment to providers for services necessary as a result of crime (such as medical treatment) that are not covered by sources such as private insurance, medical aid programs, or other benefits.\n\nCVAP, led by the Asian Pacific American Legal Resource Center, consists of the D.C. Crime Victim Compensation Office, the Mayors Office of Asian and Pacific Islander Affairs, the Metropolitan Police Department (Asian Liason Unit), and other community partners. The program is funded by the Office of Victim Services of the Executive Office of the Mayor. Through CVAP, APALRCs services include educating the Asian Pacific American community about public safety, reporting crimes, and assisting victims with applying for crime victim compensation. Since the project began in 2001, the APALRC has screened over 600 victims and has assisted nearly 100 Asian victims applying for compensation.\n\nIf You Have Been a Victim of a Crime in DC\n\nIf you have been a victim of a crime that occurred in the District of Columbia and have been determined to be eligible for compensation through CVCP, the APALRC can help with the application process and case management. This may include payment for medical costs, lost wages, and other compensation costs that have directly resulted from being a victim of a crime.\n\nWe will assist with filling out the application, compiling supporting documents and evidence, and being the point of contact with the DC Courts in managing your case.','1264011549910449','https://www.apalrc.org/crime-victims-assistance-partnership/',NULL,'helpline@apalrc.org','Verified','917725171609009','To request assistance or for additional details, please contact the APALRCs Helpline at (202) 393-3572, ext. 22. For additional details on the CVCP program, please visit the DC Courts official site. ',NULL,NULL,NULL,NULL,'1010201225467528','743786809520784',NULL,'884944905632896','1018319997039351',NULL,NULL,NULL),(697,1145399925529779,'Food Pantry',NULL,782406976349276,'A food pantry for those in need of food.','1197279412047011',NULL,NULL,NULL,'Verified','832990803111047','No application, you just need to be a DC resident.',NULL,NULL,NULL,NULL,'777587688446935','672436089248275,645766619371641',NULL,'868012483124236','826890204604396',NULL,NULL,NULL),(698,1153962275208345,'Bridging the Gap',NULL,930909694635560,'An assistance program offering:\n- Case management\n- ESL classes\n- Resume writing sessions\n- Computer classes\n- Pro bono legal services\n- Youth programs\n- Information and referral','906651913636867','https://lortonaction.org/assistance-programs/',NULL,NULL,'Verified','637158405241810,917725171609009,970915508638448,789038541797078','Call to register. Walk in during registration hours.',NULL,NULL,NULL,NULL,'906987068756792','1229690477859335,892622133517119,876311376686616,600743088526043,1256920432035968',NULL,NULL,'1276944443091304',NULL,NULL,NULL),(699,1163310698125750,'Permanent Supportive Housing',NULL,1195870505334629,'Here chronically homeless families find and maintain permanent housing through intensive case management, rental assistance and specialized care for children and youth. With a holistic approach, we focus on all areas of families lives.\n\nFor families who have had multiple experiences with homelessness, they find stability and a home in our permanent supportive housing program. The majority of families live in their own apartments across the city, while some live in a single apartment building. This program provides long-term housing and in-home supportive services to formerly chronically homeless families.\n\nThese programs are based on Housing First, a nationally successful model that focuses on helping individuals and families move into and sustain permanent housing  along with a variety of services to promote stability, self-sufficiency and well-being.\n\nWe place families into permanent homes and provide them with the tools they need to focus on their life goals, including:\n\nIn-home, goal-oriented case management\nAssistance on finding an affordable apartment\nConnection to employment and training\nNavigation through school and life challenges for their children\nPairing eligible youth with volunteer mentors\nConnection to community resources\nA team of staff  with expertise in the areas of case management, housing, employment and youth  work with the parents and children in each family to help them achieve those goals.\n\nHome Now \nWe provide scattered-site permanent supportive housing to about 150 formerly homeless families with children. Families hold leases in their own names and pay up to 30 percent of their income towards rent.\n\nMississippi Avenue and Archer Park Apartments \nIn a public, private, and nonprofit partnership - we provide apartment-style permanent supportive housing to 18 families with children and 11 individuals, who have previously struggled with chronic homelessness.','688457108968845','https://www.communityofhopedc.org/housing/permanent-supportive-housing',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195,877243931325915','1255819816076094',NULL,NULL,NULL),(700,1163350819971430,'The Sleep Center',NULL,1220981589179778,'The Sleep Center specialists at United Medical Center help improve the lives of individuals challenged by interrupted sleep. They also assist organizations in ensuring employee safety through the evaluation, diagnosis and treatment of sleep disorders.\n\nA sleep disorder can dramatically affect ones health. It increases the risk of high blood pressure, heart attacks, obesity, strokes, high cholesterol, and other health issues. The Sleep Center specialists can diagnose and treat anyone suffering from insomnia, sleep apnea, and other sleep disorders.\n\nCommon Sleep Disorders we treat include:\n Hypopnea Syndrome\n Insomnia\n Narcolepsy\n Night Terror Disorder, Pavor Nocturnus\n Obstructive Sleep Apnea\n Rapid Eye Movement Behavior Disorder\n Restless Leg Syndrome\n Sleep Deprivation','620132940242525','https://www.unitedmedicaldc.com/services/sleep-center/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'1136418356307446','1100182510854387',NULL,NULL,'818226241830087',NULL,NULL,NULL),(701,1164006971785156,'Sacred Heart Dinner Program',NULL,1279230501938511,'The Sacred Heart Dinner Program is a nonprofit organization located in the Mt. Pleasant/Columbia Heights neighborhood of Washington, D.C. We offer free services to the low-income and homeless including free dinners from Monday to Friday, free legal referrals as well as free haircuts. We partner with multiple local organizations such as Thrive DC, Martha\'s Table and Capital Area Food Bank.\n\nServices Offered\n\n\nFree dinners (Monday-Friday; 4:00 PM - 6:00 PM)\nFree haircuts (every Monday and Friday during dinner service)\nFree legal referrals (every 2nd and 4th Friday of the month during dinner service)\nHypothermia shelter\nFree coats and warm clothing (during winter months)\nIndividual job assistance (customized per client)','905037841940941','http://www.dinnerprogram.org/about-us',NULL,NULL,'Verified','832990803111047','Walk in for a meal.',NULL,NULL,NULL,NULL,'1235881686916009','668143820192889',NULL,'877243931325915','1149735320929251',NULL,NULL,NULL),(702,1166512271577678,'Laundry Services - Men',NULL,801110030219864,'Offers a space to do laundry.','1220597047470925',NULL,NULL,NULL,'Verified','911225335803318','Sign ups for laundry are done on Fridays for the following week, on a first come-first served basis, with one alternate for each day.',NULL,NULL,NULL,NULL,'665113076769939','924880377270164',NULL,'625195015492370,877243931325915','962322435473993',NULL,NULL,NULL),(703,1124462892366916,'HIV Care Management',NULL,925360037107607,'TWC implements core programs such as: family-centered case management services; peer outreach; comprehensive risk counseling services; HIV counseling, testing and referral services (CTR)','946396771118356',NULL,NULL,NULL,'Verified',NULL,NULL,NULL,NULL,NULL,NULL,'640736255097589',NULL,NULL,'866965462945330,836091364973509,1292849277583603,780785826421817','1134563231552544',NULL,NULL,NULL),(704,1127640457224641,'Counseling for Seniors',NULL,970560028876577,'JSSAs experienced and compassionate professional staff of clinical social workers and care managers help seniors meet the challenges of living long and well.\n\nThrough in-office and in-home visits our team provides counseling for seniors facing a broad range of life issues. JSSAs goal is to assist seniors in maintaining their independence through comprehensive tailored services and programs.\n\nCounseling for seniors can alleviate stress about:\n\n- Life transitions\n- Decision-making\n- Caregiving\n- Relationships\n- Illness\n- Dealing with loss','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/counseling-for-seniors/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'1053289039718908,854808174954754','1328302797893590,1218692669680880',NULL,NULL,NULL),(705,1128285304774272,'Rapid Re-housing',NULL,1195870505334629,'We help families experiencing homelessness exit shelter quickly and move into their own homes with short- to medium-term rental and utility assistance and supportive services. We connect families with employment and resources in their communities.\n\nCommunity of Hope helps families experiencing homelessness quickly move out of shelter and into homes of their own through our Rapid Re-Housing Program. For many of these families, this home may be the first time theyve signed their own lease  a big step toward self-sufficiency.\n\nOur Rapid Re-Housing Program provides short-term rental and utility assistance  along with case management  to those families experiencing homelessness. We know that with a few months of assistance, our families can become stably housed for years to come.\n\nThis national best practice to end homelessness is a key resource in the housing continuum and we provide a number of critical supports.\n\nWe address the housing search and employment needs to start our families on a path of self-sufficiency:\n\nHousing stability focused case management\nAssistance on finding an affordable apartment\nConnection to employment and training\nConnection to community resources\nOur Rapid Re-Housing program serves up to 211 families at any given moment while our team also has a leadership role in developing this best practice model in Washington, DC.','688457108968845','https://www.communityofhopedc.org/housing/rapid-re-housing',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195,877243931325915','1255819816076094',NULL,NULL,NULL),(706,1136637606616454,'Food Assistance',NULL,682552065545256,'NVFS Hunger Resource Center (HRC, or Centro de Recursos para Prevenir el Hambre) at our SERVE Campus provides nearly 600 Prince William County families every month with:\n\nEmergency food assistance\nNutrition information\nStrategies for buying healthy food on a budget','764854375292129','https://www.nvfs.org/our-services/homelessness-housing/serve-campus/',NULL,NULL,'Verified','832990803111047','Please call before coming in.`',NULL,NULL,NULL,NULL,'791975728727740,964860483808020',NULL,'998959625812107',NULL,'1341470966230086',NULL,NULL,NULL),(707,1133165843084453,'Early Education Home-based',NULL,761153930697275,'We make house calls\nHome Based provides the same Early Head Start (EHS) resources and support in your home that children and families receive in our Early Learning Centers.\nQualified home visitors perform weekly 90-minute home visits with parents to engage them and their children. We support parents in developing qualifying milestones in order to support their childs success. Bi-weekly socialization allows parents to build their understanding of parenting and brings the community together.\nWe give training support in health, nutritious meals, breastfeeding, school readiness, shared community resources, etc. Were serving 72 families with this program, which is culturally sensitive to the needs of the community.','594960886051316,999755198000719','https://www.upo.org/earlyeducation/',NULL,NULL,'Verified','789038541797078','Call to enroll and set up a visit.',NULL,NULL,NULL,NULL,'849573890085736,665905423802380','587544010010943,940897095189363,682372519823224','1258802836458213','1274396898894043,1177145976454922','1304904589817191,1166860713798541',NULL,NULL,NULL),(708,1134361757901839,'Case Management at the Phyllis Wheatley YWCA',NULL,1186080684764999,'Since December 2016, N Street Village has provided case management services at the Phyllis Wheatley YWCA on Rhode Island Avenue in Northwest D.C. Founded in 1905, the historic Phyllis Wheatley YWCA has long provided affordable housing to women in Washington, D.C. In 2016, the Phyllis Wheatley YWCA completed an extensive renovation of its building. N Street Village supports their critical mission by providing wrap-around support services to 42 formerly homeless residents.','856110821321208','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','637158405241810','Please call before coming to the YWCA.\n\nWe encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\n N Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','928689553150002',NULL,'836091364973509,877243931325915','750683065369273',NULL,NULL,NULL),(709,1134694149755541,'Joyful Food Markets',NULL,1279230501938511,'In January 2015, Marthas Table, in partnership with the Capital Area Food Bank and DC Health, launched Joyful Food Markets to increase access to and encourage consumption of fresh fruits and vegetables east of the Anacostia River.\n\nJoyful Food Markets are pop-up monthly markets held in elementary schools in Wards 7 and 8 in D.C. School families are invited to shop at no-cost for a variety of beautiful high-quality produce, including bananas, apples, greens, and sweet potatoes, as well as basic shelf staples such as pasta and beans.\n\nSchool cafeterias and gymnasiums are transformed into joyful environments with music, dancing, and colorful tables filled with baskets of fresh produce and healthy non-perishable food. In addition, our markets feature kids activities and recipe samples designed to get children excited about healthy eating and cooking.',NULL,'https://marthastable.org/health-wellness-programs/',NULL,NULL,'Verified',NULL,'Visit our website to see all 53 schools in Wards 7 & 8.',NULL,NULL,NULL,NULL,'1235881686916009',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(710,1147407982912051,'Sexual Health',NULL,840733417398800,'The capable and compassionate doctors and nurses at Marys Center provide comprehensive sexual health services in a confidential, safe, and inclusive environment. Marys Center also offers a wide range of sexual health prevention, testing, and treatment resources and services including:  \n\nPrevention and Testing\nCare and Treatment','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/sexual-health/',NULL,NULL,NULL,'941516382466411','To reach the Sexual Health Resource Hotline, call (202) 851-3971  \nTo reach our HIV Care Navigation team, email BeSafeBeSure@maryscenter.org \nTo make an appointment, call (844) 796-2797 anytime \n\nPlease reach out if you need assistance with applying for Ryan White coverage or to learn more about AIDS Drug Assistance Program (ADAP) and various other discount programs for HIV medications.   \n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'609237693650331,1301804131597006','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,NULL,'903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(711,1147909066828937,'Emergency Housing',NULL,1323664977480953,'The Sanctuary  Emergency overnight respite for youth who need safe housing immeadiately. The Santuary offers dinner, showers, and washer and dryers to clean clothes. Doors open at 6:00 pm at 2001 Mississippi Ave\n\nSafe Haven  CHWs emergency housing program, provides single youth ages 18-24 a flexible 90-day program to get off the street and to provide them with a customized plan to get their lives back on track.','1106602330344467','http://covenanthousedc.org/our-services/housing/',NULL,NULL,'Verified','878986697513222,929094559121639','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'1222973168897685','899989255714132',NULL,NULL,NULL),(712,1160149147134890,'Childhood Sexual Abuse',NULL,809193297555798,'This webpage offers information on what childhood sexual abuse is, how to identify it, and what to do if you suspect it.','728145736382163','http://dcrcc.org/counseling/no-straight-path/childhood-sexual-abuse/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Visit website.\n',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(713,1162907800070547,'Emerging Leaders Program',NULL,908300362827413,'The Emerging Leaders Program is committed to help every young adult find appropriate work, passion for the future and the tools, education, and relationships for their dreams to become reality.\n\nOur goals are:\n\n- Provide a professional, compassionate job preparation, job placement, and job retention services.\n- Support applicants throughout their discovery process to define a career goals and actionable next steps.\n- Encourage participants to further their education by obtaining either GED, Associates degree, Bachelors degree or certification from a vocational school.\n- Connect Emerging Leaders with the access to resources (i.e. scholarships, connections, jobs) to further personal and professional growth.','1150129069386124,1286395778585315','http://jubileejobs.org/our-programs/for-job-seekers/',NULL,NULL,'Verified','970915508638448','If you are seeking help in finding employment through our job placement program, you must attend orientation. Upcoming orientations are listed on the website.\n\nContact our Youth Employment Counselor for more information:\n\nDeSean Lawson\ndlawson@jubileejobs.org\n(202) 667-8970',NULL,NULL,NULL,NULL,'1313473502046025,639225425188186','1250551652902957,903053826297447',NULL,'776053016432100','638447966180396,1157041158470005',NULL,NULL,NULL),(714,1175089962860672,'Community Outreach',NULL,1007623446966696,'REDEEM Community Development Corporation is the outreach arm of our church. It supports and manages our Community Outreach Center (open Wednesdays and Saturdays 9a-11a) and our Community Garden where needy residents receive groceries, fresh produce from our garden, clothing, prayer and information on other city-wide social services.','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','637158405241810','Call or visit us during our church services.',NULL,NULL,NULL,NULL,'755149488867036','924051846766211',NULL,NULL,'1088461256923134',NULL,NULL,NULL),(715,1180623233814950,'Financial Literacy and Other Assistance',NULL,919690199169575,'- Monthly Financial Counseling Clinics by appointment.\n- Seasonal supports include school supplies and holiday gifts for children.\n- Our counselors make referrals to other community resources.\n\nUnited Community hosts monthly financial counseling clinics for one-on-one sessions; you need not be a client to participate, and all income levels are welcome. These are held at United Community Main Office at 7511  Fordson Rd., on the second Tuesday evening of most months. In collaboration with our partner Britepaths, trained pro bono financial planners provide a one-on-one session, including free credit report with analysis and action plan. An appointment is required for the evening sessions.','987030255962297','http://www.ucmagency.org/stepping-stones-basic-needs.html',NULL,NULL,'Verified','1077790582995406,789038541797078','Call to set up an appointment.\n\nRegarding the Financial Literacy clinic:\nRegistration is required a week in advance. Childcare is provided for ages 2 and older. Please arrive between 6pm and 7:15pm to ensure time to meet with a Financial Planner. ',NULL,NULL,NULL,NULL,'927006793998791','717231166133554',NULL,'891092215548488','611571036444170',NULL,NULL,NULL),(716,1124328528578512,'KENNEDY INSTITUTE',NULL,606159111308029,'Provides the following services: RW Behavior Support BSP Development & Follow-Up , RW Behavior Support Diagnostic Assessment, RW Behavior Support Non-Professional (Behavior), RW Behavior Support Non-Professional (Medical), RW Day Hab w/Meals, RW Day Habilitation, RW Day Habilitation One-to-One (Behavior), RW Day Habilitation One-to-One (Medical), RW Employment Readiness, RW Family Training, RW Family Training Assessment, RW Host Home, RW In-Home Supports, RW Residential Habilitation, RW Speech Hearing and Language Therapy, RW Speech Hearing and Language Therapy Assessment, RW Speech Hearing and Language Therapy Assessment, RW Supported Employment GROUP Job Training & Supports , RW Supported Employment GROUP Long Term Follow Along , RW Supported Living, RW Supported Living Periodic, RW Supportive Employment Individually (Long-Term Follow-Along), RW Supportive Employment Individually (Intake and Assessment), RW Supportive Employment Individually (Job Placement), RW Supportive Employment Individually (Job Training & Support), RW Supportive Employment Individually (Long-Term Follow-Along), RW Supportive Employment Individually (Intake and Assessment), RW Supportive Employment Individually (Job Placement), RW Supportive Employment Individually (Long-Term Follow-Along), RW Wellness Nutrition Assessment, RW Wellness Nutrition Ongoing Support','1188102183681608','http://dds.dc.gov/service/how-apply-services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1295539867349281',NULL,NULL,NULL),(717,1123747363862749,'Mentorship',NULL,562836772362344,'ACTS provides mentorship and career opportunities in the field of translational science.','796479538430138','https://careers.actscience.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'877776396812857',NULL,NULL,NULL,'1092560590600641',NULL,NULL,NULL),(718,1123886368027680,'Supported Employment',NULL,976379482380679,'Many of our clients have struggled to secure or maintain employment because of the nature and severity of their disability and a lack of hope that they can actually return to work after years of unemployment. Our evidence-based Supported Employment program helps people with some of the most complicated mental and physical health challenges accomplish their employment and educational goals.\n\nPathways to Housing DCs Supported Employment program was developed out of the same philosophy as our Housing First model: just as we believe that anyone who wants housing is housing ready, anyone who says they want a job is employment ready. When someone tells us that they want to work, our Supported Employment team immediately leaps into action to help them find and retain employment in Washington, DC and the surrounding region. The team provides assistance and support throughout the job search, application, interview, and onboarding process.  That support continues into each persons new career, for as long as it is needed, with teams offering counsel and advice as each person adjusts to their new work routine. Our Supported Employment program also operates quarterly workshops, as well as other ongoing support services that are tailored to each individuals needs. This data-driven, person-centric, approach toward employment has been wildly successful, with our team being nationally recognized as exemplary in terms of best practice in the field of supported employment.','743353111808252','https://pathwaystohousingdc.org/what-we-do/supported-employment/',NULL,NULL,'Verified','970915508638448','Call or walk in for more information.',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268',NULL,'877243931325915','1137409735223363',NULL,NULL,NULL),(719,1124787894447866,'Home Repair Services',NULL,1183850219079477,'Yachad provides free health and safety repairs to low-income homeowners living in Washington, DC and the following areas in Prince Georges County: Hyattsville, Landover, District Heights, Capitol Heights, and Hillcrest Heights.\n\nSome health and safety repairs addressed by Yachad include: roof repair, plumbing repair, electrical repair, pest control, drywall repair, broken appliance replacement, and accessibility services.\n\nWe work on a limited number of homes each year and we want our repairs to affect as many people as possible. When considering applications, Yachad prioritizes multigenerational households and families with children.','888398891117437','http://yachad-dc.org/homerepairservices.php',NULL,NULL,'Verified','929094559121639','If you are interested in applying to Yachads Single Family Home Repair Program, call our office. We do our repairs in a two cycles. The application deadline is summer for fall repairs and December 1st for spring repairs. There is no harm in applying in between our deadlines, we just ask for your patience in hearing from us.\n\nAfter completing your application, Yachad staff will review it. We may schedule an appointment to inspect your home and determine the scope of work. Further inspections from our construction manager and estimates from skilled workers may occur. After these steps, the price and content of repairs will be evaluated, and accepted homeowners will be notified.\n\nHomeowners that are accepted into the program, and a majority of adults living in their household, must attend mandatory, free Homeowners Workshops. These workshops are open to the public and are held twice a year. Attendees learn tricks of home maintenance, budgeting skills, and more. To find out more about these workshops, please contact us.',NULL,NULL,NULL,NULL,'896191474881929','1221091850952095',NULL,'1294818681778567,1009160981885425','851682919843426',NULL,NULL,NULL),(720,1134764669826308,'Caregiver Support','Kensington Clubs',855094084464049,'The Kensington Club provides a great place for older adults with early stage memory loss to find camaraderie and coping skills. It also offers respite to caregivers, who know that when their loved one is at Kensington Club, they will have a much needed break.\n\nCaregiver support is also available through Early Stage Dementia Education and Support Groups. With training from the Alzheimers Association, facilitators lead a unique model of information and support to individuals with a diagnosis and their care partners. With a goal of enhancing the lives of individuals with dementia and their families, the eight-week sessions cover topics such as understanding the disease and how to find community resources. Each week, education is provided for the whole group, followed by separate support groups for care partners and those with a diagnosis.','924628911683577,805806723754090,1179174778771993','https://accessjca.org/kensington-clubs/',NULL,NULL,'Verified','637158405241810','For information or to schedule a visit, please call.',NULL,NULL,NULL,NULL,'958720616157709,898009380902296','600730005000820,878694033728814,1149591818853041',NULL,'618828421943202,641003986848929,1157835357284365','1050035692418764,1203002351100645,594266389872303',NULL,NULL,NULL),(721,1135875611263139,'Office of the D.C. Long-Term Care Ombudsman Program',NULL,1093127605400642,'The Office of the D.C. Long-Term Care Ombudsman Program (DCLTCOP) is an important part of Legal Counsel for the Elderly. DCLTCOP is an advocate and resource for persons who reside in long-term care facilities such as nursing homes, assisted living and community residence facilities. The program also provides advocacy services to individuals receiving services through the Elder and Persons with Physical Disabilities (EPD) Medicaid Waiver. Ombudsmen help residents and their families understand and exercise their rights and effectively address concerns which impact their health, safety and quality of life.  The program advocates for older adults and persons with disabilities at both the individual and systems levels by receiving, investigating and resolving complaints made by or on behalf of residents, promoting the development of resident and family councils, and informing governmental agencies, providers and the general public about issues and concerns impacting recipients of long-term care services and supports.\n\n Ombudsman Services\n\nAdvocate for the rights of older persons and other persons receiving long-term care services in the District of Columbia;\nInvestigate and resolve complaints made by or on behalf of an older person or other persons receiving long-term care services;\nEducate and empower residents to understand and exercise their rights\nAll confidential, resident-centered, and free of charge.\nHome and Community-Based Services\n\nAs of Oct. 1, 2012, the ombudsman program expanded its scope of advocacy services to include District residents receiving home and community-based services in their private homes through the D.C. Medicaid Elderly and Persons with Physical Disabilities (EPD) Waiver. \n','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/dc-long-term-care-ombudsman.html?intcmp=AE-LCE-WWD-R1C2LL5',NULL,'dcombuds@aarp.org','Verified','917725171609009','Call for information',NULL,NULL,NULL,NULL,'1287736008934844',NULL,NULL,'854808174954754','763163886168100',NULL,NULL,NULL),(722,1140318024724985,'Sexual Health',NULL,1323195974089796,'COUNSELING, TREATMENT, REFERRAL AND LINKAGE\nCounseling, Treatment, Referral, LinkageThe Counseling, Treatment, Referral and Linkage (CTRL) program provides testing for HIV, STI, and pregnancy, risk reduction counseling, pregnancy options counseling, and support to ensure linkages to health care and social services. All services are provided free of charge to youth ages 11 to 24 years old. Youth of all gender and sexual identities are welcomed and encouraged to participate in CTRL services.\n\nTESTING DAYS AND HOURS\nMonday-Thursday, 3-6 p.m. at LAYCs, 1419 Columbia Road, NW, on the 3rd Floor.\n\nA nurse practitioner offers free birth control consultations and STI treatments every other Thursday evening from 5-7 p.m. by appointment only. Please call (202)319-0422 if you would like to schedule an appointment or learn more about these services.\n\nTHE SEXUAL WELLNESS ADVOCACY BY TEENS (SWAT) PROGRAM\nSexual Wellness Advocacy The Sexual Wellness Advocacy by Teens (SWAT) Program aims to create an army of youth who are trained as peer educators to promote healthy sexuality and reproductive health, including HIV, STI, and unplanned pregnancy prevention. In addition to increasing participants own knowledge of these topics and how to communicate key information to their peers, the program aims to establish a culture of openness and self-respect around sexual and reproductive health in LAYC youth and contribute to decreasing HIV and STI incidences and pregnancy among youth in Washington DC. Youth execute an outreach project at the end of the course to spread their knowledge amongst peers and solidify what they have learned. SWAT programs are taught at middle and high schools in the DC area, creating improved partnerships with LAYC and opportunities to do outreach for testing services.','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/sexual-health/',NULL,NULL,'Verified','941516382466411','Call or email for more information.',NULL,NULL,NULL,NULL,'1281387074856034,801845574930546','920999838182205,1016645181977967','612213908439005,825996014744789','1295679372454826','1288365969354186',NULL,NULL,NULL),(723,1141643347330568,'Housing Services ',NULL,1178149503221687,'Supports families through the housing process. Housing coordinators identify new rental units, negotiate lease agreements, and oversee travel arrangements for move-in. ',NULL,'https://housingup.org/ending-homelessness/housing-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(724,1148617267210635,'Adolescent Acute Inpatient',NULL,1265431689708141,'Our mental health facilities for teens and adolescents are available for patients between the ages of 10 and 17. We have mental health counseling programs for patients who suffer from major psychiatric disorders, depression, substance abuse and behavioral problems. Just recently we added a trauma unit for adolescents, ages 13  17.\n\nOur Adolescent Treatment Program is highly structured to meet each patients special needs. We have staff on hand who specifically specialize in various mental health disorders and substance abuse treatments for teens.\n\nSpecialty Adolescent Treatment Program Services Include:\n\nCrisis stabilization\nIndividualized treatment plan\nTherapy focused on issues of trust, sexuality, individuation, intimacy and acting-out\nIntensive therapy for victims of emotional or sexual trauma\nPsychotherapy\nPsychopharmacology\nArt and expressive therapies\nSelf-esteem groups\nLiving skills\nTherapeutic recreation activities\nGroup therapy\nFamily support','1289140698414142','https://psychinstitute.com/treatment-services/adolescent-acute-inpatient/',NULL,NULL,'Verified','941516382466411','Its easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'883345659611536,1202046420944840','1045297656470568',NULL,NULL,NULL),(725,1179815376168159,'Short-Term Respite Care',NULL,1195280864464976,'If youre a caregiver who needs a little time off to take a vacation or tend to personal matters, we offer short-term respite care. You can take some much-deserved time off with the knowledge that your loved one will receive the quality, compassionate care they need to thrive. It also provides your loved one with the chance to meet other seniors facing health challenges and provides an excellent opportunity for socialization which they might not otherwise get. Short-term stays are also an excellent way to assist those who may be preparing to transition to long-term care.','814720878521693','https://www.stoddardbaptistglobal.org/our-services/short-term-respite-care/',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'1257614234179117',NULL,NULL,'854808174954754','1230684095904498',NULL,NULL,NULL),(726,1183786146199295,'Senior Living Communities',NULL,1180598613249590,'Seabury provides housing options for older adults through our three housing communities: Home First Residences, Seabury at Friendship Terrace, and Seabury at Springvale Terrace.','1154084082448020,878783319164190,965470521205325','https://www.seaburyresources.org/seniorliving',NULL,'info@seaburyresources.org','Verified','941516382466411,637158405241810,929094559121639','Call or email for more information. Tours are available both in person and virtually.',NULL,NULL,NULL,NULL,'1281076749443978','1176087327224268',NULL,'854808174954754','1137042288285597,765219405028228,978117321314014',NULL,NULL,NULL),(727,1189947540122655,'Women\'s Health',NULL,840733417398800,'Marys Center is here for all your womens health needs. Our skilled and kind providers will walk you through each stage of your health journey and offer comprehensive womens health services including: \n\nFamily Planning\nMidwifery Services\nObstetrics and Gynecology (OB/GYN)\nPrenatal Care','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/adults-and-seniors/womens-health/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,'1263089203668614,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(728,1135183488769656,'HEALTH CARE FOR THE HOMELESS COALITION',NULL,890469114349217,'Provides Mental Health services','1238893972656148','http://www.dccfh.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(729,1148230459385861,'JOINT BASE ANACOSTIA-BOLLING: AIR FORCE CAREER FOCUS',NULL,845885697863453,'Provides assistance to military family members, active duty and retirees in securing employment. Home visits: Downtown','988704048030141','http://cnic.navy.mil/ffr/family_readiness/fleet_and_family_support_program.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'687643573533420',NULL,NULL,NULL),(730,1150307807148693,'Home Instruction for Parents of Preschool Youngsters','HIPPY',931366816861797,'The achievement gap appears well before children enter kindergarten. Children who begin school having missed critical early learning opportunities are already at risk for failure in school.\n\n\n\nHome Instruction for Parents of Preschool Youngsters (HIPPY), an evidenced-based early learning program, addresses these issues by supporting parents in their critical role as their childs first and most influential teachers. In the HIPPY model, peer home visitors deliver 30 weeks of high quality school readiness curriculum directly to parents who then work with their own three, four, and five year-old children. Using the HIPPY books and curriculum, parents spend one-on-one time each day reading books with their children and teaching them school readiness skills.\n\n\n\nHIPPY helps parents empower themselves as their children\'s first teacher by giving them the tools, skills and confidence they need to work with their children in the home. The program was designed to bring families, organizations and communities together and remove any barriers to participation that may include limited financial resources or lack of education.','1098817401970888','https://www.perryschool.org/youth-development',NULL,NULL,'Verified','789038541797078','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372','802405581688320',NULL,'915486946336080','896277574789110',NULL,NULL,NULL),(731,1158010282443707,'Food and Nutrition Program',NULL,1323195974089796,'LAYCs Food & Nutrition Program is an opportunity for youth to get their hands dirty in the kitchen and the garden.\n\nIn our Teen Center kitchen, youth hone their cooking skills, trying new foods, learning how to make healthy choices about what they eat, and engaging with broader food justice issues.\n\nLAYC also has a raised bed garden in front of its Columbia Rd. office, which serves as another classroom. The garden provides direct experience about how food grows and whats in season when. The herbs and vegetables from the garden are used in cooking classes and internal catering for LAYC meetings and events.','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/food-nutrition-program/',NULL,NULL,'Verified','832990803111047,941516382466411','Call or email for more information.',NULL,NULL,NULL,NULL,'1248093235818331','920999838182205,1016645181977967','1214337031845729','1295679372454826','1288365969354186',NULL,NULL,NULL),(732,1164661927797269,'Homeless Services',NULL,1061460575455807,'Homeless Services include:\n\n- Emergency Rental Assistance\n- Housing Resources\n- Temporary Shelter\n- Community Resources','1282660521731521','https://dhs.dc.gov/page/virginia-williams-family-resource-center',NULL,NULL,'Verified','929094559121639','If you are a family with children under 18 and need emergency shelter, please call the Shelter Hotline at (202) 399-7093. The Shelter Hotline is available 24 hours a day.\n\nBring the following with you to access family emergency shelter:\n\n- Identification\n- Birth Certificates for each family member\n- Proof of Income\n- Proof of District residency if not established through identification',NULL,NULL,NULL,NULL,'1066322983572364','606181263945469,1047678134294030',NULL,'565669778208779,868012483124236,1274524177531453,753216819976855,1080143486455420','592947414359807',NULL,NULL,NULL),(733,1166106416739636,'Food Pantry',NULL,1274524554725599,'Provides a food pantry to the community.','756139435965093',NULL,NULL,NULL,'Verified','832990803111047','Walk in and bring an ID.',NULL,NULL,NULL,NULL,'1179786506429029,821254553857567','1246945203240826',NULL,'565669778208779','1088461256923134',NULL,NULL,NULL),(734,1172793580060024,'Low Vision Services',NULL,964889233755760,'Provides services for folks with vision problems from limited vision to blindness.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','941516382466411','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(735,1178673163145313,'Rapid Re-housing for Individuals',NULL,948113581207578,'The goal of this program is to provide timely access to permanent housing for individuals with moderate acuity, without preconditions (such as employment, income, sobriety, or absence of a criminal record). All participants require some assistance through financial support and case management in a time-limited manner to assist with achieving housing stability that should last beyond the length of time the supports are provided.','911858349594317','https://www.wearecsc.org/family-services',NULL,'info@wearecsc.org','Verified','929094559121639','You must be referred by a core service agency.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'1263089203668614','921919612082211',NULL,NULL,NULL),(736,1181830707554784,'Clinical Services',NULL,1164024351359039,'Safe Shores Clinical Services Program helps families on the road to healing from trauma and abuse by providing trauma-informed mental health services. The Clinical Services team provides a safe space for children to identify and overcome challenges, develop positive coping skills and build healthy relationships through talk therapy, play therapy, art therapy, sand-tray therapy and other modalities provided to child victims, their non-offending caregivers, and siblings.','1101386810121427','https://www.safeshores.org/get-support/our-services/',NULL,NULL,'Verified','941516382466411','Contact to make an appointment for services.',NULL,NULL,NULL,NULL,'1171658960657370','597458689446427',NULL,'1274396898894043,915486946336080','960248296759213',NULL,NULL,NULL),(737,1179313324156762,'Victim Services',NULL,801110030219864,'We are now able to offer victim services to our clients through support, referrals, and connecting clients to services if they have been a victim of a crime.\n\nThe purpose of this program is to provide victims of violence with specific resources to improve their quality of life. Victim services includes resources and referrals for homeless victims of crime in the last 3 months from the day they share the event of a crime with us. This includes (but is not limited to): assault and battery, property damage, sexual assault, stalking, domestic violence, hate crime, harassment, theft, and other violent crime.\n\nFatal assaults against people experiencing homelessness outnumber hate-crimes against all protected classes combined. Between 1999 and 2015, at least 1,657 homeless individuals were violently attacked, in many cases because of their housing status, according to a report by the National Coalition for the Homeless. This is only including those that are reported.\n\nHomeless victims have rights. Were committed to providing support for our clients while bringing public awareness to this issue.','1220597047470925','https://www.thrivedc.org/victim-services/',NULL,'jessicac@thrivedc.org','Verified','637158405241810','For more information on Victims Services, please contact Jessica Chavez at (202) 503-1524 or jessicac@thrivedc.org',NULL,NULL,NULL,NULL,'1128108657108836,665113076769939','818646560557978','577518788649182','877243931325915','962322435473993',NULL,NULL,NULL),(738,1179854807435757,'Dental Health',NULL,548126332764833,NULL,'619784806206149,1214132387827753','https://www.whitman-walker.org/dental-health',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'',NULL,'599621071767378,645838145603264','',NULL,NULL,NULL,NULL),(739,1184329050770191,'The Webster House',NULL,1085960322097234,'The Webster House is a small home-like program that can serve 12 men who are homeless.\n\nTo help foster responsibility, the men are assigned tasks to maintain the property. Supportive services include case management, employment and housing placement assistance, substance abuse counseling, life skills training and social skills development.','926855982380347','http://www.dccfh.org/programs/transitional-housing/the-webster-house/',NULL,NULL,'Verified','929094559121639','Call to inquire about openings and eligibility.',NULL,NULL,NULL,NULL,'906521258220065','1202819882057306',NULL,'625195015492370,877243931325915','1249230967488290',NULL,NULL,NULL),(740,1185051455558186,'The Community Workforce Development Scholarship Fund',NULL,872299181857178,'Scholarship awards up to $2,000 upon earning entry level certification in information technology, construction, or healthcare to individuals 18+ and living in zip codes 20001, 20002, 20005, 20009, 20010, 20011, and 20017.','644198517647426','https://www.oicdc.org/new-opportunities.html',NULL,'gwragg@oicdc.org','Verified','970915508638448,1077790582995406','Contact Gregg Wragg.',NULL,NULL,NULL,NULL,'598681010126194',NULL,'1068411641337800','866965462945330,1303419030047892,1070669054292991,1297964204636191,1318602285683718,941503097115546,656780568400769,772597029369339','592528015341160',NULL,NULL,NULL),(741,1190183438277072,'Healthy Meals',NULL,1043249662316489,'Miriams Kitchen operates the only meals program in Washington, D.C. that is open, Monday through Friday, all year long, no matter the holiday or weather emergency.\n\nAll of our meals are made with fresh, healthy ingredients. The restaurant-quality food we serve shows our guests that we care. It builds a bridge of trust. And it makes it possible to form a relationship with each individual who comes through our doors.','1220017101351760','https://miriamskitchen.org/programs/meals/',NULL,NULL,'Verified','832990803111047','You can walk in during meal hours.',NULL,NULL,NULL,NULL,'582664674810922,1076876608568522','768066879976330,1282825972480356',NULL,NULL,'850193305992354',NULL,NULL,NULL),(742,1198504077729641,'Primary Care',NULL,1093127605400642,'ADULT MEDICINE\nPhysical and wellness exams for both genders\nCare for chronic disease such as diabetes, asthma, hypertension, high cholesterol, heart disease, and obesity\nCare for acute conditions such as sinusitis, pneumonia, sports injuries, and urinary tract infections\n\n\nPREVENTIVE MEDICINE\nScreening for diseases including diabetes, high blood pressure, and high cholesterol using national health guidelines\nReferrals for routine preventive screenings such as colonoscopies, mammograms, and bone density tests for osteoporosis\nGood health promotion\nNutrition and weight Loss counseling\n\n\nWOMENS WELLNESS EXAMS\nRoutine PAP smears\nClinical breast exams\nMammogram referrals\nOsteoporosis screening','841307455613093','http://andromedahealth.org/our-services/primary-care/',NULL,NULL,'Verified','941516382466411','Appointments are available Monday through Friday from 9-5. Walk-ins accepted on a case by case basis, please call in advance to check availability.\n\nINSURANCE\nIf you have an HMO plan, our providers must be listed on your insurance card as your primary care doctor in order to make a primary care appointment.\n\nAetna (PPO & HMO)\nAmeriHealth (HMO only)\nBlueCross BlueShield (HMO & PPO)\nCigna (HMO & PPO)\nMedicaid (PPO only)\nMedicare Novitas (PPO only)\nMedstar (HMO only)\nTrusted (HMO only)\nUnited Health (HMO & PPO)',NULL,NULL,NULL,NULL,NULL,'930574528621838',NULL,'1200033126219686,1226186421680538,1185211556812450','1224638786118966',NULL,NULL,NULL),(743,1135169686375345,'Classes and Groups',NULL,1088589897673997,'Mamatoto Village provides a variety of classes that can assist you in almost every aspect of the pregnancy, childbirth and parenting. Sharing information in small class settings, our instructors are certified, knowledgeable and experienced. More than just a useful source of evidence based information, Mamatoto Village Childbirth Classes provide a source of preparation, learning, relaxation, discovery and support.','1191890430739322','https://www.mamatotovillage.org/classes.html',NULL,NULL,'Verified','637158405241810','View the calendar on the website. Register online or drop in for drop-in designated groups. ',NULL,NULL,NULL,NULL,'644056895061746,867238429645312','1259025264194553,840380756273952',NULL,'1182104828841650,915486946336080','948258077222906',NULL,NULL,NULL),(744,1140920920771303,'Emergency Rental Assistance','Keep Safe Housing',983721114373124,'Emergency Rental Assistance Program (ERAP) helps low-income District residents facing housing emergencies. The program provides funding for overdue rent if a qualified household is facing eviction (including late costs and court fees). The program also supports security deposits and first months rent for residents moving to new apartments.','828792720206018','https://www.dashdc.org/housing-resource-center/maintain-housing/',NULL,NULL,'Verified','929094559121639,1077790582995406','For information on receiving emergency rental assistance visit our website or go to the DC Department of Human Services Page. \n\nCall for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'777455803391753,1256136937607288,1212718840001878','1043474797867812',NULL,NULL,NULL),(745,1146566781515189,'Advocacy & Racial Justice',NULL,1230770757213322,'We are on a mission to Eliminate Racism and Empower Women\nWe increase public awareness and engagement around the issues central to improving the lives of women.\n\nNationwide, YWCAs  advocacy work in three core areas:\nRacial Justice & Civil Rights\nEconomic Empowerment & Advancement\nHealth & Safety of Women & Girls','771897230838212','https://www.ywcanca.org/what-we-do/advocacy-racial-justice/',NULL,NULL,'Verified','917725171609009','This is primarily a policy project but if you wish to learn more or seek help, please call.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'836091364973509,1192281158279735','1330181492619505',NULL,NULL,NULL),(746,1157781613265181,'Promise Place',NULL,1306699628219808,'Promise Place is an emergency youth shelter in Prince Georges County, Maryland. The shelter provides homeless, abandoned, abused, neglected and runaway youth a compassionate alternative to the dangers of the streets and/or unstable housing. Operated in partnership with the Prince Georges County Department of Social Services, Promise Place is open 24 hours a day and serves up to 20 youth at one time. By providing a safe place to stay and intensive counseling services, Promise Place helps most youth reunite with their families and works to return all young people to stable and safe environments. On-site services include crisis intervention; individual, group, and family counseling; case management, support for shelter graduates, and temporary respite care.','574114996921997','https://www.sashabruce.org/programs/safehomes/promise-place/',NULL,'rbell@sashabruce.org','Verified','929094559121639','Open 24 hours a day. Call for more information. Exact location is not disclosed online.',NULL,NULL,NULL,NULL,'1252883236773788','1040004903404957',NULL,'877243931325915,883345659611536','1055916387358124',NULL,NULL,NULL),(747,1174068491618790,'Food Pantry',NULL,1150695227682882,'A food pantry for those in need.','994308933727557','https://assumptiondc.org/outreach/',NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'576203813370859,1068293081202730','924548406180044',NULL,NULL,'1245750861687096',NULL,NULL,NULL),(748,1173963793862866,'Adoption Services',NULL,970560028876577,'Provides adoption services including:\n\n- Informational adoption consultations\n- Home studies for private and domestic adoptions\n- Case management and adoption support services\n- Post placement supervision visits and reports\n- Individual and family counseling\n- Adoption court reports (VA)\n- Counseling and adoption searches for adult adoptees and birth parents\n- Birth parent counseling and assessments','977589590864235,1321118518935089','https://www.jssa.org/get-help/adults-couples-and-parents/adoption-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'1211730899647476,976637222906895,788431601028835','863218507660277,1218692669680880',NULL,NULL,NULL),(749,1185457585183638,'Project Transformation DC (PTDC)',NULL,1013543362848937,'We host a fun filled 8-week literacy based summer camp.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','789038541797078','Call for info on the upcoming summer camp.',NULL,NULL,NULL,NULL,'905425032669080',NULL,NULL,NULL,'1190125799561725',NULL,NULL,NULL),(750,1194108716776364,'WHITMAN-WALKER CLINIC: HIV COUNSELING AND TESTING PROGRAM',NULL,996759849305541,'Whitman-Walker Health offers free and confidential HIV testing and counseling to the general public. They use a rapid HIV test that delivers results in 20 minutes. Testing is available without an appointment. WWH also sponsors an HIV Mobile Testing Unit that goes into communities at risk and provides HIV testing and prevention Peer support program: 2 groups are available for individuals newly diagnosed with HIV. 1 group is for long term HIV survivors. 1 on 1 support services are also available.','1234289739881760','http://whitman-walker.org',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'',NULL,'599621071767378,645838145603264','','651755018600599',NULL,NULL,NULL),(751,1195066035930824,'Energy Assitance','Keep Safe Housing',983721114373124,'The Department of the Environment helps eligible District residents pay heating and cooling bills. If youre eligible, you can receive between a one-time $250 and $1,500 credit for your household. The amount of credit is based on household size, total household income, heating source, and type of dwelling.','828792720206018','https://www.dashdc.org/housing-resource-center/maintain-housing/',NULL,NULL,'Verified','1077790582995406','To apply for energy assistance, visit our website or https://doee.dc.gov//liheap. \nCall for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'777455803391753,1256136937607288,1212718840001878','1043474797867812',NULL,NULL,NULL),(752,1194701188927394,'Life Span Supports Project',NULL,744812603775568,'Quality Trusts Life-Span Supports (QTLS) project is a resource center where people with DD and their families find information, education and guidance related to accessing the benefits and support services essential for a full life.\nInformation: Visit the Resources page to search and find links to organizations that support people with DD and access free content about disability services, legal rights, support networks and more.\nEducation: Increase your knowledge. Learn about the local disability service landscape and what to expect at small, interactive educational sessions titled What do I need to know? workshops. These educational sessions will lead participants on the road to get answers involving disability benefits, independent living, supported decision-making, and how to access services that enable community engagement across the life-span.\nGuidance: Contact us for help. Families looking for individualized guidance or crisis intervention can enter short-term or long-term engagements with QTLS professionals. Quality Trusts Personal Support Facilitators (PSF) help people find resources and support services, learn how to resolve challenges, and plan for the future. PSF consulting services are individualized for each family, and will be shaped by the persons preferences, the complexity of needs, mutually agreed-upon objectives, and available resources.','1185969381076176','https://www.dcqualitytrust.org/families/life-span-supports-project/',NULL,NULL,'Verified','637158405241810','Some resources are available online. Others are provided through info sessions. Visit website to learn more or call for information on sessions.',NULL,NULL,NULL,NULL,'549594406351830','655204523101840',NULL,'1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(753,1203671009935370,'Pharmacy',NULL,840733417398800,'Full service pharmacy.','1293474810072073','https://www.maryscenterpharmacy.org/app/#/',NULL,NULL,NULL,'941516382466411','Visit website, call, or walk in. You will need a prescription.',NULL,NULL,NULL,NULL,'1049675423059160','877973171414369',NULL,'749780451422052','1091032971613171',NULL,NULL,NULL),(754,1206891395647206,'MBI Homelessness Prevention Program (HPP)',NULL,1326157862705937,'Who is MBI Homelessness Prevention Program?\n\nSpecialists then create a Housing Stabilization Plan and explore consumer\'s natural support systems to secure temporary diversions while the consumers work the Plan to gain housing. Specialists may also secure permanent diversions natural support systems that secure housing for consumers to avoid homelessness and/or shelter.\n\nWhat Should I Expect?\n\n Increased self-sufficiency through tailored Housing Stabilization Plans that guide you through the process toward sustainable housing.\nBi-Weekly Follow Ups in Office or Via Phone with Prevention Specialists for consumers provide updates on the progress made with the HSP and to explore the next steps.\nThe type and level of assistance will be based on the familys needs, situation, and MBI Homelessness Prevention Program is a 90 day program providing a wide range of services and resources for adults with children for the sake of helping families gain sustainable housing and preventing homelessness within the D.C. Metro Area\n The Prevention Program offers an alternative .\nTo shelter and provides assistance and resources designed to provide a housing solution for families who are at serious risk of homelessness.\nAt MBI Homelessness Prevention, Specialists identify factors such as rental arrears, evictions, both criminal and credit history that serve as barriers prohibiting consumers from sustainable housing contribution\nConnections to community resources to address mental health, education, employment, vocational training, childcare, and move in assistance as needed.     \n ','959978038980815','http://www.mbihs.com/what-we-offer/housing-programs',NULL,NULL,'Verified','929094559121639',' Am I Eligible?\n\n \n\nEligibility for homeless services is determined by Virginia Williams Family Resource Center.\nMust be a family - Single Individuals are not eligible.\nMust be a DC resident and/or receive DC benefits    \n \n\n How Do I Enroll?\n\n \n\n Persons seeking homeless services must first visit Virginia Williams Family Resource Center\n\n to be assessed, deemed eligible for homeless services, and receive a referral to MBI Homelessness Prevention.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'1292849277583603,868012483124236','817410769508748',NULL,NULL,NULL),(755,1149122872651888,'Assertive Community Treatment',NULL,883186000200856,'A multidisciplinary team that is engaged in serving people with chronic substance use, mental illness, homelessness, in order to minimizing unnecessary hospitalization and  emergency room visits due to psychiatric emergencies and improve their overall quality of life.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411,637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(756,1151800789254335,'Primary Care Medicine ',NULL,1200954196071495,NULL,NULL,'https://metrohealthdc.org/services/medical/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(757,1178096298000358,'School-Based Truancy Prevention Programming',NULL,727757843857751,'Our school-based truancy prevention work, through the Justice Grants Administration\'s \'Show Up, Stand Out\' program, is focused on providing academic supports, family engagement and case management services necessary to ensure that students are coming to school every day ready to learn.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234','1231516890380928',NULL,NULL,NULL),(758,1178562151177693,'Phase III',NULL,1318451956583107,'Each resident goes through four phases of treatment. In Phase 3, counseling and group therapy. Residents can now regain employment.','1147455525775238','http://cleanandsoberstreets.org/How_It_Works.html',NULL,NULL,'Verified','941516382466411,637158405241810,1232587316936391','You must have been admitted and gone through the previous phase of this four phase program. We accept referrals from the DC Department of Behavioral Health.',NULL,NULL,NULL,NULL,'883461165895110',NULL,NULL,'1244888069012632','711002699024806',NULL,NULL,NULL),(759,1182990804618783,'Progressive Employment Program','PEP',948113581207578,'Participants benefit from a three-week (15 sessions) Progressive Employment Program (PEP), family-oriented strength-based case management, job placement, and follow-up support to facilitate job retention, and other pertinent services through referrals, along with the services provided by CSC, will comprise a comprehensive array of services. The progressive employment program is also focusing on innovative ideas to build a strong career pathway for the clients, which will help create more career opportunities that align with the focused on becoming.','911858349594317','https://www.wearecsc.org/workforce-development',NULL,'info@wearecsc.org','Verified','970915508638448','Call to apply.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'1070225300187916','921919612082211',NULL,NULL,NULL),(760,1181081521839444,'Insurance Enrollment and Support',NULL,887352348953420,'La Clinica assists patients and community members to determine if they are eligible for insurance and to support their enrollment process. We hold insurance enrollment fairs open to the public during the open enrollment periods for the health exchange. Our team assists patients in collecting all needed documentation in order to apply, completing applications, and following up with the appropriate agencies to ensure that applications are approved.','1170113060894673','https://lcdp.org/_en/programs-medical-services.html',NULL,NULL,'Verified','637158405241810','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(761,1183383601010590,'Sanctuary Plus Emergency Shelter',NULL,1146223650874517,'In fall 2012, MSP completed our initiative to expand and renovate our emergency shelter, Sanctuary Plus, to provide shelter for up to 45 women and children. Residents at MSPs emergency safe house shelter, Sanctuary Plus, receive individual and group counseling, clinical case-management, and referrals focused on addressing the unique challenges each family and individual faces. The 9,000 square-foot state-of-the-art facility features 15 bedrooms, a childrens resource center, a secure playground, and a commercial kitchen with a full-time chef who plans nutritious meals for families. The shelters dormitory-style design encourages a sense of community and support that reminds families that they are not alone during this tough period of their lives.  During their 90-day stay at Sanctuary Plus, residents receive intensive supports focused on developing and pursuing goals towards independence.\n\nAs in most domestic violence shelters, children comprise the largest population in MSPs residential programs. Often lacking the ability to constructively express their feelings, children who have experienced trauma and witnessed violence, often exhibit negative or violent behavior at school and at home. Exposure to this type of violence is also the greatest indicator that a child will grow up to find himself or herself in a violent relationship  as either the abuser or abused.\n\nLast year, more than 90% of the families served in Sanctuary Plus moved to more stable, safe homes. They did not become homeless, return to their abusers, or move to another short-term shelter program  draining a very limited resource.',NULL,'https://mysistersplacedc.org/programs-services/',NULL,'info@mysistersplacedc.org','Verified','878986697513222,929094559121639','If you are a victim of domestic violence, you may be a candidate for Sanctuary Plus. Call us at 202-540-1064 to learn more about our services.',NULL,NULL,NULL,NULL,'796866824967986','584619367978739',NULL,'836091364973509,1212718840001878',NULL,NULL,NULL,NULL),(762,1186072430576309,'Seabury Connecter Card',NULL,1180598613249590,'Seabury ConnectorCard provides subsidized transportation funds through a prepaid debit card to older adults in Washington, D.C.  so that they can get the transportation they need when they need it.','1183011241112934','https://www.seaburyresources.org/transportation',NULL,'info@seaburyresources.org','Verified','632609508449013','Call for more information.',NULL,NULL,NULL,NULL,'922524162152948',NULL,NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(763,1195471396130558,'CENTER FOR SOCIAL JUSTICE: D.C. READS',NULL,941815502594091,'Employs the services of students from 7 universities to tutor D.C. public school students at 40 learning sites. The program\'s main focus is reading.','877958047132310','http://socialjustice.georgetown.edu/students/service/dcreads/about/15129.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1051724403215349',NULL,NULL,NULL),(764,1207414557990697,'Substance Abuse Counseling',NULL,801110030219864,'Thrive DC believes that every person, no matter their circumstances, should be treated with respect and dignity.\n\nFor those struggling with substance abuse and/or addiction we offer:\n\n-One-on-one counseling, case management, and treatment referrals\n-Weekly Mens Substance Abuse Education (Wednesday) 10:30 AM  11:30 AM\n-Weekly Womens Substance Abuse Education (Friday) 2:00 PM  3:00 PM\n-12 different topics of discussion (12 weeks)\nFor those struggling with substance abuse and/or addiction we offer:\n\nHelp Without Judgment\nThrive DC offers a low-barrier program designed to reach clients considering sobriety or working hard to sustain it. The program is divided into three basic parts:\n\nEducational Groups\nTreatment Referral\nIndividual Counseling\nGroup Meetings\nEvery Monday, Wednesday, and Friday from 11:00 AM  12:30 PM Thrive DC holds a group meeting for people in recovery, considering recovery, or looking for more information on getting sober for friends and family members.\n\nGroups are open to all (not restricted by gender), and are accessible to both English and Spanish speakers.\n\nEducation Topics\nThe Educational Group Topics include:\n\nDefinitions and self diagnosis\nAlcohol and drug education\nTriggers, cravings, and avoiding relapse\nPlanning for sobriety\nAlcohol and tobacco\nSex, drugs, and alcohol\nSpirituality\nStress and emotional health\nStress reduction\nNegative emotions\nAnger and communication\nRelapse prevention','1220597047470925','https://www.thrivedc.org/programs/substanceabuse/',NULL,'gabriel@thrivedc.org','Verified','941516382466411','For more information about substance abuse counseling, please contact Gabriel Fabre at (202) 503-1521 or gabriel@thrivedc.org',NULL,NULL,NULL,NULL,'665113076769939,1096494296237143','818646560557978','1166926453122116','877243931325915','962322435473993',NULL,NULL,NULL),(765,1211369825885952,'Social Services',NULL,931366816861797,'Working as part of a comprehensive partnership, the social service programs work with clients  to help them become more self-sufficient through adult and youth counseling, parenting and family strengthening, family-to-family mentoring, fatherhood initiative program, housing assistance, life skills and emergency assistance','1098817401970888','https://www.perryschool.org/services',NULL,NULL,'Verified','637158405241810','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372','802405581688320',NULL,'1263089203668614,1292849277583603','896277574789110',NULL,NULL,NULL),(766,1212544141593855,'Case Management',NULL,1323664977480953,'Case management is an essential component of our residential and educational programming. Young people work with case managers to identify their strengths and challenges and then develop and implement individual service plans. When Covenant House Washington does not offer a service that a particular young person wants or needs, the case manager can draw upon an extremely comprehensive list of external service providers with whom we partner.','1106602330344467','http://covenanthousedc.org/our-services/supportive-services/',NULL,NULL,'Verified','637158405241810','Call or walk in for more information.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(767,1213230585541920,'Early Head Start',NULL,761153930697275,'The Office of Early Learning provides direct center-based services to Early Head Start children and families.  We focus on the first 1,000 days of a childs life  from birth through age 2. We are passionate about helping children learn and develop fundamental skills, which promotes families well-being.  All of our children are screened within the first 45 days of entry for health and developmental delays.  (Approximately 10% of the children served are diagnosed with disabilities.) We embrace all populations and develop strategies to address the needs of children and families who deal with disabilities, homelessness, and foster care, as well as different languages and diverse cultural backgrounds.\nOur classrooms have a special focus on comprehensive services including health, nutrition, and mental wellness. Our Early Head Start program gives infants and toddlers the tools to develop their social-emotional, physical, cognitive, and language skills  steering them in the direction of happiness and success.\nUPO operates 13 Early Learning Centers throughout DC. (We also arrange for home visits.)\nIn addition to our program, we offer partnerships with Spanish Education Development (SED) Center and Christian Tabernacle Child Development Center (CTCDC).','594960886051316,999755198000719','https://www.upo.org/earlyeducation/',NULL,NULL,'Verified','789038541797078','Call to enroll and visit our website to find which of our 13 learning centers is nearest to you.',NULL,NULL,NULL,NULL,'615824389715095,665905423802380','587544010010943,940897095189363,682372519823224','1250903097874303','1274396898894043,1244783161808236,1177145976454922','1304904589817191,1166860713798541',NULL,NULL,NULL),(768,1214958471600009,'Unity at Friendship Place (Ward 3) ',NULL,1043772486617212,'Healthcare for homeless ','1217655786602605',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'782889011388167',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(769,1214476217655096,'Veterans Legal Assistance Project',NULL,820488001755900,'The Veterans Legal Assistance Project will handle all those areas that NLSP already covers: (e.g., landlord tenant, family law) with the addition of:\nVeterans Affairs Disability Compensation Benefits,\nSelect Veterans Affairs benefits (i.e., Post 9/11 GI Bill) on a case-by-case basis\nMilitary discharge upgrades.\n\n\nABOUT THE VETERANS LEGAL ASSISTANCE PROJECT\n\nThe Veterans Legal Assistance Project (VLAP) provides free civil legal assistance to low-income veterans in the DC region. Often homeless and disabled, these veterans lack the most basic essentials: safe and affordable housing, healthcare, subsistence income or a job and protection from exploitation or violence. Many of their problems have legal dimensions and can be alleviated or resolved with the help of a lawyer.\n\nLaunched in 2015 in response to a fragmented and inadequate network of legal assistance for destitute veterans, the VLAP provides a gateway to legal and other services for this highly vulnerable population. An NLSP Staff attorney serves as the VLAP Project Manager. The project is overseen by the Capital Area Veterans Legal Services Collaborative, a group of legal services providers and law firms in the DC area who seek to improve the accessibility, scope and delivery of effective, free civil legal services to homeless and low-income veterans.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/veterans',NULL,' veterans.project@nlsp.org','Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586,1260550501779199','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(770,1220865966040605,'Clothing Closet',NULL,1274524554725599,'Offers clothing to those in need.','756139435965093',NULL,NULL,NULL,'Verified','911225335803318','Walk in and bring an ID.',NULL,NULL,NULL,NULL,'1179786506429029,821254553857567','1246945203240826',NULL,'565669778208779','1088461256923134',NULL,NULL,NULL),(771,1223670715224591,'Center for Child Protection and Family Support',NULL,1260225511804442,'The Center\'s Village Family Support Center, located at 2021 Alabama Avenue, in Southeast, offers home visits, crisis intervention counseling, individual/group counseling, life skills training and parent support groups. The focus is on prevention and early intervention.\nThe center also runs programs in parenting skills and childhood education.','1266604236381612','www.centerchildprotection.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1012912288287179',NULL,NULL,NULL),(772,1159527228339119,'Department of Human Services',NULL,1286410465547920,'IMA Change Center Phone: 727-6600\nFax: 535-1665\nFort Davis Service Center, 3851 Alabama Ave, SE. 645-4500\nAnacostia Service Center, 2100 MLK Jr Ave, SE. 645-4614\nCongress Heights Service Center, 4001 S. Capitol St, SW. 645-4525\nTaylor St Service Center, 1207 Taylor St, NW. 576-8000','536496426622681','DHS 4 In 1 App',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1106512184832418',NULL,NULL,NULL),(773,1161420907803778,'Support Services',NULL,872299181857178,'In addition to integrated education and training, OIC/DC currently provides the following support services to any participant in need:\n\n- Alternative Instructional Services: OIC/DC\'s tutorial program is designed to assist the participants regain academic focus.\n- Strength Based Case Management Services: OIC/DC provides an extensive case management service for each participant enrolled .  \n- Referrals and Wrap Around Services: The participants will be aligned to an array of complimentary programs and social services operated by public and private agencies in the community.\n- Job Readiness, Financial Literacy, Computer Literacy & Life Skills Training: OIC/DC integrates these important instructional elements with skills and basic educational instructions, so that the participant has a holistic instructional approach.\n- Job Development and Placement: OIC has a reputation with employers for not only providing well trained people who are ready and able to work, but for working with employers to keep people on the job once placed.\n- Retention and Follow-up Services: OIC/DC sees follow -up as an extension of the program. Participants will undergo successes and failures as they learn how to negotiate the real world-of-work. They will need an ongoing source of support and encouragement in order to achieve long-term success.\n- Career Coaching: OIC/DC helps participants get a new and fresh perspective on their lives and their careers as well as where they have been, where they are today, and where they want to go in the future.','644198517647426','https://www.oicdc.org/support-services.html',NULL,NULL,'Verified','970915508638448','Services are offered to those enrolled in an OIC/DC job training program.',NULL,NULL,NULL,NULL,'1159943619120642,1329231011154165,940633061926387',NULL,NULL,'868012483124236','592528015341160',NULL,NULL,NULL),(774,1166105214343141,'Additional Services',NULL,964889233755760,'In addition to our core services, DCCIL also provides an array of other related services. These services include but are not limited to ADA information and consultation, relocation by choice, benefits planning, travel training, asset management, orientation and mobility and rehabilitation teaching for people who are blind or visually impaired, basic computer skills, housing resources (we do not provide housing directly) and limited transportation services. DCCIL provides services to individuals with significant disabilities as well as to the local community at large.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','632609508449013,941516382466411,929094559121639,637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(775,1178649951131958,'Produce Plus ',NULL,559497771463092,'D.C farmers market where customers receiving any federal benefit (SNAP, WIC, TANF, SSI Disability, Medicaid, Medicare QMB) can get $10 to spend on produce up to twice a week. ',NULL,'https://www.dcgreens.org/customers',NULL,'produceplus@dcgreens.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1149605139139139',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(776,1180091016211141,'Supported Employment',NULL,802521051916688,'Supported Employment is an evidence-based program encompassing recovery principles and recognizes that employment can be an integral part of a persons recovery. Employment Specialists develop relationships with community business owners and hiring managers to help the client become employed in the job of their choice. Working together, Employment Specialists and program participants develop an individual work plan, create a resume, and practice interviewing skills. Employment Specialists coordinate with the participants treatment team, provide job coaching, and on-going support to assist the individual in maintaining employment','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'970915508638448','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(777,1183218830562978,'Computer Lab',NULL,801110030219864,'Computer Lab\nOur computer lab is open and accessible from 10:00 AM  5:00 PM. We offer six internet connected desktops that clients may use for an hour at a time.\n\nLab Schedule\n8:30 AM Sign ups are available to reserve your computer time for the day. First come, first served.\n10:00 AM  3:00 PM Computers are open to everyone\n3:00 PM  5:00 PM Evening Program begins, computers are only available for women','1220597047470925','https://www.thrivedc.org/programs/computerlab/',NULL,NULL,'Verified','789038541797078','8:30 AM Sign ups are available to reserve your computer time for the day. First come, first served.\n10:00 AM  3:00 PM Computers are open to everyone\n3:00 PM  5:00 PM Evening Program begins, computers are only available for women',NULL,NULL,NULL,NULL,'665113076769939','818646560557978',NULL,'877243931325915','962322435473993',NULL,NULL,NULL),(778,1208776169183354,'My Health GPS',NULL,840733417398800,'Marys Center proudly offers My Health GPS to qualified DC Medicaid participants (Amerihealth or Trusted Health Plans) living with three or more chronic conditions. Launched by the DC Department of Health Care Finance, My Health GPS is designed to improve care coordination so you can manage your complex health needs more effectively and increase your quality of life.  \n\nYou can enroll in My Health GPS by:  \nVisiting any Marys Center Health Center   \nUsing the DC Health Homes website  \nDuring your Marys Center Health at Home telemedicine visit  \nOnce enrolled in My Health GPS, youll receive caring support from a multidisciplinary care coordination team with the aim of improving your health outcomes and decreasing the likelihood of preventable hospital admissions and ER visits.  \n\nYou and a care team member will complete a thorough needs assessment and work together to create a care plan shaped by your unique needs and priorities. Your Marys Center care team will serve as your point of contact for coordinating all available My Health GPS benefits and will also give you referrals to other community and social support services as needed. \n','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/my-health-gps/',NULL,NULL,NULL,'941516382466411','You can enroll in My Health GPS by:  \nVisiting any Marys Center Health Center   \nUsing the DC Health Homes website  \n\nMarys Center is ready to partner with you on your health journey. Dont hesitate to reach out to us using the information below. \n\nTo make an appointment or see if you qualify for My Health GPS, call: \n\nMarys Center appointment line at (844) 796-2797 anytime OR \nThe DC Access HELPLINE at (888)7WE-HELP or (888) 793-4397 ',NULL,NULL,NULL,NULL,'1301804131597006,976818868031171','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,NULL,'903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(779,1210697117152571,'Family Training',NULL,744812603775568,'Quality Trust staff offer a variety of practical training critical for improving the lives of children and adults with disabilities and their families. All activities are based on support inclusion, self-determination, and collaboration with existing organizations. Subjects are tailored to specific needs and requests and can include Whats Next: Planning for Secondary Transition and Making Important Choices Throughout Life. These and other topics are presented by instructors with many years of practical experience who are sensitive to the range of different family experiences and multicultural perspectives.','1185969381076176','https://www.dcqualitytrust.org/families/advocacy/',NULL,'tcampanella@dcqualitytrust.org','Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'650675878696913','655204523101840','1280208916486415','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(780,1215651158311524,'Department on Disability Services Division',NULL,1326157862705937,'The DDS Division is a federal agency that has certified MBI to provide support for you and your friends. This Program aims to strengthen the individuals mind, body, and heart to enable them to overcome worries in life derived from their physical or behavioral state. We also aims to relieve loved ones from the responsibility of taking care of their beloved who is suffering from his or her own internal difficulties. MBIs DDS Division does not provide ordinary services to our clients. We treat them with professionally trained staff who are well-adverse in their practice.\n\nIn-Home Support- MBI Provides personal and domestic care services for the BLIND, AGED, or DISABLED within your home. But if you don\'t want to stay home, social activities such as dancing, basketball games, concerts, and bowling are just SOME of the options you have for getting back out there!\nResidential Services- MBI holds several types of residential support including: Host-Home, Respite Services, & Supported Living Services.\nHost-Home Services-  Families can rest at ease knowing that their loved one is in the comfort of a Care Giver\'s home, where care is given around the clock.\nRespite Residential Services- MBI can offer you short-term care for persons with behavioral disabilities, so that you never have to worry about what to do when you need to address the other aspects of life.\nSupported Living- Ever wanted to live life without burdening those around you? Then this program may help you take the steps towards independent living. Staff can visit your home and teach you all the things you need to know such as, but not limited to: Monetary Management, Housekeeping, Conflict Resolution, Hygiene Skills\nAdult Day Habilitation Program- Individuals with developmental disabilities are given the chance to develop life skills, and receive therapeutic support in order to strengthen their daily living. The can gain vast knowledge on Daily Living Skills, Health & Fitness, Computer Skills & Research, and Employment!','959978038980815','http://www.mbihs.com/what-we-offer/department-on-disability-services-division',NULL,NULL,'Verified','637158405241810','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'817410769508748',NULL,NULL,NULL),(781,1219423070978646,'Transgender Care and Service ',NULL,548126332764833,NULL,NULL,'https://www.whitman-walker.org/transgender-care-and-services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'554247704723838',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(782,1222426882848143,'Functional Family Therapy',NULL,883186000200856,'A family-focused home-based intervention for at-risk youth and their family. Clients involved in this program are more likely to stay in school, stay out of trouble, and stay at home or in some other caring and supportive environment.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(783,1224104445658687,'Day Program',NULL,1187372282686349,'The Day Program is a structured, low barrier to entry program that welcomes over 100 guests into the Center each day to meet their immediate needs while providing case management and other support. The Program is designed to support men on their journey through homelessness, in keeping with our mission of Meeting Needs Reclaiming Lives.\n\nMen struggling with homelessness face a range of obstacles. The Father McKenna Center has a well-developed program of services and strategies to support our guests, balancing small goals with high expectations. The ultimate goal of our work is to help each man reach his full potential. Our approach is to meet each person where he is and support him as he works toward a life of stability, productivity, meaning, and hope.\n\nIn any week we have over 250 unique guests (in the course of a year more than 1,800 different men spend time at the Center). They range in age from early 20s to over 80, and are of every race, color and creed, although the overwhelming majority are African American.\n\nReflecting the diverse impact of homelessness, some men are well educated, while others do not have a high school diploma. We see men suffering from mental illness, struggling with addiction, and isolated from their families. Some men are coming home from incarceration, others are new to the DC area. In each man we see a unique person, beloved of God, deserving of grace, and imbued with innate dignity.\n\nWe provide:\nStructured case management, including counseling, an accountability program, and referrals for mental and physical health assessments.\nA mens support group meeting every day, attendance is a pre-requisite for Midday Meal at the Center. These facilitated sessions challenge and encourage, while building a strong peer network within a community where trust is rare.\nSubstantial breakfast and home-cooked hot lunch, served by volunteers and shared with love.\nShowers and laundry service, supporting our guests in maintaining personal hygiene and the self-respect which that reflects and conveys.\nUse of a phone and secure cell phone charging.\nMail distribution and use as a stable address, vital for engaging with government agencies and potential employers.\nCoordination of transportation for medical and social service appointments, in conjunction with Case Management.\nComputer access and training.\nA clothing distribution service for both basics and work appropriate clothing.','1209121324412172','https://fathermckennacenter.org/what-we-do/day-program/',NULL,'info@fathermckennacenter.org','Verified','637158405241810','Call or walk in for services.',NULL,NULL,NULL,NULL,'1123859846194392','1107831955306053',NULL,'1263089203668614','645829762063748',NULL,NULL,NULL),(784,1229115016596631,'Valenti House',NULL,906742630902911,'Valenti House, the center of the Woodley House program, has helped thousands of men and women achieve stability and reintegrate into the community. Located in Woodley Park, this three-story townhouse is named in honor of Mary Margaret Valenti, a former Woodley House Board member and great supporter of Woodley House. \n\nValenti House offers a warm, caring environment for men and women working toward recovery and greater independence.  It is centrally located near public transportation, stores, restaurants and recreational activities (within walking distance of the National Zoo). Residents receive full room and board, as well as individualized assessment, support and life skills training. Valenti House provides housing for up to 20 residents and is professionally staffed 24 hours, seven days a week.',NULL,'https://woodleyhouse.org/residential-care/valenti-house/',NULL,NULL,NULL,'929094559121639','Referrals are accepted from the Department of Behavioral Health, Core Service Agencies, private providers, hospitals and families.\nPrivately-paying residents need a psychiatrist who can include Woodley House in the residents treatment plan, providing a referral for application to Woodley House. Residents also need to show proof of their ability to pay. Privately-paying residents can come from outside the District of Columbia.\n\nResidents who require financial assistance must show proof of DC residency, be enrolled with the DC Department of Behavioral Health (with an eCura Number) and have a recommendation from their Core Service Agency to apply to Woodley House and have access to public funding assistance. The Core Service Agency will inform them of any needed documentation that they require. After documentation is gathered, please contact Valenti House to receive more information and to set up an initial interview.\n\nBecoming a resident of Valenti House includes housing, meals, 24 hour residential supervision and comprehensive skills training and clinical support services. Please contact Valenti House for more information.',NULL,NULL,NULL,NULL,'1104551016510441',NULL,'756653322156829',NULL,NULL,NULL,NULL,NULL),(785,1225714083985470,'WASHINGTON METROPOLITAN AREA TRANSIT AUTHORITY: METRO SENIOR/DISABLED ID CARD SERVICES',NULL,837178101758888,'Offers reduced fares to seniors and people with disabilities who have a valid Metro Senior ID card, Metro Disabled ID card or a valid Medicare card with photo identification.','638978574424697','http://wmata.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'788465536422820',NULL,NULL,NULL),(786,1228495289369706,'Short-term Residential',NULL,726173106231202,'The Special Circumstances Program assists those who do not qualify for other Central Union Mission programs but are in need of short-term residential services and support. Participants must be involved in a productive activity that will lead to self-sufficiency, such as school, training or part-time employment.\n\nExamples of individual goals include housing, employment, literacy, GED or External Diploma, vocational opportunities and money management, and accountability.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','929094559121639','Call for more information. This program will likely be suggested after intake if you do not qualify for other services.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'625195015492370,1319255723578292,877243931325915','585594366267961',NULL,NULL,NULL),(787,1172561205584676,'Early Childhood',NULL,1138775501034023,'Learning begins at birth and continues throughout the lifespan. DC Action for Children works to eliminate disparities and strengthen our early childhood system so it can support families with young children from birth through age 5.','1147823510376197','https://dcactionforchildren.org/our-priorities/early-childhood',NULL,NULL,NULL,'917725171609009','Call for information on our current projects.\n',NULL,NULL,NULL,NULL,'1139434629285592','1098590993104545',NULL,NULL,'792709813022086',NULL,NULL,NULL),(788,1174727442443930,'Street Outreach',NULL,1245236106154921,'Everyone Home DCs Street Outreach team works with chronically homeless individuals living in Capitol Hill, specifically in the Eastern Market neighborhood. Our Street Outreach team utilizes a person-centered approach to build and maintain relationships with our chronically homeless neighbors, and supports them in meeting their immediate needs and achieving their long term goals, which includes obtaining stable housing.\n\nOur Street Outreach team spends most of their time in the field, meeting clients where they are, accompanying them to goal-oriented appointments, and connecting them to community resources including mental health services, medical benefits, food stamps, SSI/SSDI and other supportive services. Our street outreach team partners with Unity Healthcare to connect our homeless neighbors with high quality medical care. Our street outreach team is enhanced by our Homeless Assistance Response Team (HART), which is made up of vibrant and caring community volunteers.','843095304494507','https://everyonehomedc.org/programs/street-outreach/',NULL,NULL,'Verified','929094559121639','For more information about our street outreach program, or to connect with an outreach worker, call 202-544-0631 ext. 202.',NULL,NULL,NULL,NULL,'976521643212097,591848459801218','1127790854320730,1172146638038771',NULL,'877243931325915','803436271206188',NULL,NULL,NULL),(789,1171417382872545,'City Leaders Program',NULL,601937487816671,'Academic and career challenges do not end with high school, and neither do FLOC programs. Students enrolled in the City Leaders Postsecondary Program continue to receive support and guidance as they navigate their college or vocational school experience.\n\nFLOC supports postsecondary scholars with:\n\n- Individualized Academic Guidance\n- Professional Development Workshops\n- Encouragement to join campus social activities and perform community service\n- FLOC Alumni social gatherings\n- Exam Care Packages','1140386841515505','https://floc.org/city-leaders-program/',NULL,NULL,'Verified','789038541797078','If you have any questions or would like to enroll a student in the City Leaders Program, please contact Diana Romero, Recruitment and Outreach Manager, at dromero@floc.org or 202-349-3517.',NULL,NULL,NULL,NULL,'796654497660631,907838847178020','1058805278682671,601024770885061',NULL,'929489252462627,955662425502270','766532349524044',NULL,NULL,NULL),(790,1187463498588025,'Partnership Program',NULL,726173106231202,'Veterans Substance Abuse and Recovery Program (SARP)\nThe Mission partners with the Veterans Substance Abuse and Recovery Program (SARP) to provide temporary housing for up to six veterans in the VA treatment program for two to four weeks while their transitional housing is arranged.\n\nSo Others Might Eat (SOME)\nAn agreement with So Others Might Eat (SOME) allows men to participate in SOME programs during the day and receive shelter at the Mission during a typical stay of three to four weeks.\n','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','832990803111047,941516382466411','Call for more information. These programs are in partnership with other organizations.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'877243931325915,625195015492370,1319255723578292','585594366267961',NULL,NULL,NULL),(791,1188218787305496,'EmpowerGirls',NULL,1230770757213322,'EmpowerGirls serves middle and high school girls. The program is run in District of Columbia Public Schools and Prince Georges County Public Schools. During the school day, students meet for EmpowerGirls sessions  during lunch or other regularly scheduled periods. In addition, students meet with an assigned near-peer mentor during special EmpowerGirls field trips, or planned one-on-one activities. Mentors stay in contact with EmpowerGirls through ongoing communication to build authentic bonds and sisterhood.\n\nEMPOWERgirls focus on:\nCareer & College Readiness\nConfidence & Self-Efficacy\nCultural Competency\nMindfulness & Mental Health\nAdvocacy & Leadership\nPrevention & Life Skills\nMentor a Young Girl Today\nInvest in a young girl while developing marketable leadership skills. As a mentor, you can make a difference in the lives of girls in the national capital area TODAY!\n\nWhat Does it Take to be a Mentor?\nAgree to make a one-year commitment as a mentor.\nSpend a minimum of eight hours per month one-on-one with mentee.\nMentoring sessions can take place one-on-one, in the community, or during structured activities organized by EmpowerGirls.\nMentors are encouraged to attend all monthly special EmpowerGirls events, and communicate weekly with mentee to develop a strong and authentic bond.\nMentors go through an interview with YWCA National Capital Area, complete a criminal background check, receive formal training, and start with a program meet and greet.\nAdditional mandatory in-service trainings are provided to support the mentor-mentee relationship.','771897230838212','https://www.ywcanca.org/what-we-do/youth-mentoring-development/empowergirls/',NULL,'youthprograms@ywcanca.org','Verified','970915508638448,789038541797078','The application is available online on the program website. Download the application, fill it out, and then send it to youthprograms@ywcanca.org. You can also call for more information.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'836091364973509','1330181492619505',NULL,NULL,NULL),(792,1191542329896840,'Homicide Outreach Project Empowering Survivors (HOPES)','HOPES',769893937425938,'Through the Wendt Centers Homicide Outreach Project Empowering Survivors (HOPES) Program we provide comfort and support, information and practical assistance to families, individuals, and communities coping with homicide-related deaths. Services are provided by licensed clinicians, program staff, and carefully trained volunteers with expertise in the areas of trauma, grief and loss, and child and family therapy.','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(793,1197691835069647,'Foster Care',NULL,1323195974089796,'LAYCs Foster Care program places some of the Districts most vulnerable youth in a safe and loving home.\n\nSome children in the Washington, DC area are removed from their home out of necessity for their safety; others are removed because their biological parents are not able to care for them; and other youth and children come to this country unaccompanied, without close ties to other family members.\n\nThe District had 6,727 total referrals for child abuse and neglect which resulted in 6,190 referrals for investigation; 2,377 children were found to be victims of abuse or neglect.*\n\nOUR PROGRAM\nThe foster care system allows for these children to have a safe place to live and heal once separated from dangerous situations. A licensed child placing agency with the District of Columbia, LAYCs Foster Care program provides housing and intensive case management services to children and youth in DC.\n\nOur program ensures foster families are prepared for the responsibility of being a caretaker for a child in the foster care system through:\n\nA certification process that licenses families to meet DC Child and Family Services Agency requirements.\nTraining and support to provide a temporary safe haven to the child or youth during a critical time in their lives.','585101162574385','http://www.layc-dc.org/what-we-do/safe-housing/foster-care/',NULL,NULL,'Verified','637158405241810','Call or walk in for more information.',NULL,NULL,NULL,NULL,'745110519319130','1353902664253088','955478188348338','1292849277583603,1295679372454826','846581217255552',NULL,NULL,NULL),(794,1210007334289332,'Family Rehousing Stabilization Program','FRSP',948113581207578,'Families in the Family Rehousing and Stabilization Program (FRSP) must be assigned by The Community Partnership for the Prevention of Homelessness. FRSP provides a security deposit and rental subsidy for up to 12 months to re-house families who are homeless. CSC provides case management, teach and encourage housing maintenance skills (e.g. timely rental and utility payments, appropriate landlord-tenant communications, etc.), and needed referrals to help stabilize the families.','911858349594317','https://www.wearecsc.org/family-services',NULL,'info@wearecsc.org','Verified','929094559121639,637158405241810','You must be referred by a core service agency.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'1292849277583603','921919612082211',NULL,NULL,NULL),(795,1208786629108154,'Counseling and Emergency Assistance',NULL,931366816861797,'Perry Center, Inc. anticipates receiving some funds to assist families in crisis.','1098817401970888','https://www.perryschool.org/family-and-social-services',NULL,NULL,'Verified','878986697513222,637158405241810,1077790582995406','To learn more about emergency assistance and crisis counseling, please contact Margaret Pegram at 202-312-7159.',NULL,NULL,NULL,NULL,'821652578679829','802405581688320','769228683615655','1263089203668614,1292849277583603','896277574789110',NULL,NULL,NULL),(796,1221979026614276,'Behavioral Health ',NULL,1200954196071495,NULL,NULL,'https://metrohealthdc.org/services/behavioral-health/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(797,1224317983369922,'Patricia Handy Place for Women',NULL,1186080684764999,'The Patricia Handy Place for Women, located at 810 Fifth Street NW, is the first short term emergency housing facility to open as part of the Mayors All Eight Wards plan to address and end homelessness in the District of Columbia, as detailed in the Homeward DC strategic plan. Incorporating the best of N Street Villages service-enriched model of care, programming at the Patricia Handy Place is trauma-informed, dignified, and safe for single women experiencing homelessness. The transformative program includes critical services provided by trained staff, volunteers, and city and nonprofit partners and has been designed to create a sense of community and enhance individual feelings of empowerment. ','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(798,1224083578603659,'Barriers to Employment',NULL,820488001755900,'NLSP will consider handling following types of problems that are preventing clients from getting or keeping jobs:\n\nCriminal records\nDenials of employment when they are improperly based on arrest or credit reports\nExcessive wage garnishments\nProblems with child support arrearages\n-Denial of employment because arrearages are owed\n-Threats of jail\n-Drivers license suspensions\nImproper inclusion in an abuse/neglect registry\nDenials of professional licenses\nWe may also assist with the following employment-related problems:\n\nRecovering unpaid wages such as\n-Wages below minimum wage\n-Unpaid overtime\n-Unpaid tips\n-Charges for equipment that bring wages below minimum\nUnemployment or tax problems because employers define workers as \"independent contractors\" instead of \"employees\nWe may offer advice and brief services for other employment-related issues. If we cannot assist you, we will help find an organization that can.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/barriers-to-employment',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(799,1229131972445514,'Independent Living Skills Training',NULL,964889233755760,'DCCIL provides IL skills training in specific areas needed to achieve independent living, ensuring that people with disabilities achieve and maintain their independence.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(800,1226281254511848,'Anacostia Health Center (Ward 8) ',NULL,1043772486617212,NULL,'764535834724222',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'928057873648589',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(801,1230658202367837,'Online Transgender Resources',NULL,810479025131545,'An online group of resources aimed to support the transgender and gender non-conforming community.',NULL,'https://www.hips.org/transgender-resources.html',NULL,NULL,'Verified','637158405241810,941516382466411,917725171609009','Visit website to check out the resources.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(802,1182157958552306,'Infants',NULL,580772169029651,'Our Infant Program is designed to meet the individual needs and scheduling of infants six weeks to 18 months. We develop a relationship with your infant, helping your baby to feel safe and loved. This relationship creates confidence in your child so that he or she will be ready and excited to learn new skills while in our care. Moreover, we build a relationship with you and your family, prioritizing open communication so that we are working in partnership to promote the growth and development of your child.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'1253130963143168','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(803,1176014704120176,'Center for Autism Spectrum Disorders',NULL,1061724977026001,'The Center for Autism Spectrum Disorders (CASD) is a multidisciplinary team comprised of pediatric autism specialists, including clinical psychologists, neuropsychologists, child and adolescent psychiatrists, developmental pediatricians, social workers and speech/language pathologists. These experts work together to provide the best possible care for autistic youth, and lead research to understand the underpinnings of autism and effective approaches to maximize autistic youth outcomes.\nThe Regions Largest Autism Program\nCASD is the largest multidisciplinary pediatric autism program in the Washington, D.C., region. Our specialists understand the unique needs of children as their brains and bodies develop. We offer:\n\nEvidence-based clinical care. Our experts lead national research studies on ASD with the goal of advancing assessment and treatment options. By studying autisms genetic, neurocognitive, behavioral and social factors, we can identify and apply the most effective treatments for your child.\nEducation, support and advocacy. We provide the latest information about ASD to everyone from families and patients to school personnel, physicians and agencies. Resources include seminars, workshops, the CASD Chat newsletter, training and consultations. Sign up to be added to our CASD Chat newsletter mailing list. You can also view details about upcoming Executive Function and Social Skills groups.  \nWe collaborate with the following departments/specialties:\n\nDevelopmental pediatrics\nDevelopmental/clinical psychology\nGenetics\nGender and gender identity development\nNeurology\nNeuropsychology\nPsychiatry\nSpeech and language pathology\nCASD\'s mission is to excel in care, advocacy, research and education. We accomplish this by:\n\nProviding a quality health care experience for our patients and families through a coordinated program of state-of the-art clinical services\nImproving health outcomes for children regionally, nationally and internationally by educating the next generation of clinicians in best practices for autism evaluation, diagnosis and treatment\nCreating innovative solutions to pediatric health challenges by conducting research that includes and reflects the neuro-diverse population we serve\nEmbracing neurodiversity and welcoming autistic individuals as collaborators, research trainees, students and staff members\nCASD works every day to optimize trajectories for autistic youth with the goal of successful transition into adulthood. Our Stakeholder Advisory Board, comprised of parents whose children have received assistance from CASD, provides recommendations to CASD faculty and staff to improve care, research, education and advocacy efforts.','979447652621070,1262539583552576,1123014911424110,847752209986828','https://childrensnational.org/departments/center-for-neuroscience-and-behavioral-medicine/programs-and-services/center-for-autism-spectrum-disorders',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.\n\nIf you are interested in participating in one of our research studies, call 301-765-5425.',NULL,NULL,NULL,NULL,'936399096455093,1316624030382957','1132999168848737,692011508244789,1095419747725144,587218394770946',NULL,'1274396898894043,858950609064214','1067302604787333,1158748634298092,941935819463300,1289198148097063',NULL,NULL,NULL),(804,1192518431630550,'Food Pantry',NULL,706476638607137,'Offers a food pantry to DC residents in need of food. Must bring own bags.','692842183271323','https://www.brighterdaydc.org/',NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'919075870505440','900620545310091',NULL,'868012483124236,1274524177531453','915998507127869',NULL,NULL,NULL),(805,1195217931217458,'Infant and Toddler Mental Health Program (ITP)',NULL,1061724977026001,'Most children can be gloomy or irritable at times. But for some children and even infants, difficulties in personality or mood can be more serious. These problems are sometimes related to a medical condition or to a developmental delay. They also may result from a traumatic event.\n\nWhatever the cause, we understand how stressful and confusing it can be when your young child is having trouble. We are here to help relieve these problems in children up to age 5, and prevent them from worsening as children grow up.\n\nWhy Choose Us\nAt the Infant and Toddler Mental Health Program (ITP) at Childrens National Health System, we diagnose personality and mood conditions early and design treatments specifically for your child. Features of our program include:\n\nUnique, specialized psychiatric services for young children. We are one of only a few providers in the region specializing in psychiatric treatment for preschool-age children and in specialized therapies for this age group such as Parent-Child Interaction Therapy (PCIT), a best practice therapeutic approach for young children with behavioral difficulties and their parents. Our feeding disorders clinic is one of only a few of its kind in the U.S. that specializes in treating infants and toddlers.\nCompassionate, personalized care for each patient and family. Our Infant and Toddler Mental Health specialists consider each childs individual situation and always treat you and your family as part of the team. We take the time to help you understand your childs diagnosis and treatment and to answer any questions you may have. Our care supports your childs emerging abilities and helps him or her grow into a healthy and happy child.\nInternationally known for our results. The defining work on feeding disorders in young children was written by our director, Irene Chatoor, M.D.. Children who need specialized expertise and child-focused care are referred to us from the Washington, D.C., area, across the nation and around the world.\nClose collaboration with skilled specialists. Our team works closely with a variety of specialists who add perspective to your childs care. They can include occupational therapists and speech-language therapists, as well as experts from fields such as developmental psychology, developmental pediatrics, autism spectrum disorder and sleep disorders.\nSpecialized Care\nIdentifying mental health issues in children is complex. Childrens National offers two care paths that draw on multiple resources for your child.\n\nComprehensive Assessment and Intervention\nComprehensive assessment and intervention services help with a broad range of behavioral issues and stressful conditions that may affect infants through the first years of life. Parents or medical providers, may have concerns about:\n\nAggression\nAnxiety\nExposure to loss\nFeeding problems\nIrritability\nMoodiness\nNeglect\nSleeping difficulties\nViolence\nWithdrawn behavior\nYou childs first meeting with specialists may last up to two hours. It will include a psychiatric assessment. At that time we observe your child during a play session and cleaning up toys afterward. After this meeting, we give general feedback and advice for parents.\n\nThe underlying reasons for a childs distress and/or behaviors can be complex.\n\nA thorough evaluation usually requires at least three visits. Afterward we may recommend or provide:\n\nConnections to school and community resources. We provide referrals for school-based services, such as DC Early Stages, Maryland Child Find, and Virginia Infants and Toddlers Connections. We also work with school administrators to help them provide services for your child. That can include letters of recommendation for school-based interventions, such as individualized educational plans (IEP), and referrals to educational advocates such as the Childrens Law Center.\nDaycare or preschool consultations\nIndividual treatment strategies. This can include highly effective approaches such as parent-child interaction therapy (PCIT), which is provided by PCIT-certified therapist Leandra Godoy, Ph.D.. Applied behavioral analysis (ABA) can result in positive behavior changes in children with autism spectrum disorder. We also may recommend play therapy.\nMedication, if needed. Some children benefit from medications focused specifically on their condition. Psychiatrist Bhavin Dave, M.D., can prescribe the right medication for your child and monitor how he or she responds.\nMultidisciplinary care. We can connect you and your child with other providers, such as specialists in autism spectrum disorder, developmental psychology, developmental pediatrics, speech-language therapy, and occupational therapy. We may also refer your child to our Sleep Center.\nEducation for parents. Experts at Childrens National help parents understand how issues such as developmental delays and medical problems can lead to emotional or behavioral issues in young children. They also explain your childs specific diagnosis and how it usually affects children as they grow.\nParenting support groups. Our parent support group gives parents an opportunity to share and learn from each other in an atmosphere of compassion, respect, confidentiality and mutual support.\nFeeding Disorders\nOur multidisciplinary feeding disorders team was established more than 15 years ago. Since then it has helped hundreds of families.\n\nFeeding disorders in infants and young children under the age of 6 can come from a physical problem, an emotional issue or both. Assessment and care for infants and young children with these disorders can help them avoid health problems and improve their emotional well-being as they grow. Feeding disorders can include:\nOvereating\nRefusing to eat\nAversions to specific foods\nSpitting up or vomiting in infants\nDifficulty sucking or swallowing in infants\nGastro-esophageal reflux\nChildren with these problems may weigh too much or too little, or be normal weight. Infants may fail to gain weight and thrive. Older children may fall behind the normal growth curve.\n\nNew patients are first seen by a nurse specialist in gastroenterology. This nurse will consider your childs medical, behavioral and nutritional issues. We also look at how well your child can control his or her lips, tongue and jaw muscles (oral-motor development). This screening will include a physical exam.\n\nAfter the initial report from the nurse specialist, your child will have visits with specialists in several areas of care relevant to his or her condition. We may look further into his or her oral-motor and psychiatric issues. At this time, we will observe your child from behind a one-way mirror as he or she eats and plays.\n\nOnce we complete the comprehensive evaluation, the entire team meets with you to provide feedback. Our recommendations can include:\n\nGuidance for parents in feeding management\nMedical treatment\nOral-motor therapy\nReferral to day treatment or inpatient care, if needed','1282604214927911','https://childrensnational.org/departments/infant-and-toddler-mental-health-program-itp',NULL,NULL,NULL,'941516382466411','For a new appointment for comprehensive assessment and intervention, call 202-476-5544. For follow-up appointments or questions, call 202-476-2486.\n\nFor a new appointment with the multidisciplinary feeding disorders team, call 202-476-5544.',NULL,NULL,NULL,NULL,'978304346911390,851455138371570,1260415588272979','892012398827551',NULL,'1274396898894043','928813128095347',NULL,NULL,NULL),(806,1197999240060381,'The Care Center',NULL,1220981589179778,'The Care Center is an outpatient infectious diseases treatment facility. We provide diagnostic and clinical services for infections and infectious diseases. The community can find us in the medical office building adjacent to our emergency department.','620132940242525','https://www.unitedmedicaldc.com/care-center/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'1136418356307446','1100182510854387',NULL,NULL,'818226241830087',NULL,NULL,NULL),(807,1201397185768590,'Kosher Meals on Wheels Program',NULL,970560028876577,'Seniors receive two low-salt meals, including lunch, dinner, bread, juice, milk, and fruit/dessert. Delivery is available Monday through Friday, and recipients may sign up to receive meals three, four, or five days per week.\n\nMeals are prepared by the Hebrew Home of Greater Washington in Rockville, Maryland and delivered by JSSA volunteers Monday through Friday between 9:00 AM and 12:30 PM.\n\nA full days set of meals are delivered cold and packaged in containers with heating instructions. Cancellations must occur at least 48 hours in advance. Meals will not be left at the door.\n\nThere are subsidies for Meals on Wheels available from JSSA and Montgomery County Department of Health and Human Services Senior Nutrition Program for those who cannot contribute the full amount.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/meals-on-wheels/',NULL,NULL,'Verified','637158405241810','For more information, please contact Diane Hays Earp, 301-816-2639 or dhaysearp@jssa.org.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1166119041430511',NULL,'1053289039718908,854808174954754','1328302797893590,1218692669680880',NULL,NULL,NULL),(808,1196102680422177,'SIBLEY MEMORIAL HOSPITAL',NULL,826683601578208,'Provides Psychiatric services.','1279712967379272','http://www.sibley.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'940246582982051',NULL,NULL,NULL),(809,1225791609508431,'Project Change',NULL,769893937425938,'Project Change is an innovative new program launched this year as part of H.O.P.E.S., implemented in coordination with Metropolitan Police Department and Medstar Hospital. The Center dispatches highly experienced mental health counselors to provide crisis support on-site at the hospital and in the community in the aftermath of an attempted homicide. The program is designed to promote healing at the family and community level and facilitate violence de-escalation. ','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(810,1230192545630197,'PROVIDENCE HOSPITAL',NULL,1110735130668467,'Provides Psychiatric services','1045557663297574','http://www.provhosp.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'854499289805909',NULL,NULL,NULL),(811,1233829102705880,'Unity at Harbor Light (Ward 5) ',NULL,1043772486617212,'Healthcare for homeless ','573694594931255',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'756860469257710',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(812,1237806236278461,'Education, Outreach & ParkArts',NULL,640186123610411,'DC residents learn and experience the value of parks for community health and vitality. Youth and adults of all ages explore our greenways and blueways through expeditionary learning and outdoor education activities year-round. Visitors to our Josephine Butler Parks Center learn about the urban greening movement and our approach to park-based community health.\n\nThe ParkArts program offers residents of Wards 7 and 8 a performing arts pop-up program that brings together arts partners and the public for a free mobile outdoor interactive arts and cultural experience in underserved parks and green spaces.','938406735971229','https://washingtonparks.net/programs/education/',NULL,NULL,'Verified','789038541797078','Visit website for calendar of events.',NULL,NULL,NULL,NULL,'1126250650450819','1099909899297811',NULL,NULL,'838941505712500',NULL,NULL,NULL),(813,1244196225355763,'Solution-Focused Brief Therapy','SFBT',948113581207578,'  Solution-Focused Brief Therapy (SFBT) is a therapeutic model and interviewing skill set that uses open-ended questions to identify solutions rather than an exhaustive examination of problems. As the name suggests, SFBT is future-focused, goal-directed, and focuses on solutions, rather than on the problems.','911858349594317','https://www.wearecsc.org/training-institute',NULL,'info@wearecsc.org','Verified','637158405241810','Call to set up an appointment.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,NULL,'921919612082211',NULL,NULL,NULL),(814,1248912869636667,'Social Work',NULL,726173106231202,'The Mission provides a variety of social services to low-income families to improve their well-being.\n\nSome of these services include providing English language instruction, GED preparation, health consultations, vocational support and more.','838780960881380','https://www.missiondc.org/what-we-do/family-programs/social-work/',NULL,NULL,'Verified','637158405241810,789038541797078','Call to speak to the social work department.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(815,1252793336729933,'Dental ',NULL,775874603891849,NULL,'903707682119815','https://www.some.org/services/healthcare#dental',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'569570973008761',NULL,NULL,NULL,'962036505121926',NULL,NULL,NULL),(816,1187200756463947,'Socking It to Winter',NULL,761153930697275,'Did you know that donating white tube socks can help save lives?\nIn addition to providing transportation services to DCs homeless population, our Shelter Hotline provides comfort items such as socks to keep the homeless protected during times of extreme cold.\nWhy white socks? Because cold temperatures can cause hypothermia and other serious health problemsand white socks make it easier for healthcare professionals to identify signs of infection, frostbite, and other foot ailments.','594960886051316,999755198000719','https://www.upo.org/communitywellness/',NULL,NULL,'Verified','911225335803318','Call if you are in need or want to donate.',NULL,NULL,NULL,NULL,'665905423802380','587544010010943,940897095189363,682372519823224',NULL,'684980356183378','1304904589817191,1166860713798541',NULL,NULL,NULL),(817,1191507987013016,'Mickey Leland House',NULL,1085960322097234,'Mickey Leland is a transitional housing program that can serve up to 22 men. The men are provided assistance with obtaining employment and permanent housing, and other help that prepares them for activities of daily living and self-sufficiency.','625764854102357','http://www.dccfh.org/programs/transitional-housing/mickey-leland-house/',NULL,NULL,'Verified','929094559121639','Call to inquire about openings and eligibility.',NULL,NULL,NULL,NULL,'948692297893561,616315721892118','1202819882057306',NULL,'1287907374119525,625195015492370,877243931325915,1070225300187916','744195899554615',NULL,NULL,NULL),(818,1210217918383230,'School Food Collaborative ','School Food Advisory Board ',559497771463092,'Support DCPS food and nutrition services through partnership and welcomes community feedback via School Food Advisory Board ',NULL,'https://www.dcgreens.org/school-food-advisory-board',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(819,1211572108731192,'Notary Services',NULL,844234717265246,'Most common law systems have what is called in the United States a notary public, a public official who notarizes legal documents and who can also administer and take oaths and affirmations, among other tasks.[2] In the United States, a signing agent, also known as a loan signing agent, is a notary public who specializes in notarizing mortgage and real estate documents. Although notary publics are public officials, they are not paid by the government; they may obtain income by charging fees, provide free services in connection with other employment (for example, bank employees), or provide free services for the public good. Documents are notarized to deter fraud and to ensure they are properly executed. An impartial witness (the notary) identifies signers to screen out impostors and to make sure they have entered into agreements knowingly and willingly. Loan documents including deeds, affidavits, contracts, powers of attorney are very common documents needing notarization. In the US (except Puerto Rico), any person  lawyer or otherwise  may be commissioned as a notary.\n\n\n\n\n\nTo \"notarize\" a document or event is not a term of art, and its definition varies from place to place; but it generally means the performance by a notary of a series of possible steps, which may include the following (not an exhaustive list):\n\n\n\nIdentifying the person appearing before the notary through personal acquaintance or by reference to significant proofs of identity including passport, driving license, etc.[3]\n\nWhere land titles are involved or significant rights may accrue by reference to the identity, signatures may also be verified, recorded and compared.\n\nRecording the proof of identity in the notarial register or protocol.\n\nSatisfying the notary that the person appearing is of full age and capacity to do whatever is intended.\n\nTaking an affidavit or declaration and recording that fact.\n\nTaking detailed instructions for a protest of a bill of exchange or a ship\'s protest and preparing it.\n\nRecording the signature of the person in the register or protocol.\n\nTaking an acknowledgment (in the United States) of execution of a document and preparing a certificate of acknowledgement.\n\nPreparing a notarial certificate (in most other jurisdictions) as to the execution or other step.\n\nSealing or stamping and signing the document.\n\nRecording all steps in the register or protocol.\n\nDelivering the completed original to the person appearing.\n\nIn some cases, retaining a copy of the document in the register or protocol.\n\nCharging the person appearing a fee for the service.','1116781625364190','https://mhcdo.org/notary-services',NULL,NULL,NULL,'917725171609009','Call to set up an appointment.',NULL,NULL,NULL,NULL,'1161638800071039','887181369602868',NULL,NULL,'802890951138045',NULL,NULL,NULL),(820,1220807689850937,'Family-to-Family Health Information Center','F2F HIC',1169351687674186,'AJE is home to the Family-to-Family Health Information Center for the District of Columbia, also known as the D.C. Health Information Center.\n\nWhat is an F2F HIC?\nFamily to Family Health Information Centers are established to provide information and assistance to Children and Youth with Special Health Care Needs (CYSHCN).\n\nWho are CYSHCN?\nThey are children who have, or are at risk for, chronic physical, developmental, behavioral or emotional conditions and who also require health and related services of a type or amount beyond that required by children generally. Examples of such conditions include: Asthma, Autism Spectrum Disorder, Cerebral Palsy, Blindness, Loss of Hearing, Diabetes, Bipolar Disorder, Epilepsy, etc\n\nWhat does the F2F DCHIC do?\nIn partnership with Marys Center for Maternal and Child Care we provide families of CYSHCN and the professionals that serve them, with one-on-one assistance, face to face and online training on topics related to health care.\n\nWe help families navigate through DCs health care system.\nWe connect families to resources within their communities.\nWe help families develop skills necessary to cooperatively and effectively participate in planning and decision making on health related issues.','763729877559385,641740493818315','aje-dc.org/dchic/',NULL,NULL,NULL,'637158405241810,941516382466411','Does the F2F DCHIC charge for services?\nNo, services are provided free of charge.\n\nHow Do I Get Started?\nThats easy! Just give us a call at (202)678-8060.\n\nWhat Can I Expect When I Call?\nAn educational support specialist will ask you some questions to understand what you need and will work with you to develop your next steps.\n\nWhat if I Dont Live in DC?\nTo find out about F2F HICs in other states, please visit the National Center for Family and Professional Partnership.',NULL,NULL,NULL,NULL,'1278097116269820,1123181686957068,602432444817544','859999387383412,1170631815352558',NULL,'1292849277583603','578010665151939,767767048082720',NULL,NULL,NULL),(821,1223081331141901,'D.C. HEALTHY START',NULL,NULL,'Offers home visiting services from nurses and family support workers, as well as screenings and assessments, case management, and health and parenting education. Serves District of Columbia residents from Wards 5, 6, 7, and 8. Women who are pregnant or who have infants up to 3 months old can enroll, and can receive services until the child is 2 years old.',NULL,'http://doh.dc.gov/service/dc-healthy-start-project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(822,1223965805414362,'Diaper Program',NULL,618997848324116,'Bread for the City distributes diapers each month. In addition, our baby pantry often stocks pull-ups, cereal, bottles, baby wipes, formula, hygiene packets, and other items that support new parents. At this time, diaper sizes 4, 5, and 6 are running low mid-month, and there is a significant need for additional in-kind donation support.','1058560288612968','https://breadforthecity.org/social-services/',NULL,NULL,'Verified','911225335803318','Call or walk in.',NULL,NULL,NULL,NULL,'606695908675970','1001321103570109',NULL,NULL,'786471426290380',NULL,NULL,NULL),(823,1220271139140877,'Labor Support Services',NULL,1088589897673997,'We provide support for Married/Domestic Partners, LGBTQQIA+, persons, Pregnant Teens, VBACs, Survivors of Abuse, Single & Surrogate Mamas, Adoptions, Military Families, Planned Cesareans, High-Risk Pregnancy, Miscarriages and Stillbirths. We support families of all religious and spiritual practices.\n\nThe Labor Support package for all mothers include: \n- 2 prenatal visits (the first in our office and the 2nd in your home)\n- Birth Plan Coaching\n- Comfort measures and relaxation techniques exploration and practice\n- On-call support beginning 3 weeks before your estimated due date (EDD)\n- Continuous labor and birth support \n- 2 postpartum visits which includes Lactation/Infant Feeding Support (this includes bottle feeding)\n\nLabor Support fees range from $800-$1600. Flexible payment options are available. FSA and HSA are accepted. All fees are due by 34 weeks of pregnancy. $250 non-refundable deposit reserves your space, 1/2 due before the first visit, 1/2 due before the second visit.','1191890430739322','https://www.mamatotovillage.org/labor.html',NULL,NULL,'Verified','637158405241810','Call the intake line or fill out an initial inquiry form on the website.',NULL,NULL,NULL,NULL,'644056895061746,867238429645312','1259025264194553,840380756273952',NULL,'1182104828841650','948258077222906',NULL,NULL,NULL),(824,1238586489770478,'Olaiyas Cradle',NULL,1306699628219808,'Olaiyas Cradle is a supportive, independent living program for homeless young mothers ages 18-21 and their children, for up to 18 months. Women are self-referred, and receive individual counseling, comprehensive maternal and infant health care, life skills training, education and career guidance, and child care support and parenting training to enable them to achieve self-sufficiency. Residents graduating from the program receive follow-up support and housing assistance to help them maintain stability.','1083708956779513','https://www.sashabruce.org/programs/safehomes/olaiyas-cradle/',NULL,'choward@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program. ',NULL,NULL,NULL,NULL,'646987721676899','882054301651193',NULL,'670990591619199,951536606221426,877243931325915','626337120120757',NULL,NULL,NULL),(825,1240040646031640,'RISE Transitional Housing',NULL,1146223650874517,'An innovative transitional-to-permanent housing program that builds survivors skills and self-dependency\nMSPs transitional-to-permanent housing program, RISE (Reaching Independence through Survivor Empowerment) helps families fleeing from domestic violence move from crisis and homelessness to safety and stability. In this one year program, MSP staff provide case management and education on financial responsibility and life planning. During the year of participation, rental payments are subsidized by MSP and MSP staff provide ongoing support and referrals to clients as they pursue goals in an autonomous environment. Families have the option to remain in the homes they have built for themselves after exiting the program, promoting long-term self-sufficiency and freedom from abuse.\n\nRISE launched in 2012, and in its first year, RISE served 5 families. Today RISE serves almost 30 families and continues to grow.',NULL,'https://mysistersplacedc.org/programs-services/',NULL,'info@mysistersplacedc.org','Verified','929094559121639','If you are a victim of domestic violence, you may be a candidate for Sanctuary Plus. Call us at 202-540-1064 to learn more about our services.',NULL,NULL,NULL,NULL,'796866824967986','584619367978739',NULL,'836091364973509,1212718840001878',NULL,NULL,NULL,NULL),(826,1238532588650595,'Temporary Housing at The Triumph',NULL,1195870505334629,'Community of Hope is pleased to bring our experience in ending family homelessness to The Triumph  our new temporary housing site. \n\nThe Triumph is where families are provided:\n\n  Access to services in their own community.\n\n 24-hour support as families plan to move to more permanent housing.\n\n Connection to Community of Hopes largest and most robust healthcare center, providing essential services such as: medical, dental and emotional wellness, homelessness prevention, maternal and child health, and home visiting for families with young children.','867188743739885','https://www.communityofhopedc.org/triumph-0',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DCs coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195,877243931325915','736237693077342',NULL,NULL,NULL),(827,1250906881501241,'Adult Individual and Group Therapy',NULL,883186000200856,'Covers broad topics including conflict resolution, wellness, grief and loss, trauma, domestic violence.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(828,1253744104425599,'P.O.W.E.R.','Providing Opportunities with Educational Readiness',761153930697275,'Kids want and need to know that the adults in their lives are invested in their future and committed to helping make their dreams come true.\nProviding Opportunities with Educational Readiness (P.O.W.E.R.) is a six-year program designed to help young people in DCs Ward 8 do well in middle school and high school and ensure that they are academically and emotionally prepared to continue their education after graduation.\nP.O.W.E.R. students participate in a wide variety of afterschool, weekend, and summertime activities, including STEM (science, technology, engineering, and mathematics) programming and nationally recognized competitions, college readiness lessons, field trips and fairs, and workshops that teach students and their families how to get financial help and prepare for future job opportunities.\nAnd the numbers show that P.O.W.E.R. really delivers! 30 of the programs first group of 40 students enrolled in college after graduating high school, and P.O.W.E.R. participants have earned a total of $1.5 million in college scholarships.\nWe work with many other organizations to offer P.O.W.E.R. workshops and services, including Bowie State University, DC College Access Program, Sasha Bruce Teen Outreach Program, Patriots Technology, Future Resource Learning, Wards 7 & 8 DC Prevention Centers, and the Tau Gamma Delta Sorority of Washington, DC.','594960886051316,999755198000719','https://www.upo.org/youth-services/',NULL,NULL,'Verified','789038541797078','For more information about P.O.W.E.R., contact UPO Youth Services Program Case Manager Kenny Carroll at 202-610-2014.',NULL,NULL,NULL,NULL,'851233609504150,665905423802380','587544010010943,940897095189363,682372519823224','981929906512252','740331137219886','1304904589817191,1166860713798541',NULL,NULL,NULL),(829,1252264089140599,'Veterans Services',NULL,726173106231202,'The Mission will provide emergency and long-term support to help homeless, hungry and unemployed veterans meet immediate needs, restore their lives and get back on their feet.  Based on the 2015 Point in Time count of homeless guests at the Mission, among the veterans: 65% were chronically homeless, 57% were formerly institutionalized, 43% reported chronic health conditions, 26% had mental health conditions and 26% had physical disabilities.\n\n Central Union Mission serves veterans in numerous ways:\n\nShelter.  On average, 17 homeless veterans stay in the shelter each night.  Some are referred to the Mission by the Veterans Administration.  Through a no-cost Memorandum of Understanding with the VA, the Mission provides short-term housing for veterans while they participate in VA programs for homeless veterans.  Through this partnership, the Mission provided 1,195 nights of shelter to 48 veterans over the past year.  This is in addition to over 5,000 nights of shelter provided to veterans not referred by the VA.\n\n Food.  Through its food pantry, the Mission serves on average 35 veterans per month, providing each of them and their families with enough groceries for about 96 meals each month.  The Mission also serves 3 meals per day to homeless guests as well as other hungry people who walk in its doors, amounting to over 50 meals per day for veterans.  Altogether, the Mission provides over 58,000 meals to veterans per year.\n\nWorkforce Development Programs.  Approximately 2 veterans participate each year in the Missions Work Therapy Program and Ready2Succeed programs, that provide work readiness training, employs veterans in-house in the Missions homeless shelter and food pantry and in Mission-held contracts and entrepreneurial ventures.  The Mission employs each participant for 6 to 24 months and helps them secure unsubsidized jobs and housing.\n\n Supportive Social Services and Education.  Veterans benefit from all levels of service of the Mission, including social services; classes in GED preparation, Basic Adult Education, and job search skills; transitional housing for working veterans who cannot afford their own rent; and rehabilitation from drugs, alcohol and other addictions.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','941516382466411,929094559121639,911225335803318,637158405241810,970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'625195015492370,877243931325915,1319255723578292,1260550501779199','585594366267961',NULL,NULL,NULL),(830,1195448583131416,'Active Intake Project',NULL,1093127605400642,' The Active Intake Project (AIP) is an innovative legal services delivery program, which brings legal services directly to the neighborhoods where D.C. seniors live.\n\nThe AIP is part of AARP Legal Counsel for the Elderlys Pro Bono Project. While most of our cases require D.C. seniors to initiate contact with our office through our Legal Hotline, the Active Intake Project ensures that LCE reaches underserved, low-income seniors in the District who may be reluctant or unable to initiate contact with our office.\n\nBy holding periodic legal intake clinics in various senior centers, subsidized senior housing buildings, churches, senior fairs and other places where seniors congregate, the Active Intake Project is able to connect with underserved seniors. At each clinic, the active intake attorney and her volunteers meet individually with seniors present to complete a \"Legal Health Assessment,\" which pinpoints areas in which each participant may require legal assistance. Then after conducting a conflicts check, we schedule in-office appointments for clients whom we met in the field and require ongoing legal help. Cases requiring extended legal representation are referred to LCE\'s Pro Bono Project for referral to a volunteer attorney in the District of Columbia.\n\nThe Active Intake Project handles civil cases for eligible clients in the following areas: Medicare/Medicaid, debt collection relief, landlord/tenant matters, public benefits, consumer fraud, powers of attorney for health care and finance, and wills.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/active-intake-project.html?intcmp=AE-LCE-WWD-R1C1LL1',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,NULL,'763163886168100',NULL,NULL,NULL),(831,1199983060673417,'Outpatient Clinic Services',NULL,644694600510926,'Neighbors Consejo is a Core Service Agency (CSA) certified by the Department of Behavioral Health in the District of Columbia. Through the Program of Mental Health and our qualified licensed clinicians, we offer the services of Diagnostic/Assessment, Medication/Somatic Treatment, Individual Therapy, Individual and Group Counseling, and Community Support.','788509441386056','http://neighborsc.org/en/our-programs/outpatient-clinic-services/',NULL,NULL,'Verified','941516382466411','Call (888) 793-4357.',NULL,NULL,NULL,NULL,'1114638904926849,963948373745242,1104511203133237','779790908267690',NULL,NULL,'926785180984945',NULL,NULL,NULL),(832,1215438821283570,'Primary Medical Care',NULL,964008795352849,'Our medical staff provides primary medical care to HIV positive individuals through our Outpatient Primary Medical Care Program. Care includes:\n\nPhysical examinations\n\nLaboratory tests\n\nSubspecialty referrals\n\nPrescribing medication when necessary\n\nContinuing medical follow up','803526594539754','http://www.rapinc.org/medical.html',NULL,NULL,'Verified','941516382466411','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'664148755918958,780785826421817,915486946336080','601647045974328',NULL,NULL,NULL),(833,1216556310653957,'Outpatient Behavioral Health Clinic',NULL,802521051916688,'The Outpatient Behavioral Health Clinic (OBHC) is an interdisciplinary team that serves as the main access point for adult services, and also provides psychotherapy and low-intensity community support for individuals who are seeking assistance with addressing life stressors, managing mental health symptoms more effectively, or healing from trauma. Recognizing that clients need a diverse spectrum of support, the OBHC uses a patient-centered approach to treatment planning and program referral, and lengthens the enrollment and engagement process to better match individuals with programs, interventions, and the appropriate level of care.','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(834,1219686317955585,'Head Start',NULL,761153930697275,'To boost outcomes for children ages 3-5, we oversee thecomprehensive support given by 9 providers, ensuring that they meet the Head Start Performance Standards.\nUPO partners with Head Start programs through DCs Quality Improvement Network (QIN).The DC government chose us to become a QIN hub because we have a proven high-quality model. Our knowledge helps build the capacity of neighborhood-based center  look for the ones near you!\nOur partners range from Educare DC (which provides the entire set of resources for children) to AppleTree charter school (which provides the educational portion while UPO staff work with families to ensure their health and well-being).Parents are involved through committees and trainings so they can access community resources, healthcare, dental vans, and hearing and vision screenings.','594960886051316,999755198000719','https://www.upo.org/earlyeducation/',NULL,NULL,'Verified','789038541797078','Call to enroll and visit our website to find which of our 13 learning centers is nearest to you.',NULL,NULL,NULL,NULL,'615824389715095,665905423802380','587544010010943,940897095189363,682372519823224','1250903097874303','1274396898894043,1177145976454922,805633029474383','1304904589817191,1166860713798541',NULL,NULL,NULL),(835,1219974334671075,'Women\'s Ministry','Sister-2-Sister',1253319258586656,'The Sister-2-Sister plans events that will empower the women of Covenant Baptist UCC and the community. The ministry creates opportunities to bridge the age gap within Covenant by working to bring youth, young adults, and mature women together. The ministry\'s events are meant to educate and inform women about their health and ways to heal. Always, the women of Covenant are reaching out to and sharing their time with those in the surrounding community residing in assisted living and 24-hour care facilities. Most importantly, teaching and studying God\'s word as sisters in Christ, the ministry seeks always to learn better how to interpret God\'s word for everyday life.','861096970014349','http://www.covenantdc.org/sister-2-sister',NULL,NULL,'Verified','637158405241810',NULL,NULL,NULL,NULL,NULL,'1067100404223709',NULL,NULL,'836091364973509','1159415480551281',NULL,NULL,NULL),(836,1224357598807692,'Senior Saints',NULL,1007623446966696,'At the age of 99, Mother Wila Hudgen is an active  glowing example of Gods grace and mercy.  Our senior saints meet monthly to discuss issues and share information that impact the elderly.  They sponsor several outings during the calendar year including shopping trips and live stage performances.  ','756139435965093','http://thefirstbaptistchurchofdeanwood.org/Deanwood/Ministries.html',NULL,NULL,'Verified','637158405241810','Call or visit us during our church services.',NULL,NULL,NULL,NULL,'755149488867036',NULL,NULL,'854808174954754','1088461256923134',NULL,NULL,NULL),(837,1225292713865575,'CFLS: TRANSITIONAL HOUSING PROGRAM AT TRINITY ARMS',NULL,1205641770221060,'Offers a two year transitional housing program for homeless families. Families receive 2 years of temporary housing in an apartment unit and social services designed to help them move toward self-sufficiency. Families pay 30% of their net monthly income.','776793732904241','http://cflsdc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'967673170995278',NULL,NULL,NULL),(838,1234340144717096,'Education',NULL,1287130751059247,'Calvary\'s life skills, education, and arts program (LEAP) is designed to address gaps that may exist in the education and life skills of the women we serve.\n\nOur education programs take place each weekday afternoon and are offered on-site at Calvary. Classes typically last one hour, and women may choose two classes each day from the selection of three or four being offered. Class focus areas include financial literacy, arts & creative expression, health & wellness, and writing skills.','1315826372203677','https://www.calvaryservices.org/program/education/',NULL,NULL,'Verified','789038541797078','To access our services, you must first receive a referral from a core service agency. If they match you with our organization, you will be sent over for an intake. If you have additional questions, please call.',NULL,NULL,NULL,NULL,'1285405208459287','890039510897571',NULL,'836091364973509,877243931325915,1212718840001878','926608893625888',NULL,NULL,NULL),(839,1238464725740308,'MetroHealth Food Bank ',NULL,1200954196071495,NULL,NULL,'https://metrohealthdc.org/services/food-bank-nutrition/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1270632561621566',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(840,1251743719079225,'Citizenship Info Sessions and Workshops',NULL,1116810105858975,'CARECEN conducts activities to inform people about the process of becoming a US citizen (eligibility requirements, application steps, timeline and more), screen them for eligibility, and assist those eligible with filing their Form N-400 Application for Naturalization to the U.S. Citizenship and Immigration Services. Please call us to find out about upcoming info sessions.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(841,1249532731729968,'Drop-in Center',NULL,1306699628219808,'If you are a young person in crisis, and need to speak to someone please dial the  24 Hour Hotline 202-547-7777\n\nIf need more information about our programs or would like to speak to someone in our administrative office dial 202 675-9340 \n\nAt the SBY Drop-In Center, harm reduction plans will be a first step, followed by comprehensive service plans. The Drop-In Center is able to access such services as crisis intervention, conflict resolution, counseling services, recreational and cultural activities, school re-engagement, health education, access to showers, toiletries, school supplies, food resources and more!','870889793389860','https://www.sashabruce.org/programs/safehomes/drop-in-center/',NULL,'plieber@sashabruce.org','Verified','878986697513222,929094559121639','Drop in for services during opening hours. You can also call or email for more information.',NULL,NULL,NULL,NULL,'1173443518827100','1143293406823524',NULL,'877243931325915,883345659611536','1348528510348782',NULL,NULL,NULL),(842,1259349665237657,'Primary Care',NULL,840733417398800,'Marys Center is committed to your overall health and well-being. From routine checkups to more serious ailments, our goal is to provide you high-quality, compassionate care in a convenient and comfortable setting.  \n\nWe offer adults and seniors routine primary and preventive care including: \nAnnual physicals and check ups  \nHealthy lifestyle assessments, such as nutrition assessments \nHealth screenings for conditions like diabetes, high blood pressure, and sexually transmitted disease. Cancer screenings available based on your personal risk. \nImmunizations, like your annual flu shot and many of the vaccinations recommended prior to international travel  \nReferrals to specialists when needed \nSick visits for when you dont feel well \nTreatment and management of acute and chronic conditions, such as diabetes, high blood pressure, obesity, asthma, and HIV \nSenior-focused care and disease prevention classes available to DC residents over 60 years old. Visit our senior wellness centers for more information.  \nWe also offer the following convenient, on-site services and resources: \nFamily medicinewe can see your whole family \nGroup health education sessions available for diabetes and high blood pressure  \nLaboratories for diagnostic testing \nNutrition and healthy lifestyle programs  \nOutpatient therapy and psychiatric services \nPharmacy with free delivery ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/adults-and-seniors/primary-care/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,'1263089203668614,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(843,1266877916484133,'Advocacy and Referrals','Labor of Love Human Service Center',877366768823409,'We partner with  other agencies to refer clients who may be best served by another organization.  We advocate on behalf of clients who may not be able to effectively state their case for additional support or services. We also assist persons with applying for SNAP (food stamp) benefits. Please click here for a resource list for Maryland and the District of Columbia.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','917725171609009,637158405241810','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(844,1273431636145481,'Health Access',NULL,682552065545256,'NVFS connects children and adults with free or reduced-cost medical and dental care, as well as prescription medications. This helps families and individuals maintain good health, avoid more serious and costly health issues, and focus on higher-level needs.','764854375292129',NULL,NULL,NULL,'Verified','941516382466411','Call to make an appointment.',NULL,NULL,NULL,NULL,'736909404940832,964860483808020',NULL,'998959625812107',NULL,'1341470966230086',NULL,NULL,NULL),(845,1209187247938710,'Education',NULL,612828763371641,'Offers age-based education services, split into Infant Classroom, Toddler/Two Classroom, Preschool Classroom, and Kingergarten Prep curriculums.','836904778271068,621638073150979,1120989994777643,1261460579474983','https://www.mazique.org/services/',NULL,NULL,'Verified','789038541797078','Call for more information.',NULL,NULL,NULL,NULL,'1200602057472122','888042423183025',NULL,'1256281229501064','626820886744559,882267988490168,920259856619905,913507292300030',NULL,NULL,NULL),(846,1209642667021134,'The Neediest Kid Program ',NULL,876151548923517,NULL,NULL,'https://www.nccf-cares.org/neediest-kids/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(847,1216690927743518,'Vocational Training',NULL,1140996665222837,'CASA partners with local community colleges such as Prince Georges Community College and Montgomery College to offer a range of vocational training courses.  Current topics include: electrical, building maintenance, drywall installation and painting, computer repair, cabinetry, HVAC installation and repair, blueprint reading, power tool usage, sewing and dress-making, child development, security, solar paneling, and hospitality.\n\nVocational training graduates receive industry-recognized certification from the community college and CASA, and CASA conducts follow-up to track improvement in employment status or income.','1091435530922324','https://wearecasa.org/programs/vocational-training/',NULL,'jnino@wearecasa.org','Verified','970915508638448','For more information about upcoming courses and to apply contact:\n\nJacinta Nino jnino@wearecasa.org or  240.491.5775/301.356.03278',NULL,NULL,NULL,NULL,'1184988992731200,1279959054833190,611448477360093','736089112142715','798494739947118',NULL,'836261919910340',NULL,NULL,NULL),(848,1229834582759480,'Senior Services',NULL,597291118069880,'Our services currently include the following:\n\n monthly grocery deliveries\n weekly farmers market produce deliveries in the summer and fall\n shopping transportation\n friendly visits\n Thanksgiving food basket deliveries\n holiday gift deliveries and visits\n emergency food deliveries\n emergency cleaning\n advocacy w/ agencies and landlords','903036719647021','https://www.wearefamilydc.org/what-we-do/services/',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'585670788788642',NULL,NULL,'854808174954754','962322435473993',NULL,NULL,NULL),(849,1224237784751973,'Early Childhood Education',NULL,1279230501938511,'Marthas Table offers a nationally accredited early childhood education program for students 6 weeks to 3 years of age. The full-day program runs year-round at two of our locations The Commons (Southeast D.C.) and The Maycroft (Northwest D.C.). Our teachers focus on whole child development (physical, cognitive, and social-emotional development) to ensure children are on track and ready to learn in Pre-K and beyond.','947434898715713,1262159504249540','https://marthastable.org/education-programs/',NULL,'educationprograms@marthastable.org','Verified','789038541797078','Our education program has an open, non-discriminatory enrollment policy. For information about enrollment in our early childhood education program, please contact educationprograms@marthastable.org.\n\nApplications for our early childhood education program are accepted on a rolling basis at both of our locations. Ready to begin the online enrollment application?\n\nApplications can also be submitted in person at either location or done online. A comprehensive list of documents and steps are available online.',NULL,NULL,NULL,NULL,'1235881686916009','1305220417627664,1296414037325068',NULL,'1153122749802852','1273798320035626,873144110718631',NULL,NULL,NULL),(850,1229484402696374,'Employment Program',NULL,801110030219864,'In some cases homelessness may be temporary, while in others it is a chronic challenge. Whatever the reason, homelessness cannot be solved through the provision of meals and supplies alone.\n\nWe work to uncover the reasons why an individual has become destabilized and provide the necessary training, education, and ongoing support needed to regain their independence. For that reason, we offer:\n\n One-on-one case management and employment support\n Workshops in foundational skills and job readiness\n Resume writing and job search support\n 23 weeks of intensive employment training\n\nFor individuals who need more support in finding employment, Thrive DC provides two case managers that will tailor their approach to an individuals need. Topics covered in case management can include:\n\nEmployment Goals and Expectations\nEffective Resume and Cover Letter Writing\nInterviewing Skills\nWorkplace Communication\nJob Searching Techniques\nFinancial Planning and Money Management\nMock Interviews','1220597047470925','https://www.thrivedc.org/programs/employment/',NULL,NULL,'Verified','970915508638448','Call or email for more information. You can also drop in during the following hours (with limitations based on gender identity)\nMonday  Friday\n8:30 AM  2:00 PM (Men & Women)\n2:00 PM  4:00 PM (Women Only)',NULL,NULL,NULL,NULL,'665113076769939','818646560557978','577518788649182,1204985979154628','877243931325915','962322435473993',NULL,NULL,NULL),(851,1225675874740777,'Behavioral Health Services',NULL,864654455488543,'Individual Counseling\nFamily Counseling and Training\nCommunity Support\nCrisis Intervention\nDiagnostic Assessments\nPsychological Evaluation\nBehavioral Aid\nCommunity Transition\nMedication Management\nResource Coordinator','1205522007643431','http://innercityfamilyservices.com/',NULL,NULL,NULL,'941516382466411','Call for services or submit a referral on website.',NULL,NULL,NULL,NULL,'891305332730659,1153100898791474',NULL,NULL,NULL,'777262664227450',NULL,NULL,NULL),(852,1225863118799944,'Foreclosure Prevention Counseling',NULL,1116810105858975,'CARECEN helps homeowners to prevent losing their homes to foreclosure. Housing counselors assess mortgage debt, map recovery plans, help clients improve their financial management skills, negotiate with servicers, and counsel clients on their options. Counselors also help homeowners to become aware with the warning signs of loan modification fraud and help them take appropriate action if they have already been victims of scams.','547920365968268','http://carecendc.org/direct-services/housing-services/',NULL,'info@carecendc.org','Verified','917725171609009,929094559121639','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1295679372454826','842193303927915',NULL,NULL,NULL),(853,1241641820248132,'Legal Services Know Your Rights',NULL,1140996665222837,'CASA provides a variety of legal services for low-income immigrants in housing, employment and immigration matters. CASA provides its members free legal consults on these matters during weekly intake sessions. Assistance in defending the legal rights of our members is accomplished through mass education sessions, advocacy, individual representation and impact litigation.\n\nIn addition, CASA provides assistance in applying for a variety of immigration benefits before the US Citizenship and Immigration Service (USCIS) including the Deferred Action for Childhood Arrivals program (DACA) where CASA has established itself as the number one non-profit provider in Maryland.','1091435530922324','https://wearecasa.org/programs/legal/',NULL,NULL,'Verified','917725171609009','Show up early as space is limited',NULL,NULL,NULL,NULL,'1184988992731200,1279959054833190','1184678318205498',NULL,'1182980053228188,1340162113833071','836261919910340',NULL,NULL,NULL),(854,1243674394135496,'Case Management Services',NULL,1093127605400642,'The HIV/AIDS continuum of care is a complex system of medical and social service agencies that can be challenging for people living with HIV to navigate. Medical Case managers (MCMs) play a vital role in helping clients navigate and access HIV/AIDS care. MCMs assist clients in addressing barriers while providing services that are flexible to the clients current medical and social needs. Medical case management reflects a philosophy that affirms a clients right to privacy, confidentiality, respect, nondiscrimination, dignity and self-determination.\n\nMCMs provide ongoing case management to individuals, dual diagnosed and LGBT populations that have been diagnosed with HIV/ AIDS, which consist of indigent, uninsured, and under-insured clients who have additional co-morbidities such as persistent severe mental illness and substance abuse. MCMs provide in-depth counseling, crisis intervention, education, translation and ongoing support services and expertise through comprehensive assessment, planning, referral, and overall evaluation of individual patient needs.\n\nAndromeda has bilingual staff (English-Spanish) MCMs with vast experience working and understanding the various needs and issues in different communities. MCMs at Andromeda also provide ongoing advocacy and transportation to their clients and accompany them as needed to medical appointments, social services, court, hospitals, Social Security, and Immigration amongst other agencies. In addition, MCMs assist clients in applying to different medical insurances and medication assistance programs, city housing, and emergency food, hygiene, and clothing programs. MCMs promote continuity of care through the integration of case management, utilization and assessment of the clients acuity levels and psycho-socials, service plans, and by referring and linking clients to services out in the community.\n','841307455613093','http://andromedahealth.org/our-services/case-management-services/',NULL,NULL,'Verified','637158405241810','If you want to be enrolled you can call Andromedas Reception line at (202) 292-4707 Ext. 100 and ask to transfer you to any of the Medical Case Managers. The only requirement is that you reside in the Washington D.C area and that your income is at 500% or less according to the poverty guidelines.',NULL,NULL,NULL,NULL,'860598871725625','778728885186196,930574528621838',NULL,'780785826421817','1224638786118966',NULL,NULL,NULL),(855,1249176990484846,'LGBT+ Health',NULL,840733417398800,'All clients are welcome here. Marys Center is fully committed to providing accessible, convenient, and culturally competent care.  Our role is to support you on your health journey regardless of race, color, religion, national origin, disability, age, sex,sexual orientation, or gender identity or expression. Our priority is to ensure you feel safe andcomfortable talking about your health, your thoughts, and about any unique challenges you may face.   \n\nA number of our providers specialize in the physical, emotional, and sexual health of the LBGT+ population.  We know visiting the doctor can be uncomfortable, so its our goal to create an environment where you feel respected and heard.  We want you to feel you can talk about your health concerns, no matter what they are.   \n\nWhen you visit Marys Center, you can be confident youll receive comprehensive primary care from a team that is familiar and experienced with diverse needs.  This includes culturally competent services such as: \n\nAnnual physicals\nDental Care\nBehavioral Health Care\nPreventive Care\nSick Visits\nIn addition, we can help you protect your sexual health through free HIV testing and prevention methods available at our health centers. Testing for sexually transmitted infections (STI) is available through any medical visit, and by request for walk-in services with our sexual health team. \n\nTransgender Health Needs\nIf you identify as transgender or gender non-conforming and are seeking care, Marys Center can serve as your home base during the process. Our medical team can:\n\nTalk with you about your gender treatment goals, to come up with a treatment plan that is right for you. \nPrescribe and manage hormone therapy;  \nProvide surgical referral letters when needed;\nHelp with insurance coverage eligibility\nConnect you with mental health providers here at Marys Center;  \nAccess to supportive mental health care is important. Marys Center has behavioral health providers who can assist children, adolescents, and adults who identify as transgender or gender non-conforming with any emotional, social, or trauma concerns they may have experienced.  ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/lgbtqia-healthcare/',NULL,NULL,NULL,'941516382466411','To reach the Sexual Health Resource Hotline, call (202) 851-3971  \nTo reach our HIV Care Navigation team, email BeSafeBeSure@maryscenter.org \nTo make an appointment, call (844) 796-2797 anytime \n\nPlease reach out if you need assistance with applying for Ryan White coverage or to learn more about AIDS Drug Assistance Program (ADAP) and various other discount programs for HIV medications.   \n\nWe accept most insurance plans including Medicaid and Medicare. If you dont have health insurance, well help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'609237693650331,1301804131597006',NULL,NULL,'1186681173947755,1200832408072169','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(856,1252702593988888,'Million Meal Project',NULL,584105465886479,'This program is in partnership with the Department of Social Service to make sure our community has fresh fruit and  produce in the community for good health.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','832990803111047','Call to learn more.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(857,1255893170172420,'Pregnancy Care and Groups',NULL,1195870505334629,'We want all of our moms and babies to have the best outcome possible  so starting in the 6th month of pregnancy (around 26 weeks), pregnant moms join the CenteringPregnancy group. \n\nOur moms benefit from:\n\nInteractive learning and fun discussion in a relaxed setting with other moms due at the same time as you\nEducation about labor, breastfeeding and basic newborn care\nGames, food and chances to win prizes or receive gifts for your baby\nContinue to have one-on-one checkups with the midwife during group\nPlus, there is no wait time for your appointment!','1090162375763715,1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411,637158405241810','Centering is currently offered at two of our locations: the Conway Health and Resource Center and the Family Health and Birth Center. \n\nWant to learn more about how to join our CenteringPregnancy Group? Call the health center nearest to you for more information.',NULL,NULL,NULL,NULL,'1279880844015186,763524779006557','849762282889895,856292695140924',NULL,'1182104828841650','1016957397804274,920259856619905',NULL,NULL,NULL),(858,1267727721478414,'Dental Services',NULL,1195870505334629,'We offer affordable, comfortable, and convenient dental services for patients of all ages to help you keep smiling.\n\nWe provide the following dental services at our Conway Health and Resource Center in Ward 8.\n\nDental services for you and your family\nComprehensive oral exams \nDental x-rays and cleanings\nFillings\nSealants\nDentures\nExtractions\nRoot canal treatment\nCrowns\nWe accept many health ins','1090162375763715,1146632771763115','https://www.communityofhopedc.org/healthcare/dental-services',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'846201766185688,665495770462606','1271715775560973,595037108371835,1270512922612605,1168145184682128',NULL,NULL,'1016957397804274,771726091253980',NULL,NULL,NULL),(859,1270590689586287,'Mental Health Access Helpline',NULL,1172521016075482,'The Access HelpLine at 1(888)7WE-HELP or 1-888-793-4357 is the easiest way to get connected to services provided by the Department of Behavioral Health and its certified behavioral health care providers. This 24-hour, seven-day-a-week telephone line is staffed by behavioral health professionals who can refer a caller to immediate help or ongoing care. The Access Helpline can activate mobile crisis teams to respond to adults and children who are experiencing a psychiatric or emotional crisis and are unable or unwilling to travel to receive behavioral health services. \n\nCall the Access Helpline to:\n\nGet emergency psychiatric care\nHelp with problem solving\nDetermine whether to seek ongoing mental health services or other types of services\nFind out what services are available\nYoung people can call the Access Helpline for help dealing with the drama of family, death, school, drugs, gangs and violence. We can help you sort out and manage feelings of hopelessness, anger, grief, stress or whatever is troubling you. ','1220839720071176','https://dbh.dc.gov/service/access-helpline',NULL,NULL,NULL,'878986697513222,941516382466411,637158405241810',NULL,NULL,NULL,NULL,NULL,'883515995625764,871982556461569','1234973155607630',NULL,NULL,'677760270951950',NULL,NULL,NULL),(860,1280256361717353,'Early Childhood Behavioral Health',NULL,840733417398800,'Marys Center is here to help you find solutions for the behavioral health challenges your child may be facing. We actively involve you in their treatment and teach you to tune into your childs needs, interpret their language, and help strengthen their inner resilience. We offer a variety of proven therapeutic approaches to help your child on their journey towards mental wellbeing and will work alongside you to find the best solution. Our approaches include:  \n\nParent-Child Interaction Therapy (PCIT)\nChild-Parent Psychotherapy (CPP)\nTheraplay\nWhen individual therapy is recommended for your child, we use the following approaches:  \nExpression Therapy\nChild-Centered Play Therapy (CCPT)\nSand Tray Therapy\nPlayful Cognitive Behavioral Therapy (Playful CBT)','1282458965799792,964869638930274','https://www.maryscenter.org/behavioral-health/children-and-teens/early-childhood-behavioral-health/',NULL,NULL,NULL,'941516382466411','Marys Center is ready to partner with you on your health journey. If you are interested in the above services, please complete a referral form. Once you submit your referral form, we will contact you about making an appointment.  \n\nFor additional questions about where services are provided, please use the following numbers:  \n\nDCBehavioral Health Direct Line (202) 851-3671  \nMaryland Behavioral Health Direct Line (240) 839-3401',NULL,NULL,NULL,NULL,'1345728742501995','1134877289644712,827996522503929',NULL,'1263089203668614,854808174954754','903265014608550,962742212670581',NULL,NULL,NULL),(861,1239721554358448,'Family Economic Security',NULL,1138775501034023,'Children and youth are particularly vulnerable when their families lack the income, assets, and access to consistently meet basic needs. These risks include low birth weight, poor health due to environmental factors, episodic or chronic homelessness, and poor education outcomes. DC Action for Children supports strengthening access to affordable housing, quality education and family safety net programs.','1147823510376197','https://dcactionforchildren.org/our-priorities/family-economic-security',NULL,NULL,NULL,'917725171609009','Call for information on our current projects.\n',NULL,NULL,NULL,NULL,'1139434629285592','1098590993104545',NULL,NULL,'792709813022086',NULL,NULL,NULL),(862,1235636405349063,'Health Promotion Program',NULL,887352348953420,'The Health Promotion program partners directly with the Latino community to develop culturally appropriate and peer-based educational methods that promote health literacy, wellness, lifestyle, and environmental changes. Through educational sessions, group interventions, community events, and health promotion campaigns led by trained Peer Health Promoters (promotores de salud), we aim to reduce the incidence of preventable chronic diseases and health disparities in the Latino community. Collaborating directly with our primary care services, the Health Promotion Program enhances La Clnicas patient access to chronic disease prevention and self-management education and support.','1170113060894673,868710877316469','https://lcdp.org/_en/programs-community-health-action.html',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359,887062299451299','1202170493625306,686273477676422,1136144186376874',NULL,'1295679372454826','1080723808883365,1214063268443455',NULL,NULL,NULL),(863,1241974546153013,'Substance Use Treatment Program',NULL,887352348953420,'La Clncas Volviendo a Vivir program is the only bilingual substance use program serving the Latino community in the Washington, D.C. Metropolitan Area. This is an intensive outpatient substance use treatment and HIV counseling and testing services program providing individual and group counseling, group support, mental health therapy, case management, and HIV testing and education. La Clnica is a Level I and Level 2 Recovery Support Services (RSS) provider through the DC Department of Behavior Health.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(864,1243832082519507,'Homeowner Support',NULL,574964812525513,'Offers support to homeowners around a variety of issues. Support is provided around foreclosure, Home Equity Conversion Mortgage (HECM) or Reverse Mortgage, home rehabilitation, and training for condo and co-op managers. ','947853021041099','http://housingetc.org/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call to schedule an appointment or find out when workshops are taking place.',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,NULL,'1138176448388213',NULL,NULL,NULL),(865,1248931277100420,'Healthy Meals & Basic Needs',NULL,1186080684764999,'The Womens Day Center is often the first entry point for women. Open 365 days a year, the Center offers safe respite from the streets, meets a womans basic needs for food, clothing, laundry and showers, provides access to resources for housing, health, legal and other needs, and offers a confidential crisis and case management support.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/healthy-meals-basic-needs/',NULL,NULL,'Verified','832990803111047,911225335803318,917725171609009','Welcome Sessions:  Women seeking services are encouraged to attend one of our Welcome Sessions, offered every Monday-Friday (with the exception of some holidays) at 9:15 am in the Day Center.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','674198790176107,779960367654816',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(866,1249659581366985,'Substance Use Disorder Treatment',NULL,1323195974089796,'TREATMENT SERVICES\nWe provide counseling services to youth ages 12-21 years old who are using alcohol and/or other drugs, engaging in high-risk behavior such as drug use and delinquent activities, and/or have parents that abuse drugs. Counseling services are based on an individualized assessment and treatment plan. During treatment, youth identify goals and learn how to achieve them. They also learn skills like problem-solving and positive communication, which will help them have a better quality of life. Youth will learn positive ways to enjoy life without alcohol and drugs. Recovery is a process that takes time, and with treatment the youth learn to make better decisions and improve their relationships with caregivers, teachers, peers, court personnel, and others.\n\nSCOPE OF SERVICES\nBilingual services (English/Spanish)\nIndividual, group and family counseling\nCrisis intervention\nCase management and referrals\nHIV/AIDS Education\nAlcohol/Drug education\nAnger management\nAcculturation\nViolence prevention\nIntroduction to AA/NA groups\nReferral to other in-house programs and/or external organizations','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/substance-use-disorder-treatment/',NULL,NULL,'Verified','941516382466411','Call or email for more information.',NULL,NULL,NULL,NULL,'665879809068779','920999838182205,1016645181977967','1328428091308050','1295679372454826','1288365969354186',NULL,NULL,NULL),(867,1280840473848403,'Sexual Health Program',NULL,887352348953420,'La Clnica provides comprehensive sexual and reproductive health services all under one roof. The Sexual Health Program implements community outreach to educate the Latino community about sexual health, HIV, and promote HIV testing services and conducts condom distribution. Sexual and reproductive health educational charlas and family planning interventions are designed and implemented with the goal of promoting positive sexuality.The program also offers HIV system navigation services, providing early support and access to quality HIV care services to HIV-positive Latinos.','868710877316469','https://lcdp.org/_en/programs-community-health-action.html',NULL,NULL,'Verification in Progress','941516382466411',NULL,NULL,NULL,NULL,NULL,'887062299451299',NULL,NULL,'1295679372454826','1214063268443455',NULL,NULL,NULL),(868,1285397708822108,'Hypothermia and Low-barrier Shelter',NULL,577764298046742,'The free shelter is available at night and during weather emergencies, 7 days a week throughout the year, 24 hours a day.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','878986697513222,929094559121639','Call or walk in. Exact location given out at the main office or over the phone.',NULL,NULL,NULL,NULL,'937785373035309','863395801700959','599621071767378','1200832408072169,605403471620978','603292299584681',NULL,NULL,NULL),(869,1234003496832541,'Young Parents',NULL,1323195974089796,'The Young Parents Program (YPP) at LAYC is a fun, engaging way for young people to build parenting skills. Current and expecting mothers and fathers attend interactive workshops where they work closely with a Parent Educator as well as learn from their peers in either the Prenatal or Parenting workshop series.\n\nAdditionally, all participants in YPP work individually with a case manager to set personal and family goals, and work toward achieving them. Participants also have the opportunity to attend special events such as family get togethers, holiday celebrations, field trips, and a graduation celebration when they complete the program.\n\nPRENATAL SERIES\nIn the Prenatal Series, expecting young parents learn about their new roles as mothers and fathers and begin to establish positive connections with their arriving babies. Class topics include: fetal development, prenatal nutrition, breastfeeding, labor and delivery, relaxation, preparing for the baby, basic infant care, sleeping and soothing techniques for newborns, and more!\n\nPARENTING SERIES\nIn the Parenting Series, participants explore parenting styles, reflect on personal experiences, think critically about what it means to be a parent, and practice modeling positive behaviors for their children. YPP uses the Parenting Journey curriculum, a strengths-based program designed to help parents learn about themselves and their relationships with others while learning to navigate the resources they need to parent effectively.\n\nPARTICIPANT BENEFITS:\nClasses offered in English & Spanish\nStipends\nHealthy food during workshops\nChild care provided during workshops\nTransportation assistance available\nMentorship\nFamily celebrations\nELIGIBILITY:\nMothers and fathers between the ages of 11 to 24\nAble to attend all program workshops\nResident of Washington D.C.','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/young-parents/',NULL,NULL,'Verified','637158405241810,789038541797078','Call or email for more information.',NULL,NULL,NULL,NULL,'1072627992557883,1226355078973829','920999838182205,1016645181977967','888608942220002,991150474887656','1295679372454826,915486946336080,597495441321591','1288365969354186',NULL,NULL,NULL),(870,1244747959773878,'Neighborhood Tutoring Program',NULL,601937487816671,'This program helps students in grades 1-12 achieve grade-level competency in reading and math through one-on-one attention and a structured, step-by-step curriculum. Frequent tests help ensure that a student has mastered the material in one lesson before moving on to the next. When students are guided at their own pace and engaged through fun and interesting activities, they gain academic skills and confidence in their ability to learn.','1140386841515505','https://floc.org/neighborhood-tutoring-program/',NULL,NULL,'Verified','789038541797078','To enroll a child in the Neighborhood Tutoring Program, please file the appropriate form on our website\'s student enrollment page.',NULL,NULL,NULL,NULL,'796654497660631,907838847178020','1058805278682671,601024770885061',NULL,'1168700157058167','766532349524044',NULL,NULL,NULL),(871,1242360569614402,'MARTHA\'S TABLE/ SCARED HEART CHURCH: FOOD AND NUTRITION PROGRAM',NULL,1279230501938511,'Provides daily meals to homeless and low-income children, families, and individuals through McKenna\'s Wagon, a mobile soup kitchen; daily meals and snacks to low-income toddlers, children and teenagers (ages 1-17) through a Children\'s and Summer program',NULL,'http://marthastable.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(872,1249294483746869,'Food Pantry',NULL,1187372282686349,'The Father McKenna Center operates a daily Food Pantry for low-income families, particularly seniors, who are residents of Ward 6. As our city, and particularly our Ward, has redeveloped many of our long-term residents are experiencing food insecurity. The Center has been meeting these needs since we were founded in 1983, and there is more demand than ever before.\n\nThe Food Pantry is open each weekday. Families seeking food assistance check-in with volunteers and have a shopping experience allowing them to select the products they want to meet their specific familys needs. We find this approach to be rewarding  supporting healthy meals, the dignity of choice, and reducing waste.\n\nFamilies may visit the Food Pantry as often as every two weeks. We provide food that supports more than 45,000 meals annually. The Food Pantry also builds community  the same families will regularly shop on the same schedule, building relationships with each other and the volunteers.\n\nWe believe that reducing a familys anxiety about putting food on the table, allows space for the grace of sharing, conversation, and care around that table. In the words of our inspiration, Fr. Horace McKenna, You cannot speak to a person about his or her soul, when they have no food.\n\nThe Father McKenna Center Food Pantry provides an atypical pantry experience by offering both non-perishable and fresh goods. We stock the Pantry with food from the Capital Area Food Bank, private and group donations, and purchases made possible by our donors.','1209121324412172','https://fathermckennacenter.org/what-we-do/food-pantry/',NULL,'info@fathermckennacenter.org','Verified','832990803111047','Families can visit as often as every two weeks.',NULL,NULL,NULL,NULL,'1123859846194392','1107831955306053',NULL,NULL,'645829762063748',NULL,NULL,NULL),(873,1252929483881761,'The Road to College',NULL,1228099889682852,'Assisting all individuals interested in attending post secondary institutions and colleges and universities to gain admission into their institution of choice.','904892331647550','http://cityofpraisechurch.com/community/',NULL,NULL,'Verified','789038541797078','This is offered directly after church service every fourth Sunday of the month.',NULL,NULL,NULL,NULL,'600625677788643','918886934091220',NULL,NULL,'818242711886355',NULL,NULL,NULL),(874,1260294251529919,'UNIDOSUS: ADVOCACY AND EMPOWERMENT',NULL,1235926278832683,'UnidosUS, formerly known as, National Council of La Raza, seeks to ensure Hispanic American representation at all levels of government, to promote equitable participation of Latinos in public policy debates and programs, and to protect Hispanic civil rights.','936750287730760','http://www.unidosus.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'671899479947026',NULL,NULL,NULL),(875,1262392779353939,'Psychiatry and Behavioral Sciences',NULL,1061724977026001,'Psychiatry and Behavioral Sciences at Childrens National Health System offers assessment, diagnosis and care for children and teens with behavioral, emotional and developmental disorders.\n\nPsychiatric conditions we treat include:\n\nAttention deficit hyperactivity disorder (ADHD)\nAutism spectrum disorders (ASD)\nBipolar disorder/manic depression\nDysthymic disorder\nEating disorders\nGeneralized anxiety disorder\nFeeding disorders\nLearning disorders\nMajor depression\nObsessive-compulsive disorder\nPanic disorder\nPost-traumatic stress disorder (PTSD)\nSchizophrenia\nSeparation anxiety disorder\nSocial phobia\nServices We Provide\nEach patients assessment is comprehensive and specific to the child or teen. To begin the process of emotional healing, our care team may use a variety of therapies in your childs treatment plan, such as:\n\nBehavior modification\nFamily therapy\nGroup therapy\nPlay therapy\nPsychopharmacology (the use of medications to treat mental disorders)\nOur outpatient service evaluates approximately 1,000 new patients annually, with more than 17,000 follow-up visits each year.\n\nThe inpatient unit includes a 12-bed child unit and a 14-bed adolescent unit. Both units provide a safe setting where our team provides crisis intervention and stabilization.\n\nWe also offer psychiatry services via telemedicine to help patients and families in farther communities access our expert care.','1282604214927911,856126341619748,979447652621070','https://childrensnational.org/departments/psychiatry-and-behavioral-sciences',NULL,NULL,NULL,'941516382466411',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'928813128095347,787442654546775,1067302604787333',NULL,NULL,NULL),(876,1264097357440589,'IONA SENIOR SERVICES (WARD 3): ADULT DAY HEALTH CARE',NULL,880881169888319,'Provides a safe and caring environment for older residents of the D.C. Metropolitan area who may be suffering from Alzheimer\'s Disease, other types of dementia, stroke or physical impairment.','666148222775634','http://iona.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1320233927043765',NULL,NULL,NULL),(877,1272430859437969,'Housing Services',NULL,909401719398962,'Provides social services and referrals to homeless women.','1215517692128370','http://nebw.org/',NULL,NULL,'Verification in Progress','929094559121639',NULL,NULL,NULL,NULL,NULL,'815707427459010',NULL,NULL,NULL,'1071232777595227',NULL,NULL,NULL),(878,1282251456865145,'Unity at Federal City (CCNV/Ward 6) ',NULL,1043772486617212,'Healthcare for homeless','897004671586116',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'859934312238230',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(879,1281204672852064,'Individual, Group, and Family Therapy',NULL,883186000200856,'Counseling for individuals, groups and families to resolve symptoms of behavioral, emotional, social, and cognitive disorders','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,'599621071767378,645838145603264','','646846673243288',NULL,NULL,NULL),(880,1287637880598333,'D.C. DEPARTMENT ON DISABILITY SERVICES (DDS): TRANSPORTATION SERVICES',NULL,886723337790722,'Provides transportation services for any customer registered with MRDDA.','665576595246792','http://dds.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'803873216349399',NULL,NULL,NULL),(881,1287178898963916,'Food Assistance',NULL,999334342940796,'Provides free food to those in need.','1266225890742478','https://nourishnow.org/get-food/',NULL,NULL,'Verified','832990803111047','Referrals from social service agencies are preferred, but not required.\n\nNo walk-in or same-day appointments are available at this time. Plan and schedule your pick-up 3-7 business days ahead to request your choice of appointment. All appointments must be scheduled with a Nourish Now employee over the phone or in person. All client appointments and food pickups are handled Monday through Friday.\n\nIf taking public transportation, please bring reusable grocery bags or a cart.\n\nPlease bring a Photo ID.',NULL,NULL,NULL,NULL,'780586392014879','556775175698025,620495825705625',NULL,'565669778208779','1241946310153308',NULL,NULL,NULL),(882,1298139501002270,'Rapid Emotional Support Team','REST',809193297555798,'Rapid Emotional Support Team, REST, was developed due to an increased need for crisis support as a result of growing levels of awareness and organized response to issues related to sexual assault. REST provides onsite crisis support to individuals impacted by sexual assault, including personal and secondary trauma. By placing trained crisis support workers on site, REST can provide emotional support to individuals working towards eliminating sexual assault. REST crisis support workers are able to aid individuals with stabilization, distress reduction and provide referrals for ongoing support','728145736382163','http://dcrcc.org/rapid-emotional-support-team/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810,878986697513222','Call for help.',NULL,NULL,NULL,NULL,'841680442767650',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(883,1292756176570822,'D.C. Schedule H Property Tax Credit',NULL,1093127605400642,'Legal Counsel for the Elderly assists low-income seniors who do not need to file a complete tax return with filing for the D.C. Schedule H property tax credit.\n\nEligibility for the Property Tax Credit\nLow-income D.C. residents may qualify for up to $1000 for property taxes or rent paid by filing the D.C. Schedule H tax form. The D.C. Office of Tax Revenue determines eligibility for the credit:\n\nD.C. resident from January 1st to December 31st\nRent or own and live in home or apartment\nIncome below $40,000 per year\nIncome below $60,000 if over 70 years old\nSome rental properties do not qualify\n\nOur Services\nWe assist clients who do not need to file a complete tax return. We screen clients to see whether they are likely to qualify. If so, we meet with clients, in our office or at pro bono clinics, to review the Schedule H tax form and the documentation needed. We assist with submitting the form to the Office of Tax Revenue. If the credit is not received within three months, we assist with calling the Office of Tax Revenue to learn the reason for the denial.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/schedule-h-tax-credit.html?intcmp=AE-LCE-WWD-R1C2LL1',NULL,NULL,'Verified','917725171609009,1077790582995406','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,'868012483124236,854808174954754','763163886168100',NULL,NULL,NULL),(884,1298309949522497,'Veterans First',NULL,791950857737387,'Friendship Places Veterans First program is a leading provider of rapid rehousing and homeless prevention services for veterans and their families in the Washington D.C. metropolitan area. The program follows the results proven Housing First model, which removes all barriers to housing such as unemployment, histories of incarceration, sobriety and mental health care, and instead prioritizes providing permanent housing.\n\nThe Veterans First staff provide case management services aimed at housing stability. These services may include assistance with locating and moving into a permanent housing unit, connecting with benefits, employment assistance, connecting with medical and mental health care, budgeting, and other needs identified during intake.','931886810745529','https://friendshipplace.org/programs-outreach/housing/',NULL,'vfscreen@friendshipplace.org','Verified','929094559121639','Eligibility\nTo participate in the Veterans First program you must be a single Veteran or a household that includes a Veteran who has served on active duty in the military, naval, or air service* and:\n\nNot have been given a dishonorable discharge\nHave an income below the 50% median income for their area\nBe homeless or at risk of becoming homeless\n*National Guard and Reservists who were activated by Presidential Order to serve in another State or Country (beyond basic training) and received a DD-214 with an other than dishonorable discharge are also eligible for this program\n\nWhere We Serve?\nThe Veterans First program serves Washington D.C. and the counties of Prince George (MD), Montgomery (MD), Frederick (MD), Fairfax (VA), Loudoun (VA), Prince William (VA), Arlington (VA), as well as the City of Alexandria (VA).\n\nNeed Help?\nTo become a participant in the Veterans First program, call our intake line at 202.658.9599, or email vfscreen@friendshipplace.org.\n\nTuesday is by appointment only.',NULL,NULL,NULL,NULL,'956844133947886','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'1244888069012632,1260550501779199','1152494666421051',NULL,NULL,NULL),(885,1239703812521018,'Fitness & Exercise',NULL,900455754248217,'Fitness and exercise program.','984058750613797','https://www.asburyumcdc.org/',NULL,NULL,'Verified','941516382466411','Call to learn more.',NULL,NULL,NULL,NULL,'1224416978291385,931894948994087',NULL,NULL,NULL,'944084611081362',NULL,NULL,NULL),(886,1244526695505882,'Partnership to Independence',NULL,692112692154000,'The Partnership to Independence (P2I) is a new initiative based on 17 years of working with individuals and families with one goal in mind  helping them to achieve sustained self-sufficiency. It integrates the lessons we have learned and the best of our services to date in the areas of workforce development, health & wellness, and wraparound support.\n\nP2I is an intensive five-year commitment for families living below the poverty line, and we will launch the initial cohort in the fall of 2018. This cohort will include up to 100 families, each of which will be matched with Advocates (experienced Wider Circle staff members) and individual volunteers, who together will provide comprehensive, consistent, and long-term support.\n\nThe program is a part of A Wider Circles drive toward both a more outcomes-based approach and more client-centered programming. While our services continue to be in great demand and produce significant change for individuals and families, we, like many organizations across the country, yearn for more progress in supporting families efforts to rise out of poverty. We believe this program will contribute significantly to that end.\n\nParticipants will receive individualized planning support and a wide range of skill-building and educational opportunities. Select services include:\n\nCollaborative goal setting\nWorkforce development training and coaching to assist with obtaining and retaining employment\nHealth and wellness assessments and classes covering physical, mental, emotional, and other dimensions of well-being, as well as twice yearly home visits\nFinancial management and skill building\nProvision of essential items to ensure that basic needs are met\nReferrals to a wide range of partners and specialists','610894518918920','http://awidercircle.org/partnership-to-independence/',NULL,NULL,'Verified','637158405241810,970915508638448,911225335803318,832990803111047,941516382466411,1077790582995406','Cohorts only launch once a year. Please call if you are interested in joining.',NULL,NULL,NULL,NULL,'877523491860439','646160018921336,1236548249618145',NULL,NULL,'1154169690232586',NULL,NULL,NULL),(887,1258855549014937,'Homeowner Accessibility Services',NULL,1183850219079477,'If you are a homeowner who needs accessibility modifications built at your home for yourself or a family member, please contact us. Yachad can make accessibility renovations to the inside or outside of your home including but not limited to:\n\nHand bar installation\nGrab bar installation\nInstallation of handicap approved appliances and utilities\nRamp construction\nWe also have funding for renovations concerning disabilities such as asthma or allergies. This can include:\n\nRemoval of old, dirty carpet\nReplacement with new flooring','888398891117437','http://yachad-dc.org/accessibility.php',NULL,NULL,'Verified','929094559121639','We base our services on financial need and project scope, and work with homeowners who do not have the resources to pay for the costly renovations. Contact us for an application. We ask for proof of homeownership and current property tax records. If you are a long-term renter, we may be able to assist you if the landlord provides his permission.\n\nAfter we receive your application, Yachad staff will schedule an appointment to meet with you to determine what is appropriate for your home modification.\n\nIf you have any questions, please contact us. We would love to hear from you.',NULL,NULL,NULL,NULL,'896191474881929','1221091850952095',NULL,'1294818681778567,1009160981885425','851682919843426',NULL,NULL,NULL),(888,1263635869014242,'Family Services ',NULL,876151548923517,NULL,NULL,'https://www.nccf-cares.org/family-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(889,1265325284377461,'The Family Ministry Center (FMC) ','FMC',726173106231202,'The Family Ministry Center (FMC) is a center where people struggling with insufficient food and clothing can find help.  It is Central Union Missions hub for family services in Washington, DC.  Our large facility on Bladensburg Road houses a food bag assembly and distribution area, a free shop of donated clothing and housewares and a large meeting space.  From this location, the Mission hosts its Relief & Restoration Program, its Operation Back Pack and Operation Christmas Miracle gifts programs for children as well as monthly Seniors Fellowships in both English and Spanish.\n\nThe Relief & Restoration Program (R & R) is designed to provide a community where needy, broken families and individuals have access to free resources that provide relief from such burdens. Our goal is to restore the hurting, hungry and lost community to being better, living wiser, knowing Jesus Christ. In addition to free food and clothing, the R & R program provides pastoral counsel, encouragement and prayer, an on-site social worker to help with special circumstances, and special events throughout the year.','838780960881380','https://www.missiondc.org/what-we-do/family-programs/family-ministry-center/',NULL,NULL,'Verified','832990803111047,911225335803318','Call or walk in for help.\n\nIf you are currently in need of assistance outside of FMC operating hours, please contact the Hunger Lifeline at (202) 644-9807 (Monday-Friday 9am5pm) or visit the Food Bank Network Website or DC Food Finder Website to search for services such as food, healthcare, housing, and job training. If you are in need of furniture, contact A Wider Circle at (301) 608-3504.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(890,1292184415850124,'Classes',NULL,662579547117824,'We provide services, pregnancy support, and parenting support for at-risk DC women and families.','901362892558172','http://www.healthybabiesproject.org/classes/',NULL,'hbpprograms@gmail.com','Verified','789038541797078','Register for all classes by calling (202) 396-2809 or sending an email to hbpprograms@gmail.com. Call (202) 396-2809 for help with transportation or childcare.',NULL,NULL,NULL,NULL,'645677274573700','841350792744889',NULL,'836091364973509,1292849277583603','1244665120116979',NULL,NULL,NULL),(891,1291599466171764,'Overnight Guests',NULL,726173106231202,'Every night, guests and students are invited to join volunteers from Washington area churches, who lead a worship service and read the Bible. Whenever the Missions doors are open, counseling and clinical care is provided. Services like medical care, housing assistance and clothing are available at no cost.\n\n\nGuests can participate in Bible study and discussion groups. Men who express a sincere desire for a changed life are encouraged to enter the intensive residential Restoration & Transformation Program.\n\nEvery year, the Mission provides over 63,000 beds and bedding for those using our emergency shelter and camp through the Overnight Guest Program, Restoration &  Transformation Program and Family Programs.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/overnight-guests/',NULL,NULL,'Verified','941516382466411,929094559121639,911225335803318,637158405241810','For more information about the Overnight Guest Ministry for the homeless, please email Rev Ron L. Stanley',NULL,NULL,NULL,NULL,'842965887033119',NULL,'1043054479944359','1319255723578292','585594366267961',NULL,NULL,NULL),(892,1296433586474206,'Shelter Plus Care',NULL,761153930697275,'Not having a place to call home is even more difficult when you also suffer from mental illness, addiction, HIV/AIDS, or other debilitating conditions.\nOur Shelter Plus Care program provides case management and support services to homeless persons with chronic health issues who are also receiving housing support. We work with individuals and families who are currently getting rental assistance from DCs Community Partnership for the Prevention of Homelessness.\nWe also help homeless persons and their families with education, employment, financial management, child care, and transportation.`','594960886051316,999755198000719','https://www.upo.org/communitywellness/',NULL,NULL,'Verified','637158405241810,929094559121639','For more information, please contact Francis Monroe at 202-562-3800',NULL,NULL,NULL,NULL,'1152713868211992','587544010010943,940897095189363,682372519823224','1115797516280285','684980356183378','1304904589817191,1166860713798541',NULL,NULL,NULL),(893,1304206816813795,'Medical and Community Care',NULL,548126332764833,NULL,'','https://www.whitman-walker.org/medical-community-care',NULL,'appointments@whitman-walker.org',NULL,'',NULL,NULL,NULL,NULL,NULL,'923447387409370',NULL,'645838145603264,756653322156829,773180771408189','',NULL,NULL,NULL,NULL),(894,1305017069566679,'Clubhouse Drop-in Center',NULL,783236314114871,'GMC operates a Clubhouse Drop-In Center every day from 8:00 am to 4:00 pm. Our center is a safe space for people experiencing homelessness to come, feel welcome, and to simply belong. We call our center a clubhouse and encourage our guests to take ownership of and pride in the center. Guests help diffuse disputes, offer suggestions on areas for improvement, and help keep the center a clean and welcoming space.\nShowers and Laundry\nWe offer up to 20 showers and five loads of laundry a day on a first come, first serve basis. We provide all the basics: soap, shampoo, towels, razors, a laundry basket, laundry detergent, and, if needed, a temporary change of clothes.\n\nCase Management\nOur case managers help guests determine what their needs are and identify the best steps for fulfilling those needs. We assist with benefits applications, referrals, housing applications, and counseling. Case managers are available in our center Monday through Friday between 8:00 am and 4:00 pm.\n\nComputers, Phone, and Mail\nGuests are allowed to use the computers and phone in our center and may use GMCs mailing address to receive mail. We believe in helping people stay connected to the world, whether its with family and friends, case workers, the doctor, or the news.\n\nCoffee and Sandwiches\nWe have coffee and sandwiches for our guests while they are in our center. Though GMC is not a meal program, we strive to have coffee and sandwiches to help our guests last from breakfast to dinner.\n\nProgramming\nGMC offers educational and fun programming in our center. Past and current programming includes a counseling group, a smoking cessation group, a knitting class, movie screenings, bingo, yoga, and more. These programs teach valuable skills, allow our guests to socialize, and provide a fun distraction from the harsh reality outside our center.\n\nMedical Care\nWe have two psychiatrists and a general practitioner who come to GMC weekly. They perform basic health assessments in our center, write prescriptions, and give referrals. ','865999041296626','https://georgetownministrycenter.org/programs/clubhouse/',NULL,'info@gmcgt.org','Verified','637158405241810','Walk in to fill out an application.\n',NULL,NULL,NULL,NULL,'658265377894745','1251235179498072',NULL,'877243931325915','807078925662836',NULL,NULL,NULL),(895,1248769095025847,'Adolescent Services ',NULL,876151548923517,NULL,NULL,'https://www.nccf-cares.org/adolescent-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(896,1273385977104878,'Citizenship Loan Program',NULL,1116810105858975,'CARECEN partners with ACCESO, a bilingual branch of the DCGECU, to offer the \"New Americans Loan Program\", an initiative through which we aim to make naturalization and other immigration related processes affordable, by removing the high cost barrier and by offering a low interest, one-year micro-loan.  This program also  provides financial literacy and asset building opportunities to members of the diverse communities each institution serves.  To apply for this loan, citizenship applicants must first be screened and found eligible for naturalization by CARECEN.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009','To apply for this loan, citizenship applicants must first be screened and found eligible for naturalization by CARECEN.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(897,1277276480508566,'50th Street Family Program',NULL,1085960322097234,'50th Street Family Program is located in a residential neighborhood and is specifically for families with children who have become homeless.\n\nTemporary housing is provided in 12 individually furnished apartments with full kitchens. Participants in the program are expected to provide their own food and prepare all meals for their family. Families with incomes are expected to place funds in a personal escrow account. A referral from the Virginia Williams Family Resource Center (VWFRC) is one of the requirements for placement into this program. Along with other trained staff, a Program Director is onsite to manage shelter operations.','1218038521689235','http://www.dccfh.org/programs/family-services/50th-street-family-program/',NULL,NULL,'Verified','929094559121639','A family must be referred by the Virginia Williams Family Resource Center.',NULL,NULL,NULL,NULL,'624477976772029,1158808973498466','1202819882057306',NULL,'1292849277583603,877243931325915','1094445543172331',NULL,NULL,NULL),(898,1277069302008536,'Show Up, Stand Out',NULL,925199151398185,'Through funding received from the Office of Victim Services Justice Grants (OVSJG), the Show Up, Stand Out (SUSO) truancy prevention program targets students who have accumulated five to nine unexcused absences.  Program activities include, school-wide attendance incentives, home visits, family case management, concrete supports to families, parent engagement activities, and attendance education.  E/BFSC currently partners with the following schools under the SUSO program:\n\nAmidon-Bowen Elementary School\nBrowne Education Campus\nJefferson Academy\nLangdon Elementary School\nMcKinley Tech Middle School\nMiner Elementary School\nTwo Rivers Public Charter School\nTwo Rivers Public Charter School  Young Campus\nWalker-Jones Education Campus','778459456343468','http://ebfsc.org/our-programs/school-based-programs/',NULL,NULL,'Verified','637158405241810','For more information, please call.',NULL,NULL,NULL,NULL,'1194161595371590','986926461476700,900372337520002,1142698126123180',NULL,NULL,'1174417076661204',NULL,NULL,NULL),(899,1282487813090005,'Mentoring and Tutoring',NULL,855094084464049,'If youre age 50+, we invite you to volunteer with JCA Heyman Interages Centers high impact programs. Volunteers engage in meaningful service throughout Montgomery County in a variety of programs that help youth unlock their full potential. Our programs take place in schools and in the community, helping youth ages 3-18 with academics, self-confidence and an appreciation of cross-age connections. As a JCA Interages volunteer, you can make a difference in as little as one hour a week, or you can increase your impact by giving more time. We provide training and ongoing support and will work with you to find the right opportunity to fit your interests, skills and schedule.','924628911683577','https://accessjca.org/interages/',NULL,NULL,'Verified','789038541797078','Call to find out more.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'761929300455945,854808174954754,743601753506222,1178794928615970','1050035692418764',NULL,NULL,NULL),(900,1287738688707705,'Thrift Store',NULL,930909694635560,'A thrift store offering clothing and home goods.','813250237828389','https://lortonaction.org/lortons-attic-lcacs-thrift-store/',NULL,NULL,'Verified','911225335803318','Come to the thrift store during business hours.',NULL,NULL,NULL,NULL,'906987068756792','1245900033225592,1279269183820818',NULL,NULL,'1134049832810428',NULL,NULL,NULL),(901,1298911741733382,'Dental/Medical Prescription Assistance',NULL,919690199169575,'- Referrals for emergency dental appointments can be made to Northern Virginia Dental Clinic if you are in need of emergency dental care.\n- We also provide assistance to pay for critical medical prescriptions.','987030255962297','http://www.ucmagency.org/stepping-stones-basic-needs.html',NULL,NULL,'Verified','941516382466411,1077790582995406','Call or walk in during business hours.',NULL,NULL,NULL,NULL,'927006793998791','717231166133554',NULL,'891092215548488','611571036444170',NULL,NULL,NULL),(902,1298968199365502,'Community Markets',NULL,1279230501938511,'At our monthly pop-up community markets, all children, their families, and neighbors are invited to shop at no-cost for fresh, healthy produce and pantry staples. Monthly community markets are open to the public.','1291451614834077,947434898715713','https://marthastable.org/health-wellness-programs/',NULL,NULL,'Verified','832990803111047','Guests can just show up to shop at any pop-up location.',NULL,NULL,NULL,NULL,'1235881686916009','784780548511844,880791717426221',NULL,NULL,'769154108829537,1273798320035626',NULL,NULL,NULL),(903,1300980508291929,'Employment Services',NULL,1131980011333623,'Efforts From Ex-Convicts provide Employment and Referral Services for the benefit of ex-offenders. Mr Tinnen specializes in providing one-on-one support and guidance in helping you prepare for or  find the job you seek and providing recommendations for any training or counseling needs.','1297547838260579','http://www.efecachieves.org/programs/employment-services/',NULL,NULL,'Verified','970915508638448','Walk in or call for application.',NULL,NULL,NULL,NULL,'1152989987737661','1240071387530616',NULL,'664148755918958','949959980193647',NULL,NULL,NULL),(904,1311595168931297,'Food Assistance',NULL,919690199169575,'- United Communitys Food Pantry provides supplemental groceries once per week.\n- Assistance with SNAP eligibility and forms is available. Some families may be eligible for the monthly USDA Commodities program.\n- Free fresh produce distribution is generally the last Saturday of the month in United Communitys back parking lot, 8am - 11am. Please call 703.768.7106 to confirm the date for this month. Open to general public; no proof of need required. Arrive early and bring your own bags.','987030255962297','http://www.ucmagency.org/stepping-stones-basic-needs.html',NULL,NULL,'Verified','832990803111047','Prospective clients are advised to call the main office for an appointment with a counselor: 703.768.7106, weekdays 9am - 5pm.\n\nOur geographic service area is the Alexandria portion of southeastern Fairfax County. We generally\nserve community members who reside in the following zip codes: 22303, 22306, 22307, 22308, 22309,\n22310, and part of 22060 (north of 9139 Richmond Hwy.).\nFamilies with incomes at or below 200% of the federal poverty level can qualify for basic needs\nassistance. (For a family of 3, for example, this is annual income at or below $41,560.)',NULL,NULL,NULL,NULL,'927006793998791','717231166133554,895016590852441,637262321593026,1300776409918544',NULL,'891092215548488','611571036444170',NULL,NULL,NULL),(905,1267195102722768,'Real Opportunities Training Program','Real Opps',801110030219864,'Thrive DC is proud to provide a program that works with individuals who are facing major barriers to employment. We help clients train for a new culinary career who are overcoming anything from homelessness, a long history of joblessness, to substance abuse, and felony convictions.\n\nWhen given the opportunity clients are dedicated to putting in the work, we can help them jump start their careers again and be their mentors during the process.\n\nReal Opp GraduationA Job Program That Works\nOur Real Opportunity Training Program (Real Opps) is an 18 week program with intensive case management to overcome major challenges. Its broken down into two sections:\n\n6 weeks of soft skills development and training as a chef alongside Thrive DCs kitchen staff\n12 week externship at a local restaurant\nNear the end of training clients will also have the opportunity to test for a Food Handlers License.\n\nReal Opps is designed for the individual who wants to make a real change in their lives. Individuals must be committed to the program for 18 weeks. To support that commitment, Thrive DC will provide a small stipend to all participants. For those who complete the program, achieving their goals is very possible!\n\nMany individuals are hired directly by the restaurants they extern at, and for those who arent, they have the foundational skills and good references to be an asset at any kitchen in the city.','1220597047470925','https://www.thrivedc.org/programs/employment/realopps/',NULL,'alicia@thrivedc.org','Verified','970915508638448','For questions about the program, please contact Alicia Horton at (202) 503-1522, or alicia@thrivedc.org ',NULL,NULL,NULL,NULL,'665113076769939,1299532893666576','818646560557978','636692867080417','877243931325915','962322435473993',NULL,NULL,NULL),(906,1273613208251491,'SPARK Youth Program','Previously: Forward Steps',919690199169575,'United Community\'s SPARK program (formerly called Forward Steps) is a multifaceted youth development program for students in grades 1 - 12, operating at United Community\'s two communiy centers: Creekside Village Community Center and Sacramento Neighborhoood Center. The program provides a safe after-school and summer environment where at-risk youth can receive homework help, learn new skills, and engage in activities that promote leadership and intervention/prevention of negative behaviors.\n\nThe program focuses on:\nImproving academic achievement\nStrengthening leadership and social skills\nIncreasing parental involvement\n\nSPARK is designed to build positive momentum in each participant\'s life. More than 80 youth are enrolled over the year, with 94% of the students showing improvement in their grades and social skills, and more than 75% of parents actively involved in their children\'s lives.','928012146500435,1246140596600748','http://www.ucmagency.org/sparkyouth.html',NULL,NULL,'Verified','637158405241810','For more information, call either center during business hours.',NULL,NULL,NULL,NULL,'676690284227155,746366368083217','554058492941520,1120594852165211,826011901306447,1232282827720859',NULL,'883345659611536,1168700157058167','1126520692919525,890837741306671',NULL,NULL,NULL),(907,1283472697302797,'Columbia Road Health Services (Ward 1) ',NULL,1043772486617212,NULL,'1290604886585097',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'882078503958236',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(908,1290396892728753,'Ward 5 & 6 Aging Services',NULL,1180598613249590,'Finding the right resources when in need can be very challenging. Seabury Ward 5 and 6 Lead Agency services are designed to provide older adults with ward-based and citywide supportive services, resources and referrals that assist them in continuing to live independently in their homes and community.','765115819494380,1183011241112934','https://www.seaburyresources.org/agingservices',NULL,'info@seaburyresources.org','Verified','941516382466411,637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'990653723421604,762056949976027','1176087327224268',NULL,'854808174954754','638665770674913,743160673924882',NULL,NULL,NULL),(909,1300660045853572,'UPO Academic Scholarship',NULL,761153930697275,'College isnt cheap. We all want our children to have the opportunity to continue their education, but the financial reality often makes that dream difficult to achieve.\nSince 1990, UPO has helped ease the burden of college hopefuls and their families by awarding scholarships. Currently, UPO gives $10,000 annually to each of 5 deserving DC high school students who want to improve their lives and their community by continuing to learn.\nWe know that being the first in the family to go to college or being away from home for the first time can be scary, overwhelming, and stressful on students and their families, so we also provide ongoing encouragement, support, and assistance to scholarship recipients.','594960886051316,999755198000719','https://www.upo.org/youth-services/',NULL,NULL,'Verified','1077790582995406,789038541797078','For more information about our scholarship opportunities, contact UPO Youth Services Division Director De Angelo Rorie at 202-610-2796.',NULL,NULL,NULL,NULL,'757819596231988,665905423802380','587544010010943,940897095189363,682372519823224','773180771408189','740331137219886','1304904589817191,1166860713798541',NULL,NULL,NULL),(910,1311316578271310,'Winter Shelter',NULL,783236314114871,'GMC started the shelter on a pilot basis for six weeks during the winter of 1993. Today, the shelter serves ten homeless people from November through April and provides an opportunity for shelter residents to establish warm, supportive relationships with staff and volunteers and among themselves. The Winter Shelter creates a safe haven, offering a comfortable, friendly, low-demand environment designed to appeal to our most vulnerable and service-resistant homeless guests.\n\nOur shelter rotates between ten congregations in Georgetown. Every night, congregants from the current location of the shelter prepare and serve a hot, nutritious meal to our residents and help foster the sense of community we try to create.','865999041296626','https://georgetownministrycenter.org/programs/winter-shelter/',NULL,'info@gmcgt.org','Verified','929094559121639,637158405241810','Call for information on exact timeline and rotating locations. You can access the shelter by walking in.',NULL,NULL,NULL,NULL,'658265377894745',NULL,NULL,'877243931325915','807078925662836',NULL,NULL,NULL),(911,1313580838903453,'Safe and Healthy Home',NULL,623502983860633,'Our Safe and Healthy Home program focuses on stabilizing 25 items that the National Center for Healthy Housing (NCHH) found to drastically improve living conditions for a homes residents, with a particular focus on low-income persons living in older and/or substandard housing who are disproportionately affected by home hazards. Volunteers work throughout the year on home safety, accessibility modifications, and fire and carbon monoxide safety prevention improvements.\n\nLast year, our clients met only 68% of the recommended items, but after Rebuilding Together made repairs and upgrades, 86% of the items that contribute to a safe and health home were completed. ','834887345290440','http://www.rebuildingtogetheralex.org/index.php/about-us/programs2019',NULL,'info@rebuildingtogetherdca.org','Verified','929094559121639','Call or apply online. Concerning eligibility, folks who are eligible are low income homeowners who cannot maintain their homes (typically elderly, persons with disabilities, veterans, and families with children), as are nonprofit facilities, schools, and public spaces that serve low-income residents. To be considered for home assistance, candidates must complete and submit an application form and provide documentation of total household income, such as tax forms or pay stubs. Some of our clients are referred through congregations, schools, community agencies and service groups, or by self-referral.',NULL,NULL,NULL,NULL,'1184206268036011','1272598751590026',NULL,'1009160981885425,753216819976855','1171518036331901',NULL,NULL,NULL),(912,1314823770834798,'Housing First Teams',NULL,976379482380679,'Pathways to Housing DC was founded to positively transform the lives of people experiencing chronic homelessness, who are also living with serious and persistent mental illness and challenging health conditions. For the past decade, we have successfully engaged, housed, supported, and treated over 850 adults who had been living on the streets for years. As an alternative to a system of emergency shelter/ transitional housing, our model is simple: provide housing first, and then combine that permanent housing with supportive treatment services in the areas of mental and physical health, substance abuse, education, and employment.\n\nWhile the model is simple, the Housing First Program is very complex and requires dedicated staff to coordinate all aspects (outreach, housing, healthcare, treatment and case management) of the program in order for the people we serve to be successful in their recoveries. Housing First means there are no conditions that have to be met before the person moves in. Housing is provided in apartments that are spread throughout the District, with each client holding their own lease. Using scattered sites, we are able to give each client choice in where they would like to live, helping to foster a sense of home and self-determination. Stable, supportive housing is merely the first step towards reintegrating into their community, rebuilding family relationships, reconnecting with their faith fellowships, and experiencing an improvement in overall physical health and psychological wellbeing.\n\nAfter receiving housing first, every client is matched with a support team (Assertive Community Treatment Team, Veterans Housing First Team and/or Permanent Supportive Housing Team) comprised of psychiatrists, nurses, social workers, certified addictions counselors, employment specialists, and peer health specialists. The team works together to provide comprehensive community-based treatment and support services around the clock, with a focus on integrating both health and social well-being into the recovery plan. These vital interventions are designed to empower client choice and support successful independent living. Using this model, we have been able to maintain a housing retention rate of at least 91% with clients who have traditionally been viewed as treatment resistant, and not ready for housing. We believe that housing is a basic human right, that anyone who says they want a safe place to live is housing ready, and that virtually all people can be successful in housing with the proper combination of supports. Our success using the Housing First model demonstrates that the vast majority of people we connect with permanent supportive housing stay in that housing and on the path to recovery.','743353111808252','https://pathwaystohousingdc.org/what-we-do/housing-first/',NULL,NULL,'Verified','929094559121639','We do not accept direct referrals for this program. Please call for more information. Referrals are done through the CAHP system.',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268',NULL,'877243931325915','1137409735223363',NULL,NULL,NULL),(913,1316831396089328,'Unity at 801 East Building Shelter (Ward 8) ',NULL,1043772486617212,'Healthcare for the homeless ','918683698959010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1102057898411791',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(914,1321120943941065,'Rooting DC ',NULL,559497771463092,'Free, hands-on gardening workshops ',NULL,'https://www.dcgreens.org/rooting-dc ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(915,1321094180433140,'Senior Services',NULL,726173106231202,'Nearly half of the low-income people who turn to the Mission for food and clothing are seniors trying to supplement their fixed food budget and make ends meet.\n\nSenior Luncheons\n\nThe Mission holds senior luncheons every month with Bingo, a delicious lunch, an inspirational program and groceries to take home. Its both a day of fellowship and a safety net that helps encourage isolated seniors in our community.\n\n24 Seniors Luncheons were held in English and Spanish last year.\nSeven seniors were housed in the Missions Lambert House, our low-income housing facility\nFood, Clothes and More\n\nOur Family Ministry Center is also committed to meeting the needs of seniors, many who are on disability. Besides food, the center offers clothing and household items like eating utensils, wall decor, shampoo, flower vases, pillows, blankets and tablecloths.','838780960881380','https://www.missiondc.org/what-we-do/community-services/senior-services/',NULL,NULL,'Verified','637158405241810,911225335803318,832990803111047','Call for more information.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'854808174954754','601101607323805',NULL,NULL,NULL),(916,1332741706053106,'Support Services for Victims of Violence Program',NULL,577764298046742,'This program provides therapeutic and mental health support for victims of violence, whether it is sexual, physical, emotional. Through our victim services, we provide one-on-one case management and counseling services for victims of violence.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','637158405241810','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','1289350366232372','1200832408072169,605403471620978','603292299584681',NULL,NULL,NULL),(917,1270127715145648,'Early Learning Center',NULL,919690199169575,'United Community\'s Early Learning Center creates positive classroom experiences that encourage children\'s curiosity and holistically further development.  The safe, nurturing environment allows children to learn through play and encourages exploration using the five senses.  Allowing children to freely and healthfully express needs, develop self control, respect for others and cultivate a positive self-image within the classroom environment has many beneficial factors for children.  Encouraging communication between the center staff and families ensures a healthier bond between parent and child.  \n\nEarly Learning Center Services:\nA child-centered, multicultural environment\nA developmentally appropriate curriculum \nLesson plans focused on learning through hands-on exploration and discovery\nDaily communication among teachers, parents, and children\nDevelopmental screenings and assessments\nHealth screenings: dental, vision, and hearing\nNutritious breakfast, lunch, afternoon snack\n\nFamily Services:\nIn-house Child Development Specialist\nReferrals to services for children with special needs \nReferrals for effective parenting\nCommunity resources provided through United Community','1251056114217612','http://www.ucmagency.org/earlylearningcenter.html',NULL,'torria.baker@unitedcommunity.org','Verified','789038541797078,941516382466411,832990803111047','Call to learn about enrollment. You can also email us.',NULL,NULL,NULL,NULL,'1114612056687370','867742554981281',NULL,'1274396898894043,1292849277583603','1054081986123306',NULL,NULL,NULL),(918,1272292641029297,'Lights of Hope Program',NULL,769893937425938,'The Lights of Hope Program provides candle light vigils for families in the Washington Metropolitan area regardless of cause of death.\n\nWhat is a Candlelight Vigil?\nA Candlelight Vigil is a powerful ritual of remembrance. It can be a formal or informal gathering of family, friends and community that come together to remember a loved one. Vigils are typically held after sunset at a designated location and attendees will light candles which burn during the vigil. Gatherings are usually one hour in length (formal vigils may be longer). Families may include poems, prayers, singing, and speakers(public and/or religious officials) as a part of the vigil. There are instances where media may be present.\n\nWhy have a Candlelight Vigil?\nCandlelight Vigils have become a shared community experience for families, friends and the community to acknowledge, honor and give tribute to the memory of a deceased loved one. Vigils provide a source of comfort and hope on the journey to healing.','1108850981657232,1166799153375505','https://www.wendtcenter.org/lights-of-hope-program/',NULL,'stillman@wendtcenter.org','Verified',NULL,'How to Request a Vigil?\nThe Lights of Hope Program is available to individuals and families in the Washington Metropolitan area regardless of the cause of death.\n\nOctober April: Vigils begin at 6pm or 6:30pm\nMay-September: Vigils begin at 7pm or 7:30pm\nThe Lights of Hope Program provides individuals and families with the following:\n\n(50) Candles with Drip Guards\n(50) Guides to Coping After Traumatic Loss\n(50) Color Programs\n(20) Keepsake Programs\n(2) Trash Bags\n*When necessary police presence arranged',NULL,NULL,NULL,NULL,'798956401851670','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(919,1279217562065520,'Private-public PSH Partnership Program',NULL,787727417537507,'The DC Department of Housing and Community Development (DHCD) administers the District\'s Inclusionary Zoning (IZ) for Residential Developers Program, which requires that 8 percent - 10 percent of the residential floor area be set-aside for affordable units in most: new residential development projects of 10 or more units; and rehabilitation projects that are creating 10 or more units in an existing building or addition. In addition, many of these projects have a set aside for permanent supportive housing units. \n\nAs part of our Private-Public PSH Partnership Program, Open Arms Housing has partnered with responsible developers dedicated to the mission of creating a better community and eradicating homelessness from the most vulnerable populations. Currently we have several partnerships nearing completion and are excited about upcoming partnerships to provide more permanent supportive housing units. ','920572231138004','https://openarmshousing.org/programs',NULL,'partnerships@openarmshousing.org','Verified','929094559121639','If you are a developer and would like to discuss future partnerships with Open Arms Housing, please contact us at partnerships@openarmshousing.org.',NULL,NULL,NULL,NULL,'1130020356495609','819527791411716',NULL,NULL,'663934110398598',NULL,NULL,NULL),(920,1288975729182572,'VETERANS AFFAIRS (VA) OUTPATIENT CLINIC: SOUTHEAST WASHINGTON D.C.',NULL,1300690778936362,'The Community Based Outpatient Clinic (CBOC) Southeast provides basic medical and preventative care, health education, mental health services, addiction counseling, comprehensive women\'s health care and nutritional counseling to eligible veterans. Referral services are provided for those who require specialized care.','953406517143083','http://www.washingtondc.va.gov/locations/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'605557371997807',NULL,NULL,NULL),(921,1290043633447090,'Emergency Child & Adolescent Victim Crisis Fund',NULL,1164024351359039,'Safe Shores Family Advocacy program is a familys first point of contact at Safe Shores and works with children and their non-offending caregivers throughout the continuum of services to help families see and achieve a safe, new start.\n\nModest financial assistance is available to children and their families in emergency situations to provide immediate relief for urgent needs. Requests might include coverage for transportation costs, school uniforms and supplies, infant/toddler car seats, summer camp fees, cribs and beds, nebulizers.','1101386810121427','https://www.safeshores.org/get-support/our-services/family-advocacy-services/',NULL,NULL,'Verified','637158405241810','Safe Shores will conduct a forensic interview after a report of child sexual or physical abuse is made to DC CFSA or the MPD. Family Advocacy Services are available to children and families during this time.',NULL,NULL,NULL,NULL,'1171658960657370','597458689446427',NULL,'1079714166824390,1274396898894043,915486946336080','960248296759213',NULL,NULL,NULL),(922,1290448335349018,'Pediatrics and Adolescent Medicine ',NULL,1191261150235856,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(923,1293112150353032,'Community Strong',NULL,623502983860633,'Our Community Strong program provides improvements to a variety of common spaces used by thousands of Alexandria residents. From community parks and gardens to senior centers, homeless shelters and low-income daycare facilities, we partner with other organizations to upgrade or renovate these areas. Activities include building greenhouses and vegetable gardens, installing benches and tables, creating walkways, planting greenery, installing play areas, and much more. \n\nBecause of the work weve completed, children now have safe areas to play, neighbors have gardens to grow their own food, seniors have social connection spaces, and safe facilities to attend, and whole neighborhoods have been revitalized.','834887345290440','http://www.rebuildingtogetheralex.org/index.php/about-us/programs2019',NULL,'info@rebuildingtogetherdca.org','Verified','929094559121639','Call or apply online. Concerning eligibility, folks who are eligible are low income homeowners who cannot maintain their homes (typically elderly, persons with disabilities, veterans, and families with children), as are nonprofit facilities, schools, and public spaces that serve low-income residents. To be considered for home assistance, candidates must complete and submit an application form and provide documentation of total household income, such as tax forms or pay stubs. Some of our clients are referred through congregations, schools, community agencies and service groups, or by self-referral.',NULL,NULL,NULL,NULL,'1184206268036011','1272598751590026',NULL,'1009160981885425,753216819976855','1171518036331901',NULL,NULL,NULL),(924,1296730701251441,'The Center for Families and Children',NULL,802521051916688,'Community Connections is pleased to offer services to children and youth who suffer from mental illness, substance abuse, or a history of trauma. Our goal is to provide high-quality, clinical mental health services focused on the strengths of each individual child and family. Family support and skill building are offered through individual, group, and family-based interventions. Community Connections utilizes the focus and creativity of the entire team to develop flexible and targeted interventions. Problems are recognized in their proper context and addressed through collaborative partnerships with families and their formal and informal support networks.\n\nWHAT TO EXPECT:\nComprehensive Assessments\nIndividual Treatment Planning\nCommunity-Based Services\nCollaboration and Teaming\nCulturally Competent and Well-Trained Staff\nOn-Call Crisis Services\nEvidence-Based Program\n\nOUR SERVICES:\nCommunity-Based Intervention\nIndividual Psychotherapy\nPsychiatric Services\nGroups\nFamily-Based Services','1130006642102532','http://www.communityconnectionsdc.org/our-services/families-children',NULL,NULL,NULL,'637158405241810,941516382466411','If you are interested in receiving services at The Center for Families and Children or have questions about our services, please come to an Information Session.\n\n\n\nYou can sign up for our next session by visiting our calendar. Your child does not need to attend the Information Session.\n\nCalendar: http://www.communityconnectionsdc.org/events/?view=calendar',NULL,NULL,NULL,NULL,'1186529718830668',NULL,NULL,'868012483124236,837964410196977,1200033126219686,804517213435343,937643355135162,1227486019167060','603553623654573',NULL,NULL,NULL),(925,1318218238602449,'Community Harvest',NULL,640186123610411,'The Community Harvest program provides demonstration opportunities for public land reclamation, green planning and design, job training, volunteer support, and advocacy for community greening efforts.','1133664511724903,793256928193231','https://washingtonparks.net/programs/community-harvest/',NULL,NULL,'Verified','832990803111047,970915508638448,789038541797078','Call for more information.',NULL,NULL,NULL,NULL,'1126250650450819','1186410017519358,976209607538308,1159408019708687,916456272581834',NULL,NULL,'906270690131919,1180062904104210',NULL,NULL,NULL),(926,1320331128300695,'School Garden Markets ',NULL,559497771463092,'Schools partner with one of three non profit food hubs (the Common Market, Community Foodworks, and Dreaming Out Loud). ',NULL,'https://www.dcgreens.org/school-garden-markets',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(927,1322260694270949,'Permanent Housing Program (PHP)',NULL,1306699628219808,'The Permanent Housing Program grants 13 young families (head of household ages 18-24) exiting city shelters seamless access to 2-bedroom apartments. Families receive a wide range of housing, case management, employment assistance, life skills education and other positive youth development services. Continuously updated, individualized service plans for each resident are geared towards the overall goal of assisting families in transitioning to independent housing.','951106217202607','https://www.sashabruce.org/programs/safehomes/permanent-housing-program-php/',NULL,'srobertson@sashabruce.org','Verified','929094559121639','Call or email to access this program.',NULL,NULL,NULL,NULL,'874482698067575','882054301651193',NULL,'1292849277583603,1222973168897685,877243931325915','654333290489949',NULL,NULL,NULL),(928,1336511977669058,'Social Services',NULL,577764298046742,'This program offers a support center with intensive case management and social services from our diverse non-clinical social workers. As part of the services offered, Casa Ruby provides support in human services, such as the acquisition of a government issued I.D. and other skills building initiatives.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','637158405241810,917725171609009','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','1289350366232372','1200832408072169,605403471620978','603292299584681',NULL,NULL,NULL),(929,1332764177181120,'Adult Counseling',NULL,769893937425938,'Our professional, experienced counselors work with adults, children, teens, and adults individually as families and in support groups. We offer counseling in our main office in Northwest Washington, DC or in our satellite offices in SE and NE Washington.','1108850981657232,1166799153375505','https://www.wendtcenter.org/adult-counseling/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021. Our standard fee for counseling services is $145.00 per hour. However, we accept insurance and offer a sliding scale (based on household income) to ensure our services are accessible by anyone in need.',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(930,1277116846663193,'Syringe Exchange',NULL,810479025131545,'Provides a needle exchange where people can drop off used needles and exchange them for clean ones as part of a harm reduction campaign.','858837023472383,586004400786711','https://www.hips.org/syringe-exchange.html',NULL,NULL,'Verified','941516382466411','Locations vary. See below or call for more information.\n\nBread for the City\n1525 Seventh Street, NW\nWashington, DC 20001\n(202) 386-7020\n\nBread for the City provides harm reduction activities and needle exchange services for those in need at its headquarters located at 1525 Seventh Street, NW only. Call Bread for the City for more information.\n\nFamily and Medical Counseling Services, Inc.\n2041 Martin Luther King Ave., SE\nSuite 303\nWashington, DC  20020\n(202) 889-7900 / Mobile Unit: (202) 253-5712\n\nNeedle Exchange Mobile Unit Schedule:\n(services provided by Family and Medical Counseling Services)\nMonday: 9:30 am - 11:30 am Potomac Gardens\n                     1:30 pm - 3:30 pm Southern Avenue & Chesapeake St., SE\nTuesday: 9:30 - 11 am  Division Avenue, NE\n                     11:20 am - 12 pm  Half and O Streets, SE\n                     1:30 pm - 3:30 pm MLK Ave. and Morton Streets, SE\nWednesday: 9 am - 10:15 am 14th and U Streets, NW\n                     10:30 am - 11:40 am Montello and Simms\n                     1:30 pm - 3:30 pm North Capitol St. and Florida Ave., NW \nThursday: 9:30 am - 11:30 am Georgia Avenue and Morton Street, NE\n                     1:30 pm - 3:30 pm 19th and Benning Road \nFriday: Visit office location',NULL,NULL,NULL,NULL,'732018700373297,1288270700272372,933430884294333',NULL,NULL,NULL,'941976438893110,865952231500398',NULL,NULL,NULL),(931,1280474482709655,'Senior Community Service Employment Program (SCSEP)','SCSEP',855094084464049,'The JCA Senior Community Service Employment Program (SCSEP) provides on-the-job training for people with low income age 55 and older who live in Montgomery and Frederick counties, Maryland. Trainees receive minimum wage while working at charities and government agencies to build their skills and resumes while delivering valuable community service. SCSEP is operated under a U.S. Department of Labor grant and in cooperation with Senior Service America, Inc. The SCSEP program is an equal opportunity program.','924628911683577','https://accessjca.org/scsep/',NULL,'cascsepinfo@accessjca.org ','Verified','970915508638448','Download and fill out the SCSEP Preliminary Application. Email it to jcascsepinfo@accessjca.org or yawilliams@accessjca.org.\n',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'854808174954754,1114978823107611,822271561821597,1182980053228188','1050035692418764',NULL,NULL,NULL),(932,1281816879491049,'Mental Health Services',NULL,1093127605400642,'Andromeda provides individuals, couples, and family mental health and substance abuse services for those who are suffering from these illnesses and those who are HIV positives. We provide Integrated Dual Disorders Treatment that helps people develop the hope, knowledge, skills, and support they need to manage their problems. The treatment also helps individuals pursue meaningful life goals, behavioral interventions as needed, and crisis intervention services. Our philosophy of treatment is to provide dignified care with a holistic approach by combining mental health and substance abuse treatment in a coordinated, highly individualized and flexible treatment plan.\n\nWe provide psychiatric assessment and medication management services, referred to our two psychiatrists:\n\nDr. Alvaro Guzman\nDr. Anca Zinnes.\n\n\nAndromeda accepts the following insurance programs for mental health services:\n\nAetna (HMO only)\nAmeriHealth Perform Care (HMO only)\nBlueCross BlueShield (HMO & PPO)\nCigna (HMO & PPO)\nMedicaid (PPO only)\nMedicare (PPO only)\nOptimum Choice Inc.\nTrusted Behavioral Health (HMO only)\nUnited Community Health (HMO only)\nUnited Health (HMO & PPO)\nValue Options Medstar (HMO only)\n\n\nWe also have a sliding scale option for those who do not have mental health coverage through their insurance plan. We require co-pays.','841307455613093','http://andromedahealth.org/our-services/mental-health-services/',NULL,'info@andromedadc.org','Verified','941516382466411','Call or email for appointment. Calling is best as email could take a while.',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,NULL,'1224638786118966',NULL,NULL,NULL),(933,1282973947484780,'Medical Nutritional Therapy',NULL,935708179993271,'The primary goal is to provide Medical Nutrition Therapy (MNT) assessment and counseling services for Damien Ministries\' food pantry and case management client population.As the newest program at Damien Ministries, Medical Nutrition Therapy effectively responds to the Nutritional Support Needs of PLWHA in our client population.This program supports existing programs with the goal of increasing the availability of healthy food as well as low-sodium products, all of which will promote better eating habits and health outcomes related to good nutrition. A registered dietician will be available to perform nutritional assessments, develop meal plans, provide on-going consultation and reassessment of nutritional needs. Thenutrition assessment includes analysis of dietary history and intake, height, weight, pre-illness usual weight, goal weight, body mass index (BMI), lean body mass and fat.','1295311939008541','http://www.damienministries.org/',NULL,NULL,'Verified','941516382466411','Call to set up an appointment',NULL,NULL,NULL,NULL,'1174596952831378','1170974328064768,620540776659347',NULL,NULL,'1010200482336643',NULL,NULL,NULL),(934,1282686227944763,'Hypothermia Help',NULL,761153930697275,'Hypothermia is a medical emergency that occurs when your body loses heat faster than it can produce heat, causing a dangerously low body temperature. Left untreated, hypothermia can lead to complete failure of your heart and respiratory system and eventually death! ','1186823261288379','https://www.upo.org/communitywellness/',NULL,NULL,'Verified','929094559121639,878986697513222','We do outreach during cold weather and you can also reach out to our housing hotline.',NULL,NULL,NULL,NULL,'775081687772349,1066322983572364','623621986722153',NULL,'684980356183378','1010090868515533',NULL,NULL,NULL),(935,1285350837219213,'Groceries-to-go',NULL,1219589148672769,'Food & Friends Groceries-to-Go service is available for individuals and families who live outside our freshly-prepared meals delivery area. It is also available for those clients who are able to do light meal preparation, or who have a caregiver to do so. Delivered to clients every other week, Groceries-to-Go includes fresh produce, frozen meats such as fish and poultry, frozen soups and entrees prepared in our kitchen, and pantry items. Dietitians work with each client to review nutrition and food safety as a part of the program. Clients receive a recipe booklet that includes cooking tips and recipes based on the food included in their grocery deliveries.\n\nIn addition to packaged groceries, clients receive 4 frozen prepared entrees, 2 frozen prepared soups and a protein pack of frozen fish and poultry. Clients may also receive liquid nutritional supplements as needed.','857875532631251','https://foodandfriends.org/about-us/#services-we-provide',NULL,NULL,'Verified','832990803111047',NULL,NULL,NULL,NULL,NULL,'1239494728678928,1133561368089400','857395816743172,884617333624034',NULL,NULL,'1251720034767684',NULL,NULL,NULL),(936,1289508652850921,'Social Work Services','Misler Center',855094084464049,'Our social workers are at the front lines at the Misler Center. They are usually the first staff members to handle inquiry calls from families and others seeking information about the Center. They personally guide families and participants through the intake process, and help to make the transition to the Center an easy and seamless process.\n\nOnce a participant has joined the Center, the social work staff stays in regular contact with families, providing updates on participant progress and using their vast knowledge of community resources to help families with care needs. In addition, they lead on-going support groups for both participants and family caregivers.','924628911683577','https://accessjca.org/misler-center/',NULL,'Misler@AccessJCA.org','Verified','637158405241810','For more information, to arrange a visit, or to speak with one of our social workers, please call us at 301-468-1740, or use the contact form on our website to send an email inquiry.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1058170814905410',NULL,'1157835357284365,854808174954754,1032274526726429','1050035692418764',NULL,NULL,NULL),(937,1291991254111763,'Tele-Psychiatry Program',NULL,1061724977026001,'Provides telephone-based psychiatric services.',NULL,'https://childrensnational.org/departments/psychiatry-and-behavioral-sciences',NULL,NULL,NULL,'941516382466411','Call for services.',NULL,NULL,NULL,NULL,'978304346911390',NULL,NULL,'1274396898894043',NULL,NULL,NULL,NULL),(938,1299121197634961,'Nurturing Parenting Program',NULL,727757843857751,'The goals of the Nurturing Parenting Program is to increase the parent/caregiver capacity of residents in the community to improve, enhance and support their abilities to understand and respond to the developmental, educational, recreational, spiritual and socio-economic needs of children and young adults to create, maintain and grow healthy, thriving families and communities.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234,915486946336080','1231516890380928',NULL,NULL,NULL),(939,1297058844905012,'Healthcare Certification',NULL,1230770757213322,'Our Healthcare certification program is a great start to a career as a Certified Nursing Assistant, or in another patient care role.\n\nAvailable certifications in Healthcare:\nHome Health Aide: Train to provide routine healthcare, such as changing bandages and dressing wounds. Other skills include applying topical medications to the elderly or persons with disabilities. Also learn to monitor or report changes in a patients health status. Prepare for care in a patients home or in a care facility.\n\nCertified Nursing Assistant: Train to provide basic patient care under direction of nursing staff. Gain the skills for duties such as feeding, bathing, dressing, grooming, or moving patients.','771897230838212','https://www.ywcanca.org/what-we-do/career-education-training-center/home-health-aide-program/',NULL,NULL,'Verified','970915508638448,789038541797078','The application is available online on the program website. You can also call for more information.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'836091364973509','1330181492619505',NULL,NULL,NULL),(940,1295568882348530,'Food Assistance',NULL,1091687465844379,'Provides food to Montgomery County residents who meet income eligibility guidelines.','1348564381004436','https://www.mannafood.org/how-to-receive-food-from-manna/',NULL,NULL,'Verified','832990803111047','Please call Mannas main office during regular business hours at (301) 424-1130.  We need to receive your call by 3:00 pm the day before you would like to receive food so we can have your order ready.\n\nWhen you come to pick up food, you need a photo ID with your current Montgomery County address, or provide a document that proves you currently reside in the county.\n\nIf you cannot pick up your food on the day scheduled, you must call Manna in order to reschedule your pick up.\n\nIf you need to schedule a pick up outside of Mannas normal business hours, DIAL 311 to contact the Department of Health and Human Services.\n\nYou can also get a referral from hundreds of referral agencies that work with Manna. Ask your case manager, social worker or pastor.',NULL,NULL,NULL,NULL,'1181713169181704','1218206458520016',NULL,'1227383950401000,1182980053228188,1274524177531453,565669778208779','740708126474880',NULL,NULL,NULL),(941,1298050850536077,'Clothing Program',NULL,618997848324116,'Bread for the Citys clothing room enjoys more than 700 visits each month. We offer attire, books, and small household goods for various seasons and occasions to our clients and their families.\n\nAll clothing and small goods are donated and provided free of charge. Toiletry packs (often containing soap, toothpaste, toothbrushes, lotion, shampoo, conditioner, or other products) are also distributed through the clothing program.\n','1058560288612968','https://breadforthecity.org/clothing/',NULL,NULL,'Verified','911225335803318','Bread for the Citys clothing room is located at our Southeast Center (1640 Good Hope Road SE). Clients may visit the clothing room for 15 minutes one time each week.  Staff and volunteers will be on hand to assist.',NULL,NULL,NULL,NULL,'606695908675970','1148690830051336',NULL,NULL,'786471426290380',NULL,NULL,NULL),(942,1300052909750200,'School-based Mental Health Program',NULL,840733417398800,'The Marys Center School Based Mental Health (SBMH) Program supports children, families, and communities by promoting behavioral wellness. Our goal is to increase student, family, and school communities attainment of positive mental health and well-being. To do this, we partner with DC public charter schools in Wards 1, 4, and 5 to enhance each schools wellness team. \n\nThe SBMH team is dedicated to helping children and young adults of all ages with the emotional health challenges they may be facing. Our kind and highly skilled bilingual therapists work full-time in each school, reducing barriers to behavioral health assessments and culturally appropriate, trauma-informed care.   \n\nAdditionally, our SBMH program partners with high school seniors and their families through the Got Transition Young Adult Mental Health Initiative. The initiative aims to help prepare them for the unique stressors they may face as they enter adulthood and ensure they can continue caring for their emotional health.  \n',NULL,'https://www.maryscenter.org/behavioral-health/children-and-teens/school-based-mental-health-program/',NULL,'mparrella@maryscenter.org',NULL,'941516382466411','If your school is interested in partnering with Marys Center, contact Marisa Parrella,LICSW,LCSW-C, Director of School Based Mental Health Program at mparrella@maryscenter.org or (202) 674-3754. ',NULL,NULL,NULL,NULL,'1239044772095121,1301804131597006',NULL,NULL,'883345659611536,1274396898894043',NULL,NULL,NULL,NULL),(943,1301959132503150,'Women\'s Collective',NULL,925360037107607,'Our case management services are a part of a comprehensive family-centered program that provides peer support, creates connections between careseekers and caregivers, and promotes the participation and empowerment of women, their families, and members of their support network in developing care plans based on their self-defined needs. We accept, as well as provide, referrals for women, women and their children, to/from other programs that provide local primary medical care, support and mental health services for women with HIV/AIDS either currently not in a system of care or who need support to remain in a system of care. We provide services for women and their families that assists them in accessing respite care, childcare, housing, food, transportation services, etc., providing women with opportunities to take care of not only their own primary medical and psychosocial needs but also the needs of their children and other family members.','946396771118356','www.womenscollective.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1134563231552544',NULL,NULL,NULL),(944,1305546200651894,'La Casa',NULL,791950857737387,'La Casa is a 40-unit Permanent Supportive Housing (PSH) building for previously chronically homeless males located in the Columbia Heights neighborhood of Washington, DC. The programs highly vulnerable residents receive comprehensive on-site case management, supportive services, and 24 hour staffing. Services at La Casa are tailored to the unique needs of each participant.\n\nLa Casas approach is based on the principles of Housing First, an evidence-based housing model that considers housing the first priorityespecially for those who are also facing other barriers. This model emphasizes stabilizing housing immediately, so that other needs can be successfully met.\n\nFriendship Place case managers at La Casa meet regularly with residents to assess their needs. Individuals in the program have an active voice in their individualized service plans. We empower participants to connect with their needs, while supporting and guiding them through the process of rebuilding their lives.\n\nLa Casa is locally funded by the District of Columbias Department of Human Services and operated by Friendship Place. The 40-individual unit complex currently operates at 100 percent capacity, housing 40 individuals.','931886810745529','https://friendshipplace.org/programs-outreach/la-casa/',NULL,NULL,'Verified','929094559121639','You must be referred directly from the Department of Human Services (DHS), through DCs Coordinated Entry System.\n\nTuesday is by appointment only.',NULL,NULL,NULL,NULL,'1235107925689722','952322142188080,1042246873120846,803785847917866,1277898146406252',NULL,'1244888069012632,625195015492370','1152494666421051',NULL,NULL,NULL),(945,1307622731573519,'Street Outreach',NULL,1306699628219808,'SBY Street Outreach prevents and intervenes in incidents of community violence, specifically in Wards 5, 6, 7 and 8. This program provides services to young people and their families who are at high risk of becoming victims or perpetrators of violence. Our culturally competent approach includes street-based outreach and safe drop-in spaces in areas where violence is most acute, case management services, and special youth development activities.\n\nOur efforts are sustained through true community collaboration and partnership. Strong relationships with District agencies, resident councils at public housing projects and other key stakeholders are crucial and uniformly valued.','1083708956779513','https://www.sashabruce.org/programs/safehomes/street-outreach/',NULL,'plieber@sashabruce.org','Verified','929094559121639,637158405241810','Street outreach is conducted by the staff. If you want more information on this program, call or email.',NULL,NULL,NULL,NULL,'708588487667319',NULL,NULL,'877243931325915,883345659611536','626337120120757',NULL,NULL,NULL),(946,1311031611561841,'Peer Counseling',NULL,964889233755760,'DCCIL preserves its integrity as a grassroots organization by implementing peer support to achieve objectives set by the disability community itself. The value placed on peer support in the Independent Living Movement is paramount and unique, and the significance of a system that values the peer-to-peer relationship is often overlooked by a society that is accustomed to valuing the opinion of professionals and experts over the goals and needs of consumers.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(947,1314427687239600,'Pharmacy ',NULL,548126332764833,NULL,'619784806206149,1214132387827753','https://www.whitman-walker.org/pharmacy',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'933188481288490',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(948,1317451290347942,'COMMUNITY FOR CREATIVE NON-VIOLENCE (CCNV): FEDERAL CITY SHELTER',NULL,609227002779117,'Provides overflow beds for single men during hypothermia season, as well as continuous and ongoing transportation and support services to those without shelter.','1277910214924473','http://theccnv.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'730657096706420',NULL,NULL,NULL),(949,1332300140733520,'Youth Substance Abuse Prevention',NULL,883186000200856,'Assessments and basic education activities to delay the onset of experimentation with drugs and alcohol','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(950,1337570408700851,'Training Programs',NULL,872299181857178,'Offers job and professional training programs including:\n\n- Home Health Aide\n- Customer Service Training\n- A+ Computer Repair\n- Business Office Support Specialist with Microsoft Office Certification (BOSS/MOS)\n- Entrepreneurial Training Program\n- Family to Family\n- Work Readiness National Certification','644198517647426','https://www.oicdc.org/training-programs.html',NULL,NULL,'Verified','970915508638448','Info Sessions for all training programs are held at our Training Center located at 3016 Martin Luther King Jr., Ave, SE. at 9:45 AM every Monday and on the following Tuesday when there is a holiday on Monday.',NULL,NULL,NULL,NULL,'1329231011154165,940633061926387','1125054424161461,836900782822377',NULL,NULL,'592528015341160',NULL,NULL,NULL),(951,1342596886767460,'State Health Insurance Assistance Program (SHIP)','SHIP',855094084464049,'SHIP provides Montgomery County seniors and adults under 65 with long term disabilities with health insurance counseling, enrollment guidance and assistance and problem resolution for issues relating to Medicare benefits and other public and private health insurance sources. JCA holds the contract for SHIP, which operates out of its Rockville office.\n\nEducation and counseling is available on health insurance options and decisions, as well as fraud and abuse prevention in Medicare and Medicaid.\n\nStaff and trained volunteers are available to help with understanding Medicare  Part A, Part B, Part C and Part D. Assistance can range from help in selecting a Prescription Drug plan to eligibility for extra help in paying for Medicare.','924628911683577','https://accessjca.org/information-and-referral/',NULL,NULL,'Verified','637158405241810','To contact the SHIP program, call 301.255.4250. Visit the SHIP website for more information.',NULL,NULL,NULL,NULL,'1129800077806599','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(952,1348541466880314,'Legal Interpreter Project',NULL,1141864402494387,'Since few legal organizations in the Washington, D.C. metropolitan area have attorneys or staff members who speak Asian languages, the APALRC launched the Legal Interpreter Project (LIP) in the fall of 2001 to supplement its Helpline project. Through LIP, the APALRC recruits community members to go through a two-day training program on legal interpretation. The APALRC currently has a pool of 54 trained interpreters whose skills span 26 different Asian languages. Once a client is referred from the Helpline to a legal services organization, the APALRC is able to provide the client with a trained legal interpreter, thereby ensuring that language does not continue to present a barrier to services. The APALRCs legal interpreters have assisted with on-site interpretation for attorney-client meetings, interpretation via telephone, and translation of affidavits and other documents.','1264011549910449','https://www.apalrc.org/legal-interpreter-project/',NULL,NULL,'Verified','917725171609009','Once referred for services, you will be offered this service.',NULL,NULL,NULL,NULL,'1148564700806737','743786809520784',NULL,'884944905632896','1018319997039351',NULL,NULL,NULL);
